/*Table structure for table `logbook` */

DROP TABLE IF EXISTS `logbook`;

CREATE TABLE `logbook` (
  `id` bigint(20) unsigned NOT NULL AUTO_INCREMENT,
  `id_proposal` bigint(20) unsigned NOT NULL,
  `catatan` text COLLATE utf8mb4_unicode_ci NOT NULL,
  `tanggal` timestamp NOT NULL DEFAULT current_timestamp() ON UPDATE current_timestamp(),
  `biaya` bigint(20) DEFAULT NULL,
  `direktori_foto` varchar(255) COLLATE utf8mb4_unicode_ci NOT NULL,
  `lat_foto` varchar(255) COLLATE utf8mb4_unicode_ci NOT NULL,
  `long_foto` varchar(255) COLLATE utf8mb4_unicode_ci NOT NULL,
  `created_at` timestamp NULL DEFAULT NULL,
  `updated_at` timestamp NULL DEFAULT NULL,
  PRIMARY KEY (`id`),
  KEY `logbook_id_proposal_foreign` (`id_proposal`),
  CONSTRAINT `FK_logbook_proposal` FOREIGN KEY (`id_proposal`) REFERENCES `proposal` (`id`) ON DELETE CASCADE ON UPDATE CASCADE
) ENGINE=InnoDB AUTO_INCREMENT=94 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;

