/*Table structure for table `mahasiswa` */

DROP TABLE IF EXISTS `mahasiswa`;

CREATE TABLE `mahasiswa` (
  `id_pengguna` varchar(25) COLLATE utf8mb4_unicode_ci NOT NULL,
  `id_proposal` bigint(20) unsigned DEFAULT NULL,
  `ipk` double(4,2) NOT NULL DEFAULT 0.00,
  UNIQUE KEY `mahasiswa_id_pengguna_unique` (`id_pengguna`),
  KEY `mahasiswa_id_proposal_foreign` (`id_proposal`),
  CONSTRAINT `FK_mahasiswa_proposal` FOREIGN KEY (`id_proposal`) REFERENCES `proposal` (`id`) ON DELETE SET NULL ON UPDATE SET NULL,
  CONSTRAINT `mahasiswa_ibfk_1` FOREIGN KEY (`id_pengguna`) REFERENCES `pengguna` (`id`) ON DELETE CASCADE ON UPDATE CASCADE
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;

