insert  into `proposal`(id,lolos,judul,direktori,direktori_final,usulan_dana,abstrak,keyword,jenis_id,konfirmasi_tim,created_at,updated_at) values (5,0,'Fives (Tas Motif Cantik dengan Desain Casual)','17030214003 MIFTAKHUL JANNAH SETYORINI.pdf','17030214003 MIFTAKHUL JANNAH SETYORINI.pdf',6000000,'<p>Fives adalah usaha di bidang perdagangan. Menjual produk tas. Tas dengan perpaduan motif cantik dan desain casual yang anak muda banget. Dijual dengan harga terjangkau.</p>','pouch|fives |motif|motif cantik|totebag|slingbag',2,1,'2018-04-20 00:04:34','2018-07-20 20:00:09'),(9,0,'CABUK SETAN','16080314062 Cyntya Dwi Wahyuningtyas.pdf','16080314062 Cyntya Dwi Wahyuningtyas.pdf',5993500,'<p><span style=\"font-size: 10.5pt; font-family: Verdana, sans-serif;\">Cabuk Setan (Cabe Bubuk Rasa Setan)</span></p>\r\n<p><span style=\"font-size: 10.5pt; font-family: Verdana, sans-serif;\">Pengolahan Produk Lokal Cabai Bubuk sebagai Bisnis Inovatif bagi Mahasiswa.</span></p>\r\n<p>&nbsp;</p>\r\n<p><span style=\"font-size: 10.5pt; font-family: Verdana, sans-serif;\">Cabuk Setan merupakan produk makanan berupa bumbu dapur yang berasal dari cabai bubuk&nbsp;</span><span style=\"font-size: 11pt; font-family: Ebrima;\">yang memiliki kekhasan rasa dan membuat ketagihan. Cabai sendiri memiliki banyak manfaat bagi tubuh manusia diantaranya dapat mengontrol kadar kolestrol dalam darah, baik untuk sistem kekebalan tubuh, mengurangi risiko kanker usus besar dan sebagainya. Rumusan masalah dalam Program Mahasiswa Wirausaha (PMW) ini adalah menciptakan peluang bisnis dan tingginya minat konsumen pecinta pedas. Luaran yang diharapkan dapat terciptanya peluang usaha mandiri, karya yang kreatif, dan jiwa enterpreneurship.Metode yang digunakan dalam pelaksanaan dimulai dengan pencarian ide, penyusunan struktur organisasi dan tahapan pelaksanaan program mulai dari persiapa produksi, pelaksanaan produksi, pengemasan, promosi, kerjasama dengan mitra, dan evaluasi pelaksanaan program.</span></p>',NULL,1,1,'2018-04-20 07:46:50','2018-07-03 11:09:06'),(37,0,'HALO PAHLAWAN - WEB DESIGN AND DIGITAL MARKETING AGENCY','17051214008 Moch. Fachrudin.pdf','17051214008 Moch. Fachrudin.pdf',5000000,'<p>Halo Pahlawan - Web Design dan Digital Marketing Agency -. Kami melayani pembuatan desain web, Search Engine Optimization (SEO), desain grafis, hingga internet marketing. Kami percaya di era digital ini, setiap UMKM, korporasi maupun individu sangat membutuhkan website untuk menunjang daya saing antar korporasi. Dengan Harga bersahabat yang kami tawarkan, kami harap dapat membantu mereka untuk bersaing di era digital ini</p>',NULL,4,1,'2018-04-25 02:35:17','2018-07-04 00:52:23'),(43,0,'PITA RAPI','16010024035 FITRI AYU RUSDIANA.pdf','16010024035 FITRI AYU RUSDIANA.pdf',4000000,'<p class=\"MsoNormal\" style=\"margin-bottom: .0001pt; text-align: justify; mso-layout-grid-align: none; text-autospace: none;\"><span style=\"font-family: Ebrima; color: black;\">Minimnya pengolahan makanan dari bahan talas mendorong kegiatan usaha dengan memanfaatkan talas untuk dijadikan Pizza Talas. Pizza talas ini dibuat untuk mengangkat ekonomi daerah-daerah yang dapat berpotensi sebagai wilayahbudi daya Talas. Selain itu, menjadi salah satu inovasi bagi masyarakat dalam mengolah Talas, karena selama ini masih sedikit olahan dari bahan Talas baik ubi maupun pohonnya. Talas juga mengandung serat yang baik bagi pencernaan apabila dikonsumsi masyarakat. </span><span style=\"font-family: Ebrima;\">Pizza talas ini sangat cocok untuk dimakan di pagi hari untuk sarapan, atau jam makan siang, bahkan sebagai makan malam. Bisa dinikmati di sekolah, kampus, kantor, maupun di rumah. Pizza Talas ini akan dipasarkan secara direct selling dan online selling. Promosi Pizza Talas akan dilakukan secara langsung dan memanfaatkan sosial media sebagai media promosi yang akan cepat menyebar informasi.</span></p>',NULL,1,1,'2018-04-25 05:29:34','2018-07-07 04:43:00'),(54,0,'BUKOS (BUNGA KOL SEHAT) Inovasi Produk OlahanKesehatan Berbahan Dasar Bunga Kol','16050423002 JAROT DANANG PRIAMBODO.pdf','16050423002 JAROT DANANG PRIAMBODO.pdf',6500000,'<p class=\"MsoNormal\" style=\"text-align: justify;\"><span lang=\"IN\" style=\"font-family: Ebrima; color: black; background: white; mso-ansi-language: IN;\">Pada tahun 2016 s</span><span style=\"font-family: Ebrima; color: black; background: white;\"><span style=\"font-variant-ligatures: normal; font-variant-caps: normal; orphans: 2; text-align: start; widows: 2; -webkit-text-stroke-width: 0px; text-decoration-style: initial; text-decoration-color: initial; word-spacing: 0px;\">ebanyak 35% penduduk Jawa Timur lahir dalam kondisi pendek atau stunting(Jawa Pos, 2016). Se</span></span><span lang=\"IN\" style=\"font-family: Ebrima; color: black; background: white; mso-ansi-language: IN;\"><span style=\"font-variant-ligatures: normal; font-variant-caps: normal; orphans: 2; text-align: start; widows: 2; -webkit-text-stroke-width: 0px; text-decoration-style: initial; text-decoration-color: initial; word-spacing: 0px;\">hingga menjadikan Jawa Timur sebagai Provinsi pertama mengalami gizi buruk di Pulau Jawa dengan 19.1% dari</span></span><span style=\"font-family: Ebrima; color: black; background: white;\"><span style=\"font-variant-ligatures: normal; font-variant-caps: normal; orphans: 2; text-align: start; widows: 2; -webkit-text-stroke-width: 0px; text-decoration-style: initial; text-decoration-color: initial; word-spacing: 0px;\">568,482 kasus disusul</span></span><span lang=\"IN\" style=\"font-family: Ebrima; color: black; background: white; mso-ansi-language: IN;\"><span style=\"font-variant-ligatures: normal; font-variant-caps: normal; orphans: 2; text-align: start; widows: 2; -webkit-text-stroke-width: 0px; text-decoration-style: initial; text-decoration-color: initial; word-spacing: 0px;\">Jawa Tengah</span></span><span style=\"font-family: Ebrima; color: black; background: white;\"><span style=\"font-variant-ligatures: normal; font-variant-caps: normal; orphans: 2; text-align: start; widows: 2; -webkit-text-stroke-width: 0px; text-decoration-style: initial; text-decoration-color: initial; word-spacing: 0px;\">(Metro Tv, 2016).</span></span><span lang=\"IN\" style=\"font-family: Ebrima; color: black; background: white; mso-ansi-language: IN;\"><span style=\"font-variant-ligatures: normal; font-variant-caps: normal; orphans: 2; text-align: start; widows: 2; -webkit-text-stroke-width: 0px; text-decoration-style: initial; text-decoration-color: initial; word-spacing: 0px;\">Dengan demikian Jawa Timur</span></span><span style=\"font-family: Ebrima; color: black; background: white;\"><span style=\"font-variant-ligatures: normal; font-variant-caps: normal; orphans: 2; text-align: start; widows: 2; -webkit-text-stroke-width: 0px; text-decoration-style: initial; text-decoration-color: initial; word-spacing: 0px;\">juga</span></span><span lang=\"IN\" style=\"font-family: Ebrima; color: black; background: white; mso-ansi-language: IN;\"><span style=\"font-variant-ligatures: normal; font-variant-caps: normal; orphans: 2; text-align: start; widows: 2; -webkit-text-stroke-width: 0px; text-decoration-style: initial; text-decoration-color: initial; word-spacing: 0px;\">merupakan salah satu provinsi dengan masalah gizi buruk tertinggi di Indonesia. Hal ini dikarenakan masih minimnya minat masyarakat terhadap sayuran, salah satunya bunga kol.</span></span><span style=\"font-family: Ebrima; color: black; background: white;\"><span style=\"font-variant-ligatures: normal; font-variant-caps: normal; orphans: 2; text-align: start; widows: 2; -webkit-text-stroke-width: 0px; text-decoration-style: initial; text-decoration-color: initial; word-spacing: 0px;\">Bunga kol atau sering disebut dengan kembang ko</span></span><span lang=\"IN\" style=\"font-family: Ebrima; color: black; background: white; mso-ansi-language: IN;\"><span style=\"font-variant-ligatures: normal; font-variant-caps: normal; orphans: 2; text-align: start; widows: 2; -webkit-text-stroke-width: 0px; text-decoration-style: initial; text-decoration-color: initial; word-spacing: 0px;\">l</span></span><span style=\"font-family: Ebrima; color: black; background: white;\"><span style=\"font-variant-ligatures: normal; font-variant-caps: normal; orphans: 2; text-align: start; widows: 2; -webkit-text-stroke-width: 0px; text-decoration-style: initial; text-decoration-color: initial; word-spacing: 0px;\">merupakan salah satu jenis sayuran yang memiliki</span></span><span lang=\"IN\" style=\"font-family: Ebrima; color: black; background: white; mso-ansi-language: IN;\"><span style=\"font-variant-ligatures: normal; font-variant-caps: normal; orphans: 2; text-align: start; widows: 2; -webkit-text-stroke-width: 0px; text-decoration-style: initial; text-decoration-color: initial; word-spacing: 0px;\">berbagai macam kandungan </span><span style=\"font-family: Ebrima; color: black; background: white;\">seperti kalsium, fosfor, zat besi dsb, </span><span lang=\"IN\" style=\"font-family: Ebrima; color: black; background: white; mso-ansi-language: IN;\">yang dapat</span><span style=\"font-variant-ligatures: normal; font-variant-caps: normal; orphans: 2; text-align: start; widows: 2; -webkit-text-stroke-width: 0px; text-decoration-style: initial; text-decoration-color: initial; word-spacing: 0px;\">bermanfaat dalam</span></span><span style=\"font-family: Ebrima; color: #222222; background: white;\"><span style=\"font-variant-ligatures: normal; font-variant-caps: normal; orphans: 2; text-align: start; widows: 2; -webkit-text-stroke-width: 0px; text-decoration-style: initial; text-decoration-color: initial; word-spacing: 0px;\">untuk menjaga kesehatan tulang, otak, dan mencegah gangguan kardiovaskular.</span></span><span style=\"font-family: Ebrima; color: black; background: white;\"><span style=\"font-variant-ligatures: normal; font-variant-caps: normal; orphans: 2; text-align: start; widows: 2; -webkit-text-stroke-width: 0px; text-decoration-style: initial; text-decoration-color: initial; word-spacing: 0px;\">BUKOS merupakan sebuah inovasi usaha di bidang kuliner yang menghasilkan produk olahan kesehatan yang menggunakan bahan dasar sayuran berupa Bunga Kol yang dioalh menjadi 3 produk olahan yang menarik dan modern yakni puding cup yogurt, puding drink yogurt dan stick. Kami yakin produk yang kami tawarkan dapat berkembang dengan baik hal ini dikarenakan masih minimnya kompetitor di pasaran dan juga olahan BUKOS ini sangat mendukung bagi masyarakat yang peduli terhadap kesehatan. Konsumen dapat membeli produk kami melalui stand, personal selling, offline,online, hingga ke distributor. Mungkin untuk jangka pendek kami masih di sekitar daerah Surabaya dan juga sidoarjo. Untuk </span><span style=\"font-family: Ebrima;\">pendistribusian kita menggunakan jasa antar kirim barang </span><span lang=\"IN\" style=\"font-family: Ebrima; mso-ansi-language: IN;\">dan juga pengiriman dengan jasa karyawan di daerah surabaya</span><span style=\"font-family: Ebrima;\">.<span style=\"color: black; background: white;\"> Produk ke depan kita juga akan mengkombinasikan dengan buah-buahan dan juga akan membuat olahan nugget dari bunga kol. Berdasarkan perhitungan kami produk yang kami tawarkan akan mengalami break even point pada 3 kali produksi.</span></span></span></p>',NULL,1,1,'2018-04-25 12:23:12','2018-07-03 09:23:44'),(62,0,'SEWEL TERCYDUK (TERNYATA DICUIL YAHUT DAN MELEDUK)','16030654012 Putri Apriliyani.pdf','16030654012 Putri Apriliyani.pdf',6000000,'<p>SEWEL TERCYDUK (TERNYATA DICUIL YAHUT DAN MELEDUK)</p>\r\n<p>Sewel adalah cemilan merakyat khas Bangkalan. Berbahan tepung tapioka, udang yang disajikan dengan petis khas Madura. Sayangnya cemilan tersebut umumnya sebagai pelengkap hidangan rujak Madura dan dijual dengan harga yang sangat murah yaitu RP. 500,-/biji oleh karena itu kami ingin meningkatkan harga jual sewel dan memperkenalkan kuliner tersebut di luar Madura. Melalui PMW UNESA 2018 kami berharap sewel akan lebih terkenal dan disukai banyak orang. Dana yang kami ajukan sebesar Rp. 6.000.000,- dengan dana tersebut nantinya sewel diinovasikan isian dan kemasan agar lebih menarik dan menyesuaikan jaman. Terdapat 3 level isian cabai muncrat yaitu level buronan, level napi, level tikus dasi yang akan dikemas dengan cup coup yang kekinian. Bumbu petis Madura memiliki rasa dan aroma khas, kami akan menyediakan dua varian yaitu bumbu petis original dan pedas. Kami juga berkerjasama dengan masyarakat Bangkalan dalam proses produksi bahan mentah, kemudian proses selanjutnya hingga sampai pada konsumen akan dilakukan oleh kami. Target minimal penjualan adalah 35 cup dengan harga Rp. 6.000,- dan jika diakumulasi laba bersih yang diperoleh selama sebulan adalah Rp. 2.835.000,-.</p>',NULL,1,1,'2018-04-26 00:13:52','2018-07-20 09:55:21'),(76,0,'Komedi Get Cream (Kombinasi Gedi Nugget-Ice Cream)','17030244016 Nurul Fadilah.pdf','17030244016 Nurul Fadilah.pdf',6000000,'<p>Salah satu permasalahan yang tidak umum lagi dikalangan masyarakat adalah penyakit. Makanan dapat dikatakan sebagai sumber penyakit bagi manusia apabila dikonsumsi secara berlebihan. Kebiasaan seseorang mengkonsumsi makanan cepat saji yang menggunakan bahan pengawet, pewarna, pemanis, dan junk food dapat menimbulkan beberapa penyakit. Produk yang kami usulkan berjudul Komedi Get Cream (Kombinasi Gedi Nugget Ice Cream) merupakan sebuah produk yang terdiri dari nugget berisi keju dan tambahan es krim sebagai pemanis. Nugget dan es krim ini dibuat dengan tambahan daun gedi (Abelmoschus manihot) sehingga produk ini dapat dikhususkan sebagai makanan tinggi antioksidan. Alasan kami memilih produk Komedi Get Cream sebagai usaha karena merupakan produk makanan sehat yang bermutu tinggi mencegah penyakit kekurangan antioksidan. Selain itu, tidak membutuhkan bahan dan alat yang mahal serta lokasi usaha yang sangat strategis berpusat di Kota Surabaya menjadi potensi untuk mendukung usaha kami. Adapun tujuan dari usaha ini adalah menciptakan produk inovatif dalam menyongsong kedaulatan makanan sehat, menambah pengalaman dan ilmu pengetahuan kewirausahaan dalam melakukan kegiatan usaha, mewujudkan kesejahteraan pangan dalam memanfaatkan keanekaragaaman hayati di nusantara, menyongsong generasi ilmiah dalam khazanah pangan sehat masyarakat Indonesia, membudayakan semangat, sikap, perilaku dan kemampuan kewirausahaan di kalangan mahasiswa dan masyarakat yang mampu diandalkan.</p>\r\n<p></p>',NULL,1,1,'2018-04-26 04:55:10','2018-07-10 02:47:20'),(80,0,'KEPO (Kedelai Puding) Kombinasi Kesegaran Sari Kedelai dan Lembutnya Silky Puding','17080554044 yohana paramita.pdf','17080554044 Yohana Paramita.pdf',6500000,'<p>Di era modern ini banyak sekali masyarakat yang menggandrungi minuman kemasan dengan tampilan yang menarik khususnya pada kalangan remaja. Namun, terkadang minuman tersebut belum tentu memiliki kandungan nutrisi yang tinggi. Disini kami mencoba membuat minuman kemasan dengan tampilan yang menarik namun tetap kaya akan gizi.Kami memberi nama minuman ini KEPO (Kedelai Puding) Minuman ini merupakan kombinasi antara sari kedelai dengan silky puding. Kami memiliki penggunaan sari kedelai karena memiliki kandungan nutrisi yang tinggi dan untuk memperkaya serat kami menggunakan silky puding.Dengan berbagai kandungan nutrisi yang ada didalamnya minuman ini bukan hanya minuman kekinian saja tetapi juga minuman yang kaya akan nutrisi.</p>',NULL,1,1,'2018-04-26 06:25:23','2018-07-04 08:41:31'),(82,0,'Tas KOMO (Tas Sisa Kain Jok Mobil)','16040274086 Muhammad Akbar Kurniawan.pdf','16040274086 Muhammad Akbar Kurniawan.pdf',6500000,'<p><span style=\"font-size: 11.0pt; font-family: Ebrima; mso-fareast-font-family: \'Times New Roman\'; mso-bidi-font-family: Arial; mso-ansi-language: IN; mso-fareast-language: IN; mso-bidi-language: AR-SA;\">Tas ini dibuat dari bahan dasar sisa dan limbah bungkus jok mobil yang tidak terpakai. Berdasarkan data yang diperoleh bahwa penduduk dan kendaraan di Surabaya padat, sehingga banyak bengkel di Surabaya maka berimplikasi jumlah limbah bungkus jok lebih banyak. Cara memperoleh bungkus dilakukan dengan cara mendatangi bengkel-bengkel di Surabaya kemudian membeli sisa bungkus jok dengan harga murah. Pembuatan tas ini dilakukan oleh mahasiswa sendiri di tempat tinggalnya dilakukan selama tiga bulan mulai dari persiapan hingga pemasaran. Manfaat dari kegiatan ini yaitu akan menguarangi limbah dan dapat membantu masyarakat dalam membeli tas murah berkualitas bagus, apabila usaha ini dapat berkembang lebih baik, maka dapat menjadi lapangan pekerjaan bagi masyarakat untuk nilai penganguran.</span></p>',NULL,4,1,'2018-04-26 06:58:47','2018-07-03 21:03:46'),(85,0,'Liebesoya (Life Be So Enjoyable with Soya)','16020094034 Mas Uliatul Hikmah.pdf','16020094034 Mas Uliatul Hikmah.pdf',6000000,'<p class=\"MsoNormal\" style=\"line-height: 115%;\"><span lang=\"EN-ID\" style=\"font-family: Ebrima; mso-ansi-language: EN-ID;\">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;Liebesoya merupakan inovasi Sari Kedelai Premium yang disajikan dalam bentuk Ice Blend dengan pilihan 7 (tujuh) rasa. Rasa-rasa tersebut adalah </span><span style=\"font-family: Ebrima;\">Original Soy, Ginger Soy, Oreo Soy, Cocholate Soy, Vanila Latte Soy, Taro Soy, dan Cappucino Soy. Selain pada pilihan rasanya, Liebesoya semakin menarik dengan topping Bubble. Pilihan rasa tersebut beberapa diantaranya menggunakan bubuk instan yaitu pada rasa Oreo, Chocolate, Vanila Latte, Taro, dan Cappucino. Rasa Original Soy merupakan rasa Sari Kedelai tanpa penambahan rasa. Sedangkan Ginger Soy adalah penambahan Jahe pada proses produksi Sari Kedelai. </span></p>\r\n<p class=\"MsoNormal\" style=\"line-height: 115%;\"><span style=\"font-family: Ebrima;\">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;Liebesoya dikemas menggunaan Cup Plastik printing dengan brand Liebesoya agar menarik. Liebesoya dijual secara langsung pada booth minuman dengan mempertimbangkan tempat-tempat strategis. Booth minuman yang digunakan Liebesoya adalah Booth Minuman yang telah didesain menarik supaya pembeli tertarik. Selain itu promosi Liebesoya akan dilakukan secara online pada media sosial instagram sebagai media sosial Liebesoya yang paling utama serta secara offline dengan menyebarkan brosur dan dari mulut ke mulut. </span></p>\r\n<p class=\"MsoNormal\" style=\"line-height: 115%;\"><span style=\"font-family: Ebrima;\">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;Satu Bulan Liebesoya menargetkan penjualan sebanyak 30 cup sehari dengan total 900 cup selama 1 bulan. Liebesoya meraup keuntungan Rp 3.000,-/cup dari harga jual Rp 7.000,-/cup. Rumah Produksi utama Liebesoya berada di Jalan Pulo Wonokromo 140 D Surabaya. sistem penjualan Liebesoya dijual melalui booth. Dengan sistem penjualan yang praktis diharapkan dapat membuka cabang diberbagai kota seperti Sidoarjo, Gresik dan Malang.</span></p>',NULL,1,1,'2018-04-26 07:33:06','2018-07-08 01:21:02'),(87,0,'BALEKAMBANG (BolA LEle KAntong Mahasiswa BANGet)','16010644030 IKAMAYA SRIDARMA DEWI.pdf','16010644030 IKAMAYA SRIDARMA DEWI.pdf',6000000,'<p class=\"MsoNormal\" style=\"text-align: center; line-height: 115%; mso-layout-grid-align: none; text-autospace: none;\" align=\"center\"><strong style=\"mso-bidi-font-weight: normal;\"><span lang=\"EN-US\" style=\"font-family: Ebrima;\">RINGKASAN</span></strong></p>\r\n<p class=\"MsoNormal\" style=\"text-align: center; line-height: 115%; mso-layout-grid-align: none; text-autospace: none;\" align=\"center\"><strong style=\"mso-bidi-font-weight: normal;\"><span lang=\"EN-US\" style=\"font-family: Ebrima;\"></span></strong></p>\r\n<p class=\"MsoNormal\" style=\"text-indent: 36.0pt; line-height: 115%; mso-layout-grid-align: none; text-autospace: none;\"><span lang=\"EN-US\" style=\"font-family: Ebrima;\">Rata-rata konsumsi ikan di Indonesia lebih sedikit dari negara lain. Meskipun pada tahun 2017 konsumsi ikan masyarakat Indonesia sudah mengalami kenaikan daipada tahun sebelumnya tapi masih dirasa kura dibandingkan konsumsi ikan negara lain. Untuk meningkatkan konsumsi ikan kami memiliki inovasi untuk membuat inovasi makanan dari olahan lele yaitu <strong style=\"mso-bidi-font-weight: normal;\">BALEKAMBANG </strong>(BolA LEle KAntong Mahasiswa BANGet). Kami memilih lele sebagai bahan baku karena </span><span style=\"font-family: Ebrima; mso-ansi-language: IN; mso-bidi-font-weight: bold;\">lele </span><span lang=\"EN-US\" style=\"font-family: Ebrima; mso-bidi-font-weight: bold;\">meng</span><span style=\"font-family: Ebrima; mso-ansi-language: IN; mso-bidi-font-weight: bold;\">andung gizi yang baik untuk tubuh. Salah satunya kaya akan vitamin A, B1, dan asam lemak yang dapat digunakan sebagai obat malnutrisi, sebagai antipiretik (menurunkan demam), obat bisul, obat cacing, obat mimisan, beri-beri serta untuk penyakit kandung kemih.</span><span lang=\"EN-US\" style=\"font-family: Ebrima; mso-bidi-font-weight: bold;\"> Untuk menarik pelanggan kami membuat 5 varian rasa yaitu, <em style=\"mso-bidi-font-style: normal;\">Original, Ground Nut, Cheese, Green Chili, Black Pepper </em><span style=\"mso-spacerun: yes;\"></span>yang kemudian dikemas dalam satu kemasan yang menarik. Dalam satu kemasan terdapat 5 bola lele, dimana pelanggan dapat memilih varian rasa yang diinginkan. Untuk target pemasaran kami menarget</span><span lang=\"EN-US\" style=\"font-family: Ebrima;\"> masyarakat </span><span style=\"font-family: Ebrima; mso-ansi-language: IN;\">Surabaya</span><span lang=\"EN-US\" style=\"font-family: Ebrima;\"> semua jenis profesi, terutama pada masyarakat yang gemar makan olahan lele</span><span style=\"font-family: Ebrima; mso-ansi-language: IN;\"> di wilayah Surabaya dan sekitarnya serta tidak menutup kemungkinan di seluruh Indonesia</span><span lang=\"EN-US\" style=\"font-family: Ebrima;\">.</span></p>',NULL,1,1,'2018-04-26 08:08:51','2018-07-10 11:15:35'),(93,0,'SIMAGIZI Suroboyo (Siomay Semanggi Bergizi asli Suroboyo)','16010714074 Dewi Windasari.pdf','16010714074 Dewi Windasari.pdf',6500000,'<p class=\"MsoListParagraphCxSpFirst\" style=\"margin-left: 54.0pt; mso-add-space: auto; text-align: justify; text-indent: 18.0pt;\"><span style=\"font-family: Ebrima; mso-bidi-font-family: \'Times New Roman\';\">Indonesia memiliki banyak keberagaman suku, adat, budaya dan makanan di setiap daerahnya. Setiap kota pasti memiliki kuliner unggulan yang menjadi keunikan tersendiri di kotanya. Salah satunya kota Surabaya memiliki kuliner unggulan yang menggambarkan kekhususan dari kota itu sendiri. Makanan unggulan yang khas di kota surabaya salah satunya yaitu semanggi suroboyo. </span></p>\r\n<p class=\"MsoListParagraphCxSpLast\" style=\"margin-left: 54.0pt; mso-add-space: auto; text-align: justify; text-indent: 18.0pt;\"><span style=\"font-family: Ebrima; mso-bidi-font-family: \'Times New Roman\';\">SIMAGIZI Suroboyo merupakan inovasi usaha dalam bidang makanan yang memadukan kreasi siomay dengan sayur semanggi. Dalam hal ini semanggi suroboyo yang merupakan makanan yang sudah sangat legendaris di masyarakat kami inovasikan dengan paduan makanan siomay yang sudah sangat familiar diberbagai kalangan. Sehingga salah satu tujuan usaha ini yaitu untuk lebih mempopulerkan makanan khas kota Surabaya serta menjadi penyedia makanan sehat dan bergizi yang dapat dikonsumsi oleh berbagai pihak. Oleh karena itu, usaha ini dapat dikatakan sebagai usaha yang memiliki prospek yang bagus di kota Surabaya.</span></p>\r\n<p class=\"MsoListParagraph\" style=\"margin-left: 54.0pt; mso-add-space: auto; text-align: justify; text-indent: 18.0pt;\"><span style=\"font-family: Ebrima;\">SIMAGIZI Suroboyo merupakan jenis makanan inovasi baru dan belum memiliki daya saing, maka hal itu menjadi keunggulan tersendiri untuk prospek usaha kedepan. Untuk prospek pemasaran produk SIMAGIZI Suroboyo ini juga dapat disajikan sebagai kuliner atau <em>Coffe break</em> di tempat-tempat rapat (<em>meeting</em>), hotel, serta dapat dipasarkan di kegiatan-kegiatan kota Surabaya dan Pusat oleh-oleh.</span></p>\r\n<p></p>',NULL,1,1,'2018-04-26 09:53:30','2018-07-10 10:56:29'),(97,0,'BALI : Sarung Bantal Sablon Bergaya Motivasi','16010024062 Anisaul Indah Mutia Sari.pdf','16010024062 Anisaul Indah Mutia Sari.pdf',5500000,'<p>Bantal masuk dalam kebutuhan sekunder. Tapi siklusnya akan terus <span style=\"line-height: 1.3;\">berganti sehingga celah dalam usaha ini akan selalu ada karena sepertiga</span><span style=\"line-height: 1.3;\">hidup manusia umumnya dilewati dalam keadaan tidur. Kegiatan usaha </span><span style=\"line-height: 1.3;\">ini merupakan usaha pembuatan bantal sablon dengan desain yang unik</span><span style=\"line-height: 1.3;\">dan kreatif. Keunggulan dari produk ini yakni, sarung bantal</span><span style=\"line-height: 1.3;\">menggunakan kain katun yang ditambahkan desain yang berbeda dari</span><span style=\"line-height: 1.3;\">bantal biasa yakni dengan kata-kata motivasi seperti jangan lupa</span><span style=\"line-height: 1.3;\">berdoa sebelum tidur yang apabila melihat bantal sablon ini maka akan t</span><span style=\"line-height: 1.3;\">erlintas dibenaknya. Keunikan lainnya dari bantal ini adalah konsumen</span><span style=\"line-height: 1.3;\">dapat memesan desain sesuai keinginan. Berbeda dengan penjual lainnya</span><span style=\"line-height: 1.3;\">yang membeli bantal secara langsung yang artinya tidak dapat memilih</span><span style=\"line-height: 1.3;\">desain yang diinginkan. Bantal dengan ukuran 45 x 45 ini menggunakan</span><span style=\"line-height: 1.3;\">isian dacron yang empuk dan halus.</span></p>\r\n<p></p>','sarung bantal|sablon|motivasi',4,1,'2018-04-26 10:23:46','2018-07-04 00:39:54'),(99,0,'MILKY GREEN \"Beauty, Healthy, and Nutrition Drink\"','17050394060 Alim Akbar Romadlony.pdf','17050394060 Alim Akbar Romadlony.pdf',6000000,NULL,'susu|edamame|kacang hijau|low fat|minuman',1,1,'2018-04-26 10:58:09','2018-07-23 04:48:00'),(125,0,'Puding LEBAI (Legen Bikin Nagih)','16040274035 Muhammad Muchlisin.pdf','16040274035 Muhammad Muchlisin.pdf',5000000,'<p></p>\r\n<p style=\"margin: 0px 0px 16px; text-align: center; line-height: normal;\" align=\"center\"><strong><span lang=\"IN\" style=\"margin: 0px; font-family: Ebrima; font-size: 12pt;\">ABSTRAK</span></strong></p>\r\n<p></p>\r\n<p style=\"margin: 0px 0px 13.33px; text-align: justify;\"><span lang=\"IN\" style=\"margin: 0px; line-height: 115%; font-family: Ebrima; font-size: 12pt;\">Legen dan siwalan merupakan ciri khas makanan dari Kota Tuban. Legen dan siwalan di Tuban hanya dijual dalam bentuk apa adanya sebagai buah dan minuman legen dengan harga yang tentunya murah. Belum ada kreativitas untuk menaikkan nilai suatu produk dari legen dan siwalan itu sendiri. Padahal legen dan siwalan dapat diubah menjadi banyak varian bentuk makanan ataupun minuman untuk menambah minat daya beli masyarakat dan daya jual sehingga nilai dari inovasi produk itu sendiri akan meningkat.<span style=\"margin: 0px;\"> </span></span></p>\r\n<p></p>\r\n<p style=\"margin: 0px 0px 13.33px; text-align: justify;\"><span lang=\"IN\" style=\"margin: 0px; line-height: 115%; font-family: Ebrima; font-size: 12pt;\">Jenis olahan makanan yang akan kita hasilkan adalah<span style=\"margin: 0px;\"> </span>sebuah inovasi puding dengan memanfaatkan legen dan siwalan. Olahan produk ini<span style=\"margin: 0px;\"> </span>bernama Puding LEBAI (Legen Bikin Nagih) nama tersebut dipilih karena bahan utama yang digunakan untuk membuat puding ini berasal dari legen dan siwalan yang di campur dengan agar-agar, susu, gula sehingga membentuk suatu produk yang enak. </span><span lang=\"EN-GB\" style=\"margin: 0px; line-height: 115%; font-family: Ebrima; font-size: 12pt;\">Produk akan dikemas dalam </span><span lang=\"IN\" style=\"margin: 0px; line-height: 115%; font-family: Ebrima; font-size: 12pt;\">cup dengan</span><span lang=\"EN-GB\" style=\"margin: 0px; line-height: 115%; font-family: Ebrima; font-size: 12pt;\"> desain </span><span lang=\"IN\" style=\"margin: 0px; line-height: 115%; font-family: Ebrima; font-size: 12pt;\">yang </span><span lang=\"EN-GB\" style=\"margin: 0px; line-height: 115%; font-family: Ebrima; font-size: 12pt;\">menarik. </span><span lang=\"IN\" style=\"margin: 0px; line-height: 115%; font-family: Ebrima; font-size: 12pt;\">Makanan ringan yang bergizi ini dapat dikonsumsi oleh berbagai pihak dan kalangan.</span></p>\r\n<p></p>\r\n<p style=\"margin: 0px 0px 13.33px; text-align: justify;\"><span lang=\"IN\" style=\"margin: 0px; line-height: 115%; font-family: Ebrima; font-size: 12pt;\">Keunggulan dari produk ini adalah sebuah inovasi makanan bercita rasa lokal yang dikemas dalam bentuk modern sehingga dapat menaikkan harga jual dan menambah minat masyarakat untuk membeli produk tersebut. Hal lain yang menjadi sebuah keunggulan adalah produk ini mengangkat sumber daya alam dari daerah Tuban yang belum terjamah akan modernisasi dan juga belum ada kreatifitas sehingga legen dan siwalan terkesan biasa saja, dengan adanya produk ini tentunya akan menambah daya jual serta daya beli masyarakat sehingga keuntungan akan lebih tinggi dibanding sebelumnya. Dengan adanya inovasi ini juga dapat membantu petani siwalan dan legen untuk menambah produksinya sehingga dapat meningkatkan perekonomian mereka.</span></p>\r\n<p></p>\r\n<p style=\"margin: 0px 0px 13.33px; text-align: justify;\"><span lang=\"IN\" style=\"margin: 0px; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; font-size: 12pt;\"></span></p>\r\n<p></p>\r\n<p style=\"margin: 0px 0px 13.33px; text-align: justify;\"><span lang=\"IN\" style=\"margin: 0px; line-height: 115%; font-family: Ebrima; font-size: 12pt;\"><strong>Kata kunci</strong> : Inovasi, Legen, Puding, Siwalan.</span></p>',NULL,1,1,'2018-04-27 01:11:37','2018-07-11 11:38:39'),(129,0,'TUTONSI (Totebag Two Tone Multifungsi)','16020084036 Feby Rahmania Budiyani.pdf','16020084036 Feby Rahmania Budiyani.pdf',18000000,'<p><strong>ABSTRAK</strong></p>\r\n<p>Totebag merupakan salah satu jenis tas yang saat ini banyak diminati baik oleh kalangan muda maupun kalangan tua karena sifat praktis, sederhana, namun memberikan gaya atau nilai tambah pada penggunanya. Namun, pada kenyataannya totebag cenderung memiliki gaya yang monoton dengan bentuk sablon ataupun motif pada satu sisi saja. Hal ini mendorong keinginan dari kami untuk menginovasi jenis totebag yang ada di pasaran dengan menggunakan TuTonSi yang merupakan akronim dari Totebag Two Tone Multifungsi.</p>\r\n<p>Alasan kami ingin menginovasikan produk totebag karena kami ingin menawarkan nilai efisien dan unik pada pembeli. Seperti yang kita tahu bahwa totebag saat ini tidak memiliki perkembangan atau inovasi yang sangat signifikan, padahal, para pecinta totebag tengah menunggu inovasi produk tersebut dari waktu ke waktu. Totebag yang kami tawarkan ini memiliki nilai multifungsi dimana selain dapat digunakan sebagai tas, produk ini pun dapat digunakan sebagai dompet mini. Kemudian, inovasi two tone atau model bolak balik pun kami berikan agar produk kami berbeda dengan produk totebag padanya umumnya.</p>',NULL,4,1,'2018-04-27 01:44:23','2018-07-04 06:12:53'),(132,0,'TARASO STIK TALAS ANEKA RASA','16051214038 Ismail Romadhon.pdf','16051214038 Ismail Romadhon.pdf',6000000,'<p><span style=\"font-size: medium;\">Pada kesempatan di \"Program Mahasiswa Wirausaha\" , kami ingin menguji </span><span style=\"font-family: Ebrima,Ebrima; font-size: medium;\"><span style=\"font-family: Ebrima,Ebrima; font-size: medium;\">kemampuan dibidang wirausaha. Dengan adanya analisa peluang yang ada pada saat ini, disekitar tempat tinggal kami mencoba membuat produk yang telah ada. Namun kami mengembangkan dan memberikan inovasi pada produk yang telah ada tersebut. Ide yang kami akan kembangkan adalah mengenai produk talas. Dengan memberikan nama yang unik, dengan begitu masyarakat akan tertarik dan merasa penasaran. Talas ini dibuat dengan proses digoreng dan menjadi stik talas yang lezat. Taraso nama yang kami berikan pada pengembangan produk kami. Taraso memiliki 6 varian rasa, yaitu coklat, oreo, matcha, bbq, keju dan balado. Harganya juga cukup terjangkau dan dapat dijangkau oleh konsumen, sehingga dapat dikonsumsi oleh masyarakat umum. </span></span></p>\r\n<p></p>',NULL,1,1,'2018-04-27 02:33:16','2018-07-24 17:08:37'),(137,0,'MEDIA KITA (Kreasi Indonesia Tanah Airku)','16010024032 Fidan Luthfullahi.pdf','16010024032 Fidan Luthfullahi.pdf',5000000,'<p class=\"MsoNormal\" style=\"text-indent: 36.0pt; line-height: 115%;\"><span style=\"font-family: Ebrima;\">MEDIA KITA (Kreasi Indonesia Tanah Airku) adalah jasa pembuatan media pembelajaran interaktif yang solutif, melalui aplikasi berbasis komputer/CAI (Computer Assisted Instruction). Dimana didalamnya bukan hanya ada materi teks saja. Namun materi yang interaktif lengkap dengan gambar, animasi, video serta musik. Selain itu terdapat juga latihan soal, simulasi, dan kuis edukasi.</span></p>\r\n<p class=\"MsoNormal\" style=\"text-indent: 36.0pt; line-height: 115%;\"><span style=\"font-family: Ebrima;\">Jasa ini menyesuaikan kebutuhan pelanggan serta penggunanya nanti, baik dari segi mata pelajaran, usia, dan tujuan pembelajaran. Harga yang kami tawarkan pun bervariasi, mulai Rp 300.000 hingga Rp 750.000, dengan berbagai macam jenis konten. Pelanggan nantinya dapat memesan melalui website, sosmed, maupun secara langsung.</span></p>\r\n<p class=\"MsoNormal\" style=\"text-indent: 36.0pt; line-height: 115%;\"><span style=\"font-family: Ebrima;\">Rencana kedepan akan membuat lebih banyak macam medianya (video, audio, dan mobile learning), serta pembuatan media khusus untuk anak yang berkebutuhan khusus.</span></p>\r\n<p style=\"text-indent: 48px;\"></p>',NULL,2,1,'2018-04-27 02:57:39','2018-07-22 01:02:10'),(152,0,'Say HI (Hidrogel Indonesia)','16020074094 Hendra Wahyu Hidayatulloh.pdf','16020074094 Hendra Wahyu Hidayatulloh.pdf',6000000,'<h1 style=\"text-indent: 36.0pt; line-height: normal;\"><span lang=\"IN\" style=\"font-size: 11.0pt; font-family: Ebrima; mso-ansi-language: IN; font-weight: normal;\">Program wirausaha ini bernama <em>Say HI</em> (Hidrogel Indonesia). <em>Say HI </em>merupakan usaha yang menggunakan produk hidrogel sebagai media alternatif merawat tanaman dalam ruang. Hidrogel berbentuk bulatan dan terbuat dari kristal polimer yang ramah lingkungan karena bahan penyusunnya yang ramah lingkungan, bersifat biodegradable. Oleh sebab ini produk ini memiliki keunggulan yang lebih dari media tanam lainnya. Beberapa keunggulan produk ini daripada produk yang lain adalah dengan pembentukan konsep yang dibuat semenarik mungkin, dimulai dari kombinasi warna dari hidrogel, wadah, dan tanaman yang digunakan serta slogan atau kata-kata sebagai sarana kampanye untuk kesadaran akan lingkungan. Mengapa Lingkungan? Seperti halnya yang kita tahu, bahwa lingkungan pada dekade ini sangat menghawatirkan sekali dan perlu adanya uluran tangan ikhlas seseorang untuk memperbaikinya. Dengan demikian kami rasa produk ini cocok digunakan pada hari ini dan masa-masa sekarang ini sebagai produk awal untuk mengkampanyekan lingkungan agar lebih baik dan lebih terawat.</span></h1>','hidogel|tanaman|lingkungan',4,1,'2018-04-27 03:46:03','2018-07-06 02:01:59'),(163,0,'TAMASYA (Tas Makrame Sylvia)','16010024043 Dahlia Sylviana Putri.pdf','16010024043 Dahlia Sylviana Putri.pdf',5500000,'<p class=\"MsoNormal\" style=\"text-align: center;\" align=\"center\"><strong style=\"mso-bidi-font-weight: normal;\"><span style=\"font-family: Ebrima; mso-ansi-language: IN;\">TAMASYA (Tas Makrame Sylvia)</span></strong></p>\r\n<p class=\"MsoNormal\" style=\"text-align: center; line-height: 115%;\" align=\"center\"><strong style=\"mso-bidi-font-weight: normal;\"><span style=\"font-family: Ebrima; mso-ansi-language: IN;\"></span></strong></p>\r\n<p class=\"MsoNormal\" style=\"line-height: 115%;\"><span style=\"font-family: Ebrima; mso-ansi-language: IN;\"><span style=\"mso-tab-count: 1;\"> </span>TAMASYA (Tas Makrame Sylvia) adalah produk tas yang menggabungkan fashion dengan seni atau kerajian simpul tali. Oleh karenanya bahan pembuatan Tamasya ini dari<span style=\"mso-spacerun: yes;\"> </span>tali kur. Tali kur memiliki tekstur yang tebal dan kuat sehingga ketika dijadikan tas akan<span style=\"mso-spacerun: yes;\"> </span>menjadikan tas tersebut kuat dan tahan lama. Keunikan dari tas ini yaitu terletak pada desain dan model yang bervariasi, bahkan pembelipun dapat memilih sendiri model dan desain sesuai keinginan. Produk ini juga masih jarang ditemui di wilayah Universitas Negeri Surabaya sehingga masih sedikit pesaingnya. Dengan desain dan model yang kekinian pengusaha optimis bahwa Tamasya ini dapat mendapatkan laba yang banyak. Tamasya memiliki ukuran yang bervariasi mulai dari kecil, sedang hingga besar.</span></p>',NULL,5,1,'2018-04-27 04:07:47','2018-07-08 11:09:07'),(170,0,'Javanese Zingiber Officinale and Cinnamon Cheesecake with corn oil sauce alami sebagai oleh-oleh khas Surabaya','16030654040 Dary Naufal Sujarwo.pdf','16030654040 Dary Naufal Sujarwo.pdf',6000000,'<p><strong><em>Javanese Zingiber Officinale and Cinnamon cheesecake with corn oil sauce</em> </strong>alami sebagai oleh-oleh khas Surabaya dimana jajanan tersebut menggunakan bahan-bahan alami yaitu toga sebagai campuran Zingiber Officinale and Cinnamon atau jahe dan kayu manis yang akan di campurkan dalam adonan roti, dengan demikian cheesecake ini memiliki nilai tambah dengan adanya campuran bahan yang kaya manfaat tersebut, kemudian cheesecake dilengkapi dengan vla yang mengandung corn oil, sehingga kaya akan vitamin dan kandungan bahan aktif yang dapat mencegah kanker dan radikal bebas.</p>',NULL,1,1,'2018-04-27 04:24:57','2018-07-21 01:12:19'),(181,0,'BORA-BORA (Bonggolan Rambutan)','17010714028 Ahmad Matinul Haq.pdf','17010714028 Ahmad Matinul Haq.pdf',4500000,'<p>Usaha kami bergerak di bidang produksi makanan dengan bahan-bahan produk lokal indonesia sebagai salah satu suply makanan pokok di indonesia. banyaknya makanan siap saji yang tersebar di indonesia membuat makanan ini yang dahulunya menjadi makanan andalan masyarakat kecamatan sidayu kabupaten gresik kini mulai sedikit menurun padahal makanan ini adalah olahan dari ikan dan tepung. nama makanan ini adalah Bonggolan. Bonggolan adalah makanan khas masyarakat kecamatan sidayu kabupaten gresik yang cukup terkenal. latar belakang terciptanya makanan ini karena adanya pemasokan yang lebih dari para petani ikan sehingga masyarakat membuat inovasi olahan ikan ini. namun kualitas dan kuantitas bonggolan yang di buat di masyarakat sidayu sangat sederhana dengan mempunyai 2 macam bonggolan dengan rasa pedas dan original dan kemasan yang terbuat dari daun pisang saja. dari inspirasi masyarakat tersebut kami membuat Inovasi usaha yang ingin kami wujudkan serta mendapatkan bimbingan lebih lanjut dari program PMW yaitu usaha di bidang industri makanan, yang akan memiliki prospek baik sampai masa yang akan datang yang berjudul BORA-BORA (Bonggolan Rambutan) yaitu olahan bonggolan yang kemudian dilapisi irisan kulit lumpia yang menyelimuti bagian luar bonggolan sehingga bonggolan tampil menyerupai buah rambutan. Rasa dari bonggolan rambutan akan lebih gurih dan akan kami padukan dengan saus spesial buatan kami. yang mana kami menciptakan makanan ini bertujuan membuat inovasi makanan. Bonggolan Rambutan ini untuk mengalihkan kebiasaan masyarakat yang terus konsumtif terhadap fast food, menjadi beralih ke Makanan yang mempunyai kandungan gizi yang terdapat pada ikan bandeng itu sendiri. Latar belakang terciptanya makanan ini karena adanya pemasokan yang lebih dari petani ikan sehingga masyarakat membuat inovasi olahan ikan. sehingga membantu pemerintah dalam memenuhi kebutuhan pangan masyarakat, selain itu dengan adanya inovasi ini, kami berharap masyarakat yang saat ini terbiasa dengan makanan siap saji dan praktis, beralih ke produk makanan yang kami olah ini dengan kemasan yang menarik, praktis, enak, dan tidak mengandung bahan pengawet, tentunya juga memiliki harga yang terjangkau. inovasi makanan ini dapat memberikan warna terhadap dunia kuliner indonesia dan mengangkat makanan ciri kas kabupaten gresik khususnya masyarakat kecamatan sidayu yang merupakan pelopor terciptanya makanan ini.</p>',NULL,1,1,'2018-04-27 05:19:48','2018-07-03 21:29:09'),(206,0,'Baby Macaron','16020084045 Gita Orchidea Nadira.pdf',NULL,6000000,'<p>Macaron merupakan kue kering yang berasal dari Prancis berbasis meringue yang terbuat dari tepung&nbsp; almond, putih telur dan gula bubuk. Macaron berbentuk bulat dan ditumpuk seperti sandwich dengan isian ganache. Tekstur luarnya renyah dan lembut didalamnya. Tampilannya menarik dengan warna-warn yang lucu menggemaskan. Macaron merupakan salah satu makanan pastry yang cukup banyak digemari masyarakat dari semua kalangan. Namun harganya yang mahal membuat masyarakat enggan sering untuk membelinya. Mereka merasa banyak makanan yang lebih murah dan memuaskan disbanding jika mereka membeli macaron. Maka dari itu meskipun rasanya yang enak, macaron jarang sekali dibeli oleh masyarakat, khususnya masyarakat menengah ke bawah.</p>\r\n<p>Oleh sebab itu kami menginovasikan macaron dengan rasa yang sama dan harga yang lebih murah. Kami menginovasikan mulai dari bentuk dan bahan baku yang digunakan. Jika biasanya macaron yang dijual di toko bakery atau pastry berdiameter 5 cm, kami membuat ukuran yang lebih kecil sekitar diameter 3 cm, karna dengan ukuran lebih kecil masyarakat tidak cepat merasa eneg dengan makanan manis yang satu ini. Selain itu dengan bentuk yang lebih kecil, macaron bisa terlihat lebih imut dan lebih menggemaskan. Inovasi lain adalah bahan bakunya. Alasan macaron ini dijual dengan harga mahal karna memang bahan bakunya sendiri sudah mahal, yaitu almond ground. Agar bisa di jual dengan harga yang lebih murah dengan kandungan yang tetap sama, kami mencampurkan separuh dari almond ground dengan kacang tanah asli yang sudah di sangrai agar menghasilkan tepung yang lebih banyak.</p>','Bisnis|Makanan|Macaron',1,1,'2018-04-27 08:40:37','2018-05-04 09:02:24'),(215,0,'Paludarium Back to Nature and Culture','16020114090 EKO ADI PRABOWO.pdf','16020114090 EKO ADI PRABOWO.pdf',5500000,'<p class=\"MsoNormal\" style=\"text-indent: 1.0cm; line-height: 115%;\"><span style=\"font-family: Ebrima;\">Usaha yang diusung berjudul Paludarium Back </span><span lang=\"IN\" style=\"font-family: Ebrima; mso-ansi-language: IN;\">t</span><span style=\"font-family: Ebrima;\">o Nature And Culture merupakan usaha yang bergerak di bidang produksi barang. Paludarium merupakan sebuah seni menghias akuarium yang di dalamnya menggabungkan tumbuhan di darat (<em style=\"mso-bidi-font-style: normal;\">epifit, </em>dan <em style=\"mso-bidi-font-style: normal;\">forest</em>) dengan tumbuhan di dalam air (<em style=\"mso-bidi-font-style: normal;\">aquatic</em>). Sedangkan, yang membedakan produk ini dengan produk lain sejenis terdapat pada dekorasi yang mengusung arsitektur kuno khas jawa atau daerah lain seperti miniatur candi atau gapura. Keunggulan dari usaha ini adalah dalam satu usaha dapat menghasilkan dua produk yang pertama paludarium yang kedua hasil budidaya tanaman hias <em style=\"mso-bidi-font-style: normal;\">aquatic</em>, <em style=\"mso-bidi-font-style: normal;\">forest</em>, dan <em style=\"mso-bidi-font-style: normal;\">epifit</em>. </span></p>\r\n<p class=\"MsoNormal\" style=\"text-indent: 1.0cm; line-height: 115%;\"><span style=\"font-family: Ebrima;\">Pemasaran usaha ini diutamakan diwilayah Sidoarjo-Surabaya. Dan tidak menutup kemungkinan keseluruh wilayah Indonesia karena dalam hal pemasaran menggunakan metode <em style=\"mso-bidi-font-style: normal;\">online shop & cod</em>, untuk hal promosi memanfaatkan dunia maya, sosial media, dan took <em style=\"mso-bidi-font-style: normal;\">online</em>. Dan juga akan merambah ke dunia pendidikan, karena usaha ini memuat semua tentang pelajaran Ilmu Pengetahuan Alam, dan juga beberapa ilmu lainya. </span></p>\r\n<p class=\"MsoNormal\" style=\"text-indent: 1.0cm; line-height: 115%;\"><span style=\"font-family: Ebrima;\">Selain itu, usaha ini memamerkan secara langsung di daerah yang sering dikunjungi oleh masyarakat. Dalam hal distribusi apabila dalam jangkauan produk dapat diantar ke pemesan secara langsung, namun apabila diluar jangkauan akan menggunakan jasa kurir dengan pengemasan tertentu agar tidak rusak. Untuk <em style=\"mso-bidi-font-style: normal;\">prospek</em> kedepan usaha ini sangatlah menjanjikan, karena semakin lama lahan bercocok tanam semakin berkurang, dengan adanya paludarium menjadi sebuah terobosan baru seni bercocok tanam tumbuhan hias didalam ruangan (<em style=\"mso-bidi-font-style: normal;\">indor</em>). Selain itu, usaha ini memiliki keuntungan yang besar dalam sekali proyek, karena tanaman <em style=\"mso-bidi-font-style: normal;\">aquatic</em>, <em style=\"mso-bidi-font-style: normal;\">epifit</em>, dan <em style=\"mso-bidi-font-style: normal;\">foest</em> harganya masih tergolong mahal.</span></p>',NULL,5,1,'2018-04-27 10:20:57','2018-07-04 11:09:16'),(228,0,'King Krawooo (Burger Nasi Krawu)','16020084005 Arifiany Dharmayanti.pdf',NULL,5215000,'<p class=\"MsoNormal\" style=\"text-align: center;\" align=\"center\"><strong><span lang=\"EN-US\" style=\"font-family: Ebrima;\">ABSTRAK</span></strong></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify; text-justify: inter-ideograph; text-indent: 36.0pt;\"><span lang=\"EN-US\" style=\"font-family: Ebrima; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">Masakan Indonesia</span><span class=\"apple-converted-space\"><span lang=\"EN-US\" style=\"font-family: Ebrima; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">&nbsp;</span></span><span lang=\"EN-US\" style=\"font-family: Ebrima; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">merupakan pencerminan beragam budaya dan tradisi berasal dari<span class=\"apple-converted-space\">&nbsp;</span></span><span lang=\"EN-US\"><a title=\"Kepulauan Nusantara\" href=\"http://id.wikipedia.org/wiki/Kepulauan_Nusantara\"><span style=\"font-family: Ebrima; color: windowtext; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; text-decoration-line: none;\">kepulauan</span><span lang=\"IN\" style=\"font-family: Ebrima; color: windowtext; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; text-decoration-line: none;\">. </span><span style=\"font-family: Ebrima; color: windowtext; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; text-decoration-line: none;\">Nusantara</span></a></span><span class=\"apple-converted-space\"><span lang=\"EN-US\" style=\"font-family: Ebrima; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">&nbsp;</span></span><span lang=\"EN-US\" style=\"font-family: Ebrima; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">yang terdiri dari sekitar 6.000 pulau dan memegang tempat penting dalam budaya nasional Indonesia secara umum dan hampir seluruh masakan Indonesia kaya dengan bumbu berasal dari rempah-rempah. Kekayaan rempah inilah yang membuat makanan tradisional Indonesia memiliki ciri khas tersendiri yang sulit untuk dilupakan kelezatannya. Sayangnya, masyarakat Indonesia seringkali enggan untuk membuatnya sendiri dirumah. Hal ini dikarenakan memasak makanan tradisional Indonesia seperti nasi gudeg dan nasi uduk membutuhkan banyak bahan dan menggunakan teknik teknik memasak tradisional yang cenderung membutuhkan waktu yang lama. Mereka terkadang lebih memilih makanan-makanan tersebut, tidak heran jika dimasa sekarang ini penjual masakan tradisional Indonesia seperti nasi uduk dan gudek mudah dijumpai di berbagai sisi jalan. Namun, banyak orang tetap berasumsi bahwa makanan tradisional tersebut tidak cukup praktis untuk dikonsumsi karena diperlukan beberapa waktu untuk memakannya. Hal ini mungkin tidak akan cocok untuk orang yang berada dalam kesibukan padat. Mereka terkadang diharuskan melakukan beberapa hal sekaligus dalam satu waktu.</span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify; text-justify: inter-ideograph; text-indent: 36.0pt;\"><span lang=\"EN-US\" style=\"font-family: Ebrima; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">Oleh karena itu, kami menginovasikan sebuah produk makanan tradisional yakni nasi krawu yang lezat namun sangat praktis untuk dimakan dimana saja dan kapan saja. &ldquo;King Krawooo&rdquo; merupakan nama dari produk makanan tradisional yang ingin kami kembangkan. Produk ini merupakan makanan tradisional terkenal dari kota Gresik, Jawa Timur yang telah memiliki banyak penggemar. Kelebihannya, produk ini kami buat dengan rasa makanan tradisional yang khas tetapi bergaya internasional <em>(modern)</em> karena disajikan dalam bentuk burger sehingga praktis untuk dimakan. Bahan dasar dari produk ini adalah daging sapi yang dibumbui dengan rempah-rempah pilihan sebagai perasa alami serta dilengkapi dengan macam macam poyah kelapa sebagai ciri khasnya. </span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify; text-justify: inter-ideograph; text-indent: 36.0pt;\"><span style=\"font-family: Ebrima; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">&nbsp;</span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify; text-justify: inter-ideograph; text-indent: 36.0pt;\"><span style=\"font-family: Ebrima; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">&nbsp;</span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify; text-justify: inter-ideograph; text-indent: 36.0pt;\"><span style=\"font-family: Ebrima; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">&nbsp;</span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify; text-justify: inter-ideograph; text-indent: 36.0pt;\"><span style=\"font-family: Ebrima; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">&nbsp;</span></p>\r\n<p><span style=\"font-size: 11pt; line-height: 115%; font-family: Ebrima; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><br style=\"mso-special-character: line-break; page-break-before: always;\" clear=\"all\" /> </span></p>\r\n<p class=\"MsoNormal\"><span style=\"font-family: Ebrima; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">&nbsp;</span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify; text-justify: inter-ideograph; text-indent: 36.0pt;\"><span style=\"font-family: Ebrima; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">&nbsp;</span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify; text-justify: inter-ideograph; text-indent: 36.0pt;\"><span lang=\"EN-US\" style=\"font-family: Ebrima; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">Tujuan dari inovasi yang kami lakukan ini adalah semakin melonjaknya minat masyarakat akan kelezatan nasi krawu. Selain itu, alasan kami membuatnya dalam bentuk burger adalah untuk menjawab permintaan masyarakat yang umumnya menyukai makanan tradisional namun mereka perlu menyisikan beberapa waktu untuk memakannya. Seperti yang kita tahu, bahwa burger sendiri merupakan makanan cepat saji yang praktis dan juga diminati segala kalangan. Kami berpikir bahwa membuat nasi krawu dalam bentuk burger akan menambah nilai praktis dan nilai jual produk sehingga produk ini dapat diminati banyak kalangan baik anak-anak, dewasa maupun orang tua.</span></p>\r\n<p>&nbsp;</p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify; text-justify: inter-ideograph; text-indent: 36.0pt;\"><span lang=\"EN-US\" style=\"font-family: Ebrima; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">Burger krawu yang kami kembangkan ini memiliki cita rasa yang lezat khas lidah masyarakat Indonesia. Hal ini dikarenakan daging yang kami olah merupakan daging kualitas baik dan dibumbui dengan berbagai rempah. Ditambah dengan sambal khas nasi krawu yang akan menambah cita rasa produk kami. Serangkaian nasi, daging dan sambal yang dibentuk menyerupai burger akan semakin menambah minat masyarakat untuk memakannya. Kami berharap dengan adanya produk &ldquo;King Krawooo&rdquo; ini dapat menyebar luaskan kuliner tradisional Indonesia dengan cara yang praktis untuk mengkonsumsinya.&nbsp;</span></p>','Makanan Tradisional|Nasi Krawu|Burger|Khas Gresik|Praktis',1,1,'2018-04-27 12:26:27','2018-05-04 05:16:24'),(240,0,'Sego Pring Mendoan Krispi (SPRING DORS)','16020104060 Dina Ainis Syifa\'.pdf',NULL,5000000,'<p>Usaha ini bergerak dibidang barang yang mengarah pada makanan. Dengan kami beri nama Spring Dors &ldquo;Sego Pring Mendoan Krispi&rdquo;. Makanan usaha kami merupakan inovasi dari nasi bungkus. Makanan ini berbahan nasi dicampur dengan sayuran dan menggunakan pengganti lauk yaitu dengan tempe. Bahan tempe tersebut sudah dalam 3 hari dan kemudian dimanfaatkan sebagai lauk yang sering di kenal orang dengan tempe mendoan. Tempe mendoan pada usaha ini kami inovasi menjadi mendoan krispi. Kemudian ditambah dengan varian sambal yaitu sambal rumput laut, sambal nanas, dan sambal belimbing sebagai pelengkap nasi dan dikemas dengan menggunakan besek yang terbuat dari anyaman bambu.</p>','Nasi|Makanan|Sayuran|Mendoan',1,1,'2018-04-27 21:53:43','2018-05-04 13:52:14'),(251,0,'The Amazing Shoes','16080314063 Sella Rodiana.pdf','16080314063 Sella Rodiana.pdf',6000000,'<p class=\"MsoListParagraph\" style=\"margin-left: 2.0cm; mso-add-space: auto; text-align: justify;\"><span lang=\"IN\" style=\"font-family: Ebrima; mso-bidi-font-family: \'Times New Roman\';\">Produk yang kami hasilkan ini berupa sebuah sepatu polos yang didesain atau dilukis dengan cat warna yang menjadi sepatu lukis. Jadi dalam proses pembuatan sepatu lukis ini juga terdapat prosedur dalam pembuatannya. Tujuannya yaitu agar sepatu lukis yang kami hasilkan memiliki kualitas dan kuantitas yang tinggi. Selain itu kami juga menerima pesanan sesuai dengan selera konsumen. Jadi kami akan selalu mengutamakan minat konsumen dengan cara mempercantik dan memperindah lukisan dengan bakat-bakat tangan yang kreatif, supaya konsumen tertarik dengan produk kami. Di samping itu, produk sepatu lukis ini sangat jarang ditemukan oleh karena itu hal ini menjadi peluang tersendiri bagi kami untuk menarik minat dan perhatian konsumen sebanyak mungkin. Karena peran konsumen sangat mempengaruhi perkembangan usaha kami,<span style=\"mso-spacerun: yes;\"> </span>apabila kepuasan konsumen kurang maka akan berdampak negatif terhadap pendapatan usaha sepatu lukis kami. </span></p>',NULL,4,1,'2018-04-27 23:40:58','2018-07-03 09:47:03'),(266,0,'Budidaya Pembesaran Benih Ikan Lele dan Pemanfaatannya untuk Pembuatan KELES (Keripik Lele Pedas)','16051214016 RADITYA EDHI PURWOKO.pdf','16051214016 RADITYA EDHI PURWOKO.pdf',6500000,'<p>Kami mengambil tema Budidaya Pembesaran Benih ikan Lele dari kecil hingga dewasa, yang kemudian kami produksi dan kelolah menjadi KELES (Keripik Lele Pedas)</p>',NULL,1,1,'2018-04-28 02:02:45','2018-07-03 11:04:07'),(269,0,'TAS BACANDANIK (Batik Cantik dan Unik)','16080314017 Nia Kurniawati.pdf','16080314017 Nia Kurniawati.pdf',5000000,'<p class=\"MsoNormal\" style=\"text-indent: 36.0pt; line-height: 115%;\"><span style=\"font-family: Ebrima; mso-ansi-language: IN; mso-bidi-font-weight: bold;\">Tas Bacandanik (Batik Cantik dan Unik) merupakan inovasi yang berbeda dari Tas pada umumnya. Keunikan dari produk kami adalah bisa digunakan secara bolak-balik, warna dan motif yang berbeda-beda. Tas dengan bentuk seperti ini dapat memberikan dorongan kepada konsumen untuk menjadi lebih ingin mengetahui produk kami. Produk ini kami kemas dengan sangat menarik. Saat ini, Tas Bacandanik sedang digemari oleh para remaja dari berbagai kalangan.</span></p>',NULL,4,1,'2018-04-28 02:51:20','2018-07-03 09:40:09'),(274,0,'\"DoemArts\"','16080314047 Shania Puspita Maharani.pdf','16080314047 Shania Puspita Maharani.pdf',5000000,'<p><span lang=\"EN-US\" style=\"font-size: 11.0pt; line-height: 150%; font-family: Ebrima; mso-fareast-font-family: Calibri; mso-bidi-font-family: \'Times New Roman\'; mso-ansi-language: EN-US; mso-fareast-language: IN; mso-bidi-language: AR-SA; mso-no-proof: yes;\">DoemArts adalah dompet yang memiliki 3 fungsi sekaligus yaitu bisa digunakan sebagai, kemudian bisa dijadikan dompet, tempat hp dan tas jinjing untuk kondangan. Yang unik dari produk kami yakni dari bahan bekas berupa daur ulang kertas semen yang divariasi serta dipadu padankan dengan berbagai bahan yang menambah nilai jual dan keunikan dari produk kami seperti dipadukan dengan kain jeans, bisa juga dengan kain kulit imitasi, serta berbagai jenis kain lainnya dan tak lupa accesoris untuk menambah keindahan dari produk kami ini.</span></p>',NULL,4,1,'2018-04-28 05:32:02','2018-07-10 01:37:53'),(279,0,'Media Logico Piccolo Kosakata Berbasis Psychowriting','16020074007 YASMIN NABILLA.pdf','16020074007 YASMIN NABILLA.pdf',5500000,'<p class=\"MsoNormal\" style=\"margin-left: 36.0pt; text-indent: 17.5pt; line-height: 115%;\"><span lang=\"IN\" style=\"font-family: Ebrima; mso-ansi-language: IN;\">Media pembelajaran </span><em style=\"mso-bidi-font-style: normal;\"><span style=\"font-family: Ebrima;\">Logico Piccolo</span></em><span style=\"font-family: Ebrima;\"> Kosakata</span><span lang=\"IN\" style=\"font-family: Ebrima; mso-ansi-language: IN;\"> berbasis Psychowriting merupakan produk media pembelajaran yang bergerak di bidang keterampilan khususnya keterampilan menulis yang bisa mengasah otak kanan dan otak kiri para peserta didik sesuai jenjang pendidikanya dan merupakan produk yang baru dan bermanfaat. Bagi pemesan yang menginginkan desain fotonya terdapat pada sampul buku, pemesan tinggal mengirim foto yang diinginkan lalu produsen yang akan mendesain, ataupun pemesan yang mengirimkan desainnya langsung juga bisa, sehingga buku tidak melulu didesain dari produsen. Produk ini juga bisa digunakan untuk belajar lebih mudah dan cepat memahami, bisa di buat kado kepada teman dengan desain yang unik dan lucu, seperti kado ulang tahun dengan tema buku bergambar ucapan selamat ulang tahun kepada yang bersangkutan, kado wisuda dengan foto atau identitas yang bersangkutan, dan masih banyak lagi. </span><span style=\"font-family: Ebrima;\">Karena produk media ini bersifat dinamis mengikuti perkembangan jaman, <em style=\"mso-bidi-font-style: normal;\">Logico Piccolo</em> menjadi salah satu yang digemari dikalangan remaja dan anak-anak kuliah sebagai bentuk mengikuti tren kekinian.</span></p>',NULL,4,1,'2018-04-28 10:26:52','2018-07-03 12:00:01'),(284,0,'DULANG (Dadar gULung pelANGi)','16050514028 MUCH. ADE DERMAWAN.pdf','16050514028 MUCH. ADE DERMAWAN.pdf',6000000,'<p>pada saat ini sudah saatnya para pemuda-pemudi indonesia bergerak aktif dan kritis dalam bidang wirausaha dikarena pasar bebas sudah berjalan sekitar satu setengah tahun lebih kita harus berani bersaing dengan wirausaha-wirausaha dari berbagai negara lain. dengan produk-produk unggulan yang sangat mudah masuk di indonesia ini kita harus berhati-hati lagi karena kebanyakan makanan dari luar negeri mengandung bahan pengawet yang berbahaya jika dikonsumsi berlebihan.</p>\r\n<p>dengan usaha jajanan tradisional ini memiliki tujuan untuk melestarikan dan memperkenalkan kembali hasil perkebunan dari kekayaan alam di indonesia, dengan inovasi yang saya lakukan. jajanan dadar gulung ini saya inovasikan mulai dari bebera varian rasa isinya dan warna kulitnya sebagaimana pada saat ini banyak digemari oleh pemuda-pemudi.</p>\r\n<p>sangat banyak sekali manfaat dari jajanan dadar gulung pelangi ini yang memiliki enam macam jenis isi da warna kulit. misalkan isinya kacang beras yang memiliki manfaat bagi tubuh kita untuk mencegah penyakit jantung dan mencegah tekanan darah,</p>\r\n<p>kata kunci:Pemuda-pemudi, Inovasi, Manfaat</p>',NULL,1,1,'2018-04-28 22:45:41','2018-07-12 03:05:23'),(286,0,'JAMES (JAMu Tradisional ES Krim)','17020504025 Melinda Dwi Saputri.pdf','17020504025 Melinda Dwi Saputri.pdf',10500000,'<p class=\"MsoListParagraph\" style=\"margin-left: 0in; line-height: 115%; tab-stops: 28.35pt; mso-layout-grid-align: none; text-autospace: none;\"><span lang=\"IN\" style=\"font-family: Ebrima; mso-ansi-language: IN;\">Aroma dan rasa daun beluntas yang menyegarkan membaur halus dengan es krim, membantu membuka pikiran, menghidupkan kembali semangat. JAMES: sebuah produk untuk menemukan kembali eksistensi jamu di Indonesia. Terinspirasi oleh kekayaan budaya dan kekayaan alam nusantara. Jamu bluntas pilihan dipadankan dengan citarasa es krim yang tidak asing lagi untuk menciptakan pengalaman mengonsumsi jamu tradisional untuk selera yang kontemporer.</span></p>\r\n<p class=\"MsoListParagraph\" style=\"margin-left: 0in; line-height: 115%; tab-stops: 28.35pt; mso-layout-grid-align: none; text-autospace: none;\"><strong><span lang=\"IN\" style=\"font-family: Ebrima; mso-ansi-language: IN;\"></span></strong></p>',NULL,1,1,'2018-04-29 05:13:51','2018-07-13 01:56:48'),(305,0,'Ona-Mayur','16080304035 Rizka Wahyu Candra Kirana.pdf','16080304035 Rizka Wahyu Candra Kirana.pdf',6500000,'<p class=\"15\" style=\"margin-left: 28.3500pt; text-indent: 14.2000pt; mso-layout-grid-align: none; text-autospace: none; line-height: 114%;\"><span style=\"font-family: Ebrima; font-size: 11pt; background-image: initial; background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: initial; background-repeat: initial;\">Ona-Mayur adalah inovasi makanan cup yang sehat, bebas MSG dan bahan kimia dan disajikan secara ergonomis (memiliki nilai keamanan, kenyamanan dan fleksibelitas) serta penyajiannya dengan cara diseduh. Isi kemasan Ona-Mayur terdiri dari bihun jagung kering, siomay (ikan dan sayur) goreng dan batagor, serta bumbu pelengkap (bubuk cabai, seasoning, minyak sayur , minyak wijen dan sayuran kering) yang disajikan dalam </span><em><span style=\"font-family: Ebrima; font-size: 11pt; background-image: initial; background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: initial; background-repeat: initial;\">paper cup </span></em><span style=\"font-family: Ebrima; font-size: 11pt; background-image: initial; background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: initial; background-repeat: initial;\">yang memenuhi persyaratan</span><em><span style=\"font-family: Ebrima; font-size: 11pt; background-image: initial; background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: initial; background-repeat: initial;\">food grade</span></em><span style=\"font-family: Ebrima; font-size: 11pt; background-image: initial; background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: initial; background-repeat: initial;\">. Bahan-bahan Ona-Mayur mampu bertahan selama 6 bulan.</span></p>\r\n<p class=\"15\" style=\"margin-left: 28.3500pt; text-indent: 14.2000pt; mso-layout-grid-align: none; text-autospace: none; line-height: 114%;\"><span style=\"font-family: Ebrima; font-size: 11pt; background-image: initial; background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: initial; background-repeat: initial;\">Sistem pemasaran utama yang digunakan dalam pemasaran produk adalah sistem pemasaran pasar online, sehingga sasaran konsumennya adalah seluruh masyarakat Indonesia baik kalangan menengah kebawah maupun menengah keatas. Selain itu Ona-mayur juga di distribusikan ke swalayan atau minimarket serta membuka stand di tempat-tempat yang ramai pengunjung seperti taman, tempat wisata dan lain-lain. Sedangkan untuk prediksi pengembangan usaha yaitu dengan system kemitraan yaitu bisnis waralaba, mengembangkan usaha Ona-Mayur sebagai Franchisee dan membuka lapangan pekerjaan untuk kaum difabel.</span></p>',NULL,1,1,'2018-05-01 11:49:42','2018-07-06 22:07:33'),(311,0,'Kosmeal (Aplikasi Katering Kos Online)','17051214030 Betzy Alimanda Ansori.pdf','17051214030 Betzy Alimanda Ansori.pdf',4500000,'<div class=\"WordSection1\">\r\n<p class=\"MsoNormal\" style=\"text-align: justify; text-indent: .5in; line-height: normal;\"><span style=\"font-size: 12.0pt; mso-bidi-font-size: 11.0pt; font-family: \'Times New Roman\',serif;\">Kosmeal merupakan suatu aplikasi katering makanan online yang didedikasikan khusus untuk anak kos. Data menunjukkan 77,9% dari mereka mengaku bahwa pola makannya tidak teratur. Tidak seperti mahasiswa yang hidup di rumah, makanan mahasiswa kosan tidak tersedia di tempat tinggalnya. </span><span style=\"font-size: 12.0pt; font-family: \'Times New Roman\',serif;\">Mahasiswa kosan membutuhkan sebuah layanan yang menyediakan makanan secara teratur di kosnya, dimana mahasiswa kosan tidak perlu keluar kos dan mencari makanan. Dengan pembayaran di awal, mahasiswa kosan tidak perlu mengkhawatirkan ketersediaan makanannya dalam sebulan kedepan, mereka juga tidak perlu memakan makanan instan yang kurang baik untuk kesehatan.</span><span style=\"font-size: 12.0pt; mso-bidi-font-size: 11.0pt; font-family: \'Times New Roman\',serif;\"> Kosmeal berniat untuk meningkatkan kesejahteraan anak kos, sehingga anak kos dapat merasakan layanan makan layaknya di rumah sendiri.</span></p>\r\n</div>',NULL,3,1,'2018-05-02 06:54:13','2018-07-06 00:07:47'),(347,0,'KUBALE','16081194061 Rizki Nadia R.pdf','16081194061 Rizki Nadia R.pdf',6000000,'<p class=\"MsoNormal\" style=\"text-indent: 36.0pt; line-height: 115%;\"><span lang=\"EN-US\" style=\"font-family: Ebrima;\">Semakin berkembangnya zaman dan teknologi maka semakin banyak inovasi-inovasi yang dilakukan sehingga semakin banyak persaingan oleh pihak-pihak tertentu, seperti<span style=\"mso-spacerun: yes;\"> </span>halnya dalam dunia usaha khususnya di bidang kuliner. Semakin banyak inovasi-inovasi yang dilakukan oleh produsen bisnis kuliner, membuat persaingan di bidang ini semakin tinggi. Hal ini<span style=\"mso-spacerun: yes;\"> </span>diperlukan ide dan kreativitas produsen dalam pelaksanaan usaha sehingga nantinya produk yang dihasilkan memiliki ciri khas atau keunggulan tersendiri. Namun tidak jarang dalam pelaksanaan bisnis kuliner tersebut agar mendulang kesuksesan dalam waktu singkat para produsen melakukan hal yang curang dengan menggunakan bahan yang tidak sewajarnya dan tidak menyehatkan. </span></p>\r\n<p class=\"MsoNormal\" style=\"text-indent: 36.0pt; line-height: 115%;\"><span lang=\"EN-US\" style=\"font-family: Ebrima;\">Melihat kejadian tersebut, kami melihat peluang untuk mencari inovasi baru melalui inovasi makanan yang menyehatkan dan tentunya dengan harga yang terjangkau, sehingga dapat dijangkau untuk semua kalangan terutama kalangan menengah ke bawah. Inovasi yang kami lakukan merupakan inovasi dari kue basah Pancake Durian yang kami rubah dengan varian isi menggunakan buah-buahan yang lain seperti buah pisang, buah mangga dan buah naga. Kami menggunakan buah-buahan tersebut karena buah tersebut memiliki banyak kandungan yang sangat baik bagi kesehatan dan tentunya mudah untuk dijumpai. Dalam proses pengolahan produk kami menggunakan bahan-bahan yang alami dan tidak memakai bahan pengawet buatan sehingga dalam mengkonsumsinya tidak perlu dikhawatir dan diragukan lagi. Dalam pengemasan produk, kami menggunakan mika atau wadah yang mudah dijumpai dan sederhana sehingga mudah untuk dibawa dan diperjualbelikan. Produk ini nantinya akan dipasarkan di sekitar kampus, dan akan diperluas lagi jangkauannya sampai ke masyarakat sekitar. Pemasaran yang kami lakukan juga melalui media online agar dapat membantu pemasaran produk kepada masyarakat sekitar lebih cepat dan mudah. Produk inovasi makanan ini bukan hanya sekedar makanan atau kue yang dapat mengurangi rasa lapar tapi juga makanan yang menyehatkan, enak dengan harga yang terjangkau.</span></p>',NULL,1,1,'2018-05-03 07:12:26','2018-07-03 10:13:09'),(363,0,'RU GIFT : Romantic and Unique Gift','17010714039 Muhammad Gading Priangga.pdf','17010714039 Muhammad Gading Priangga.pdf',6000000,'<p><span style=\"font-family: Ebrima; font-size: 11pt; font-variant-numeric: normal; font-variant-east-asian: normal;\">Trend yang memberikan hadiah di momen spesial untuk orang-orang<br /><span style=\"font-size: 11pt; font-variant-numeric: normal; font-variant-east-asian: normal;\">spesial sangat berkembang pesat abad 20 ini. Peluang usaha yang bisa diambil<br /><span style=\"font-size: 11pt; font-variant-numeric: normal; font-variant-east-asian: normal;\">dari trend ini adalah usaha industri kreatif akan mampu berkembang pesat dan<br /><span style=\"font-size: 11pt; font-variant-numeric: normal; font-variant-east-asian: normal;\">memiliki pasar yang luas di masyarakat. Hal tersebut lah yang membuat kami<br /><span style=\"font-size: 11pt; font-variant-numeric: normal; font-variant-east-asian: normal;\">untuk berinisiasi membuat usaha RU Gift : Romantic and Unique Gift ini.<br /><span style=\"font-size: 11pt; font-variant-numeric: normal; font-variant-east-asian: normal;\">Hadiah seperti boneka, bucket bunga, bunga, bucket snack dan hadiah<br /><span style=\"font-size: 11pt; font-variant-numeric: normal; font-variant-east-asian: normal;\">hadiah mainstream lainnya sudah lah marak di masyarakat, nah oleh karena itu<br /><span style=\"font-size: 11pt; font-variant-numeric: normal; font-variant-east-asian: normal;\">kami membuat usaha RU Gift : Romantic and Unique Gift ini dengan membuat<br /><span style=\"font-size: 11pt; font-variant-numeric: normal; font-variant-east-asian: normal;\">hadiah yang tidak mainstream dan memberi kesan menarik, keren, romantis yang<br /><span style=\"font-size: 11pt; font-variant-numeric: normal; font-variant-east-asian: normal;\">nantinya mampu menjadi alternatif hadiah yang bisa menjadi rujukan.<br /><span style=\"font-size: 11pt; font-variant-numeric: normal; font-variant-east-asian: normal;\">Peluang dan keunggulan yang kami miliki membuat kami yakin untuk bisa<br /><span style=\"font-size: 11pt; font-variant-numeric: normal; font-variant-east-asian: normal;\">bersaing di era global dan mampu mewujudkan tujuan program mahasiswa<br /><span style=\"font-size: 11pt; font-variant-numeric: normal; font-variant-east-asian: normal;\">wirausaha untuk mencetak lapangan-lapangan pekerjaan baru dan mencetak<br /><span style=\"font-size: 11pt; font-variant-numeric: normal; font-variant-east-asian: normal;\">wirausaha-wirausaha muda untuk membantu menambah devisa negara, karena<br /><span style=\"font-size: 11pt; font-variant-numeric: normal; font-variant-east-asian: normal;\">seperti yang dikatakan oleh prof. Ciputra yakni negara yang ingin memiliki tingkat<br /><span style=\"font-size: 11pt; font-variant-numeric: normal; font-variant-east-asian: normal;\">ekonomi yang tinggi, seyogyanya memiliki minimal 2% wirausahawan sedangkan<br /><span style=\"font-size: 11pt; font-variant-numeric: normal; font-variant-east-asian: normal;\">indonesia belum menyentuh 1% nya, dan kami berusaha untuk turut serta<br /><span style=\"font-size: 11pt; font-variant-numeric: normal; font-variant-east-asian: normal;\">berkontribusi dengan tangan kecil kami untuk impian besar indonesia.</span></span></span></span></span></span></span></span></span></span></span></span></span></span></span></span></span><br style=\"font-variant-numeric: normal; font-variant-east-asian: normal; line-height: normal; text-align: -webkit-auto; text-size-adjust: auto;\" /></span></p>',NULL,4,1,'2018-05-03 12:16:21','2018-07-10 05:20:52'),(367,0,'Magic Rain Cover : Pelindung Tas dari Hujan','16081194002 Rifky Faransyah.pdf',NULL,12018000,'<p class=\"MsoNormal\">magic rain cover merupakan sebuah pelindung tas dari hujan yang memiliki inovasi baru dimana bentuknya berbeda dengan pelindung tas biasanya, produk magic rain cover kami di bagian belakang kami beri tutup yang dilengkapi dengan perekat, dan kain yang kami pakai adalah kain parasit yang kualitasnya bagus, dan dilengkapi dengan packing yang simple, magic rain cover kami juga beraneka ragam warna. sasaran yang kami tuju adalah mahasiswa, pengendara motor, dan pejalan kaki. strategi pemasaran yang kami gunakan melalui media sosial sebab target yang kami tuju adalah kalangan muda. usaha kami memiliki prospek yang baik sesuai dengan anggaran dana yang kami paparkan.</p>','Magic |Rain |Cover',2,1,'2018-05-03 21:52:47','2018-05-04 07:49:42'),(369,0,'MEDIA PEH JAN ERAM BERBASIS PSYCHOWRITING','16020074130 NURUL FITRYA HILDAYATI.pdf','16020074130 NURUL FITRYA HILDAYATI.pdf',6000000,'<p class=\"MsoNormal\" style=\"margin-left: 35.45pt; text-indent: 36.0pt; line-height: 115%;\"><span style=\"font-family: Ebrima;\">Alasan produk Peh Jan Eram layak mendapatkan pendampingan usaha melalui PMW dikarenakan produk ini belum ada ,masih baru dan sedang booming atau tren di banyak kalangan, mulai dari pelajar hingga mahasiswa dimana persaingan juga masih cukup rendah sehingga pasar penjualan semakin luas dan mudah mendapatkan pelanggan. Disisi lain, Produk media ini adalah kebutuhan pokok dari pelajar dan mahasiswa terutama mahasiswa yang belajar bahasa asing, dengan desain yang unik serta dilengkapi dengan gambargambar yang dilengkapi dengan kosakata, pelajar akan semakin termotivasi dalam belajar. Selain itu juga dapat meningkatkan semangat belajar karena desain buku yang cantik dan menarik, serta kekinian sehingga pengguna Peh Jan eram akan senang membawa media kemanapun, sambil main sambil belajar, dan pastinya sangat bermanfaat.</span></p>',NULL,4,1,'2018-05-03 22:21:15','2018-07-03 12:03:52'),(381,0,'Kadoku','16040254030 Novia Rahmawati.pdf','16040254030 Novia Rahmawati.pdf',6000000,'<p>Usaha ini merupakan usaha yang berkecimpung dibadang barang. Usaha ini</p>\r\n<p>dilatarbelakangi oleh kebutuhan mahasiswa dan gaya hidup mahasiswa ketika</p>\r\n<p>menghadapi seminar proposal ataupun skripsi, dimana biasanya memberikan kado</p>\r\n<p>untuk temannya. Dari peristiwa ini tim kami memilki ide untuk membuat bisnis</p>\r\n<p>KADOKU. dimana dalam usaha ini pembeli bisa mendapatkan beberapa jenis kado</p>\r\n<p>hanya dengan satu alamat usaha. Di bisnis ini memudahkan pembeli untuk memilih</p>\r\n<p>jenis kado apa yang akan mereka pesan. KADOKU menawarkan empat jenis kado,</p>\r\n<p>kado itu yaitu gambar vektor, bucket jajan, bucket jilbab, bucket bunga yang bisa</p>\r\n<p>dipesan sesuai selera. Sasaran usaha kami adalah seluruh masyarakat yang ada di</p>\r\n<p>Surabaya, khususnya mahasiswa-mahasiswi yang ada di Surabaya. Jika usaha ini</p>\r\n<p>berkembang target usaha kami adalah meluaskan bisnis dengan menerima</p>\r\n<p>pesanan dari luar kota Surabaya. Selain itu jika bisnis ini berkembang kami akan</p>\r\n<p>mengembangkan bisnis ini dengan menambah varian KADOKU seperti souvenir</p>\r\n<p>gelas cantik karakter, bucket pohon, dll. Keungguulan bisnis ini adalah harga sesuai</p>\r\n<p>dengan budget yang dimiliki konsumen dengan bentuk yang ervariasi, kreatif, lucu,</p>\r\n<p>kemudian menginovasikan barang untuk dijadikan kado dengan bentuk dan</p>\r\n<p>pengemasan yang unik serta menarik yang efektif dan efisien bisa dipesan</p>\r\n<p>kapanpun dengan waktu yang cepat. Tantangan dalam usaha ini adalah banyak</p>\r\n<p>pesaingnya seperti online shop yang membuka usaha serupa terutama online shop</p>\r\n<p>yang telah memiliki brand/nama yang cukup terkenal di masyarakat.</p>',NULL,2,1,'2018-05-04 01:09:26','2018-07-20 07:13:23'),(382,0,'Vegetable Ball','16020084038 Fadilla Nur Rahmania.pdf',NULL,4200000,'<p>Vegetable ball merupakan pentol dengan campuran sayur yang di goreng menggunakan tepung panir dengan varian saus yang berbeda dengan harga yang terjangkau bagi seluruh kalangan</p>','pentol|sayur|bergizi',1,1,'2018-05-04 01:16:12','2018-05-04 06:48:36'),(383,0,'SIRCO BLEND (Sirsak Coconut Premium)','16080304019 Vina Nafila Zulfiana.pdf','16080304019 Vina Nafila Zulfiana.pdf',10500000,'<p class=\"MsoNormal\" style=\"text-indent: 36.0pt; line-height: 115%; mso-layout-grid-align: none; text-autospace: none;\"><span lang=\"IN\" style=\"font-family: Ebrima; mso-ansi-language: IN; mso-bidi-font-weight: bold;\">Produk kami sudah berjalan selama 4 (empat bulan).</span> <span style=\"font-family: Ebrima;\">Selama 4 (empat) bulan ini kami melakukan semua proses produksi mulai dari mencari bahan baku, hingga mengolahnya menjadi minuman buah asli, segar<span style=\"mso-spacerun: yes;\"> </span>dan kaya vitamin. </span></p>\r\n<p class=\"MsoNormal\" style=\"text-indent: 36.0pt; line-height: 115%; mso-layout-grid-align: none; text-autospace: none;\"><span style=\"font-family: Ebrima;\">Dalam satu hari kami dapat memproduksi 50pcs. </span><span lang=\"IN\" style=\"font-family: Ebrima; mso-ansi-language: IN;\">Untuk pembagian operasionalnya sendiri dibagi menjadi 2 (dua) sesi. Sesi I (satu) dilaksanakan </span><span style=\"font-family: Ebrima;\">Pukul 08.00  12.00 WIB</span> <span style=\"font-family: Ebrima;\">dengan menargetkan konsumen yang sedang dehidrasi dan membutuhkan minuman buah segar pada pagi hari sampai siang hari.</span><span lang=\"IN\" style=\"font-family: Ebrima; mso-ansi-language: IN;\"> Sedangkan sesi II (dua) </span><span style=\"font-family: Ebrima;\">Pukul 13.00  16.00 WIB</span> <span style=\"font-family: Ebrima;\">dengan menargetkan konsumen pada kuliah siang dimana cuaca Surabaya sedang pada suhu panas  panasnya dan konsumen yang membutuhkan minuman buah segar pada waktu tesebut.</span></p>\r\n<p class=\"MsoNormal\" style=\"text-indent: 36.0pt; line-height: 115%; mso-layout-grid-align: none; text-autospace: none;\"><span lang=\"IN\" style=\"font-family: Ebrima; mso-ansi-language: IN;\">SIRCO BLEND sendiri memiliki banyak vitamin karena terbuat dari buah asli, yaitu sirsak dan air kelapa muda yang mengandung karbohidrat, vitamin B1, vitamin B2, dan vitamin C dll. Selain kaya vitamin dan manfaat rasa dari SIRCO BLEND sendiri sangat </span><span style=\"font-family: Ebrima;\">enak, segar, alami, </span><span lang=\"IN\" style=\"font-family: Ebrima; mso-ansi-language: IN;\">dan tidak mengandung </span><span style=\"font-family: Ebrima;\">bahan pengawet, pemanis buatan, praktis, dalam setiap moment</span><span lang=\"IN\" style=\"font-family: Ebrima; mso-ansi-language: IN;\"> dan aman dikonsumsi untuk sehari hari.</span></p>\r\n<p class=\"MsoNormal\" style=\"text-indent: 36.0pt; line-height: 115%; mso-layout-grid-align: none; text-autospace: none;\"><span lang=\"IN\" style=\"font-family: Ebrima; mso-ansi-language: IN;\">Melalui</span><span style=\"font-family: Ebrima;\"> PMW ini kami berharap rencana pengembangan usaha kami </span><span lang=\"IN\" style=\"font-family: Ebrima; mso-ansi-language: IN;\">dengan menambah jumlah produksi dan memperluas jangkauan pasar dapat segerat terwujud serta </span><span style=\"font-family: Ebrima;\">Merk SIRCO BLEND</span><span lang=\"IN\" style=\"font-family: Ebrima; mso-ansi-language: IN;\"> dapat dikenal oleh masyarakat secara luas.</span></p>',NULL,1,1,'2018-05-04 01:16:22','2018-07-10 00:34:01'),(393,0,'Dre Sport Massage Services','16060484039 ANDRI ADI SAPUTRO.pdf','16060484039 ANDRI ADI SAPUTRO.pdf',5500000,'<p>Usaha Dre Sport Massage Services sangatlah menarik dan unik dan simpel dan usaha ini menghasilkan penghasilan yang lumayan menjanjikan. Keunggulan dari usaha ini adalah kita bisa bermafaat bagi kesehataan orang lain, dan juga kita bisa mendapatkan imbalan yang lumayan bagus. Saingan pekerjaan Dre Sport Massage Services kebanyakan ada di kota besar, itupun belum bisa merata semua. Karena Dre Sport Massage Services ini menggunakan ilmu anatomi, fisiologi dan biologis maka belum banyak orang yang tau, dan saya mengusulkan ini agara saya bisa mengembangkan ilmuan ini sebagai mana seorang yang berilmu untuk itu di kota kecil masih butuh waktu untuk mempromosikan dengan menggunakan ilmu yang jelas dan benar sesuai dengan SOP.</p>',NULL,2,1,'2018-05-04 02:50:38','2018-07-04 04:49:50'),(421,0,'Shampo Dauni','16040284052 NURUL AINI.pdf','16040284052 NURUL AINI.pdf',6000000,'<p>Shampo Dauni ini merupakan sebuah inovasi terbaru yang berasal dari daun kemangi dan juga beberapa tanaman herbal lainnya. sehingga dengan adanya produk ini dapat mengurangi pemakaian produk kecantikan dengan kadar bahan kimia tinggi. shampo ini lebih diperuntukan wanita berhijab yang notabennya tinggal di Surabaya yang memiliki suhu panas. hal tersebut dikarenakan dengan rambut yang terus tertutup jilbab setiap harinya dapat menimbulkan beberapa permasalahan pada rambut. selain itu pula untuk wanita usia 30 hingga 40 tahun juga dapat digunakansebagai bentuk pengurangan pemakaian produk berbahan kimia tinggi. adapun manfaat dari produk ini yaitu utamanya mengurangi rambut rontok, mengurangi gatal-gatal pada kulit rambut dan juga mencegah rambut beruban pada usia muda.</p>',NULL,5,1,'2018-05-04 09:16:04','2018-07-04 01:19:33'),(422,0,'Herbalidz','16080314081 Dyah Retno Ismiarti.pdf',NULL,5000000,'<p><span style=\"font-family: Ebrima;\">Herbalidz ini merupakan garam mandi yang terbuat dari Garam Epsom untuk dapat membantu menghilangkan atau sebagai rileksasi badan dalam menagani beberapa penyakit tubuh, terutama pegal linu dan stress. Produk ini bernama &ldquo;HERBALIDZ&rdquo; merupakan salah satu produk yang akan membantu anda untuk menghilangkan pegal-pegal karena terlalu seringnya beraktvitas.&nbsp;</span><span style=\"font-family: Ebrima;\">HERBALIDZ ini singkatan dari herbal hits. &ldquo;HERBALIDZ&rdquo; merupakan</span><span style=\"font-family: Ebrima;\">&nbsp;&nbsp;</span><span style=\"font-family: Ebrima;\">inovasi obat herbal tanpa bahan kimia untuk meringankan serta menghilangkan berbagai macam penyakit. Dan juga tentunya &ldquo;HERBALIDZ&rdquo; ini solusi kesehatan yang makin &ldquo;HIDZ&rdquo; dan mudah dikenali konsumen karna manfaat dan nama brandnya.</span><span style=\"font-family: Ebrima;\">&nbsp;</span></p>','garam mandi|bathsalt',5,1,'2018-05-04 09:18:03','2018-05-04 13:02:35'),(423,0,'Eth-Shawl','16020124050 Desi Kartika Pratiwi.pdf','16020124050 Desi Kartika Pratiwi.pdf',5000000,'<p class=\"MsoNormal\" style=\"margin-left: 1.0cm; line-height: 115%; mso-layout-grid-align: none; text-autospace: none;\"><em style=\"mso-bidi-font-style: normal;\"><span lang=\"EN-US\" style=\"font-family: Ebrima;\">Shawl</span></em><span lang=\"EN-US\" style=\"font-family: Ebrima;\"> (syal) merupakan produk fashion yang banyak dipakai dan diminati masyarakat. Syal saat ini sudah bergeser penggunaannya dari yang sekedar untuk menghangatkan tubuh menjadi <em style=\"mso-bidi-font-style: normal;\">fashion item</em> yang bisa dipakai pada kesempatan apapun. Eth-Shawl ini merupakan produk syal <em style=\"mso-bidi-font-style: normal;\">shibori </em>(jumputan) berbahan sifon sutra dan sifon biasa yang ringan dan <em style=\"mso-bidi-font-style: normal;\">fashionable</em>. Terdiri atas beragam warna dan motif yang unik. Perpaduan antara kain sifon sutera atau sifon yang lembut, ringan, berserat alami dengan warna yang kekinian menjadikan produk ini strategis untuk menjadi <em style=\"mso-bidi-font-style: normal;\">trend-setter</em>. </span></p>\r\n<p class=\"MsoNormal\" style=\"margin-left: 1.0cm; line-height: 115%; mso-layout-grid-align: none; text-autospace: none;\"><span lang=\"EN-US\" style=\"font-family: Ebrima;\"></span></p>\r\n<p class=\"MsoNormal\" style=\"margin-left: 1.0cm; line-height: 115%; mso-layout-grid-align: none; text-autospace: none;\"><span lang=\"EN-US\" style=\"font-family: Ebrima;\">Dalam pembuatan produk ini kami menggunakan pewarna sintetis napthol. Pewarna napthol memiliki karakteristik baik mengikat warna, cocok untuk bahan kain apapun, banyak pilihan warna, dapat diatur sesuai keinginan, tidak mudah luntur, aman digunakan (<em style=\"mso-bidi-font-style: normal;\">low irritation</em>) serta memiliki karakteristik warna yang <em style=\"mso-bidi-font-style: normal;\">vintage</em>. Sedang untuk bahan kain yang digunakan ada dua jenis yaitu sifon sutra dan sifon biasa. Yang cocok dipadu-padankan dengan setelan sehari-hari tanpa menunggu musim dingin.</span></p>\r\n<p class=\"MsoNormal\" style=\"margin-left: 1.0cm; line-height: 115%; mso-layout-grid-align: none; text-autospace: none;\"><span style=\"font-family: Ebrima; mso-ansi-language: IN;\"></span></p>',NULL,4,1,'2018-05-04 09:38:10','2018-07-24 02:02:51'),(431,0,'student camera slider','16010024039 windi setyawan.pdf','16010024039 windi setyawan.pdf',5500000,'<p>rel / slide kamera murah handmade dengan harga di bawah rata-rata</p>',NULL,4,1,'2018-05-04 10:57:49','2018-07-31 02:43:21'),(442,0,'Permen JEKO (Jelly Krokot)','16030194070 Rezi Ulya Fauziah.pdf',NULL,6000000,'<p class=\"MsoNormal\" style=\"text-indent: 35.45pt; line-height: 115%;\"><span style=\"font-family: Ebrima;\">Proposal ini bertujuan untuk mengajukan sebuah gagasan berupa pengolahan tanaman krokot menjadi makanan ringan yang disukai banyak kalangan berupa permen <em style=\"mso-bidi-font-style: normal;\">jelly</em> krokot. Tanaman krokot (<em style=\"mso-bidi-font-style: normal;\">Portulaca oleracea L.</em>) adalah tanaman yang tumbuh liar di lapangan dan dapat tumbuh di daerah yang berpasir dan tanah liat. Krokot ini dapat tumbuh meski kekurangan air dan memiliki sifat adaptasi yang baik terhadap lingkungan. Krokot merupakan tanaman yang dapat dikonsumsi sebagai masakan, obat herbal, dan juga bisa digunakan untuk tanaman hias karena keindahan bunganya. Kami memanfaatkan salah satu manfaat krokot sebagai obat herbal dengan mengolahnya menjadi permen <em style=\"mso-bidi-font-style: normal;\">jelly</em> yang disukai banyak kalangan.</span></p>\r\n<p class=\"MsoNormal\" style=\"text-indent: 35.45pt; line-height: 115%;\"><span style=\"font-family: Ebrima;\">Dengan adanya permen <em style=\"mso-bidi-font-style: normal;\">jelly</em> krokot ini, tumbuhan krokot yang sangat banyak tersebar di Indonesia dapat termanfaatkan. Dikalangan anak-anak permen <em style=\"mso-bidi-font-style: normal;\">jelly</em> juga sangat digemari. Akan tetapi, kebanyakan permen <em style=\"mso-bidi-font-style: normal;\">jelly</em> yang dijual dipasaran banyak mengandung bahan-bahan pengawet, sehingga tidak baik jika sering dikonsumsi. Dengan adanya permen <em style=\"mso-bidi-font-style: normal;\">jelly</em> krokot ini, anak-anak bisa mengkonsumsinya tanpa perlu khawatir akan bahaya pengawet seperti permen <em style=\"mso-bidi-font-style: normal;\">jelly </em>lainnya, tetapi anak-anak mendapatkan manfaat yang baik dari khasiat tanaman krokot itu sendiri. Permen jelly krokot ini nantinya akan kami jual dengan harga per kemasan Rp 15.000/120 gram.</span></p>','krokot|permen jelly',1,1,'2018-05-04 13:05:43','2018-05-04 13:27:42'),(446,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,1,'2019-02-18 17:48:56','2019-02-18 17:48:56'),(448,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,1,'2019-02-21 02:57:44','2019-02-21 02:57:44'),(449,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,1,'2019-02-21 15:59:14','2019-02-21 15:59:14'),(450,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,1,'2019-02-23 00:02:30','2019-03-14 03:36:06'),(452,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,1,'2019-02-24 00:55:37','2019-02-24 00:55:37'),(453,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,1,'2019-02-24 01:52:04','2019-02-24 01:52:04'),(456,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,'2019-02-26 22:18:06','2019-02-26 22:18:06'),(458,0,'POESAY (POEDING SAYUR UNTUK YANG TERSAYANG)','2019 16020154066 Muhammad Norman Aprizal.pdf','2019 16020154066 Muhammad Norman Aprizal.pdf',5000000,'<p class=\"MsoNormal\" style=\"text-align: justify; text-indent: 36.0pt;\"><span lang=\"IN\" style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; mso-ansi-language: IN;\">Sejak enam bulan yang lalu, kami telah </span><span style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\';\">melihat minat masyarakat yang cukup tinggi terhadap makanan cepat saji, </span><span lang=\"IN\" style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; mso-ansi-language: IN;\">oleh karena itu, kami</span> <span lang=\"IN\" style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; mso-ansi-language: IN;\">telah </span><span style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\';\">membuat sebuah produk makanan dengan konsep cepat dan praktis namun tetap menyehatkan dan sesuai dengan selera masyarakat. Produk makanan tersebut kami beri nama Poesay atau Poeding Sayur</span><span lang=\"IN\" style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; mso-ansi-language: IN;\"> untuk yang tersayang</span><span style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\';\">.</span></p>\n<p class=\"MsoNormal\" style=\"text-align: justify; text-indent: 36.0pt;\"><span style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\';\">Poesay akan dipasarkan dalam bentuk</span><span lang=\"IN\" style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; mso-ansi-language: IN;\"> pudding sayur dengan garnish buah yang segar dan dikemas dalam bentuk cup. Kombinasi antara agar  agar bubuk, susu serta sayuran berupa bayam, wortel, jagung dan tomat </span><span style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\';\">merupakan bahan dasar yang kami gunakan</span><span lang=\"IN\" style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; mso-ansi-language: IN;\"> serta buah kiwi dan strawberi </span><span style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\';\">sebagai bahan pelengkap. Produk ini sangat menyehatkan karena tidak menggunakan bahan pengawet dalam pembuatannya.</span></p>\n<p class=\"MsoNormal\" style=\"text-align: justify; text-indent: 36.0pt;\"><span style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\';\">Latar belakang dari terciptanya produk ini adalah karena minat yang kurang dari masyarakat terutama anak-anak untuk mengonsumsi sayur-sayuran. Sehingga kami berusaha menciptakan produk yang dapat dinikmati masyarakat dan memenuhi kebutuhan vitamin mereka dalam bentuk</span><span lang=\"IN\" style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; mso-ansi-language: IN;\"> pudding sayur. Pudding merupakan makanan penutup </span><span style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\';\">yang diminati karena rasanya yang enak serta mengenyangkan.</span> <span style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\';\">Itulah alasan kami memilih pudding sebagai produk utama yang kami tawarkan. </span></p>\n<p></p>\n<p class=\"MsoNormal\" style=\"text-align: justify;\"><span style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\';\"></span></p>',NULL,1,1,'2019-02-26 22:30:39','2019-05-16 23:57:43'),(459,0,'PERCA CASE','2019 16080554037 Muhamad Iqbal Hutanto.pdf',NULL,7,'<p class=\"MsoNormal\" style=\"margin-left: 21.3pt; text-align: justify; text-indent: 36.0pt; mso-line-height-alt: 1.15pt;\"><span style=\"font-size: 12.0pt; font-family: \'Times New Roman\',\'serif\';\">Menjalankan usaha tidak mungkin setengah-setengah untuk memperoleh hasil yang maksimal. Untuk itu kami menyusun konsep usaha dengan semaksimal mungkin. Usaha ini adalah PERCA CASE yang ber tag line jadikan keren hapemu. Usaha ini adalah <em style=\"mso-bidi-font-style: normal;\">profit oriented</em>, tapi ada nilai baiknya yakni mencoba memaksimalkan limbah penjahit yakni berupa potongan kain yang tidak terpakai sehingga menjadi barang yang mempunyai fungsi guna<span style=\"mso-spacerun: yes;\">&nbsp; </span>yang lebih. Bahan yang ada cukup melimpah karena didapat dari penjahit atau tailor dan limbah kain tidak dimanfaatkan oleh penjahit serta biasanya dibuang atau dikubur ditanah. Untuk itu usaha ini memiliki peluang besar dengan bahan dasar yang mudah dijangkau. Dengan tag line yang kami usung berharap usaha ini menjadi usaha yang menjanjikan keuntungan dan kemaslahatan bersama. Sehingga dengan adanya usaha ini limbah penjahit dapat dimaksimalkan dan menambah nilai guna yang lebih tinggi.</span></p>','PERCA CASE|Limbah|Kain|Peluang',4,1,'2019-02-27 06:47:56','2019-03-15 02:26:27'),(460,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,1,'2019-02-27 06:51:20','2019-02-27 06:51:20'),(461,0,'LBB \"LEB\"( Languange Education Building ) Peluang Usaha Melalui Bimbingan Belajar Yang Unggul Dalam Bahasa Inggris Dan Bahasa Arab.','2019 17040254073 Fenty masrifah.pdf',NULL,8380000,'<p>Lembaga bimbingan belajar adalah&nbsp; salah satu usaha di bidang jasa yang kini banyak dibutuhkan oleh masyarakat , karena praktis serta Efisien untuk memperbaiki masalah belajar siswa. Selain itu lembaga bimbingan belajar merupakan&nbsp; &nbsp;kegiatan yang dapat memberikan pengaruh untuk meningkatkan kualitas pendidikan di Indonesia . Lembaga bimbingan belajar mengarahkan siswa untuk meningkatkan kualitas diri siswa untuk meraih prestasi yang diharapkan. Didalam Lembaga bimbingan belajar siswa dapat meningkatkan mutu dan kualitas siswa.secara tidak lagsung lembaga&nbsp; bimbingan belajar juga ikut serta dalam upaya peningkatan sumber daya manusia (SDM) di Indonesia.Kami menghadirkan Lembaga bimbingan belajar \" LEB\" ( <em>Languange Education Building</em>) yang merupakan lembaga bimbingan belajar dengan mengunakan tiga bahasa yaitu : bahasa indonesia , bahasa inggris dan bahasa ara. Dalam proses pembelajaran lembaga bimbingan \" LEB\" menggunakan tiga bahasa untuk mempersiapkan siswa menuju ranah global yang makin hari tiada pembatas antar belahan dunia. Selain itu lembaga bimbingan belajar \"LEB\" memberikan pendampingan pada siswa mengenai penagganan masalah belajar yang dihadapi siswa, serta memberikan laporan setiap bulanya kepada orang tua atau wali peserta didik untuk mengenai perkembangan kognitif siswa.</p>','Lembaga bimbingan belajar|jasa|tiga bahasa|mengatasi masalah belajar|Languange Education Building',2,1,'2019-02-27 14:35:50','2019-03-14 22:18:44'),(463,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,1,'2019-02-27 21:37:23','2019-02-27 21:37:23'),(465,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,1,'2019-03-02 00:29:03','2019-03-02 00:29:03'),(467,0,'Bakali (Bakso Ikan Kakap Isi Lorjuk)','2019 17081194041 Fikri Irfansyah.pdf',NULL,6000000,'<p>Bakali merupakan kuliner inovatif yang menggabungkan dua kuliner yang berbeda, bakso yang berbahan dasar daging ikan kakap serta lorjuk. Produk ini sangat memberdayakan masyarakat, terutama di pesisir yang berporfesi sebagai nelayan, dengan harapan mampu menjadi salah satu ikon kuliner di Surabaya.</p>','Makanan|Bakso|Lorjuk|Ikan Kakap',1,1,'2019-03-02 02:52:48','2019-03-20 04:57:31'),(468,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,1,'2019-03-02 06:28:44','2019-03-02 06:28:44'),(469,0,'TAMAGOTCHI (Mocktail Manis dengan Botol Cantik Hias)','2019 17080574002 Novika Nur Rohmah.pdf',NULL,5171000,'<p>Produk kami yang merupakan bahan minuman yang disajikan dalam kemasan kekinian yang kami beri nama Tamagotchi atau mocktail manis dengan botol kaca hias. Meskipun tamagotchi dikenal masyarakat luas sebagai konsol game yang populer pada era 90\'an, oleh kami dibuat inovasi baru yaitu minuman yang selain menyegarkan juga unik. Maka dengan begitu masyarakat akan mudah mengingat produk yang kami buat melalui merk yang telah ada dengan jenis produk yang berbeda. Selain nama, serta tampilan yang unik, keunggulan lain dari tamagotchi ini adalah dapat di refill, karena ada 3 macam pemilihan kemasan minumannya sendiri yaitu dengan cup, botol tumblr, gelas kaca jar, sehingga ikut mengurangi penggunaan sampah.</p>','mocktail|tamagotchi|minuman segar',1,1,'2019-03-02 06:41:56','2019-03-20 02:33:39'),(470,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,1,'2019-03-03 12:38:54','2019-03-03 12:38:54'),(471,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,'2019-03-03 18:22:13','2019-03-03 18:22:13'),(472,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,1,'2019-03-04 00:55:43','2019-03-04 00:55:43'),(473,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,1,'2019-03-04 02:48:22','2019-03-04 02:48:22'),(474,0,'SANG BONEK LAPAN','2019 17040254083 Arista Maya Dewanti.pdf',NULL,13498000,'<p class=\"MsoNoSpacing\" style=\"text-align: justify; line-height: 115%; tab-stops: 14.2pt;\"><span lang=\"IN\" style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; letter-spacing: -.05pt; mso-ansi-language: IN;\">Dalam dunia kuliner, kita sudah tidak asing lagi dengan menu olahan pisang. Menu satu ini telah menjadi salah satu menu kuliner favorit di berbagai kalangan. Ada beberapa olahan yang menjadi trend dan menjadi dasar inovasi dari pisang. Diantaranya pisang coklat, pisang bakar, nugget coklat dan lain sebagainya yang kini dimodifikasi dengan berbagai bentuk sehingga menjadi bentuk olahan pisang model baru. Pisang mudah untuk diolah karena rasanya yang unik dan netral sehingga cocok untuk di mix and match dengan berbagai macam toping maupun saus. Pisang memiliki tekstur yang unik, lembut dan beraroma khas, sehingga diminati oleh semua kalangan, tak peduli tua, muda, maupun anak-anak, baik di mall, restoran, maupun warung pinggiran. </span></p>\n<p class=\"MsoNoSpacing\" style=\"text-align: justify; line-height: 115%; tab-stops: 14.2pt;\"><span lang=\"EN-ID\" style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; letter-spacing: -.05pt; mso-ansi-language: EN-ID;\"><span style=\"mso-tab-count: 2;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span>Selain memproduksi olahan pisang ini, tim penulis mengimplementasikannya menjadi program pengabdian masyarakat di Desa Gandusari, Kecamatan Gandusari, Kabupaten Blitar, Jawa Timur, yang mana desa tersebut memiliki potensi pisang yang pengolahannya masih menjadi makanan yang sudah pernah ada dan belum berinovasi. Makanan olahan pisang tersebut seperti pisang goring, kripik pisang, nugget pisang, pisang coklat, dan pisang keju. Oleh karena itu tim penulis berinisiatif untuk melakukan pemberdayaan masyarakat di Desa Gandusari, Kecamatan Gandusari, Kabupaten Blitar, Jawa Timur untuk membuat olahan pisang yang dicampur dengan selai pandan yang bernama Sang Bonek Lapan. Produk olahan ini merupakan sebuah inovasi baru di bidang kuliner dengan memanfaatkan pisang sebagai bahan utama yang kemudian dipadukan dengan selai pandan yang merupakan kearifan local di desa tersebut. Tim penulis memiliki program untuk mengajak masyarakat di Desa Gandusari terutama kaum perempuan untuk bersama-sama mengoptimalkan pengolahan pisang menjadi sebuah inovasi baru di bidang kuliner dengan harapan untuk memajukan perekonomian masyarakat dengan pemberdayaan perempuan di dalamnya. Agar perempuan di Desa Gandusari selangkah lebihi maju di bidang wirausaha, disamping bertani.<span style=\"mso-spacerun: yes;\">&nbsp; </span></span></p>','bonek |pisang|pandan|pengabdian',1,1,'2019-03-04 04:49:40','2019-03-14 20:32:27'),(476,0,'GAAS POL (Nugget talas nampol)','2019 16010664002 Nisa Rait.pdf',NULL,6124000,'<p>Nugget talas ini aman dikonsumsi untuk semua kalangan. terutama untuk anak autis sangat aman dikonmsumsi. nugget ini tanpa ada bahan pengawet dan terbuat dari produk yang premium</p>','talas|nugget',1,1,'2019-03-04 19:14:30','2019-03-14 03:14:38'),(477,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,'2019-03-04 22:30:04','2019-03-04 22:30:04'),(478,0,'BIT ONISHI (Bit Onigiri & Sushi)','2019 17010664004 Nurria Yasmein.pdf',NULL,3595000,'<p><span style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',serif; mso-fareast-font-family: Calibri; letter-spacing: -.05pt; mso-ansi-language: IN; mso-fareast-language: EN-US; mso-bidi-language: AR-SA;\">Usaha yang kami lakukan adalah produksi makanan yaitu onigiri dan sushi. Onigiri dan sushi yang akan kami produksi menggunakan <strong>beras berwarna ungu</strong>. Sedangkan onigiri yang akan kami buat memiliki beberapa variasi yaitu onigiri dengan taburan wortel, onigiri bertaburan nori dan onigiri bertaburan wijen hitam. Kami menggunakan <strong>buah bit sebagai pewarna ungu nasi</strong> yang akan dijadikan onigiri dan sushi. Digunakannya buah bit sebagai pewarna alami dan juga memiliki banyak manfaat salah satunya yaitu antioksidan.&nbsp;</span><span style=\"font-family: \'Times New Roman\', serif; font-size: 12pt; letter-spacing: -0.05pt;\">Kemudian, alasan kami untuk membuat usaha ini adalah dengan memasuki era millenial saat ini banyak anak muda yang menyukai budaya dari Negeri Jepang dan Korea. Makanan sushi dan onigiri merupakan makanan yang memiliki banyak peminat dari kalangan anak muda.&nbsp;</span><span style=\"font-family: \'Times New Roman\', serif; font-size: 12pt; letter-spacing: -0.05pt;\">Selain hal tersebut, kami sering mendengarkan keluhan teman-teman di kelas yang setiap pagi hampir tidak pernah sarapan. Maka dari itu, kami membuat produk ini untuk memenuhi kebutuhan pangan mahasiswa yang sehat dan bergizi guna menunjang kegiatan belajar mereka selama di perkuliahan.</span></p>','BIT ONISHI (Bit Onigiri & Sushi) yang banyak digemari oleh |BIT ONISHI (Bit Onigiri & Sushi) yang banyak digemari oleh kalangan anak muda yang menyukai budaya Jepang. Kemudian, makanan ini juga dibuat untuk memenuhi pangan mahasiswa saat belum sarapan.',1,1,'2019-03-04 23:02:42','2019-03-14 21:32:35'),(479,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,1,'2019-03-04 23:16:04','2019-03-04 23:16:04'),(480,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,1,'2019-03-04 23:55:32','2019-03-05 00:38:08'),(481,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,1,'2019-03-05 01:46:25','2019-03-05 01:46:25'),(482,0,'SAFRO (Sambal Frozen)','2019 17010024044 Nurul khanifah.pdf',NULL,7000000,'<p class=\"MsoNoSpacing\" style=\"text-align: justify; line-height: 150%; tab-stops: 14.2pt;\"><span style=\"font-size: 12.0pt; line-height: 150%; font-family: \'Times New Roman\',\'serif\'; letter-spacing: -.05pt; mso-ansi-language: IN;\">Usaha Makanan frozen sangat marak akhir &ndash; akhir ini dinilai karena ketahanan dan siap saja kapan saja dan dapat di simpan untuk beberapa hari kedepat dan penyajian yang cukup mudah, Kami memilih Sambal sebagaimana menu utama yang kita jual , karena orang indonesia sangat maniac dengan jenis makanan Pedas, dan sambal indonesia dikenal sangat lezat , Namun kali ini kita memadu padankan dengan beberapa lauk sehingga rasa dan varian yang dinikmati konsumen dapat menjadi daya tarik sendiri untuk mencoba dan tidak bosan dengan menu yang itu itu saja, Sambal yang kita produksi nantinya adalah sambal olahan yang mengandung sedikit kadar air yang membuat sambal dapat bertahan lama dan dapat disimpan di kulkas selama berhari hari dan cocok untuk koncumen mahasiswa / para pekerja kantoran supaya dapat dikonsumsi saat sarapan yang membutuhkan sesuatu yang instan dan hemat namun tetap lezat .<span style=\"mso-spacerun: yes;\">&nbsp; </span></span></p>','Sambal Frozen Ikan Cumi',1,1,'2019-03-05 02:57:59','2019-03-14 19:35:28'),(483,0,'KANIK (Kalung Manik Manik)','2019 17010024002 Hania Ayu Mediana.pdf',NULL,7000000,'<p class=\"MsoNoSpacing\" style=\"margin-left: 36.0pt; text-align: justify; line-height: 150%; tab-stops: 14.2pt;\"><span style=\"font-size: 12.0pt; line-height: 150%; font-family: \'Times New Roman\',\'serif\'; letter-spacing: -.05pt; mso-ansi-language: IN;\">Kegiatan usaha ini merupakan usaha pembuatan kalung yang berbahan dasar manik manik. Aksesoris kalung sudah tidak asing dikalangan masyarakat, biasanya sebuah kalung terbuat dari emas atau logam berharga lainnya. Saat ini bahan yang digunakan untuk pembuatan kalung cukup beragam misalnya keramik, batu, kayu, mutiara dan manik manik. Manik manik sendiri merupakan perhiasan kecil berlubang yang terbuat dari bahan plastik. </span><span lang=\"EN-US\" style=\"font-size: 12.0pt; line-height: 150%; font-family: \'Times New Roman\',\'serif\'; background: white;\">Keindahan manik ini tergantung pada bahan yang dipakai, bentuknya, zat warna yang ditambahkan, keterampilan dan teknik pembuatannya.</span></p>\n<p class=\"MsoNoSpacing\" style=\"margin-left: 36.0pt; text-align: justify; line-height: 150%; tab-stops: 14.2pt;\"><span style=\"font-family: \'Times New Roman\', serif; font-size: 12pt;\">Produk yang akan dibuat dalam kegiatan ini adalah Kalung Manik dengan aneka warna. Kalung ini bermacam variasi, bisa dari kain polos, kain batik,</span><span style=\"font-family: \'Times New Roman\', serif; font-size: 12pt;\">&nbsp; </span><span style=\"font-family: \'Times New Roman\', serif; font-size: 12pt;\">kain bunga bunga dan lainnya.</span></p>','Kalung, Kalung Manik Manik, Manik Manik, Aksesoris, Perhiasan,',4,1,'2019-03-05 03:04:28','2019-03-14 15:51:25'),(484,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,1,'2019-03-05 06:54:00','2019-03-05 06:54:00'),(486,0,'TiLang BuBu (Plastik Daur Ulang Ibu-Ibu)','2019 17010024033 Sarah Yulian Andriani.pdf',NULL,12434000,'<p>Berawal dari kesenangan membuat barang yang unik dari bahan plastik bekas dengan mengkreasikan &nbsp;berbagai model dan bahan sesuai selera, orang-orang mulai menanyakan darimana membelinya? Padahal barang tersebut merupakan barang yang dibuat sendiri &nbsp;bukan hasil membeli dari orang lain.&nbsp;</p>\n<p>Dari sana mulai terpikir untuk memproduksi &nbsp;barang dengan sistem pre-order menggunakan desain-desain karya sendiri. Semakin kesini, permintaan produk mulai meningkat dengan ragam model dan &nbsp;bahan yang mereka inginkan (pesan) sendiri.&nbsp;</p>\n<p>Agar limbah plastik ini tidak terbuang percuma , ibu ibu disini mengolahnya menjadi suatu kerajinan. Dimana nantinya bisa berguna dan menghasilkan uang.&nbsp;</p>\n<p>&nbsp;</p>','Barang |Unik|Daur|Daur ulang|Plastik|Pemerintah |Mengolah|Uang |Ibu ibu|Kreatif|Kesenangan|Barang|Unik |Kreatif |Daur |Daur Uang |Daur Ulang |Limbah|Plastik |Ibu Ibu|Mengolah |Uang|Kerajinan|Berguna|Bekas|Desain|Model|Produksi|Karya',4,1,'2019-03-05 22:41:54','2019-03-14 13:48:38'),(487,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,1,'2019-03-05 23:10:49','2019-03-05 23:10:49'),(488,0,'LEMELLIA ART','2019 17080314051 Madinatul Munawaroh.pdf',NULL,6207000,'<p>Lemellia Art merupakan produk lukisan dari bahan dasar kertas (scrapframe) yang diimplementasikan dengan teknik quiling,&nbsp; teknik oshibana,&nbsp; dan teknik snowflake dan juga ditambah dengan aksen mutiara sehingga terlihat lebih indah dan ekslusif.&nbsp;</p>','LEMELLIA ART|LEMELLIA|ART|KREATIF',4,1,'2019-03-06 04:10:25','2019-03-15 06:50:18'),(489,0,'Morim Rainbow (Mochi Es Krim Pelangi)','2019 17010024077 Anisa Nur Kholifah.pdf',NULL,4190000,'<p>Usaha Morim Rainbow berawal dari keinginan untuk memberikan inovasi mengenai pengelolaan buah-buahan menjadi makanan yang digemari masyarakat. Kegiatan ini dapat melatih kemandirian mahasiswa untuk melakukan usaha secara nyata. Morim Rainbow tidak hanya enak dimakan tapi banyak kandungan gizi dari buah-buahan asli. Usaha ini tidak hanya menguntungkan bagi usaha Morim Rainbow sendiri, tetapi bagi pemasok buah juga menguntungkan karena dagangannya laku. Konsumen senang karena Morim Rainbow jajanan yang menyehatkan. Dengan adanya pendampingan usaha melalui PMW, diharapkan usaha Morim Rainbow dapat menjadi makanan yang sehat untuk dikonsumsi oleh masyarakat.</p>\n<p>&nbsp;</p>','Makanan|Mochi|Es krim|Morim Rainbow|Morim',1,1,'2019-03-06 04:45:05','2019-03-15 07:59:01'),(491,0,'TIMANI\' CASING BOOK','2019 17081194010 Mila Bistiana.pdf',NULL,6000000,'<p>Produk sampul binder berbahan kain dengan design yang unik dan menarik sehingga membuat tampilan binder menjadi lebih elegan. Dapat dimliki dengan harga yang terjangkau dengan kualitas terbaik. Binder menjadi baru tanpa harus membeli binder baru.</p>','sampul|binder|kain|unik|lucu|menarik',2,1,'2019-03-06 14:34:23','2019-03-20 04:22:37'),(492,0,'ORAA RIBET','2019 17030184097 Alifia Ilwi Agusty.pdf',NULL,8632000,'<p>ORAA RIBET (Organizer Bag Tanpa Ribet) merupakan salah satu jenis tas yang kami inovasikan untuk memberikan kemudahan ketika membawa banyak barang namun tetap ingin terlihat rapi dengan desain meemiliki banyak ruang. Tas ini dibuat dari kain anti air, busa polyfoam, dan kain perca yang mendukung program zero waste yang nantinya menjadi keunggulan dari produk kami. Tas ini sangat cocok untuk pelajar, mahasiswa, dosen dan karyawan yang ingin membawa barang namun tertata rapi. Peluang bisnis dengan desain yang kami ajukan ini cukup tinggi karena di Indonesia masih belum banyak yang memasarkan produk ini. Anggaran dana yang kami ajukan senilai Rp. 8.632.000,00.</p>','Tas|Organizer|zerowaste',4,1,'2019-03-06 14:57:24','2019-03-14 06:09:43'),(493,0,'JABARLISH ANTRI: Hijab Syar\'i Stylish Anti Ribet','2019 17081194016 ADELYA SHINTA MASHURI.pdf',NULL,8475000,'<p class=\"MsoNormal\" style=\"text-align: justify;\"><strong style=\"mso-bidi-font-weight: normal;\"><span style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\';\">Abstract: </span></strong><em style=\"mso-bidi-font-style: normal;\"><span style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\';\">JABARLISH ANTRI products are the latest hijab products today, with a trendy and stylish concept that makes the women who wear them increase their charm and confidence. In addition to the contemporary style, this hijab is designed to cover the chest, which means this hijab is syar\'i. Given the current trend of hijab, there are many women using syar\'i hijab. Seeing this situation is that many of our hijab syar\'i users offer hijab that still covers the body shape, but is not complicated in wearing it. So the products we make are easy to use because the hijab products we offer are instant, uncomplicated and comfortable to use.</span></em></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify;\"><strong style=\"mso-bidi-font-weight: normal;\"><span style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\';\">Abstrak: </span></strong><span style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\';\">Produk JABARLISH ANTRI merupakan produk hijab terbaru masa kini, dengan konsep yang trendy dan stylish membuat para wanita yang memakainya bertambah pesonanya dan percaya diri. Selain dengan gaya yang kekinian, hijab ini didesain menutupi dada, yang artinya hijab ini syar&rsquo;i. Mengingat trend hijab masa kini banyak wanita pengguna hijab syar&rsquo;i. Melihat keadaan tersebut yaitu banyak pengguna hijab syar&rsquo;i kami menawarkan hijab yang tetap menutupi bentuk tubuh, akan tetapi tidak rumit dalam memakainya. Maka produk yang kami buat ini mudah dipakai karena produk hijab yang kami tawarkan yaitu hijab instan tidak rumit dan nyaman dipakai.</span></p>','hijab syar\'i, stylish, tidak rumit',4,1,'2019-03-06 15:02:50','2019-03-17 06:24:23'),(494,0,'Tahu Ambyar: Pedasnya Bikin Keringat \'Ambyar-Ambyar\'!!','2019 17081194036 Sulistyo Wiky Aprianto.pdf',NULL,5843800,'<p><span style=\"font-size: 12pt; line-height: 18.4px; font-family: \'Times New Roman\', serif; position: relative; top: 0.5pt;\">&ldquo;Tahu Ambyar&rdquo; adalah sebuah usulan program wirausaha yang akan kami tawarkan, sejenis dengan jajanan &lsquo;rakyat&rsquo; yang sering disebut dengan &lsquo;Tahu Isi&rsquo; dengan sensasi sambal pedas yang akan membuat keringat &lsquo;ambyar-ambyar&rsquo;. Dalam produk ini, kami menawarkan sebuah perbedaan dari Tahu Isi pada umumnya, yaitu adanya tambahan isi tumis jamur disamping sayur-sayuran dan racikan sambal pedasnya.&nbsp;</span><span style=\"font-size: 12pt; line-height: 24px; font-family: \'Times New Roman\', serif;\">Untuk proses distribusi produk akan dilakukan dengan sistem Preorder dan direct sales yang kemudian akan tersedia pada stan kami di area studentpreuner UNESA dan untuk menjangkau konsumen yang lebih luas, kami juga membuka jalan distribusi melalui GOFOOD serta mempromosikan produk kami di area CarFreeDay Surabaya.</span></p>','makanan',1,1,'2019-03-06 15:08:27','2019-03-15 01:52:46'),(495,0,'Lawak Ice Cream','2019 17041344007 Mufatihatus Suroiya.pdf',NULL,14579000,'<p><em><span style=\"font-size: 12pt; line-height: 17.12px; font-family: Verdana, sans-serif; letter-spacing: -0.05pt;\">Lawak ice cream</span></em><span style=\"font-size: 12pt; line-height: 17.12px; font-family: Verdana, sans-serif; letter-spacing: -0.05pt;\">&nbsp;adalah bentuk usaha yang menawarkan keunikan yang tentunya berbeda dengan produk sejenis. Walaupun pada masa kini banyak sekali pengusaha yang membuat terobosan baru mengenai produk ice cream dengan bahan yang tidak lazim seperti ice cream timun maupun ice cream kemangi. Disini yang membedakan dari produk ini dengan produk sejenis yakni kita membuat bahan dasarnya dari limun khas Indonesia. Varian rasa yang ditawarkan juga akan unik dan berbeda dengan rasa&nbsp;<em>ice cream&nbsp;</em>pada umumnya.&nbsp;</span></p>','Kewirausahaan|Limun',1,1,'2019-03-06 15:09:29','2019-03-16 15:03:53'),(496,0,'Usaha Budidaya Pembibitan Lobster Air Tawar (EKLOBSTERFARM)  Skala Kecil','2019 17081194062 Feri Afdani.pdf',NULL,7734000,'<p>&nbsp;</p>\r\n<p style=\"margin: 0px; border: medium; text-align: justify; line-height: 150%; text-indent: -0.1pt;\"><span style=\"margin: 0px; color: black; line-height: 150%; font-family: \'Times New Roman\',serif; font-size: 12pt;\">EKLOBSTERFARM merupakan usaha budidaya lobster air tawar yang berfokus pada segmen pembibitan. Salah satu hal yang membedakan antara budidaya lobster air tawar dengan budidaya perikanan lainnya yakni budidaya lobster air tawar merupakan budidaya segmen pasar yang terbuka lebar karena kondisi budidaya lobster air tawar di jawa timur masih belum berkembang secara signifikan. Keunggulan dari kegiatan budidaya air lobster air tawar ini yakni biaya yang dikeluarkan untuk pakan lobster tergolong rendah karena lobster air tawar merupakan jenis crustasea yang omnivora. Sehingga jika dibandingkan dengan budidaya perikanan lainnya yang memerlukan pakan utama dari pakan pabrikan namun usaha budidaya lobster air tawar merupakan budidaya dengan estimasi pakan utama berupa sayur-sayuran atau hewan-hewan kecil<span style=\"margin: 0px;\">&nbsp; </span>(tauge, cacing tanah, umbi-umbian, dan keong sawah).</span></p>\r\n<p>&nbsp;</p>\r\n<p style=\"margin: 0px; border: medium; text-align: justify; line-height: 150%; text-indent: -0.1pt;\"><span style=\"margin: 0px; color: black; line-height: 150%; font-family: \'Times New Roman\',serif; font-size: 12pt;\"><span style=\"margin: 0px;\">&nbsp;&nbsp;&nbsp;&nbsp; </span>EKLOBSTERFARM sebagai usaha budidaya lobster air tawar merupakan salah satu solusi bagi ketergantungan pasar terhadap pasokan berupa lobster air laut yang jika diambil terus menerus maka akan ada kemungkinan kepunahan lobster. Selain itu pula besaran usaha budidaya berupa lobster air tawar di jawa timur saat ini masih tergolong rendah sehingga harga pasar bagi lobster air tawar di Jawa Timur masih tergolong tinggi. Dengan tumbuhnya usaha budidaya lobster air tawar di wilayah Jawa Timur ini diharapkan menjadi solusi agar harga pasar bagi lobster air tawar di Jawa Timur menurun dan dapat menjangkau masyarakat.</span></p>','Pembudidaya|Budidaya|Lobster|Lobster Air Tawar|Bibit|Pembibitan',5,1,'2019-03-06 15:24:00','2019-03-20 04:36:35'),(497,0,'PEKKUProduk Minuman Susu Jahe Aneka Rasa','2019 17081194018 Andriansyah Sulistyo Maulana.pdf',NULL,5775000,'<p class=\"Normal1\" style=\"text-align: justify; tab-stops: 14.2pt; border: none; mso-padding-alt: 31.0pt 31.0pt 31.0pt 31.0pt; mso-border-shadow: yes; margin: 0cm 0cm .0001pt 21.3pt;\"><strong><span lang=\"IN\" style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; mso-fareast-font-family: \'Times New Roman\'; color: black;\">PEK&rsquo;KU</span></strong><span lang=\"IN\" style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; mso-fareast-font-family: \'Times New Roman\'; color: black;\"> &ldquo;Produk Minuman Susu Jahe Aneka Rasa&rdquo; merupakan produk minuman berbentuk susu murni yang diberi campuran jahe dan memiliki berbagai varian rasa yang unik, menyegarkan, serta menyehatkan. </span><span style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; mso-fareast-font-family: \'Times New Roman\'; color: black; mso-ansi-language: EN-US;\">Penamaan PEK&rsquo;KU &ldquo;Produk Minuman Susu Jahe Aneka Rasa&rdquo; ini diambil dari bahasa jawa, PEK&rsquo;KU yang diartikan dalam bahasa Indonesia berarti Milikku. Kami berharap dengan adanya produk ini, para konsumen merasa untuk memiliki dan memberikan kesan yang menarik bagi konsumen. Produk ini memiliki lima varian rasa yang mengkombinasikan susu murni dan jahe sebagai bahan utama serta menambahkan perasa makanan untuk meningkatkan cita rasa tanpa menghilangkan khasiat utama rempah itu sendiri. Varian rasanya diantaranya adalah susu jahe original, coklat, kopi mocca, strawberry, anggur, dan melon.</span></p>','PEK\'KU|Produk olahan|Susu',1,1,'2019-03-06 15:31:25','2019-03-19 15:46:55'),(498,0,'KESEL (Cupcake Rosela)','2019 17081194083 SHINTA LINTANG NURILLAH.pdf',NULL,6000000,'<p>KESEL (Cupcake Rosela) adalah bisnis yang bergerak di bidang produksi makanan yaitu Cupcake yang berbahan dari Bunga Rosela. Alasan kami memilih bahan dari Bunga Rosela karena Bunga Rosela merupakan tanaman yang memiliki kandungan fitokimia yang berfungsi sebagai antidiabetes dimana Cupcake sendiri biasanya Cenderung dijauhi oleh penderita diabetes dikarenakan terlalu banyak mengandung gula. Selain itu Bunga Rosela dapat menjadi pewarna alami yang baik untuk tubuh. Dengan berbagai pertimbangan tersebut, maka kelompok kami memutuskan untuk membuat makanan yang menggunakan bahan-bahan alami yang ramah untuk tubuh.</p>','Cupcake|Cupcake Sehat|Cupcake Murah|Rosela|Cupcake Surabaya',1,1,'2019-03-06 15:32:26','2019-03-19 19:47:25'),(499,0,'CAICO (Kacang Ijo Coklat)','2019 17081194043 Faradella Harum Prasetyo.pdf',NULL,7000000,'<p class=\"MsoNoSpacing\" style=\"text-align: justify; line-height: 150%; tab-stops: 14.2pt;\"><span style=\"font-size: 12.0pt; line-height: 150%; font-family: \'Times New Roman\',\'serif\'; color: black; letter-spacing: -.05pt;\">Produk kami merupakan camilan roti yang memiliki keunikan tersendiri yaitu dengan mengutamakan kacang ijo kupas sebagai bahan bakunya dan memiliki bentuk yang unik seperti es krim ditambah stik es krim sebagai penyangga ketika dimakan serta tidak lupa lapisan luar yang berbalut coklat seluruhnya dan juga didalamnya terdapat coklat lumer, meski begitu tidak mengurangi rasa caico yang menyebabkan bosan atau eneg. Produk kami dikemas dalam mika plastic yang dilengkapi dengan stick es krim untuk pegangan jika hendak dimakan. Produk kami memiliki berbagai varian topping seperti keju, milo, strawberry,blueberry, kacang, dll.</span> <span style=\"font-size: 12.0pt; line-height: 150%; font-family: \'Times New Roman\',\'serif\'; color: black; letter-spacing: -.05pt;\">Manfaat usaha ini dimasyarakat adalah dengan adanya usaha ini diharapkan mampu memberi lapangan perkejaan bagi masyarakat, produk kami bisa dijadikan bisnis frozen food yang nantinya bisa dijadikan bisnis oleh ibu rumah tangga sehingga meskipun dirumah tetap berpenghasilan</span><span lang=\"IN\" style=\"font-size: 12.0pt; line-height: 150%; font-family: \'Times New Roman\',\'serif\'; color: black; letter-spacing: -.05pt; mso-ansi-language: IN;\">, </span></p>\n<p class=\"MsoNoSpacing\" style=\"text-align: justify; line-height: 150%; tab-stops: 14.2pt;\"><span lang=\"IN\" style=\"font-size: 12.0pt; line-height: 150%; font-family: \'Times New Roman\',\'serif\'; color: black; letter-spacing: -.05pt; mso-ansi-language: IN;\"><span style=\"mso-tab-count: 1;\">&nbsp;&nbsp;&nbsp;&nbsp; </span></span><span style=\"font-size: 12.0pt; line-height: 150%; font-family: \'Times New Roman\',\'serif\'; color: black; letter-spacing: -.05pt;\">Kondisi persaingan usaha dan prospek usaha dimasa yang akan datang kemungkinan untuk pesaingnya bisa banyak karena banyak beberpa produk camilan roti yang menambah variasi untuk bahan bakunya dan toppingnya, sedangkan untuk prospek usaha kemungkinan bagus karena produk kami dibutuhkan masyarakat, praktis, dan sesuai kantong mahasiswa/pelajar utamanya.</span></p>','Kacangijo |Cakelucu |Cakeenak |Cakesurabaya|Cakemurahsurabaya |Cakekacangijomurah',1,1,'2019-03-06 15:36:19','2019-03-19 19:46:41'),(500,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,1,'2019-03-06 15:50:21','2019-03-06 15:50:55'),(501,0,'CassaVa\'Vun','2019 17081194049 Shufiyyatin Aliyah.pdf',NULL,8895000,'<p>CassaVa\'Vun merupakan makanan yang berbahan dasar singkong yang disajikan dengan menarik sesuai dengan selera anak jaman sekarang. Sehingga memiliki kesan yang menarik tersendiri. Disini kami memperlihatkan kelebihan CassaVa\'Vun dengan makanan yang sejenis lainnya. Sehingga kami dapat masuk ke dalam Program Mahasiswa Wirausaha (PMW) ini.</p>','CassaVa\'Vun|Makanan|Singkong',1,1,'2019-03-06 15:55:25','2019-03-15 05:48:37'),(502,0,'Tell Mie Hot','2019 17081194081 Shafiya Aurelia Rachmawati.pdf',NULL,5000000,'<p>Usaha dalam makanan cepat saji atau fastfood merupakan usaha makanan yang sangat menjanjikan di era serba cepat seperti sekarang ini. Sehingga Tell Mie Hot bisa menjadi pilihan baru untuk makanan cepat saji bagi masyarakat .Penciptaan produk Tell Mie Hot ini menjadi hal yang bisa sangat membantu bagi masyarakat terutama masyarakat kota dan kalangan pelajar karena mereka memiliki kegiatan yang begitu padatnya,sehingga mereka melewatkan waktu untuk sarapan pagi. Dimana sarapan pagi merupakan faktor penunjang utama pada aktiftas manusia, karena dengan diawali sarapan pagi maka badan kita akan siap untuk menjalankan aktifitas pada satu hari penuh dikarenakan asupan makanan dipagi hari akan memberikan nutrisi kepada otak dan seluruh badan.serta manfaat sarapan pagi yaitu sebagai pencegah penyakit gastritis (maag) yang bisa mengganggu aktifitas manusia.</p>\n<p>Usaha pembuatan produk yang dimulai dari sebuah program kreativitas mahasiswa. kewirausahaan ini dikembangkan sebagai sarang untuk menumbuhkan jiwa kewirausahaan mahasiswa. Disamping itu , usaha ini juga dimaksudkan untuk member solusi bagi orang &ndash; orang yang menginginkan hidup sehat dan lebih produktif, menciptakan lapangan kerja baru serta membuka usaha pembuatan produk yang berorientasi sosial dan profit.</p>','1. Quick Breakfast|2. Fastfood|3. Tell Mie Hot',1,1,'2019-03-06 15:55:44','2019-03-17 07:00:35'),(504,0,'SIS (Sandwich Ice Cream Sayur)','2019 17081194033 Fauzan Bahamarianto Fajirin.pdf',NULL,8000000,'<p class=\"MsoListParagraphCxSpFirst\" style=\"margin-left: .25in; mso-add-space: auto; text-align: justify; text-indent: .25in;\"><span style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\';\">Sandwich Es Krim Sayur merupakan usaha yang bergerak di bidang pangan yang dikemas dalam bentuk makanan beku yang berbahan dasar susu dan sayuran yang dilapisi dengan roti. Dimana sandwich merupakan </span><span style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; mso-fareast-font-family: \'Times New Roman\';\">roti isi yang tepatnya makanan apapun terdapat dua atau lebih potongan roti yang berfungsi sebagai wadah untuk makanan jenis lain. Es krim merupakan makanan beku dari olahan susu yang memiliki beragam manfaat untuk tubuh yang dicampur dengan perasa dan pemanis, sehingga menghasilkan cita rasa yang enak. Sedangkan sayur, merupakan makanan kebutuhan yang sangat diperlukan oleh tubuh karena memiliki banyak vitamin di dalamnya. . Namun, sebagian mempunyai rasa yang tidak sedap. Sehingga, banyak orang yang tidak menyukai sayuran.</span></p>\n<p class=\"MsoListParagraphCxSpMiddle\" style=\"margin-left: .25in; mso-add-space: auto; text-align: justify; text-indent: .25in;\"><span style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; mso-fareast-font-family: \'Times New Roman\';\">Sandwich es krim sayur merupakan suatu kombinasi makanan dari olahan susu, santan dan sayur yang dibalut oleh roti tawar. Dimana kombinasi tersebut memiliki kandungan kaya akan nutrisi dan vitamin yang dibutuhkan oleh tubuh. Produk ini dikemas dengan menggunakan selembar kertas yang praktis dan ramah ligkungan, serta disajikan dengan tambahan berbagai macam toping seperti meses dan tentunya susu kental manis. Pengolahan produk makanan ini memiliki sejumlah keuntungan salah satunya meningkatkan konsumsi sayur.</span></p>\n<p class=\"MsoListParagraphCxSpLast\" style=\"margin-left: .25in; mso-add-space: auto; text-align: justify;\"><span style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\';\"><span style=\"mso-tab-count: 1;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span>Terbentuknya sandwich es krim sayur ini karena kita sebagai mahasiswa berfikir untuk dapat memanfaatkan sayuran yang sering dianggap sepele oleh sebagian banyak orang dengan alasan rasa yang kurang sedap. Oleh karena itu, kita memadukan makanan yang banyak disukai oleh semua kalangan baik dewasa maupun anak-anak yaitu dalam bentuk es krim dengan campuran sayur lalu dilapisi roti. Usaha ini tergolong dalam manufaktur karena kami mengolah bahan mentah seperti susu dan sayuran menjadi bahan jadi yaitu sandwich es krim sayur. Dengan adanya usaha sandwich es krim sayur ini kami juga membantu sektor peternakan dan perkebunan di Indonesia dimana bahan baku yang kami gunakan sangat melimpah di Negara kita yang tergolong Negara agraris. Serta terus melakukan pengembangan produk guna mencapai visi dan misi usaha kami.</span></p>','1. Ice Cream|2. Sayur|3. Camilan|4. Makanan|5. Dingin|6 SIS (Sandwich Ice Cream Sayur)|7. Sandwich|8. Sayuran|8 Desert',1,1,'2019-03-06 16:11:16','2019-03-18 17:15:35'),(505,0,'King of CODAS','2019 17081194061 Uswatun Kasanah.pdf',NULL,7000000,'<p><span style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; mso-fareast-font-family: Calibri; letter-spacing: -.05pt; mso-ansi-language: IN; mso-fareast-language: EN-US; mso-bidi-language: AR-SA;\">King of CODAS hadir sebagai <em>speacy food</em> yang menawarkan olahan corah pedas dengan berbahan dasar tepung terigu dan tepung tapioka. Olahan produk ini terdiri dari berbagai varian isi dan rasa. Produk ini memiliki banyak pilihan varian rasa isian seperti ayam-sayur, sosis-sayur, ayam sayur pedas, dan sosis sayur pedas. selain ini juga terdiri dari rasa keju, balado,sapi panggang, dan BBQ.&nbsp;</span><span style=\"font-size: 12pt; line-height: 18.4px; font-family: \'Times New Roman\', serif;\">Terdapat jenis original dan&nbsp;</span><span style=\"font-size: 12pt; line-height: 18.4px; font-family: \'Times New Roman\', serif; letter-spacing: -0.05pt;\">codas loreng (corah pedas telur goreng).</span><span style=\"font-size: 12pt; line-height: 115%; font-family: \'Times New Roman\', serif; letter-spacing: -0.05pt;\">&nbsp;Produk ini menimbulkan bentuk yang unik, kekinian,&nbsp; menyehatkan serta cita rasa yang berbeda dari yang lain sehingga mampu menarik minat pembeli. Harganya pun yang terbilang terejangkau.</span><span style=\"font-size: 12pt; line-height: 115%; font-family: \'Times New Roman\', serif; letter-spacing: -0.05pt;\">&nbsp;Prospek usaha King of CODAS ini bagus dikarenakan dapat memenuhi kebutuhan konsumen akan makanan pedas terutama untuk para remaja pecinta makanan pedas.</span></p>','King of CODAS industri makanan dan minuman|produk makanan|King of Codas|industri makanan dan minuman|makanan kekinian',1,1,'2019-03-06 16:15:17','2019-03-16 18:17:25'),(506,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,1,'2019-03-06 16:25:41','2019-03-06 16:25:41'),(507,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,1,'2019-03-06 16:28:26','2019-03-06 16:28:26'),(508,0,'GOCAMOJO (Goni Perca Mojokerto)','2019 17010664136 Mochammad Yoga Aditya Pratama.pdf',NULL,7000000,'<p>Gocamojo (Goni Perca Mojokerto) merupakan usaha yang memanfaatkan karung goni dan kain perca sebagai bahan utamanya. Produk ini memanfaatkan sisa kain perca yang melimpah di Mojokerto, sehingga mampu mengurangi limbah kain yang tidak terpakai. Produk yang dihasilkan yaitu keset, alas vas bunga, dan tas. Produk ini memiliki kualitas yang baik, kuat, dan ramah lingkungan. Waktu pengerjaan produk yaitu 3-7 hari. Produk yang dihasilkan tidak hanya memiliki nilai guna namun juga memiliki nilai estetika. Harga produk bervariasi sesuai dengan waktu pengerjaan dan tingkat kesulitan.</p>','Industri |Goni|Perca',4,1,'2019-03-06 17:07:35','2019-03-14 23:48:04'),(509,0,'Lampion Kerang (LARANG)','2019 17080314032 Dewi Sartika Rahayu.pdf','2019 17080314032 Dewi Sartika Rahayu.pdf',5000000,'<p class=\"MsoNormal\" style=\"text-align: justify; text-indent: .5in; line-height: 115%;\"><span style=\"font-size: 12.0pt; line-height: 115%;\">LARANG atau kepanjangan dari Lampion Kerang . Dimana suatu hasil kerajinan tangan berupa lampion yang berbahan dasar dari kulit kerang. Alamat usaha kami berada di Jl.Medokan Kampung RT 01 RW 02 Gg Buntu No 04, Kecamatan Rungkut Kota Surabaya. </span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify; text-indent: .5in; line-height: 115%;\"><span style=\"font-size: 12.0pt; line-height: 115%; mso-bidi-language: AR;\">Target pemasaran dari usaha ini cenderung masyarakat menengah kebawah sampai menengah keatas. Produk ini dijual dengan kisaran harga mulai dari Rp.95.000,- sampai dengan Rp.150.000-, Tergantung ukuran,bentuk,dan desainnya. </span></p>\r\n<p></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify; text-indent: .5in; line-height: 115%;\"><span style=\"font-size: 12.0pt; line-height: 115%; mso-bidi-language: AR;\">Untuk rincian dana yang kami usulkan yaitu sebesar Rp 5.500.000,- dengan penjualan 8 produk tiap bulan dan harga pokok penjualannya yaitu mulai dari Rp 95.000,-.</span></p>',NULL,4,1,'2019-03-06 18:18:27','2019-05-04 17:18:14'),(510,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,1,'2019-03-06 18:47:45','2019-03-08 21:31:50'),(511,0,'MINGBO (Minuman Ice Godong Bamboe)','2019 17010014045 Nur Habibullah.pdf',NULL,5040000,'<p>MINGBO(Minuman Ice Godong Bamboe)</p>\n<p>Mingbo merupakan minuman dari daun bambu, dimana kita mema faatkan daum bambu yang melimpah dimana sebelumnya hanya menjadi sampah ketika menjadi kering, mingbo merupakan produk yang terjangkau dengan harga yang murah khususnya bagi anak - anak sehingga dapat dinikmati semua kalangan</p>','MINGBO|Minuman|Godong',1,1,'2019-03-06 20:12:15','2019-03-15 03:58:54'),(512,0,'M\'BAZE [ Multi Blazer ]','2019 17080314089 Muhammad Rifqi Wahyudianto.pdf',NULL,6725000,'<p class=\"MsoNormal\"><span lang=\"EN-US\" style=\"font-size: 12.0pt; line-height: 107%; font-family: \'Times New Roman\',serif;\">M&rsquo;BAZE adalah sebuah<span style=\"background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"> produk inovasi yang merupakan bentuk modifikasi dari produk yang telah ada. Multi Blazer atau kami menyebutnya M&rsquo;BAZE&nbsp;</span></span><span lang=\"IN\" style=\"font-size: 12.0pt; line-height: 107%; font-family: \'Times New Roman\',serif; mso-ansi-language: IN;\">menawarkan</span> <span style=\"font-size: 12pt;\"><em><span lang=\"IN\" style=\"line-height: 107%; font-family: \'Times New Roman\', serif;\">fashion&nbsp;</span></em></span><span lang=\"IN\" style=\"font-size: 12.0pt; line-height: 107%; font-family: \'Times New Roman\',serif; mso-ansi-language: IN;\">atau&nbsp;<em>lifestyle</em> terbaru</span> <span lang=\"IN\" style=\"font-size: 12.0pt; line-height: 107%; font-family: \'Times New Roman\',serif; mso-ansi-language: IN;\">Blazer yang dapat digunakan dengan 2 model sekaligus. Bisa digunakan untuk long blazer (blazer selutut) dan bisa juga digunakan untuk short blazer (blazer sepinggang atau rompi). Kami memilih bahan yang terbaik untuk pembuatan produk M&rsquo;BAZE ini, sehingga menghasilkan produk dengan tampilan yang elegan dengan harga yang terjangkau.</span></p>','M\'BAZE|Multi Blazer|elegan',4,1,'2019-03-06 20:15:00','2019-03-15 01:59:58'),(513,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,1,'2019-03-06 22:09:16','2019-03-06 22:09:16'),(514,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,1,'2019-03-06 23:41:55','2019-03-06 23:41:55'),(515,0,'BATIC Bread With Thai Tea Sauce','2019 17030184095 HASNA\' NABILAH.pdf',NULL,10500000,'<p class=\"MsoNoSpacing\" style=\"text-align: justify; line-height: 150%; tab-stops: 14.2pt;\"><span style=\"font-size: 12.0pt; line-height: 150%; font-family: \'Times New Roman\',\'serif\'; letter-spacing: -.05pt; mso-ansi-language: IN; mso-bidi-font-weight: bold;\">Ketan hitam yang </span><span lang=\"EN-US\" style=\"font-size: 12.0pt; line-height: 150%; font-family: \'Times New Roman\',\'serif\'; letter-spacing: -.05pt; mso-bidi-font-weight: bold;\">dikombinasikan</span><span style=\"font-size: 12.0pt; line-height: 150%; font-family: \'Times New Roman\',\'serif\'; letter-spacing: -.05pt; mso-ansi-language: IN; mso-bidi-font-weight: bold;\"> dalam adonan roti, membawa kebermanfaatan yang t</span><span lang=\"EN-US\" style=\"font-size: 12.0pt; line-height: 150%; font-family: \'Times New Roman\',\'serif\'; letter-spacing: -.05pt; mso-bidi-font-weight: bold;\">id</span><span style=\"font-size: 12.0pt; line-height: 150%; font-family: \'Times New Roman\',\'serif\'; letter-spacing: -.05pt; mso-ansi-language: IN; mso-bidi-font-weight: bold;\">ak diragukan lagi. Teksturnya terasa seperti gandum, sehingga dapat dijadikan alternatif pengganti gandum. </span><span lang=\"EN-US\" style=\"font-size: 12.0pt; line-height: 150%; font-family: \'Times New Roman\',\'serif\'; letter-spacing: -.05pt; mso-bidi-font-weight: bold;\">K</span><span style=\"font-size: 12.0pt; line-height: 150%; font-family: \'Times New Roman\',\'serif\'; letter-spacing: -.05pt; mso-ansi-language: IN; mso-bidi-font-weight: bold;\">arena minuman <em>Thai tea</em> </span><span lang=\"EN-US\" style=\"font-size: 12.0pt; line-height: 150%; font-family: \'Times New Roman\',\'serif\'; letter-spacing: -.05pt; mso-bidi-font-weight: bold;\">sedang naik daun pada masa sekarang dan digemari oleh berbagai kalangan</span><span style=\"font-size: 12.0pt; line-height: 150%; font-family: \'Times New Roman\',\'serif\'; letter-spacing: -.05pt; mso-ansi-language: IN; mso-bidi-font-weight: bold;\">, </span><span lang=\"EN-US\" style=\"font-size: 12.0pt; line-height: 150%; font-family: \'Times New Roman\',\'serif\'; letter-spacing: -.05pt; mso-bidi-font-weight: bold;\">kami ber-</span><span style=\"font-size: 12.0pt; line-height: 150%; font-family: \'Times New Roman\',\'serif\'; letter-spacing: -.05pt; mso-ansi-language: IN; mso-bidi-font-weight: bold;\">inovasi </span><span lang=\"EN-US\" style=\"font-size: 12.0pt; line-height: 150%; font-family: \'Times New Roman\',\'serif\'; letter-spacing: -.05pt; mso-bidi-font-weight: bold;\">menjadikannya </span><span style=\"font-size: 12.0pt; line-height: 150%; font-family: \'Times New Roman\',\'serif\'; letter-spacing: -.05pt; mso-ansi-language: IN; mso-bidi-font-weight: bold;\">s</span><span lang=\"EN-US\" style=\"font-size: 12.0pt; line-height: 150%; font-family: \'Times New Roman\',\'serif\'; letter-spacing: -.05pt; mso-bidi-font-weight: bold;\">ebagai </span><span style=\"font-size: 12.0pt; line-height: 150%; font-family: \'Times New Roman\',\'serif\'; letter-spacing: -.05pt; mso-ansi-language: IN; mso-bidi-font-weight: bold;\">bahan dasar</span><span lang=\"EN-US\" style=\"font-size: 12.0pt; line-height: 150%; font-family: \'Times New Roman\',\'serif\'; letter-spacing: -.05pt; mso-bidi-font-weight: bold;\"> selai untuk isian <em>BATIC Bread</em>. Dengan tujuan agar lidah masyarakat dapat menyesuaikan diri dengan rasa <em>BATIC Bread </em>yang cenderng baru. </span><span style=\"font-size: 12.0pt; line-height: 150%; font-family: \'Times New Roman\',\'serif\'; letter-spacing: -.05pt; mso-ansi-language: IN; mso-bidi-font-weight: bold;\">Roti ketan hitam yang bersatu padu dengan selai <em>Thai Tea</em> dipercaya akan menjadi terobosan baru dunia kuliner yang berbahan baku sehat dan unik.&nbsp; &nbsp;&nbsp;</span></p>','Roti, ketan, hitam,|roti|ketan|Thai|Tea',1,1,'2019-03-07 06:23:01','2019-03-19 05:54:22'),(516,0,'PLEWOOD (Lampu Meja Berbahan Dasar Limbah Kayu Triplek)','2019 17010024052 Achmad Thohari.pdf',NULL,6159500,'<p>Usaha PLEWOOD (Lampu Meja Berbahan Dasar Limbah Kayu Triplek) ini dibuat atas keresahan melihat banyaknya sisa kayu triplek yang dibuat untuk barang meubel dibuang begitu saja, atau hanya digunakan untuk kayu bakar. oleh karena itu kami memanfaatkan sisa-sisa kayu triplek tersebut menjadi barang yang bernilai tinggi dan mempunyai nilai guna dan estetika.</p>','PLEWOOD|Industri Kreatif|Limbah Kayu',4,1,'2019-03-07 15:24:05','2019-03-14 19:27:48'),(517,0,'Selurah','2019 17080314066 Rindiani Matussolikhah.pdf',NULL,5998000,'<p>Selurah atau Seni Lukisan Rajut Homemade merupakan suatu hasil karya seni yang menggabungkan antara seni rajut dengan model lukisan dan berbentuk bingkai. Selurah memiliki fungsi estetis dimana karya ini dapat dipajang sebagai hiasan maupun digunakan sebagai souvenir dan hadiah. Pembuatan produk selurah diharapkan dapat menjadi mitra bagi pengrajin seni rajut yang produk - produknya saat ini mengalami penurunan dan terlihat sudah biasa di masyarakat.produk ini merupakan bisnis unik dan berinovasi. Karena dari seni rajut dapat membentuk pola gambar atau lukisan yang unik dan sesuai pemesanan konsumen</p>','Selurah Unik |Lukisan Rajut Bingkai',2,1,'2019-03-07 16:30:45','2019-03-15 18:12:33'),(518,0,'TARO \"Tas yang Bisa Dialih Fungsikan Menjadi Rompi dengan Menggunakan Bahan Baku Tekstil\"','2019 17080314037 Indah Dwi Setyorini.pdf',NULL,5000000,'<p class=\"MsoNormal\" style=\"margin-left: 28.35pt; text-indent: 7.65pt; line-height: 115%; mso-layout-grid-align: none; text-autospace: none;\"><span style=\"font-family: Ebrima;\">Usaha kami ini</span> <span style=\"font-family: Ebrima;\">menjual</span> <span style=\"font-family: Ebrima;\">produk</span> <span style=\"font-family: Ebrima;\">tas yang dapat di gunakan menjadi rompi. Kami menjual</span> <span style=\"font-family: Ebrima;\">berbagai</span> <span style=\"font-family: Ebrima;\">macam</span> <span style=\"font-family: Ebrima;\">warna,cus</span><span lang=\"IN\" style=\"font-family: Ebrima; mso-ansi-language: IN;\">t</span><span style=\"font-family: Ebrima;\">omer dapat</span> <span style=\"font-family: Ebrima;\">membeli</span> <span style=\"font-family: Ebrima;\">sesuai yang diinginkan. Kami juga menyediakan</span> <span style=\"font-family: Ebrima;\">jasa custom ukuran agar customer bisa</span> <span style=\"font-family: Ebrima;\">mendapatkan</span> <span style=\"font-family: Ebrima;\">produk</span> <span style=\"font-family: Ebrima;\">dengan</span> <span style=\"font-family: Ebrima;\">ukuran tas dan rompi yang diinginkan.</span> <span style=\"font-family: Ebrima;\">Usaha kami juga mempunyai</span> <span style=\"font-family: Ebrima;\">keunggulan di banding usaha tas lain. Keunggulan</span> <span style=\"font-family: Ebrima;\">usaha kami yaitu</span> <span style=\"font-family: Ebrima;\">selain bermanfaat sebagai tas, produk ini juga bisa digunakan sebagai rompi. Bahan yang digunakan adalah tekstil, sehingaa dapat dicuci. Selain itu kami menyediakan tas rompi ini dengan berbagai ukuran, sehingga dapat muat dan pas digunakan oleh customer. Karena</span> <span style=\"font-family: Ebrima;\">usaha kami berkembang</span> <span style=\"font-family: Ebrima;\">mengikuti</span> <span style=\"font-family: Ebrima;\">kemajuan</span> <span style=\"font-family: Ebrima;\">tekologi</span> <span style=\"font-family: Ebrima;\">untuk pemasaran kami juga menggunakan</span> <span style=\"font-family: Ebrima;\">jasa online. Dimana</span> <span style=\"font-family: Ebrima;\">barang</span> <span style=\"font-family: Ebrima;\">y</span><span lang=\"IN\" style=\"font-family: Ebrima; mso-ansi-language: IN;\">a</span><span style=\"font-family: Ebrima;\">ng di pesan</span> <span style=\"font-family: Ebrima;\">bisa dikirim</span> <span style=\"font-family: Ebrima;\">kemanapun dan kapanpun</span> <span style=\"font-family: Ebrima;\">sesuai</span> <span style=\"font-family: Ebrima;\">den</span><span lang=\"IN\" style=\"font-family: Ebrima; mso-ansi-language: IN;\">g</span><span style=\"font-family: Ebrima;\">a</span><span lang=\"IN\" style=\"font-family: Ebrima; mso-ansi-language: IN;\">n </span><span style=\"font-family: Ebrima;\">waktu</span> <span style=\"font-family: Ebrima;\">pembuatan</span> <span style=\"font-family: Ebrima;\">produk. Selain</span> <span style=\"font-family: Ebrima;\">itu produk kami ini kami jual dengan harga yang cukup ekonomis.</span></p>','tas |rompi|ekonomis',5,1,'2019-03-07 18:02:59','2019-03-14 21:53:21'),(519,0,'KIJANG UNESA','2019 17010024050 Dwi Yanti Rahmadani.pdf',NULL,3975000,'<p>KIJANG UNESA (Keripik Jantung Pisang Asli UNESA) merupakan usaha pembuatan keripik dengan bahan utama jantung pisang yang memiliki beberapa varian rasa. Keripik merupakan salah satu jenis dari makanan ringan yang sangat populer di masyarakat. Umumnya bahan dasar keripik yaitu singkong, pisang, kentang, keripik berbahan dasar buah ataupun bahan dasar lainnya, tetapi yang paling populer di masyarakat yaitu keripik singkong dan keripik pisang. Pemilihan jantung pisang sebagai bahan utama pembuatan keripik ini dikarenakan masih banyak orang yang belum mengetahui bahwa jantung pisang bisa diolah menjadi makanan ringan kemudian jantung pisang juga banyak didapatkan dengan harga yang sangat terjangkau. Jantung pisang merupakan bunga pisang berwarna merah keunguan, biasanya disebut oleh orang Jawa dengan sebutan Onthong.&nbsp;</p>\n<p>Produk yang akan dibuat adalah keripik jantung pisang yang akan disajikan dengan beberapa varian yang tentunya enak dan sehat dinikmati oleh siapa saja. Varian yang akan disajikan adalah original, pedas, manis, pedas manis, dan bawang.</p>\n<p>&nbsp;</p>','Camilan Sehat|Onthong|Keripik',1,1,'2019-03-07 18:32:24','2019-03-14 19:49:59'),(520,0,'Garapno.id','2019 17010024064 abdul wahid romadon.pdf',NULL,7000000,'<p><span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; line-height: 18.2px; widows: 1;\">Ini adalah sebuah layanan penyedia jasa untuk membantu mahasiswa menyelesaikan tugasnya terutama dalam tugas berbasis IT atau desain grafis dengan harga yang cukup murah bagi mahasiswa dan kualitas yang mampu bersaing di pasaran.17</span></p>','abdul17010024064|Garapno.id',4,1,'2019-03-07 20:13:13','2019-03-14 18:39:42'),(521,0,'ShiSiBa Lamp (Shine reSin Batik Lamp) Inovasi sebagai Penerangan Ruangan','2019 17080314105 Intan Nikhlatul Umroh.pdf',NULL,6000000,'<p>RINGKASAN</p>\n<p>&nbsp;</p>\n<p>Lampu adalah sebuah peranti yang memproduksi cahaya. Kata &ldquo;lampu&rdquo; dapat juga berarti bola lampu. Lampu pertama kali ditemukan oleh Sir Joseph William Swan. Lampu merupakan sumber cahaya buatan yang dihasilkan melalui penyaluran arus listrik melalui filamen yang kemudian memanas dan menghasilkan cahaya. Kaca yang menyelubungi filamen panas tersebut menghalangi udara untuk berhubungan dengannya sehingga filamen tidak akan langsung rusak akibat teroksidasi.</p>\n<p>Lampu dipasarkan dalam berbagai macam bentuk dan tersedia untuk tegangan (voltase) kerja yang bervariasi dari mulai 1,25 volt hingga 300 volt. Energi listrik yang diperlukan lampu untuk menghasilkan cahaya yang terang lebih besar dibandingkan dengan sumber cahaya buatan lainnya seperti lampu pendar dan diode cahaya, maka secara bertahap pada beberapa negara peredaran lampu pijar mulai dibatasi.</p>\n<p>Disamping memanfaatkan cahaya yang dihasilkan, beberapa pengguna lampu lebih memanfaatkan panas yang dihasilkan, contohnya adalah pemanas kandang ayam, dan pemanas inframerah dalam proses pemanasan dibidang industri. Lampu juga sering dimanfaatkan sebagai penghias atau alat untuk mempercantik rumah atau ruangan.</p>\n<p>Selain itu perkembangan teknologi yang semakin pesat dengan mulai meratanya penggunaan gadget disetiap lapisan masyarakat menjadikan E-Commerce sebagai bisnis yang cukup diminati semua kalangan karena memberikan kemudahan bagi masyarakat dalam memperoleh berbagai kebutuhan.</p>\n<p>Maka dari berbagai hal diatas, bisnis ini akan merambah pada bidang lampu hias dengan menjamin kualitas serta berbasis E-Commerce sebagai nilai tambah dibandingkan dengan kompetitor pada bidang serupa.&nbsp;</p>','inu100699 |wbWX3gcy|anna091298',4,1,'2019-03-07 21:07:19','2019-03-15 00:30:25'),(522,0,'Tteokbokki Nusantara (Tteosan)','2019 17030184047 VERONICA JUNIOR AYME SURYA.pdf',NULL,6112000,'<p>Proposal ini menggagaskan sebuah inovasi memadukan masakan khas Korea yang akhir-akhir ini digandrungi oleh kaum muda dengan gorengan yang sangat disukai masyarakat indonesia. Jajanan korea yang terbuat dari tepung beras yang disajikan dengan cara di goreng dan diberi isian yang cocok dengan lidah masyarakat Indonesia. Dengan menciptakan gabungan antara masakan korea yang diminati oleh kaum muda dan mencocokannya dengan sebuah lidah Indonesia maka akan membuat makanan ini diminati banyak orang. Untuk itu dibuatlah camilan &ldquo;Tteobokki Nusantara&rdquo; sebagai wujud inovasi untuk memenuhi semua itu. Tujuan yang diharapkan adalah dapat membuat mahasiswa untuk mebuat sebuah hal yang baru, meningkatkan mahasiswa dalam berwirausaha serta jika usaha ini berkembang dapat memberikan dampak kesejahteraan masyarakat dengan membuka lapangan pekerjaan. Cara pemasaran yang dilakukan dengan memesan online atau langsung membeli secara kemasan yang ditaruh di sebuah stand dan dipromosikan melalui media sosial seperti Whatsapp, Line, Facebook, Instagram dsb.</p>','Tteobokki|Makanan ringan|Gorengan|Tteosan',1,1,'2019-03-07 23:21:25','2019-03-14 14:12:14'),(523,0,'DORA DORES','2019 17040254093 Maharani Dwi Pertiwi.pdf',NULL,4500000,'<p>Ikan Dori merupakan salah satu ikan dengan kandungan protein yang tinggi, rendah lemah dan tinggi vitamin serta mineral. Ikan Dori yang sudah memiliki banyak manfaat dicampurkan dengan daun alur dan daun kersen yang tentunya juga memiliki manfaat yang menyehatkan tubuh. Daun Alur merupakan jenis daun yang mampu menjaga berat badan dan juga menjaga pencernaan. Begitupun dengan daun kersen yang mampu mengobati diabetes, kolesterol, dan mencegah darah tinggi. ketiga bahan yaitu ikan dori, daun kersen dan daun alur dicampur menjadi sebuah olahan makanan yang simpel namun kaya akan manfaat bagi tubuh yang mampu dikonsumsi oleh seluruh kalangan masyarakat karena harga yang ditawarkan sangat terjangkau.&nbsp;</p>','Daun alur|daun kersen|ikan dori',1,1,'2019-03-08 01:13:55','2019-03-15 01:33:02'),(524,0,'COOGIES (Cookies Ginger Secang)','2019 17010664185 Jimmy Nugroho Mukti.pdf',NULL,5591000,'<p class=\"MsoNoSpacing\" style=\"text-align: justify; line-height: 150%; tab-stops: 14.2pt;\"><span style=\"font-size: 12.0pt; line-height: 150%; font-family: \'Times New Roman\',\'serif\'; letter-spacing: -.05pt;\">Mengapa produk kami layak untuk didanai karena, Coogies ini tidak seperti cookies pada umumnya, coogies ini mempunyai rasa yang jauh berbeda dari cookies-cookies yang lain. Dimana Coogies (Cookies Ginger Secang) ini adalah salah satu jenis olahan makanan ringan berupa kue kering yang mempunyai rasa khas jahe berbalut dengan warna merah serta aroma harum dari kayu secang. Coogies ini diproduksi dengan bahan yang menjadi ciri khasnya yaitu jahe dan secang dan disertakan toping cogies berupa butter cream dan cismis. Dari bahan utama tersebut dipadukan dengan bahan-bahan yang lain sehingga jadilah coogies ginger secang ini. Oleh karena itu usaha membuat kue dari jahe secang menjadi suatu keunikan tersendiri, dimana di Indonesia sendiri masih jarang yang mengenal salah satu bahan utama dari coogies ini yaitu kayu secang. Selain itu di Indonesia<span style=\"mso-spacerun: yes;\">&nbsp; </span>juga masih jarang orang yang mengolah kayu secang ini menjadi makanan yang ternyata mempunyai cita rasa yang istimewa jika dipadukan dengan bahan-bahan lain seperti jahe. Coogies ini memiliki cita rasa unik yang menjadi ciri khas dari coogies ini, yang diperoleh dari perpaduan antara rasa pedas dari jahe dan bahan- bahan lainnya tersebut. Coogies ini juga memiliki warna yang sangat menarik dan unik, yaitu dengan warna merah yang dihasilkan dari hasil rebusan air kayu secang yang mempunyai aroma khas yang harum sehingga dapat menarik orang yang melihatnya sehingga ingin memakan coogies tersebut. </span></p>\n<p class=\"MsoNoSpacing\" style=\"text-align: justify; line-height: 150%; tab-stops: 14.2pt;\"><span style=\"font-size: 12.0pt; line-height: 150%; font-family: \'Times New Roman\',\'serif\'; letter-spacing: -.05pt;\"><span style=\"mso-tab-count: 2;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span><span style=\"mso-spacerun: yes;\">&nbsp;</span>Keunggalan dari jenis olahan makanan ringan ini yaitu memiliki banyak manfaat dan khasiat yang begitu penting bagi kesehatan tubuh manusia. Diantaranya hasil olahan secang berupa ekstrak air berwarna merah berkhasiat untuk menghambat perkembangan sel tumor, meningkatkan kerja system imun tubuh untuk melawan berbagai jenis bakteri, anti radang dan merangsang sitem imun, serta dapat menurunkan gula darah dan menjaga kesehatan hati. Tidak hanya itu coogies juga terbuat dari bahan utama jahe, yang juga bermanfaat penting bagi tubuh manusia seperti dapat mengatasi masalah pencernaan, mengurangi mual, mengurangi rasa sakit pada otot, membantu proses detoksifikasi dan mencegah penyakit kulit, serta mencegah kanker dan anti perandangan.</span></p>','COOGIES|Cookies Ginger Secang',1,1,'2019-03-08 01:56:58','2019-03-14 20:43:02'),(525,0,'JITU SAM (Jasa Cuci Sepatu Sahabat Mahasiswa)','2019 17010024029 Syahrul Gunawan.pdf',NULL,4000000,'<p class=\"MsoNoSpacing\" style=\"text-align: justify; line-height: 150%; tab-stops: 14.2pt;\"><span style=\"font-size: 12.0pt; line-height: 150%; font-family: \'Times New Roman\',\'serif\'; letter-spacing: -.05pt; mso-ansi-language: IN;\">Kegiatan usaha ini merupakan jasa untuk mencuci sepatu. Sepatu merupakan kebutuhan semua orang pada umumnya. Sepatu sebagai pelindung kaki dari kotoran berupa debu, krikil, atau bahkan lumpur. Untuk itu sepatu harus tetap dirawat supaya bisa melindungi kaki dengan aman dan nyaman. Supaya tetap terlihat rapi, keren, nyaman dan bersih sepatu harus dicuci. Latar belakang kami mendapatkan ide usaha cuci sepatu dari masalah teman mahasiswa yang suka dengan sepatu. Dia sering membeli sepatu tetapi belum 2 semester sudah rusak dan memudar. Setelah ditanya tentang cara pencuciannya ternyata kurang benar.<span style=\"mso-spacerun: yes;\">&nbsp; </span>Kami yang juga pecinta sepatu akhirnya membantunya dan berpikiran untuk membuat usaha cuci sepatu. </span></p>','jasa cuci sepatu',2,1,'2019-03-08 02:10:56','2019-03-14 23:18:30'),(526,0,'TUWAN BAG : Two in One Bag inovasi Terkini Tas Dengan dua Kegunaan','2019 17080314015 Riva Karomatul Azizah.pdf','2019 17080314015 Riva Karomatul Azizah.pdf',5500000,'<p class=\"MsoNormal\" style=\"text-align: justify; text-indent: 36.0pt; line-height: 115%; margin: 0cm 20.15pt .0001pt 1.0cm;\"><span lang=\"EN-US\" style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\';\"><strong>Tuwan bag</strong> adalah tas yang memiliki berbagai kegunaan, arti kata Tuwan Bag diambil berasal dari kata <strong>Two in One Bag</strong> jadi didalam satu tas terdapat 2 kegunaan, manfaat yang pertama yaitu tas ini dapat digunakan ketika berpergian ke kampus sebagai wadah buku dan sebagainya namun bukan hanya itu tas tersebut juga dapat digunakan berpergian bersama teman - teman diluar kampus karna di tas tersebut terdapat dua model tas yang dijadikan satu yaitu <strong>Tote Bag dan Pouch</strong> yang ada didalam Tote Bag tersebut. </span></p>',NULL,4,1,'2019-03-08 03:15:33','2019-04-29 17:05:15'),(527,0,'ES KLAMUD MILLY','2019 17010024079 Kamilah Salsabila Sofatul Akbar.pdf',NULL,5411000,'<p>ES KLAMUD MILLY (Es Kelapa Muda Milk Jelly) adalah produk minuman segar dan menyehatkan yang berbahan dasar kelapa muda. Agar cita rasanya semakin nikmat, maka ditambahkan jelly serta susu kental manis. ES KLAMUD MILLY (Es Kelapa Muda Milk Jelly) merupakan minuman yang banyak digemari oleh kalangan masyarakat. ES KLAMUD MILLY (Es Kelapa Muda Milk Jelly) juga memiliki tambahan topping diatasnya agar terlihat lebih menarik dan berbeda dengan es kelapa muda lainnya.</p>','minuman,kelapa muda, jelly susu',1,1,'2019-03-08 03:51:51','2019-03-14 23:38:37'),(528,0,'BOLA ULAR (Bola Ubi Jalar)','2019 17010644143 Vina Sangidah.pdf',NULL,5000000,'<p class=\"MsoListParagraphCxSpFirst\" style=\"margin-left: 0cm; mso-add-space: auto; text-align: justify; text-indent: 42.55pt;\"><span lang=\"IN\" style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; letter-spacing: -.05pt; mso-ansi-language: IN;\">Ubi jalar mengandung banyak nutrisi yang baik untuk kesehatan. Ubi jalar mengandung nutrisi karkohidrat yang tinggi. BOLA ULAR (Bola Ubi Jalar) merupakan produk hasil modifikasi olahan ubi agar bisa eksis di kalangan masyarakat modern saat ini. BOLA ULAR (Bola Ubi Jalar) terinspirasi dari kekayaan budaya dan kekayaan alam Indonesia. BOLA ULAR (Bola Ubi Jalar) menjadi pilihan yang dipadu padakan dengan bahan-bahan modern untuk menambah cita rasa baru dan menarik minat konsumen. Dengan memodifikasi ubi menjadi cemilan yang unik, kami berharap masyarakat tidak memandang ubi sebagai makanan kalangan menengah namun isa menyeluruh di semua kalangan.</span></p>','ubi jalar|modifikasi|cita rasa',1,1,'2019-03-08 04:30:11','2019-03-17 18:02:59'),(529,0,'Es Kunyit Asam KusemBoi','2019 17020084082 Arfan Adji Risanta.pdf',NULL,4492000,'<p class=\"MsoNoSpacing\" style=\"margin-left: 14.2pt; text-align: justify; line-height: 115%; tab-stops: 14.2pt;\"><span lang=\"IN\" style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',serif; letter-spacing: -.05pt; mso-ansi-language: IN;\">Usaha kami bergerak di produksi minuman tradisional dengan wajah baru yang menawarkan orisinalitas rasa jamu kunyit asam dan beragam kandungan di dalamnya untuk kesehatan konsumen. Es Kunyit Asam KusemBoi memiliki keunggulan dari citarasa jamu kunyit asam yang khas, dipadu dengan gula asli menjadikan produk kami akan diminati masyarakat di segala usia. Dalam penerapannya, kami mencoba merubah pola pikir masyarakat yang menganggap bahwa jamu adalah minuman dengan rasa kurang sedap. Selain itu, produk ini bermanfaat bagi suplemen kesehatan, berkhasiat menyegarkan tubuh dan menyehatkan badan. Ke depannya, KusemBoi akan menjadi produsen jamu kunyit asam yang makin diminati masyarakat luas dengan menjaga orisinalitas rasa dan kualitas bahan baku serta ketelitian dalam proses pembuatan, sehingga terciptalah jamu tradisional dengan rasa dan khasiat yang melegenda serta mengajak masyarakat untuk rutin mengonsumsi minuman herbal.</span></p>','minuman|kunyit|asam|kunyit asam|jamu|KusemBoi',1,1,'2019-03-08 04:58:34','2019-03-15 00:28:13'),(530,0,'DOKAR (Donat Ubi Bakar)','2019 17010024053 RAHAYANI SUCI AMALIYA.pdf',NULL,2500000,'<p>Produk pada rencana usaha ini adalah produk makanan berupa donat yang terbuat dari bahan dasar ubi jalar. Cara pembuatannya juga bukan digoreng, melainkan dibakar atau dioven.</p>','DOKAR|Donat|Ubi|Bakar',1,1,'2019-03-08 05:46:49','2019-03-14 21:57:35'),(531,0,'PUDING KERA (KETELA RAMBAT)','2019 17010024063 Kukuh Dwi Pratama.pdf',NULL,3810500,'<p>Peluang bisnis dalam bidang olahan makanan memang sangat menjanjikan untuk memperoleh keuntungan yang sangat besar. Salah satunya adalah dengan mengolah &ldquo;KETELA RAMBAT&rdquo; menjadi Puding yang Lezat dan digemari oleh masyarakat luas. Ketela rambat atau ubi jalar adalah bahan makanan dari jenis umbi-umbian, selain singkong, talas dan kentang yang bisa langsung diolah menjadi beragam makanan ringan yang lezat dan enak. Di Indonesia , Ubi jalar sudah sangat dikenal oleh sebagian masyarakat. Namun sayangnya, ubi jalar bukanlah jenis makanan favorit dan biasanya lebih dikenal sebagai makanan rakyat pedesaan. Padahal, ubi jalar mengandung beragam gizi yang sangat baik, bahkan jika kreatif dalam pengolahannya bisa menjadi lahan bisnis yang menguntungkan. Pendirian usaha ini dapat meningkatkan nilai tambah ubi dengan mengolahnya menjadi &ldquo;Puding KERA (Ketela Rambat)&rdquo; dengan cita rasa yang khas. Sehingga dapat menjadi makanan ringan yang menyehatkan.</p>','puding|kera|ketela|rambat|ketelarambat|ketela rambat',1,1,'2019-03-08 16:24:26','2019-03-14 23:59:39'),(532,0,'\"String Miracle\" Kreasi Seni  Pemanfaatan Paku Dan Benang Menjadi Produk Bernilai Ekonomi','2019 17080314062 Vindi kusuma wardani.pdf',NULL,5976000,'<p>Fenomena masyarakat khususnya mahasiswa adalah terbanyak dari mereka sering memberikan hadiah atau souvenir kepada teman, sahabat, kerabat, hingga keluarga pada momen-momen tertentu seperti acara ulang tahun, wisuda, pernikahan, hingga menjadikan suatu oleh-oleh untuk keluarga. Melihat fenomena tersebut kami membuat suatu produk dalam bidang industri kreatif yakni &ldquo;String Miracle&rdquo; Kreasi Seni Pemanfaatan Paku Dan Benang Menjadi Produk Bernilai Ekonomi. String Miracle ini adalah produk dengan karya seni unik yang memanfaatkan benang dan paku yang dipola menyerupai sebuah benda seperti gambar bunga, hewan, orang, hingga sebuah ikon kota yang dapat dijadikan sebagai oleh-oleh, ditambah dengan papan kayu sebagai alasnya sehingga dapat terlihat sangat natural. Produk String Miracle dibuat dengan sistem <em>ready stock</em> dan <em>custom</em>, yang dapat menyesuaikan permintaan dari konsumen, sehingga cocok sebagai hadiah atau souvenir pada momen tertentu. Harga produk kami yakni mulai dari Rp.40.000, menyesuaikan dengan ukuran papan kayu dan juga kerumitan pola yang diinginkan konsumen. Harga tersebut sangat terjangakau bagi pangsa pasar kami yakni para mahasiswa dan remaja khususnya wanita diusia (15 hingga 45 tahun). Dengan perkembangan usaha String Miracle, kami yakin akan memiliki pasar yang luas dimana melihat peluang di kota Surabaya sendiri belum ada yang menjual hiasan seperti produk String Miracle. Serta,&nbsp; kami juga optimis bahwa usaha ini dapat diterima oleh masyamasya dengan konsistensi dan kualitas yang dapat dipertanggung jawabkan.&nbsp;</p>\n<p>&nbsp;</p>','Hiasan|Hadiah|String miracle',4,1,'2019-03-08 17:01:43','2019-03-16 08:41:04'),(533,0,'Laxki.id','2019 17010024074 Hamdallah firstya s.pdf',NULL,4981000,'<p>Kegiatan usaha ini merupakan usaha pembuatan jaket untuk&nbsp;</p>\n<p>fashion wanita maupun pria dengan berbahan dasar kain berjenis&nbsp;</p>\n<p>beludru dimana kain ini merupakan kain yang tipis tapi elegant untuk&nbsp;</p>\n<p>dijadikan outer yang cocok pada musim panas seperti sekarang ini.&nbsp;</p>\n<p>Selain itu merupakan sebuah kebutuhan fashion yang belum ada&nbsp;</p>\n<p>sebelumnya di pasaran. Hal ini dilakukan untuk membuat inovasi baru&nbsp;</p>\n<p>yang jarang sekali dibuat atau diciptakan oleh desainer fashion lainnya</p>','Jaket bludru',5,1,'2019-03-08 17:30:10','2019-03-14 20:20:26'),(534,0,'Leres Bung! (Mille Crepes Ubi Ungu)','2019 17010644036 Nadilla Reza Rachmayori.pdf',NULL,6530000,'<p>Leres Bung! (<em>Mille Crepes</em> Ubi Ungu) adalah camilan yang berbahan dasar tepung ubi ungu yang baik untuk kesehatan, mengandung serat yang berfungsi untuk menjaga kesehatan usus dan melancarkan pencernaan. Ubi ungu juga memiliki kandungan antioksidan yang membantu mencegah penyakit jantung, menguatkan sistem imun,dan menyehatkan mata. Tujuan adanya Program Mahasiswa Wirausaha adalah menciptakan peluang inovatif berupa Leres Bung! (<em>Mille Crepes</em> Ubi Ungu) yang memanfaatkan ubi ungu menjadi camilan yang unik dan menyehatkan. Program Mahasiswa Wirausaha ini berguna dalam meningkatkan nilai jual ubi ungu dengan menginovasikan olahan berbentuk <em>mille crepes</em> dan menumbuhkan jiwa <em>enterpreneurship</em>.</p>','Mille crepes, Ubi ungu',1,1,'2019-03-08 17:47:30','2019-03-20 01:49:01'),(535,0,'PLASTICINE VEGAN','2019 17010044043 Virginia Viradita Salsabila.pdf',NULL,5856500,'<p><em>Plasticine Vegan&nbsp;</em>adalah plastisin dengan bahan pewarna alami yang aman di gunakan untuk anak-anak. Plastisin ini dapat digunakan untuk melatih motorik halus anak pada masa perkembangan balita maupun melatih motorik halus anak berkebutuhan khusus.</p>','PLASTICINE|VEGAN|ALAMI|SEHAT|MAINAN',4,1,'2019-03-08 18:16:22','2019-03-19 02:56:48'),(536,0,'SKS (Selai Kunyit Sehat) \"Sehat Kunyitnya, Nikmat Makannya\"','2019 17010014008 Windy Anggraini.pdf',NULL,9063000,'<p>Kunyit merupakan salah satu rempah-rempah yang banyak digunakan di Indonesia. Kunyit kebanyakan digunakan sebagai bumbu dapur maupun jamu. Inovasi baru dari bahan dasar kunyit yaitu dapat dijadikan sebagai selai untuk pendamping roti atau kue. Dengan banyaknya manfaat yang terkandung dalam seruas kunyit, dapat memberikan dampak baik bagi kesehatan tubuh. Adanya inovasi terbaru selai yang terbuat dari kunyit ini, maka diharapkan dapat membantu perekonomian para petani kunyit agar lebih sejahtera.</p>','Selai|Kunyit|Sehat|Nikmat|SKS|makanan',1,1,'2019-03-08 18:16:56','2019-03-14 19:04:24'),(537,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,'2019-03-08 18:49:33','2019-03-08 18:49:33'),(538,0,'Sambal Jancuek (Jan Cetar Uenak e) Sambel Praktis dan Ekonomis','2019 17010044059 Nisa Diva Ulhaq.pdf',NULL,2666405,'<p>Sambal Jancuek (Jan Cetar Uenak e) merupakan produk makanan yang praktis, ekonomis, higienis dan aman dari bahan pengawet. Dengan berbagai macam varian rasa serta menyediakan layanan refill atau isi ulang, produk ini mengusung tema sambal kekinian yang diminati oleh masyarakat terutama mahasiswa. Inovasi produk Sambal Jancuek (Jan Cetar Uenak e) dapat menjangkau semua selera karena tersedia berbagai macam varian yang bisa disesuaikan dengan keinginan pemesan.</p>','sambal|jar kaca|varian|makanan pendamping|pedas',1,1,'2019-03-08 18:53:03','2019-03-20 03:26:48'),(539,0,'Flocha Flip','2019 16080574070 REGINA PRIYA AGUSTINA.pdf',NULL,4000000,'<p>Usaha kerajinan sandal karakter ini adalah jenis usaha kerajinan berskala kecil yang khusus memproduksi sandal jepit seperti pada umumnya dan di beri tambahan bahan spons yang di bentuk sesuai ukuran sandal tersebut dan di lapisi dengan kain katun berpola karakter. Alasan kami dalam memilih usaha kerajinan sandal karakter ini di dasarkan atas keinginan merubah barang yang memiliki harga jual rendah menjadi barang yang memiliki harga jual tinggi dan bernilai seni tinggi. Sehingga kami memutuskan untuk membuat produk <em><strong>&ldquo; Flocha Flip &ldquo;</strong></em> yakni sandal hias kekinian dimana pemilihan nama <em>Flocha</em> mempunyai makna Flo= flower dan Cha=character. Segmentasi produk kami ada pada kalangan menengah kebawah, karena harga dari produk perubahan kami <strong>(Flocha Flip)</strong> dapat dijangkau oleh orang-orang pada kalangan tersebut. Dimana target pemasaran dari produk kami yaitu dewasa dan anak-anak khususnya perempuan yakni, dewasa bertemakan <em>flower</em> dan anak-anak bertemakan karakter kartun. Dan produk kami diperuntukkan untuk perempuan yang ingin terlihat lebih feminim dan modis dalam penampilannya, selain itu produk kami juga memiliki bahan yang nyaman saat di pakai dan cocok sebagai souvenir pernikahan ataupun hadiah ulang tahun.</p>','flocha flip|sandal karakter|kerajinan',4,1,'2019-03-08 19:24:20','2019-03-20 04:22:20'),(540,0,'Es Timun (Satu Kali Seruput Bikin Seger)','2019 16010664060 Alfiyah Nur Achmad.pdf',NULL,5708000,'<p><!-- [if gte mso 9]><xml>\n <o:OfficeDocumentSettings>\n  <o:AllowPNG/>\n </o:OfficeDocumentSettings>\n</xml><![endif]--> <!-- [if gte mso 9]><xml>\n <w:WordDocument>\n  <w:View>Normal</w:View>\n  <w:Zoom>0</w:Zoom>\n  <w:TrackMoves/>\n  <w:TrackFormatting/>\n  <w:PunctuationKerning/>\n  <w:ValidateAgainstSchemas/>\n  <w:SaveIfXMLInvalid>false</w:SaveIfXMLInvalid>\n  <w:IgnoreMixedContent>false</w:IgnoreMixedContent>\n  <w:AlwaysShowPlaceholderText>false</w:AlwaysShowPlaceholderText>\n  <w:DoNotPromoteQF/>\n  <w:LidThemeOther>EN-US</w:LidThemeOther>\n  <w:LidThemeAsian>X-NONE</w:LidThemeAsian>\n  <w:LidThemeComplexScript>X-NONE</w:LidThemeComplexScript>\n  <w:Compatibility>\n   <w:BreakWrappedTables/>\n   <w:SnapToGridInCell/>\n   <w:WrapTextWithPunct/>\n   <w:UseAsianBreakRules/>\n   <w:DontGrowAutofit/>\n   <w:SplitPgBreakAndParaMark/>\n   <w:EnableOpenTypeKerning/>\n   <w:DontFlipMirrorIndents/>\n   <w:OverrideTableStyleHps/>\n  </w:Compatibility>\n  <m:mathPr>\n   <m:mathFont m:val=\"Cambria Math\"/>\n   <m:brkBin m:val=\"before\"/>\n   <m:brkBinSub m:val=\"&#45;-\"/>\n   <m:smallFrac m:val=\"off\"/>\n   <m:dispDef/>\n   <m:lMargin m:val=\"0\"/>\n   <m:rMargin m:val=\"0\"/>\n   <m:defJc m:val=\"centerGroup\"/>\n   <m:wrapIndent m:val=\"1440\"/>\n   <m:intLim m:val=\"subSup\"/>\n   <m:naryLim m:val=\"undOvr\"/>\n  </m:mathPr></w:WordDocument>\n</xml><![endif]--><!-- [if gte mso 9]><xml>\n <w:LatentStyles DefLockedState=\"false\" DefUnhideWhenUsed=\"false\"\n  DefSemiHidden=\"false\" DefQFormat=\"false\" DefP