=\"49\" Name=\"List Table 4 Accent 5\"/>\n  <w:LsdException Locked=\"false\" Priority=\"50\" Name=\"List Table 5 Dark Accent 5\"/>\n  <w:LsdException Locked=\"false\" Priority=\"51\"\n   Name=\"List Table 6 Colorful Accent 5\"/>\n  <w:LsdException Locked=\"false\" Priority=\"52\"\n   Name=\"List Table 7 Colorful Accent 5\"/>\n  <w:LsdException Locked=\"false\" Priority=\"46\"\n   Name=\"List Table 1 Light Accent 6\"/>\n  <w:LsdException Locked=\"false\" Priority=\"47\" Name=\"List Table 2 Accent 6\"/>\n  <w:LsdException Locked=\"false\" Priority=\"48\" Name=\"List Table 3 Accent 6\"/>\n  <w:LsdException Locked=\"false\" Priority=\"49\" Name=\"List Table 4 Accent 6\"/>\n  <w:LsdException Locked=\"false\" Priority=\"50\" Name=\"List Table 5 Dark Accent 6\"/>\n  <w:LsdException Locked=\"false\" Priority=\"51\"\n   Name=\"List Table 6 Colorful Accent 6\"/>\n  <w:LsdException Locked=\"false\" Priority=\"52\"\n   Name=\"List Table 7 Colorful Accent 6\"/>\n </w:LatentStyles>\n</xml><![endif]--><!-- [if gte mso 10]>\n<style>\n /* Style Definitions */\ntable.MsoNormalTable\n	{mso-style-name:\"Table Normal\";\n	mso-tstyle-rowband-size:0;\n	mso-tstyle-colband-size:0;\n	mso-style-noshow:yes;\n	mso-style-priority:99;\n	mso-style-parent:\"\";\n	mso-padding-alt:0in 5.4pt 0in 5.4pt;\n	mso-para-margin-top:0in;\n	mso-para-margin-right:0in;\n	mso-para-margin-bottom:10.0pt;\n	mso-para-margin-left:0in;\n	line-height:115%;\n	mso-pagination:widow-orphan;\n	font-size:11.0pt;\n	font-family:Calibri;\n	mso-ascii-font-family:Calibri;\n	mso-ascii-theme-font:minor-latin;\n	mso-hansi-font-family:Calibri;\n	mso-hansi-theme-font:minor-latin;}\n</style>\n<![endif]--> <!--StartFragment--></p>\n<p class=\"MsoNormal\" style=\"text-align: center;\" align=\"center\"><strong style=\"mso-bidi-font-weight: normal;\"><span lang=\"IN\" style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\'; mso-ansi-language: IN;\">ABSTRAK</span></strong></p>\n<p class=\"MsoNormal\" style=\"text-align: justify;\"><span lang=\"IN\" style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\'; mso-ansi-language: IN;\">Judul yang kami gunakan dalam program mahasiswa wirausaha ini yaitu Es Timun (Satu Kali Seruput Bikin Seger). Program mahasiswa wirausaha ini dapat mengapresiasi ide-ide mahasiswa termasuk kami dalam dunia usaha dibidang minuman yang kami gunakan. Minuman yang akan kami jual yaitu minuman yang berbahan pokok timun. Keunikan dan keunggulan dari minuman yang akan kami tawarkan serta kami jual yaitu minuman yang segar. Jarang yang menjual minuman seperti kami ini dan jarang masyarakat menemuinya. Minuman kami yang berbahan dasar awal yaitu timun membuatnya dengan cara diparut lalu dicampurkan dengan air gula yang sudah dilautkan serta ditambahkan sprite yang sudah banyak masyarakat mengetahui lalu ditambahkan parutan lemon yang segar serta disiram isi dari air lemon tersebut. Lalu dituangkan dalam gelas plastik yang akan kami sediakan. Kami menjual minuman ini seharga Rp 4000 per gelas yang telah kami sediakan. Kami menjual minuman ini melalui promosi di media cetak seperti brosur, melalui sosial media seperti instagram, twitter, facebook dan lain-lain. Metode promosi lain yang kami gunakan yaitu iklan, <em style=\"mso-bidi-font-style: normal;\">personal selling</em> dan <em style=\"mso-bidi-font-style: normal;\">sales promotion.</em> Target penjualan kami setiap harinya yaitu 525 gelas dengan target pasar yaitu mahasiswa-mahasiswa di lingkungan perikuliahan. </span></p>\n<p><!--EndFragment--></p>','Es Timun, minuman, seger',1,1,'2019-03-08 19:31:19','2019-03-14 22:22:30'),(541,0,'E-Pading (Es Krim Panas Dingin)','2019 17010024075 Nadia Ega Lestari.pdf',NULL,2000000,'<p class=\"MsoNormal\" style=\"text-align: justify; text-indent: .5in;\"><span style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\';\">Kegiatan usaha ini merupakan usaha pembuatan es krim batang berbagai rasa dengan dibalut roti tawar iris lalu dimasak dengan cara digoreng menggunakan tepung. Es krim banyak sekali penggemarnya, dengan ini saya membuat es krim dengan sajian yang unik dan menciptakan sensasi yang baru pada saat memakannya. Pilihan es krim dan roti tawar yang digunakan bisa berbagai macam rasa, sesuai permintaan komsumen. Tepung yang digunakan adalah tepung roti halus, yang membuat es krim tersebut pada saat digigit terasa sensasi garing. Jadi pada saat memakannya kita dapat merasakan panas pada luarnya dan dingin<span style=\"mso-spacerun: yes;\">&nbsp; </span>di dalamnya dengan merasakan es krim yang meleleh, maka dari itu saya membuat nama produk makanan ini &ldquo;E-Pading ( Es Krim Panas Dingin)&rdquo;.</span></p>','E-Pading|Es Krim Panas Dingin |Es Krim Goreng Praktis',1,1,'2019-03-08 19:41:58','2019-03-15 02:52:36'),(542,0,'Shupang (Sushi Kupang)','2019 16030174075 Eko Rahmad Bahrudin.pdf',NULL,6365000,'<p class=\"MsoListParagraph\" style=\"mso-add-space: auto; text-align: justify; text-indent: 14.7pt; line-height: 150%; margin: 0in 0in .0001pt 21.3pt;\"><span lang=\"EN-US\" style=\"font-size: 12.0pt; line-height: 150%; font-family: \'Times New Roman\',\'serif\'; mso-ansi-language: EN-US;\">Sushi merupakan makanan dari Jepang yang terdiri dari nasi yang dibentuk bersama lauk berupa daging, sayuran mentah atau sudah dimasak. Sedangkan kupang merupakan</span><span style=\"font-size: 12.0pt; line-height: 150%; font-family: \'Times New Roman\',\'serif\';\"> hasil perairan laut dan termasuk dalam kelompok kerang-kerangan</span> <span style=\"font-size: 12.0pt; line-height: 150%; font-family: \'Times New Roman\',\'serif\';\">yang kaya atas protein terutama asam amino essensial</span><span lang=\"EN-US\" style=\"font-size: 12.0pt; line-height: 150%; font-family: \'Times New Roman\',\'serif\'; mso-ansi-language: EN-US;\">. Makanan Sushi memiliki karakteristik yang cocok dengan karakteristik makanan masyrakat Indonesia yang tidak dapat terlepas dari nasi. Oleh karena itu, kami melihat adanya peluang itu sebagai peluang usaha dari inovasi makanan yakni Shupang &ldquo;Sushi Kupang&rdquo;. Anggaran yang kami ajukan sebesar Rp 6.365.000.</span></p>','Shupang|Sushi|Kupang',1,1,'2019-03-08 20:06:49','2019-03-15 02:40:31'),(543,0,'Momiji \"Momen Indah dadi Siji\"','2019 17010024054 Nickita Ellena Putri Ichwan Wijaya.pdf',NULL,6390000,'<p>Momiji adalah kegiatan usaha yang bergerak di bidang industri kreatif. Produk usahanya berupa scrapframe, yaitu seni mendesain, memotong, dan merangkai kertas menjadi bentuk 3D yang dibingkai dan dihias dengan cantik.&nbsp;</p>','Momiji|Scrap|Frame|Scrapframe|Scrapframe Momiji|frame|industri kreatif|gift|kenangan|momen',4,1,'2019-03-08 20:26:10','2019-03-15 00:12:19'),(544,0,'Griya Goni ( Pigora Seni )','2019 17080314033 DWI INDAH ARTAVERLINA.pdf',NULL,6500000,'<p>Goni adalah akronim sebagian dari kata Pigora Seni yang mana ini adalah salah satu inovasi terbaru yang kami buat untuk membantu mengantisipasi bahaya radiasi yang dihasilkan oleh alat - alat teknologi terkini mengandung elektromagnetik. Apabila berbicara tentang teknologi , maka bukanlah cara tepat apabila harus menghindari. Sebab sudah menjadi tuntutan da kebutuhan zaman. Sehingga kami berinovasi yang mana lebih cenderung menyiasati dampak radiasi tersebut.</p>','Griya Goni',4,1,'2019-03-08 20:35:49','2019-03-15 04:20:58'),(545,0,'NUBIDU (Nugget Ubi Madu)','2019 17010024071 Ollyvia Arizka Virnanda.pdf',NULL,8865000,'<p class=\"MsoNormal\" style=\"margin-left: 1.0cm; text-align: justify; text-indent: -36.0pt; mso-layout-grid-align: none; text-autospace: none;\"><span lang=\"EN-US\" style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\';\">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; Kegiatan usaha ini merupakan usaha pembuatan nugget dengan campuran bahan ubi madu atau ubi cilembu yang dipadukan dengan aneka rasa topping yang bervarian diatasnya</span><span style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; mso-ansi-language: IN;\"> seperti Dark Chocolste, Milk Vanilla, Tiramisu, Tiramisu Granule, Cappucino, Greentea, Strawberry, Avocado, Banana, Mangga, Orange, Blueberry, Chocomaltine, Raspberry, dan Keju</span><span lang=\"EN-US\" style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\';\">. Ubi madu atau ubi cilembu merupakan ras lokal asal kecamatan Pamulihan, Sumedang, Jawa Barat. Ubi ini populer di kalangan konsumen semenjak tahun 1990-an. Ubi madu atau ubi cilembu ini lebih istimewa daripada umbi lainnya karena umbi ini bila di oven akan mengeluarkan sejenis cairan lengket gula madu yang manis rasanya. Rasa&nbsp; manis ini yang membuat tenaga ekstra bagi orang yang mengkonsumsinya.&nbsp;</span></p>','NUBIDU|Nugget Ubi|Nuget|Ubi Madu|Makanan Sehat|Nugget',1,1,'2019-03-08 20:45:46','2019-03-14 22:28:17'),(546,0,'Batik eco print','2019 17010024066 Dwiki Ramadhan.pdf',NULL,1940000,'<p>Kami adalah mahasiswa yang memimpikan menjadi seorang pengusaha karena&nbsp;<span style=\"line-height: 1.3;\">bekerja dengan hobby yang diminati merupakan sesuatu hal yang sangat&nbsp;</span><span style=\"line-height: 1.3;\">menyenangkan, disisi lain mendapatkan penghasilan dari menjadi pengusaha,&nbsp;</span><span style=\"line-height: 1.3;\">kami juga dapat mengasah kreatifitas kami. Ketika kami mengetahui bahwa&nbsp;</span><span style=\"line-height: 1.3;\">UNESA mengadakan Program Mahasiswa Kewirausahaan, tentunya kami sangat</span><span style=\"line-height: 1.3;\">a antusiasuntuk mengikuti program tersebut. Pada jaman yang serba canggih ini&nbsp;</span><span style=\"line-height: 1.3;\">membuat masyarakat lupa akan ciri khas daerah masing-masing, khususnya&nbsp;</span><span style=\"line-height: 1.3;\">warisan budaya yang menjadi icon dari negara kita sendiri. Kain batik sekarang&nbsp;</span><span style=\"line-height: 1.3;\">sudah banyak meraba ke dunia. Seringkali batik dijadikan sebagai fashion trade&nbsp;</span><span style=\"line-height: 1.3;\">bagi masyarakat. Tidak hanya dijadikan sebagai fashion, batik pun juga&nbsp;</span><span style=\"line-height: 1.3;\">digunakan sebagai bahan dasar tas, dompet, taplak meja, sapu tangan dll.&nbsp;</span><span style=\"line-height: 1.3;\">Penggunaan kain batik oleh semua kalangan baik dari ekonomi yang rendah,&nbsp;</span><span style=\"line-height: 1.3;\">menengah, maupun atas menjadi sebuah peluang bagi kemajuan industri batik di&nbsp;</span><span style=\"line-height: 1.3;\">Indonesia.</span></p>','Batik eco print',4,1,'2019-03-08 21:31:31','2019-03-15 03:40:17'),(547,0,'SOL BUAH MADONNA (Risol Buah Lezat Makanan Primadonna)','2019 17010014021 Rizki Muhajaroh.pdf',NULL,7765000,'<p>SOL BULE MADONNA (Risol Buah Lezat Makanan Primadona)</p>\n<p>Merupakan produk wirausaha makanan dan minuman. Produk ini menggunakan isi buah, satu keunggulan produk yang jarang ditemukan di pasaran. Produksi risol buah melibatkan peran Ibu-ibu Rumah Tangga. Pendistribusian dan penyaluran risol buah dilakukan melalui warung-warung atau kantin-kantin sekolah. Pengorganisasian usaha dilakukan oleh tiga orang mahasiswa (satu orang ketua dan dua anggota).</p>','RISOL BUAH|RISOLES|SOL BULE MADONNA|MAKANAN|SEHAT',1,1,'2019-03-09 01:03:48','2019-03-14 06:14:15'),(548,0,'Koci-koci Keramat (Ketela Rambat)','2019 17010644159 Ahmad Qolbi Nuron.pdf',NULL,5000000,'<p class=\"MsoNoSpacing\" style=\"text-align: justify; line-height: 115%; tab-stops: 14.2pt;\"><span style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; letter-spacing: -.05pt; mso-ansi-language: IN; mso-bidi-font-weight: bold;\">Pada zaman sekarang, jajanan pasar mulai kurang diminati oleh kalangan masyarakat luas. Karena bentuknya yang kurang menarik perhatian masyarakat<span style=\"mso-spacerun: yes;\">&nbsp; </span>dan kedudukannya yang dikalahkan dengan makanan cepat saji yang banyak mengandung bahan-bahan berbahaya bagi kesehatan tubuh kita. Kami menawarkan solusi untuk permasalahan diatas dengan produk olahan &ldquo;Koci-koci Keramat&rdquo; yang terbuat dari ketela rambat sehingga bebas akan bahan pengawet dan memiliki gizi yang tinggi untuk tubuh kita. Kami memiliki pemikiran untuk mengolah ketela rambat sebagai bahan dasar pembuatan koci-koci karena bahan tersebut sangat mudah didapatkan dan sangat bagus untuk dikonsumsi. Alasan kami membuat jajanan koci-koci sebagai produk kami yaitu kami ingin membuat sebuah inovasi dan kreativitas dari koci-koci yang awalnya tidak begitu diminati oleh masyarakat menjadi jajanan pasar yang sudah dimodifikasi mulai dari segi bahan dan bentuk agar terlihat lebih menarik supaya bisa diterima dan disukai oleh semua kalangan di masyarakat. </span><span lang=\"EN-US\" style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; background: white;\">Ditinjau dari segi ekonomi harga penjualan produk yang kami tawarkan ini cukup terjangkau di kalangan masyarakat, bahan baku mudah didapat harganya pun terbilang murah. Dan dari segi sosial, agroindustri yang bergerak pada bidang pengolahan </span><span style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; mso-ansi-language: IN;\">Koci-koci Keramat</span><span lang=\"EN-US\" style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; background: white;\"> ini dapat menampung pengangguran untuk dijadikan sebagai pekerja yang mengolah dan menyediakan bahan baku dengan cara budidaya </span><span style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; background: white; mso-ansi-language: IN;\">ketela rambat</span><span lang=\"EN-US\" style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; background: white;\">. Jika produk </span><span style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; mso-ansi-language: IN;\">Koci-koci Keramat</span><span style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\';\"> <span lang=\"EN-US\" style=\"background: white;\">ini diproduksi secara massal dan diterapkan atau disosialisasikan ke masyarakat luas bahkan sampai ke seluruh negara</span></span><span style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; background: white; mso-ansi-language: IN;\">. Maka produk ini akan bisa menjadi produk unggulan dari Indonesia. </span><span style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; mso-ansi-language: IN;\">Adanya <span style=\"background: white;\">agroindustri yang bergerak pada bidang pengolahan </span>Koci-koci Keramat<span style=\"background: white;\"> ini juga dapat menampung para pengangguran untuk dijadikan sebagai pekerja yang mengolah dan menyediakan bahan baku dengan cara budidaya ketela rambat. Dengan demikian maka ketela rambat yang didapat pasti akan terjamin kualitasnya. Meskipun sekarang sudah banyak variasi makanan baru, tetapi olahan </span>Koci-koci Keramat<span style=\"background: white;\"> akan tetap disukai masyarakat dari berbagai kalangan sesuai dengan minat masyarakat dalam mengkonsumsi makanan cepat saji pada umumnya dengan mempertimbangkan manfaat yang terkandung dalam ketela rambat tersebut.</span></span></p>','koci-koci|jajanan pasar|ketela rambat',1,1,'2019-03-09 01:14:07','2019-03-18 16:31:17'),(549,0,'TANGGA DIARY (Tuk Aku Yang Berharga DIARY)','2019 16010664028 Suci Gita Mawarni.pdf',NULL,7110000,'<p><span style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',serif; mso-fareast-font-family: Calibri; letter-spacing: -.05pt; mso-ansi-language: EN-ID; mso-fareast-language: EN-US; mso-bidi-language: AR-SA;\">TANGGA DIARY adalah singkatan dari \'Tuk Aku Yang Berharga yakni sebuah buku diary sebagai bentuk penolong pertama bagi individu yang mengalami kondisi stress atau depresi.&nbsp;</span><span style=\"font-family: \'Times New Roman\', serif; font-size: 12pt; letter-spacing: -0.05pt;\">Dalam buku ini tidak hanya menyediakan lembaran kosong untuk menumpahkan segala keluh kesahnya melainkan juga berisi beberapa metode untuk membantu mengatasi masalah dari individu tersebut. Sesuai namanya, yakni TANGGA, maka diawal buku tersebut akan ditulis sebuah peraturan dalam menuliskan masalahnya. Kemudian, akan ditunjukkan sebuah tangga untuk melihat dimanakah titik mereka. Buku ini juga dilengkapi sebagai </span><em style=\"font-family: \'Times New Roman\', serif; font-size: 12pt; letter-spacing: -0.05pt;\">moodtracker </em><span style=\"font-family: \'Times New Roman\', serif; font-size: 12pt; letter-spacing: -0.05pt;\">selama satu tahun dengan diharapkan individu dapat melihat apakah buku TANGGA DIARY mampu untuk memperbaiki mood mereka dengan menyerap sampah psikologis dari individu tersebut. Tidak hanya itu, kemudian buku ini berisi beberapa metode sebagai </span><em style=\"font-family: \'Times New Roman\', serif; font-size: 12pt; letter-spacing: -0.05pt;\">emotional release </em><span style=\"font-family: \'Times New Roman\', serif; font-size: 12pt; letter-spacing: -0.05pt;\">yang akan di diskusikan dengan Psikolog sehingga metode ini dapat dipertanggung jawabkan dan aman.&nbsp;</span><span style=\"font-family: \'Times New Roman\', serif; font-size: 12pt; letter-spacing: -0.05pt; text-align: justify;\">Buku ini juga membangun sugesti positif pada diri individu dengan menyisipkan kalimat motivasi dan juga list lagu yang positif bagi diri individu. Dihalaman terakhir, kami akan kembali membuat tangga untuk melihat apakah tedapat perkembangan pada individu. Apabila tidak, individu&nbsp; dapat menghubungi psikolog online yang di fasilitasi oleh kami pada halaman belakang.</span></p>\n<p class=\"MsoNoSpacing\" style=\"text-align: justify; line-height: 150%; tab-stops: 14.2pt;\">&nbsp;</p>','writing therapy|emotional release',4,1,'2019-03-09 02:08:27','2019-03-14 23:22:41'),(550,0,'SIMI (STIK MIE TELUR)','2019 17010024068 Echa Maretha Larasati.pdf',NULL,5000000,'<p class=\"MsoNoSpacing\" style=\"margin-left: 14.2pt; line-height: 115%; tab-stops: 14.2pt;\"><span style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',serif; letter-spacing: -.05pt; mso-ansi-language: IN;\">Usaha SIMI ini berawal dari keinginan untuk memberikan inovasi mengenai pengelolaan mie menjadi makanan yang digemari masyarakat. Dengan adanya pendampingan usaha melalui PMW, diharapkan usaha SIMI dapat menjadi makanan yang sehat untuk dikonsumsi oleh masyarakat. Kandungan </span><span lang=\"EN-US\" style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',serif; letter-spacing: -.05pt;\">yang terdapat</span> <span lang=\"EN-US\" style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',serif; letter-spacing: -.05pt;\">disetiap</span> <span lang=\"EN-US\" style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',serif; letter-spacing: -.05pt;\">varian SIMI baik</span> <span lang=\"EN-US\" style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',serif; letter-spacing: -.05pt;\">untuk</span> <span lang=\"EN-US\" style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',serif; letter-spacing: -.05pt;\">kesehatan</span> <span lang=\"EN-US\" style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',serif; letter-spacing: -.05pt;\">karena</span> <span lang=\"EN-US\" style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',serif; letter-spacing: -.05pt;\">mengandung</span> <span lang=\"EN-US\" style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',serif; letter-spacing: -.05pt;\">berbagai</span> <span lang=\"EN-US\" style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',serif; letter-spacing: -.05pt;\">nilai</span> <span lang=\"EN-US\" style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',serif; letter-spacing: -.05pt;\">gizi. </span></p>\n<p class=\"MsoNoSpacing\" style=\"margin-left: 14.2pt; line-height: 115%; tab-stops: 14.2pt;\"><span lang=\"EN-US\" style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',serif; letter-spacing: -.05pt;\"><span style=\"mso-tab-count: 1;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span>Dengan</span> <span lang=\"EN-US\" style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',serif; letter-spacing: -.05pt;\">adanya</span> <span lang=\"EN-US\" style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',serif; letter-spacing: -.05pt;\">jajanan SIMI ini</span> <span lang=\"EN-US\" style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',serif; letter-spacing: -.05pt;\">akan</span> <span lang=\"EN-US\" style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',serif; letter-spacing: -.05pt;\">menumbuhkan</span> <span lang=\"EN-US\" style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',serif; letter-spacing: -.05pt;\">kreatifitas</span> <span lang=\"EN-US\" style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',serif; letter-spacing: -.05pt;\">pedaganag street food untuk</span> <span lang=\"EN-US\" style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',serif; letter-spacing: -.05pt;\">lebih</span> <span lang=\"EN-US\" style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',serif; letter-spacing: -.05pt;\">mengembangkan</span> <span lang=\"EN-US\" style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',serif; letter-spacing: -.05pt;\">bahan yang sudah</span> <span lang=\"EN-US\" style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',serif; letter-spacing: -.05pt;\">ada</span> <span lang=\"EN-US\" style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',serif; letter-spacing: -.05pt;\">dan</span> <span lang=\"EN-US\" style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',serif; letter-spacing: -.05pt;\">dianggap</span> <span lang=\"EN-US\" style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',serif; letter-spacing: -.05pt;\">sebagai</span> <span lang=\"EN-US\" style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',serif; letter-spacing: -.05pt;\">makanan yang tidak</span> <span lang=\"EN-US\" style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',serif; letter-spacing: -.05pt;\">sehat</span> <span lang=\"EN-US\" style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',serif; letter-spacing: -.05pt;\">bagi</span> <span lang=\"EN-US\" style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',serif; letter-spacing: -.05pt;\">masyarakat</span> <span lang=\"EN-US\" style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',serif; letter-spacing: -.05pt;\">menjadi</span> <span lang=\"EN-US\" style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',serif; letter-spacing: -.05pt;\">makanan yang kaya akan</span> <span lang=\"EN-US\" style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',serif; letter-spacing: -.05pt;\">nilai</span> <span lang=\"EN-US\" style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',serif; letter-spacing: -.05pt;\">gizi. Usaha ini</span> <span lang=\"EN-US\" style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',serif; letter-spacing: -.05pt;\">nantinya</span> <span lang=\"EN-US\" style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',serif; letter-spacing: -.05pt;\">diharapkan</span> <span lang=\"EN-US\" style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',serif; letter-spacing: -.05pt;\">mampu</span> <span lang=\"EN-US\" style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',serif; letter-spacing: -.05pt;\">bersaing</span> <span lang=\"EN-US\" style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',serif; letter-spacing: -.05pt;\">dengan street food yang sudah</span> <span lang=\"EN-US\" style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',serif; letter-spacing: -.05pt;\">terkenal</span> <span lang=\"EN-US\" style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',serif; letter-spacing: -.05pt;\">lainnya.</span></p>','Olahan Mie',1,1,'2019-03-09 02:09:45','2019-03-14 22:37:03'),(551,0,'LUMORA (Bolu Moringa Oleifera/Kelor)','2019 17010024061 Muhimatul Aliyah.pdf',NULL,8175500,'<p><span lang=\"IN\" style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',serif; mso-fareast-font-family: Calibri; letter-spacing: -.05pt; mso-ansi-language: IN; mso-fareast-language: EN-US; mso-bidi-language: AR-SA;\">Usaha pengelolaan bolu <em>moringa oleifera</em> / kelor ini berawal dari keinginan untuk memberikan inovasi terhadap masyarakat mengenai pengelolaan daun kelor yang dapat dijadikan camilan sehat dengan tampilan baru yang mudah untuk dikonsumsi. Dengan adanya pendampingan melalui PMW, diharapkan bolu <em>moringa oleifera</em> / kelor ini dapat menjadi makanan yang sehat untuk dikonsumsi masyarakat. Kandungan yang dimiliki oleh daun kelor sendiri sangat bergizi untuk kebutuhan dan kesehatan tubuh ditambah dengan aneka macam topping yang disediakan agar konsumen dapat menikmati sesuai dengan keinginannya. Pengolahan bolu ini menjadi makanan modern dengan bahan baku yang relatif mudah didapat, sehingga dapat membuka peluang untuk usaha bagi masyarakat.&nbsp;</span><span style=\"font-size: 12.0pt; mso-bidi-font-size: 11.0pt; line-height: 115%; font-family: \'Times New Roman\',serif; mso-fareast-font-family: Calibri; mso-ansi-language: EN-US; mso-fareast-language: EN-US; mso-bidi-language: AR-SA;\">Pada masa pertumbuhan bayi dan anak-anak sangat dianjurkan oleh Organisasi Kesehatan Dunia atau WHO untuk mengkonsumsi daun kelor. Perbandingan gram daun kelor mengandung 7x vitamin pada jeruk, 4x calcium pada susu, 4x vitamin pada wortel, 2x protein pada susu, 3x potassium pada pisang. Jelas sudah kandungan dalam kelor yang dapat menyehatkan tubuh manusia.</span></p>','Bolu Kelor Rasa Rasa',1,1,'2019-03-09 04:35:05','2019-03-14 20:19:38'),(552,0,'DARI DASI JADI MEBEL (Dari Dua Dimensi Jadi Jasa Desain Media Pembelajaran )','2019 17010024047 MIFTAQNUR INANIK.pdf',NULL,4427000,'<p class=\"MsoListParagraphCxSpFirst\" style=\"margin-left: 0cm; mso-add-space: auto; text-align: justify; text-indent: 36.0pt;\"><span style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\';\">Pendidikan sebagai salah satu sektor yang paling penting dalam pembangunan nasional yang dapat dijadikan sebagai andalan utama untuk berfungsi semaksimal mungkin dalam upaya meningkatkan kualitas hidup masyarakat Indonesia. Didalam aktivitas pendidikan pun ada 6 faktor yang mempengaruhi, salah satu diantaranya adalah faktor pendidik.</span></p>\n<p class=\"MsoListParagraphCxSpMiddle\" style=\"margin-left: 0cm; mso-add-space: auto; text-align: justify; text-indent: 36.0pt;\"><span style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\';\">Ada beberapa cara dari pendidik dalam menyampaikan materi, salah satunya yaitu melalui media pembelajaran. Media pembelajaran merupakan salah satu faktor penting dalam peningkatan kualitas pembelajaran. Hal tersebut disebabkan oleh adanya perkembangan teknologi dalam bidang pendidikan yang menuntut efisiensi dan efektivitas dalam pembelajaran. Untuk mencapai tingkatan yang optimal, salah satu upaya yang dilakukan adalah menggunakan media pembelajaran yang tepat.<span style=\"mso-spacerun: yes;\">&nbsp; </span>Namun seringkali penggunaan media pembelajaran yang kurang tepat menimbulkan kebosenan pada peserta didik.</span></p>\n<p class=\"MsoListParagraphCxSpMiddle\" style=\"margin-left: 0cm; mso-add-space: auto; text-align: justify; text-indent: 36.0pt;\"><span style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\';\">Di Unesa sendiri banyak sekali mahasiswa yang membuat penelitian atau skripsi tentang pemanfaatan media dalam pembelajaran. Namun tidak semua mahasiswa memiliki potensi dalam pembuatan media pembelajaran. Untuk jasa yang tersedia di Unesa sendiri pun sangat minim sehingga hal tersebut menjadi peluang bagi kami mahasiswa S1 Teknologi Pendidikan yang telah dibekali tentang ilmu media pembelajaran yang tepat berinisiatif untuk membuka jasa desain dua dimensi menjadi jasa media pembelajaran.</span></p>\n<p class=\"MsoListParagraphCxSpLast\" style=\"margin-left: 0cm; mso-add-space: auto; text-align: justify; text-indent: 36.0pt;\"><span style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\';\">Harapan usaha ini dapat menekan kesenjangan antara para mahasiswa yang membutuhkan dengan orang yang membuka jasa layanan pembuatan media. Tidak harus mahal namun juga harus tepat<span style=\"mso-spacerun: yes;\">&nbsp; </span>dan dapat memberikan solusi bagi mahasiswa. Selama jasa pendidikan dan pembelajaran dibutuhkan maka buku dan media dua dimensi lainya juga dibutuhkan serta pastinya jasa pembuatan media pembelajaran pun juga dibutuhkan.</span></p>','Jasa Desain|Media Pembelajaran|Desain Dua Dimmensi',2,1,'2019-03-09 06:04:24','2019-03-15 14:19:10'),(553,0,'KAOS LUKIS KREASI (SURE)','2019 17040254119 Moh. Akbar Firdaus.pdf',NULL,3000000,'<p class=\"MsoNoSpacing\" style=\"text-align: justify; text-justify: inter-ideograph; line-height: 115%; tab-stops: 14.2pt;\"><span style=\"font-size: 12pt; line-height: 115%; font-family: \'Times New Roman\', serif; letter-spacing: -0.05pt;\">&ldquo;KAOS LUKIS KREASI (SURE)&rdquo; Merupakan produk inovasi dalam hal fashion design dimana banyak kita ketahui bahwa Kaos yang dijual dipasaran kebanyakan merupakan Kaos hasil sablonan dan jarang sekali bahkan hampir tidak ada kaos yang produksinya dengan cara dilukis.Oleh Karena itu kita mencoba untuk berinovasi dengan membuat suatu produk yang ada menjadi lebih bernilai dan menarik yaitu dengan membuat Kaos Lukis ini. Kaos Lukis ini tergolong Inovasi yang memang sudah ada akan tetapi kurang dalam hal Pemanfaatan bagi Wirausaha,Padaha jika dikembangkan Lagi Bisnis Kaos ini dapat mendatangkan Keuntungan Yang Cukup Lumayan.</span></p>\n<p class=\"MsoNoSpacing\" style=\"text-align: justify; text-justify: inter-ideograph; line-height: 115%; tab-stops: 14.2pt;\"><span style=\"font-size: 12pt; line-height: 115%; font-family: \'Times New Roman\', serif; letter-spacing: -0.05pt;\">Kaos Lukis ini memiliki keunggulan dalam Cara Produksi dan juga Kemasan yang digunakan.yakni kita menggunakan Karton ataupun Plastik Klip Tebal dalam Pemasarannya.Kaos yang digunakan dalam Produksi ini menggunakan Kaos Kualitas terbaik yang nyaman dipakai dan menyerap keringat sehingga sangat cocok digunakan untuk sehari-hari. Kaos sebagai bahan Lukis Memiliki berbagai Pilihan warna Kaos diantaranya Warna Hitam,Putih,Army dan Warna Pink. Saat ini Warna Yang Digunakan dalam Pembuatan Kaos Lukis hanya tersedia beberapa pilihan akan tetapi dalam kedepannya kita berencana menyediakan warna baru yang lebih inovatif lagi.</span></p>\n<p><span style=\"font-size: 12pt; line-height: 115%; font-family: \'Times New Roman\', serif; letter-spacing: -0.05pt;\">Kegiatan Produksi Pembuatan Kaos Lukis ini dilakukan secara Manual sesuai dengan Kreasi Pengrajin atau Permintaan Pesanan Yang Ada Sehingga Banyak Ide yang dapat dikreasikan kedalam Pembuatan Kaos Lukis Ini. Harga Bahan Yang Tidak Terlalu Mahal Serta Alat Digunakan Yang Cukup Sederhana Dapat Mengirit Biaya Produksi.Selain Itu, Dalam Produksi Kaos Lukis ini dapat menekean Angka Pengangguran Di Masyarakat Karena Proses Pembuatan Yang dilakukan Secara Manual.</span></p>','lukisan|kaos|kreatif|kaoslukis|kerajian',4,1,'2019-03-09 13:14:31','2019-03-14 22:08:23'),(554,0,'ICERT (Islamic Design Art)','2019 17010024081 Adinda Gea Hasna Paramastri.pdf',NULL,11658000,'<p class=\"MsoListParagraph\" style=\"margin-left: 64.35pt; mso-add-space: auto;\"><span style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\';\">Prospek pengembangan usaha </span><span lang=\"IN\" style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; mso-ansi-language: IN;\">desain sekaligus cetak bisa online maupun offline </span><span style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\';\">ini mengikuti perkembangan zaman Revolusi Industri 4.0 yaitu </span><span lang=\"IN\" style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; mso-ansi-language: IN;\">Artificial Intelligence dengan bertemakan Islam. Karena diluar sana, masih banyak konsumen yang ingin membeli jasa desain sekaligus cetak dengan mengedepankan unsur islami contohnya seperti undangan pernikahan online atau offline bertema kan islam. Keunggulan dari usaha ini berbeda dengan jasa desain lainnya mulai dari segi konsep atau tema yang banyak diminati masyarakat.</span></p>','jasa|design|art|islamic',2,1,'2019-03-09 13:58:51','2019-03-14 22:38:03'),(555,0,'DONASI (Donat Nasi) Solusi Praktis Sarapan Pagi','2019 17010664138 Aldiah Rosa Hayuningtiyas Putri.pdf',NULL,5250000,'<p class=\"MsoNormal\" style=\"text-align: justify;\"><span lang=\"EN-ID\" style=\"font-size: 12.0pt; mso-bidi-font-size: 11.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; mso-ansi-language: EN-ID;\">DONASI (Donat Nasi) merupakan produk inovatif yang berbahan dasar nasi dan dibentuk seperti donat. Dengan bentuk yang seperti donat dan dibungkus dengan <em>paper bag </em>seperti pada restoran cepat saji, akan memudahkan konsumen dalam mengkonsumsinya. DONASI (Donat Nasi) ini memiliki tiga varian isi yaitu ayam, sosis, dan jamur. DONASI (Donat Nasi) ini tidak mengandung <em>MSG </em>&nbsp;sehingga aman untuk dikonsumsi. Target pasar penjualan produk ini adalah seluruh civitas akademika UNESA dan masyarakat umum. Modal dalam pembuatan produk ini adalah Rp. 5.250.000 yang akan menghasilkan sekitar 1250 pcs. Harga jual produk ini berkisar antara Rp. 6000 &ndash; Rp. 7000, sehingga akan menghasilkan laba kurang lebih Rp. 2.700.000. DONASI (Donat Nasi) merupakan solusi bagi konsumen yang ingin sarapan dengan praktis dengan harga terjangkau.</span></p>','Donat Nasi|Sarapan|Praktis|Terjangkau',1,1,'2019-03-10 17:33:48','2019-03-14 18:48:30'),(556,0,'HUFAN FANTASY','2019 17081194017 Febby Isan Kurniasari.pdf',NULL,5000000,'<p><span lang=\"IN\" style=\"mso-ascii-font-family: \'Times New Roman\'; mso-ascii-theme-font: major-bidi; mso-hansi-font-family: \'Times New Roman\'; mso-hansi-theme-font: major-bidi; mso-bidi-font-family: \'Times New Roman\'; mso-bidi-theme-font: major-bidi; color: black; mso-ansi-language: IN;\">hufan ini adalah produk berbahan baku tahu yang memiliki isi bihun wortel, seledri, dan daun bawang. tahu ini memiliki varian isi yang memiliki 3 macam varian. yang pertama berisi sosis, yang kedua berisi telur puyuh, yang ketiga berisi keju mozzarela. H</span><span style=\"mso-ascii-font-family: \'Times New Roman\'; mso-ascii-theme-font: major-bidi; mso-hansi-font-family: \'Times New Roman\'; mso-hansi-theme-font: major-bidi; mso-bidi-font-family: \'Times New Roman\'; mso-bidi-theme-font: major-bidi; color: black;\">ufan juga memiliki varian ukuran yaitu ukuran kecil dan besar. Hufan juga memiliki 2 jenis varian yang dijual yaitu varian frozen yang bisa digoreng atau dikukus sendiri oleh konsumen, ada juga varian siap saji yang sudah digoreng dan ditaruh dikemasan</span></p>\n<p style=\"font-variant-ligatures: normal; font-variant-caps: normal; orphans: 2; text-align: start; widows: 2; -webkit-text-stroke-width: 0px; text-decoration-style: initial; text-decoration-color: initial; word-spacing: 0px;\"><span lang=\"IN\" style=\"mso-ascii-font-family: \'Times New Roman\'; mso-ascii-theme-font: major-bidi; mso-hansi-font-family: \'Times New Roman\'; mso-hansi-theme-font: major-bidi; mso-bidi-font-family: \'Times New Roman\'; mso-bidi-theme-font: major-bidi; color: black; mso-ansi-language: IN;\">hufan ini produk olahan tahu yang baru</span> <span style=\"mso-ascii-font-family: \'Times New Roman\'; mso-ascii-theme-font: major-bidi; mso-hansi-font-family: \'Times New Roman\'; mso-hansi-theme-font: major-bidi; mso-bidi-font-family: \'Times New Roman\'; mso-bidi-theme-font: major-bidi; color: black;\">ada dan </span><span lang=\"IN\" style=\"mso-ascii-font-family: \'Times New Roman\'; mso-ascii-theme-font: major-bidi; mso-hansi-font-family: \'Times New Roman\'; mso-hansi-theme-font: major-bidi; mso-bidi-font-family: \'Times New Roman\'; mso-bidi-theme-font: major-bidi; color: black; mso-ansi-language: IN;\"><span style=\"mso-spacerun: yes;\">&nbsp;</span>beredar di masyarakat. hufan ini baik untuk kalangan manapun mulai dari balit</span><span style=\"mso-ascii-font-family: \'Times New Roman\'; mso-ascii-theme-font: major-bidi; mso-hansi-font-family: \'Times New Roman\'; mso-hansi-theme-font: major-bidi; mso-bidi-font-family: \'Times New Roman\'; mso-bidi-theme-font: major-bidi; color: black;\">a</span><span lang=\"IN\" style=\"mso-ascii-font-family: \'Times New Roman\'; mso-ascii-theme-font: major-bidi; mso-hansi-font-family: \'Times New Roman\'; mso-hansi-theme-font: major-bidi; mso-bidi-font-family: \'Times New Roman\'; mso-bidi-theme-font: major-bidi; color: black; mso-ansi-language: IN;\">,remaja,dewasa,hingga lanjut usia. hufan sendiri memiliki tekstur yang lembut dan mudah dicerna bagi kalangan lanjut usia.</span> <span style=\"mso-ascii-font-family: \'Times New Roman\'; mso-ascii-theme-font: major-bidi; mso-hansi-font-family: \'Times New Roman\'; mso-hansi-theme-font: major-bidi; mso-bidi-font-family: \'Times New Roman\'; mso-bidi-theme-font: major-bidi; color: black;\">Hufan sendiri memiliki rasa yang pas juga untuk camilan dan cocok juga untuk buka puasa, karena tekstur nya yang lembut dan isinya yang padat dan disetiap lapisan hufan tersebut diisi dengan varian isi yang merata.</span></p>','makanan|kekinian|tahudengan isian|mozzarela|telur puyuh|sosis|tahu|maknyuuus',1,1,'2019-03-10 17:49:28','2019-03-20 01:24:12'),(557,0,'Memanfaatkan Limbah Cangkang Telur Menjadi Seni Hias \"Griya Kangmas\" DIHANA','2019 17080314097 Nabila Nada Tuffahati.pdf',NULL,5000000,'<p>Usaha yang kami jalankan adalah usaha membuat seni yang menambahkan cangkang telur sebagai seni yang Menjadi pendukung keindahan seni kami. Griya Kangmas dihana memiliki produk unggulan yaitu mahar nikah Dan juga produk lainnya adalah seni hias untuk hadiah wisuda, ulang tahun, dll.</p>','Cangkang|Griya Kangmas|Mahar|Seni Hias',4,1,'2019-03-10 19:35:08','2019-03-14 21:54:35'),(558,0,'Crestige Jewelry','2019 16080574141 Dzikrulli Fadhyl Aziz Ibrahim.pdf',NULL,7388800,'<p class=\"MsoNoSpacing\" style=\"margin-left: 14.2pt; text-align: justify; text-justify: inter-ideograph; line-height: 115%; tab-stops: 14.2pt;\"><span style=\"font-size: 12.0pt; line-height: 115%; letter-spacing: -.05pt;\">Usaha kami memiliki nama &ldquo;Crestige&rdquo; yang berasal dari singkatan <em style=\"mso-bidi-font-style: normal;\">creative, resin, prestige</em>. Bergerak dalam kegiatan usaha manufaktur aksesoris berbahan resin yang mengusung kesan modern, kreatif, dan estetis yang memiliki target utama perempuan usia 16-30 tahun. Maka dari itu kami membuat produk dengan tema yang cocok untuk target pasar kami tersebut. Antara lain, tema bunga, zodiak keindahan laut, hutan, dan buah.</span></p>','resin|kerajinan|kreatif|handmade|handcraft|kerajinan tangan|seni|jewelry|aksesoris|perhiasan|cincin|kalung|unik',4,1,'2019-03-10 20:21:39','2019-03-19 23:14:58'),(559,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,1,'2019-03-10 20:33:25','2019-03-13 05:36:58'),(560,0,'KRITOS (Kreasi Totebag Sulam)','2019 17010024069 Pratiwi Dwi Agustin.pdf',NULL,5633000,'<div class=\"WordSection1\">\r\n<p class=\"MsoNoSpacing\" style=\"text-align: justify; line-height: 115%; tab-stops: 14.2pt;\"><strong><span style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; letter-spacing: -.05pt;\">&nbsp;</span></strong></p>\r\n<p class=\"MsoNoSpacing\" style=\"text-align: justify; line-height: 115%; tab-stops: 14.2pt;\"><span style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; letter-spacing: -.05pt; mso-bidi-font-weight: bold;\">&nbsp;&nbsp;&nbsp;&nbsp; KRITOS (Kreasi Totebag Sulam) adalah sebuah totebag hias dengan kreasi teknik sulam pada desainnya. </span><span style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\';\">. Tote bag merupakan model tas zaman sekarang yang sedang digemari oleh masyarakat terutama anak remaja. Salah satu daya tarik totebag adalah bentuknya yang stylish dan juga dapat digunakan disegala situasi. Selain itu desain totebag yang tidak monoton dan dapat dikreasikan sendiri. Dengan menggunakan bahan dari kain blaco yang kuat dan unik juga merupakan salah satu keunggulan dari produk ini. &nbsp;</span></p>\r\n</div>\r\n<p><span style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; mso-fareast-font-family: Calibri; mso-ansi-language: EN-US; mso-fareast-language: EN-US; mso-bidi-language: AR-SA;\">&nbsp;</span></p>','KRITOS|Totebag Sulam|Kreasi Totebag',4,1,'2019-03-10 22:42:02','2019-03-14 22:12:57'),(561,0,'KRISTIK SYANTIK','2019 17080314010 Wakhidatur Rokhmani Citra Rivai.pdf',NULL,5300000,'<p>Kristik Syantik merupakan usaha kerajinan tangan di bidang Industri Kreatif. Kristik ini merupakan kerajinan tangan zaman tahun 90-an yang kini sudah sangat jarang ditemukan. Oleh karenanya kami mengembangkan kembali usaha ini dengan model yang lebih modern seiring dengan perkembangan zaman. Kami juga memiliki model dan gambar yang bermacam-macam dan tulisan yang sesuai pesanan konsumen, selain Itu pemgemasan kami pun menarik dengan diberi pernak-pernik, sehingga membuatnya tampak lebih menarik untuk dipandang.&nbsp;</p>','KRISTIK SYANTI|DEKORASI RUMAH',4,1,'2019-03-10 23:11:54','2019-03-15 07:05:48'),(562,0,'Yolo Tropicanos Ice Cream (with Soya Yogurt and Aloe Vera)','2019 16030204020 Nada Tsaniya Salsabila.pdf',NULL,14908500,'<p>&nbsp;</p>\r\n<p style=\"margin: 0px; text-align: justify; line-height: 115%;\"><span style=\"margin: 0px; line-height: 115%; letter-spacing: -0.05pt; font-family: \'Times New Roman\',serif; font-size: 12pt;\">Kesadaran masyarakat akan <em style=\"mso-bidi-font-style: normal;\">lifestyle </em>sehat saat ini semakin meningkat. Hal ini dapat terjadi karena semakin sering dijumpai penyakit-penyakit kronis yang berbahaya. Salah satu factor penyebab dari penyakit-penyakit tersebut yaitu pola makan. Masyarakat saat ini cenderung selektif dalam memilih makanan contohnya menghindari makanan dengan kalori tinggi untuk diet, menghindari makanan manis agar mengurangi resiko diabetes, atau menghindari suatu kandungan laktosa didalam susu sapi karena alergi. Tentu hal itu sangat menyiksa ketika ingin tetap mengkonsumsi makanan tetapi takut kesehatan akan terganggu. </span><span style=\"margin: 0px; line-height: 115%; letter-spacing: -0.05pt; font-family: \'Times New Roman\',serif; font-size: 12pt;\">Makanan yang sampai saat ini masih menjadi primadona dari waktu kewaktu ialah ice cream. Ice cream <span style=\"margin: 0px;\">&nbsp;</span>disukai oleh hampir semua kalalangan. Pentingnya mengetahui komposisi ice cream adalah <span style=\"margin: 0px;\">&nbsp;</span>agar dapat mengetahui manfaat yang ada didalamnya. Salah satu inovasi ice cream sehat yaitu Yolo Tropicanos Ice Cream yaitu ice cream berbahan dasar soya yogurt yang dipadukan dengan Aloe vera dengan topping buah-buahan tropical dan coklat. Produk ini merupakan inovasi baru dengan rasa dan penampilan yang menarik. Cara promosi yang kreatif menggunakan social media dan media-media lain yang mendukung memungkinkan produk ini dikenal oleh masyarakat luas dan menjadi produk <em style=\"mso-bidi-font-style: normal;\">trendsetter.</em></span></p>','Soya Yogurt, Aloe Vera,  Ice Cream, Lifestyle',1,1,'2019-03-11 00:16:17','2019-03-14 06:24:42'),(563,0,'TUGO  (Sepatu Goni)','2019 17010024011 Jihan Fitria.pdf',NULL,7000000,'<p>Sepatu Ramah Lingkungan dan Artistik sebagai Upaya Peningkatan Sumber Daya Lokal.</p>','TUGO (Sepatu Goni)|TUGO',4,1,'2019-03-11 01:36:03','2019-03-14 18:44:41'),(564,0,'BOUQEENA (BOUQUET MUKENA SEBAGAI SOUVENIR CANTIK EVENT KAMPUS DAN PENUNJANG PERALATAN IBADAH)','2019 16010664004 Nadhifah elfitasari.pdf',NULL,13266500,'<p class=\"MsoNoSpacing\" style=\"text-align: justify; line-height: 115%; tab-stops: 14.2pt;\"><span style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; letter-spacing: -.05pt;\">Buket merupakan hadiah yang umum dan sering diberikan sebagai kado atau souvenir moment penting di kampus,. Misalnya menjelang seminar proposal skripsi, seminar skirpsi, maupun saat wisuda. Biasanya, buket yang diberikan berupa buket bunga dan buket snack. Keunikan dari usaha ini adalah pemanfaatan mukena yang digunakan sebagai buket. Mukena dipilih sebagai bahan pengganti bunga karena dinilai dapat menghasilkan warna yang indah pula. Selain itu, dengan menggunakan mukena, maka tidak perlu khawatir jika buket tidak bisa disimpan dalam waktu yang lama, karena terbuat dari kain. Mukena yang dipilih adalah mukena berbahan kain parasut. Sehingga mukena akan mudah dibentuk dan memiliki hasil yang mengkilap dan cantik layaknya bunga. Selain itu, kami menambah nilai jual mukena yang tidak hanya langsung dibeli dan digunakan untuk beribadah, namun juga dapat digunakan sebagai souvenir dan kado cantik bagi mahasiswa/i dalam merayakan event kampus. Manfaat bagi masyarakat luas, usaha ini sangat memberikan manfaat terutama dalam penyedia souvenir, kado, maupun peralatan ibadah yang dikemas unik dan elegan dengan harga yang terjangkau </span><span style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; background: white;\">yaitu mulai dari Rp 60.000 sampai dengan Rp 300.000 yang disesuaikan dengan keinginan pembeli akan model mukenah. </span><span style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; letter-spacing: -.05pt;\">Keunggulan dari usaha ini adalah belum adanya produsen buket mukena yang ditujukan pada mahasiwa terutama di UNESA, wilayah Surabaya dan sekitarnya. Kemudian buket mukena dapat digunakan sebagai penunjang peralatan shalat. Sehingga, selain sebagai kado atau souvenir, buket mukena ini dapat digunakan untuk menambah koleksi peralatan shalat pembeli. Buket mukena juga memiliki manfaat ganda. Artinya, setelah mukena berbentuk buket ini ketika sudah tidak ingin di simpan saja pun, buket dapat di lepas ulang dan masih dapat digunakan sebagai peralatan shalat sebagaimana mestinya. Jadi, buket mukena ini akan tetap terpakai walaupun sudah berbeda bentuk. Pemanfaatan buket mukena ini memiliki target pasar yang cukup luas. Tidak hanya mahasiswa putri saja yang dapat menggunakan maupun membelinya. Sebab mahasiswa putra juga dapat membelinya sebagai kado/souvenir kepada seseorang. Selain itu, lebih luas lagi pembeli tidak hanya bisa dari kalangan mahasiswa, tetapi juga dari pihak dosen dan staff/karyawan, bahkan masyarakat luas pun dapat menjadi sasaran usaha.</span></p>\n<p class=\"MsoNormal\"><strong style=\"mso-bidi-font-weight: normal;\">&nbsp;</strong></p>','Bouquet, Mukenah, Souvenier',4,1,'2019-03-11 02:23:04','2019-03-14 16:28:30'),(565,0,'Sushi Beras Merah Toping Bandeng (SHUBERABE)','2019 17010644164 RITA YULIYANTI.pdf',NULL,6300000,'<p>Menghadirkan inovasi terbaru di dalam dunia sushi. Tidak hanya sekedar mengganti nasi putih dengan nasi merah tapi juga kandungan gizi serta rendah karbohidrat sebagai alasan utama. Komponen pembentuk sushi nasi merah yang memiliki kandungan gizi yang sangat tinggi dapat memenuhi kebutuhan gizi harian. Dengan harga Rp. 15.000,00/porsi mampu menjangkau semua kalangan.&nbsp;</p>','Nori|Nasi merah|Bandeng|Mentimun|Diet|Gizi tinggi',1,1,'2019-03-11 03:20:51','2019-03-15 02:07:31'),(566,0,'CUP CAKE TAYO ( tauwa dan Hylocereus undatus/ buah naga, sebagai alternatif makanan sehat)','2019 17010644042 Fanny Tri Kusumawardani.pdf',NULL,5042000,'<p><!-- [if gte mso 9]><xml>\r\n <o:OfficeDocumentSettings>\r\n  <o:RelyOnVML/>\r\n  <o:AllowPNG/>\r\n </o:OfficeDocumentSettings>\r\n</xml><![endif]--><!-- [if gte mso 9]><xml>\r\n <w:WordDocument>\r\n  <w:View>Normal</w:View>\r\n  <w:Zoom>0</w:Zoom>\r\n  <w:TrackMoves/>\r\n  <w:TrackFormatting/>\r\n  <w:PunctuationKerning/>\r\n  <w:ValidateAgainstSchemas/>\r\n  <w:SaveIfXMLInvalid>false</w:SaveIfXMLInvalid>\r\n  <w:IgnoreMixedContent>false</w:IgnoreMixedContent>\r\n  <w:AlwaysShowPlaceholderText>false</w:AlwaysShowPlaceholderText>\r\n  <w:DoNotPromoteQF/>\r\n  <w:LidThemeOther>IN</w:LidThemeOther>\r\n  <w:LidThemeAsian>X-NONE</w:LidThemeAsian>\r\n  <w:LidThemeComplexScript>X-NONE</w:LidThemeComplexScript>\r\n  <w:Compatibility>\r\n   <w:BreakWrappedTables/>\r\n   <w:SnapToGridInCell/>\r\n   <w:WrapTextWithPunct/>\r\n   <w:UseAsianBreakRules/>\r\n   <w:DontGrowAutofit/>\r\n   <w:SplitPgBreakAndParaMark/>\r\n   <w:EnableOpenTypeKerning/>\r\n   <w:DontFlipMirrorIndents/>\r\n   <w:OverrideTableStyleHps/>\r\n  </w:Compatibility>\r\n  <m:mathPr>\r\n   <m:mathFont m:val=\"Cambria Math\"/>\r\n   <m:brkBin m:val=\"before\"/>\r\n   <m:brkBinSub m:val=\"&#45;-\"/>\r\n   <m:smallFrac m:val=\"off\"/>\r\n   <m:dispDef/>\r\n   <m:lMargin m:val=\"0\"/>\r\n   <m:rMargin m:val=\"0\"/>\r\n   <m:defJc m:val=\"centerGroup\"/>\r\n   <m:wrapIndent m:val=\"1440\"/>\r\n   <m:intLim m:val=\"subSup\"/>\r\n   <m:naryLim m:val=\"undOvr\"/>\r\n  </m:mathPr></