 115%; font-family: \'Times New Roman\',\'serif\'; mso-fareast-font-family: Ebrima; mso-ansi-language: IN;\">Indonesia merupakan negara tropis penghasil buah-buahan yang beragam. sebagai salah satu negara beriklim tropis tidak heran </span><span lang=\"EN-US\" style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; mso-fareast-font-family: Ebrima;\">apabila setiap</span><span style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; mso-fareast-font-family: Ebrima; mso-ansi-language: IN;\"> daerah di Indonesia memiliki lebih dari satu perkebunan buah</span><span lang=\"EN-US\" style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; mso-fareast-font-family: Ebrima;\">,</span><span style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; mso-fareast-font-family: Ebrima; mso-ansi-language: IN;\"> baik di</span> <span style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; mso-fareast-font-family: Ebrima; mso-ansi-language: IN;\">wilayah dataran tinggi </span><span lang=\"EN-US\" style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; mso-fareast-font-family: Ebrima;\">ataupun</span><span style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; mso-fareast-font-family: Ebrima; mso-ansi-language: IN;\"> dataran rendah. Namun disisi lain</span><span lang=\"EN-US\" style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; mso-fareast-font-family: Ebrima;\">,</span><span style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; mso-fareast-font-family: Ebrima; mso-ansi-language: IN;\"> banyak buah yang hanya tumbuh musiman, sehingga berpengaruh pada harga pemasarannya. </span><span lang=\"EN-US\" style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; mso-fareast-font-family: Ebrima;\">Diantara buah tersebut</span> <span lang=\"EN-US\" style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; mso-fareast-font-family: Ebrima;\">adalah</span><span style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; mso-fareast-font-family: Ebrima; mso-ansi-language: IN;\"> buah naga</span><span lang=\"EN-US\" style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; mso-fareast-font-family: Ebrima;\"> yang </span><span style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; mso-fareast-font-family: Ebrima; mso-ansi-language: IN;\">berasal dari negara</span> <span lang=\"EN-US\" style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; color: #222222; background: white;\">Meksiko, Amerika Tengah dan Amerika Selatan</span><span lang=\"EN-US\" style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; mso-fareast-font-family: Ebrima;\">.</span> <span lang=\"EN-US\" style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; mso-fareast-font-family: Ebrima;\">N</span><span style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; mso-fareast-font-family: Ebrima; mso-ansi-language: IN;\">amun</span><span lang=\"EN-US\" style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; mso-fareast-font-family: Ebrima;\">,</span><span style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; mso-fareast-font-family: Ebrima; mso-ansi-language: IN;\"> s</span><span lang=\"EN-US\" style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; mso-fareast-font-family: Ebrima;\">aat ini</span><span style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; mso-fareast-font-family: Ebrima; mso-ansi-language: IN;\"> buah naga </span><span lang=\"EN-US\" style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; mso-fareast-font-family: Ebrima;\">sudah banyak</span><span style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; mso-fareast-font-family: Ebrima; mso-ansi-language: IN;\"> dibudidayakan diberbagai </span><span lang=\"EN-US\" style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; mso-fareast-font-family: Ebrima;\">negara </span><span style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; mso-fareast-font-family: Ebrima; mso-ansi-language: IN;\">di</span><span lang=\"EN-US\" style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; mso-fareast-font-family: Ebrima;\"> Asia, salah satunya</span><span style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; mso-fareast-font-family: Ebrima; mso-ansi-language: IN;\"> Indo</span><span lang=\"EN-US\" style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; mso-fareast-font-family: Ebrima;\">n</span><span style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; mso-fareast-font-family: Ebrima; mso-ansi-language: IN;\">esia</span><span lang=\"EN-US\" style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; mso-fareast-font-family: Ebrima;\">. Hal tersebut di</span><span style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; mso-fareast-font-family: Ebrima; mso-ansi-language: IN;\">karena</span><span lang=\"EN-US\" style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; mso-fareast-font-family: Ebrima;\">kan</span><span style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; mso-fareast-font-family: Ebrima; mso-ansi-language: IN;\"> penanamannya yang mudah</span><span lang=\"EN-US\" style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; mso-fareast-font-family: Ebrima;\"> dan kecocokan dengan musim di Indonesia</span><span style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; mso-fareast-font-family: Ebrima; mso-ansi-language: IN;\">. </span><span lang=\"EN-US\" style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; mso-fareast-font-family: Ebrima;\">Buah naga di Indonesia termasuk buah musiman serta dijual dengan harga cukup murah yaitu Rp 8.000/kg. Permasalahannya adalah pada saat panen pemasokan dari kebuh buah naga meningkat pesat, namun penjualan di pasar tidak begitu banyak. Disisi lain, kondisi buah yang mudah busuk mengakibatkan pedagang membanting harga lebih murah lagi. Keadaan tersebut mengakibatkan petani mengalami kerugian besar. Oleh karena itu, kami ingin membuat inovasi buah naga yang dikemas secara modern namun tetap dikombinasikan dengan makanan tradisional dengan bahan utama dan tauwa yakni <strong style=\"mso-bidi-font-weight: normal;\">CUP CAKE TAYO (Tauwa dan <em style=\"mso-bidi-font-style: normal;\">Hylocereus Undatus</em>/Buah Naga</strong></span><strong style=\"mso-bidi-font-weight: normal;\"><span style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; mso-fareast-font-family: Ebrima; mso-ansi-language: IN;\">)</span></strong><strong style=\"mso-bidi-font-weight: normal;\"><span lang=\"EN-US\" style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; mso-fareast-font-family: Ebrima;\"> sebagai Alternatif Cemilan yang Menyehatkan </span></strong><span lang=\"EN-US\" style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; mso-fareast-font-family: Ebrima;\">. </span></p>\r\n<p class=\"MsoNormal\" style=\"text-indent: 36.0pt; line-height: 115%;\"><span lang=\"EN-US\" style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; mso-fareast-font-family: Ebrima;\">B</span><span style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; mso-fareast-font-family: Ebrima; mso-ansi-language: IN;\">uah naga merupakan buah manis berwarna merah yang berasal dari negara</span> <span lang=\"EN-US\" style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; color: #222222; background: white;\">Meksiko, Amerika Tengah dan Amerika Selatan</span><span lang=\"EN-US\" style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; mso-fareast-font-family: Ebrima;\">.</span> <span style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; mso-fareast-font-family: Ebrima; mso-ansi-language: IN;\"><span style=\"mso-spacerun: yes;\">&nbsp;</span>Buah naga </span><span style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; mso-ansi-language: IN;\">mengandung banyak nutrisi dan mineral yang </span><span lang=\"EN-MY\" style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; mso-ansi-language: EN-MY;\">membantu kesehatan tubuh</span><span style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; mso-ansi-language: IN;\">.</span><span lang=\"EN-US\" style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\';\"> Diantara manfaat buah naga adalah sebagai berikut membantu menjaga kesehatan kulit, mencegah kanker, menjaga kesehatan jantung, mencegah diabetes, dan meningkatkan kekebalan tubuh.</span><span style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; mso-ansi-language: IN;\"> Selain itu</span><span lang=\"EN-US\" style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\';\">,</span><span style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; mso-ansi-language: IN;\"> bahan</span><span lang=\"EN-US\" style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\';\"> utama</span><span style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; mso-ansi-language: IN;\"> lainnya </span><span lang=\"EN-US\" style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\';\">dalam produk ini </span><span style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; mso-ansi-language: IN;\">yaitu tauwa</span><span style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; mso-fareast-font-family: Ebrima; mso-ansi-language: IN;\">. Tauwa merupakan makanan tradisional khas Thionghoa yang terbuat dari sari kacang kedelai. Tauwa memiliki banyak manfaat bagi kesehatan, namun mayoritas masyarakat masih belum mengetahui. Diantara manfaat dari tauwa adalah </span><span style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; mso-ansi-language: IN;\">membantu merangsang keluarnya air susu ibu (ASI), dapat menurunkan resiko diabetes, dapat meringankan derita sakit seperti sakit tenggorokan, demam, dan lain-lain, dapat menurunkan diare, serta dapat membantu menurunkan kadar kolesterol. </span></p>\r\n<p><span style=\"font-size: 12.0pt; line-height: 150%; font-family: \'Times New Roman\',\'serif\'; mso-fareast-font-family: Ebrima; mso-ansi-language: IN; mso-fareast-language: EN-US; mso-bidi-language: AR-SA;\">Produk</span><span lang=\"EN-US\" style=\"font-size: 12.0pt; line-height: 150%; font-family: \'Times New Roman\',\'serif\'; mso-fareast-font-family: Ebrima; mso-ansi-language: EN-US; mso-fareast-language: EN-US; mso-bidi-language: AR-SA;\"> Cup Cake Tayo</span><em style=\"mso-bidi-font-style: normal;\"><span lang=\"EN-US\" style=\"font-size: 12.0pt; line-height: 150%; font-family: \'Times New Roman\',\'serif\'; mso-fareast-font-family: Ebrima; mso-ansi-language: IN; mso-fareast-language: EN-US; mso-bidi-language: AR-SA;\"> <span style=\"mso-spacerun: yes;\">&nbsp;</span></span></em><span style=\"font-size: 12.0pt; line-height: 150%; font-family: \'Times New Roman\',\'serif\'; mso-fareast-font-family: Ebrima; mso-ansi-language: IN; mso-fareast-language: EN-US; mso-bidi-language: AR-SA;\">ini akan dipasarkan dengan berbagai varian</span><span style=\"font-size: 12.0pt; line-height: 150%; font-family: \'Times New Roman\',\'serif\'; mso-fareast-font-family: Calibri; mso-ansi-language: EN-US; mso-fareast-language: EN-US; mso-bidi-language: AR-SA;\"> <span lang=\"EN-US\">rasa seperti </span></span><span style=\"font-size: 12.0pt; line-height: 150%; font-family: \'Times New Roman\',\'serif\'; mso-fareast-font-family: Calibri; mso-ansi-language: IN; mso-fareast-language: IN; mso-bidi-language: AR-SA;\">original, coklat, stowbery, dan green tea</span><span lang=\"EN-US\" style=\"font-size: 12.0pt; line-height: 150%; font-family: \'Times New Roman\',\'serif\'; mso-fareast-font-family: Calibri; color: red; mso-ansi-language: EN-US; mso-fareast-language: EN-US; mso-bidi-language: AR-SA;\">. </span><span lang=\"EN-US\" style=\"font-size: 12.0pt; line-height: 150%; font-family: \'Times New Roman\',\'serif\'; mso-fareast-font-family: Calibri; mso-ansi-language: EN-US; mso-fareast-language: EN-US; mso-bidi-language: AR-SA;\">Sedangkan pilihan <em style=\"mso-bidi-font-style: normal;\">topping</em>nya antara lain </span><span lang=\"EN-US\" style=\"font-size: 12.0pt; line-height: 150%; font-family: \'Times New Roman\',\'serif\'; mso-fareast-font-family: Calibri; mso-ansi-language: EN-US; mso-fareast-language: IN; mso-bidi-language: AR-SA;\">cokelat <em>chocochip, </em>sprinkle </span><span style=\"font-size: 12.0pt; line-height: 150%; font-family: \'Times New Roman\',\'serif\'; mso-fareast-font-family: Calibri; mso-ansi-language: IN; mso-fareast-language: IN; mso-bidi-language: AR-SA;\">,meses, dan oreo</span><span lang=\"EN-US\" style=\"font-size: 12.0pt; line-height: 150%; font-family: \'Times New Roman\',\'serif\'; mso-fareast-font-family: Calibri; mso-ansi-language: EN-US; mso-fareast-language: IN; mso-bidi-language: AR-SA;\">.<span style=\"mso-spacerun: yes;\">&nbsp; </span></span><span style=\"font-size: 12.0pt; line-height: 150%; font-family: \'Times New Roman\',\'serif\'; mso-fareast-font-family: Calibri; mso-ansi-language: IN; mso-fareast-language: EN-US; mso-bidi-language: AR-SA;\">Produk ini akan dijual</span><span lang=\"EN-US\" style=\"font-size: 12.0pt; line-height: 150%; font-family: \'Times New Roman\',\'serif\'; mso-fareast-font-family: Calibri; mso-ansi-language: EN-US; mso-fareast-language: EN-US; mso-bidi-language: AR-SA;\"> dengan dua pilihan yakni eceran (1 cup) atau paketan (berisi 4 cup). Pemasaran akan dilakukan</span><span style=\"font-size: 12.0pt; line-height: 150%; font-family: \'Times New Roman\',\'serif\'; mso-fareast-font-family: Calibri; mso-ansi-language: IN; mso-fareast-language: EN-US; mso-bidi-language: AR-SA;\"> di daerah Lidah Wetan, Babatan dan Kampus Unesa. Dengan adanya produk ini, diharapkan masyarakat akan membiasakan untuk hidup sehat melalui pilihan makanan dan minuman sehari-hari.<span style=\"mso-spacerun: yes;\">&nbsp; </span></span></p>','cup cake|buah naga|tauwa|makanan sehat',1,1,'2019-03-11 03:40:19','2019-03-15 12:10:16'),(567,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,'2019-03-11 03:47:17','2019-03-11 03:47:17'),(568,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,'2019-03-11 03:47:21','2019-03-11 03:47:21'),(569,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,'2019-03-11 03:47:21','2019-03-11 03:47:21'),(570,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,'2019-03-11 03:47:21','2019-03-11 03:47:21'),(571,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,'2019-03-11 03:47:22','2019-03-11 03:47:22'),(572,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,'2019-03-11 03:47:22','2019-03-1