 style=\"letter-spacing: -.05pt;\">j</span>adi mak<span style=\"letter-spacing: .05pt;\">a</span><span style=\"letter-spacing: -.15pt;\">n</span>an <span style=\"letter-spacing: .05pt;\">y</span>ang d<span style=\"letter-spacing: -.05pt;\">i</span>g<span style=\"letter-spacing: -.05pt;\">e</span>m<span style=\"letter-spacing: -.1pt;\">a</span>ri mas<span style=\"letter-spacing: .05pt;\">y</span><span style=\"letter-spacing: -.1pt;\">a</span>ra<span style=\"letter-spacing: -.05pt;\">k</span>at. <span style=\"letter-spacing: .15pt;\"><span style=\"mso-spacerun: yes;\">&nbsp;</span></span><span style=\"letter-spacing: -.05pt;\">D</span>en<span style=\"letter-spacing: -.05pt;\">g</span>an<span style=\"mso-spacerun: yes;\">&nbsp; </span>adan<span style=\"letter-spacing: -.05pt;\">y</span>a <span style=\"letter-spacing: .1pt;\"><span style=\"mso-spacerun: yes;\">&nbsp;</span></span>pe<span style=\"letter-spacing: -.05pt;\">n</span>da<span style=\"letter-spacing: -.15pt;\">m</span>p<span style=\"letter-spacing: -.05pt;\">i</span>ngan usaha <span style=\"letter-spacing: .1pt;\"><span style=\"mso-spacerun: yes;\">&nbsp;</span></span><span style=\"letter-spacing: .05pt;\">m</span>e<span style=\"letter-spacing: -.05pt;\">l</span>alui <span style=\"letter-spacing: .05pt;\"><span style=\"mso-spacerun: yes;\">&nbsp;</span></span><span style=\"letter-spacing: -.05pt;\">P</span><span style=\"letter-spacing: -.1pt;\">M</span>W, d<span style=\"letter-spacing: -.05pt;\">i</span>harap<span style=\"letter-spacing: -.05pt;\">k</span>an usaha Tempe Bakar ini dapat m<span style=\"letter-spacing: -.05pt;\">e</span>n<span style=\"letter-spacing: -.05pt;\">j</span>adi mak<span style=\"letter-spacing: .05pt;\">a</span><span style=\"letter-spacing: -.15pt;\">n</span>an <span style=\"letter-spacing: .05pt;\">y</span>ang se<span style=\"letter-spacing: -.15pt;\">h</span>at un<span style=\"letter-spacing: -.05pt;\">t</span>uk d<span style=\"letter-spacing: -.05pt;\">i</span>k<span style=\"letter-spacing: .05pt;\">o</span>nsu<span style=\"letter-spacing: -.05pt;\">m</span>si<span style=\"mso-spacerun: yes;\">&nbsp; </span>ol<span style=\"letter-spacing: -.05pt;\">e</span>h ma<span style=\"letter-spacing: -.15pt;\">s</span><span style=\"letter-spacing: .05pt;\">y</span>a<span style=\"letter-spacing: -.1pt;\">r</span>a<span style=\"letter-spacing: .05pt;\">k</span>at.</span></p>\n<p class=\"MsoNormal\" style=\"margin-bottom: .0001pt; mso-pagination: none; mso-layout-grid-align: none; text-autospace: none;\"><span style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',serif;\">&nbsp;</span></p>','Inovasi Produk Tempe Kedelai',1,0,'2019-03-11 03:47:42','2019-03-19 15:12:21'),(580,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,'2019-03-11 03:47:42','2019-03-11 03:47:42'),(581,0,'VFICE ( Vegetable dan Fruit Ice Cream)','2019 17010044053 NABELLA NUR ANGGI SAFITRI.pdf',NULL,10628013,'<p>Nutrisi sangat dibutuhkan untuk anak - anak saat masa pertumbuhan salah satunya diperoleh dari sayuran dan buah - buahan. Banyak anak - anak yang sulit untuk mengkonsumsi sayuran dan buah - buahan, sampai orang tua pun susah untuk memberikan asupan seimbang yang dibutuhkan oleh anak. Maka dibuatlah varian baru untuk anak dapat mengkonsumsi sayuran dan buah - buahan yakni es krim. Banyak anak menyukai es krim maka, disini kami menghadirkan produk baru yang berbahan dasar dari sayuran dan buah - buahan untuk memenuhi kebutuhan nutrisi pada masa pertumbuhan anak. Dan banyak manfaat yang didapatkan salah satunya kesehatan karena produk yang kami buat terbebas dari 5P dan bahan - bahan yang memiliki khasiat bagi tubuh.</p>','VFICE ( Vegetable dan Fruit Ice Cream )|Sehat',1,1,'2019-03-11 04:07:30','2019-03-14 23:33:50'),(582,0,'KENANGAN (Kebab Nangka Enak Tenan) Sebagai Inovasi Makanan Olahan Pengganti Daging di Indonesia','2019 17010014034 Raudya Tuzzahra Maghfirani.pdf',NULL,6017000,'<p><em>KENANGAN (Kebab Nangka Enak Tenan) merupakan produk inovasi kebab daging pada umumnya. Kebab ini menggunakan isian nangka muda yang diolah sedemikian rupa hingga menyerupai daging. Nangka muda dipilih karena daging dan seratnya yang menyerupai daging. Buah nangka merupakan buah tropis yang dapat dengan mudah ditemui di negara seperti Indonesia.&nbsp;</em></p>\r\n<p><em>Kebab ini dapat dikonsumsi semua masyarakat dari berbagai usia dan kalangan karena harga yang terjangkau daripada kebab daging. Karena tidak menggunakan daging, kebab ini dapat dikonsumsi orang yang alergi protein hewani, orang yang tidak menyukai bau dan rasa daging serta orang yang menjadi locto-ovo vegan. Kebab ini tidak mengandung lemak jenuh karena menggunakan nangka sebagai isian daging.</em></p>\r\n<p><em>KENANGAN (Kebab Nangka Enak Tenan) menjadi produk inovasi kebab berisi nangka muda. Belum banyak masyarakat yang membuat inovasi seperti ini, sehingga kami dapat memperkenalkan secara luas produk makanan inovasi baru dan melakukan inovasi-inovasi makanan lain berbahan nangka muda serta hal ini bisa menjadi peluang usaha yang cukup menjajikan.</em></p>','kebab|nangka muda|pengganti daging|locto-ovo vegan|sehat',1,1,'2019-03-11 04:07:50','2019-03-20 00:11:07'),(583,0,'MASKULIN (Masker Organik Gelatin)','2019 16030194086 Hanifatin azizah.pdf',NULL,7526000,'<p class=\"MsoNormal\" style=\"text-align: center; line-height: 150%;\" align=\"center\"><span style=\"font-size: 12.0pt; line-height: 150%; font-family: \'Times New Roman\',\'serif\';\">Abstrak</span></p>\n<p class=\"MsoNormal\" style=\"text-align: justify; text-indent: 36.0pt;\"><span style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; mso-bidi-font-family: \'Times New Roman\'; mso-bidi-theme-font: minor-bidi;\">Masker organik maskulin merupakan produk masker yang berbahan dasar gelatin sapi dan beras tagi yang memiliki tiga jenis varian, yaitu varian coklat, <em style=\"mso-bidi-font-style: normal;\">green </em>tea, dan kopi. Masker ini merupakan masker wajah alami yang tidak memberikan efek samping yang berbahaya, serta memiliki banyak manfaat bagi kecantikan wajah. <span style=\"mso-spacerun: yes;\">&nbsp;</span>Gelatin merupakan senyawa turunan protein yang diperoleh dengan cara mengekstrak kolagen hewan dan mengeringkannya. Gelatin merupakan campuran antara peptida dengan protein yang diperoleh dari hidrolisis kolagen yang secara alami terdapat pada tulang atau kulit binatang. Gelatin dapat meregenerasi sel-sel pada kulit sehingga dapat digunakan sebagai anti penuaan.</span></p>\n<p class=\"MsoNormal\" style=\"text-align: justify; text-indent: 36.0pt;\"><span style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; mso-bidi-font-family: \'Times New Roman\'; mso-bidi-theme-font: minor-bidi;\">Usaha produk masker organik ini diharapkan dalam jangka panjang dapat mendatangkan profit yang menjanjikan bagi para pelaku usaha. Bahan-bahan produksi seperti gelatin sapi, beras tagi, coklat, dan <em style=\"mso-bidi-font-style: normal;\">green tea</em> yang murah serta mudah didapatkan menyebabkan harga jual dari produk masker organik ini terjangkau bagi semua kalangan.</span></p>\n<p class=\"MsoNormal\" style=\"text-align: justify;\"><span style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; mso-bidi-font-family: \'Times New Roman\'; mso-bidi-theme-font: minor-bidi;\"><span style=\"mso-tab-count: 1;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span>Metode pemasaran dari masker organik ini yaitu dengan mendistribusikan produk secara konvensional/<em style=\"mso-bidi-font-style: normal;\">offline</em> di area kampus UNESA Ketintang, selain itu juga dipasarkan secara <em style=\"mso-bidi-font-style: normal;\">online </em>menggunakan berbagai sosial media, seperti Instagram, Facebook, dan Whatsapp. Produk masker organik ini nantinya akan dijual dengan harga Rp 10.000,00/25 gram.</span></p>\n<p class=\"MsoNormal\" style=\"line-height: 150%;\"><span style=\"font-size: 12.0pt; line-height: 150%; font-family: \'Times New Roman\',\'serif\';\">Kata kunci : Maskulin, Masker organik, Gelatin, Beras tagi</span></p>','Maskulin, Masker organik, Gelatin, Beras tagi|maskulin|masker organik|gelatin|beras tagi',4,1,'2019-03-11 04:53:36','2019-03-15 04:15:33'),(584,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,'2019-03-11 05:50:38','2019-03-11 05:50:38'),(585,0,'EGG-GRADING Pengembangan Produk Inovasi Mesin Klasifikasi Kualitas Telur Ayam Berbasis Microcontroller','2019 17050524060 Zulfa Ludfi Diana Sari.pdf',NULL,14807500,'<p>Bidang kewirausahaan saat ini cukup berkembang pesat dengan meningkatnya pengetahuan seseorang akan IPTEK. Demikian hal ini manusia dituntut supaya bisa berkembang dan mengembangkan kemampuan mereka dengan memanfaatkan teknologi. Disini penulis mengembangkan IPTEK dengan memadukan kemampuan dalam pembuatan produk inovasi berbasis teknologi untuk kemudian di produksi massal dan dipasarkan demi memenuhi kebutuhan pasar konsumen. Judul yang diambil penulis yaitu &ldquo;EGG-GRADING&rdquo; Pengembangan Produk Inovasi Mesin Klasifikasi Kualitas Telur Ayam Berbasis Microcontroller. Pengembang usaha produksi mesin grading telur ayam ini atas dasar melihat suatu permasalahan yang ditemukan pada pengusaha telur ayam yang masih kurang efektif dan efisien dalam melakukan pengklasifikasian telur ayam berdasarkan bobotnya. Selain itu, jika melihat alat-alat serupa yang digunakan masih memiliki harga jual yang sangat tinggi dan rata-rata masih di produksi di luar negeri. Produksi mesin ini dikembangkan dengan mempertimbangkan kualitas serta permasalahan pada pengusaha telur ayam. Di desain dengan menerapkan mobilitas dalam penggunaan, bekerja dengan menggunakan sistem semi otomatis dengan teknologi microcotroller, serta memiliki harga yang jauh lebih ekonomis dibanding produk luar negeri. Sehingga usaha yang penulis kembangkan ini memiliki daya saing yang masih sedikit dang prospek usaha yang cukup bagus kedepannya.</p>','Grading Telur|Mesin pemilah telur|microcontroler|mass detector|klasifikasi bobot teluri',3,1,'2019-03-11 05:50:38','2019-03-20 05:12:51'),(586,0,'BOS TERSERAH (BONGGOLAN PAYUS TERMANTUL SUPER ENAK MURAH MERIAH)','2019 16030654004 Dea Damar Wahyu Pradana.pdf',NULL,8000000,'<p>Bonggolan adalah cemilan khas Gresik yang merakyat. Berbahan tepung tapioka, ikan payus yang disajikan dengan bumbu rujak dengan khas petis Gresik. Bonggolan pada umumnya hanya dibungkus daun pisang dan hanya memiliki satu varian rasa yaitu original. Produk kami &lsquo;BOS TERSERAH (Bonggolan Payus Termantul Super Enak Murah Meriah)&rsquo; merupakan cemilan pertama di Indonesia yang mengusungkan jajanan rakyat khas Gresik kemudian diinovasikan dengan berbagai rasa sayur, pedas dan buah agar dapat diterima oleh generasi modern. Melalui PMW UNESA 2019 kami berharap bonggolan akan lebih terkenal dan disukai banyak orang. Dana yang kami ajukan sebesar Rp 8.000.000,- dengan dana tersebut nantinya bonggolan diinovasikan dengan bentuk, isian dan kemasan yang lebih menarik dan modern. Produk tersebut kami inovasi dengan konsep <em>customer request</em>. Pembeli dapat memesan bonggolan dengan berbagai macam bentuk karakter dan varian sesuai dengan keinginan. Kami menginovasi&nbsp; <em>packaging standing pouch</em> untuk bonggolan <em>frozen</em> dan <em>paper bowl</em> untuk bonggolan goreng. Pelengkap bonggolan berupa sambal rujak pedas dengan khas petis Gresik yang disajikan dengan berbagai level yang akan melumer di mulut serta pelengkap kerupuk payus yang gurih. Kami juga berkerjasama dengan masyarakat Gresik dalam proses produksi bahan mentah, kemudian proses selanjutnya hingga sampai pada konsumen akan dilakukan oleh kami. Target minimal penjualan adalah 350 cup dengan harga Rp.8.000,- dan jika diakumulasi laba bersih yang diperoleh selama sebulan adalah Rp. 1.200.000,-.</p>','bonggolan|Gresik|ikan payus',1,1,'2019-03-11 06:13:38','2019-03-16 14:13:01'),(587,0,'STIK KOIT ( Stik Ikan Tongkol Cabe Rawit)','2019 17010024010 Dwi Putri Meidawati Setianingrum.pdf',NULL,6000000,'<p style=\"text-indent: 36.0pt;\"><span style=\"mso-ansi-language: IN;\">Camilan STIK KOIT </span><span lang=\"EN-US\">dibuat dan </span><span style=\"mso-ansi-language: IN;\">disajikan seperti </span><span lang=\"EN-US\">stik bawang</span><span style=\"mso-ansi-language: IN;\"> dengan</span><span lang=\"EN-US\"> kreasi</span> <span lang=\"EN-US\">bahan utama ikan tongkol</span><span style=\"mso-ansi-language: IN;\">.</span><span lang=\"EN-US\"> Pemilihan ikan tongkol sebagai bahan utama pembuatan stik dikarenakan ikan tongkol kaya akan nutrisi karena kandunganprotein, asam lemak omega-3, dan mikro nutrein. Protein pada ikan tongkol sering dimanfaatkan sebagai asupan protein rendah lemak, biasanya sebagai pengganti daging merah. Ikan tongkol juga kaya akan vitamin B12, selenium, niacin, fosfor, magnesium, riboflavin, vitamin B6, kalium, tiamin, asam panthotenak, zat besi, tembaga, dan Vitamin A.</span></p>\n<p style=\"text-indent: 36.0pt;\"><span lang=\"EN-US\">Stik KOIT (Stik Tongkol Rawit ) dengan rasa pedas karena rasa pedas yang diperoleh dari bahan cabe rawit asli yang dicampur dengan bahan adonannya. Stik ini memilik 3 versi yaitu rasa original, rasa pedas manja dan pedas sadis. </span><span style=\"mso-ansi-language: IN;\">K</span><span lang=\"EN-US\">arena banyak kandungan pada ikan tongkol dapat meminimalisir lemak yang terkandung dalam cemilan ini. </span><span style=\"mso-ansi-language: IN;\">Makanan ini bisa bertahan selama </span><span lang=\"EN-US\">1 bulan</span> <span lang=\"EN-US\">dan di bungkus</span><span style=\"mso-ansi-language: IN;\"> didalam sebuah </span><span lang=\"EN-US\">kemasan</span><span style=\"mso-ansi-language: IN;\">. </span><span lang=\"EN-US\">S</span><span style=\"mso-ansi-language: IN;\">ehingga</span><span lang=\"EN-US\">&nbsp; Stik KOIT&nbsp; ini camilan praktis yang cocok</span><span style=\"mso-ansi-language: IN;\"> dinikmati </span><span lang=\"EN-US\">sebagai camilan keluarga maupun camilan teman bersantay. </span></p>','Stik Tongkol|camilan stik ikan tongkol',1,1,'2019-03-11 13:40:11','2019-03-14 14:20:53'),(588,0,'CAH PIKIR (Camilan Kripik Kenikir)','2019 17030174028 Siti Munawaroh.pdf',NULL,11510000,'<p class=\"MsoNoSpacing\" style=\"text-align: justify; line-height: 115%; tab-stops: 14.2pt;\"><span style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; letter-spacing: -.05pt; mso-ansi-language: IN;\">CAH PIKIR (Camilan Kripik Kenikir) merupakan camilan&nbsp; keripik dari daun&nbsp; kenikir. Produk ini memiliki varian rasa original dan<span style=\"mso-spacerun: yes;\">&nbsp; </span>pedas yang dikemas dalam plastik <em style=\"mso-bidi-font-style: normal;\">standing pouch</em>. CAH PIKIR yang gurih dan renyah dapat menjadi camilan yang disukai di kalangan masyarakat karena harga yang terjangkau.<span style=\"mso-spacerun: yes;\">&nbsp; </span>Selain itu, daun kenikir yang digunakan untuk membuat keripik ini juga mengandung banyak nilai gizi yang bermanfaat untuk kesehatan manusia dan </span><span style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; mso-ansi-language: IN;\">dapat menjadi alternatif bagi yang tidak suka dengan sayuran.</span><span style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; mso-ansi-language: IN; mso-fareast-language: IN;\"> Target pemasaran dalam usaha ini adalah masyarakat Surabaya, mulai dari anak-anak, orang tua, remaja dan khususnya mahasiswa. Sistem pemasaran kami menggunkan sistem <em style=\"mso-bidi-font-style: normal;\">direct selling</em> dan system mitra-mitra usaha yang meliputi minimarket, foodcourt serta sekolah. Selain pemasaran secara offline, kami juga melakukan pemasaran online melalui media sosial seperti instagram, facebook, official Line, dan official WhatsApp. Untuk Peralatan dan bahan dapat dengan mudah diperoleh di pasar DTC sedangkan<span style=\"mso-spacerun: yes;\">&nbsp; </span>daun kenikirnya<span style=\"mso-spacerun: yes;\">&nbsp; </span>kami membeli di Desa Pinggir, Kec. Balongpanggang, Gresik. Dalam 1 minggu kami memproduksi 100 produk sehingga dalam sebulan dihasilkan 400 produk CAH PIKIR. Harga yang dipatok sekisar Rp 7.000 per produk sehingga keuntangan yang diperoleh sebesar Rp 2.000 per produk. Dengan sitem penjualan yang mudah diharapkan kota cakupan pemasaran semakin luas diberbagai kota seperti Gresik, Sidoarjo, dan Malang.</span></p>','kenikir dan keripik|keripik, kenikir,',1,1,'2019-03-11 14:13:39','2019-03-20 03:06:26'),(589,0,'TAMBON (TAMBAL BAN ONLINE) \"Ora nuntun, Ora getun\" by TIM URC','2019 17010024021 PUTRI AYU ANDAR WANTI.pdf',NULL,10000000,'<p><span style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',serif; mso-fareast-font-family: Calibri; mso-ansi-language: IN; mso-fareast-language: EN-US; mso-bidi-language: AR-SA;\">Usaha TAMBON (Tambal Ban Online) ini berawal dari keinginan untuk memberikan sebuah inovasi dengan mengikuti era digital dan teknologi untuk memudahkan dan bermanfaat bagi seluruh masyarakat di Indonesia.</span></p>','tambal ban|online|jasa|platform|tim urc|inovasi',2,1,'2019-03-11 14:33:49','2019-03-14 16:55:23'),(590,0,'DoKa (Dompet STNK)','2019 17010714014 Novia Setia Rahmawati.pdf','2019 17010714014 Novia Setia Rahmawati.pdf',6500000,'<p>Dompet adalah salah satu benda yang memiliki fungsi sebagai alat menyimpan uang, kartu kredit atau debit, kartu identitas, dokumen-dokumen penting, foto, kartu nama atau barang-barang pribadi lainnya. Di zaman yang modern kini banyak sekali macam-macam dompet yang beredar di masyarakat yang memiliki desain dan corak yang berbeda-beda. Berbagai macam inovasi dompet terkini banyak dikembangkan oleh masyarakat. Rumusan masalah dalam PMW 2019 ini adalah menciptakan peluang bisnis yang inovatif melalui dompet yang diberi nama <em>DoKa (Dompet STNK).</em> Latar belakang pembuatan produk ini karena banyaknya informasi dari masyarakat khususnya mahasiswa kampus UNESA yang sering kehilangan STNK beserta surat-surat penting lainnya. DoKa ini merupakan salah satu peluang bisnis yang bergerak di bidang industri kreatif. DoKa merupakan salah satu inovasi dompet yang digunakan sebagai tempat menyimpan STNK, meyimpan uang dan kartu-kartu penting lainnya yang terbuat dari bahan dasar kulit sintesis yang memiliki kualitas terbaik. DoKa ini memiliki desain transparan sehingga memudahkan pengecekan STNK ketika akan memasuki loket karcis. Selain itu DoKa pula memiliki tanda pengenal yang berguna sebagai pemberi informasi kepada yang menemukan DoKa agar dikembalikan kepada pemilik DoKa. Target pasar dari penjualan produk ini adalah mahasiswa UNESA, pekerja, dan masyarakat sekitar UNESA serta pengguna media sosial. Metode yang digunakan dalam pelaksanaan usaha ini dimulai dengan penyusunan analisis kebutuhan masyarakat sekitar, struktur organisasi dan tahapan pelaksanaan usaha yang dimulai dari persiapan produksi, pelaksanaan produksi, pengemasan produk, promosi, distribusi produk, pencatatan dan evaluasi pelaksanaan usaha yang dilakukan secara berkala setiap bulannya. Harapan dari produk DoKa ini adalah agar dapat meminimalisir angka kehilangan STNK dan surat penting lainnya yang sering terjadi di lingkungan masyarakat khususnya di lingkungan kampus UNESA.</p>',NULL,4,1,'2019-03-11 14:57:58','2019-04-30 04:05:14'),(591,0,'SEHANGAT INI','2019 17010024051 Wahyu Fitri Dwi Yanti.pdf',NULL,6715000,'<p class=\"MsoNormal\" style=\"text-align: justify; text-indent: 15.1pt; margin: 0cm 13.3pt 10.0pt 15.0pt;\"><span style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; mso-fareast-font-family: Ebrima;\">Goni atau orang Indonesia menyebut Rami, adalah tanaman serat nabati selain kapas.<span style=\"mso-spacerun: yes;\">&nbsp; </span>Serat goni ini warnanya coklat dan lebih terang selain itu juga kuat dan berkualitas. Terdapat beberapa macam jenis kain goni sesuai tingkat kerapatan dan kehalusan dari masing-masing jenis, kain goni ini juga terbuat dari benang goni. </span><span lang=\"IN\" style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; mso-ansi-language: IN;\">Saat ini produk goni banyak digemari karena keunikannya dan memiliki nilai seni. Perlu ketekunan dan ketelitian untuk membuat karya seni ini sehingga masih belum banyak yang menjual seni kerajian </span><span style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\';\">kain goni</span><span lang=\"IN\" style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; mso-ansi-language: IN;\"> ini. </span></p>','Pemanfaatan kain goni',4,1,'2019-03-11 15:56:08','2019-03-14 20:25:59'),(592,0,'CHIZZA (Chicken Pizza)','2019 16010664022 Mifta Hayu Alizya.pdf',NULL,5427000,'<p>CHIZZA (Chicken Pizza) merupakan makanan yang berbahan dasar ayam dan diberi topping keju mozarella, paprika, dan jagung. makanan yang sangat lezat, banyak mengandung vitamin B yang dapat meredakan stres. Perbedaan produk kami dengan produk chizza yang lain yakni CHIZZA yang kami buat menggunakan minyak jagung yang bebas lemak sehingga menambah kualitas dari CHIZZA. Kami mematok harga 5000 per porsinya, harga yang sangat terjangkau bagi semua kalangan.</p>','chizza|chicken pizza',1,1,'2019-03-11 16:28:55','2019-03-14 15:56:56'),(593,0,'Krip Bosang  Kripik Bonggol Pisang','2019 17040254062 Risa Kurnia Ningsih.pdf',NULL,2000000,'<p>&nbsp;Judul dari kegiatan usaha kami adalah &ldquo;KRIP BOSANG&rdquo; keripik bonggol pisang untuk camilan, dengan jenis usaha makanan yaitu produk berupa camilan berbahan dasar bonggol pisang yang berasal dari akar pohon pisang yang memiliki manfaat sebagai bahan pangan. Mengapa kami membuat usaha keripik bnggol pisang ini adalah dikarenakan prospek kedepan usaha pembuatan makanan ini diharapkan cerah dan banyak diminati oleh semua kalangan &nbsp;dewasa., serta masih jarang pesaing yang menggunakan produk yang sama dalam menjual produknya. Produk ini sangat menarik karena selain enak juga menyehatkan. Produk Krip Bosang berasal dari bahan alami dengan kandungan berupa energi, protein, karbohidrat, lemak, kalsium, fosfor, dan zat besi. &nbsp;Dalam penjualan kami berfokus untuk memasarkan kepada para mahasiswa khususnya di daerah Surabaya dan menjualnya dengan menitipkan pada toko-toko sekitar kampus. Teknik yang kami lakukan dalam memasarkan produk adalah dengan Promosi mneggunakan sarana Media sosial seperti facebook, instagram, WhatsApp, Line, web atau blog, Telepon atau nomor hanphone, Brosur, pamflet, word of mouth agar informasi produk dapat tersampaikan dengan sempurna serta dalam jangka waktu promosi awal kami memberikan potongan harga kepada konsumen sebesar 5%.&nbsp;</p>\r\n<p>Kelebihan dari produk &ldquo;KRIP BOSANG&rdquo; ini sangatlah beragam yaitu, Produk menggunakan bahan-bahan alami tanpa zat kimia, Harga terjangkau untuk kalangan Mahasiwa. Kemasan yang menarik dan mudah digunakan, Rasa yang enak, Pelayanan yang ramah, nyaman juga mengutamakan kepuasan konsumen, Melayani konsumen dengan cepat dan tepat. Namun didalam suatu produk pasti mempunyai kekurangan yaitu memerlukan uji BPOM, arena produk kami masih baru maka uji BPOM agara dipercaya oleh konsumen, Hanya bisa bertahan selama 2 minggu, karena memakai produk yang alami tanpa tambahan bahan kimia, Modal masih kecil, serta Belum mempunyai tempat usaha yang tetap. Dalam usaha operasional produk, kami mngutamakan kualitas rasa yang tidak mengecewakan bsgi pelanggan, yaitu bahan baku dari bahan alami dan tida membahayakan untuk tubuh.</p>\r\n<p>&nbsp;</p>','Kripik alami, kripik rasa rasa|Kripik tanpa pengawet',1,1,'2019-03-11 17:34:42','2019-03-14 20:00:39'),(594,0,'SoLe Rainbow','2019 17010664088 Luna Jane\'s Leopacky.pdf',NULL,2194000,'<p>SoLe adalah makanan varian terbaru dari olahan daging ikan lele menjadi sosis yang di padukan dengan sayuran.&nbsp;Sosis diolah dengan cara digoreng dan dibakar sesuai selera dari pembeli. Dilengkapi dengan saos. yang menambah kelezatan sosis ini.</p>\r\n<p>Target promosi dari produk ini adalah masyarakat surabaya dan konsumen online terutama siswa dan mahasiswa surabaya. Sistem pemasaran yakni dengan menawarkan secara langsung kepada konsumen serta menawarkan melalui media sosial online.</p>','Sosis lele|Sosis|Lele|SoLe|SoLe Rainbow',1,1,'2019-03-11 17:41:50','2019-03-15 05:48:53'),(595,0,'BUCO SHAKE (BUBBLE CORN SHAKE)  Drink Healthy, Drink Buco Shake','2019 17040254067 Nasihatul Mahmudah.pdf',NULL,6000000,'<p class=\"MsoListParagraph\" style=\"text-align: justify; text-indent: 36.0pt;\"><span style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\';\">Menjadi seorang wirausaha atau enterpreneur bukanlah hal yang sulit dan mudah. Hal tersebut tidak semudah membalikkan telapak tangan. Tidak juga sesulit mencari jarum dalam jerami. Memjadi seorang wirausaha harus mempunyai <em>planning </em>yang matang dan tidak lupa untuk <em>doing </em>dan <em>action. </em>Karena konsep-konsep yang bagus sekalipun akan pecumaa pabila tidak segera action.</span><span style=\"font-family: \'Times New Roman\', serif; font-size: 12pt; letter-spacing: -0.05pt;\">&ldquo;BUCO SHAKE&rdquo; sebagai konsep matang hasil dari buah pemikiran setelah mengamati, bertanya-tanya dan mensurvei apa yang disukai konsumen bukanlah ide yang datang tiba-tiba. Jagung biasa yang terdapat di pasaran selama ini di inovasi sampai pada tahap pengemasan sehingga dapat memasuki toko-toko atau gerai minuman.</span></p>\n<p class=\"MsoListParagraph\" style=\"text-align: justify; text-indent: 36.0pt;\"><span lang=\"IN\" style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; mso-fareast-font-family: Calibri; mso-fareast-theme-font: minor-latin; mso-bidi-font-family: Arial; mso-bidi-theme-font: minor-bidi; letter-spacing: -.05pt; mso-ansi-language: IN; mso-fareast-language: EN-US; mso-bidi-language: AR-SA;\">&ldquo;BUCO SHAKE&rdquo; berbeda dengan produk minuman shake biasa. Produk minuman ini terbuat dari bahan alami yaitu jagung manis segar. Jagung manis segar diblender dan diolah sedemikian rupa sehingga menjadi sari jagung manis kental.&ldquo;BUCO SHAKE&rdquo; memiliki varian topping bubble yang juga banyak digunakan menjadi topping minuman </span><span style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; mso-fareast-font-family: Calibri; mso-fareast-theme-font: minor-latin; mso-bidi-font-family: Arial; mso-bidi-theme-font: minor-bidi; letter-spacing: -.05pt; mso-ansi-language: EN-US; mso-fareast-language: EN-US; mso-bidi-language: AR-SA;\">siap saji </span><span lang=\"IN\" style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; mso-fareast-font-family: Calibri; mso-fareast-theme-font: minor-latin; mso-bidi-font-family: Arial; mso-bidi-theme-font: minor-bidi; letter-spacing: -.05pt; mso-ansi-language: IN; mso-fareast-language: EN-US; mso-bidi-language: AR-SA;\">lainnya. Selain itu, dalam &ldquo;BUCO SHAKE&rdquo; juga&nbsp; ditambahkan dengan susu kental manis untuk menambah cita rasa. &ldquo;BUCO SHAKE&rdquo; disajikan dingin dan kental dengan es batu yang diblender. Rasa segar dan manis alami dari jagung ditambah dengan kenyalnya<em> &ldquo;bubble pearl&rdquo; </em>menambah sensasi segar saat meminum es jagung ini. &ldquo;BUCO SHAKE&rdquo;</span> <span lang=\"IN\" style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; mso-fareast-font-family: Calibri; mso-fareast-theme-font: minor-latin; mso-bidi-font-family: Arial; mso-bidi-theme-font: minor-bidi; letter-spacing: -.05pt; mso-ansi-language: IN; mso-fareast-language: EN-US; mso-bidi-language: AR-SA;\">&nbsp;juga hadir dengan varian topping yang berbeda.</span></p>','minuman sehat|olahan jagung manis|inovasi minuman jagung|bisnis minuman jagung',1,1,'2019-03-11 17:52:40','2019-03-14 19:44:35'),(596,0,'De. Torte (Homemade Brownis Avocado)','2019 17081194026 Siti Shahriyah.pdf',NULL,5580000,'<p class=\"MsoNormal\">Di era globalisasi seperti sekarang ini, persaingan dunia industri semakin meningkat, baik dibidang barang maupun jasa. UMKM juga saat ini sedang ramai diperbincangkan di masyarakat luas, karena dinilai UMKM juga memiliki peran penting dalam roda perputaran ekonomi negara. Apalagi sedang gencarnya ekonomi kreatif yang membuat banyak bermunculan usaha-usaha baru dengan produk yang baru juga. Hal ini lah yang mendorong kami untuk membuka usaha yang kami namakan \' De.Torte\' <em>Homemade</em> Brownis Avocado. Disini kami memadukan antara brownis dengan vla avocado yang lumer serta toping coklat diatasnya. Brownis avocado ini belum beredar di pasaran, dan inilah yang menjadi peluang bisnis bagi kami.</p>','Kuliner, Brownis Avocado, Dessert Box',1,1,'2019-03-11 18:13:40','2019-03-19 03:30:29'),(597,0,'TOLPANG (pentol kupang)','2019 17010714047 faisal hakim.pdf',NULL,7616000,'<p>&nbsp;TOLPANG (pentol kupang)</p>\n<p>Indonesia terdiri dari beribu-ribu pulau, 34 provinsi, 415 kabupaten dan 93 kota. Indonesia merupakan Negara yang kaya akan sumber daya alam, terutama kekayaan lautnya. Indonesia sebagai Negara kepulauan , hampir dua pertiga wilayahnya adalah lautan.&nbsp; &nbsp;Setiap derah di Indonesia memiliki kuliner khas daerah yang menjadi keunikan daerah tersebut. Sidoarjo memiliki makanan khas yaitu Lontong Kupang.Kupang adalah hewan laut sejenis kerang bentuknya kecil sebesar biji besar.Kupang hanya dapat ditemukan di pesisir timur Jawa Timur khususnya Sidoarjo. Kupang memiliki kandungan nutrisi yang baik seperti asam amin, omega-3, protein, lemak, karbohidrat.&nbsp; TOLPANG (Pentol Kupang)&nbsp; merupakan inovasi dalam bidang makanan yang memadukan kreasi bakso dengan bahan dasar ikan kupang dan kuah khas lontong kupang.Dalam hal ini lontong kupang yang merupakan makanan legendaris di masyarakat kami inovasikan dengan paduan makanan bakso yang sangat diminati oleh masyarakat Indonesia. Setiap daerah memiliki ciri khas bakso yang berbeda-beda, sehingga salah satu tujuan usaha ini adalah untuk lebih mempopulerkan Kupang dan&nbsp; membuat bakso kupang sebagai makanan khas Sidoarjo. Oleh karena itu , usaha ini dapat dikatakan sebagai usaha yang memiliki prospek yang bagus di Indonesia.&nbsp; TOLPANG (Pentol Kupang) merupakan jenis makanan inovasi baru dan belum memiliki daya saing, maka hal itu menjadi keunggulan tersendiri untuk prospek usaha kedepan. Untuk pemasaran produk TOLPANG (Pentol Kupang) ini dapat disajikan sebagai kuliner di tempattempat rapat,hotel,serta dapat dipasarkan di kegiatan-kegiatan kota yang ada di Kota Sidoarjo maupun Surabaya.</p>','TOLPANG|pentol kupang',1,1,'2019-03-11 18:36:09','2019-03-14 15:42:52'),(598,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,1,'2019-03-11 18:41:55','2019-03-11 18:41:58'),(599,0,'Deniad Tote Bag','2019 17081194056 Fadlilatul Muminah.pdf',NULL,9395000,'<p><strong><span style=\"font-size: 10.5pt; font-family: Verdana, sans-serif;\">Deniad Tote Bag</span></strong></p>\n<p><span style=\"font-size: 10.5pt; font-family: Verdana, sans-serif;\">&nbsp;</span></p>\n<p><span style=\"font-size: 10.5pt; font-family: Verdana, sans-serif;\">Seiring dengan berkembangnya zaman, industri fashion mulai dilirik oleh kalangan masyarakat, mulai dari pria hingga wanita, mulai dari remaja hingga tua.</span></p>\n<p><span style=\"font-size: 10.5pt; font-family: Verdana, sans-serif;\">Namun,limbah kain percah masih di temukan berceceran dan juga masih di jumpai klangan masyarakat yang kurang mempunyai rasa cinta pada budaya bangsa yakni batik</span></p>\n<p><span style=\"font-size: 10.5pt; font-family: Verdana, sans-serif;\">Oleh karena itu, dibentuklah sebuah inovasi untuk menyatukan 3 aspek tersebut dengan cara membuat Tot Bag yang memiliki bahan dasar kain percah batik yang dapat menumbuhkan rasa cinta pada budaya bangsa yakni batik. Deniad merupakan tote bag home made. Tote bag ini berbahan dasar kain yang berkualitas. Seperti yang diketahui, kain yang berkualitas itu nyaman dipakai dan kuat dalam artian tidak mudah sobek. Tote bag ini juga memiliki ciri khas corak budaya Indonesia yaitu pada saku tote bag yang bermotif kedaerahan.</span></p>','batik|tote bag|fashion|limbah kain percah',2,1,'2019-03-11 18:45:34','2019-03-20 03:49:02'),(600,0,'Tas Rajut Taratik','2019 17081194080 Resti Kartika Maharti.pdf',NULL,2000000,'<p class=\"MsoNormal\" style=\"margin: 0cm; margin-bottom: .0001pt; mso-para-margin-top: 0cm; mso-para-margin-right: 0cm; mso-para-margin-bottom: .0001pt; mso-para-margin-left: 0gd; text-align: justify; text-indent: 36.0pt; mso-char-indent-count: 0; line-height: 150%; mso-pagination: widow-orphan; border: none; mso-padding-alt: 31.0pt 31.0pt 31.0pt 31.0pt; mso-border-shadow: yes;\"><span lang=\"EN-US\" style=\"font-size: 12.0pt; line-height: 150%; font-family: \'Times New Roman\',\'serif\'; mso-fareast-font-family: \'Times New Roman\'; color: black;\">Peningkatan limbah plastik saat ini terus meningkat. Plastik sendiri dikonsumsi sekitar 100 juta ton/tahun di seluruh dunia.Satu tes membuktikan 95% orang pernah memakai barang mengandung Bisphenol-A. Oleh karena itu pemakaian plastik yang jumlahnya sangat besar tentunya akan berdampak siqnifikan terhadap kesehatan manusia dan lingkungan karena plastik mempunyai sifat sulit terdegradasi (non-biodegradable). Konsumsi masyarakat akan plastik ini akan mengakibatkan bertumpuknya limbah plastik. Seperti yang kita tahu bahwa dibutuhkan ratusan tahun hingga limbah tersebut dapat terurai dengan sempurna. Sampah plastik tidaklah bijak jika dibakar karena akan menghasilkan gas yang akan mencemari udara dan membahayakan pernafasan manusia, dan jika sampah plastik ditimbun dalam tanah maka akan mencemari tanah, air tanah. Kami disini, memberikan solusi atas permasalahan diatas dengan cara membuat suatu produk kreatif yang berbahan dasar Plastik yang dipintal seperti benang menjadi tali kur.&nbsp;</span><span style=\"font-family: \'Times New Roman\', serif; font-size: 12pt; text-indent: -0.1pt;\">Agar tas tidak terkesan biasa dan monoton, tas diaplikasikan dengan berbagai motif yang dibuat dengan menggunakan teknik crochet. Tas dengan aplikasi motif memang sering dijumpai di pasaran, namun hanya dibuat menggunakan bahan kain lalu dijahit pada tas. Begitu juga dengan boneka monster yang akan diaplikasikan pada tas, dibuat lucu dengan warna-warna yang menarik agar menjadi disukai dan banyak digemari oleh semua orang, terutama remaja putri.</span><span style=\"font-family: \'Times New Roman\', serif; font-size: 12pt; text-indent: -0.1pt;\">&nbsp; </span><span style=\"font-family: \'Times New Roman\', serif; font-size: 12pt; text-indent: -0.1pt;\">Remaja putri yang identik dengan hal-hal lucu dan berwarna-warni dirasa pantas menjadi sasaran dari pembuatan skripsi ini. Karena tidak hanya motif saja tetapi berbagai animasi seperti bunga, kartun, agar tas yang biasa kita lihat menjadi berbeda dari biasanya dan tentu akan lebih menarik dan banyak diminati di pasaran. Dengan uraian di atas, penulis ingin menciptakan kesan yang berbeda terutama dari segi bentuk dan ukurannya.</span></p>','Tas rajut|Tali Kur|Plastik',4,1,'2019-03-11 18:57:55','2019-03-19 03:16:24'),(601,0,'NUBORENG MASA (Nugget Brownies Goreng Macam Rasa)','2019 17010024015 Anita Rahmawati.pdf',NULL,4574000,'<p>Produk ini menyajikan makanan dengan bahan dasar brownies yang kemudian di goreng dan di tambah topping sesuai rasa yang diinginkan. Brownies goreng ini dijual dengan harga Rp 28.000 per pcs.</p>','Nugget Brownies|Brownies Goreng',1,1,'2019-03-11 19:22:11','2019-03-14 23:01:28'),(602,0,'Crispy Oreo (Oreo Goreng Renyah)','2019 17081194008 Della PratamiPutri.pdf',NULL,5700000,'<p class=\"MsoNormal\" style=\"margin-bottom: .0001pt; text-align: justify; text-indent: 36.0pt; line-height: 150%;\"><span class=\"a\"><span lang=\"IN\" style=\"font-size: 12.0pt; line-height: 150%; font-family: \'Times New Roman\',serif;\">Saat ini banyak sekali masyarakat yang lebih menyukai makanan cepat saji dengan rasa yang enak dan harga yang relatif murah namun kualitas tetap terjamin. Untuk memenuhi &nbsp;permintaan masyarakat tersebut harus diciptakan suatu kegiatan usaha yang sifatnya kreatif, inovatif dan memiliki daya saing yang tinggi sehingga dapat menarik perhatian masyarakat untuk membeli produk yang kita tawarkan.</span></span></p>\n<p class=\"MsoNormal\" style=\"margin-bottom: .0001pt; text-align: justify; text-indent: 36.0pt; line-height: 150%;\"><span lang=\"IN\" style=\"font-size: 12.0pt; line-height: 150%; font-family: \'Times New Roman\',serif; mso-fareast-font-family: \'Times New Roman\'; mso-fareast-language: IN;\">Oreo adalah cemilan sejenis biskuit&nbsp; yang&nbsp; terdiri dua biscuit coklat dengan krim putih ditengahnya, masyarakat umumnya memiliki cara popular untuk memakan oreo yaitu dengan cara mencelupkannya kedalam susu atau menikmatinya dengan segelas teh panas atau segelas kopi.</span></p>\n<p class=\"MsoNormal\" style=\"margin-bottom: .0001pt; text-align: justify; text-indent: 36.0pt; line-height: 150%;\"><span lang=\"IN\" style=\"font-size: 12.0pt; line-height: 150%; font-family: \'Times New Roman\',serif;\">Kami sekelompok mahasiswa memilih usaha ini agar biscuit tidak lagi dinikmati dengan cara&nbsp; yang&nbsp; biasa masyarakat lakukan,&nbsp; maka dari itu&nbsp; kami&nbsp; membuat cemilan yang&nbsp; renyah dengan&nbsp; rasa&nbsp; gurih dan manis ini dengan modifikasinya yaitu digoreng dengan balutan tepung lalu diberi&nbsp; topping&nbsp; kekinian.</span></p>\n<p>&nbsp;</p>\n<p class=\"MsoNormal\" style=\"margin-bottom: .0001pt; text-align: justify; text-indent: 36.0pt; line-height: 150%;\"><span lang=\"IN\" style=\"font-size: 12.0pt; line-height: 150%; font-family: \'Times New Roman\',serif; mso-fareast-font-family: \'Times New Roman\'; mso-fareast-language: IN;\">Kami&nbsp; memilih usaha ini karena oreo digemari kalangan anak muda,&nbsp; apalagi jika tambahin&nbsp; topping&nbsp; pasti akan menambahkan citarasanya dan sangat cocok bagi semua kalangan.&nbsp; Dan bedanya usaha kami&nbsp; dengan&nbsp; yang&nbsp; lain,&nbsp; yaitu&nbsp; kami&nbsp; menghidangkannya tidak hanya memakai oreo yang&nbsp; hanya&nbsp; rasa&nbsp; vanilla, &nbsp;tetapi juga memakai&nbsp; rasa&nbsp; oreo&nbsp; yang&nbsp; lainnya,&nbsp; sehingga konsumen dapat memesan dengan selera mereka. Olahan cemilan ini dibuat tidaklah menguras&nbsp; modal&nbsp; yang&nbsp; banyak,&nbsp; maka dari itu juga cemilan ini sangat sesuai dengan kantong mahasiswa,&nbsp; kami berusaha membuat olahan cemilan ini dengan rasa&nbsp; yang berkualitas dengan harga&nbsp; yang murah dan beda dari pesaing yang lainnya.</span></p>','makanan|oreo|pmw|cemilan',1,1,'2019-03-11 20:00:56','2019-03-19 01:48:37'),(603,0,'Kemasan Oleh-Oleh \"Suro dan Boyo\"','2019 17040704006 Ari Purwita Kartika.pdf','2019 17040704006 Ari Purwita Kartika.pdf',5000000,'<p>Kemasan Oleh-oleh Suro dan Boyo</p>\n<p>Saat ini kemasan oleh-oleh Suro dan Boyo terutama di kota Surabaya tidak banyak yang memproduksi, sehingga analisis persaingan usaha relative masih mudah dan menjadikan usaha ini tetap memiliki peluan yang cukup menjanjikan. Dengan terciptanya suatu usaha yang unik dengan situasi persaingan tidak banyak yang memproduksi maka usaha ini akan berjalan dengan lancar dan berpeluan.</p>\n<p>Menurut kami dalam berwirausaha, ada banyak hal yang kami dapatkan tentang arti ketangguhan sebagai manusia. Tidak mudah menyerah, mengasah diri untuk selalu belajar dan belajar, selalu tekun dan giat dalam membuat produk-produk dengan krestivitas yang terus berkembang dan lain sebagainya. Untuk mengatasi dampak buruk dari adanya perkembangan zaman, kami membuat produk yang bertemakan icon dari daerah asal kami yakni Surabaya. Kami akan menyajikan produk dengan memanfaatkan dampak baik dari perkembangan zaman yakni teknologi dan memadukannya dengan beberapa kearifan local dan icon yang dimiliki kota asal kami, Surabaya. Kami akan berusaha membuat produk yang minimalis dan eyecatchig, dan juga tidak melupakan manfaat dan fungsi dari produk yang kami buat sehingga mampu bersaing dengan produk-produk dalam negeri hingga luar negeri.</p>',NULL,4,1,'2019-03-11 20:15:00','2019-05-08 09:07:02'),(604,0,'BUCIN (Bucket Chocolate Inovatif)','2019 17010714070 Indri Irawati.pdf',NULL,4071000,'<p>PMW berjudul BUCIN (Bucket Chocolate Inovatif)</p>\n<p>Proposal disusun oleh mahasiswa Ilmu Pendidikan Jurusan Manajemen Pendidikan yang diketuai oleh Indri Irawati serta anggotanya Fenty Wulandari Trisna Asdi dan Risa Apriliya Cahyati.</p>','pmw|BUCIN|Bucket|Chocolate|Inovatif|makanan',1,1,'2019-03-11 20:27:40','2019-03-14 03:27:08'),(605,0,'SEBLAK NAGA','2019 17010644092 Rizqi Noviyanti Fauziyah.pdf',NULL,2586000,'<p><span style=\"text-align: justify; text-indent: 66.2px; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; font-size: 12pt; line-height: 18.4px; font-family: \'Times New Roman\', serif;\">Prospek&nbsp;</span><span style=\"text-align: justify; text-indent: 66.2px; font-size: 12pt; line-height: 18.4px; font-family: \'Times New Roman\', serif;\">makanan unik yang memang sedang menjadi &ldquo;buah bibir&rdquo; disemua kalangan. Serta khasiat yang ditimbulkan memang banyak sekali untuk kesehatan tubuh kita. Kami memberikan sumbangsih untuk membuat produk yang dikatakan unik tersebut yaitu Seblak Naga yang higienis dan aman dari bahan pengawet berbahaya karena kandungan nutrisi yang sudah dipercaya dan tentunya sangat baik untuk menjaga kesehatan</span><span lang=\"IN\" style=\"text-align: justify; text-indent: 66.2px; font-size: 12pt; line-height: 18.4px; font-family: \'Times New Roman\', serif;\">. Disinilah kami memiliki pemikiran agar buah naga beserta kulitnya dapat diterima dan disukai di tengah-tengah masyarakat.&nbsp;&nbsp;</span><span style=\"text-align: justify; text-indent: 66.2px; font-size: 12pt; line-height: 18.4px; font-family: \'Times New Roman\', serif;\">Seblak Naga merupakan sebuah</span><span style=\"text-align: justify; text-indent: 66.2px; font-size: 12pt; line-height: 18.4px; font-family: \'Times New Roman\', serif;\">&nbsp;</span><span style=\"text-align: justify; text-indent: 66.2px; font-size: 12pt; line-height: 18.4px; font-family: \'Times New Roman\', serif;\">inovasi dan kreativitas dari bahan pangan yang sebagian besar hanya disukai buahnya saja, kulitnya tidak. Maka dari itu kami mencoba berbagai cara bagaimana kulit dari buah naga ini dapat diterima di tengah-tengah masyarakat, karena sungguh berharga kandungan gizi yang ada di kulit buah naga ini jika tidak kita manfaatkan. Oleh karena itu kami membuat sebuah olahan pangan yang sudah banyak dikenal oleh masyarakat terutama mahasiswa yaitu Seblak Mie.&nbsp;<span style=\"background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">Ditinjau dari segi ekonomi harga penjualan produk yang kami tawarkan ini cukup terjangkau di kalangan masyarakat, bahan baku mudah didapat harganya pun terbilang murah. Jika produk&nbsp;</span>Seblak Naga&nbsp;<span style=\"background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">ini diproduksi secara massal dan diterapkan atau disosialisasikan ke masyarakat luas bahkan sampai ke seluruh negara</span></span><span lang=\"IN\" style=\"text-align: justify; text-indent: 66.2px; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; font-size: 12pt; line-height: 18.4px; font-family: \'Times New Roman\', serif;\">. Maka produk ini akan bisa menjadi produk unggulan dari Indonesia. Dengan demikian maka&nbsp;</span><span style=\"text-align: justify; text-indent: 66.2px; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; font-size: 12pt; line-height: 18.4px; font-family: \'Times New Roman\', serif;\">kulit beserta buah dari buah naga</span><span lang=\"IN\" style=\"text-align: justify; text-indent: 66.2px; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; font-size: 12pt; line-height: 18.4px; font-family: \'Times New Roman\', serif;\">&nbsp;yang didapat pasti akan terjamin kualitasnya.&nbsp;</span><span style=\"text-align: justify; text-indent: 66.2px; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; font-size: 12pt; line-height: 18.4px; font-family: \'Times New Roman\', serif;\">Meskipun sekarang sudah banyak variasi makanan baru, tetapi olahan&nbsp;</span><span style=\"text-align: justify; text-indent: 66.2px; font-size: 12pt; line-height: 18.4px; font-family: \'Times New Roman\', serif;\">Seblak Naga<span style=\"background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">&nbsp;akan tetap disukai masyarakat dari berbag</span></span><span lang=\"IN\" style=\"text-align: justify; text-indent: 66.2px; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; font-size: 12pt; line-height: 18.4px; font-family: \'Times New Roman\', serif;\">a</span><span style=\"text-align: justify; text-indent: 66.2px; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; font-size: 12pt; line-height: 18.4px; font-family: \'Times New Roman\', serif;\">i kalangan sesuai dengan minat masyarakat dalam mengkonsumsi Seblak Mie pada umumnya d</span><span lang=\"IN\" style=\"text-align: justify; text-indent: 66.2px; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; font-size: 12pt; line-height: 18.4px; font-family: \'Times New Roman\', serif;\">engan mempertimbangkan manfaat yang terkandung dalam kulit dan buah dari buah naga tersebut.</span></p>','Buah Naga|Kulit Buah Naga|Seblak|Seblak Naga|Seblak Mie',1,1,'2019-03-11 20:54:46','2019-03-15 07:11:35'),(608,0,'Eat My Mbote','2019 17020154053 Choirunnisa.pdf','2019 17020154053 Choirunnisa.pdf',10937500,'<p>usaha makanan ringan berupa keripik yang menggunakan bahan baku klasik namun dikemas dengan kemasan yang ramah lingkungan dan dengan desain kekinian. dipasarkan dengan dua cara<em>offline</em> dan<em>online</em>. secara<em>offline</em> di pasarkan sekitar surabaya-gersik-sidoarjo. secara<em> online</em> di pasarkan melalui instagram, facebook, dan shopee(situs belanja online)</p>',NULL,1,1,'2019-03-11 21:20:09','2019-04-29 01:33:16'),(609,0,'Z-Tix Batik Nyentrik','2019 17020084096 Nurul Iftitah.pdf',NULL,6500000,'<p>Batik Nyentrik (Z Tix) adalah sebuah kaos bermotif batik yang bertujuan untuk mengenalkan budaya batik ke generasi muda. Dengan menghadirkan motif batik dari berbagai daerah di Indonesia, Batik Nyentrik (Z Tix) diharap manpu memberi warna baru dalam gaya berpakaian anak muda jaman sekarang yang terus berubah dan berkembang.</p>','Enter',5,1,'2019-03-11 21:24:55','2019-03-15 04:20:16'),(610,0,'NUBAR! (Nasi Uduk Bakar)','2019 17020084051 Yossi Rifki Noviadayanti.pdf',NULL,6970000,'<p>Nasi uduk adalah salah satu masakan tradisional Indonesia dan kami ingin tetap menjaga eksistensinya dengan membuat inovasi produk bernama NUBAR! (Nasi Uduk Bakar). Produk ini adalah produk nasi bakar yang dibuat dengan cara berbeda yakni dibakar serta diberi isian bervariasi, selain itu kami juga mengemasnya secara cantik untuk lebih memikat pembeli.</p>','Nasi|Bakar|Nasi bakar|Nasi uduk',1,1,'2019-03-11 21:31:09','2019-03-14 02:19:46'),(611,0,'SECU (Spesial and Cute Bouquet)','2019 17010714042 Achmad Candra Wijasena.pdf',NULL,7000000,'<p><span style=\"font-size: 12.0pt; mso-bidi-font-size: 11.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; mso-fareast-font-family: Calibri; mso-fareast-theme-font: minor-latin; mso-ansi-language: IN; mso-fareast-language: EN-US; mso-bidi-language: AR-SA;\">Pada dasarnya dari dulu sampai sekarang kita tidak lepas dari yang namanya bunga. Bunga selalu dibutuhkan dalam setiap acara karena kebanyakan orang menyukai bunga,&nbsp;sehingga kami berinisiasi untuk membuat usaha SECU Bouquet : Special and Cute Bouquet. Kami mempunyai&nbsp;Visi dan Misi \"Customer desires that match custom (keinginan pelanggan yang sesuai custom). SECU Bouquet ini adalah Produk yang hendak memberikan pergeseran bagi Bouquet yang sudah sering digunakan oleh pengguna pada umumnya, untuk merayakan moment special maka juga dibutuhkan bouquet yang Special dan Cute. Sehingga dengan berani produk yang dihasilkan jelas akan berbeda dengan yang ditemukan di pasaran. Bouquet biasanya hanya dihiasi dengan rangkaian bunga, Kartu Ucapan, boneka dan snack akan sangat berbeda dengan SECU (Special and Cute) Bouquet yang material-nya akan disesuaikan dengan keperluan dan keinginan pelanggan, Yang tidak menutup kemungkinan penggunaan material seperti Buku, dan Teks. Tidak terlihat kuno dimata millennial dengan kecakapan penggunaan warna dan material yang tepat.</span></p>','Bouquet|Spesial|Cute|Bunga|SECU',4,1,'2019-03-11 21:31:41','2019-03-14 12:06:32'),(613,0,'TRENDRINK : Si Bule Rasa Lokal','2019 17040674071 Billa Fanisa.pdf',NULL,14790000,'<p class=\"MsoNoSpacing\" style=\"text-align: justify; line-height: 115%; tab-stops: 14.2pt;\"><span lang=\"IN\" style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; letter-spacing: -.05pt; mso-ansi-language: IN;\">&nbsp; &nbsp; Trendrink merupakan menuman inovasi dari ketela yang disajikan dalam jenis minumaan <em style=\"mso-bidi-font-style: normal;\">float</em>. Trendrink memiliki 6 varian rasa diantaranya original, coklat, stroberi, matcha, cappucino, dan oreo dengan cara pemberian bubuk rasa pada saat diblend. Selain memiliki banyak varian rasa, Trendrink juga diberikan tambahan ice cream sebagai topping yang menambah kemenarikkan dari Trendrink. </span></p>\n<p class=\"MsoNoSpacing\" style=\"text-align: justify; line-height: 115%; tab-stops: 14.2pt;\"><span lang=\"IN\" style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; letter-spacing: -.05pt; mso-ansi-language: IN;\"><span style=\"mso-tab-count: 1;\">&nbsp;&nbsp;&nbsp;&nbsp; </span>Trendrink dikemas dengan menggunakan cup plastik printing ukuran 14 oz<span style=\"mso-spacerun: yes;\">&nbsp; </span>dengan desain Trendrink yang menarik. Trendrink sendiri dijual secara langsung di tempat-tempat yang strategis dengan menggunakan booth minuman yang menarik. Booth minuman yang digunakan pun memiliki desain yang unik dan menarik agar konsumen pun tertarik. Selain itu, Trendrink juga akan dipromosikan melalui online dengan menggunakan berbagai sosial media seperti instagram, line, facebook, whatsapp dan juga melalui offline dengan menyebarkan brosur dan dari mulut ke mulut.</span></p>\n<p class=\"MsoNormal\" style=\"margin-bottom: 8.0pt; text-align: justify; text-indent: 14.2pt; mso-pagination: widow-orphan;\"><span lang=\"IN\" style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; letter-spacing: -.05pt; mso-ansi-language: IN;\">Dalam satu bulan Trendrink menargetkan penjualan sebanyak 20 cup perhari dengan total 600 cup selama sebulan. Trendrink mengambil keuntungan Rp </span><span style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; letter-spacing: -.05pt;\">1.800 </span><span lang=\"IN\" style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; letter-spacing: -.05pt; mso-ansi-language: IN;\">dari harga jual Rp 7000. Tempat produksi utama Trendrink berada di Bohar Selatan rt.06/rw.03 Sidoarjo dengan sistem penjualan melalui booth minuman. Dengan menggunakan sistem yang praktis diharapkan Trendrink dapat membuka banyak cabang di </span><span style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; color: black;\">seluruh Surabaya, Sidoarjo dan Pacitan bahkan seluruh daerah Jawa Timur.</span></p>','Minuman |Inovasi|Kekinian|Float|Ketela rambat',1,1,'2019-03-11 22:07:45','2019-03-20 03:23:56'),(614,0,'Lilin aroma terapi: Aroma Alam','2019 17020084007 Desti Anggraini.pdf',NULL,6000,'<p>lilin aroma terapi: Aroma Alam ini dibuat dengan minyak esensial yang mempunyai beranekaragam aroma yang dibuat unik dalam jar sehingga menambah nilai estetika dan kepraktisan. aroma dari minyak esensial ini dapat membantu meredakan stres, merelaksasikan pikiran, meningkatkan kualitas tidur, dan dapat mengobati masalah pernapasan.</p>','lilin|aroma|terapi|minyak|esensial',5,1,'2019-03-11 22:34:55','2019-03-15 03:44:50'),(615,0,'SEW OLD JEANS INTO THE BAG (SOJIB)','2019 17081194075 Maolina Nurdin.pdf',NULL,3000000,'<p><span style=\"font-size: 12pt; line-height: 115%; font-family: \'Times New Roman\', serif; position: relative; top: 0.5pt;\">SOJIB &ldquo;<em>Sew Old Jeans Into the Bag</em>&rdquo; merupakan usaha yang bergerak di bidang jasa dimana konsumen akan menyediakan celana jeans tak terpakai, yang kemudian akan kami ubah dengan menjahitnya menjadi tas. SOJIB &ldquo;Sew Old Jeans Into the Bag&rdquo; termotivasi dari keinginan kami membantu para pengguna jeans untuk mendaur ulang celana jeansnya yang sudah tak terpakai menjadi sesuatu yang dapat digunakan agar jeans tersebut tidak menjadi limbah yang mencemari lingkungan. Kami juga menyediakan jenis dan model yang dapat dipilih langsung oleh konsumen.</span></p>','tas|jeans|barang bekas|jasa|SEW OLD JEANS INTO THE BAG (SOJIB)|SOJIB',2,1,'2019-03-11 22:39:34','2019-03-15 06:54:51'),(616,0,'HDKPROJECT \"5 in 1\"','2019 17010014061 Roby Anggara Handika Putra.pdf',NULL,9500000,'<p>HDKPROJECT&nbsp;<em>\"5 in 1\"&nbsp;</em>merupakan usaha dibidang jasa yang melayani pemesanan meliputi 5 bidang yaitu, Desain, Foto, Video, Konveksi, dan Souvenir. dengan demikian dapat mempermudah customer dalam mencari tempat untuk melakukan pemesanan meliputi 5 bidang tersebut. HDKPROJECT memiliki potensi keuntungan yang tinggi dengan resiko kerugian yang sangat rendah, akan tetapi HDKPROJECT membutuhkan pengembangan meliputi alat dan promosi/pemasaran.</p>','jasa|desain|konveksi|fotographi|videographi|souvenir|murah|kado|unik',2,1,'2019-03-11 22:52:58','2019-03-14 23:20:27'),(617,0,'So Party (ShOes rePAiR and proTecy)','2019 17010024042 Donny rahmansyah.pdf',NULL,5000000,'<p class=\"MsoNoSpacing\" style=\"margin-left: 35.45pt; text-align: justify; text-indent: -14.15pt; line-height: 150%; tab-stops: 14.2pt;\"><span lang=\"EN-ID\" style=\"font-size: 12.0pt; line-height: 150%; font-family: \'Times New Roman\',serif; letter-spacing: -.05pt; mso-ansi-language: EN-ID;\">Usaha Jasa ini berawal dari pengalaman sendiri saat mempunyai sepatu, saat sepatu rusak tetapi tidak memiliki uang lebih untuk membeli sepatu baru saat itu pula berfikir untuk membuat inovasi reparasi sepatu yang dapat membuat sepatu rusak menjadi seperti baru. Jasa ini menguntukan untuk masyarakat menengah kebawah yang tidak ingin mengeluarkan uang lebih untuk membeli sepatu baru, serta dapat memperbaiki sepatu kesayangan yang penuh denga cerita hidup.</span></p>','So Party',2,1,'2019-03-11 23:39:08','2019-03-14 23:17:23'),(618,0,'PONARI (KLEPON WARNA-WARNI ORGANIK LEZAT BERGIZI)','2019 17010714048 MOCH. ISNUDIN.pdf',NULL,5037000,'<p><span lang=\"EN-US\" style=\"font-size: 12pt; line-height: 115%; font-family: \'Times New Roman\', serif; color: #222222; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">Program wirausaha ini bernama PONARI (Klepon Warna Warni Organik Lezat Bergizi). PONARI merupakan usaha kuliner yang terinovasi dari jajanan khas Pausuruan yaitu klepon. Bahan PONARI terbuat dari bahan dasar tepung ketan yang diberi varian warna dari bahan-bahan organik dan dibentuk bermacam-macam dengan bentuk buah, memiliki varian rasa nanas, cokelat, dan str</span><span style=\"font-size: 12pt; line-height: 115%; font-family: \'Times New Roman\', serif; color: #222222; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">o</span><span lang=\"EN-US\" style=\"font-size: 12pt; line-height: 115%; font-family: \'Times New Roman\', serif; color: #222222; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">beri serta diberi taburan keju. Usaha&nbsp; ini dibuat karena adanya realitas masyarakat yang kurang berminat terhadap jajanan tradisional dan sehat</span><span style=\"font-size: 12pt; line-height: 115%; font-family: \'Times New Roman\', serif; color: #222222; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">, </span><span style=\"font-size: 12pt; line-height: 115%; font-family: \'Times New Roman\', serif; color: #222222; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">&nbsp;</span><span style=\"font-size: 12pt; line-height: 115%; font-family: \'Times New Roman\', serif; color: #222222; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">m</span><span lang=\"EN-US\" style=\"font-size: 12pt; line-height: 115%; font-family: \'Times New Roman\', serif; color: #222222; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">engapa harus produk makanan sehat? Rumah sakit selalu dipenuhi pasien dari usia muda hingga tua. Sebagian besar pasien tidak menjaga kesehatan terutama pada makanan yang dikonsumsi. Bagaimana tidak, sebagian besar jajanan yang tersebar di pasaran merupakan jajanan yang kurang sehat namun dibungkus dengan be</span><span style=\"font-size: 12pt; line-height: 115%; font-family: \'Times New Roman\', serif; color: #222222; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">n</span><span lang=\"EN-US\" style=\"font-size: 12pt; line-height: 115%; font-family: \'Times New Roman\', serif; color: #222222; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">tuk luaran produk yang menarik didukung minat masyarakat yang tinggi terhadap jajanan yang terlihat menarik dari bentuk luar tanpa mengetahui komposisi bahan jajanan tersebut. Di sisi lain, jajanan tradisional yang memiliki komposisi bahan sehat sudah tersisihkan oleh jajanan yang moderen dan cepat saji. Oleh karena itu PONARI ini dibuat dengan konsep semenarik mungkin agar dapat meningkatkan minat masyarakat terhadap jajanan tradisional dan sehat. Dengan demikian, kami rasa produk ini cocok digunakan pada masa sekarang sebagai usaha melestarikan jajanan tradisional dan sehat yang beredar di masyarakat.</span></p>','KLEPON|ORGANIK|GIZI',1,1,'2019-03-11 23:39:25','2019-03-14 20:46:09'),(619,0,'vytie.id','2019 17010024017 Silvi Rohmawati.pdf',NULL,10300000,'<p><strong>Vytie.id</strong> adalah sebuah nama produk yang didalamnya memproduksi outer yang fashionable dan stylish. Outer adalah elemen tambahan dalam satu penampilan yang mampu membuat seketika menjadi lebih stylish. Keunggulan dari produk ini selain banyak motif yang bisa dipilih oleh konsumen, modelnya juga kekinian</p>','outer vytie.id|outer|vytie.id|kekinian',4,1,'2019-03-11 23:45:18','2019-03-14 17:43:11'),(620,0,'Re_Mi','2019 17040284078 Ashri hani prasetyo.pdf',NULL,8500000,'<p>Kegiatan wirausaha ini dilatar belakangi oleh semakin berkembangnya cemilan atau makanan ringan dengan berbagai rasa. Contohnya saja seperti makaroni pedas, keju, dan lain-lain. Produk cemilan atau jajanan ini sudah umum dipasaran dan memang sedang digandrungi oleh generasi milenial. Sayangnya, jajanan tradisional mulai bergeser ke lokasi pariwisata dan akhirnya hanya sekedar oleh-oleh yang peminatnya tidak terlalu banyak. Salah satunya yaitu rengginang. Jajanan tradisional ini tidak terlalu dikenal oleh generasi milenial yang lebih mengenal makanan ringan yang dijual di minimarker dan supermarket. Rasanya yang gurih dan renyah, dirasa cocok untuk lidah masyarakat masa kini, apalagi ditambah dengan varian rasa yang beragam.&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>Usaha Re_Mi ini diharapkan mampu mengenalkan eksistensi rengginang sebagai jajanan tradisional yang dapat bersaing dengan makanan atau cemilan masa kini. Dengan varian rasa dan kemasan yang disesuaikan dengan tren terkini justru menjadikan rengginang pantas bersanding dan bersaing dipasaran bersama dengan jajanan populer sejenis makaroni, keripik kentang, mie lidi dan lain sebagainya. Kandungan dalam jajanan rengginang pun sederhana, beras ketan dan campuran bumbu seperti bawang putih, garam, dan terasi, lalu digoreng renyah dengan minyak panas menjadi salah satu keunggulan produk ini karena dengan teknik tersebut mampu membuat rengginang yang biasanya dijual dipasar tradisional menjadi lebih renyah dan gurih. Ditambah lagi dengan varian rasa seperti sapi panggang (BBQ), jagung bakar, dan balado.</p>\r\n<p>&nbsp;</p>\r\n<p>Target khusus dari usaha ini adalah mahasiswa Universitas Negeri Surabaya dan masyarakat sekitar baik laki-laki maupun perempuan yang merupakan generasi milenial sesuai dengan nama usaha kami yaitu Re_Mi yang berarti Rengginang Milenial. Selain itu kebanyakan mahasiswa mengenal jajanan rengginang ini namun mereka mengetahuinya hanya sebatas jajanan tradisional yang &lsquo;murahan&rsquo;. Sehingga kami ingin menjadikan rengginang sebagai salah satu jajanan eksis mahasiswa Universitas Negeri Surabaya dan masyarakat sekitar.</p>\r\n<p>&nbsp;</p>','Rengginang|Millennials|Camilan kekinian|Remi',1,1,'2019-03-11 23:57:24','2019-03-20 04:05:54'),(621,0,'MILIH SABU (mie lidi aneka sayur dan buah)','2019 17010024003 AINA NI\'MATUL ALIYAH.pdf',NULL,7000000,'<p class=\"Default\" style=\"text-align: justify; line-height: 150%;\"><span style=\"font-family: \'Times New Roman\',\'serif\';\">mie lidi dengan campuran bahan dari buah-buahan dan sayur-sayuran yang dipadukan dengan serbuk cabai (untuk varian pedas) dan garam (untuk varian asin). Mie lidi mungkin tidak asing lagi dikalangan remaja saat ini. Pemilihan buah-buahan dan sayur-sayuran sebagai campuran pembuatan mie lidi ini dikarenakan buah-buahan dan sayur-sayuran mengandung vitamin dan serat yang sangat bermanfaat dan tentunya sehat untuk tubuh. Tidak hanya karbohidrat dari tepung terigu saja yang terkandung didalam adonan pembuatan mie lidi tetapi ada serat dan vitaminnya juga yang terdapat dari buah-buahan dan sayur-sayuran. Fungsi penambahan buah-buahan dan sayur-sayuran ini juga untuk menambah warna agar menarik karena terdapat sari sari buah-buahan dan sayur-sayuran asli.</span></p>\r\n<p class=\"Default\" style=\"text-align: justify; line-height: 150%;\"><span class=\"ilfuvd\"><span style=\"font-family: \'Times New Roman\',\'serif\';\">Adapun kandungan nutrisi yang ada pada buah antara lain: Vitamin dan mineral, seperti vitamin C, asam folat, kalium, vitamin A (beta <span style=\"mso-bidi-font-weight: bold;\">karoten</span>), vitamin E, magnesium, <span style=\"mso-bidi-font-weight: bold;\">zinc</span>, dan. Air dan. <span style=\"mso-bidi-font-weight: bold;\">Antioksidan</span> dan <span style=\"mso-bidi-font-weight: bold;\">fitonutrien</span>, yang juga memberi manfaat tersendiri bagi kesehatan tubuh.&nbsp;</span></span><span lang=\"EN-US\" style=\"font-size: 12pt; line-height: 150%; font-family: \'Times New Roman\', serif;\">Mie lidi ini ada dua versi, yaitu pedas, asin. Untuk versi pedas akan diberi saus pedas dan serbuk cabai, untuk versi </span><span style=\"font-size: 12pt; line-height: 150%; font-family: \'Times New Roman\', serif;\">asin akan diberi garam dan kaldu bubuk</span><span lang=\"EN-US\" style=\"font-size: 12pt; line-height: 150%; font-family: \'Times New Roman\', serif;\">.</span></p>','mie lidi sayur dan buah|mie lidi',1,1,'2019-03-12 00:23:04','2019-03-14 15:00:28'),(622,0,'Bakul Kado','2019 17010714052 Adelia Dinda Permatasari.pdf',NULL,7500000,'<p class=\"MsoNormal\" style=\"text-align: justify; text-indent: 36.0pt;\"><span lang=\"IN\" style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',serif; mso-ascii-theme-font: major-bidi; mso-hansi-theme-font: major-bidi; mso-bidi-theme-font: major-bidi; mso-ansi-language: IN;\">Usaha kami adalah jenis usaha yang bergerak pada bidang industri kreatif dimana kami memanfaatkan peluang dalam pengolahan desain grafis berjudul \"Bakul Kado\". Seperti namanya, usaha ini adalah usaha yang menjual kado untuk diberikan kepada orang-orang tersayang dihari-hari istimewa atau hanya sekedar untuk kejutan.&nbsp;</span><span lang=\"IN\" style=\"text-indent: 36pt; font-size: 12pt; line-height: 115%; font-family: \'Times New Roman\', serif;\">Bakul kado menjual kreasi frame foto 3D dengan desain unik berbentuk 3D atau dapat disebut dengan pop up frame. Proses produksi kami dimulai dengan membuat kerangka desain sesuai keinginan pelanggan kemudian desain di cetak dan disusun menggunakan bahan yang dibutuhkan pada pigura berbentuk <em>scrapbook </em>tiga dimensi. Pop up frame memang belum cukup terkenal dikalangan masyarakat, namun dengan seiring perkembangan waktu dan teknologi yang ada usaha yang kami buat akan semakin banyak peminat dan pesaingnya. Oleh karena itu kami membuat inovasi yang berbeda mengenai produk yang akan dibuat, sehingga kami yakin akan dapat bersaing dengan produk yang sejenis lainya.&nbsp;</span><span style=\"text-indent: 36pt; font-family: \'Times New Roman\', serif; font-size: 12pt;\">Tujuan dalam pembuatan produk ini adalah sebagai realisasi dari ide-ide kami menjadi sebuah peluang usaha yang nantinya akan kami kembangkan, selain itu kami ingin melatih jiwa berwirausaha di usia</span><span style=\"text-indent: 36pt; font-family: \'Times New Roman\', serif; font-size: 12pt;\">&nbsp; </span><span style=\"text-indent: 36pt; font-family: \'Times New Roman\', serif; font-size: 12pt;\">muda, menikmati prosesnya dan menggali pengalaman sebanyak-banyaknya yang nantinya dapat menjadi bekal bagi kami di masa mendatang.</span></p>','kreatif|Kreatif|Frame 3d|Frame3D|Unik|Kado',4,1,'2019-03-12 00:33:34','2019-03-15 01:45:20'),(623,0,'HOLIBEANS (Homemade sling bag berbahan jeans)','2019 17020084005 Anggi Yanita Octaviani.pdf',NULL,8000000,'<p>Homemade sling bag ini memanfaatkan jeans bekas yang tak terpakai. Meskipun memanfaatkan bahan bekas kami tetap memperhatikan kualitas. Kami juga menawarkan harga yang terjangkau. Macam-macam tas yang akan kami produksi seperti sling bag berwarna-warni, ransel kecil, totebag dan dompet.</p>','Tas|Slingbag|Jeans|Holibeans',5,1,'2019-03-12 00:42:27','2019-03-14 21:58:49'),(624,0,'Moody (Minuman dari daging buah siwalan dengan rasa matcha dan coklat)','2019 17080554074 Nadhira Aisyah Damayanti.pdf',NULL,8600000,'<p>\"Moody\" merupakan produk minuman yang berbahan buah siwalan dengan varian rasa <em>matcha</em> dan coklat. Minuman kekinian yang memiliki rasa nikmat, unik dan menyegarkan yang dikemas dengan menarik. Selain dari segi cita rasa yang dapat memuaskan konsumen, produk ini juga memiliki kandungan nutrisi tinggi, siwalan memiliki kandungan vitamin C,&nbsp; B1, protein dan fosfor yang dapat menyehatkan tubuh.&nbsp;</p>\n<p>Selain itu peluang untuk memulai usaha ini sangat menjanjikan,&nbsp; karena pada persaingan pasar masih belum ditemukan produk lain yang sejenis. Selain itu keadaan cuaca disekitar tempat usaha (surabaya)&nbsp; yang panas akan terus menambah kebutuhan konsumen pada minuman yang praktis tetapi nikmat. Sehingga kami yakin bahwa produk ini dapat berkembang dengan pesat.&nbsp;&nbsp;</p>','Buah siwalan dengan rasa coklat dan matcha|Buah siwalan|Matcha|Coklat|Nutrisi |Menyegarkan|Menyehatkan|Unik',1,1,'2019-03-12 00:44:41','2019-03-18 13:21:31'),(625,0,'Keriku Krezz Krizz (Keripik Kubis Lezat Bergizi)','2019 17010014001 Vivin Ariyanti.pdf',NULL,6000000,'<p>Indonesia merupakan suatu negara besar yang memiliki banyak budaya atau adat istiadat yang beragam. Dengan adanya keragaman tersebut menyebabkan Indonesia disebut sebagai negara yang kaya akan budaya. Keragaman yang sering kita ketahui yaitu terkait dengan rumah adat, pakaian adat, tarian adat, bahasa daerah serta makanan daerah. Keragaman pada setiap daerah menjadi keunikan tersendiri daerah-daerah tersebut.</p>\r\n<p>Salah satu makanan daerah yang sering ditemui yaitu keripik berbagai jenis yang berasal dari beberapa daerah , seperti keripik bayam Malang dan keripik talas dari kediri. Keriku Krezz Krizz (K3) merupakan salah satu inovasi usaha dalam bidang makanan dengan bahan dasar kubis. Kubis merupakan salah satu jenis sayur yang tersebar luas di Indonesia. Di Indonesia kubis sering diolah menjadi sayur, padahal kubis memiliki beberapa potensi yang baik jika diolah menjadi produk lain seperti Keriku Krezz Krizz.</p>\r\n<p>Keriku Krezz Krizz merupakan jenis makanan inovasi baru yang murah dan memiliki manfaat yang sangat banyak. Keriku Krezz Krizz ini bermanfaat bagi orang-orang yang memiliki kebiasaan mengkonsumsi makanan ringan. Prospek pemasaran makanan ini berkembang dengan sangat baik karena menggunakan metode online dan offline serta dapat dikonsumsi oleh berbagai kalangan baik anak-anak, remaja, maupun orang dewasa.</p>\r\n<p>&nbsp;</p>','Snack|Makanan|Keripik|Kubis|Cemilan|Lezat|Bergisi|Bergizi|Manis|Nikmat|Pedas',1,1,'2019-03-12 00:50:03','2019-03-14 19:18:42'),(626,0,'Baby Crab Snack','2019 17020084013 kholisatun nikmah.pdf',NULL,5065000,'<p>baby crab snack merupakan&nbsp;makanan&nbsp;ringan yang terbuat dari kepiting kecil yang diolah kering dan dikombinasikan dengan berbagai rasa.&nbsp;</p>','kepiting|kecil|kering|crab|baby',1,1,'2019-03-12 00:56:44','2019-03-14 22:12:30'),(627,0,'MY HAIR CARE','2019 16030194092 Fajar Wisnu Pambudi.pdf',NULL,12000000,'<p class=\"MsoNormal\" style=\"text-align: justify; text-indent: 36.0pt;\"><span lang=\"IN\" style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; mso-ansi-language: IN;\">Proposal ini bertujuan untuk mengajukan sebuah produk berupa pemanfaatan lidah buaya (<em style=\"mso-bidi-font-style: normal;\">aloevera) </em><span style=\"mso-spacerun: yes;\">&nbsp;</span>dan daun kelor (<em style=\"mso-bidi-font-style: normal;\">moringa oliefera) </em>menjadi produk perawatan rambut berupa shampo dan <em style=\"mso-bidi-font-style: normal;\">hair tonic</em>. </span><span style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\';\">Lidah buaya (<em style=\"mso-bidi-font-style: normal;\">aloevera</em>) adalah tanaman yang memiliki manfaat lebih untuk perawatan rambut khususnya dapat menyuburkan rambut, mencegah kerontokan, dan melembabkan. Daun kelor (<em style=\"mso-bidi-font-style: normal;\">moringa oliefera</em>) merupakan bahan alami yang telah diketahui dapat menyehatkan kulit kepala dan rambut. Daun kelor (<em style=\"mso-bidi-font-style: normal;\">moringa oliefera</em>) merupakan bahan alami yang telah diketahui dapat menyehatkan kulit kepala dan rambut . Daun kelor mengandung mineral, asam amino esensial, anti oksidan seperti vitamin C, vitamin E, flavonoid, dan masih banyak lainnya. Lidah buaya dan daun kelor banyak ditemui di Indonesia, khususnya di Pulau Jawa. Banyaknya tanaman lidah buaya dan daun kelor yang ditemui di Indonesia membuat kami tertarik untuk memanfaatkan tanaman tersebut agar lebih bermanfaat bagi semua kalangan. </span></p>\n<p class=\"MsoNormal\" style=\"text-align: justify; text-indent: 36.0pt;\"><span style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\';\">Dengan adanya produk perawatan rambut dari bahan alami diharapkan dapat memberikan manfaat lebih bagi kesehatan rambut. Usaha produk shampo berbahan dasar lidah buaya yang telah kami jalani telah banyak terjual di pulau jawa khususnya di Surabaya. Selain menjadi konsumen, beberapa orang ingin mendaftarkan diri untuk menjadi <em style=\"mso-bidi-font-style: normal;\">Reseller</em> produk shampo tersebut. Tingginya minat pembeli terhadap produk perawatan rambut membuat kami tertarik untuk mengembangkan produk kami yakni dengan mengeluarkan produk baru yaitu <em style=\"mso-bidi-font-style: normal;\">hair tonic</em> berbahan lidah buaya dan daun kelor. Oleh sebab itu, kami layak mendapatkan pendampingan usaha melalui PMW dengan banyaknya manfaat bagi konsumen dan bagi <em style=\"mso-bidi-font-style: normal;\">Reseller</em> jika produk kami terlaksana.</span><span lang=\"IN\" style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; mso-ansi-language: IN;\"> Produk ini akan kami jual dengan harga yaitu </span><span style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\';\">60 mL dengan harga Rp 8.000/botol. Sedangkan untuk jenis <em style=\"mso-bidi-font-style: normal;\">hair tonic</em> akan dijual dalam kemasan 120 mL dengan harga Rp. 15.000/botol.</span></p>','shampo|hair tonic|daun kelor|lidah buaya',5,1,'2019-03-12 01:19:50','2019-03-20 02:11:27'),(628,0,'CHIKUNG: Kimchi Kangkung','2019 17081194042 Vira oktaviani rezqy.pdf',NULL,4050000,'<p>Mahasiswa sebagai&nbsp;<em>agent of change</em> mulai melirik profesi seorang entrepreneur, namun menjadi seorang entrepreneur tidaklah mudah. Banyak sekali rintangan yang harus dihadapi oleh seorang mahasiswa yang ingin menjadi seorang entrepreneur, salah satunya masalah permodalan. Proposal ini bertujuan untuk mengikuti program mahasiswa wirausaha yang dimana bukan hanya permodalan saja yang diberikan tetapi ilmu mengenai kewirausahaan dan pengembangan jiwa entrepreneur. Chikung menjadi produk yang kami usungkan dalam PMW, karena produk ini merupakan inovasi pertama yang mengakulturasikan makanan korea dengan bahan dan bumbu khas Indonesia.</p>','Chikung, Kimchi, Fermentasi',1,1,'2019-03-12 01:26:01','2019-03-17 05:53:47'),(629,0,'Nyakitin (Nuggetnya Kentang Ikan Patin)','2019 17010044060 Moch. Baharudin Yusuf.pdf',NULL,5090700,'<p>Autis atau gangguan spektrum autis merupakan anak berkebutuhan khusus dan mengalami gangguan pada perkembangan otak. Anak autis memiliki kesulitan berkomunikasi dan berinteraksi dengan oranglain, untuk mengurangi gejala pada anak autis pola makan harus di pertimbangkan. Dalam banyak kasus menyatakan bahwa anak autis menderita alergi atau sangat sensitif terhadap makanan yang mengandung protein khusus bernama gluten dan kasein, karena tubuh mereka memproses dua kandungan protein tersebut dengan cara yang berbeda dengan anak normal pada umumnya. Oleh karena itu kami mempunyai ide untuk membuat makanan nuget bergizi untuk anak autis dengan memperhatikan bahan-bahan yang di gunakan untuk anak autis. Nugget tersebut di buat dengan campuran ikan patin dan kentang, serta tepung maizena. Disini kami mengambil kentang sebagai alternatif pengganti tepung, karena mengingat anak Autis harus menghindari makanan yang mengandung gluten, dan salah satu bahan yang mengandung Gluten free Casein Free (GFCF) adalah Kentang. Kentang juga memiliki manfaat lain yaitu untuk membantu meningkatkan fungsi pencernaan dalam tubuh sehingga secara alami akan membantu dalam proses penurunan berat badan. Tetapi tetap harus di kombinasi dengan sumber gizi yang seimbang, oleh karena itu kami membuat nugget kentang ikan dengan ikan patin , karena kandungan lemak pada ikan patin lebih rendah di bandingkan jenis ikan lainnya. selain itu ikan patin memiliki manfaat atu kandungan nutrisi yang tinggi untuk pertmbuhan anak. &nbsp;</p>\r\n<p>Adapun keunggulan dari produk yang kami tawarkan adalah makanan ini memiliki penyajian yang menarik perhatian konsumen. &nbsp; Dengan berbgai bentuk pola huruf dan kemasan yang membuat anak-anak dan konsumen lain tertarik. Produk ini masih belum ada di pasaran sehingga kami mempunyai inovasi baru untuk membuat produk makanan yang menjanjikan dari segi kandungan, rasa dan penampilan yang tidak akan mengecewakan konsumen. Produk ini kami sajikan untuk masyarakat secara luas pada umumnya namun yang terpenting dari adanya produk Keripik T&eacute;rasa yang menjadi sasaran utama kami adalah Anak Berkebutuhan khusus, khsusunya anak dengan spektrum Autis. Selain itu, dengan adanya produk baru yang telah kami buat dapat menambah inovasi baru bagi masyarakat untuk membuat peluang usaha, dan juga menambah pengetahuan untuk para orangtua khususnya ibu-ibu yang mempunyai anak dengan spetrum Autis.</p>\r\n<p>&nbsp;</p>','Nugget|Kentang|Patin|Autis|Makanan|Nyakitin|Sehat|Snack|Ikan|Murah|Spektrum|Jajanan|Instan|Gluten|Casein|Free|Gizi|Ringan|Glutein|Nuget|Camilan|Maizena|Gluten free casein free|GFCF|Pencernaan|Cornflakes|Kyloggs|ABK|Anak berkebutuhan khusus|Sayur|Wortel|Alphabet|Abjad|Huruf|Bentuk|Jagung|Anak|Inovasi|Orang tua|Ibu|Slb|Inklusi|Yayadan|Yayasan|Sekolah|Dewasa|Tua|Sdlb|Smplb|Smalb|Goreng|Frozen|Food|Frozen food',1,1,'2019-03-12 01:29:45','2019-03-18 04:34:14'),(630,0,'ART JI TATAG ( Seni Jilbab Jumputan Ala Anak Tuna Grahita)','2019 16010044001 RISKA AGTIANI PUTRI.pdf',NULL,8390000,'<p class=\"MsoNoSpacing\" style=\"margin-left: 35.45pt; text-align: justify; text-indent: -14.15pt; line-height: 115%; tab-stops: 14.2pt;\"><span style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; letter-spacing: -.05pt;\">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;Seiring dengan perkembangan zaman peluang pekerjaan semakin sedikit sehingga menuntut para calon sarjana untuk berpikir kreatif dengan mampu berwirausaha. Terutama sebagai calon pendidik anak luar biasa harus memiliki kreativitas tinggi untuk menciptakan kreasi yang bisa diterima masyarakat, sehingga dapat mencipatakan peluang usaha. </span></p>\n<p class=\"MsoNoSpacing\" style=\"margin-left: 35.45pt; text-align: justify; text-indent: -14.15pt; line-height: 115%; tab-stops: 14.2pt;\"><span style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; letter-spacing: -.05pt;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Jilbab merupakan salah satu atribut yang diminati oleh kalangan muslimah baik anak-anak hingga kalangan orang tua. Dalam memakai jilbab muslimah akan memperhitungkan bahan, motif dan warna yang nyaman dan cocok apabila dikenakan. Melalui usahaa tersebut Universitas mulai menggerakkan mahasiswa untuk berwirausaha, salah satunya Unesa yang membuat PMW (Progam Mahasiswa Wirauusaha). Melalui PMW ini kami&nbsp; dari jurusan Pendidikan Luar Biasa 2016 berkomitmen untuk memulai usaha . Usaha yang akan kami ajukan yaitu ART JI TATAG ( Seni Jilbab Jumputan Ala Anak Tuna Grahita).</span></p>\n<p class=\"MsoNoSpacing\" style=\"margin-left: 35.45pt; text-align: justify; text-indent: -14.15pt; line-height: 115%; tab-stops: 14.2pt;\"><span style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; letter-spacing: -.05pt;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Jilbab Jumputan adalah jilbab yang memiliki motif jumputan yang teratur dengan seni mencelupkan jumputan kain kedalam pewarna tekstil. Jilbab ini berbeda dengan jilbab yang lain karena proses pembuatan, motif , dan warna yang menggunakan alat dan bahan tradisional sehingga tidak berbahaya jika dilakukan anak tuna grahita. Kelompok kami pernah membuat batik jumputan namun masih terhalang oleh dana dan SDM. Maka karena itu kami mengembangkan kreativitas dalam membuat batik menjadi hal yang lebih sederhana dan nantinya dapat diterima oleh masyarakat, oleh karena itu kami mengusulkan untuk membuat jilbab jumputan&nbsp; dengan adanya PMW ini kami mengusulkan membuat kreativitas jilbab jumputan dengan bantuan anak tuna grahita juga untuk melatih vokasi anak tuna grahita agar mereka memiliki ketrampilan.</span></p>\n<p class=\"MsoNoSpacing\" style=\"margin-left: 35.45pt; text-align: justify; text-indent: -14.15pt; line-height: 115%; tab-stops: 14.2pt;\"><span style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; letter-spacing: -.05pt;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Besar harapan kami pihak Universitas dapat meloloskan kami di Progam Mahasiswa Wirausaha. Pendanaan yang diberikan dapat mengembangkan usaha ART JI TATAG ( Seni Jilbab Jumputan Ala Anak Tuna Grahita). Apabila usaha telah berkembang diharapkan mampu membuka peluang usaha bagi masyarakat terutama anak tuna grahita untuk meningkatkan ketrampilan sehhinnga nantinya menjadi progam vokasional bagi anak tuna grahita.&nbsp;</span></p>','ART JI TATAG|JILBAB|ATG',4,1,'2019-03-12 01:39:01','2019-03-15 01:05:36'),(631,0,'JAREBOW JAGUNG REBUS RAINBOW','2019 17040254086 Firda Nur Laili.pdf',NULL,10000000,'<p class=\"MsoNormal\" style=\"line-height: 115%; tab-stops: 1.0cm; mso-layout-grid-align: none; text-autospace: none;\"><span class=\"MsoCommentReference\"><span style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; mso-ansi-language: IN; mso-bidi-font-weight: bold;\">&nbsp;</span></span></p>\n<p class=\"MsoNormal\"><strong><span style=\"font-size: 12.0pt; line-height: 150%; font-family: \'Times New Roman\',\'serif\'; color: #222222; background: white; mso-ansi-language: IN;\"><span style=\"mso-tab-count: 1;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span></strong><span lang=\"EN-US\" style=\"font-size: 12.0pt; line-height: 150%; font-family: \'Times New Roman\',\'serif\'; background: white; mso-bidi-font-weight: bold;\">Jagung</span><span lang=\"EN-US\" style=\"font-size: 12.0pt; line-height: 150%; font-family: \'Times New Roman\',\'serif\'; background: white;\">&nbsp;(<em>Zealmays</em>&nbsp;ssp.&nbsp;<em>mays</em>)adalah</span><span style=\"font-size: 12.0pt; line-height: 150%; font-family: \'Times New Roman\',\'serif\'; background: white; mso-ansi-language: IN;\"><span style=\"mso-spacerun: yes;\">&nbsp; </span></span><span lang=\"EN-US\" style=\"font-size: 12.0pt; line-height: 150%; font-family: \'Times New Roman\',\'serif\'; background: white;\">&nbsp;</span><span lang=\"EN-US\" style=\"font-size: 12.0pt; line-height: 150%; font-family: \'Times New Roman\',\'serif\';\"><a title=\"Tanaman pangan\" href=\"https://id.wikipedia.org/wiki/Tanaman_pangan\"><span style=\"color: windowtext; background: white; text-decoration: none; text-underline: none;\">tanaman</span> <span style=\"color: windowtext; background: white; text-decoration: none; text-underline: none;\">pangan</span></a><span style=\"background: white;\">&nbsp;penghasil&nbsp;</span><a title=\"Karbohidrat\" href=\"https://id.wikipedia.org/wiki/Karbohidrat\"><span style=\"color: windowtext; background: white; text-decoration: none; text-underline: none;\">karbohidrat</span></a><span style=\"background: white;\">&nbsp;</span></span><span style=\"font-size: 12.0pt; line-height: 150%; font-family: \'Times New Roman\',\'serif\'; background: white; mso-ansi-language: IN;\">yang mudah untuk dicari dan ditemukan dimana-mana. Materi untuk membuat jajan jagung rainbow antara lain adalah, jagung, susu keju pewarna makanan dan mentega yang dapat diolah menjadi jajan enak mengenyangkan perut. Dalam menjalani sebuah bisnis, ada beberapa hal yang perlu kita perhatikan dan diketahui secara seksama bahwasannya saat kita memulai sebuah rintisan usaha maka peluang pasar dan cara mengikat pelanggan atau penjual merupakan sebuah hal yang terpenting. Jadi hal pertama yang di lakukan dalam<span style=\"mso-spacerun: yes;\">&nbsp; </span>bisnis adalah mengetahui bagaimana peluang pasar dan bagaimana pula cara memeperoleh oerder tersebut. Kegiatan ini bertujuan untuk membuat inovasi baru sehingga dapat memudahkan masyarakat untuk berwirausaha.</span></p>\n<p class=\"MsoNormal\"><span lang=\"EN-US\">&nbsp;</span></p>','Jagung |Manfaat jagung |Tujuan pembuatan',1,1,'2019-03-12 02:09:14','2019-03-14 17:00:23'),(632,0,'BUDE AYU (Bunga Dekorasi Anti Layu)','2019 17010664009 Aynun Ilmi.pdf',NULL,4000000,'<p class=\"MsoNormal\" style=\"margin-bottom: .0001pt; text-align: justify; text-indent: 1.0cm;\"><span lang=\"IN\" style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; mso-ansi-language: IN;\">Bude Ayu, atau singkatan dari Bunga Dekorasi Anti Layu. Bude Ayu</span><span style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\';\">&nbsp;digunakan untuk dekorasi dan dapat mempercantik dinding ruangan. Keunikan dari dekorasi bunga yang kami buat adalah tidak akan layu karena berbahan dasar kertas.&nbsp;</span><span style=\"font-family: \'Times New Roman\', serif; font-size: 12pt; text-indent: 1cm;\">Bahan dasar kertas yang kami gunakan bukanlah kertas biasa, kami menggunakan kertas jasmine. Kertas jasmine memiliki kualitas yang sangat bagus, tebal, memiliki warna-warna yang cantik dan terdapat efek glitter pada kertas. Pada proses pembuatannya, Bude Ayu dibuat secara handmade.&nbsp;</span><span style=\"font-family: \'Times New Roman\', serif; font-size: 12pt; text-indent: 1cm;\">Bude Ayu dapat digunakan sebagai hiasan dinding dalam berbagai acara. Karenanya, warna dan desain dari Bude Ayu dapat disesuaikan dengan keinginan dari konsumen. Selain itu, kami juga menyediakan pemesanan bunting flag,</span><span style=\"font-family: \'Times New Roman\', serif; font-size: 12pt; text-indent: 1cm;\">&nbsp; </span><span style=\"font-family: \'Times New Roman\', serif; font-size: 12pt; text-indent: 1cm;\">untuk menambah meriah dekorasi yang digunakan untuk event atau pesta.&nbsp;</span><span style=\"font-family: \'Times New Roman\', serif; font-size: 12pt; text-indent: 1cm;\">Kami membuat Bude Ayu ini dengan menawarkan 3E, yakni Efektif, Ekonomis dan Efisien. Bude Ayu efektif karena tahan lama dan tidak membutuhkan perawatan khusus, selain dapat digunakan untuk mempercantik dinding ruangan juga dapat sebagai dekorasi pesta. Harga yang terjangkau memberikan nilai ekonomis pada Bude Ayu. Dengan segala kelebihan dan harga yang ekonomis yang dimiliki, maka Bude Ayu menjadi pilihan yang efisien dibandingkan dengan dekorasi bunga yang lain.&nbsp;</span><span style=\"font-family: \'Times New Roman\', serif; font-size: 12pt; text-indent: 1cm;\">Proses distribusi Bude Ayu selain jalur offline juga jalur online. Hal ini kami pilih karena target kami menjual Bude Ayu bukan hanya untuk orang disekitar tapi juga konsumen-konsumen di luar kota atau di luar pulau. Dengan demikian, menggunakan metode online akan memudahkan proses ditribusi dan ekspedisi ke luar kota atau ke luar pulau. Kami juga adalah produsen utama, jadi Bude Ayu benar-benar original hasil produksi kami. Sehingga dapat dijamin kualitas dan mutu dari Bude Ayu.</span></p>','Bunga|Dekorasi|Paperflower|Anti layu|kreatif|Bunga kertas|kertas jasmine',4,1,'2019-03-12 02:12:03','2019-03-14 19:00:23'),(633,0,'SWEET CUPCAKE','2019 17020104036 LULY KURNIAWATI.pdf',NULL,1000000,'<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;Sweet cupcake adalah kue cup yang sangat dinikmati anak-anak, remaja, dan terutama kaum perempuan. Cupcake yang kami suguhkan memiliki varian rasa seperti oreo, coklat, dan keju. Selain ketiga varian rasa tersebut juga akan dikembangkan varian rasa unik seperti buah-buahan. Cupcake yang kami tawarkan memiliki harga terjangkau yaitu Rp 6000 rupiah per cupnya. selain untuk cemilan, cupcake juga dapat digunakan sebagai kado untuk orang tersayang, seperti pada acara aniversary, ulang tahun, dan acara-acara lainnya. Produk Sweet Cupcake ini nantinya akan dipasarkan melalui penitipan di toko-toko sekitar Unesa dan melalui pemesanan online.&nbsp;&nbsp;</p>','sweet cupcake|sweet|cupcake|manis|makanan manis|kue|cemilan|jajanan manis',1,1,'2019-03-12 02:26:23','2019-03-15 00:04:45'),(634,0,'Ice Cream Sabu-Sabu (Es krim Sayur dan Buah)','2019 17020084080 WULIDA WAHIDATUL MASRURIA.pdf',NULL,13292000,'<p class=\"MsoNormal\" style=\"margin-bottom: 0.0001pt; text-align: justify; text-indent: 0.5in; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',serif; mso-fareast-font-family: \'Times New Roman\'; color: #222222;\">Es krim adalah makanan beku yang menjadi makanan penutup, popular dengan nama&nbsp;<em>dessert. </em></span><span style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',serif; mso-fareast-font-family: Ebrima; color: #212121;\">Menurut sebuah penelitian Es krim memiliki beberapa manfaat diantaranya mengurangi rasa tertekan atau stress, kaya akan kalsium, meningkatkan kekebalan tubuh, dan kaya akan vitamin sehingga sangat bagus untuk kesehatan. Selain itu, Ice Cream Sabu-Sabu ini terbuat dari bahan dasar sayur dan buah seperti tomat, wortel, brokoli, bayam, buah naga, manga, nangka dan lain sebagainya. Seperti yang kita ketahui bahwa saat ini banyak orang yang terserang penyakit degeneratif seperti jantung, hipertensi, dan kanker dipengaruhi oleh adanya radikal bebas. Sedangkan senyawa yang dapat menetralkan radikal bebas adalah antioksidan. Pembuatan es krim dengan bahan dasar tomat dan buah naga merah bertujuan untuk meningkatkan konsumsi antioksidan yang berasal dari buah. Pemilihan tomat dan buah naga merah sebagai bahan baku dikarenakan tomat mimiliki antioksidan likopen yang stabil pada suhu pemanasan, sedangkan buah naga merah memiliki antioksidan flavonoid. Selain itu, saat ini banyak orang yang tidak suka untuk mengkonsumsi makanan-makanan sehat seperti sayur dan buah. Maka dari</span><span style=\"font-size: 12pt; line-height: 115%; font-family: \'Times New Roman\', serif;\"> itu, kami terinspirasi untuk mengemas sayur dan buah-buahan menjadi makanan yang disukai oleh berbagai kalangan. Dengan adanya es krim sayur dan buah-buahan ini orang-orang akan menjadi sadar bahwasanya sayur dan buah-buahan dapat dikemas menjadi dissert yang sangat lezat dalam bentuk es krim sebagai alternative makanan sehat.</span></p>','Ice Cream Sayur dan Buah|Sayur|Buah |Ice cream|ice cream',1,1,'2019-03-12 02:44:13','2019-03-15 00:38:41'),(635,0,'Gonna Get (Dragon Banana) with Glaze Javanese','2019 17020114087 Khusnul Khotimah Fitriasari.pdf',NULL,14978000,'<p>&nbsp;</p>\n<p>&nbsp;</p>\n<p>Buah naga dan pisang saat ini menjadi salah satu makanan favorit bagi semua kalangan masyarakat, mulai dari anak-anak hingga orang dewasa.&nbsp; Saat ini buah naga dan pisang dapat dijadikan peluang bisnis yang cukup menjanjikan bagi&nbsp; kalangan masyarakat. Akan tetapi buah naga dan pisang original dengan berbagai varian rasa terkadang juga cukup membosankan. Saat ini dibutuhkan inovasi baru tentang buah naga dan pisang untuk merambah ke dunia industri agar lebih disukai oleh masyarakat. Untuk merintis inovasi baru ini, kami memulainya dengan inovasi nugget buah naga dan pisang dengan Jawa. Kemudian selanjutnya kami memberikan nama Gonna Get (Dragon Banana Nugget) with Glaze Javanese. Dimana nugget ini akan disajikan dengan varian rasa yang berbeda dan topping. Varian rasa yang akan disajikan yaitu buah naga dan pisang dengan topping mises, oreo, dan keju serta varian glaze. Dengan adanya inovasi baru diharapkan masyarakat dapat lebih menyukai buah naga dan pisang dan tidak akan membosankan. Akan tetapi, dengan adanya inovasi baru juga diharapkan tidak akan mengurangi kenikmatan rasa dan nilai gizi.&nbsp;&nbsp;</p>\n<p>Kata kunci: nugget, buah, naga, pisang, bisnis, inovasi, glaze, javanese.</p>','Gonna Get Javanese',1,1,'2019-03-12 03:11:14','2019-03-20 04:32:58'),(636,0,'The Tales','2019 17020104056 Safira Vicky Grey Fenda.pdf',NULL,7000000,'<p>The Tales adalah usaha yang menjual totebag dengan desain yang bertemakan monogatari atau dongeng yang berasal dari Jepang. Dalam perkembangan berikutnya, The Tales tidak hanya mengangkat dongeng dari negara Jepang saja melainkan dari negara yang lain.</p>\r\n<p>Pada sisi depan totebag ini akan ditampilkan gambar karakter sebuah dongeng beserta judul dongeng tersebut dalam Bahasa Jepang. Selain itu akan ada hangtag yang berisi kisah singkat dari karakter yang ditampilkan. Pada hangtag tersebut akan disertakan pula alamat blog yang menyediakan kisah lengkap mengenai karakter yang terdapat pada totebag tersebut.&nbsp;</p>\r\n<p>Totebag ini berbeda dari totebag pada umumnya karena dapat mengedukasi masyarakat mengenai budaya dan bahasa asing yaitu Bahasa Jepang. Dengan adanya blog yang berisi dongeng terkait karakter pada totebag juga diharapkan akan menambah minat baca masyarakat.</p>\r\n<p>Dari segi edukasi budaya dan bahasa, The Tales adalah yang pertama dan satu-satunya produk totebag yang memberikan edukasi. Diharapkan dengan keunikan dan orisinalitasnya, The Tales dapat diminati oleh masyarakat luas.</p>','Totebag|Bahasa Asing|Budaya asing|Dongeng',4,1,'2019-03-12 03:12:14','2019-03-20 03:21:49'),(637,0,'NAMETAKEY FLANEL (Name Tag Key Chain Flanel)','2019 17020124019 NURUL AZIZAH DWIRIANTI.pdf',NULL,7750000,'<p>&nbsp;</p>\n<p class=\"MsoNoSpacing\" style=\"text-align: justify; line-height: 150%; tab-stops: 14.2pt;\"><span style=\"font-size: 12.0pt; line-height: 150%; font-family: \'Times New Roman\',\'serif\'; letter-spacing: -.05pt; mso-ansi-language: IN;\">Produk hiasan yang dibuat dengan tangan (handmade) berupa <em>name tag</em> dan gantungan kunci berbahan utama kain flanel. Mengedepankan nilai estetis, beda dari yang lain, dan dapat menerima pesanan sesuai keinginan konsumen. Bermanfaat untuk memberikan kesan personal konsumen sebagai identitas kamar (<em>name tag</em>) dan penanda kunci (<em>key chain</em>). Nametakey Flanel merupakan produk yang diminati namun masih sedikit pengrajinnya, dan prospek usaha dimasa yang akan datang dapat dipertahankan serta dikembangkan dalam hal kreatifitas dan inovasi produk.</span></p>\n<p>&nbsp;</p>\n<p class=\"MsoNoSpacing\" style=\"text-align: justify; line-height: 150%; tab-stops: 14.2pt;\">&nbsp;</p>\n<p class=\"MsoNoSpacing\" style=\"text-align: justify; line-height: 150%; tab-stops: 14.2pt;\"><span style=\"font-size: 12.0pt; line-height: 150%; font-family: \'Times New Roman\',\'serif\'; letter-spacing: -.05pt; mso-ansi-language: IN;\">Dengan uang Rp 7.750.000 kami dapat menghasilkan 720 buah <em>key chain</em> dan 500 buah <em>name tag</em>. Dalam kurun waktu satu bulan (satu kali produksi) kami menargetkan 120 <em>key chain</em> dan 84 <em>name tag</em> terjual. Kami menargetkan dalam waktu empat kali produksi kami bisa mengembalikan modal awal, dengan jumlah produk 360 <em>key chain</em> dan 252 <em>name tag</em>. </span></p>\n<p>&nbsp;</p>','gantungan kunci|souvenir|hiasan|flanel',4,1,'2019-03-12 03:23:26','2019-03-15 22:07:18'),(638,0,'Pak Project Jasa Foto dan Dekorasi','2019 16080574085 Fithrotul Aulia.pdf',NULL,12495000,'<p><span style=\"line-height: 18.2px;\">Pak Project merupakan jasa yang bergerak dibidang foto dan dekorasi, di era digital dan kemudahan sosial media saat ini hampir seluruh kegiatan manusia menjadi konsumsi publik. Berdasarkan pengalaman dalam mengelola sebuah kegiatan yang diadakan oleh organisasi kemahasiswaan UNESA, kami melakukan evaluasi bahwa kegiatan yang diadakan kurang menarik karena kurangnya sentuhan dekorasi yang mendukung dan menambah nilai kegiatan. selain kegiatan kemahasiswaan saat ini banyak kegiatan yang membutuhkan tambahan dekoarsi yang simple, menarik namun tetap elegan yang dapat mendukung berlangsungnya kegiatan yang dilaksanakan. seperti contohnya Birthday Party, Engangement hingga Wedding. oleh karena itu penulis mengusulkan sebuah usaha yang bergerak dibidang Jasa Foto dan Dekorasi yang diberi nama \"Pak Project\"</span></p>','Pak Project|Dekorasi|Fotografi|Photobooth|Jas Foto|Jasa Dekorasi|Birthday Party|Engangement',2,1,'2019-03-12 03:32:31','2019-03-20 02:29:26'),(639,0,'GAYAM SPICY FLAVOR','2019 17040254082 Annisa Sahabsari.pdf',NULL,13000000,'<p>Gayam adalah sejenis suku polong-polongan atau dalam bahasa inggris dikenal dengan istilah chestnut. Gayam juga mempunyai kandungan vitamin C dan antioksidan yang baik untuk tubuh. Bisnis ini didasari oleh kesukaan kami terhadap kuliner pedas, yang memang disukai oleh kalangan muda mudi ataupun mahasiswa akhi-akhir ini . Saya pun memilih gayam karena rasa yang disukai oleh khalayak banyak terutama anak muda dan bahan baku yang mudah dicari dan efisien atau tidak memerlukan mengeluarkan budget yang besar. Rasa pedas menjadi pilihan saya untuk digabungkan dengan gayam karena&nbsp; rasa pedas yang menjadi penambah selera makan serta merupakan favorit pasar. Selain itu ada juga varian campuran rasa lainnya yaitu seperti keju, barbaque, dan sapi panggang dengan bumbu pedas rempah tradisional. Dari segi nama, saya pun membuat nama yang sedikit unik seperti yang dijelaskan sebelumnya agar masyarakat dapat mengingat kami karena sejatinya nama merupakan identitas tersendiri pada setiap usaha tentunya. Saya memilih nama &ldquo;Gayam Spicy Flavor&rdquo; yang artinya Gayam adalah bahan baku utama, sedangkan Spicy Flavor adalah rasa pedas.</p>','Gayam|Makanan ringan|Pedas|Banyak rasa|Vitamin C|Anti oksidan',1,1,'2019-03-12 03:35:17','2019-03-15 00:29:08'),(640,0,'ONIKU (Onigiri Kusuka) Paduan Cita Rasa Indonesia','2019 17080304061 Nur Aisyah Pratiwi.pdf',NULL,6795000,'<p class=\"MsoNormal\" style=\"margin-bottom: .0001pt; text-align: justify; text-indent: 28.35pt;\"><span style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',serif; mso-ascii-theme-font: major-bidi; mso-hansi-theme-font: major-bidi; mso-bidi-theme-font: major-bidi;\">Manusia melakukan banyak aktivitas demi memenuhi kebutuhan hidup yang terkadang membuat manusia melupakan makan dan mengesampingkan rasa laparnya. Padahal keadaan perut yang tidak terisi dapat membuat kondisi tubuh menjadi lemas. Pada umumnya, setiap orang mengkonsumsi makanan ringan atau snack maupun roti dan sejenisnya untuk mengganjal perut. Mengkonsumsi makanan mengandung bahan pengawet sesering dan sebanyak apapun tidak akan mampu memenuhi kebutuhan nutrisi dalam tubuh, justru mengandung kalori berlebih dan bahaya untuk kesehatan (Rohma Ana, 2015). Makanan yang paling baik untuk penghilang lapar adalah nasi, karena mengandung karbohidrat yang memberikan energi secara optimal. Namun, setiap orang dengan kesibukan tinggi malas untuk mengkonsumsi nasi karena memerlukan waktu lama dan tidak dapat dilakukan sambil beraktivitas. Oleh karenanya, dibutuhkan makanan kaya karbohidrat dan bergizi yang dapat dikonsumsi secara praktis. Salah satunya adalah menyajikan nasi dalam bentuk onigiri.</span></p>\n<p class=\"MsoNormal\" style=\"margin-bottom: .0001pt; text-align: justify; text-indent: 28.35pt;\"><span style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',serif; mso-ascii-theme-font: major-bidi; mso-hansi-theme-font: major-bidi; mso-bidi-theme-font: major-bidi;\">Onigiri adalah nasi kepal khas Jepang. Di Indonesia, makanan jepang sangat mudah untuk dijumpai karena digemari oleh orang Indonesia. Hal tersebut membuktikan usaha kuliner dengan konsep Jepang memiliki prospek yang baik. Oleh karena itu, kami menciptakan Oniku (Onigiri Kusuka) Paduan Cita Rasa Indonesia. Oniku adalah inovasi onigiri yang disajikan berupa nasi gurih dan varian isi masakan ayam khas Indonesia. Tidak hanya membangun sebuah usaha, tetapi memiliki nilai dan tujuan untuk melestarikan dan mengangkat masakan khas Indonesia dengan konsep masakan luar yang saat ini digemari masyarakat Indonesia.</span></p>\n<p class=\"MsoNormal\" style=\"margin-bottom: .0001pt; text-align: justify; text-indent: 28.35pt;\"><span style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',serif; mso-ascii-theme-font: major-bidi; mso-hansi-theme-font: major-bidi; mso-bidi-theme-font: major-bidi;\">Penjualan produk Oniku dilakukan dalam sebulan (20 hari aktif) dengan produksi 40 buah perhari. Pengenalan produk dengan memberikan potongan harga 50% perbuah untuk pembeli 10 produk pertama. Hal tersebut dilakukan sebagai uji pasar untuk perbaikan produk usaha selanjutnya. Penjualan dilakukan di area kampus dan sekitar Surabaya dengan harga Rp 7.500 perbuah. Kemudian melakukan konsinyasi dengan beberapa outlet penjualan yaitu Foodcourt Unesa dan Kantin Srikandi FE, dengan harga jual kepada distributor yaitu Rp 7.000 perbuah. Target pasar usaha ini adalah mahasiswa dan semua kalangan masyarakat. Promosi digencarkan melalui offline dan online. Berdasarkan analisi</span><span lang=\"IN\" style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',serif; mso-ascii-theme-font: major-bidi; mso-hansi-theme-font: major-bidi; mso-bidi-theme-font: major-bidi; mso-ansi-language: IN;\">s</span><span style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',serif; mso-ascii-theme-font: major-bidi; mso-hansi-theme-font: major-bidi; mso-bidi-theme-font: major-bidi;\"> kelayakan usaha, modal usaha </span><span lang=\"IN\" style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',serif; mso-ascii-theme-font: major-bidi; mso-hansi-theme-font: major-bidi; mso-bidi-theme-font: major-bidi; mso-ansi-language: IN;\">O</span><span style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',serif; mso-ascii-theme-font: major-bidi; mso-hansi-theme-font: major-bidi; mso-bidi-theme-font: major-bidi;\">niku akan kembali selama 1 bulan 14 hari, lebih cepat dari rencana investasi. Sehingga kegiatan usaha layak dijalankan.</span></p>','Nasi|Onigiri|Rasa Masakan Indonesia',1,1,'2019-03-12 03:38:20','2019-03-18 18:37:30'),(641,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,1,'2019-03-12 03:43:23','2019-03-12 03:43:57'),(642,0,'Bucket Custom Dari Kain','2019 17081194023 ARIS DANU ARTA.pdf',NULL,5000000,'<p class=\"MsoNoSpacing\" style=\"text-align: justify; text-justify: inter-ideograph; text-indent: 36.0pt;\"><span style=\"font-size: 12.0pt; font-family: \'Times New Roman\',serif; mso-ansi-language: IN;\">Produk ini merupakan usaha kreatif berupa bucket custom dari kain, dimana memiliki keunikan dari segi bentuk atau desain serta pewarnaan yang menarik karena tentunya berbeda dari produk sejenis pada umumnya. Bucket custom ini bermanfaat sebagai pengganti bucket bunga agar memberi kesan tersendiri </span><span lang=\"EN-US\" style=\"font-size: 12.0pt; font-family: \'Times New Roman\',serif;\"><span style=\"mso-spacerun: yes;\">&nbsp;</span>bagi konsumen </span><span style=\"font-size: 12.0pt; font-family: \'Times New Roman\',serif; mso-ansi-language: IN;\">ketika </span><span lang=\"EN-US\" style=\"font-size: 12.0pt; font-family: \'Times New Roman\',serif;\">menggunakannya untuk acara</span><span style=\"font-size: 12.0pt; font-family: \'Times New Roman\',serif; mso-ansi-language: IN;\"> wisuda,</span> <span style=\"font-size: 12.0pt; font-family: \'Times New Roman\',serif; mso-ansi-language: IN;\">perayaan ulang tahun</span><span lang=\"EN-US\" style=\"font-size: 12.0pt; font-family: \'Times New Roman\',serif;\">, pernikahan</span><span style=\"font-size: 12.0pt; font-family: \'Times New Roman\',serif; mso-ansi-language: IN;\"> maupun perayaan lainnya.</span></p>\n<p class=\"MsoNoSpacing\" style=\"text-align: justify; text-justify: inter-ideograph; text-indent: 36.0pt;\"><span style=\"font-size: 12.0pt; font-family: \'Times New Roman\',serif; mso-ansi-language: IN;\">Untuk prospek kedepannya,kami akan memproduksi dengan skala yang lebih besar disertai dengan pengembangan inovasi yang lebih baik lagi agar produk kami semakin dikenal luas di masyarakat sebagai upaya memperluas jaringan pemasaran.</span></p>','bucket|usaha|kreatif|acara|prospek|inovasi|pemasaran|konsumen',4,1,'2019-03-12 03:47:18','2019-03-19 06:01:08'),(643,0,'BOMISOS (Bola Mie Sosis)','2019 17010024006 Alda Putri Martina.pdf',NULL,6913000,'<p>BOMISOS (Bola Mie Sosis) ini makanan yang berbahan dasar tahu karena banyak orang yang tidak paham akan gizi dari tahu sendiri maka saya membuat makanan ini, supaya bisa dinikmati banyak kalangan terutama anak - anak sampai kalanagn remaja yang jarang suka makanan rumahan, dengan begini anak - anak dan kalanagn remaja lebih bisa makan - makanan sehat tanpa membeli makanan cepat saji. dengan harga RP.2500 per biji dsudah bisa pesan antar khusus di daerah surabaya tentunya.&nbsp;</p>','tahu|mie|sosis|makanan sehat',1,1,'2019-03-12 03:54:30','2019-03-14 14:13:29'),(644,0,'M&H Art Memorable and Happiness Art','2019 17050524010 Sinta Putri Anisa.pdf',NULL,7790000,'<p><strong>M&amp;H&nbsp;<em>Art \"Memorable and Happiness Art\"&nbsp;</em></strong>merupakan produk barang berupa bingkai foto yang dapat diisi dengan berbagai macam desain, seperti lettering, foto yang dibuat timbul, dan gambar-gambar. Dengan <strong>M&amp;H&nbsp;<em>Art&nbsp;</em></strong>&nbsp; kita dapat menyimpan memori kenangan dengan cara yang lebih artistik. Produk ini dapat digunakan sebagai hadiah atau cindera mata untuk orang yang sedang berulang tahun, menikah, wisuda, dan lain sebagainya. Pelanggan dapat memilih desain <strong>M&amp;H&nbsp;<em>Art&nbsp;</em></strong>&nbsp;yang telah kami sediakan, namun mereka juga dapat memesan <strong>M&amp;H&nbsp;<em>Art&nbsp;</em></strong>&nbsp; dengan desain mereka sendiri yang mereka inginkan.&nbsp;</p>','Art|Foto|Bingkai |Desain|Hadiah|Wisuda',4,1,'2019-03-12 04:06:23','2019-03-20 01:19:03'),(645,0,'Kata Pena (Kayu Tua Penuh Makna)','2019 17020084020 Luh Putri Maharani.pdf',NULL,11500000,'<p>Kata Pena adalah sejenis kerajinan yang terbuat dari papan kayu yang dicat berukuran kurang lebih 10x30 cm dengan tulisan custom disetiap bidang papan. Dalam satu kata pena bisa terdapat banyak papan yang dirangkai secara horizontal.</p>','Kata Pena|Kayu|Hiasan dinding|Lettering art',4,1,'2019-03-12 04:08:04','2019-03-15 02:51:43'),(646,0,'NIKUNG BERGIZI (Brownies Kangkung Bergizi)','2019 17010714068 Mohammad Agung Arif Wicaksono.pdf',NULL,8030000,'<p class=\"MsoNormal\" style=\"margin-bottom: .0001pt; text-align: justify; text-indent: .25in;\"><span lang=\"IN\" style=\"font-size: 12.0pt; mso-bidi-font-size: 10.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; letter-spacing: -.05pt; mso-ansi-language: IN;\">NIKUNG BERGIZI</span><span style=\"font-size: 12.0pt; mso-bidi-font-size: 10.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; letter-spacing: -.05pt;\"> (</span><span lang=\"IN\" style=\"font-size: 12.0pt; mso-bidi-font-size: 10.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; letter-spacing: -.05pt; mso-ansi-language: IN;\">Brownies</span><span style=\"font-size: 12.0pt; mso-bidi-font-size: 10.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; letter-spacing: -.05pt;\"> Kangkung Bergizi) ini merupakan inovasi usaha dalam bidang kuliner yang memadukan kreasi olahan brownies yang didalamnya terdapat kangkung yang pastinya akan membuat kita berfikir kangkung kok dijadikan brownies. Dalam hal ini kangkung merupakan sayuran hijau yang sangat digemari</span><span lang=\"IN\" style=\"font-size: 12.0pt; mso-bidi-font-size: 10.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; letter-spacing: -.05pt; mso-ansi-language: IN;\"> untuk dijadikan olahan masakan seperti cah kangkung, sayur asam kangkung dan<span style=\"mso-spacerun: yes;\">&nbsp; </span>lain-lain </span><span style=\"font-size: 12.0pt; mso-bidi-font-size: 10.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; letter-spacing: -.05pt;\"><span style=\"mso-spacerun: yes;\">&nbsp;</span>oleh masyarakat Indonesia seperti Surabaya, Gresik, Sidoarjo dan sekitarnya, dan tentunya sangat digemari oleh berbagai kalangan masyarakat dari anak kecil sampai orang dewasa.</span></p>\n<p class=\"MsoNormal\" style=\"margin-bottom: .0001pt; text-align: justify; text-indent: .25in;\"><span lang=\"IN\" style=\"font-size: 12.0pt; mso-bidi-font-size: 10.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; letter-spacing: -.05pt; mso-ansi-language: IN;\">NIKUNG BERGIZI</span><span style=\"font-size: 12.0pt; mso-bidi-font-size: 10.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; letter-spacing: -.05pt;\"> (</span><span lang=\"IN\" style=\"font-size: 12.0pt; mso-bidi-font-size: 10.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; letter-spacing: -.05pt; mso-ansi-language: IN;\">Brownies</span><span style=\"font-size: 12.0pt; mso-bidi-font-size: 10.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; letter-spacing: -.05pt;\"> Kangkung Bergizi) ini merupakan olahan brownies yang berbahan dasar kangkung yang memiliki banyak manfaat bagi kesehatan tubuh seperti serat, vitamin C, vitamin A</span><span lang=\"IN\" style=\"font-size: 12.0pt; mso-bidi-font-size: 10.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; letter-spacing: -.05pt; mso-ansi-language: IN;\"> serta betakaroten</span><span style=\"font-size: 12.0pt; mso-bidi-font-size: 10.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; letter-spacing: -.05pt;\">,</span><span lang=\"IN\" style=\"font-size: 12.0pt; mso-bidi-font-size: 10.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; letter-spacing: -.05pt; mso-ansi-language: IN;\"> vitamin B kompleks, omega 3,</span><span style=\"font-size: 12.0pt; mso-bidi-font-size: 10.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; letter-spacing: -.05pt;\"> protein, zat besi, dan kalsium. Dan juga mampu menjaga sistem kekebalan tubuh seseorang serta mampu membantu kinerja otak menjadi lebih baik</span><span lang=\"IN\" style=\"font-size: 12.0pt; mso-bidi-font-size: 10.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; letter-spacing: -.05pt; mso-ansi-language: IN;\"> dan dapat membantu mengurangi radikal bebas di tubuh (sebagai anti oksidan).</span></p>\n<p class=\"MsoNormal\" style=\"margin-bottom: .0001pt; text-align: justify; text-indent: .25in;\"><span lang=\"IN\" style=\"font-size: 12.0pt; mso-bidi-font-size: 10.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; letter-spacing: -.05pt; mso-ansi-language: IN;\">NIKUNG BERGIZI</span><span style=\"font-size: 12.0pt; mso-bidi-font-size: 10.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; letter-spacing: -.05pt;\"> (</span><span lang=\"IN\" style=\"font-size: 12.0pt; mso-bidi-font-size: 10.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; letter-spacing: -.05pt; mso-ansi-language: IN;\">Brownies</span><span style=\"font-size: 12.0pt; mso-bidi-font-size: 10.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; letter-spacing: -.05pt;\"> Kangkung Bergizi) merupakan jenis makanan inovasi baru dan belum memiliki daya saing, maka hal itu menjadi keunggulan tersendiri</span> <span style=\"font-size: 12.0pt; mso-bidi-font-size: 10.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; letter-spacing: -.05pt;\">untuk prospek usaha kedepan. Untuk prospek pemasaran produk </span><span lang=\"IN\" style=\"font-size: 12.0pt; mso-bidi-font-size: 10.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; letter-spacing: -.05pt; mso-ansi-language: IN;\">NIKUNG BERGIZI</span><span style=\"font-size: 12.0pt; mso-bidi-font-size: 10.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; letter-spacing: -.05pt;\"> (</span><span lang=\"IN\" style=\"font-size: 12.0pt; mso-bidi-font-size: 10.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; letter-spacing: -.05pt; mso-ansi-language: IN;\">Brownies</span><span style=\"font-size: 12.0pt; mso-bidi-font-size: 10.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; letter-spacing: -.05pt;\"> Kangkung Bergizi)</span> <span style=\"font-size: 12.0pt; mso-bidi-font-size: 10.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; letter-spacing: -.05pt;\">ini juga dapat disajikan sebagai kuliner atau <em style=\"mso-bidi-font-style: normal;\">Coffee Break</em> ditempat-tempat rapat serta dapat dipasarkan di area kampus dan pusat oleh-oleh.</span></p>','Brownies Kangkung|Makanan Bergizi|Inovasi Makanan',1,1,'2019-03-12 04:12:43','2019-03-14 05:13:03'),(647,0,'Netsix (Netflix Asix)','2019 17020084039 Mochammad Abidin Abror.pdf',NULL,9068000,'<p>Netflix</p>','Netflix',2,1,'2019-03-12 04:15:42','2019-03-15 00:12:09'),(648,0,'BaCiNes','2019 17010664036 Pega Astria Susanto.pdf',NULL,4457000,'<p>BaCiNes merupakan sebuah terobosan baru yang berbeda dari biasanya, Baso Aci yang biasanya menggunakan kuah dan cuanki namun kami menawarkan Baso Aci yang dilengkapi dengan mayones.&nbsp;Sehingga baso aci milik kami memiliki cita rasa yang berbeda dengan bakso Aci lainnya. Itulah keunikan yang kami tawarkan dan memiliki harga yang ramah kantong. Bakso Aci diharapkan dapat diterima di berbagai masyarakat dari kalangan remaja hingga dewasa.</p>','BaCinNes (Baso Aci Mayones)|Baso|Aci|Mayones',1,1,'2019-03-12 04:26:29','2019-03-14 23:29:37'),(649,0,'PEMBERDAYAAN DAN PELATIHAN MASYARAKAT DALAM PEMANFAATAN SERAT DAUN NANAS SEBAGAI KERAJINAN TANGAN DIDESA SUGIH WARAS KECAMATAN NGANCAR KABUPATEN KEDIRI','2019 17040254075 nico kusuma wijaya.pdf',NULL,12704000,'<p><span style=\"font-size: 14px;\">Kediri merupakan satu kota kecil di jawa timur yang mempunyai beragam kekayaan alam, salah satunya adalah pertanian nanas yang terletak di Kecamatan Ngancar. Permasalahan yang terjadi akhir akhir ini adalah kurangnya pemanfaatan limbah daun nanas. permasalahan lainnya adalah kurang berkembangnya sumber daya manusia di sekitar kecamatan ngancar terutama ibu ibu rumah tangga. oleh karena itu pkm ini dibuat untuk memberikan solusi terhadap permasalahan tersebut agar sumber daya manusia terperdaya dengan baik dan limbah daun nanas juga termanfaatkan dengan baik. pemanfaatan tersebut dapat berupa bentuk bentuk kerajinan dan bentuk lainnya</span></p>','serat daun nanas|kerajinan tangan|pemberdayaan masyarakat|ngancar kediri',2,1,'2019-03-12 04:37:46','2019-03-15 05:25:04'),(650,0,'Cilok Sayur Bergizi \"CIYUZ\"','2019 17010664080 Fazaiz Khoirotun Chisan.pdf',NULL,4800000,'<p><strong>Ciyuz</strong> adalah makanan cilok Yang tetap menggunakan bahan baku namun dengan inovasi terbaru yaitu&nbsp; dicampur dengan sayuran, dimana sayuran ini akan membuat orang yang tidak suka makan sayur bisa tetap menikmati sayur tapi dengan &nbsp;bentuk makanan yang berbeda. Dengan ciyuz ini semua kalangan bisa menikmati dari mulai anak kecil&nbsp; sampai dengan orang dewasa. Karena dalam dalam ciyuz ini mengandung banyak sekali manfaat yang dapat diambil dari sayuran yang digunakan jadi di sini sangat berbeda manfaatnya dibandingkan dengan cilok cilok yang sudah beredar pada umumnya.</p>','empat juta delapan ratus|4.800.000|CIYUZ|Cilok|Sayur|Bergizi',1,1,'2019-03-12 04:39:50','2019-03-15 06:31:15'),(651,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,1,'2019-03-12 04:40:12','2019-03-12 04:53:49'),(652,0,'KOLANG ( Kopi Gelang )','2019 17010024080 Hanif Catur Febrianto.pdf',NULL,3200000,'<p class=\"MsoNoSpacing\" style=\"text-align: justify; line-height: 150%; tab-stops: 14.2pt;\"><span lang=\"IN\" style=\"font-size: 12.0pt; line-height: 150%; font-family: \'Times New Roman\',\'serif\'; letter-spacing: -.05pt; mso-ansi-language: IN;\">Pengusaha kopi kecil yang tersebar di desa-desa di jawa timur contohnya, produksi kopi pasti memiliki limbah, bahkan limbah ini sangat banyak berserakan bahkan kopi sering dibuang begitu saja, dibakar atau digunakan untuk pakan ternak, namun dengan kami memikirkan usaha ini, kami ber asumsi bila usaha ini juga dapat membantu pengusaha kopi kecil di desa desa agar penghasilan mereka bisa bertambah, ini akan membuat para petani kopi bisa semakin bersemangat untuk terus menciptakan kopi yang luar biasa, mengingat produsen kopi paling baik di dunia salah satunya adalah di indonesia, panen terbesar di jawa timur adalah tembakau dan kopi.</span></p>','KOLANG ( Kopi Gelang )',4,1,'2019-03-12 05:27:46','2019-03-15 03:11:16'),(653,0,'Keripik Bonggolan (KRIBO) Varian rasa','2019 17020084066 Fani Nabila Titania.pdf',NULL,5301000,'<p class=\"MsoNoSpacing\" style=\"text-align: justify; text-justify: inter-ideograph; line-height: 150%; tab-stops: 14.2pt;\"><span style=\"font-size: 12.0pt; line-height: 150%; font-family: \'Times New Roman\',\'serif\'; letter-spacing: -.05pt; mso-ansi-language: EN-MY; mso-bidi-font-weight: bold;\">Keripik bonggolan atau KRIBO varian rasa adalah Usaha Mikro, Kecil dan Menengah (UMKM) rintisan yang bergerak dibidang produksi makanan ringan atau camilan. Sesuai dengan nama usaha kami. Bonggolan merupakan camilan khas dari Gersik, Jawa Timur yang sebagian terbuat dari tepung tapioka dan ikan. Rasa khas ikan inilah yang membuat bonggolan disukai dikalangan masyarakat gersik dan sekitarnya. Namun, seiring berkembangnya inovasi terhadap usaha makanan membuat bonggolan tidak lagi digemari. Masyarakat beralih kepada produk makanan yang mempunyai banyak varian rasa dan kemasan yang bagus. Itulah alasan yang membuat kami berinovasi untuk menciptakan produk KRIBO varian rasa dengan tujuan agar makanan khas dari daerah tetap eksis dikalangan masyarakat.</span></p>','KRIBO|keripik',1,1,'2019-03-12 05:37:29','2019-03-14 18:49:30'),(654,0,'Clebino ( Clever Binocular)','2019 17020084006 Nur Zikri Amalia.pdf',NULL,9000000,'<p>Clebino(clever binocular) atau teropong pintar adalah media pembelajaran yang berfungsi untuk membantu siswa sekolah dasar (SD) memperkaya pengetahuan kosakata bahasa inggris</p>','media pembelajara|clebino|media pembelajaran|teropong pintar',4,1,'2019-03-12 05:56:40','2019-03-15 04:26:09'),(655,0,'USUM SEHAT','2019 17010024056 sujianto.pdf',NULL,10584000,'<p class=\"MsoNormal\" style=\"margin-bottom: .0001pt; text-align: justify; text-justify: inter-ideograph; line-height: 115%; background: white;\"><span style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',serif; mso-fareast-font-family: \'Times New Roman\'; color: black; border: none windowtext 1.0pt; mso-border-alt: none windowtext 0cm; padding: 0cm;\">Pada saat ini minuman rasa-rasa dan penambah stamina sangat digemari dikalangan mahasiswa, padahal kita tahu bahwa minuman seperti itu kurang baik bagi kesehatan tubuh jika dikonsumsi setiap hari. oleh karena itu agar tidak berlarut-laraut dan menimbulkan hal yang tidak baik bagi kesehatan tubuh, kami ingin mengalihkan kegemaran mahasiswa tersebut berubah menjadi gemar minum susu. Susu menganduk banyak sekali maanfaat bagi kesehatan tubuh kita</span><span style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',serif; mso-fareast-font-family: \'Times New Roman\'; color: black;\">. </span></p>\n<p class=\"MsoNormal\" style=\"margin-bottom: .0001pt; text-align: justify; text-justify: inter-ideograph; line-height: 115%; mso-layout-grid-align: none; text-autospace: none;\"><span style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',serif; mso-bidi-theme-font: minor-bidi; color: black;\">Kami mengambil susu murni dari koperasi susu di pacet, kemudian kami masak dengan gula sehingga siap minum. Untuk penyajianya nanti jika ada yang pembembeli kami langsung masakan susu nya jadi akan terasa nikmat ketika diminum dengan keadaan hangat. Kami juga akan membuat dalam wadah kemasan plastik 250ml dalam keadaan dingin. Pembelian langsung bisa datang ke graha bakti pramuka unesa, kami juga membuka pesanan jadi nanti kami antarkan ke konsumen minimal pembelian 10 bungkus.</span></p>\n<p class=\"MsoNormal\" style=\"margin-bottom: .0001pt; text-align: justify; text-justify: inter-ideograph; line-height: 115%; background: white;\"><span style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',serif; mso-fareast-font-family: \'Times New Roman\'; color: black; border: none windowtext 1.0pt; mso-border-alt: none windowtext 0cm; padding: 0cm;\">Kami berharap usaha kami ini bisa menambah wawasan teman-teman mahasiswa dalam berwirausaha sehingga bisa hidup mandiri, selain itu juga jika usaha ini berkembang akan memberikan dampak yang baik dalam pen-sejahteraan masyarakat dengan membuka lapangan pekerjaan baru sebagai penjual susu murni. Cara pemasaran ini akan memanfaatkan promosi dari teman ke teman kemudian memanfaatkan kemajuan teknologi modern </span><span style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',serif; mso-fareast-font-family: \'Times New Roman\'; color: black;\">seperti <span style=\"border: none windowtext 1.0pt; mso-border-alt: none windowtext 0cm; padding: 0cm;\">Facebook, Whatsapp, Instagram, dll.</span></span></p>','USUM SEHAT, Pasti Sehat!!!|Susu Murni',1,1,'2019-03-12 06:29:05','2019-03-14 20:01:46'),(656,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,1,'2019-03-12 07:43:47','2019-03-13 23:07:58'),(657,0,'Dumbek Unicorn','2019 16010644092 Dwi Suci Rohmanah.pdf',NULL,10478500,'<p>Kue dumbek merupakan kue tradisional khas Tuban, Jawa Timur. Kue dumbek ini memiliki tekstur yang kenyal seperti kue dodol. kue dumbek ini terbuat dari tepung beras, gula merah, dan santan. jadi, kue dumbek ini tidak mengandung bahan kimia didalamnya. Di Surabaya ini, kue dumbek jarang sekali ditemukan dan bahkan jarang sekali dikenal oleh masyarakat. Maka dengan adanya fenomena ini kami memiliki inovasi yang belum pernah ada yaitu \"Dumbek Unicorn\". Makanan ini adalah perpaduan kue dumbek dengan alpukat serta rumput laut dan di beri beberapa toping buah-buahan yang di kemas dalam cup bening yang diberi label. Dengan melihat persaingan pasar produk ini belum pernah ada, sehingga produk kami ini layak untuk dipasarkan. kami mematok harga 7000 untuk setiap produk yang kami jual, yang sesuai dengan kantong masyarakat dan juga mahasiswa. produk ini kaya akan manfaat serta dapat digunakan sebagai alternatif pengganti sarapan dan aman dikonsumsi berbagai kalangan.</p>','inovasi kue dumbek|inovasi makanan tradisional|produk sehat pengganti sarapan',1,1,'2019-03-12 12:25:36','2019-03-14 00:42:25'),(658,0,'LAMPFRAME BY KLAPLIP','2019 16020124008 YUANDA DIEA CHOIRUM ANISSA.pdf',NULL,4185000,'<p class=\"MsoListParagraph\" style=\"margin-left: 1.0cm; text-indent: 21.3pt; line-height: 115%; tab-stops: 1.0cm; mso-layout-grid-align: none; text-autospace: none;\"><span style=\"font-size: 12pt;\"><strong><span style=\"line-height: 115%; font-family: \'Times New Roman\', serif;\">LAMPFRAME by KLAPLIP</span></strong></span></p>\n<p class=\"MsoListParagraph\" style=\"margin-left: 1.0cm; text-indent: 21.3pt; line-height: 115%; tab-stops: 1.0cm; mso-layout-grid-align: none; text-autospace: none;\"><span style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; mso-ansi-language: IN;\">Lampu bingkai atau <em>Lampframe</em> ini adalah lampu hias yang diterapkan pada sebuah bingkai atau pigura yang biasanya hanya sekedar untuk membingkai foto. Pada kaca <em>Lampframe</em> ini, kami mampu menuliskan nama, kata &ndash; kata bijak ataupun siluet wajah sesuai dengan pemesanan. Selain untuk mengembangkan ilmu seni rupa yang kami miliki, usaha ini kami buat karena banyaknya kebutuhan masyarakat khususnya para pemuda akan benda &ndash; benda unik dan berkesan dengan harga yang terjangkau. Maka dari itu kami membuat <em>Lampframe</em> ini yang bisa difungsikan sebagai kado ulang tahun, kado wisuda, kado pernikahan ataupun dekorasi ruangan dan caffee dll.</span></p>\n<p class=\"MsoListParagraph\" style=\"margin-left: 1.0cm; text-indent: 21.3pt; line-height: 115%; tab-stops: 1.0cm; mso-layout-grid-align: none; text-autospace: none;\">&nbsp;</p>\n<p class=\"MsoListParagraph\" style=\"margin-left: 1.0cm; text-indent: 21.3pt; line-height: 115%; tab-stops: 1.0cm; mso-layout-grid-align: none; text-autospace: none;\"><span style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; mso-ansi-language: IN;\">Harga <em>Lampframe</em> pada pasar cukup tinggi, maka dari itu kami membuat produk <em>Lampframe</em> dengan harga lebih terjangkau namun kualitas sama bahkan lebih. Pembuatan <em>Lampframe</em> ini cukup mudah dengan bahan &ndash; bahan yang juga mudah untuk didapat seperti pigura, lampu tumblr, pilox dan bahan lain sehingga pembuatannya pun tidak membutuhkan waktu yang lama.&nbsp;</span></p>\n<p class=\"MsoListParagraph\" style=\"margin-left: 1cm; text-indent: 21.3pt; line-height: 16.1px;\">&nbsp;</p>','PMW|LAMPFRAME|KLAPLIP',4,1,'2019-03-12 13:08:24','2019-03-15 01:13:26'),(659,0,'KEBAB KEBUL','2019 17010024046 CITRA PUTRI FEBRIANA.pdf',NULL,5052000,'KEBAB LUMER ISI DURIAN','KEBAB KEBUL|KEBAB DURIAN|KEBAB LUMER',1,1,'2019-03-12 13:55:23','2019-03-14 21:27:05'),(660,0,'STROL\'S (Stick Roll Potato Cheese)','2019 17020084075 Nine Dera Pratika.pdf',NULL,5000000,'<p>sekarang ini banyak masyarakat yang minat dalam usaha makana. hal tersebut dilatarbelakangi oleh meningkatnya daya konsumtif masyarakat sekarang ini. di zaman yang modern ini banyak masyaraka maupun kalangan anak muda yang mencari makana masa kini dengan harga yang cukup murah serta rasanya yang tidak kalah enak dengan makanan yang lainnya. oleh karena itu kami mengembangkan usaha makanan yang bernama Strol\'s (Stick Roll Potato Cheese). makanan ini berbahan dasar kentang. makana ini sangat cocok untuk mereka yang ingin diet. makanan ini juga dijual dngan harga yang cukup murah . ada dua jenis yaitu&nbsp;<em>Big Strol\'s and Mini Strol\'s.&nbsp;</em></p>','makanan strol\"s',1,1,'2019-03-12 14:25:43','2019-03-15 06:25:44'),(661,0,'Chiz\'reng Jatel','2019 17010664069 Jesica Nur Azizah.pdf',NULL,4520000,'<p>Produk yang kami tawarkan adalah chiz\'reng jatel yaitu cireng keju mozarella dengan varian jagung, ketela dan wortel. Produk ini berbeda dengan cireng lain yang biasanya hanya sebagai camilan gorengan berminyak biasa, tetapi produk chiz\'reng jatel ini dibuat dengan varian sayur yang menyehatkan. Produk ini kami tawarkan dengan higeinis, tanpa ada bahan pengawet dan dalam bentuk frozen food, sehingga konsumen bisa menikmati chiz\'reng dalam keadaan hangat.&nbsp;</p>\n<p>Produk ini kami tawarkan dengan harga yang&nbsp; cukup ekonomis yaitu dengan harga dengan harga 15.000/pack. Modal yang dibutuhkan untuk memulai usaha ini juga sangat minim yaitu dengan biaya 4.520.000 dengan keuntungan 2.910.00</p>','Cireng mozarella jagung ketela wortel|Cireng|Mozarella|Jagung|Ketela|Wortel|Bergizi',1,1,'2019-03-12 14:27:29','2019-03-14 23:31:47'),(662,0,'Takys (Tas Kayu Lukis)','2019 17080314027 VIGI ASTINA.pdf',NULL,5600000,'<p>&nbsp;Usaha Takys (Tas Kayu Lukis) merupakan salah satu usaha dibidang kerajinan, dimana Takys ini merupakan hasil kreasi tas yang berbahan dasar kayu. Untuk ketahanan dari Takys ini sendiri sudah dapat dijamin atas kualitas dan kelayakannya. Dalam persaingan usaha yang semakin ketat, kami yakin bahwa usaha ini bisa bertahan dan bahkan bisa berkembang pesat. an kami akan berusaha membuat inovasi dan kreativitas baru, seperti memperkenalkan design-design baru.</p>\n<p>Untuk kayunya sendiri, disini kami tidak menggunakan kayu yang hanya polosan saja pada bagian luarnya, namun kami akan buat ukiran. Kedepannya sendiri untuk ukirannya akan terus kami tingkatkan dan kami kembangkan sesuai dengan keinginan para customer.</p>','Takys (Tas Kayu Lukis)|Takys|Tas Kayu Lukis|Hasil Kerajinan Dari Kayu',4,1,'2019-03-12 14:40:25','2019-03-14 23:10:00'),(663,0,'SADEL RACING (Sari Kedelai Rasa Amazing) Sebagai Upaya Wirausaha Produk Minuman Kreatif,Inovatif dan Bergizi','2019 17050634061 Syaviera Aifia Fauziah.pdf',NULL,9843100,'<p class=\"MsoNoSpacing\" style=\"margin-left: -14.2pt; text-align: justify; line-height: 150%; tab-stops: 14.2pt;\"><span style=\"font-size: 12.0pt; line-height: 150%; font-family: \'Times New Roman\',\'serif\'; letter-spacing: -.05pt; mso-ansi-language: IN;\">Susu kedelai merupakan minuman yang bernilai gizi tinggi, terutama karena kandungan proteinnya. Selain itu susu kedelai mengandung lemak, karbohidrat, kalsium, fosfor, zat besi, provitamin A, vitamin B kompleks dan air (Koswara 2006b). Namun, perhatian masyarakat kita terhadap jenis minuman ini masih kurang. Susu kedelai harganya lebih murah daripada susu produk hewani. </span></p>\n<p class=\"MsoNoSpacing\" style=\"margin-left: -14.2pt; text-align: justify; line-height: 150%; tab-stops: 14.2pt;\"><span style=\"font-size: 12.0pt; line-height: 150%; font-family: \'Times New Roman\',\'serif\'; letter-spacing: -.05pt; mso-ansi-language: IN;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Pengemasan dengan menggunakan botol unik yang sedang trend saat ini dalam industri ini diharapkan dapat mengubah penampilan dan mempunyai daya tarik pembeli dibanding dengan pengemasan susu kedelai terdahulu. Melalui redesain kemasan dimungkinkan waktu yang dibutuhkan untuk mengemas lebih efisien. Dalam industri minuman, pengemasan merupakan tahap terakhir produksi</span></p>\n<p><span style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; mso-fareast-font-family: Calibri; letter-spacing: -.05pt; mso-ansi-language: IN; mso-fareast-language: EN-US; mso-bidi-language: AR-SA;\">sebelum didistribusikan.</span></p>','sari kedelai|susu sari kedelai|susu kedelai|produk minuman|minuman bergizi',1,1,'2019-03-12 14:47:43','2019-03-19 20:33:40'),(664,0,'Katering Organik \"Chill\'s Kitchen\"','2019 16010044032 Dessy Rizky Nuraini Herawati.pdf',NULL,15000000,'<p>Chill&rsquo;s Kitchen merupakan sebuah usaha katering makanan sehat yang bergizi dan terbuat dari bahan-bahan organik. Chills Kitchen berbeda dengan katering makanan pada umumnya karena kita sangat menjaga kualitas dan kehigenisan makanan kami. Di era milenial sekarang ini banyak kawula muda ingin memiliki gaya hidup sehat tetapi susah untuk menjaga pola hidup sehat karena banyaknya aktivitas. Saat ini jarang sekali makanan yang mengedepankan makanan sehat sebagai produk mereka, karena kebanyakan masyarakat lebih memilih fast food yang notabenenya bukan makanan yang sehat dan dapat memicu penyakit. Serta dengan hadirnya Chills Kitchen masyarakat dapat dengan mudah mendapatkan makanan sehat secara mudah dan praktis.</p>\n<p>&nbsp;</p>','makanan|minuman',1,1,'2019-03-12 14:48:06','2019-03-20 04:03:36'),(665,0,'Jasa Penghias Hantaran Bayi Dan Parcel (JAS PHBP)','2019 17040254101 Serly Dwi Marlisa.pdf',NULL,7782000,'<p>Kewirausahaan adalah suatu usaha yang bergerak di segala bidang dan mampu mengurangi jumlah pengangguran. Di era milineal ini , orang-orang berlomba untuk membuka usaha dengan persaingan yang sangat ketat. Usaha-usaha tersebut adalah seperti makanan, jasa, dan properti. Dunia usaha tak lain terjadi persaingan antar pedagang baik secara langsung maupun lewat media sosial, hanya untuk menarik minat pembeli.</p>','JASA|HANTARAN|PARCEL',2,1,'2019-03-12 14:58:15','2019-03-14 23:54:19'),(666,0,'LUPREK PEDAS','2019 17010024070 RIZKI FIRMAN ARDIANSYAH.pdf',NULL,3700000,'<p><span style=\"font-size: 11.0pt; line-height: 115%; font-family: Ebrima; mso-fareast-font-family: Calibri; mso-bidi-font-family: Ebrima; letter-spacing: -.05pt; mso-ansi-language: EN-US; mso-fareast-language: EN-US; mso-bidi-language: AR-SA;\">K</span><span style=\"font-size: 11.0pt; line-height: 115%; font-family: Ebrima; mso-fareast-font-family: Calibri; mso-bidi-font-family: Ebrima; mso-ansi-language: EN-US; mso-fareast-language: EN-US; mso-bidi-language: AR-SA;\">e<span style=\"letter-spacing: -.05pt;\">g</span>ia<span style=\"letter-spacing: -.05pt;\">t</span>an <span style=\"letter-spacing: .05pt;\">&nbsp;</span>usa<span style=\"letter-spacing: -.1pt;\">h</span>a <span style=\"letter-spacing: .05pt;\">&nbsp;</span>i<span style=\"letter-spacing: -.05pt;\">n</span>i&nbsp; m<span style=\"letter-spacing: -.05pt;\">e</span><span style=\"letter-spacing: -.1pt;\">r</span>upa<span style=\"letter-spacing: .05pt;\">k</span>an usa<span style=\"letter-spacing: -.1pt;\">h</span>a <span style=\"letter-spacing: .05pt;\">&nbsp;</span>pe<span style=\"letter-spacing: -.05pt;\">m</span>b<span style=\"letter-spacing: -.15pt;\">u</span>a<span style=\"letter-spaci