tyle=\"mso-bidi-font-style: italic;\">makeup&nbsp;</span>yang kiranya bisa dicoba dulu atau ada&nbsp;<span style=\"mso-bidi-font-style: italic;\">sample</span>-nya dan dikemas lebih kecil agar tidak mubazir apabila tidak cocok dengan cara beli&nbsp;<span style=\"mso-bidi-font-style: italic;\">makeup share in jar</span>.</span></p>','Industri perdagangan',2,1,'2019-03-12 16:23:28','2019-03-14 23:24:29'),(672,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,1,'2019-03-12 16:40:15','2019-03-12 16:44:42'),(673,0,'Daur Ulang Limbah Rambut Menjadi Babeko (Barang Bernilai Ekonomis)','2019 17050634013 Sri Windarti.pdf',NULL,8640000,'<p>Limbah adalah buangan yang dihasilkan dari suatu proses produksi baik industri maupun domestik (rumah tangga). Zaman sekarang limbah sudah banyak dijadikan bahan daur ulang untuk mengurangi limbah yang mencemari&nbsp;lingkungan. Kebanyakan limbah yang dijadikan bahan daur ulang adalah&nbsp;plastik dan kertas yang sudah banyak dijadikan berbagai macam produk. Oleh&nbsp;karena itu kelompok kami ingin membuat inovasi terbaru yaitu daur ulang dari&nbsp;limbah rambut.</p>\n<p>&nbsp;</p>','Bros|Rambut|Daur Ulang',2,1,'2019-03-12 16:43:03','2019-03-20 05:36:28'),(674,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,1,'2019-03-12 17:03:16','2019-03-20 04:26:59'),(675,0,'MAGIC FILTER FOR A BETTER FISH LIFE','2019 17010014009 Putri oktaviane pusparini.pdf',NULL,5745000,'<p>Dahulu para pecinta ikan hias saat memelihara ikan di aquarium memang tidak menggunakan teknologi pendukung apapun, sehingga mengakibatkan ikan-ikan di dalam aquarium tidak bisa bertahan hidup lama. Magic Filter ini merupakan inovasi usaha dalam bidang industri kreatif berupa filter unik yang kami desain untuk memudahkan para pecinta ikan hias maupun masyarakat dalam memelihara dan merawat habitat ikan hias (aquarium) agar tidak selalu membersihkan dan mengganti air dalam aquarium seperti pada umumnya. Cara kerja Magic Filter ini ialah mengeluarkan gelembung yang bertujuan untuk memberikan oksigen agar ikan bisa bertahan hidup lebih lama serta menyaring kotoran dalam aquarium agar kebersihan air tetap terjaga. Oleh karena itu, usaha ini memiliki prospek yang bagus dalam memudahkan masyarakat khususnya para pecinta ikan hias untuk memelihara ikan hias dan baik bagi kelangsungan hidup ikan hias.&nbsp;</p>','Filter, Aquarium, Fish|Filter Aquarium Fish',4,1,'2019-03-12 17:08:29','2019-03-15 02:01:38'),(676,0,'PREMAN \"Permen Jelly Menyehatkan\"','2019 17081194011 Novia Dwi Safitri.pdf',NULL,2500000,'<p class=\"MsoNormal\" style=\"text-align: justify;\"><span style=\"font-size: 12.0pt; mso-bidi-font-size: 11.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\';\">PREMAN adalah inovasi makanan permen jelly, yaitu singkatan dari Permen Jelly Menyehatkan. Permen jelly ini berbeda dengan permen jelly pada umumnya. Produk ini menggunkan salah satu temu-temuan yaitu jahe yang menyehatkan bagi tubuh. Produk ini dibuat untuk memenuhi keinginan konsumen yang semakin sadar akan olahan makanan sehat. Permen jelly yang terbuat dari campuran agar-agar dan sari jahe memliki kandungan nilai gizi yang cukup tinggi. Agar-agar yang terbuat dari rumut laut memiliki banyak kandungan mineral. Kandungan mineral yang terdapat di dalam agar-agar antara lain kalsium, besi, kalium dan natrium. Sedangkan jahe mengandung banyak vitamin, protein, zat besi, kalsium dan kandungan lainnya. Jahe bermnafaat untuk mencegah penyakit kanker, memperlancar sistem pencernaan, serta meredakan rasa mual.</span></p>','Makanan dan Minuman',1,1,'2019-03-12 17:29:52','2019-03-15 19:06:03'),(677,0,'NASI BAPER (Bakar Pelangi Request Isi) sebagai Inovasi Makanan Bergizi','2019 17040274009 Helia Septiana.pdf',NULL,11114000,'<p class=\"MsoNormal\" style=\"margin-bottom: .0001pt; text-align: justify; text-indent: 36.0pt; mso-pagination: widow-orphan;\"><span style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',serif;\">&nbsp;</span></p>\r\n<p style=\"margin: 0cm 0cm 0.0001pt; text-align: justify; line-height: 115%; background-position: initial initial; background-repeat: initial initial;\">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; Program Mahasiswa Wirausaha yang berjudul NASI BAPER (Bakar Pelangi <em>Request</em> Isi) sebagai inovasi makanan bergizi, bertujuan untuk mengembangkan keterampilan berwirausaha bagi mahasiswa dan menambah nilai kesehatan bagi masyarakat. Nasi ini dibuat dengan olahan yang menarik dan memiliki nutrisi yang tinggi dengan harga terjangkau. Nasi ini dibuat meyerupai warna pelangi menggunakan pewarna alami seperti buah-buahan, sayur-sayuran dan dedaunan serta diolah dengan cara dibakar.</p>\r\n<p style=\"margin: 0cm 0cm 0.0001pt; text-align: justify; line-height: 115%; background-position: initial initial; background-repeat: initial initial;\"><span style=\"background-position: initial initial; background-repeat: initial initial;\">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;Pembuatan nasi ini dilakukan oleh mahasiswa sendiri dari produksi hingga pemasaran. Produksi dilakukan ditempat tinggal dan pemasaran dilakukan dengan cara penyebaran pamflet ke mahasiswa dan masyarakat, menggunakan media sosial, dan membuka stand ketika ada acara di kampus maupun di luar kampus, seperti acara Fish Fest dan Wisuda. Selain itu, nasi baper bisa dititipkan ke koperasi sekolah yang dilakukan oleh orang tua di rumah.</span></p>\r\n<p style=\"margin: 0cm 0cm 0.0001pt; text-align: justify; line-height: 115%; background-position: initial initial; background-repeat: initial initial;\"><span style=\"background-position: initial initial; background-repeat: initial initial;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Harga satu warna bulatan nasi baper yang di dalamnya terdapat lauk seharga 3000. Dalam satu kemasan nasi baper berisi 3-5 bulatan dengan warna dan isi lauk yang berbeda sehingga harga nasi baper dalam satu kemasan berkisar mulai 9000 hingga 15.000, beras yang digunakan untuk proses produksi sekitar 5kg untuk memproduksi 150 bulatan nasi baper. Konsumen sasaran nasi baper ini mulai dari mahasiswa hingga masyarakat umum.</span></p>\r\n<p style=\"margin: 0cm 0cm 0.0001pt; text-align: justify; line-height: 115%; background-position: initial initial; background-repeat: initial initial;\">&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p class=\"MsoNormal\" style=\"margin-bottom: .0001pt; line-height: normal; mso-pagination: widow-orphan;\"><span style=\"font-size: 12.0pt; font-family: \'Times New Roman\',serif;\">&nbsp;</span></p>','Nasi Baper, request isi, pewarna alami',1,1,'2019-03-12 17:30:06','2019-03-15 02:49:50'),(678,0,'KETAN WANGI','2019 17010024001 Yuris Maulana Fahriza Afifie.pdf',NULL,4000000,'<p><span lang=\"IN\" style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',serif; mso-fareast-font-family: Calibri; letter-spacing: -.05pt; mso-ansi-language: IN; mso-fareast-language: EN-US; mso-bidi-language: AR-SA;\"><strong>KETAN WANGI</strong> (Kerajinan Rotan khas Banyuwangi)</span></p>\r\n<p><span lang=\"IN\" style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',serif; mso-fareast-font-family: Calibri; letter-spacing: -.05pt; mso-ansi-language: IN; mso-fareast-language: EN-US; mso-bidi-language: AR-SA;\">Usaha ini merupakan usaha tentang pemberdayaan kerajinan dengan memanfaatkan rotan khas Banyuwangi. Pembuatan kerajinan dari rotan ini dibuat untuk meningkatkan kesadaran masyarakat akan pentingnya melestarikan budaya lokal. Dengan usaha inilah masyarakat bisa mengerti akan pentingnya keberagaman dan perbedaan bahwa itu semua bukan merupakan suatu penghalang untuk kita tetap mengerti dan mengenal budaya masyarakat lainnya.</span></p>','KETAN WANGI|KETAN WANGI MEMANG UNIK',4,1,'2019-03-12 17:40:34','2019-03-14 18:58:50'),(679,0,'Pelatihan Bu Camat (Budidaya Cacing merah tanah)','2019 17010034062 LITA KRISTIANA.pdf',NULL,7514000,'<p><span style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; mso-fareast-font-family: Calibri; letter-spacing: -.05pt; mso-ansi-language: IN; mso-fareast-language: EN-US; mso-bidi-language: AR-SA;\">Membuat program belajar berupa pelatihan budidaya cacing lumbricus rubellus adalah usaha kami </span><span style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; mso-fareast-font-family: Calibri; mso-ansi-language: IN; mso-fareast-language: EN-US; mso-bidi-language: AR-SA;\">sebagai mahasiswa jurusan Pendidikan Luar Sekolah yang telah mendapatkan mata kuliah teori dan praktek pemberdayaan masyarakat berkewajiban mendarmabaktikan pengetahuan dan pengalaman belajarnya, maka dilakukanlah pelatihan budidaya cacing tanah merah ini sebagai upaya pemberdayaan masyarakat.</span> <span style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; mso-fareast-font-family: Calibri; mso-ansi-language: IN; mso-fareast-language: EN-US; mso-bidi-language: AR-SA;\">Kegiatan pelatihan ini dilaksanakan mulai dari pemberian materi dan praktek, pendampingan, monitoring dan evaluasi.&nbsp;</span><span style=\"font-family: \'Times New Roman\', serif; font-size: 12pt; letter-spacing: -0.05pt;\">Modal untuk memulai bisnis budidaya cacing tanah lumbricus rubellus sedikit atau tidak terlalu besar, karena yang paling dibutuhkan adalah membeli indukan serta memanfaatkan bak plastik sebagai tempat pembibitan budidaya cacing tanah.&nbsp;</span><span style=\"font-family: \'Times New Roman\', serif; font-size: 12pt; letter-spacing: -0.05pt;\">Dengan demikian kami berkesempatan untuk membantu warga belajar untuk memulai usahanya.</span></p>','Pelatihan|budidaya|cacing|jasa|perdagangan|pemberdayaan',2,1,'2019-03-12 17:45:25','2019-03-15 04:35:47'),(680,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,1,'2019-03-12 17:47:55','2019-03-12 18:34:37'),(681,0,'CISARUA YAHUDDD (Cilok Rasa Rumput Laut)','2019 16030194004 Ragil Triyani.pdf',NULL,7300000,'<p>rumput laut merupakan tanaman alga yang hidup di perairan. Tumbuhan ini hidup menempel pada substrat baik pasir, lumpur, kayu, karang mati, maupun kulit kerang. Rumput laut kaya akan nutrisi dan mineral sehingga tak heran jika tumbuhan ini mendapat julukan <em>superfood,&nbsp;</em>maka dari itu kami tertarik untuk menginovasi produk makanan berbahan dasar rumput laut agar keberadaan rumput laut yang melimpah lebih bermanfaat dan prosuk olahannya lebih menarik bagi seluruh kalangan masyarakat. Proposal ini bertujuan untuk mengajukan sebuah gagasan pengolahan rumput laut menjadi makanan cemilan berupa cilok rumput laut. Cilok sangat digemari semua kalangan karena produk makanan ini bisa dijadikan camilan sekaligus pengganjal perut. Harganya yang murah mejadikan ini cukup terjangkau bagi semua kalangan. Adanya rumput laut yang dijadikan sebagai bahan dasar cilok ini akan menggantikan peran boraks karena rumput laut akan memberikan tekstur kenyal sehingga baik anak-anak maupun orang dewasa tidak perlu khawatir lagi akan bahaya boraks, justru konsumen akan mendapatkan manfaat yang baik bagi kesehatan. Selain itu, rumput laut akan memberikan cita rasa yang khas. Produk cilok rasa rumput laut ini nantinya akan dijual dengan harga Rp 7.000,00/ kemasan cup dan Rp 15.000,00/ kemasan <em>frozeen food</em>-nya.</p>','cilok|rumput laut|camilan bergizi',1,1,'2019-03-12 17:49:12','2019-03-15 02:47:16'),(682,0,'Mr. Nupi (Nuget Pisang)','2019 17081194021 Dwi Sri Wahyuningsih.pdf',NULL,3000000,'<p><!-- [if gte mso 9]><xml>\r\n <o:OfficeDocumentSettings>\r\n  <o:AllowPNG/>\r\n </o:OfficeDocumentSettings>\r\n</xml><![endif]--><!-- [if gte mso 9]><xml>\r\n <w:WordDocument>\r\n  <w:View>Normal</w:View>\r\n  <w:Zoom>0</w:Zoom>\r\n  <w:TrackMoves/>\r\n  <w:TrackFormatting/>\r\n  <w:PunctuationKerning/>\r\n  <w:ValidateAgainstSchemas/>\r\n  <w:SaveIfXMLInvalid>false</w:SaveIfXMLInvalid>\r\n  <w:IgnoreMixedContent>false</w:IgnoreMixedContent>\r\n  <w:AlwaysShowPlaceholderText>false</w:AlwaysShowPlaceholderText>\r\n  <w:DoNotPromoteQF/>\r\n  <w:LidThemeOther>IN