mso-fareast-font-family: \'Times New Roman\'; mso-hansi-theme-font: major-bidi; mso-bidi-theme-font: major-bidi; mso-fareast-language: IN;\">Mr. Nupi (Nuget Pisang) adalah produk yang berbahan dasar buah <span style=\"mso-spacerun: yes;\">&nbsp;</span>pisang yang diolah dengan proses digoreng dengan dibalut oleh tepung roti&nbsp; sehingga memiliki tekstur yang renyah, dan memiliki berbagai macam topping. Produk ini memiliki bentuk yang hampir serupa dengan nuget pada umumnya yaitu kotak-kotak.&nbsp; Produk ini merupakan bentuk inovasi yang dibuat untuk&nbsp; menambah nilai&nbsp;&nbsp; guna dari buah&nbsp; pisang dengan mengubahnya menjadi salah satu jenis kudapan yang diminati oleh banyak kalangan, dan menjadi pioneer untuk kudapan modern, yang berasal dari bahan-bahan yang sederhana namun memiliki cita rasa dan bentuk yang elegan atau mewah. Dengan adanya usaha dan produk ini diharapkan dapat membuka lapangan pekerjaan dan menumbuhkan inovasi serta kreasi<span style=\"mso-spacerun: yes;\">&nbsp; </span>dikalangan anak muda untuk mengubah bahan-bahan sederhana menjadi suatu produk yang luar biasa. </span></p>','Makanan, Nuget Pisang|Healty Food|Jajanan masa kini|Kekinian|Jajanan Unik|Kudapan menarik',1,1,'2019-03-12 17:56:03','2019-03-17 13:49:36'),(683,0,'UTIBOX (Unique Tissue Box)','2019 17010024019 Laily Novianty.pdf',NULL,4105000,'<p class=\"MsoListParagraph\" style=\"margin-left: 37.0pt; mso-add-space: auto; line-height: 115%;\"><span lang=\"EN-US\" style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\';\">UTIBOX merupakan singkatan dari Unique Tissue Box. UTIBOX adalah suatu produk kerajinan tangan yang terbuat dari bahan dasar daur ulang, contohnya seperti kardus yang sudah tidak terpakai dan karton tebal. Karton dan kardus tersebut diolah menjadi sebuah produk tissue box yang akan dihiasi dengan bahan-bahan tekstil seperti benang wol, katun, dan lain sebagainya. Selain bahan-bahan tekstil, didalam produk UTIBOX ini juga dikombinasi dengan bahan-bahan alam seperti daun kering, kulit telur ayam/puyuh, dan lain sebagainya.</span></p>','Produk unik yang ramah lingkungan',4,1,'2019-03-12 17:57:48','2019-03-14 16:33:33'),(684,0,'Shoeedaystory','2019 17081324016 Gayatri Tirta Lesmana Putri.pdf',NULL,9600000,'<p class=\"MsoNoSpacing\" style=\"text-align: justify; line-height: 150%; tab-stops: 14.2pt;\"><span lang=\"EN-US\" style=\"font-size: 12.0pt; line-height: 150%; font-family: \'Times New Roman\',\'serif\'; letter-spacing: -.05pt;\">Jasa cuci sepatu merupakan salah satu bisnis jasa yang sedang naik daun saaat ini. Kesibukan di dunia kerja, telah menyita banyak waktu luang para pekerja. Kondisi seperti ini membuat usaha jasa cuci sepatu ini semakin diminati calon konsumen. Peningkatan minat pelanggan ini akan kuat bila didukung dengan adanya peningkatkan kualitas dan pelayanan.</span></p>\n<p class=\"MsoNoSpacing\" style=\"text-align: justify; line-height: 150%; tab-stops: 14.2pt;\"><span lang=\"EN-US\" style=\"font-size: 12.0pt; line-height: 150%; font-family: \'Times New Roman\',\'serif\'; letter-spacing: -.05pt;\">Pemanfaatan sistem dan teknologi informasi dapat membantu perusahaan dalam mendapatkan informasi yang akurat, cepat, dan tepat. Seperti official account instagram, twitter, facebook, line, whatsapp business, google business, menjadi bentuk dukungan kegiatan operasional dan pengambilan keputusan suatu perusahaan. Informasi yang optimal dapat memberi kemudahan kepada perusahaan untuk meningkatkan pelayanan terhadap konsumen dan mewujudkan strategi bisnis yang diharapkan. </span></p>\n<p class=\"MsoNoSpacing\" style=\"text-align: justify; line-height: 150%; tab-stops: 14.2pt;\"><span style=\"font-size: 12.0pt; line-height: 150%; font-family: \'Times New Roman\',\'serif\'; letter-spacing: -.05pt; mso-ansi-language: IN;\">Shoeedaystory ini merupakan usaha yang bergerak dibidang jasa, dengan menawarkan jasa cuci sepatu, tetapi disini Shoeedaystory berbeda dengan jasa cuci sepatu yang lain yaitu tidak hanya sepatu tetapi bisa tas, dan topi ataupun boneka. </span><span lang=\"EN-US\" style=\"font-size: 12.0pt; line-height: 150%; font-family: \'Times New Roman\',\'serif\'; letter-spacing: -.05pt;\">Usaha laundry sepatu ini termasuk usaha yang long term, artinya tidak akan pernah mati selama kebutuhan orang terhadap sepatu semakin meningkat. Karena kebanyakan dari mereka memiliki kegiatan yang cukup padat dalam kesehariaannya, sehingga tidak memiliki banyak waktu tersedia untuk melakukan pekerjaan ini sendiri dirumah.</span></p>\n<p class=\"MsoNoSpacing\" style=\"text-align: justify; line-height: 150%; tab-stops: 14.2pt;\"><span style=\"font-family: \'Times New Roman\', serif; font-size: 12pt; letter-spacing: -0.05pt;\">Manfaat bagi masyarakat dengan adanya jasa usaha cuci sepatu bisa membuka lapangan pekerjaan baru seiring dengan kebutuhan cuci sepatu yang dibutuhkan.</span></p>','Shoeedaystory|Jasa|Cuci Sepatu',2,1,'2019-03-12 18:18:50','2019-03-19 23:55:36'),(685,0,'PECILAKAN Pecel Instan Langsung Makan','2019 17080304082 FAHIRA QOTRUNNADA.pdf',NULL,5010000,'<p>PECILAKAN &ldquo;Pecel Instan Langsung Makan&rdquo; merupakan makanan tradisional instan yang mengkombinasikan antara bumbu sambal kacang sebagai bahan utamanya yang dicampur dengan sayur dan tambahan lauk lain misalnya ebi atau kering tempe yang ditemani bersama rempeyek atau kerupuk puli dengan gizi yang baik bagi kesehatan. Konsumen dapat memilih lauk yang sesuai selera yaitu ebi atau kering tempe. Setiap bahan tersebut dikemas terpisah dalam satu kemasan ziper plastik agar konsumen dapat dengan mudah membuka kemasan Pecilakan dan praktis membawanya. Produk ini dibuat karena melihat peluang-peluang yang ada, melihat zaman sekarang yang serba praktis berinisiatif membuat pecel instan ini.</p>','Pecel|Pecel instan|Pecilakan',1,1,'2019-03-12 18:24:43','2019-03-20 03:20:46'),(686,0,'CIRENG KUPING (KULIT PISANG)','2019 17010644139 RAHMA EGA AMALIA.pdf',NULL,4500,'<p>Sebagian besar orang memilih makanan siap saji&nbsp;dikarenakan makanan siap saji lebih praktis dan menghemat waktu. Tetapi makanan siap saji memiliki efek yang tidak baik untuk&nbsp;kesehatan. Oleh sebab itu kita berpikir untuk membuat makanan&nbsp;yang menyehatkan tanpa bahan pengawet dan tentunya bernilai gizi&nbsp;tinggi.Kami membuat cireng yang berbeda dari cireng lainnya&nbsp;dengan memanfaatkan kulit pisang sebagai bahan utamanya.Tidak&nbsp;banyak orang yang mengetahui manfaat dari kulit pisang sendiri.&nbsp;Disinilah kami memiliki pemikiran agar kulit pisang dapat disukai dan&nbsp;dimanfaatkan oleh masyarakat,karena tidak banyak kalangan&nbsp;masyarakat yang memanfaatkan kulit pisang. Mayoritas masyarakat&nbsp;hanya memanfaatkan daging buahnya saja untuk dijadikan sebagai&nbsp;olahan makanan. Oleh karena itu kami membuat olahan makanan&nbsp;dari kulit pisang karena kulit pisang banyak terdapat kandungan gizi&nbsp;yang banyak, sangat disayangkan jika kulit pisang hanya dibuang dan&nbsp;tidak dimanfaatkan. Kandungan dari kulit pisang sendiri&nbsp;memiliki kandungan gizi yang cukup tinggi. Secaraumum dalam 100&nbsp;gram kulit pisang terdapat karbohidratsebanyak 18,50gram,lemak&nbsp;2,11gram, protein0, 3gram,kalsium 715mg, fosfor117mg, zatbesi&nbsp;1,60mg,vitaminB0,12mg dan vitamin C 17,50mg. Sehinggasangat&nbsp;disayangkan jika kulit pisang tidak diolah menjadi olahan makanan&nbsp;karena pohon pisang juga banyak ditemui dimanasaja. Ditinjaudari&nbsp;segi ekonomi harga penjualan produk kami tawarkan cukup&nbsp;terjangkau dikalangan masyarakat, bahan baku mudah didapatkan&nbsp;dan harganyapun terbilang murah.Darisegisosial,produk Cireng&nbsp;Kuping dapat menampung pengangguran untuk&nbsp;dijadikan sebagai karyawan untuk bekerja bersama kami,bisa juga&nbsp;membantu kami untuk menyediakan bahan baku,danmemasarkan&nbsp;produk kami. Hal itu dapat mengurangi jumlah pengangguran yang&nbsp;ada.Tidak hanya dalam cirengnya saja,kamipun mengolah saos&nbsp;cireng dengan memilih da nmemilah bahan tanpa pengawet danwarna makanan,sehingga cukup aman untukd ikonsumsi siapapun.&nbsp;Mulaidarianak-anak,remaja,orangdewasa,orangtua,hingga lanjut&nbsp;usia.Cireng Kuping yang kami buat berbeda dengan cireng-cireng&nbsp;yang ada di pasaran, mereka menggunakan pengawet dan pengenyal&nbsp;untuk membuat tekstur cireng menjadi lebih menarik. Akan tetapi&nbsp;kami tetap memilih dan memilah bahan alami sebagai bahan utama&nbsp;pembuatan cireng kuping dan saosnya.Kami menjamin tingkat&nbsp;kebersihan,kesehatan dari produk kami.Salah satu cara agar&nbsp;masyarakat menyukai produk CirengKuping(KulitPisang) dengan&nbsp;mempromosikan diakun media sosialkami,dan dapat berjualan&nbsp;keliling di sekitar area kampus kami. Mempromosikan dengancara&nbsp;tersebut menjadikan produk kami dapat dikenal dan dikonsumsi&nbsp;banyak orang.</p>','manfaat|kulit pisang',1,1,'2019-03-12 18:25:45','2019-03-18 16:37:16'),(687,0,'DEBUS (Donat Buah dan Sayur)','2019 17020084004 Nur Ania Fitrianti.pdf',NULL,8283000,'<p>Sebagai salah satu makanan populer, saat ini donat telah dianggap sebagai jajanan yang biasa-biasa saja oleh masyarakat, khusunya kaum muda. Oleh karena itu, kami memiliki ide untuk mengkombinasikan donat dengan buah dan sayur. Berbeda dengan donat pada umumnya, DEBUS terbuat dari pisang, buah naga, labu kuning, kentang, ubi ungu, dan ubi madu sebagai bahan dasar. Kandungan vitamin dan protein dari buah dan sayur serta karbohidrat dari tepung diharapkan dapat membuat produk inovasi ini menjadi pilihan jajanan yang lebih sehat. Selain itu, donat ini juga dilengkapi dengan berbagai macam topping dan isian, seperti coklat leleh dan selai. DEBUS dijual dengan kemasan kardus yang masing-masing berisi 2 biji. Harga untuk satu kemasan adalah 5.500 rupiah.</p>','Makanan|Donat|Buah|Sayur',1,1,'2019-03-12 18:39:04','2019-03-14 22:23:26'),(688,0,'Bekal Hati Patin (Bekal Sehat dari Ubi dan Ikan Patin)','2019 17010644149 Aisiyah Amini.pdf',NULL,7655000,'<p>Program Mahasiswa Wirausaha merupakan wadah bagi mahasiswa untuk mengaspirasikan ide-ide wirausaha yang dinaungi risetdikti. Dalam hal ini kami sebagai mahasiswa turut berkontribusi dengan ikut serta dalam Progam Mahasiswa Wirausaha (PMW). Produk yang kami usulkan berupa makanan dengan judul \"Bekal Hati Patin\". Bekal Sehat dari Ubi dan Ikan Patin (Bekal Hati Patin) merupakan produk yang berbahan dasar dari ubi jalar dan ikan patin yang memiliki nilai gizi yang tinggi karena mengandung mineral, protein, serat, vitamin, karbohidrat yang rendah kalori dan baik untuk kesehatan jantung.&nbsp;Tujuan dari produk kami yaitu untuk memberikan inovasi baru terhadap makanan cepat saji yang berbentuk bekal sehat kepada masyarakat luas. Sehingga kami dapat meminimalisir makanan cepat saji yang kurang sehat jika dikonsumsi terus-menerus.</p>','Bekal sehat, Patin dan Ubi',1,1,'2019-03-12 19:11:30','2019-03-14 23:52:36'),(689,0,'Susu teh benalu Milktea-Loe (Loranthaceae)','2019 17040274063 Khofifah Kurnia Amalia Sholihah.pdf',NULL,8018000,'<p>Di zaman yang semakin maju ini, menuntut segalanya serba cepet, praktis dan inovatif. Termasuk juga pada makanan dan minuman, tidak hanya rasa yang lezat dan sehat melainkan juga harus kreatif dan unik. Jika tidak demikian maka makanan dan minuman tersebut akan kalah bersaing mengingat Indonesia sudah memasuki Masyarakat Ekonomi ASEAN (MEA).</p>\n<p>Dengan berkembangnya makanan dan minuman cepat saji, sifatnya yang praktis seolah menjadi satu-satunya pilihan menuntaskan rasa lapar ataupun mengatasi rasa haus. Namun makanan dan minuman tersebut rendah gizi dan justru memiliki kandungan karsinogen penyebab kanker. Maka diperlukan suatu inovasi produk cepet saji yang menyehatkan.</p>\n<p>Minuman teh adalah jenis minuman yang banyak digemari oleh masyarakat Indonesia. Pada produk ini kami memilih benalu untuk dijadikan bahan membuat teh. Disamping unik dan menarik, benalu juga memiliki kandungan senyawa aktif anti tumor dan hipertensi. Tanaman yang sering dianggap tidak memiliki kegunan ini ternyata memiliki segudang manfaat bagi kesehatan.&nbsp;</p>\n<p>Berdasarkan analisis fitokimia tanaman tersebut mempunyai kandungan seperti; tannin, flavonoid, quersetin, glikosida, alkaloid, saponin, dan inulin, zat aktif tersebut mempunyai peranan pada hipertensi (Mensah JK et al, 2009).&nbsp;</p>\n<p>Pada produk ini akan ditambahkan susu dengan beberapa varian rasa. Penambahan susu akan menambahkan nilai gizi pada produk ini mengingat kandungan nutrisi lengkap pada susu seperti karbohidrat, protein, mineral, serta vitamin (Mahmud dkk, 2008).&nbsp;</p>\n<p>Alasan pemilihan produk susu teh benalu ini adalah karena tuntutan masyarakat pada sajian yang cepat, praktis, menarik, kreatif, dan unik tanpa melupakan rasa dan kandungan gizi didalamnya. Dan ini merupakan keunggulan produk ini yaitu mengusung bahan tanaman yang jarang dimanfaatkan sehingga memiliki keunikan dan menarik minat konsumen.&nbsp;</p>\n<p>Unit produksi minuman ini direncanakan kapasitas 50 botol per hari yang berukuran 200 ml dengan desain yang unik disertai kolom perasaan. Untuk menyesuaikan selera lidah setiap orang maka produk ini tersedia varian rasa original, mangga, jeruk, stroberi, dan anggur.</p>','Milktea|Susu|Teh|Benalu|Minuman|Unik',1,1,'2019-03-12 19:28:36','2019-03-15 05:22:32'),(690,0,'Tahu Tuman','2019 17080324042 Nofi Nur Amalina.pdf',NULL,12000000,'<p>Judul Usaha ini adalah Tahu Tuman ,diberi nama Tahu Tuman karena membuat seseorang ketagihan akan rasa pedasnya dan lagi hits nya kata &ndash; kata Tuman pada saat ini. Tahu Tuman terbuat dari Tahu Susu pilihan yang diolah menjadi sebuah keripik dengan cita rasa yang gurih dan berlevel pedas,pilihan levelnya level 1 sampai 5.Keungulan dari Tahu Tuman itu sendiri adalah terbuat dari tahu susu yang memiliki karakteristik yang lembut serta crunchy bila digoreng dan rasa pedasnya yang bisa membuat mood seseorang menjadi meningkat,Ide dari pembuatan Keripik Tahu Tuman ini diawali dengan banyaknya masyarakat yang menyukai gorengan dengan cita rasa pedas.</p>','Tahu susu',1,1,'2019-03-12 19:44:15','2019-03-20 04:07:47'),(691,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,1,'2019-03-12 19:52:35','2019-03-14 22:24:00'),(692,0,'BOLBIKAT (Bola-bola Ubi Coklat)','2019 17010034056 Devi Oktaviana.pdf',NULL,12975000,'<p class=\"MsoNoSpacing\" style=\"margin-left: 14.2pt; text-align: justify; text-indent: 21.25pt; line-height: 150%; tab-stops: 14.2pt;\"><span style=\"font-size: 12.0pt; line-height: 150%; font-family: \'Times New Roman\',\'serif\'; letter-spacing: -.05pt;\"><span style=\"font-size: 12.0pt; line-height: 150%; font-family: \'Times New Roman\',\'serif\'; letter-spacing: -.05pt;\">Kegiatan usaha ini merupakan usaha pembuatan olahan makanan berupa bola bola dari bahan ubi jalar dengan</span><span lang=\"IN\" style=\"font-size: 12.0pt; line-height: 150%; font-family: \'Times New Roman\',\'serif\'; letter-spacing: -.05pt; mso-ansi-language: IN;\">&nbsp;isi dan</span><span style=\"font-size: 12.0pt; line-height: 150%; font-family: \'Times New Roman\',\'serif\'; letter-spacing: -.05pt;\">&nbsp;topping coklat</span><span lang=\"IN\" style=\"font-size: 12.0pt; line-height: 150%; font-family: \'Times New Roman\',\'serif\'; letter-spacing: -.05pt; mso-ansi-language: IN;\">, keju dan kacang</span><span style=\"font-size: 12.0pt; line-height: 150%; font-family: \'Times New Roman\',\'serif\'; letter-spacing: -.05pt;\">. Ubi jalar merupakan salah satu jenis umbi-umbian yang cukup terkenal di Indonesia, akan tetapi tidak menarik sehingga kurang peminatnya. Pemilihan ubi jalar sebagai bahan utama bola-bola makanan dikarenakan ubi jalar mengandung karbohidrat sebagai pengganti nasi yang cocok untuk sarapan.</span></span></p>\n<p class=\"MsoNoSpacing\" style=\"margin-left: 14.2pt; text-align: justify; text-indent: 21.25pt; line-height: 150%; tab-stops: 14.2pt;\"><span style=\"font-size: 12.0pt; line-height: 150%; font-family: \'Times New Roman\',\'serif\'; letter-spacing: -.05pt;\">Ubi jalar merupakan sumber pangan yang penting karena merupakan bahan pangan memiliki nilai gizi yang cukup baik. Ubi jalar mengandung banyak vitamin A untuk memenuhi kebutuhan harian tubuh. Selain itu, ubi jalar juga mengandung 37% kebutuhan tubuh akan vitamin C. Kandungan nutrisi penting lainnya pada ubi jalar yaitu 25% mangan, 14% vitamin B6, dan 9% kalium. </span></p>','MAKANAN BOLBIKAT',1,1,'2019-03-12 19:57:37','2019-03-16 14:11:54'),(693,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,1,'2019-03-12 19:57:44','2019-03-12 20:02:50'),(694,0,'SIKOMAN (Siomay Tongkol Mantap)','2019 17010664161 Rr.Putri Ayu Gayatri.pdf',NULL,2276000,'<p>Siomay Tongkol Mantap (SIKOMAN) merupakan jajanan sehat yang berbahan dasar ikan tongkol dan sayur. Siomay ini merupakan inovasi produk jajanan yang memiliki nilai gizi. Produk ini dibuat dengan tujuan untuk meningkatkan kualitas kesehatan masyarakat serta sebagai upaya pengembangan pengolahan hasil laut. Pembuatan produk ini dilakukan dengan cara dikukus dan sebagai pengembangan usaha produk akan dibuat dengan cara digoreng dan menyediakan dalam bentuk&nbsp;<em>frozen food</em>. Pemasaran SIKOMAN akan difokuskan pada media sosial dan dengan penjualan langsung.</p>','Siomay|Siomay ikan|Siomay Ikan|Siomay Ikan Tongkol|Siomay Tongkol|Siomay Sehat',1,1,'2019-03-12 20:02:27','2019-03-14 20:57:12'),(695,0,'KEBON UNESA (Kope Beton UNESA)','2019 17010024045 zidni rifki nadhifah.pdf',NULL,4350000,'<p class=\"MsoListParagraphCxSpFirst\" style=\"margin-left: 54.0pt; mso-add-space: auto; text-align: justify; text-indent: -18.0pt; line-height: 115%; mso-list: l0 level1 lfo1;\"><!-- [if !supportLists]--><span style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',serif; mso-ascii-theme-font: major-bidi; mso-fareast-font-family: \'Times New Roman\'; mso-fareast-theme-font: major-bidi; mso-hansi-theme-font: major-bidi; mso-bidi-theme-font: major-bidi;\"><span style=\"mso-list: Ignore;\">1.<span style=\"font: 7.0pt \'Times New Roman\';\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span></span><!--[endif]--><span style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',serif; mso-ascii-theme-font: major-bidi; mso-hansi-theme-font: major-bidi; mso-bidi-theme-font: major-bidi;\">Gambaran Umum dan Keunggulan Usaha</span></p>\n<p class=\"MsoListParagraphCxSpMiddle\" style=\"margin-left: 54.0pt; mso-add-space: auto; text-align: justify; text-indent: 18.0pt; line-height: 115%;\"><span style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',serif; mso-ascii-theme-font: major-bidi; mso-hansi-theme-font: major-bidi; mso-bidi-theme-font: major-bidi;\">Usaha kami ini bergerak pada bidang produksi minuman yang dimana pembuatannya menggunakan bahan alami yang mudah ditemukan yakni biji buah nangka. Banyaknya masyarakat Indonesia yang menyukai kopi tidak hanya kalangan pria dewasa tetati remaja, kaum wanita dan anak-anak pun mulai menyukai kopi dan menjadikan kopi sebagai minuman favoritnya, apalagi dengan beredarnya berbagai macam kopi dengan varian rasa yang beragam seperti pada kopi kemasan goodday dan kopi siap minum starbucks. <span style=\"mso-spacerun: yes;\">&nbsp;</span>Latar belakang terciptanya minuman ini yaitu banyaknya orang dewasa hingga anak-anak yang menyukai kopi, namun seperti kita tahu kopi memiliki banyak kandungan diantarannya kafein dan Ethyphenol yang jika dikonsumsi secara terus menerus akan berdampak tidak baik pada tubuh kita. Pemilihan biji nangka sebagai bahan baku alternative dikarenakan biji nangka mengandung karbohidrat yang cukup tinggi dan potensial untuk diolah menjadi produk pangan (Rukmana, 2002). Setiap 100 gram biji nangka mengandung energi 165 kalori, karbohidrat 36,7 gram, lemak 0,1 gram, protein 4,2 gram, besi 1 mg, fosfor 200 mg, kalsium 33 mg, tiamin 0,2 mg dan air 57,7 gram.</span></p>\n<p class=\"MsoListParagraphCxSpMiddle\" style=\"margin-left: 54.0pt; mso-add-space: auto; text-align: justify; text-indent: 18.0pt; line-height: 115%;\"><span style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',serif; mso-ascii-theme-font: major-bidi; mso-hansi-theme-font: major-bidi; mso-bidi-theme-font: major-bidi;\">Produk yang akan kami buat dalam kegiatan ini merupakan inovasi baru yakni kopi berbahan dasar dari biji nangka yang nantinya akan kami sajikan dengan berbagai macam inovasi rasa serta akan kami kemas semenarik mungkin, yang nantinya para penikmat kopi dapat menikmati kopi ini tanpa takut akan adannya kandungan bahaya yang ada dalam kopi tersebut. KEBON UNESA ini nantinya akan kami kemas pada kemasan bubuk serta ada juga yang siap minum. Untuk saat ini kebon unesa memiliki varian rasa original, vanilla, cappuccino dan moccachino. Untuk varian rasa nantinya kita akan mengembangkan lebih banyak lagi mengikuti selera masyarakat.</span></p>\n<p class=\"MsoListParagraphCxSpMiddle\" style=\"margin-left: 54.0pt; mso-add-space: auto; text-align: justify; text-indent: -18.0pt; line-height: 115%; mso-list: l0 level1 lfo1;\"><!-- [if !supportLists]--><span style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',serif; mso-ascii-theme-font: major-bidi; mso-fareast-font-family: \'Times New Roman\'; mso-fareast-theme-font: major-bidi; mso-hansi-theme-font: major-bidi; mso-bidi-theme-font: major-bidi;\"><span style=\"mso-list: Ignore;\">2.<span style=\"font: 7.0pt \'Times New Roman\';\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span></span><!--[endif]--><span style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',serif; mso-ascii-theme-font: major-bidi; mso-hansi-theme-font: major-bidi; mso-bidi-theme-font: major-bidi;\">Manfaat Bagi Masyarakat</span></p>\n<p class=\"MsoListParagraphCxSpMiddle\" style=\"margin-left: 2.0cm; mso-add-space: auto; text-align: justify; text-indent: 15.3pt; line-height: 115%;\"><span style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',serif; mso-ascii-theme-font: major-bidi; mso-hansi-theme-font: major-bidi; mso-bidi-theme-font: major-bidi;\">Selain dibuat untuk alternatif pengganti kopi, kopee beton ini juga dibuat untuk mengangkat ekonomi para petani buah nangka. Selain itu biji buah nangka yang selama ini sering diabaikan oleh masyarakat dan banyak masyarakat yang belum mengetahui bahwa banyak manfaat yang terkandung dalam biji buah nangka tersebut ternyata dapat diolah menjadi produk alternatif yang baik yang akan di produksi dan dikembalikan agar dapat dinikmati oleh masyarakat. </span></p>\n<p class=\"MsoListParagraphCxSpMiddle\" style=\"margin-left: 54.0pt; mso-add-space: auto; text-align: justify; text-indent: -18.0pt; line-height: 115%; mso-list: l0 level1 lfo1;\"><!-- [if !supportLists]--><span style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',serif; mso-ascii-theme-font: major-bidi; mso-fareast-font-family: \'Times New Roman\'; mso-fareast-theme-font: major-bidi; mso-hansi-theme-font: major-bidi; mso-bidi-theme-font: major-bidi;\"><span style=\"mso-list: Ignore;\">3.<span style=\"font: 7.0pt \'Times New Roman\';\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span></span><!--[endif]--><span style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',serif; mso-ascii-theme-font: major-bidi; mso-hansi-theme-font: major-bidi; mso-bidi-theme-font: major-bidi;\">Kondisi Pesaing Usaha</span></p>\n<p class=\"MsoListParagraphCxSpMiddle\" style=\"margin-left: 2.0cm; mso-add-space: auto; text-align: justify; text-indent: 15.3pt; line-height: 115%;\"><span style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',serif; mso-ascii-theme-font: major-bidi; mso-hansi-theme-font: major-bidi; mso-bidi-theme-font: major-bidi;\">Kopee beton ini nantinya disajikan dalam 2 kemasan yakni kemasan bubuk dan kemasan siap minum. Dua kemasan yang disajikan ini memudahkan konsumen untuk menikmati kopee beton ini, selain praktis juga mudah dibawa kemana mana. Kopee beton ini nanti memiliki berbagai pilihan rasa yang ditawarkan agar konsumen dpat memilih sesuai selera. Kopee beton juga memiliki desain kemasan yang menarik, harga yang ekonomis serta rasa yang tidak kalah dengan kopi brand lain yang telah beredar dipasaran, yang memang nantinya kopee beton ini akan dihadapkan dengan pesaing pesaing yang lainnya.</span></p>\n<p class=\"MsoListParagraphCxSpMiddle\" style=\"margin-left: 54.0pt; mso-add-space: auto; text-align: justify; text-indent: -18.0pt; line-height: 115%; mso-list: l0 level1 lfo1;\"><!-- [if !supportLists]--><span style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',serif; mso-ascii-theme-font: major-bidi; mso-fareast-font-family: \'Times New Roman\'; mso-fareast-theme-font: major-bidi; mso-hansi-theme-font: major-bidi; mso-bidi-theme-font: major-bidi;\"><span style=\"mso-list: Ignore;\">4.<span style=\"font: 7.0pt \'Times New Roman\';\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span></span><!--[endif]--><span style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',serif; mso-ascii-theme-font: major-bidi; mso-hansi-theme-font: major-bidi; mso-bidi-theme-font: major-bidi;\">Prospek Usaha di Masa yang Akan Datang</span></p>\n<p class=\"MsoListParagraphCxSpLast\" style=\"margin-left: 2.0cm; mso-add-space: auto; text-align: justify; text-indent: 15.3pt; line-height: 115%;\"><span style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',serif; mso-ascii-theme-font: major-bidi; mso-hansi-theme-font: major-bidi; mso-bidi-theme-font: major-bidi;\">Dengan adannya usaha kopee beton ini diharapkan dapat meningkatan perekonomian petani buah nangka. Nantinya kami ingin akan dibuka gerai kopee beton seperti gerai starbuck serta dipasarannya kemasan bubuk kopi kami di toko dan supermarket terdekat agar nantinya mudah untuk didapatkan. Kopee beton ini juga diharapkan mampu meningkatkan devisa negara serta dapat membuka lapangan kerja baru dan diharapkan Indonesia dapat bersaing dengan produksi kopi dunia.</span></p>','Biji nangka|Kopi|Kopee beton|kopi kaya gizi',1,1,'2019-03-12 20:08:50','2019-03-14 20:47:30'),(696,0,'PunSi Hitz','2019 17010714032 Yolanda Berliana Yanuariyanti.pdf',NULL,6545000,'<p>PunSi Hitz merupakan olahan punten warna warni. Punten sendiri merupakan makanan khas Jawa Timur seperti Tulungagung dan Pacitan. Adapun pecel, olahan ikan bandeng dan rempeyek ebi (udang) sebagai pendamping punten. Bandeng dan udang sendiri merupakan ciri khas dari Kabupaten Sidoarjo.</p>\n<p>Jadi, PunSi Hitz merupakan sajiaj tradisional yang bergizi dan mengenyangkan, yaitu berisi karbo (punten), protein nabati (pecel), dan protein hewani (ikan bandeng dan ebi).</p>','#punten|#warna|#bandeng|#ebi',1,1,'2019-03-12 20:21:45','2019-03-14 21:28:09'),(697,0,'HappyTaso (Tahu Bakso Bahagia)','2019 16010664050 Dea Anggi Clarista Putri.pdf',NULL,5977000,'<p class=\"MsoListParagraph\" style=\"margin-left: 18.0pt; text-indent: 24.55pt; line-height: 115%; mso-layout-grid-align: none; text-autospace: none;\"><span lang=\"IN\" style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; mso-ansi-language: IN;\">Ide usaha ini muncul saat melihat kondisi orang-orang yang lapar dan tidak ingin memakan makanan berat namun tetap ingin merasa kenyang dengan harga makanan yang terjangkau . Menurut kami HappyTaso merupakan salah satu solusi yang dapat membantu permasalahan tersebut .Ditambah ,HappyTaso merupakan jajanan yang dalam proses produksinya memerhatikan kebersihan dan menggunakan bahan-bahan yang aman dikonsumsi sehingga pada saat makan HappyTaso ini konsumen mendapatkan berbagai nilai tambah selain rasa kenyang yaitu harga yang murah, sehat serta mendapatkan kepuasaan dan kebahagiaan.<span style=\"mso-spacerun: yes;\">&nbsp; </span></span></p>\n<p class=\"MsoListParagraph\" style=\"margin-left: 18.0pt; text-indent: 24.55pt; line-height: 115%; mso-layout-grid-align: none; text-autospace: none;\"><span lang=\"IN\" style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; mso-ansi-language: IN;\">Selain itu, alasan lain kami memilih usaha tahu bakso ini adalah walaupun jajanan ini cukup populer di berbagai daerah namun pihak-pihak yang menjual tahu bakso disekitar Lidah Wetan dan UNESA khusus nya masih sedikit, sehingga mampu memberikan peluang usaha bagi kami. HappyTaso merupakan jajanan berupa tahu yang telah digoreng dengan isi bakso di dalamnya. Untuk membuat produk ini terlihat <em style=\"mso-bidi-font-style: normal;\">out of the box </em><span style=\"mso-spacerun: yes;\">&nbsp;</span>maka kami menambahkan berbagai varian isi dan rasa<span style=\"mso-spacerun: yes;\">&nbsp; </span>dengan masing-masing nama yang unik.</span></p>\n<p class=\"MsoListParagraph\" style=\"margin-left: 18.0pt; text-indent: 24.55pt; line-height: 115%; mso-layout-grid-align: none; text-autospace: none;\"><span lang=\"IN\" style=\"font-family: \'Times New Roman\',\'serif\'; mso-ansi-language: IN;\">Berikut ini adalah berbagai varian rasa dan isi dari HappyTaso :</span></p>\n<p class=\"MsoListParagraph\" style=\"margin-left: 64.35pt; text-indent: -18.0pt; line-height: 115%; mso-list: l0 level1 lfo1; tab-stops: 1.0cm; mso-layout-grid-align: none; text-autospace: none;\"><!-- [if !supportLists]--><span lang=\"IN\" style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; mso-fareast-font-family: \'Times New Roman\'; mso-ansi-language: IN;\"><span style=\"mso-list: Ignore;\">a.<span style=\"font: 7.0pt \'Times New Roman\';\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span></span><!--[endif]--><span lang=\"IN\" style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; mso-ansi-language: IN;\">Original</span></p>\n<p class=\"MsoListParagraph\" style=\"margin-left: 64.35pt; line-height: 115%; tab-stops: 1.0cm; mso-layout-grid-align: none; text-autospace: none;\"><span lang=\"IN\" style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; mso-ansi-language: IN;\">Dalam varian original, tahu bakso yang disajikan merupakan rasa asli yang tidak ada campuran isi dan rasa-rasa lain. </span></p>\n<p class=\"MsoListParagraph\" style=\"margin-left: 64.35pt; text-indent: -18.0pt; line-height: 115%; mso-list: l0 level1 lfo1; tab-stops: 1.0cm; mso-layout-grid-align: none; text-autospace: none;\"><!-- [if !supportLists]--><span lang=\"IN\" style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; mso-fareast-font-family: \'Times New Roman\'; mso-ansi-language: IN;\"><span style=\"mso-list: Ignore;\">b.<span style=\"font: 7.0pt \'Times New Roman\';\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span></span><!--[endif]--><span lang=\"IN\" style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; mso-ansi-language: IN;\">Hot Arabian</span></p>\n<p class=\"MsoListParagraph\" style=\"margin-left: 64.35pt; line-height: 115%; tab-stops: 1.0cm; mso-layout-grid-align: none; text-autospace: none;\"><span lang=\"IN\" style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; mso-ansi-language: IN;\">Hot Arabian merupakan varian tahu bakso yang pedas. Isi dari Hot Arabian ini berupa potongan-potongan cabai.</span></p>\n<p class=\"MsoListParagraph\" style=\"margin-left: 64.35pt; text-indent: -18.0pt; line-height: 115%; mso-list: l0 level1 lfo1; tab-stops: 1.0cm; mso-layout-grid-align: none; text-autospace: none;\"><!-- [if !supportLists]--><span lang=\"IN\" style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; mso-fareast-font-family: \'Times New Roman\'; mso-ansi-language: IN;\"><span style=\"mso-list: Ignore;\">c.<span style=\"font: 7.0pt \'Times New Roman\';\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span></span><!--[endif]--><span lang=\"IN\" style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; mso-ansi-language: IN;\">Hawaiian sea treasure</span></p>\n<p class=\"MsoListParagraph\" style=\"margin-left: 64.35pt; line-height: 115%; tab-stops: 1.0cm; mso-layout-grid-align: none; text-autospace: none;\"><span lang=\"IN\" style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; mso-ansi-language: IN;\">Hawaiian sea treasure merupakan salah satu varian dari tahu bakso dengan isi seafood ( cumi dan udang ).</span></p>\n<p class=\"MsoListParagraph\" style=\"margin-left: 64.35pt; text-indent: -18.0pt; line-height: 115%; mso-list: l0 level1 lfo1; tab-stops: 1.0cm; mso-layout-grid-align: none; text-autospace: none;\"><!-- [if !supportLists]--><span lang=\"IN\" style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; mso-fareast-font-family: \'Times New Roman\'; mso-ansi-language: IN;\"><span style=\"mso-list: Ignore;\">d.<span style=\"font: 7.0pt \'Times New Roman\';\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span></span><!--[endif]--><span lang=\"IN\" style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; mso-ansi-language: IN;\">Quail&rsquo;s Egg </span></p>\n<p class=\"MsoListParagraph\" style=\"margin-left: 64.35pt; line-height: 115%; tab-stops: 1.0cm; mso-layout-grid-align: none; text-autospace: none;\"><span lang=\"IN\" style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; mso-ansi-language: IN;\">Varian dari Quail&rsquo;s Egg berupa tahu bakso yang berisikan telur puyuh</span><span style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\';\">.</span></p>\n<p class=\"MsoListParagraph\" style=\"margin-left: 64.35pt; line-height: 115%; tab-stops: 1.0cm; mso-layout-grid-align: none; text-autospace: none;\"><span style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\';\">&nbsp;</span></p>\n<p class=\"MsoListParagraph\" style=\"margin-left: 64.35pt; text-indent: -18.0pt; line-height: 115%; mso-list: l0 level1 lfo1; tab-stops: 1.0cm; mso-layout-grid-align: none; text-autospace: none;\"><!-- [if !supportLists]--><span lang=\"IN\" style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; mso-fareast-font-family: \'Times New Roman\'; mso-ansi-language: IN;\"><span style=\"mso-list: Ignore;\">e.<span style=\"font: 7.0pt \'Times New Roman\';\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span></span><!--[endif]--><span lang=\"IN\" style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; mso-ansi-language: IN;\">Heavenly Cheese</span></p>\n<p class=\"MsoListParagraph\" style=\"margin-left: 64.35pt; line-height: 115%; tab-stops: 1.0cm; mso-layout-grid-align: none; text-autospace: none;\"><span lang=\"IN\" style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; mso-ansi-language: IN;\">Heavenly Cheese merupakan varian dari HappyTaso yang berisikan keju </span><span style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\';\">warna-warni </span><span lang=\"IN\" style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; mso-ansi-language: IN;\">berkualitas</span><span style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\';\">.</span></p>','Tahu BAkso|HAppy|Tahu Bakso Semarang',1,1,'2019-03-12 20:28:10','2019-03-15 06:31:36'),(698,0,'Sup Gabus Berlonceng','2019 17010024041 Sekar Arum Ing P.pdf',NULL,2696000,'<p class=\"MsoNormal\" style=\"margin-left: 1.0cm; text-indent: 36.0pt; line-height: 115%; mso-layout-grid-align: none; text-autospace: none;\"><span style=\"font-size: 12.0pt; mso-bidi-font-size: 11.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; mso-ansi-language: IN;\">Sup Gabus Berlonceng </span><span lang=\"EN-US\" style=\"font-size: 12.0pt; mso-bidi-font-size: 11.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\';\">adalah sebuah produk berbahan dasar </span><span style=\"font-size: 12.0pt; mso-bidi-font-size: 11.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; mso-ansi-language: IN;\">buah belonceng yang </span><span lang=\"EN-US\" style=\"font-size: 12.0pt; mso-bidi-font-size: 11.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\';\">di</span><span style=\"font-size: 12.0pt; mso-bidi-font-size: 11.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; mso-ansi-language: IN;\">sajikan dengan kuah rempah kayu manis dan jahe khas Indonesia</span><span lang=\"EN-US\" style=\"font-size: 12.0pt; mso-bidi-font-size: 11.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\';\">. Yang menjadi latar belakang kami dalam menciptakan produk </span><span style=\"font-size: 12.0pt; mso-bidi-font-size: 11.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; mso-ansi-language: IN;\">Sup Gabus Berlonceng </span><span lang=\"EN-US\" style=\"font-size: 12.0pt; mso-bidi-font-size: 11.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\';\">ini karena </span><span style=\"font-size: 12.0pt; mso-bidi-font-size: 11.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; mso-ansi-language: IN;\">belum terlalu banyaknya </span><span lang=\"EN-US\" style=\"font-size: 12.0pt; mso-bidi-font-size: 11.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\';\">masyarakat</span><span style=\"font-size: 12.0pt; mso-bidi-font-size: 11.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; mso-ansi-language: IN;\"> Indonesia yang mengetahui buah belonceng serta kurang minatnya masyarakat Indonesia terutama anak muda </span><span lang=\"EN-US\" style=\"font-size: 12.0pt; mso-bidi-font-size: 11.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\';\"><span style=\"mso-spacerun: yes;\">&nbsp;</span>untuk mengkonsumsi </span><span style=\"font-size: 12.0pt; mso-bidi-font-size: 11.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; mso-ansi-language: IN;\">minuman berkomposisi rempah</span><span lang=\"EN-US\" style=\"font-size: 12.0pt; mso-bidi-font-size: 11.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\';\">, padahal tanpa disadari sangat banyak manfaat </span><span style=\"font-size: 12.0pt; mso-bidi-font-size: 11.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; mso-ansi-language: IN;\">buah belonceng dan olahan rempah</span><span lang=\"EN-US\" style=\"font-size: 12.0pt; mso-bidi-font-size: 11.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\';\"> bagi tubuh,<span style=\"mso-spacerun: yes;\">&nbsp; </span>Sebagai mahasiswa Teknologi Pendidikan yang sudah menempuh mata kuliah Inovasi dan Difusi termotivasi untuk membuat </span><span style=\"font-size: 12.0pt; mso-bidi-font-size: 11.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; mso-ansi-language: IN;\">buah belonceng</span><span lang=\"EN-US\" style=\"font-size: 12.0pt; mso-bidi-font-size: 11.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\';\"> yang sebelumnya </span><span style=\"font-size: 12.0pt; mso-bidi-font-size: 11.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; mso-ansi-language: IN;\">belum terlalu terkenal dan rempah kayu manis dan jahe yang kurang peminat </span><span lang=\"EN-US\" style=\"font-size: 12.0pt; mso-bidi-font-size: 11.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\';\">menjadi </span><span style=\"font-size: 12.0pt; mso-bidi-font-size: 11.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; mso-ansi-language: IN;\">olahan makanan sekaligus minuman </span><span lang=\"EN-US\" style=\"font-size: 12.0pt; mso-bidi-font-size: 11.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\';\">yang lebih unik dan kreatif</span><span style=\"font-size: 12.0pt; mso-bidi-font-size: 11.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; mso-ansi-language: IN;\">. </span></p>\n<p class=\"MsoNormal\" style=\"margin-left: 1.0cm; text-indent: 36.0pt; line-height: 115%; mso-layout-grid-align: none; text-autospace: none;\"><span lang=\"EN-US\" style=\"font-size: 12.0pt; mso-bidi-font-size: 11.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\';\">Manfaat dari </span><span style=\"font-size: 12.0pt; mso-bidi-font-size: 11.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; mso-ansi-language: IN;\">Sup Gabus Berlonceng </span><span lang=\"EN-US\" style=\"font-size: 12.0pt; mso-bidi-font-size: 11.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\';\">yang pertama dari </span><span style=\"font-size: 12.0pt; mso-bidi-font-size: 11.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; mso-ansi-language: IN;\">buah belonceng </span><span lang=\"EN-US\" style=\"font-size: 12.0pt; mso-bidi-font-size: 11.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\';\">sendiri yaitu dikutip dari artikel kesehatan yang memaparkan fakta ilmiah tentang hasil penelitian para ilmuwan dan manfaatnya,</span><span style=\"font-size: 12.0pt; mso-bidi-font-size: 11.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; mso-ansi-language: IN;\">belonceng</span><span lang=\"EN-US\" style=\"font-size: 12.0pt; mso-bidi-font-size: 11.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\';\"> dapat me</span><span style=\"font-size: 12.0pt; mso-bidi-font-size: 11.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; mso-ansi-language: IN;\">njadi obat tifus, menjaga kesehatan ginjal dan jantung, menurunkan tekanan darah tinggi, membantu melawan sembelit, gangguan kemih, serta membersihkan paru-paru perokok aktif</span><span lang=\"EN-US\" style=\"font-size: 12.0pt; mso-bidi-font-size: 11.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\';\">. Hasil pelitian Teguh Setiawan Wibowo dari Fakultas Farmasi Universitas Surabaya, dikutip dari situs ubaya.ac.id, menyatakan rebusan </span><span style=\"font-size: 12.0pt; mso-bidi-font-size: 11.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; mso-ansi-language: IN;\">buah belonceng</span><span lang=\"EN-US\" style=\"font-size: 12.0pt; mso-bidi-font-size: 11.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\';\"> dapat menurunkan kadar glukosa darah hewan uji hiperglikemia sebesar 8,07 persen<span style=\"mso-spacerun: yes;\">&nbsp; </span>dibandingkan kelompok kontrol, dan 15,96 persen dibandingkan kelompok pembanding.Yang kedua manfaat dari </span><span style=\"font-size: 12.0pt; mso-bidi-font-size: 11.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; mso-ansi-language: IN;\">kuah rempah kayu manis dan jahe adalah membantu mengontrol kadar gula darah, kolesterol, dan tekanan darah, serta memperbaiki fungsi otak. Kayu manis juga memiliki sifat</span> <span style=\"font-size: 12.0pt; mso-bidi-font-size: 11.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; mso-ansi-language: IN;\">antibakteri. Untuk jahe manfaat yang dapat diperoleh adalah antiradang dan antioksidan yang kuat, serta baik untuk meredakan mual, nyeri terkait menstruasi, osteoarthritis, dan meredakan flu.</span></p>','sup gabus|makanan|unik|inovasi|kreatif|lonceng',1,1,'2019-03-12 20:28:43','2019-03-14 16:57:09'),(699,0,'Totebag FulFul Ashoooy','2019 17010024025 Fanida Desy Ari Susanti.pdf',NULL,1568000,'<p>Totebag ful ful Ashoooy merupakan jenis produk jasa berupa tas polos yang tersedia berbagai warna. disinilah letak perbedaan produk ini dengan yang laiinya. tersedia banyak warna yang lucu juga nyentrik untuk dipakai kalangan mahasiswa ataupun masyarakat umum mengapa dibuat polos? karena disini kami akan menggunakan kreativitas tangan sendiri untuk melukisnya diatas totebag polos yang telah disiapkan dalam usaha ini kami memilki tema sendiri yakni gambar yang akan dilukis yakni berupa gambar adopsi dari sebuah film beserta quotes nya yang berupa motivasi atau sindiran.Kami hanya membuat produk 15 buah tas setiap 2 bulan dikarenakan usaha yang masih awal dan pastinya rekan dan juga waktu yang terbatas produk ini ijamin keunikannya dan pasti sangat cocok untuk dipakai saat ngampus ataupun hunting.</p>','totebag|colorful|meaningful',2,1,'2019-03-12 20:30:18','2019-03-14 19:43:41'),(700,0,'NgiChips (Nganjuk Onion Chips)','2019 17010714067 Nur Aini Dwi Setyowati.pdf',NULL,7500000,'<p class=\"MsoNormal\" style=\"text-align: left; line-height: normal;\" align=\"left\"><span style=\"font-size: 12.0pt; font-family: \'Times New Roman\',\'serif\'; mso-fareast-font-family: \'Times New Roman\'; background: white;\">Pada zaman sekarang ini banyak makanan ringan yang dijual di pasaran yang biasa di sebut camilan, yang banyak kita jumpai di warung, pasar atau tempat lainnya yang dekat dengan sekitar kita. Dari cemilan makanan jensi makanan kering ataupun makanan basah saat ini banyak makanan modern buatan pabrik yang dijual di pasar &ndash; pasar bahkan di warung &ndash; warung.</span></p>\n<p class=\"MsoNormal\" style=\"text-align: left; line-height: normal;\" align=\"left\"><span style=\"font-size: 12.0pt; font-family: \'Times New Roman\',\'serif\'; mso-fareast-font-family: \'Times New Roman\';\"><br /> Ketatnya persaingan di pasar makanan tidak menyurutkan langkah kami guna&nbsp;&nbsp;mencoba memproduksi suatu makanan tradisional yang tidak kalah menarik dengan makanan instan. Tentunya dengan harapan mampu bersaing dalam pasar makanan. Produk tersebut adalah &ldquo;Nganjuk Onion Chips&rdquo;.</span></p>\n<p class=\"MsoNormal\" style=\"text-align: left; line-height: normal;\" align=\"left\"><span lang=\"EN-GB\" style=\"font-size: 12.0pt; font-family: \'Times New Roman\',\'serif\'; mso-bidi-font-family: \'Times New Roman\'; mso-bidi-theme-font: minor-bidi; letter-spacing: -.05pt; mso-ansi-language: EN-GB;\">Untuk mengurangi jumlah penurunan harga bawang di pasaran kami menawarkan inovasi baru dalam bidang makanan, yaitu mengolah bawang merah tersebut menjadi keripik (Chips) yang disesuaikan dengan selera anak milenial sekarang.Selain mengurangi jumlah penunuran harga bawang inovasi ini juga mampu memberikan lapangan kerja baru bagi penduduk sekitar daerah Nganjuk yang belum memiliki pekerjaan khususnya anak &ndash; anak muda.</span></p>','Onion|Chips|Snack|Makanan',1,1,'2019-03-12 20:33:46','2019-03-14 14:54:00'),(702,0,'MOCHI SUIT','2019 17010714049 Berliana Rosita.pdf',NULL,7392000,'<p>Sushi merupakan makanan khas asal Jepang yang terdiri dari nasi yang dibentuk bersama lauk yang berupa makanan laut, daging, sayuran mentah atau yang sudah dimasak. Nasi sushi mempunyai rasa asam yang lembut karena dibumbui campuran cuka beras (mizkan), garam, dan gula. Sushi sudah cukup terkenal di Indonesia namun sebagian orang juga tidak menyukai karena beberapa sushi terdiri atas nasi, daging dan sayuran mentah yang pada sebagian orang Indonesia hal tersebut kurang cocok untuk lidah orang Indonesia.</p>\n<p>MOCHI SUIT merupakan inovasi yang bergerak pada bidang makanan dengan perpaduan beras ketan dan buah sehingga menghasilkan sushi yang sangat merakyat di lidah orang Indonesia. Karena ketan mengandung kerbohidrat sepertiga lebih rendah dari beras. Oleh karena itu, ketan dapat dijadikan alternatif untuk yang sedang menjalani program penurunan berat badan. Ketan juga kaya serat yang membantu menjaga sistem pencernaan. Ketan juga berkhasiat sebagai anti oksidan. Manfaat lain adalah melancarkan metabolisme, menurunkan risiko osteoporosis, dan menurunkan risiko penyakit jantung.&nbsp;</p>\n<p>Sehingga salah satu tujuan usaha ini adalah menjadi penyedia makanan sehat yang dapat di konsumsi oleh masyarakat. Oleh karena itu usaha ini memiliki prospek yang bagus di Kota Surabaya dan sekitarnya.&nbsp; Selain itu MOCHI SUIT merupakan jenis makanan inovasi baru dan belum memiliki daya saing, maka hal itu menjadi keunggulan tersendiri untuk prospek usaha kedepan. Untuk prospek pemasaran produk MOCHI SUT ini juga dapat disajikan sebagai Coffe break di tempat-tempat rapat (meeting), hotel, serta dapat dipasarkan di kegiatan- kegiatan di Sidoarjo.b</p>','makanan |kreatif|sehat|bergizi|murah',1,1,'2019-03-12 20:34:03','2019-03-19 17:56:57'),(703,0,'Aksara (Kaos Batik Nusantara)','2019 17010024076 Yomaya Mega Kristanti.pdf',NULL,4000000,'<p><em>Aksara</em> ini merupakan kaos yang mengangkat unsur batik dan aksara jawa pada desain kaosnya, cocok untuk para anak-anak muda namun juga bisa digunakan untuk semua usia, dengan memakai kaos ini kita tetap bisa tampil stylish namun tetap juga menunjukkan rasa nasionalisme.</p>','Aksara|Kaos|Batik|Nusantara',4,1,'2019-03-12 20:35:12','2019-03-14 22:30:15'),(704,0,'RAINBOW CHURROS SAHABAT ANAK AUTIS','2019 16010664026 Qori Faizun.pdf',NULL,5820,'<p class=\"MsoNormal\" style=\"text-align: justify;\"><span style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\';\">Churros adalah makanan yang memiliki tekstur renyah dan lembut. Produk churros sampai saat ini belum banyak dipasarkan dikalangan masyarakat, dapat dikatakan masih minim penjual. Churros yang akan kami perkenalkan sebagai produk unggulan dari penulis yakni churros yang bebas dari kasein dan gluken yang diperuntukkan bagi anak-anak penyandang autis. Produk churros ini juga akan dimodifikasi dengan bentuk yang lebih menarik dan tetap menjaga kandungan makanan untuk anak-anak penyandang autis. Modifikasi yang akan diterapkan pada produk ini adalah churros yang berwarna-warni. Pewarna yang digunakan untuk churros ini tetap menggunakan pewarna alami, menyehatkan dan bebas dari kasein dan gluken yang merupakan pantangan bagi anak penyandang autis. Pewarna makanan alami tersebut akan didapatkan dari berbagai jenis buah dan sayuran seperti buah naga, kubis, wortel, teh hijau dan mangga. Produk ini diharapkan dapat bermanfaat bagi masayarakat khususnya anak penyandang autis untuk dapat dijadikan sebagai alternative jajanan atau snack yang menyehatkan. Selain itu, churros ini juga dapat dikonsumsi oleh masyarakat umum sebagai makanan yang lebih sehat karena dibuat secara alami dan tanpa bahan pengawet. Seiring berjalannya waktu tentunya persaingan usaha akan muncul maka pengembangan usaha akan penulis lakukan dengan menjual produk dengan varian yang berbeda dan dapat dijual diberbagai tempat missal sekolah, mall,dan lain sebagainya.</span></p>','Churros, Rainbow Churros, Anak Autis, Bahan alami',1,1,'2019-03-12 20:47:36','2019-03-15 01:31:43'),(705,0,'\"OMAH INSPIRASI\" SEBAGAI IMPLEMENTASI HUMANITY EDUCATION','2019 16010034024 SHONIATUL UMMI RIZQI.pdf',NULL,8980000,'<p class=\"MsoNormal\" style=\"text-indent: 36.0pt; line-height: 115%;\"><span style=\"font-family: Ebrima; mso-ansi-language: IN; mso-bidi-font-weight: bold;\">Omah inspirasi adalah sebuah usaha di bidang jasa pendidikan yang bergerak pada layanan kursus bahasa inggris yang menggunakan pendekatan pendidikan humanis. </span><span style=\"font-family: Ebrima; mso-ansi-language: IN;\">Setiap pembelajarannya berorientasi pada kebutuhan belajar peserta didik. Selain itu, Omah inspirasi juga memiliki program-program menarik yang dapat menumbuhkan inspirasi peserta didik untuk terus mengembangkan dirinya, seperti kelas profesi, kelas keterampilan, dan <em>nature learning. </em>Kelas profesi merupakan acara dua mingguan sekali yang akan mendatangkan <em>guess star </em>dari berbagai macam profesi, sehingga dapat memberikan inspirasi kepada peserta didik untuk mulai menentukan cita-citanya. Kelas keterampilan adalah kelas mingguan yang di dalamnya terdapat berbagai macam keterampilan yang diminati peserta didik. <em>Nature learning </em>adalah program belajar langsung di alam, kegiatannya berupa pengenalan lingkungan alam dengan cara pembentukan tim untuk menyelesaikan mini proyek yang berkaitan dengan alam atau juga bisa melalui kegiatan <em>out bound.</em></span></p>\n<p class=\"MsoNormal\" style=\"line-height: 115%;\"><strong><span style=\"font-family: Ebrima; mso-ansi-language: IN;\">&nbsp;</span></strong></p>','Omah Inspirasi, kursus Bahasa Inggris|Omah Inspirasi|Kursus Bahasa Inggris',2,1,'2019-03-12 20:58:09','2019-03-14 23:50:52'),(706,0,'BOS Nusantara (Bola Nasi Nusantara)','2019 17010024072 Tamara Adhania.pdf',NULL,4362000,'<p class=\"MsoNormal\" style=\"margin-bottom: .0001pt; text-align: justify; text-indent: .5in; line-height: 150%;\"><span style=\"font-size: 12.0pt; mso-bidi-font-size: 11.0pt; line-height: 150%; font-family: \'Times New Roman\',serif;\">Ide untuk membuat usaha BOS Nusantara ini muncul karena keinginan untuk membuat inovasi baru dari nasi goreng. Bagamaina jika nasi goreng dapat di nikmati dengan mudah tanpa harus membutuhkan tempat dan sendok untuk dapat di nikmati. Selain mempertimbangkan bagaimana cara baru untuk menikmati nasi goreng, muncul juga ide untuk membuat rasa yang berbeda dari nasi goreng pada umumnya yang mana bumbunya hanya berbahan dasar bawang merah, bawang putih, dan cabai dengan rasa yang standart. Kami berinisiatif untuk membuat rasa baru dengan mengangkat cita rasa masakan Indonesia yang sangat kaya akan rempah-rempah, salah satunya adalah Rendang dan Kare. Pertimbangan rasa ini juga terinspirasi dari nasi kebuli dan nasi briyani yang mana nasi tersebut bisa lebih enak jika di masak menggunakan bumbu-bumbu masakan. Dengan memilih untuk menggunakan bumbu Rendang dan Kare maka produk ini akan sangat cocok di lidah para konsumen karna cita rasa Indonesia yang familiar.</span></p>','Bola Nasi Rasa Nusantara',1,1,'2019-03-12 20:59:47','2019-03-14 20:25:10'),(707,0,'Sun Pipi','2019 16080574101 NINDA AGUSTINA.pdf',NULL,11000000,'<p>Sun pipi adalah olahan pisang yang digoreng krispi dibalut dengan selai yang ditusuk sehingga memudahkan konsumen untuk memakannya.</p>','p',1,1,'2019-03-12 21:06:43','2019-03-20 07:03:58'),(708,0,'OIJA \"Oats in a jar\"','2019 17010664085 BARRON ATALARIK SIHAB.pdf',NULL,10000000,'<p>Hidup di kota besar di Indonesia, seperti Surabaya, menuntut masyarakatnya untuk mampu melakukan aktivitas sejak pagi hari. Kesibukan membuat masyarakat sering melewatkan sarapan dan kekurangan energi untuk menjalankan aktivitas yang menyebabkan menurunnya produktivitas yang memuaskan dan meningkatnya pola hidup yan tidak sehat. Produk &ldquo;Oija&rdquo; atau Oats In a Jar memberikan solusi untuk permasalahn tersebut dengan menyediakan makanan sehat untuk sarapan berupa olahan gandum dengan komposisi bahan-bahan sehat lain yaitu Greek yogurt, dark chocolate, kacang almond, dan buah-buahan yang berguna untuk meningkatkan kemampuan kognitif, terutama untuk atensi, bagi masyarakat yang harus segera bekerja di pagi hari. Tak hanya itu, konsep lain produk ini adalah ramah lingkungan, sehingga selama produksi akan menghindari penggunaan kemasan plastik dan menggunakan kemasan yang dapat digunakan kembali. Proses penjualan akan dilakukan dengan memanfaatkan E-commerce dan penjualan langsung. Rencana biaya untuk produksi dan pemasaran dari produk ini adalah Rp10.000.000 untuk kegiatan selama 12 bulan, dimana setiap modal akan digunakan semaksimal mungkin untuk meningkatkan penjualan.</p>','Olahan gandum, makanan sehat, kemasan reusable',1,1,'2019-03-12 21:12:59','2019-03-15 04:10:13'),(709,0,'GYOBUNG (Gyoza Rebung)','2019 17010714079 Imawati Sumaryo.pdf',NULL,4961000,'<p>GYOBUNG merupakan kombinasi makanan Jepang yaitu Gyoza dengan sayur Rebung. Produk ini masih belum ada di Indonesia serta banyak kandungan bergizi didalamnya.</p>','enter|makanan|gyoza|unik|rebung|inovatif|bergizi|ekonomis',1,1,'2019-03-12 21:15:47','2019-03-13 20:52:03'),(710,0,'MURASAKU (Merchandise Murah Dari Disabilitas Tapi Berkualitas)','2019 17020104020 Yuniar Ambaryanti.pdf',NULL,9305000,'<p>Murasaku merupakan produk merchandise berupa totebag, Kaos, dan Tas serut yang terdapat gambar berdesain literasi ungkapan berbagai bahasa termasuk bahasa isyarat. Murasa ku terinspirasi oleh kebudayaan mahasiswa FBS Unesa yang bermacam-macam bahasa dan penggunaan bahasa isyarat sebagai bentuk kepedulian terhadap penyandang disabilitas. Proses pembuatan desain pada produk ditangani langsung oleh penyandang disabilitas yang berkompeten dibidangnya sehingga penyandang disabilitas dapat diberdayakan kemampuannya. Harga yang ditawarkan sangat sesui dengan keuangan mahasiswa yakni untuk kaos adalah Rp 65.000 , untuk totebag seharga Rp 45.000 dan untuk tas serut Rp 50.000&nbsp;</p>','Literasi|Merchandise|Disabilitas',4,1,'2019-03-12 21:15:53','2019-03-19 00:27:15'),(711,0,'NISSA  AING','2019 16010024037 DESY AYU AINURROHMAH.pdf',NULL,4000000,'<p><span class=\"CharAttribute4\"><span lang=\"EN-US\" style=\"font-size: 12.0pt; mso-fareast-font-family: Batang; mso-font-kerning: 1.0pt; mso-ansi-language: EN-US; mso-fareast-language: KO; mso-bidi-language: AR-SA;\">Kegiatan usaha ini merupakan usaha&nbsp; pembuatan brownies dengan campuran bahan dari sagu dengan aneka rasa dan topping diatasnya. Brownies merupakan makanan yang berasal Amerika, namun walaupun brownies berasal dari luar negeri namun makanan tersebut cukup populer di Indonesia.Pemilihan sagu sebagai bahan utama pembuatan brownies dikarenakan bahan pangan ini mengandung banyak karbohidrat</span></span><span style=\"font-size: 12pt;\">Kegiatan usaha ini merupakan usaha</span><span style=\"font-size: 12pt;\">&nbsp; </span><span style=\"font-size: 12pt;\">pembuatan brownies dengan campuran bahan dari sagu dengan aneka rasa dan topping diatasnya. Brownies merupakan makanan yang berasal Amerika, namun walaupun brownies berasal dari luar negeri namun makanan tersebut cukup populer di Indonesia.Pemilihan sagu sebagai bahan utama pembuatan brownies dikarenakan bahan pangan ini mengandung banyak karbohidrat.</span></p>','NISSA AING|BROWNIES SAGU',1,1,'2019-03-12 21:19:31','2019-03-14 21:36:34'),(712,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,'2019-03-12 21:21:54','2019-03-12 21:21:54'),(713,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,'2019-03-12 21:21:55','2019-03-12 21:21:55'),(714,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,'2019-03-12 21:21:55','2019-03-12 21:21:55'),(715,0,'HijaB-need','2019 17010664013 Aulia Rahmah.pdf',NULL,4071000,'<p dir=\"ltr\" style=\"line-height: 1.7999999999999998; margin-top: 0pt; margin-bottom: 0pt; text-align: justify;\"><span style=\"font-size: 12pt; font-family: \'Times New Roman\'; color: #000000; background-color: transparent; font-weight: 400; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-east-asian: normal; font-variant-position: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;\">HijaB-need (Hijab B-Need) merupakan produk hijab yang terinspirasi dari salah satu teori kepribadian milik Abraham Maslow, yaitu Hirarki Kebutuhan. Menurut teori Hirarki Kebutuhan, manusia memiliki lima tahapan kebutuhan, yaitu kebutuhan fisiologis, keamanan, kasih sayang dan cinta, harga diri, dan aktualisasi diri. Puncak dari kebutuhan manusia adalah aktualisasi diri atau kebutuhan meta yang merupakan kebutuhan seseorang untuk mewujudkan secara maksimal potensi yang ia miliki sehingga dapat menjadi manusia yang utuh. &nbsp;</span></p>\r\n<p dir=\"ltr\" style=\"line-height: 1.7999999999999998; margin-top: 0pt; margin-bottom: 0pt; text-align: justify;\"><span style=\"font-size: 12pt; font-family: \'Times New Roman\'; color: #000000; background-color: transparent; font-weight: 400; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-east-asian: normal; font-variant-position: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;\">Kata &ldquo;B-need&rdquo; sendiri merupakan singkatan dari </span><span style=\"font-size: 12pt; font-family: \'Times New Roman\'; color: #000000; background-color: transparent; font-weight: 400; font-style: italic; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-east-asian: normal; font-variant-position: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;\">Being need</span><span style=\"font-size: 12pt; font-family: \'Times New Roman\'; color: #000000; background-color: transparent; font-weight: 400; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-variant-east-asian: normal; font-variant-position: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;\">, yang mana dapat diartikan sebagai kebutuhan untuk berekmbang atau transformasi menjadi lebih bermakna. HijaB-need memiliki desain unik dan kekinian yang dapat menggambarkan karakter dari rincian kebutuhan meta yang terdapat dalam teori Hirarki Kebutuhan. Konsep aktualisasi diri ini memberi pesan dan semangat kepada masyarakat luas khususnya kaum wanita untuk dapat mengaktualisasi dirinya secara optimal agar keberadaan mereka dapat memberikan makna bagi kehidupan ini. Konsep ini masih jarang ditemukan, khususnya dalam produk hijab. Dengan produk ini, kami berharap dapat memberikan nuansa baru dalam dunia fashion muslim serta dapat memperluas wawasan masyarakat mengenai teori dan konsep dalam ilmu psikologi. </span></p>\r\n<p>&nbsp;</p>','Hijab, Fashion|Hijab|Fashion|Industri kreatif|wanita',4,1,'2019-03-12 21:21:55','2019-03-14 18:01:43'),(716,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,'2019-03-12 21:21:55','2019-03-12 21:21:55'),(717,0,'Jongkong Hitam CoGreen (Coklat Green tea)','2019 17040254002 Fitri Utaminingsih.pdf',NULL,5185000,'<p>Jongkong adalah kue yang terbuat dari bahan dasar campuran tepung beras dan tepung tapioka. Jongkong ini hampir ada di seluruh wilayah Indonesia. Dinamakan jongkong hitam karena keunikannya yang menggunakan air abu merang yang dapat memberikan warna hitam pada kue jongkong. Jadi kue jongkong ini menggunakan warna hitam yang alami dari abu merang padi. Kue jongkong memiliki tekstur yang kenyal dan lembut, serta memiliki rasa yang manis gurih dengan ditaburi parutan kelapa muda. Di Lamongan sudah jarang sekali ditemukan kue jongkong. Kue jongkong hanya ditemukan pada saat acaran tahlilan 7 hari,40 hari atau 100 hari orang yang meninggal sebagai hidangan atau dibawa pulang di desa-desa. Jongkong hitam ini memiliki ciri khas dengan taburan parutan kelapa muda. Untuk membuat hal yang baru dan unik di kalangan masyarakat yang sudah jarang memakan jongkong, kami membuat inovasi untuk mengganti taburan parutan kelapa muda pada jongkong dengan topping coklat dan green tea. Dimana saat ini zaman sudah maju atau disebut zaman millennial dan tentu saja masyarakat tidak asing lagi dengan coklat, dan green tea. Apalagi anak muda zaman now tentu sangat menyukai makanan atau minuman yang berbau coklat atau green tea. Terlebih lagi saat ini coklat dan green tea banyak dijadikan topping pada nugget pisang. Untuk menciptakan hal baru dan lebih dikenal masyarakat terutama anak muda zaman now agar lebih mengenal jajanan tradisional jongkong ini ,kami&nbsp; membuat inovasi dengan memberikan topping pada kue jongkong.</p>','Jongkong hitam|Coklat greentea',1,1,'2019-03-12 21:24:41','2019-03-14 22:36:10'),(718,0,'CAKEP POL (CupcaKe daun pEPaya berPrOtein & Lezat)','2019 17010024026 Finie Tabita Angelica Hutagalung.pdf',NULL,2475500,'<p class=\"MsoNoSpacing\" style=\"margin-bottom: 1.2pt; text-align: justify; line-height: 115%; tab-stops: 14.2pt;\"><span lang=\"IN\" style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; mso-ansi-language: IN;\">CAKEP POL kepanjangan dari CAKEP POL adalah CupaKe daun pEPaya berPrOtein &amp; Lezat . Seperti namanya, usaha ini merupakan usaha dibidang pangan yaitu cupcake. Namun yang membedakan bahwa cupcake ini memakai bahan yag tidak biasa yaitu daun pepaya.</span></p>','CAKEP POL|CUPCAKE|DAUN PEPAYA',1,1,'2019-03-12 21:32:22','2019-03-14 19:15:05'),(719,0,'LERIUK (Lele Kriuk) Aneka Rasa','2019 17010714076 Dinda Dwi Kartika Rahmawati.pdf',NULL,4278000,'<p class=\"MsoNoSpacing\" style=\"text-align: justify; line-height: 150%; tab-stops: 14.2pt;\"><span style=\"font-size: 12.0pt; mso-bidi-font-size: 10.0pt; line-height: 150%; font-family: \'Times New Roman\',\'serif\'; letter-spacing: -.05pt; mso-ansi-language: IN;\">Program wirausaha ini bernama LERIUK (Lele Kriuk) Aneka Rasa. LERIUK ini merupakan usaha dalam bidang makanan yang berfokus pada pengolahan ikan lele. Kami memiliki inovasi baru dalam pengolahan ikan lele menjadi makanan praktis yang disukai banyak kalangan. Ikan lele yang merupakan sumber protein dan sumber vitamin B-12 ini dibentuk seperti dadu kecil-kecil namun lebih panjang dan tipis. Produk ini memiliki keunggulan dalam pengonsumsian. Beberapa keunggulan produk ini adalah konsumen tidak perlu memilah duri dalam ikan saat makan dan produk ini memiliki anea rasa baru yang tentunya disukai banyak kalangan. Mengapa Lele? Seperti yang sudah ada ikan lele hanya diolah menjadi lauk utuh yang dimakan dengan nasi serta sayur dan menjadi keripik lele. Dengan demikian kami rasa produk ini cocok untuk dikonsumsi pada masa yang akan mendatang.</span></p>\n<p><strong><span style=\"font-size: 12.0pt; mso-bidi-font-size: 11.0pt; line-height: 107%; font-family: \'Times New Roman\',\'serif\'; mso-fareast-font-family: Calibri; letter-spacing: -.05pt; mso-ansi-language: IN; mso-fareast-language: EN-US; mso-bidi-language: AR-SA;\">&nbsp;</span></strong></p>','#lele|#kriuk',1,1,'2019-03-12 21:38:55','2019-03-14 18:53:30'),(720,0,'BROW-KAT','2019 17040254096 Sinta meithia nugraha.pdf',NULL,1635500,'<p>Jiwa yang tahan banting dan selalu haus akan perubahan membuat manusia haus akan kepuasan sehingga adanya program kewirausahaan memotivasi mereka yang ingin berkreatif dengan karyanya, serta memberikan banyak ilmu terkait dengan dunia wirausaha. Kami berminat mengikuti program ini karena kami ingin mengimplementasikan ide-ide kreatif kami, menginovasi suatu produk yang berdaya guna dan dinikmati oleh banyak orang. Dalam program mahasiswa kewirausahaan ini kami lebih belajar untuk menjadi wirausahawan muda yang saling bekerja sama dalam membangun usaha yang diharapkan baik untuk kedepannya serta memberi kesempatan untuk diri dalam menggali potensi diri. dengan Dengan demikian kami peserta PMW memberikan kreasi makanan baru kepada masyarakat dimana makanan ini dapat menumbuhkan semangat tubuh hingga makanan yang kami tawarkan adalah pencuci mulut yang menyenangkan.&nbsp;</p>','BROW-KAT|Makanan Manis',1,1,'2019-03-12 21:39:28','2019-03-14 22:29:14'),(721,0,'ALMOND MACALOZZ \"MACARON SEHAT DAN BERGIZI\"','2019 17010664091 Nadila idzania Putri.pdf',NULL,5000,'<p class=\"MsoNormal\" style=\"text-align: justify; text-justify: inter-ideograph;\"><span style=\"font-size: 12.0pt; mso-bidi-font-size: 11.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\';\">&ldquo;Produk Kami Layak Mendapatkan Dana PMW &rdquo;</span></p>\n<p class=\"MsoNormal\" style=\"text-align: justify; text-justify: inter-ideograph; text-indent: .5in;\"><span style=\"font-size: 12.0pt; mso-bidi-font-size: 11.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\';\">Program mahasiswa Wirausaha adalah program yang di tunggu-tunggu oleh sebgaian mahasiswa.PMW menjadi wadah dalam menuangkan kreativitas agar menjadi suatu inovasi. Tidak heran apabila program ini mendapat respon positif dari kampus tercinta kami Univeristas Negeri Surabaya ,dosen kami mengatakan bahwa jangan sampai menjadi mahasiswa yang hanya mencari pekerjaan usahakan setelah lulus kami membuka lapangan pekerjaan.Menjadi pengusaha itu menjanjikan dalam banyak hal, seperti bebas mengatur hidup tanpa harus dibatasi dengan aturan yang ada di pekerjaan, bebas mengerjaknnya di mana saja,tidak terpaku umur dan ijasah karena yang terpenting adalah KEMAUAN,Profesi apapun bisa,asalkan memiliki Jiwa yang pantang menyerah,tahan banting,dan selalu haus akan perubahan.Salah satunya menjadi pengusaha.Oleh karenanya saya mengikuti seleksi ini.&nbsp;Dana yang ditawarkan memang menggiurkan,namun bagi saya,bukan itu prioritas utama mengapa saya ikut program ini. Saya,Nadila Idzania Putri.Anak pertama dari tiga bersaudara,dibesarkan oleh orang tua sederhana namun selalu<span style=\"mso-spacerun: yes;\">&nbsp; </span>berusaha memberikan yang terbaik untuk saya.Saya di lahirkan menjadi perempuan yang tidak tergolong cerdas dalam eksakta,tapi saya senang berusaha keras,berjuang hingga lelah.Saya teringat tentang dimana&nbsp;orang cerdas tapi malas akan kalah dengan orang bodoh tetapi bekerja keras.Saya punya beberapa kelebihan misal saya suka dikritik,saya suka memperbaiki diri,saya sangat suka tantangan, Kekurangan saya,saya terkadang mudah merasa puas.<br /> <span style=\"mso-spacerun: yes;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span>Kembali kepada pembahasan mengapa berminat mengikuti program ini,saya ingin mengimplementasikan ide-ide kreatif saya.Menginovasi suatu produk dan dinikmati oleh banyak orang.</span><span style=\"font-size: 12.0pt; mso-bidi-font-size: 11.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; mso-fareast-language: EN-US;\">Selanjutnya,saya akan menceritakan sedikit pengalaman dalam usaha.Saya suka berdagang.Dari Sekolah Dasar saya sering berjualan di dalam kelas.Bahkan ini masih tetap saya lakukan sampai sekarang.</span><span style=\"font-size: 12.0pt; mso-bidi-font-size: 11.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\';\">Dari menjual<span style=\"mso-spacerun: yes;\">&nbsp; </span>gelang gelangan dari manik,kertas sticky notes,binder warna warni,kosmetik,masker,hingga makanan yang sekarang akhirnya saya ajukan,makanan yang saya ajukan ini makanan sehat dengan harga yang terjangkau bagaiamna tidak masyarakat nantinya bisa mencicipi atau bisa menikmati makanan yang enak tetapi sehat , makanan yang lucu tapi tunggi gizi,mewah tapi murah,saya membuat sebuah inovasi macaron yang terdapat oat dan gandum nya dengan tinggi manfaat namun bisa dinikmati dengan harga yang murah.Prinsip saya, apapun akan saya jual yang terpenting halal dan tidak membebankan segalanya pada orang tua <span style=\"mso-spacerun: yes;\">&nbsp;</span>. Passion saya ialah menjadi entepreneur, seseorang yang bisa menciptakan suatu perubahan. Inilah alasan mengapa &ldquo;Kami Layak Mendapatkan Dana PMW</span>&rdquo;</p>','macaron |bergizi|enak|murah|almond|sereal|oat dan gandum|lezat|pengganti nasi',1,1,'2019-03-12 21:41:27','2019-03-19 15:06:40'),(722,0,'Pakar Cinta (Pancake Bakar Chesee and Nutella)','2019 17010014030 NABILA SALMA SALSABILA.pdf',NULL,2500000,'<p><span style=\"font-size: 12pt; line-height: 115%; font-family: \'Times New Roman\', serif; letter-spacing: -0.05pt;\">Pakar Cinta </span><span lang=\"EN-ID\" style=\"font-size: 12pt; line-height: 115%; font-family: \'Times New Roman\', serif; letter-spacing: -0.05pt;\">merupakan usaha makanan pancake yang terbuat dari bahan dasar tepung terigu</span><span lang=\"EN-US\" style=\"font-size: 12pt; line-height: 115%; font-family: \'Times New Roman\', serif; letter-spacing: -0.05pt;\">. </span><span lang=\"EN-US\" style=\"font-size: 12pt; line-height: 115%; font-family: \'Times New Roman\', serif;\">Berbeda dengan pancake pada umumnya, pancake kami mempunyai keunikan dengan membuat inovasi baru yaitu pancake bakar. Pancake tersebut ditaburi gula yang kemudian dibakar pada bagian gulanya menggunakan alat gas torch. Setelah dibakar pancake tersebut diberi topping dengan dua pilihan varian rasa yakni, keju dan nutella. Karena hal inilah kami memilih nama usaha makanan yakni &ldquo;Pakar Cinta&rdquo; yang merupakan singkatan dari </span><span style=\"font-size: 12pt; line-height: 115%; font-family: \'Times New Roman\', serif; letter-spacing: -0.05pt;\">Pancake Bakar Cheese n Nutella. Kami </span><span lang=\"EN-ID\" style=\"font-size: 12pt; line-height: 115%; font-family: \'Times New Roman\', serif; letter-spacing: -0.05pt;\">memilih topping dengan varian rasa keju dan nutella karena dua hal tersebut banyak diminati oleh kalangan remaja yang menjadi target sasaran pemasaran kami.&nbsp;</span></p>','Pancake|Chesee|Nutella|Nikmat|Sehat',1,1,'2019-03-12 21:51:02','2019-03-16 19:27:12'),(723,0,'Rainbow Creamynde (onde-onde dengan kulit warna-warni aneka rasa dengan isian creamy fla)','2019 17010664128 Tasya Firly Febriana.pdf',NULL,7241500,'<p>Rainbow Creamynde (onde-onde dengan kulit warna-warni aneka rasa dengan isian creamy fla) merupakan sebuah inovasi untuk jajanan tradisional onde-onde. Onde-onde yang kita ketahui hanya berwarna putih dengan isian kacang ijo, Rainbow Creamynde menciptakan variasi kulit dengan rasa durian, pandan, dan kopi sedangkan isiannya berupa creamy fla dengan rasa green tea, coklat, dan vanila. Rainbow Creamynde bisa menjadi salah satu makanan kekinian kedepannya yang disukai masyarakat dengan harga yang terjangkau serta dapat menjadi peluang usaha.</p>','creamy fla|inovasi|kekinian|onde-onde',1,1,'2019-03-12 21:52:59','2019-03-15 04:21:51'),(724,0,'JUMPRET MULTI RASA (Jumbreg Terompet Multi Rasa)','2019 17040254066 Arina ameliyah.pdf',NULL,10000000,'<p>Jumpret multi rasa yaitu makanan khas lamongan yang dikembangkan dengan berbagai varian rasa mulai dari rasa coklat,&nbsp; original, pandan dengan diberi toping berupa coklat dan nangka diatasnya. Sehingga makanan ini akan memiliki ciri khas tersendiri di masyarakat atau konsumen. Makanan ini akan di distribusikan diluar kota lamongan,&nbsp; seperti kota Surabaya, Gresik dan Sidoarjo sehingga dapat mempermudah konsumen dalam memperoleh JUMPRET MULTI RASA. harga JUMPRET MULTI RASA juga sangat terjangkau sehingga dapat dijangkau oleh masyarakat luas.&nbsp; Baik anak kecil,&nbsp; remaja maupun dewasa.&nbsp;</p>','jumbregmulti rasa|jumbreg|multi|rasa',1,1,'2019-03-12 22:00:26','2019-03-14 21:04:40'),(725,0,'CUTE BALLS (Klepon Ubi Jalar Beraneka Rasa)','2019 17010024008 YANI EKA PUTRI.pdf',NULL,5689000,'<p class=\"MsoListParagraphCxSpFirst\" style=\"text-align: justify;\"><span lang=\"EN-ID\" style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; letter-spacing: -.05pt; mso-ansi-language: EN-ID;\"><span style=\"mso-spacerun: yes;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span><span lang=\"EN-ID\" style=\"font-family: \'Times New Roman\',\'serif\'; mso-ansi-language: EN-ID;\">Pada kesempatan kali ini saya sebagai mahasiswa unesa mempunyai inovasi untuk membuat<span style=\"mso-spacerun: yes;\">&nbsp; </span>kue klepon memilih ubi jalar dijadikan sebagai bahan campuran pembuatan klepon karena pemanfaatannya masih kurang. Serta saya ingin memberikan inovasi pada rasa kue klepon yaitu dengan tambahan rasa durian,coklat,keju,dan original berisi rasa gula merah.</span></p>\n<p class=\"MsoListParagraphCxSpMiddle\" style=\"text-align: justify; tab-stops: 153.0pt;\"><span lang=\"EN-ID\" style=\"font-family: \'Times New Roman\',\'serif\'; mso-ansi-language: EN-ID;\"><span style=\"mso-tab-count: 1;\">&nbsp; &nbsp; &nbsp;</span></span><span style=\"font-family: \'Times New Roman\', serif;\">Harapan saya sebagai mahasiswa unesa yang</span><span style=\"font-family: \'Times New Roman\', serif;\">&nbsp; </span><span style=\"font-family: \'Times New Roman\', serif;\">telah memberikan inovasi baru pada kue</span><span style=\"font-family: \'Times New Roman\', serif;\">&nbsp; </span><span style=\"font-family: \'Times New Roman\', serif;\">klepon ,semoga jajanan tradisional bisa kembali menjadi sorotan masyarkat dan tidak tergeser dengan adanya perkembangan zaman dengan makanan import maupun siap saji.</span></p>\n<p class=\"MsoListParagraphCxSpLast\" style=\"text-align: justify;\"><span lang=\"EN-ID\" style=\"font-family: \'Times New Roman\',\'serif\'; mso-ansi-language: EN-ID;\">&nbsp;</span></p>','Klepon Ubi Jalar  |Kesehatan|makanan tradisonal |Klepon|Ubi Jalar |Kue Tradisional',1,1,'2019-03-12 22:03:56','2019-03-15 03:03:05'),(726,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,'2019-03-12 22:08:52','2019-03-12 22:08:52'),(727,0,'TOKDAMENG (Botok Daun Mengkudu)','2019 17010664096 Ilham Bachtiar Febriansyah.pdf',NULL,10325000,'<p class=\"MsoNormal\" style=\"margin-bottom: 0.0001pt; text-align: justify; text-indent: 36pt; line-height: 14.65pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span lang=\"EN-US\" style=\"font-size: 12.0pt; font-family: \'Times New Roman\',\'serif\'; mso-fareast-font-family: \'Times New Roman\'; color: #333333;\">Usaha TOKDAMENG (Botok Daun Mengkudu) merupakan sebuah usaha yang nantinya akan dijalankan di Kampung Lempung Perdana Kota Surabaya. Dengan bahan utamanya adalah daun mengkudu <em>(</em></span><em><span lang=\"EN-US\" style=\"font-size: 12pt; font-family: \'Times New Roman\', serif; color: #222222; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">Morinda citrifolia)</span></em><span lang=\"EN-US\" style=\"font-size: 12pt; font-family: \'Times New Roman\', serif; color: #222222; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"> yang memiliki khasiat yang sangat beragam dan sangat mudah untuk diperoleh, sehingga kami memiliki ide inovatif unruk mengelola bahan dasar tersebut untuk dijadikan sebuah kuliner yang bernamakan &ldquo;TOKDAMENG (Botok Daun Mengkudu)&rdquo;. </span><span lang=\"EN-US\" style=\"font-size: 12pt; font-family: \'Times New Roman\', serif; color: #222222; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">Karena sejauh ini perkembanagan kegunaan daun mengkudu masih belum diketahui oleh banyak orang. Kegunaan tumbuhan <em>Morinda citrifolia </em>biasanya hanya digunakan pada bagian buahnya saja. Namun nyatanya daun dari tumbuhan tersebut bisa digunakan sebagai bahan makanan pengganti rumput laut.&nbsp;</span><span lang=\"EN-US\" style=\"font-size: 12pt; font-family: \'Times New Roman\', serif; color: #222222; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">Daun mengkudu memiliki kandungan zat zat aktif, salah satunya adalah flavonoid, dimana flavonoid merupakan salah satu jenis antioksidan yang banyak terkandung dalam makanan, seperti coklat. Antioksidan itu sendiri bekerja menangkal radikal bebas dalam tubuh. Jadi TOKDAMENG memiliki manfaat untuk menangkal penyebab berbagai macam penyakit kronis.&nbsp;</span><span lang=\"EN-US\" style=\"font-size: 12pt; font-family: \'Times New Roman\', serif; color: #222222; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">Didalam dunia bisnis, memang wajar apabila terjadi persaingan, banyak sekali inovasi inovasi yang beredar, namun pada inovasi kali ini masih belum banyak yang menggeluti inovasi ini. TOKDAMENG merupakan inovasi yang bisa dikatakan baru didunia kuliner. Hal ini dikarenakan masih sedikit pengetahuan untuk mengelola daun mengkudu agar digunakan menjadi bahan masakan yang layak dikonsumsi oleh banyak orang.</span></p>\r\n<p>&nbsp;</p>\r\n<p class=\"MsoNoSpacing\" style=\"text-align: justify; tab-stops: 14.2pt;\"><span lang=\"EN-US\" style=\"font-size: 12.0pt; font-family: \'Times New Roman\',\'serif\'; letter-spacing: -.05pt;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span></p>','TOKDAMENG Enak |TOKDAMENG Yahut|TOKDAMENG Merakyat|Botok Enak|Botok Spesial|Botok Udang|Botok Daun Mengkudu|Botok Udang Mengkudu|Botok Spesial |Cita Rasa Botok',1,1,'2019-03-12 22:08:52','2019-03-15 00:09:21'),(728,0,'NUGGET JUMBA (JAMUR BANDENG)','2019 17010024059 Febby Olivia Nugrahensy.pdf',NULL,2000000,'<p>Nugget JUMBA (Jamur dan Bandeng) adalah olahan variasi dari nugget&nbsp;dengan bahan utama jamur tiram dan ikan bandeng. Nugget JUMBA dibuat dari jamur tiram dan ikan bandeng karena mempunyai kandungan gizi yang baik dan sehat untuk anak-anak maupun orang dewasa. Agar tidak membosankan nugget JUMBA&nbsp;diberi variasi beberapa rasa yaitu original, sauce barbeque, sauce balado dan sauce keju. Dengan rasa yang enak dan harga yang terjangkau. Kami membuat nugget ini bertujuan menciptakan variasi rasa yang baru, yang tentunya akan disukai oleh para konsumen.&nbsp;&nbsp;</p>\n<p>&nbsp;</p>','Nugget, Jamur, Bandeng',1,1,'2019-03-12 22:16:13','2019-03-14 21:58:24'),(729,0,'PROPOSAL RENCANA USAHA PROGRAM  MAHASISWA WIRAUSAHA UNESA CIGOR HIENAQ','2019 17021254032 RUHANNAH RENANDA AGUSTINAH.pdf',NULL,11000000,'<p class=\"MsoNormal\" style=\"text-align: center;\" align=\"center\"><span style=\"mso-spacerun: \'yes\'; font-family: \'Times New Roman\'; mso-fareast-font-family: SimSun; font-size: 12.0000pt;\">CIGOR HI&rsquo;ENAQ (Cireng Goreng)</span></p>\n<p class=\"MsoNormal\" style=\"text-align: center;\" align=\"center\"><span style=\"mso-spacerun: \'yes\'; font-family: \'Times New Roman\'; mso-fareast-font-family: SimSun; font-size: 12.0000pt;\">Pengolahan Produk Makanan Sebagai Bisnis Inovatif Mahasiswa</span></p>\n<p class=\"MsoNormal\" style=\"text-align: center;\" align=\"center\"><span style=\"mso-spacerun: \'yes\'; font-family: \'Times New Roman\'; mso-fareast-font-family: SimSun; font-size: 12.0000pt;\">Ruhannah Renanda Agustinah, David Cavalera, Abdurrohman Nafis</span></p>\n<p class=\"MsoNormal\" style=\"text-align: center;\" align=\"center\"><span style=\"mso-spacerun: \'yes\'; font-family: \'Times New Roman\'; mso-fareast-font-family: SimSun; font-size: 12.0000pt;\">Harpang Yudha Karyawanto, S.Pd., M.Pd.</span></p>\n<p class=\"MsoNormal\" style=\"text-align: center;\" align=\"center\"><span style=\"mso-spacerun: \'yes\'; font-family: \'Times New Roman\'; mso-fareast-font-family: SimSun; font-size: 12.0000pt;\">&nbsp;</span></p>\n<p class=\"MsoNormal\" style=\"text-align: center;\" align=\"center\"><span style=\"mso-spacerun: \'yes\'; font-family: \'Times New Roman\'; mso-fareast-font-family: SimSun; font-size: 12.0000pt;\">&nbsp;</span></p>\n<p class=\"MsoNormal\" style=\"text-align: justify; text-justify: inter-ideograph;\" align=\"justify\"><span style=\"mso-spacerun: \'yes\'; font-family: \'Times New Roman\'; mso-fareast-font-family: SimSun; font-size: 12.0000pt;\">Cigor Hi&rsquo;enaq merupakan nama produk cireng yang kami buat. Cigor Hi&rsquo;enaq adalah makanan yang berbahan dasar tepung tapioka yang </span><span style=\"font-family: \'Times New Roman\'; color: #222222; letter-spacing: 0pt; font-size: 12pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">mengandung energi sebesar 362 kilokalori, protein 0,5 gram, karbohidrat 86,9 gram, lemak 0,3 gram, kalsium 0 miligram, fosfor 0 miligram, dan zat besi 0 miligram. Selain itu di dala</span><span style=\"font-family: \'Times New Roman\'; color: #222222; letter-spacing: 0pt; font-size: 12pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">m&nbsp;</span><span style=\"font-family: \'Times New Roman\'; color: #222222; letter-spacing: 0pt; font-size: 12pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">t</span><span style=\"font-family: \'Times New Roman\'; color: #222222; letter-spacing: 0pt; font-size: 12pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">epung </span><span style=\"font-family: \'Times New Roman\'; color: #222222; letter-spacing: 0pt; font-size: 12pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">t</span><span style=\"font-family: \'Times New Roman\'; color: #222222; letter-spacing: 0pt; font-size: 12pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">apioka&nbsp;juga terkandung vitamin A sebanyak 0 IU, vitamin B1 0 miligram dan vitamin C 0 miligram.</span><span style=\"font-family: \'Times New Roman\'; color: #222222; letter-spacing: 0pt; font-size: 12pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">&nbsp;Rumusan Masalah dari Program Mahasiswa Wirausaha ini adalah menciptakan peluang bisnis yang inovatif berupa produk cireng dengan berbagai varian rasa. Dalam produk ini para konsumen akan dimanjakan oleh rasa nya yang unik dan lezat. Luaran yang diharapkan dari </span><span style=\"font-family: \'Times New Roman\'; color: #222222; letter-spacing: 0pt; font-size: 12pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">Program Mahasiswa Wirausaha ini terciptanya produk cireng yang bergizi, enak dan menyehatkan dan dengan biaya yang terjangkau.Analisis kelayakan usaha bisa dilihat dari nilai BEP sebesar </span><span style=\"mso-spacerun: \'yes\'; font-family: \'Times New Roman\'; mso-fareast-font-family: SimSun; font-size: 12.0000pt;\">Rp.40.555</span><span style=\"mso-spacerun: \'yes\'; font-family: \'Times New Roman\'; mso-fareast-font-family: SimSun; font-size: 12.0000pt;\">, R/C Ratio pada 8</span><span style=\"mso-spacerun: \'yes\'; font-family: \'Times New Roman\'; mso-fareast-font-family: SimSun; font-size: 12.0000pt;\">5,8</span><span style=\"mso-spacerun: \'yes\'; font-family: \'Times New Roman\'; mso-fareast-font-family: SimSun; font-size: 12.0000pt;\">, ROI sebesar </span><span style=\"mso-spacerun: \'yes\'; font-family: \'Times New Roman\'; mso-fareast-font-family: SimSun; font-size: 12.0000pt;\">Rp. 168.504</span><span style=\"mso-spacerun: \'yes\'; font-family: \'Times New Roman\'; mso-fareast-font-family: SimSun; font-size: 12.0000pt;\">. Metode yang digunakan dalam pelaksanaan dimulai dari struktur organisasi dan tahapan pelaksanaan program mulai dari persiapan produksi, pelaksanaan produksi, pengemasan, promosi, pemasaran dan evaluasi pelaksanaan program.</span></p>','cigor hienaq gurih dan renyah|cireng|goreng|hienaq',1,1,'2019-03-12 22:30:21','2019-03-15 06:13:52'),(730,0,'Proposal PMW \"Ashiaaap Photography\"','2019 17021254053 Della Adisty Pramesita.pdf',NULL,11000000,'<p><span style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',serif; mso-fareast-font-family: Calibri; letter-spacing: -.05pt; mso-ansi-language: EN-US; mso-fareast-language: EN-US; mso-bidi-language: AR-SA;\">Kami adalah mahasiswa yang memimpikan menjadi seorang pengusaha karena bekerja dengan hobby yang diminati merupakan sesuatu hal yang sangat menyenangkan, disisi lain mendapatkan penghasilan dari menjadi pengusaha, kami juga dapat mengasah kreativitas kami. Ketika kami mengetahui bahwa Universitas Negeri Surabaya mengadakan Program Mahasiswa Wirausaha, tentunya kami sangat antusias untuk mengikuti program tersebut. Mengingat sebelumnya kami sudah mendapat bekal dari seminar kewirausahaan yang kami ikuti dan pelatihan kewirausahaan yang diadakan oleh jurusan maupun fakultas, tentunya hal tersebut kami kombinasikan agar menjadi konsep kewirausahaan yang akan kami usung yaitu &ldquo;Ashiaaap Photography&rdquo;. Kami melihat banyak peluang dan kesempatan yang bisa kami manfaatkan untuk mengembangkan konsep kewirausahaan yang sudah kami tuliskan dalam proposal ini. &ldquo;Ashiaaap Photography&rdquo; akan menjadi awal kegiatan kewirausahaan kami agar menjadi wirausahawan yang berkualitas.</span></p>','Studio|Foto|Studio Foto|Fotografi|Ashiaaap|Mahasiswa',2,1,'2019-03-12 22:39:54','2019-03-15 04:33:51'),(731,0,'SAMBAT GUYS ( Dimsum Sayur Rambutan )','2019 17010664137 Dinda Ayu Damayanti.pdf',NULL,6677000,'<p class=\"MsoNoSpacing\" style=\"text-align: justify; line-height: 150%; tab-stops: 14.2pt;\"><span lang=\"EN-ID\" style=\"font-size: 12.0pt; line-height: 150%; font-family: \'Times New Roman\',\'serif\'; letter-spacing: -.05pt; mso-ansi-language: EN-ID;\">&nbsp; &nbsp; Dimsum Sayur Rambutan (SAMBAT GUYS) menjadi awal kegiatan kewirausahaan kami, dilihat dari penggemar makanan tiongkok semakin banyak namun belum ada yang berbahan dasar sayuran.</span></p>\n<p class=\"MsoNoSpacing\" style=\"text-align: justify; line-height: 150%; tab-stops: 14.2pt;\"><span lang=\"EN-ID\" style=\"font-size: 12.0pt; line-height: 150%; font-family: \'Times New Roman\',\'serif\'; letter-spacing: -.05pt; mso-ansi-language: EN-ID;\"><span style=\"mso-tab-count: 1;\">&nbsp;&nbsp;&nbsp;&nbsp; </span>Dimsum masih tidak banyak dijual di pasaran, dimsum hanya dijual di restoran-restoran tertentu, maka dari itu, kami ingin membuat dimsum yang praktis tanpa harus pergi ke restoran, dan kami menginovasikanya dengan sayuran agar lebih sehat, namun tidak mengubah rasa dimsum yang khas dengan udang dan ayam.</span></p>','Dimsum|Udang Rambutan|Dimsum Sayur|Dimsum Sayur Rambutan|Sambat Guys|Dimsum Sambat Guys|Sambat Guys Enak|Dimsum sambat guys enak',1,1,'2019-03-12 22:54:17','2019-03-14 22:24:32'),(732,0,'Notebook Motif Kerawang gayo','2019 17010024004 Hikmah hafidza.pdf',NULL,6747500,'<p><span lang=\"EN-US\" style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; mso-fareast-font-family: Calibri; mso-ansi-language: EN-US; mso-fareast-language: EN-US; mso-bidi-language: AR-SA;\">Usaha ini merupakan usaha pembuatan notebook yang didesain dengan menggunakan motif ukir khas suku Gayo yang disebut dengan Kerawang Gayo.&nbsp;</span><span style=\"font-family: \'Times New Roman\', serif; font-size: 12pt; letter-spacing: -0.05pt;\">Notebook motif kerang gayo ini sebelumnya belum pernah ada dijadikan oleh-oleh khas dari daerah Aceh Tengah dan Bener Meriah&nbsp;</span><span style=\"font-family: \'Times New Roman\', serif; font-size: 12pt; letter-spacing: -0.05pt;\">sehingga besar peluang produk ini akan diminati oleh para wisatawan.&nbsp;</span></p>','Barang|Buku|Notebook|Motif|Gayo',2,1,'2019-03-12 23:00:49','2019-03-15 00:25:40'),(733,0,'NAMONESIA','2019 17020144006 Melinda Setyowati.pdf',NULL,13309500,'<p class=\"MsoNoSpacing\" style=\"text-align: justify; line-height: 150%; tab-stops: 14.2pt;\"><span lang=\"EN-ID\" style=\"font-size: 12.0pt; line-height: 150%; font-family: \'Times New Roman\',\'serif\'; letter-spacing: -.05pt; mso-ansi-language: EN-ID;\">Perpaduan rasa antara nangka muda dan keju mozarella yang disajikan dalam suatu produk makanan siap saji berupa nugget dapat membuka wawasan bahwa nangka muda tidak hanya bisa diolah menjadi sayur gudeg maupun sayur lodeh. Nangka muda yang bertekstur dan berserat seperti daging kami manfaatkan sebagai pengganti daging ayam dalam bahan dasar pembuatan nugget. Untuk memberi daya tarik kepada konsumen, kami memberikan berbagai pantun pada kemasan produk.</span></p>','nugget|nangka muda|pantun',1,1,'2019-03-12 23:01:00','2019-03-20 00:14:02'),(734,0,'PIKPAR','2019 17040254045 Wahyu Krismi Oktavia.pdf',NULL,7000000,'<p>PIKPAR atau Keripik pare merupakan salah satu variasi dari kuliner kering yang terbuat dari pare. Keripik pare diolah dengan tata cara pengolahan yang tradisional khususnya pada proses penghilangan rasa pahit yang ada di sayur pare. Pahit dari sayur pare berasal dari getah yang ada di sayur pare. Sayur pare, walaupun memiliki cita rasa yang pahit namun sayur pare menjadi salah satu sayur yang memiliki beragam manfaat. &nbsp;Manfaat dari sayur pare dapat digunakan baik setelah diolah maupun sebelum diolah. &nbsp;Olahan-olahan dari sayur pare hanya dapat dijumpai dalam beberapa variasi saja seperti ditumis atau direbus. Hal tersebut menyebabkan banyak orang tidak menyukai kripik pare selain karna variasi makanannya yang hanya beberapa namun juga rasa pahit khas dari sayur pare yang sangat sulit untuk dihilangkan. PIKPAR menyajikan keripik pare sama halnya dengan keripik pada umumnya yang memiliki rasa gurih dan tidak pahit. Selain itu keripik pare dari PIKPAR juga memiliki beberapa varian rasa yang mampu menjadi pilihan rasa bagi konsumen yang akan membeli atau mengkonsumsi keripik pare PIKPAR.</p>','Keripik pare|Variasi|Pahit',1,1,'2019-03-12 23:01:20','2019-03-15 04:39:55'),(735,0,'DIM GO-KU','2019 17010024024 Ajar Harnum Novella Ayuminanda.pdf',NULL,7055000,'<p style=\"text-align: justify; line-height: 115%; background: white; margin: 0cm 0cm 15.0pt 0cm;\"><span style=\"mso-ansi-language: EN-US;\">DIM GO-KU </span><span lang=\"IN\"><span style=\"mso-spacerun: yes;\">&nbsp;</span>ini merupakan usaha dimsum dengan 2 versi, yaitu kukus dan goreng yang di padukan dengan saos. <span style=\"color: #333333; background: white;\">Dimsum merupakan salah satu variasi makanan yang mirip sekali dengan siomay. Ada banyak sekali variasi dimsum yang kita kenal, seperti resep dimsum udang, dimsum leng hong kien, resep ceker dimsum, dimsung goreng dan yang lainnya.</span>Dimsum belakangan cukup populer di lingkungan masyarakat. <span style=\"color: #333333;\">Waktu pertama kali masuk Indonesia, Dimsum memang hanya tersedia di Resturant Restaurant yang cukup besar dan berada di kota kota besar saja. Biasanya harga yang dibanderol pun cukup mahal untuk kantong kebanyakan masyrakat Indonesia. Tetapi seiring dengan perkembangan bisnis kuliner yang cukup pesat, Dimsum Ayam, Dimsum Udang, Dimsum Ikan atau variasi yang lain bisa dengan mudah kita dapat dan harganya pun tidak semahal dahulu. Tetapi tetap saja penjual makanan khas Jepang dan Korea ini tidak sebanyak penjual Siomay Bandung dan tidak gampang ditemui, terutama buat teman teman yang tinggal di kota kecil.Selain cita rasanya yang khas dan empuk, kandungan gizi yang terkandung di dalam Resep Dimsum Siomay Ayam memang cukup banyak dan sangat dibutuhkan oleh tubuh kita. Tidak hanya buat anak anak yang lagi dalam masa pertumbuhan, orang dewasa dan orang tua pun akan mendapatkan banyak manfaat dari kandungan gizi, vitamin dan protein dalam makanan ini.</span></span></p>','Dimsum',1,1,'2019-03-12 23:01:46','2019-03-14 20:00:09'),(736,0,'LAMP PAR (Lampu Tidur, Pengusir Nyamuk dan Aromaterapi )','2019 17080574108 Lutfi Indana.pdf',NULL,15000000,'<p>LAMP PAR merupakan produk inovasi gabungan dari Lampu tidur, Pengusir nyamuk dan Aromaterapi. Produk Lamp par ini belum pernah ditemukan dipasaran sebelumnya.</p>','Lamp par|lampu|nyamuk|aromaterapi|tidur|inovasi',4,1,'2019-03-12 23:05:00','2019-03-15 16:47:35'),(737,0,'PENAT\'SLE (Pentol Warna Sehat Rasa Lele)','2019 17080324050 Bela Febriana Nur Pratiwi.pdf',NULL,9505000,'<p>Pentol adalah jajanan yang paling banyak digemari oleh masyarakat khususnya di Indonesia, baik dari anak-anak hingga orang dewasa pasti pernah merasakannya. Namun kebanyakan pentol terbuat dari bahan dasar daging ayam atau daging sapi. Untuk itu kami memunculkan sebuah inovasi baru yaitu PENAT\'SLE.</p>\n<p>PENAT&rsquo;SLE (Pentol Warna Sehat Rasa Lele) merupakan produk dengan inovasi baru yang terbuat dari bahan dasar lele dan disajikan dalam cup dengan saus kacang. Bahan dasar lele yang memiliki nilai gizi tinggi, tentunya tidak akan kalah lezat dan bergizinya dari daging ayam maupun sapi.pewarna yang digunakan pada pentol adalah pewarna dari sayuran. Warna orange didapat dari wortel, hijau dari sawi hijau, dan ungu dari ubi ungu. Harga jual dari PENAT\'SLE juga sangat terjangkau yaitu Rp.5.000 per Cup. Dengan adanya inovasi baru ini PENAT\'SLE tidak hanya memuaskan perut akan tetapi juga memberikan khasiat dari lele dan sayuran yang terkandung didalam pentol.</p>\n<p>&nbsp;</p>\n<p>&nbsp;&nbsp;</p>','PENAT\'SLE|Pentol Warna',1,1,'2019-03-12 23:14:35','2019-03-15 03:03:02'),(738,0,'SEKAWAN','2019 16010664003 Savira Nur Habibah.pdf',NULL,6050000,'<p class=\"MsoListParagraph\" style=\"margin: 0in; margin-bottom: .0001pt; mso-add-space: auto; text-align: justify; text-indent: 28.35pt; mso-pagination: widow-orphan; mso-layout-grid-align: none; text-autospace: none;\"><span lang=\"X-NONE\" style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\';\">Surabaya sebagai kota metropolitan menjadikannya sasaran bagi para pengembang <em>start-up<span style=\"mso-spacerun: yes;\">&nbsp; </span></em>daerah sekitar. Namun hingga saat ini belum<span style=\"mso-spacerun: yes;\">&nbsp; </span>ada ide <em>start-up</em> yang memperhatikan kesehatan mental masyarakat Surabaya spesifiknya Generasi Z Surabaya. Oleh karena itu ide <em>start-up </em>ini yaitu SEKAWAN (Sekumpul Ngadepi Permasalahan), merupakan gagasan yang memperhatikan kesehatan mental generasi z Surabaya<em>.</em><span style=\"mso-spacerun: yes;\">&nbsp; </span>Lebih spesifiknya kesehatan mental yang menjadi fokus kami adalah perilaku kecenderungan untu</span><span style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; mso-ansi-language: EN-US;\">k</span><span lang=\"X-NONE\" style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\';\"> bunuh diri. </span><span lang=\"IN\" style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; mso-ansi-language: IN;\">dimana aplikasi ini akan mempermudah remaja Surabaya mendapatkan edukasi dan fasilitas konseling kelompok mengenai perilaku kecenderungan bunuh diri.</span></p>','PSIKOLOGI|KONSELING',3,1,'2019-03-12 23:16:54','2019-03-14 23:12:17'),(739,0,'RAINBOW CHURROS','2019 17010014004 REGITA DEWI ASMARADANI BUDIARGI.pdf',NULL,6500000,'<p>Rainbow Churros merupakan salah satu makanan yang berbahan utama tepung terigu dengan bentuk menyerupai tanduk domba, yang kami hadirkan dengan inovasi terbaru yakni memiliki bahan dasar buah dan sayur.&nbsp;</p>','NIKMAT|SEHAT|CHURROS|RAINBOW',1,1,'2019-03-12 23:23:21','2019-03-19 22:47:34'),(740,0,'Nugget Sayunara (Sayur (Nisfu,Safitri,Chintia))','2019 17010024027 Nisfu Lailiyah.pdf',NULL,4521000,'<p class=\"MsoNormal\" style=\"text-align: justify; text-indent: 36.0pt;\"><span style=\"font-size: 12.0pt; line-height: 107%; font-family: \'Times New Roman\',serif; mso-bidi-font-family: \'Times New Roman\'; mso-bidi-theme-font: minor-bidi; color: black;\">Nugget Sayur merupakan olahan nugget yang dicampur dengan sayur-sayuran, nugget pada umumnya merupakan olahan yang berbahan dasar daging ayam, sering dikenal dengan makanan siap saji atau fast food. Sayur memiliki banyak manfaat diantaranya yaitu Vit A, Vit C, zat besi, mineral, kalsium, kalium, namun berbagai manfaatnya tidak sebanding dengan banyaknya masyarakat yang gemar makan sayur. Pakar kesehatan menyebutkan jika sayuran dan buah-buahan memang penting bagi kesehatan sekaligus pertumbuhan anak. Sayangnya banyak anak yang malas untuk mengkonsumsinya karena dianggap sebagai makanan yang kurang memiliki rasa dan aroma yang menarik. Anak anak lebih suka makan makanan siap saji yang mereka rasa sangat enak dibanding hanya makan sayur. Oleh karena banyaknya orang yang kurang gemar makan sayur dan lebih suka makan makanan siap saji, maka dengan adanya inovasi nugget sayur oleh (nugget sayunara) diharapkan masyarakat sadar akan kesehatan tubuhnya dengan makan makanan olahan yang mengandung sayur sayuran. Nugget Sayunara adalah solusi bagi masyarakat yang kurang suka makan sayur, dengan makan nugget sayunara kita akan mendapatkan banyak manfaat dari sayur sayuran dan pastinya enak jika dimakan sebagai lauk maupun camilan.</span></p>','Nugget Sayur|Nugget|Makanan unik|Makanan Sehat|Makanan|Sayur',1,1,'2019-03-12 23:23:25','2019-03-14 14:40:31'),(741,0,'DONT PEA ( Donat penenang Autis )','2019 17010044093 Dormian kasriwati siregar.pdf',NULL,6109750,'<p><span style=\"font-family: \'Times New Roman\',\'serif\';\">DONT PEA merupakan jajanan donat yang dikembangkan dengan olahan gluten free serta ekstra daun pegagan yang mengandung senyawa sedatif yang bersifat menenagkan, Autis merupakan gangguan yang kompleks dan berat yang dialami oleh anak berkebutuhan khusus serta gluten merupakan pantangan makanan bagi anak autis sehingga anak autis harus bebas gluten dan juga memerlukan zat penenang yang mampu mengurangi gejala hiperaktifitas saat tantrum, sehingga DONT PEA merupakan makanan sehat yang cocok bagi anak autis, daun pegagan yang dikenal dengan segudang manfaat sangat baik bagi semua kalangan masyarakat,&nbsp; dipasarkan dengan harga terjangkau pada lingkup kalangan masyarakat luas seperti kantin-kantin sekolah ,toko-toko , pusat-pusat terapi dan diyakini kelak akan memiliki kerjasama dengan berbagai lembaga-lembaga khusus dan dunia kesehatan.&nbsp;</span></p>\r\n<p>&nbsp;</p>','Donat|Autis|Gluten free|Ekstra pegagan',1,1,'2019-03-12 23:38:14','2019-03-15 05:03:10'),(742,0,'BATOFU (BAtagor TOngkol toFU)','2019 17010714072 MELINDA ELFINA RAHMAWATY.pdf',NULL,7547000,'<p class=\"MsoNoSpacing\" style=\"text-align: justify; line-height: 115%; tab-stops: 14.2pt;\"><strong style=\"mso-bidi-font-weight: normal;\"><span style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; letter-spacing: -.05pt; mso-ansi-language: IN;\">&nbsp;</span></strong></p>\r\n<p class=\"MsoNoSpacing\" style=\"text-align: justify; line-height: 115%; tab-stops: 14.2pt;\"><span style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; letter-spacing: -.05pt; mso-ansi-language: IN;\"><span style=\"mso-tab-count: 1;\">&nbsp;&nbsp;&nbsp;&nbsp; </span>Indonesia adalah negara yang memiliki banyak destinasi wisata, dengan berbagai macam jajanan di jalanan tempat wisata tersebut. Salah satunya jajan batagor, yang mungkin tidak asing kembali bagi kita. Inovasi usaha kuliner yang ingin kami wujudkan, serta agar mendapatkan bimbingan lebih lanjut dari program PMW yaitu usaha di bidang barang berupa makanan, yang akan memiliki prospek baik sampai masa yang akan datang yang berjudul BATOFU (Batagor Tongkol Tofu) yaitu olahan jajan Batagor<span style=\"mso-spacerun: yes;\">&nbsp; </span>tahu dan batagor dari ikan tongkol yang dibalut kulit pangsit sehingga Batagor modern ini<span style=\"mso-spacerun: yes;\">&nbsp; </span>menyajikan tampilan modern dan praktis. </span></p>\r\n<p class=\"MsoNoSpacing\" style=\"text-align: justify; line-height: 115%; tab-stops: 14.2pt;\"><span style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; letter-spacing: -.05pt; mso-ansi-language: IN;\"><span style=\"mso-tab-count: 1;\">&nbsp;&nbsp;&nbsp;&nbsp; </span>Rasa dari Batagor<span style=\"mso-spacerun: yes;\">&nbsp; </span>tahu dan batagor dari ikan tongkol yang dibalut kulit pangsit akan lebih enak dan akan kami inovasi dengan beberapa level kepedasan saus spesial dari produk kami. yang mana kami menciptakan makanan ini<span style=\"mso-spacerun: yes;\">&nbsp; </span>bertujuan membuat inovasi makanan Batagor<span style=\"mso-spacerun: yes;\">&nbsp; </span>ini untuk mempermudah kebiasaan masyarakat yang terus konsumtif terhadap jajanan yang kurang sehat, menjadi beralih ke Batagor tahu dan batagor ikan tongkol yang mempunyai kandungan gizi yang terdapat pada ikan tongkol, protein dari tahu serta vit c dari cabe maupun tomat itu saos spesial batagor kami. </span></p>\r\n<p class=\"MsoNoSpacing\" style=\"text-align: justify; line-height: 115%; tab-stops: 14.2pt;\"><span style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; letter-spacing: -.05pt; mso-ansi-language: IN;\"><span style=\"mso-tab-count: 1;\">&nbsp;&nbsp;&nbsp;&nbsp; </span>BATOFU (Batagor Tongkol Tofu) merupakan jenis makanan inovasi baru dan belum memiliki daya saing, maka hal itu menjadi keunggulan tersendiri untuk prospek usaha kedepan. Untuk prospek pemasaran produk BATOFU (Batagor Tongkol Tofu) ini juga dapat disajikan sebagai kuliner atau Coffe break di<span style=\"mso-spacerun: yes;\">&nbsp; </span>tempat-tempat rapat ( meeting ), hotel, serta dapat dipasarkan di kegiatan-kegiatan kota Surabaya dan Pusat oleh-oleh.</span></p>\r\n<p class=\"MsoNoSpacing\" style=\"text-align: justify; line-height: 115%; tab-stops: 14.2pt;\"><span style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; letter-spacing: -.05pt; mso-ansi-language: IN;\">&nbsp;</span></p>\r\n<p class=\"MsoNoSpacing\" style=\"text-align: justify; line-height: 115%; tab-stops: 14.2pt;\"><strong style=\"mso-bidi-font-weight: normal;\"><span style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; letter-spacing: -.05pt; mso-ansi-language: IN;\">Visi Misi Usaha </span></strong></p>\r\n<p class=\"MsoNoSpacing\" style=\"text-align: justify; line-height: 115%; tab-stops: 14.2pt;\"><span style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; letter-spacing: -.05pt; mso-ansi-language: IN;\">Visi usaha kami yakni memperkenalkan cita rasa baru, serta menjaga kualitas produk makanan daerah indonesia yaitu Batagor menjadi 2 cita rasa baru yaitu Batagor berbahan dasar tongkol di balut kulit lumpia dan batagor asli yang berbahan dasar tahu yang menjadi identitas batagor jajanan di pinggir jalan di daerah indonesia. dengan memberikan inovasi baru. Sehingga mampu menjadi makanan yang berkualitas, menarik, dan diterima oleh kalangan masyarakat. </span></p>\r\n<p class=\"MsoNoSpacing\" style=\"text-align: justify; line-height: 115%; tab-stops: 14.2pt;\"><span style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; letter-spacing: -.05pt; mso-ansi-language: IN;\"><span style=\"mso-spacerun: yes;\">&nbsp;</span></span></p>\r\n<p class=\"MsoNoSpacing\" style=\"text-align: justify; line-height: 115%; tab-stops: 14.2pt;\"><strong style=\"mso-bidi-font-weight: normal;\"><span style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; letter-spacing: -.05pt; mso-ansi-language: IN;\">Misi Usaha</span></strong></p>\r\n<p class=\"MsoNoSpacing\" style=\"text-align: justify; line-height: 115%; tab-stops: 14.2pt;\"><span style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; letter-spacing: -.05pt; mso-ansi-language: IN;\">- Memberikan kepuasan pada pelanggan </span></p>\r\n<p class=\"MsoNoSpacing\" style=\"text-align: justify; line-height: 115%; tab-stops: 14.2pt;\"><span style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; letter-spacing: -.05pt; mso-ansi-language: IN;\">- Memperkenalkan Batagor baru dengan menjaga citra rasa </span></p>\r\n<p class=\"MsoNoSpacing\" style=\"text-align: justify; line-height: 115%; tab-stops: 14.2pt;\"><span style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; letter-spacing: -.05pt; mso-ansi-language: IN;\">- Mencari keuntungan dari modal yang kecil dan<span style=\"mso-spacerun: yes;\">&nbsp; </span>Mencari peluang usaha di tengah di era 4.0</span></p>','inovatif|kreatif|makanan|upgrade|batagor|tongkol|kuliner|modern|unik|menarik|enak',1,1,'2019-03-12 23:40:51','2019-03-15 03:27:50'),(743,0,'Natty Face Mask (Natural Beauty Mask)','2019 16010684049 Putri Diana Sofiya Hidayah.pdf',NULL,14555000,'<p class=\"MsoListParagraph\" style=\"margin-left: 46.35pt; line-height: 115%; tab-stops: 1.0cm; mso-layout-grid-align: none; text-autospace: none;\"><em style=\"mso-bidi-font-style: normal;\"><span style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; mso-bidi-font-weight: bold;\">Natty Face Mask</span></em><span style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; mso-bidi-font-weight: bold;\"> merupakan masker <em style=\"mso-bidi-font-style: normal;\">home made </em>kekinian yang terbuat dari tumbuh-tumbuhan alami </span><span style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\';\">seperti akar wangi, seledri, kunyit, dan gandum. Bahan-bahan tersebut sengaja dipilih karena memiliki banyak manfaat yang baik untuk meremajakan kulit wajah. Seledri banyak mengandung vitamin yang dapat mengatasi wajah berminyak, mencegah penuaan, mencerahkan wajah, mengatasi jerawat. Gandum <span style=\"background: white;\">mengandung nutrisi seperti <em style=\"mso-bidi-font-style: normal;\">selenium</em>, Vitamin E, dan <em style=\"mso-bidi-font-style: normal;\">zinc</em> sangat baik untuk menjaga kelembapan kulit, mengatasi jerawat</span>. Kunyit mengandung sebuah senyawa <em style=\"mso-bidi-font-style: normal;\">diarilheptanoid</em> sekitar 3-4% dan yang terdiri dari <em style=\"mso-bidi-font-style: normal;\">Curcumin, dihidrokurkumin, desmetoksikurkumin </em>dan<em style=\"mso-bidi-font-style: normal;\"> bisdesmetoksikurkumin </em>yang berguna untuk mengusir jerawat, menyamarkan bekas jerawat. Akar wangi sebagai obat mempercepat penyembuhan luka dimana semua bahan tersebut bisa digunakan sebagai bahan kosmetika. </span></p>\n<p class=\"MsoListParagraph\" style=\"margin-left: 46.35pt; line-height: 115%; tab-stops: 1.0cm; mso-layout-grid-align: none; text-autospace: none;\"><span style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; mso-bidi-font-weight: bold;\"><span style=\"mso-tab-count: 1;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span><em style=\"mso-bidi-font-style: normal;\">Natty Face Mask</em> diharapkan mampu mengambil peluang usaha masker alami dipasaran karena berani tampil beda dengan variasi kemasan dan packaging yang lucu serta unik. Harga nya juga relative murah dengan banyaknya manfaat yang diberikan. Proses pembuatannya dengan teknologi modern sederhana yang tetap mempertahankan keutuhan bahan utama. Oleh karena itu, <em style=\"mso-bidi-font-style: normal;\">Natty Face Mask</em> merupakan paket komplit perawatan wajah alami tanpa perlu khawatir terkena efek samping jangka panjang.</span></p>','Kecantikan |Masker|Natural Beauty',4,1,'2019-03-12 23:43:47','2019-03-15 03:06:10'),(744,0,'PonBow Klepon Rainbow','2019 17010014062 Dewi Nur Anggraini.pdf',NULL,3887000,'<p class=\"MsoNormal\"><span style=\"font-family: \'Verdana\',\'sans-serif\'; color: black; background: white;\">Pada umumnya Klepon yang sering kita temui berbentuk bulat, berwarna hijau, berbalut parutan kelapa dengan gula merah sebagai isinya. Di era milenial dan kekinian saat ini, klepon jarang menarik perhatian. Akan tetapi, kiniklepon akanhadir dengan inovasi baru, dengan banyak varian warna dan aneka varian rasa, dan makanan ini akan disebut PonBow (Klepon Rainbow). Makanan ini diharapkan mampu menarik perhatian masyarakat karena keunikannya dan perpaduan antara makanan tradisional dan makanan modern.</span></p>','PonBow|Klepon |Rainbow|Klepon Rainbow',1,1,'2019-03-12 23:48:48','2019-03-18 01:03:02'),(745,0,'NUKLIR (Nugget Daun Kenikir)','2019 17040254044 Novita Wahyu Pratama.pdf',NULL,9000000,'<p>&nbsp;</p>\r\n<p style=\"margin: 0px; text-align: justify; line-height: 115%;\"><span lang=\"EN-US\" style=\"margin: 0px; line-height: 115%; letter-spacing: -0.05pt; font-family: \'Times New Roman\',serif; font-size: 12pt;\">Usaha ini adalah usaha yang bergerak dibidang barang yang berbentuk olahan makanan. Adanya usaha ini dilatarbelakangi adanya kebutuhan akan makanan ringan yang semakin meningkat, namun semakin sulit ditemui makanan ringan cepat saji yang sehat. Dari adanya fakta tersebut tim kami memiliki ide untuk membuat olahan makanan ringan cepat saji yang sehat dengan mencampur bahan daun kenikir karena pada umumnya daun kenikir kurang diminati sehingga tim kami berinisiatif untuk mengolahnya menjadi olahan makanan ringan yang menarik dan cepat penyajiannya. Olahan tersebut oleh tim kami diberi nama NUKLIR yaitu singkatan dari Nugget Daun Kenikir, dan juga dicampur dengan ikan tenggiri sehingga memiliki kandungan gizi yang baik dan juga dapat menjadi makanan sehat. Sasaran usaha kami adalah mahasiswa Universitas Negeri Surabaya Kampus Ketintang yang umumnya membutuhkan jajanan seperti olahan yang kami buat, selain itu masyarakat juga mejadi sasaran target usaha kami. Jika usaha kami ini berkembang maka kami akan menginovasi produk olahan kami menjadi lebih menarik dengan kualitas rasa dan bahan yang terus konsisten. Tantangan dari usaha ini adalah apabila muncul produk-produk serupa dipasaran ataupun secara online. </span></p>\r\n<p>&nbsp;</p>','Nugget|Daun Kenikir|Makanan Sehat',1,1,'2019-03-13 00:00:10','2019-03-15 00:00:18'),(746,0,'ASW Studio - Custom Painting Jeans (Jasa Lukis Jeans)','2019 16020124055 Romzi Akram Al Naufal.pdf',NULL,9447000,'<p class=\"MsoNormal\" style=\"text-align: justify; mso-layout-grid-align: none; text-autospace: none; margin: 0in 0in .0001pt 13.5pt;\"><span style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\';\">ASW Studio &ndash; Custom Painting Jeans (Jasa Lukis Jeans) </span></p>\n<p class=\"MsoNormal\" style=\"text-align: justify; text-indent: 31.5pt; mso-layout-grid-align: none; text-autospace: none; margin: 0in 0in .0001pt 13.5pt;\"><span style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\';\">Kegiatan usaha ini menawarkan layanan jasa lukis pada jaket jeans, mengemas jeans bekas yang mungkin tampak lusuh menjadi lebih menarik dan fashionable dengan motif lukisan sesuai permintaan customer. Jasa kami menggunakan kualitas cat yang terbaik, awet, tahan lama, dan tidak mudah rusak ketika dicuci. Dan menawarkan harga terjangkau dengan kualitas detail gambar yang menjadi perhatian utama kami. Kami juga memberikan free-ongkir untuk pengiriman produk pasca pengerjaan khusus area Surabaya.</span></p>','ASW Studio|Custom Painting Jeans|Jasa Lukis Jeans|PMW 2019|Unesa|FBS |Seni Rupa Unesa',2,1,'2019-03-13 00:12:45','2019-03-19 02:01:23'),(747,0,'SUGOR Kalenial','2019 17020104049 Mahardika Pribadi.pdf',NULL,12375000,'<p><span lang=\"IN\" style=\"font-size: 12.0pt; mso-bidi-font-size: 11.0pt; line-height: 115%; font-family: \'Times New Roman\',serif; mso-fareast-font-family: Calibri; mso-ansi-language: IN; mso-fareast-language: EN-US; mso-bidi-language: AR-SA;\">Pada proyek usaha kami kali ini kami mengusulkan produk yang bernama &ldquo;SUGOR Kalenial ( Susu Goreng Pelengkap Menu 4 sehat 5 sempurna kaum milenial)&rdquo; sebagai usaha yang akan kami pasarkan. Kami memilih produk ini karena produk ini mudah dibuat dan mempunyai gizi yang tinggi. Sugor berbentuk seperti tahu biasa tetapi menggunakan susu sebagai bahan dasarnya</span><span lang=\"EN-US\" style=\"font-size: 12.0pt; mso-bidi-font-size: 11.0pt; line-height: 115%; font-family: \'Times New Roman\',serif; mso-fareast-font-family: Calibri; mso-ansi-language: EN-US; mso-fareast-language: EN-US; mso-bidi-language: AR-SA;\">, serta dibalut dengan selai rasa kekinian yang tidak asing bagi kaum milenial.</span></p>','Sugor|Kalenial',1,1,'2019-03-13 00:13:06','2019-03-19 20:22:50'),(748,0,'BAGOPE (Bakso Goreng Tempe)','2019 17010714083 Trisha Ika Novitasari.pdf',NULL,5000000,'<p class=\"MsoNoSpacing\" style=\"text-align: justify; line-height: 150%; tab-stops: 14.2pt;\"><span lang=\"IN\" style=\"font-size: 12.0pt; mso-bidi-font-size: 10.0pt; line-height: 150%; font-family: \'Times New Roman\',\'serif\'; letter-spacing: -.05pt; mso-ansi-language: IN;\">Inovasi usaha yang ingin kami wujudkan serta mendapatkan bimbingan lebih lanjut dari program PMW yaitu usaha di bidang barang makanan, yang akan memiliki prospek baik sampai masa yang akan mendatang yang berjudul BAGOPE (Bakso Goreng Tempe) yaitu olahan tempe yang dicampuri dengan daging ayam dan tepung panir. Rasa dari Bakso Goreng Tempe akan lebih nikmat kami padukan dengan saos dan mayonais.Kami menyediakan BAGOPE (Bakso Goreng Tempe) dua variasi yaitu original dan isi keju.Tujuan kami menciptakan makanan ini yaitu untuk mengalihkan kebiasaan masyarakat yang terus konsumtif terhadap fast food, menjadi beralih ke makanan yang mempunyai kandungan gizi yang terdapat pada tempe itu sendiri. Latar belakang terciptanya makanan ini karena banyak nya pemasaran tempe dengan pengolahan masyarakat yang kurang sehat, dengan adanya inovasi ini, kami berharap masyarakat yang saat ini terbiasa dengan makanan siap saji dan praktis beralih ke produk makanan yang kami olah ini dengan kemasan yang menarik, praktis, enak, dan tidak mengandung pengawet, tentunya dengan harga yang terjangkau.</span></p>','makanan|bakso|tempe|lezat|enak|murah|bergizi',1,1,'2019-03-13 00:26:17','2019-03-14 17:24:04'),(749,0,'DASI in GLASS (DAwet Siwalan di dalam gelas)','2019 17010644002 Susilo Sudarsono.pdf',NULL,14310000,'<p>Buah siwalan adalah buah yang menyegarkan bagi tenggorokan maupun bagi tubuh. Bentuk buahnya yang bening seperti kolang kaling dan dagingnya yang lembut seperti kelapa muda sangat cocok jika buah siwalan ini menjadi minuman dikala matahari menyengat tubuh, selain menyegarkan tubuh, khasiat siwalan dapat digunakan sebagai isotonic dalam tubuh.&nbsp;</p>\n<p>Namun entah kenapa masyarakat begitu kurang antusias mengolah buah siwalan yang penuh manfaat inilah, karena merasa terpanggil untuk memberikan perubahan bagi indonesia, maka dasi in glass muncul sebagai solusi yang kreatif inofatif efektif dan menghasilkan. Melihat peluang di daerah Surabaya yang umumnya bersuhu panas adalah suasana yang cocok untuk memperdagangkan produk kami.</p>\n<p>Sudah sepantasnya dasi in glass minuman segar dawet siwalan adalah perpaduan yang lengkap menghilangkan rasa dahaga, dan pmw adalah salah satu dari ribuan jalan yang dapat ditempuh untuk mengembangkan produk inofatif kami tak lain adalah dasi in glass</p>','Dasi in glass, buah Siwalan|DASI in GLASS|Buah Siwalan',1,1,'2019-03-13 00:28:08','2019-03-15 02:59:27'),(750,0,'DGost (DGetuk Gulung Obst)','2019 17010644003 Felia Nailusy Syifa\'.pdf',NULL,5646000,'<p><span style=\"font-size: 12.0pt; mso-bidi-font-size: 10.0pt; font-family: \'Times New Roman\',serif; mso-fareast-font-family: \'Times New Roman\'; mso-bidi-font-family: Arial; mso-ansi-language: EN-US; mso-fareast-language: EN-US; mso-bidi-language: AR-SA;\">Getuk dari zaman ke zaman tetap sama yaitu singkong yang direbus dengan ditambahi beberapa warna dan rasa dan disajikan dengan taburan kelapa parut diatasnya. Kemudian disini saya akan membuat getuk gulung dengan isian selai buah asli sehingga seseorang jika merasakan D&rsquo;Gost ini akan merasakan sensasi makan getuk dengan rasa yang asli tidak hanya warna saja.</span></p>','Gethuk|Gethuk buah',1,1,'2019-03-13 00:36:45','2019-03-15 05:39:10'),(751,0,'DUYUNG KAMU (Dumpling Ayam,  Udang, Jamur)','2019 17010664081 Anisah Siwi Anggreni.pdf',NULL,4562500,'<p>Keunikan dari produk yang kami produksi adalah isian dumpling yang&nbsp; biasanya hanya berisi daging ayam dan udang olahan tetapi produk kami ini memiliki keunikan yang berbeda yaitu dengan olahan daging ayam dan udang dengan tambahan jamur olahan pedas berbagai level dan terdapat saos madu. Keunggulan dari produk kami adalah pengolahan olahan isi dumpling yang ditambah dengan jamur dengan berbagai level kepedesan dan madu sebagai saos. Jadi produk ini terdapat paduan rasa pedas dan manis. Manfaat bagi masyarakat adalah memberikan suatu inovasi baru dalam pengolahan dumpling yang akan memberikan sensasi baru dengan rasa perpaduan pedas dan manis. Produk kami akan bersaing di dunia pemasaran dengan kondisi pesaingan yang masih rendah karena olahan dumpling ini belum ada yang memproduksi dumpling dengan perpaduan pedas jamur dan manis saos madu. Prospek produk kami diharapkan mampu menjadi pesaing yang&nbsp; berat di kalangan produk produk kuliner lainnya.</p>','Dumpling Ayam|Dumpling Udang|Dumpling Jamur|Dumpling Isi|Spicy Dumpling|Honey Dumpling|Dumpling Kukus',1,1,'2019-03-13 00:37:02','2019-03-15 00:00:04'),(752,0,'SERAT (Aksesoris Rajut)','2019 17010644035 Novita Riwidiyanti.pdf',NULL,8297000,'<p>Usaha Aksesoris Rajut ini adalah berawal dari keinginan untuk menambah kreativitas dalam pembuatannya dengan berbagai bentuk dan pola yang digunakan. Selain itu, usaha ini juga dimanfaatkan untuk mendapakan pengalaman dan mengembangkan bakat. Dengan adanya pendampingan usaha melalui PMW ini, diharapkan usaha Aksesoris Rajut dapat menambah rasa cinta seseorang terhadap benda-benda serta kerajinan tangan.</p>','usaha|aksesoris|rajut',4,1,'2019-03-13 00:38:19','2019-03-19 00:09:13'),(753,0,'KECEBONG ANYUT (Crazy Choco Brownies Kacang Kapri Yahut)','2019 17010714005 Restu Dwi Apriliani.pdf',NULL,6500000,'<p>&nbsp;</p>\r\n<p style=\"margin: 0px; text-align: justify; line-height: 115%;\"><span lang=\"EN-US\" style=\"margin: 0px; line-height: 115%; font-family: \'Times New Roman\',serif; font-size: 12pt;\">Pada era globalisasi ini, kita tidak banyak menemukan olahan makanan modern yang di olah dengan menggunakan kolaborasi hasil alam, maka dari itu tim membuat usaha bidang kuliner yang di olah dengan menggunakan salah satu hasil alam penduduk lokal daerah di sekitar Surabaya. Hasil alam yang di maksud adalah Kacang Kapri Tanah. Petani kacang kapri tanah biasanya hanya menjual hasil panen secara langsung tanpa pengolahan sehingga penghasilan yang mereka dapat kurang memuaskan, padahal mereka memproduksi kacang kapri cukup melimpah bahkan sampai pada ranah ekspor ke berbagai negara. Latar belakang tim mengangkat usaha ini karena bersifat original dan kurang adanya pengelolaan lebih dalam olahan kacang kapri. Selain itu, brownies merupakan makanan yang terkenal dan banyak diketahui oleh semua lapisan masyarakat. Dalam usaha ini, tim mengkolaborasikan pembuatan brownies dengan kacang kapri, dimana kacang kapri digunakan sebagai bahan utama pengganti karbohidrat dalam kandungan brownies. Usaha ini kami beri nama KECEBONG ANYUT (Crazy Choco Brownies Kacang Kapri Yahut).</span></p>\r\n<p>&nbsp;</p>\r\n<p style=\"margin: 0px; text-align: justify; line-height: 115%;\"><span lang=\"EN-US\" style=\"margin: 0px; line-height: 115%; font-family: \'Times New Roman\',serif; font-size: 12pt;\">KECEBONG ANYUT (Crazy Choco Brownies Kacang Kapri Yahut) adalah usaha yang akan di Produksi&nbsp; di Daerah Jl. Wonorejo IV No. 151-A Surabaya. Dengan bahan baku utama Kacang Kapri yang memiliki nilai gizi tinggi dan manfaat yang baik bagi tubuh. Selain itu, terdapat perbedaan yang cukup signifikan dari brownies yang ada dipasaran dengan brownies yang tim kami buat. salah satu perbedaannya terletak pada bahan baku dalam mengolahnya dengan menggunakan kacang kapri sebagai campuran dalam adonan brownies tersebut. Dengan adanya Brownies Kacang Kapri di daerah Surabaya, maka tim menjadi salah satu innovator dalam mengolah kacang kapri menjadi brownies.</span></p>','enter |enter',1,1,'2019-03-13 00:50:30','2019-03-19 19:54:33'),(754,0,'SROLL - BI (Snack Roll Binahong)','2019 17040254106 Mita Amalia Rosa.pdf',NULL,5000000,'<p>Makanan ringan khas yang berasal dari Indonesia terutama daerah Jawa Timur yaitu<em> Japit Gulung</em>&nbsp;saat ini mulai terlupakan, bahkan jajanan itu hanya di buat pada acara besar seperti&nbsp;hajatan, nikahan, dll. Kemudian selain permasalahan diatas&nbsp;kami juga melihat banyak populasi Daun Binahong dimana masyarakat Indonesia jarang mengkonsumsinya,&nbsp;sedikit juga tanaman ini ada yang membudidayakan, selain itu daun inipun jika di campurkan dengan bahan lain tidak terasa pahit. Oleh karena itu kami membuat inovasi snack dengan nama produk <strong>SROLL - BI</strong> (Snack Roll Binahong), dimana snack ini&nbsp;ditambah bahan dasar&nbsp;binahong, sudah tidak diragukan lagi bahwa khasiat daun binahong ini diantarannya yaitu mengandung Flavonoid yang bagus untuk&nbsp;penderita kanker, Alkaloid untuk membasmi radikal bebas, Saponin untuk pembentukan kolagen yang baik bagi kulit, minyak siri untuk melancarkan metabolisme, dan manfaat yang lainnya. Pada saat kita melakukan percobaan membuat snack ini ternyata citarasa yang dihasilkan sangat enak, manis gurih, dan renyah, kemudian kita juga sudah melakuakn <em>tester </em>kepada bayak orang dan respon mereka juga bagus. Produk inipun merupakan produk pertama yang dikombinasikan dengan manfat Daun Binahong tanpa campuran sedikitpun bahan berbahaya sehingga aman dikonsumsi oleh berbagai kalangan. Kami ingin meningkatkan minat masyarakat terhadap produk lokal tanpa meninggalkan cita rasa dari <em>Japit Gulung</em> pada umumnya. diharapkan juga masyarakat dapat selektif dalam memilih jajanan atau camilan yang setidaknya memiliki manfaat bagi tubuhnya, m<span style=\"font-family: Times New Roman; font-size: medium;\">aka</span> dari itu kelompok kami ingin melakukan banyak pengembangan usaha produk Sroll - Bi ini.</p>','makanan|Snack|Binahong|manfaat|variasi|enak|crispy|renyah|menarik',1,1,'2019-03-13 00:50:35','2019-03-14 19:43:42'),(755,0,'ROBI SI COGAN (Roti Tepung Biji Alpukat isi Coklat Oreo Elegan)','2019 17010644029 PUTRI AYU WANDIRA.pdf',NULL,7321000,'<p class=\"MsoNormal\" style=\"text-align: center;\" align=\"center\"><strong style=\"mso-bidi-font-weight: normal;\"><span style=\"font-size: 12.0pt; line-height: 107%; font-family: \'Times New Roman\',\'serif\';\">ROBI SI COGAN (Roti Tepung Biji Alpukat isi Coklat Oreo Elegan)</span></strong></p>\n<p class=\"MsoNormal\" style=\"text-align: justify; text-indent: 36.0pt;\"><span style=\"font-size: 12.0pt; line-height: 107%; font-family: \'Times New Roman\',\'serif\';\">Robi si Cogan merupakan sebuah roti yang dibuat dengan menggunakan tepung olahan dari biji alpukat dan tepung terigu sebagai tambahan. Biji alpukat memiliki banyak manfaat bagi kesehatan tubuh diantaranya dapat menurunkan kadar kolestrol, mengatasi gangguan pencernaan, membantu menjaga daya tahan tubuh, mencegah kanker dan anti penuaan. Rumusan Masalah dalam Program Mahasiswa Wirausaha (PMW) <span style=\"mso-spacerun: yes;\">&nbsp;</span>ini adalah menciptakan peluang bisnis yang inovatif berupa kue robi si cogan dan memanfaatkan biji alpukat menjadi camilan yang menyehatkan dengan harga terjangkau. Diharapkan dari PMW ini tercipta produk robi si cogan yang bergizi, lezat, dan menyehatkan serta dapat diterima dikalangan masyarakat. PMW ini berguna dalam menumbuhkan jiwa enterpreneurship.</span></p>','Biji Alpukat, Roti, Bisnis Inovatif.|Biji|Biji Alpukat|Roti|Bisnis Inovatif',1,1,'2019-03-13 00:51:25','2019-03-15 06:26:37'),(756,0,'Coomis','2019 17010024087 Prayoga Dearwansah.pdf',NULL,5000000,'<p class=\"MsoNoSpacing\" style=\"text-align: justify; line-height: 150%; tab-stops: 14.2pt 3.0cm 92.15pt 99.25pt 106.35pt;\"><span style=\"font-size: 12.0pt; line-height: 150%; font-family: \'Times New Roman\',\'serif\'; letter-spacing: -.05pt; mso-ansi-language: IN;\">Nama Usaha<span style=\"mso-tab-count: 1;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span><span style=\"mso-tab-count: 1;\">&nbsp;&nbsp; </span><span style=\"mso-tab-count: 1;\">&nbsp; </span>: </span><span lang=\"EN-ID\" style=\"font-size: 12.0pt; line-height: 150%; font-family: \'Times New Roman\',\'serif\'; letter-spacing: -.05pt; mso-ansi-language: EN-ID;\">Coomis (cookies dari kulit manggis)</span></p>\n<p class=\"MsoNoSpacing\" style=\"text-align: justify; line-height: 150%; tab-stops: 14.2pt 3.0cm 92.15pt 99.25pt 106.35pt;\"><span style=\"font-size: 12.0pt; line-