12.0pt; line-height: 150%; font-family: \'Times New Roman\',\'serif\'; letter-spacing: -.05pt; mso-ansi-language: EN-ID;\">Prayoga Dearwansah</span></p>\n<p class=\"MsoNoSpacing\" style=\"text-align: justify; line-height: 150%; tab-stops: 14.2pt 3.0cm 92.15pt 99.25pt 106.35pt;\"><span style=\"font-size: 12.0pt; line-height: 150%; font-family: \'Times New Roman\',\'serif\'; letter-spacing: -.05pt; mso-ansi-language: IN;\">Email/No Telepon<span style=\"mso-tab-count: 1;\">&nbsp; </span><span style=\"mso-tab-count: 1;\">&nbsp; </span>:<span style=\"mso-tab-count: 1;\">&nbsp; </span></span><span lang=\"EN-ID\" style=\"font-size: 12.0pt; line-height: 150%; font-family: \'Times New Roman\',\'serif\'; letter-spacing: -.05pt; mso-ansi-language: EN-ID;\">prayogadearwansah99@gmail.com/085806628730</span></p>','makanan,cookies,kulitmanggis',1,1,'2019-03-13 00:53:07','2019-03-15 01:07:15'),(757,0,'SKY blend (Susu Kedelai Yummy)','2019 17020084019 Anggrita Nurfaiziyah.pdf',NULL,6855000,'<p><span style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; mso-fareast-font-family: Calibri; mso-ansi-language: IN; mso-fareast-language: EN-US; mso-bidi-language: AR-SA;\">SKY Blend </span><span lang=\"EN-US\" style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; mso-fareast-font-family: Calibri; mso-ansi-language: EN-US; mso-fareast-language: EN-US; mso-bidi-language: AR-SA;\">(susukedelai yummy) </span><span style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; mso-fareast-font-family: Calibri; mso-ansi-language: IN; mso-fareast-language: EN-US; mso-bidi-language: AR-SA;\">adalah nama produk </span><span lang=\"EN-US\" style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; mso-fareast-font-family: Calibri; mso-ansi-language: EN-US; mso-fareast-language: EN-US; mso-bidi-language: AR-SA;\">kami. Padaumumnya, minuman blend berbahandasarcoklat</span> <span lang=\"EN-US\" style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; mso-fareast-font-family: Calibri; mso-ansi-language: EN-US; mso-fareast-language: EN-US; mso-bidi-language: AR-SA;\">dan</span> <span lang=\"EN-US\" style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; mso-fareast-font-family: Calibri; mso-ansi-language: EN-US; mso-fareast-language: EN-US; mso-bidi-language: AR-SA;\">susu</span><span style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; mso-fareast-font-family: Calibri; mso-ansi-language: IN; mso-fareast-language: EN-US; mso-bidi-language: AR-SA;\"> namun kami membuat inovasi yang berbeda yaitu dengan menggunakan bahan dasar kedelai murni yang diolah secara alami. </span><span lang=\"EN-US\" style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; mso-fareast-font-family: Calibri; mso-ansi-language: EN-US; mso-fareast-language: EN-US; mso-bidi-language: AR-SA;\">Tidakhan</span><span lang=\"EN-US\" style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; mso-fareast-font-family: Calibri; mso-ansi-language: EN-US; mso-fareast-language: EN-US; mso-bidi-language: AR-SA;\">ya itu, produk</span> <span lang=\"EN-US\" style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; mso-fareast-font-family: Calibri; mso-ansi-language: EN-US; mso-fareast-language: EN-US; mso-bidi-language: AR-SA;\">ini</span> <span style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; mso-fareast-font-family: Calibri; mso-ansi-language: IN; mso-fareast-language: EN-US; mso-bidi-language: AR-SA;\">tidak seperti susu kedelai pada umumnya. SKY Blend memiliki berbagai macam varian rasa seperti, rasa jeruk, strawberry, durian, kurma, jahe, kopi dan original. Selain kekinian, minuman ini memiliki kualitas yang baik. Tidak ada pengawet dan perasa yang kami gunakan aman untuk kesehatan. Pada penyajian SKY Blend ini, kami akan menambahkan topping berupa parutan coklat batang.</span></p>','susu|kedelai|minuman|susu kedelai',1,1,'2019-03-13 01:02:01','2019-03-15 02:44:07'),(758,0,'STIK TARI','2019 17010024012 fachrurrizal achmad rinaldy.pdf',NULL,3827000,'<p>Stik tari adalah produk makanan yang berasal dari tahu putih dan tahu kuning yang dijadikan menjadi produk camilan berbentuk stik dengan berbagai rasa.</p>','STIK TAHU KEDIRI',1,1,'2019-03-13 01:09:31','2019-03-15 01:03:03'),(759,0,'Wak Kopi','2019 17010024014 Mohammad Daffa Sutrisno.pdf',NULL,4000000,'<p class=\"MsoNoSpacing\" style=\"text-align: justify; line-height: 150%; tab-stops: 14.2pt;\"><span style=\"font-size: 12.0pt; mso-bidi-font-size: 11.0pt; line-height: 150%; font-family: \'Times New Roman\',serif; color: #222222; background: white;\">Tingkat stress yang semakin tinggi membuat masyarakat membutuhkan tempat untuk sekedar melepas lelah atau mencari tempat refreshing yang bisa menyegarkan suasana kembali.&nbsp; Ke coffee shop atau kedai kopi menjadi salah satu pilihan yang favorit di masyarakat.&nbsp; Di samping sudah menjadi budaya khusus di Indonesia, masyarakat terbukti mempunyai minat yang amat besar untuk mengunjungi tempat yang di gemari semua usia ini. </span></p>\n<p class=\"MsoNoSpacing\" style=\"text-align: justify; line-height: 150%; tab-stops: 14.2pt;\"><span style=\"font-size: 12.0pt; mso-bidi-font-size: 11.0pt; line-height: 150%; font-family: \'Times New Roman\',serif; color: #222222; background: white;\"><span style=\"mso-tab-count: 1;\">&nbsp;&nbsp;&nbsp;&nbsp; </span>Dengan adanya Wak Kopi ini masyarakat bisa meminum kopi dengan varian rasa yang ada dan bermacam-macam dan menarik dengan harga yang sangat murah bagi kantong untuk meminum kopi sehari-hari</span></p>','Wak Kopi',1,1,'2019-03-13 01:39:01','2019-03-14 19:37:17'),(760,0,'\"PENTAKER\" (pentol tahu anti kanker)','2019 17010664144 Fitria Laela.pdf',NULL,3500000,'<p>Jumlah penderita kanker di seluruh dunia terus meningkat signifikan. Laporan terbaru yang dirilis oleh International Agency for Research on Cancer, Organisasi Kesehatan Dunia (WHO) mengestimasi terdapat 18,1 juta kasus kanker baru dan 9,6 juta kematian yang terjadi pada tahun ini. Salah satu cara menghindarkan diri dari penyakit ini yaitu menjaga pola makan sehat. Beberapa jenis makanan bahkan memiliki kemampuan pencegahan kanker.</p>\r\n<p>Produk yang akan kami pasarkan merupakan olahan makanan yang sehat dan memiliki banyak manfaat, dan manfaat utamanya adalah sebagai makanan pencegah kanker untuk itu nama dari produk kami adalah PENTAKER (Pentol Tahu Anti Kanker). Keunggulan dari produk kami yaitu menggunakan bahan-bahan alami dan higenis. Bahan utama dari produk kami adalah tahu dengan lima varian rasa yaitu brokoli, bayam, wortel, jamur enoki, dan original. Semua bahan-bahan tersebut memiliki kandungan zat yang dapat memperlambat pertumbuhan sel kanker.</p>\r\n<p>Produk kami menggunakan saus tomat yang dibuat sendiri. Hal ini dikarenakan dalam kandungan tomat terdapat zat yang dapat mencegah kanker lambung dan zat tersebut akan lebih aktif apabila dijadikan saus sehingga dapat memaksimalkan manfaatnya. Dan semua manfaat yang telah dipaparkan tersebut dapat didapatkan sekaligus dalam satu bungkus produk kami.</p>\r\n<p>Produk kami akan dikemas menggunakan mika plastik dengan alas daun pisang. Pemasaran produk akan dilakukan secara langsung dan menggunakan pengiklanan melalui media sosial.</p>','Pentol tahu enter|Makanan sehat enter|Pencegah kanker',1,1,'2019-03-13 01:41:50','2019-03-15 01:17:34'),(761,0,'SIOBI (Siomay Ubi) Camilan Sehat Bergizi untuk Anak ADHD','2019 16010664048 Sinta Khusnullia.pdf','2019 16010664048 Sinta Khusnullia.pdf',4000000,'<p></p>\n<p class=\"MsoNormal\" style=\"margin-left: 36.0pt; text-align: justify; text-indent: 36.0pt;\"><span lang=\"EN-US\" style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',serif;\">Ubi merupakan salah satu umbi-umbian yang banyak ditemui di Indonesia dan mudah untuk mendapatkannya. Selain harganya yang sangat terjangkau, ubi dapat digunakan sebagai makanan pokok pengganti nasi. Namun, di era milenial saat ini ubi terkesan sebagai makanan kuno yang ketinggalan jaman. Sehingga masyarakat saat ini sudah mulai jarang mengonsumsinya. Masyarakat kini dari semua kalangan lebih menyukai makanan cepat saji.</span><span style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',serif;\"><span lang=\"EN-US\">Selain sehat SIOBI memiliki banyak manfaat bagi kesehatan, sehingga semua kalangan dapat mengonsumsi makanan ini. </span></span><span lang=\"EN-US\" style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',serif;\">Terutama bagi anak yang memiliki gangguan ADHD (Attention Deficit Hyperactivity Disorder) yaitu anak yang selalu aktif dan tidak bisa diam dalam kurun waktu yang lama. Dapat diketahui bahwa anak yang mengalami ADHD harus menghindari makanan yang mengandung gluten dan kasein. Zat tersebut merupakan sejenis zat medium yang terbentuk dari asam amino yang mempunyai ciri khas protein tapi bukan protein. Selain itu anak ADHD dilarang untuk mengonsumsi makanan yang mengandung perwarna dan pengawet karena dapat memunculkan perilaku hiperaktivitas tinggi. Pada anak ADHD, kekurangan seng, kalsium, magnesium akan meningkatkan kegelisahan, konsentrasi rendah dan kesuliatn belajar. Kekurangan lemak esensial juga dapat mengakibatkan kesulitan belajar. Deficit vitamin B1 dapat memicu perilaku agresif, impulsive dan eratik. Vitamin B1 banyak dijumpai pada kentang, padi-padian, umbi-umbian, bijian, telur, kacang-kacangan, daging, sayur dan beras merah. </span><span lang=\"EN-US\" style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',serif;\">Mengetahui hal tersebut anak yang memiliki gangguan tersebut sangat baik untuk mengonsumsi ubi, hal ini dikarenakan banyak manfaat yang terkadung dalam ubi untuk mengurangi tingkat hiperaktif anak. Karena banyak kandungan yang terdapat dalam ubi yang baik bagi kesehatan anak dengan ADHD. Diantara kandungan yang terdapat dalam ubi antara yaitu karbohidrat, Kalium, dan vitamin A, B dan kolin. Selain itu ubi juga rendah lemak sehingga cocok bagi yang menjalankan progam diet.</span></p>\n<p></p>',NULL,1,1,'2019-03-13 01:43:00','2019-05-03 14:31:12'),(762,0,'ES DISINI SENANG ( Ice Cream Daun Sirih Sehat, Enak dan Bergizi )','2019 17010024030 sektiawan.pdf',NULL,11200000,'<p><strong>RINGKASAN PROPOSAL RENCANA USAHA</strong></p>\r\n<p><br /><strong>Ice Cream Daun Sirih Sehat, Enak dan Bergizi ( ES DISINI SENANG )</strong> merupakan inovasi ice cream berbahan dasar daun sirih dengan varian rasa sirih coklat, sirih vanilla, sirih oreo, dan sirih original. Selain dengan menggunakan bahan daun sirih yang memiliki khasiat yang menyehatkan seperti Sebagai pengobat nyeri, Melawan kanker, Menghambat karies gigi dan masih banyak lagi.&nbsp; <br />&nbsp;<br />Produk ini akan menggabungkan minuman tradisional dan modern sehingga dapat menarik kaum milenial maupun masyarakat tradisional, produk ini juga memiliki toping sesuai dengan varian rasa, sehingga dapat membuat tampilan produk lebih menarik. Varian rasa tersebut&nbsp; menggunakan susu segar seperti rasa coklat menggunakan susu segar coklat, rasa vanilla menggunakan susu segar vanilla dan rasa oreo menggunakan oreo, sementara untuk toping nya menggunakan coklat batangan dan potongan oreo. <br />&nbsp;<br />ES DISINI SENANG dikemas dengan CUP yang tertera brand ES DISINI SENANG yang membuat kemasan lebih menarik. ES DISINI SENANG dijual dengan menggunakan booth yang menarik dan memanfaatkan lokasi strategis untuk pemasaranya. Sementara untuk promosi kami memanfaatkan internet yang sekarang ini sangat mudah untuk diakses oleh masyarakat di Indonesia, seperti menggunakan media sosial Instagram , facebook, whatsapp, line dan website resmi ES DISINI SENANG .com untuk menjangkau konsumen yang lebih luas. Untuk pemasaran offline kami menggunakan brosur, stiker dan dari mulut kemulut&nbsp; untuk mengenalkan kepada masyarakat.</p>\r\n<p><br />Setiap bulan ES DISINI SENANG menargetkan sebanyak 30 cup&nbsp; perhari dengan total 900 cup perbulan . ES DISINI SENANG meraup keuntungan RP. 2.000,- dari harga jual Rp.4000,-/cup. Rumah produksi ES DISINI SENANG berlokasi di sidoarjo. Sistem penjualan ES DISINI SENANG menggunakan booth untuk mempermudah dalam penjualan dan lebih mengenalkan brand kami kepada masyarakat serta diharapkan dengan menggunakan booth akan lebih mudah dalam mebuka cabang penjualan seperti di Malang, Jombang, Mojokerto dan Gresik.</p>','minuman|makanan|es|es disini senang|ice|ice cream|sehat|enak|bergizi|murah|milenial|tradisional|4.0|industri|surabaya|gresik|sidoarjo|nganjuk|unesa|coklat|vanilla|cokelat|oreo|dingin|manis|kekinian|obat|alami|kuliner|hits|food|drink|like',1,1,'2019-03-13 01:48:21','2019-03-14 20:32:15'),(763,0,'Makrame Cantik','2019 16020124046 Haniya.pdf',NULL,4440000,'<p class=\"MsoNormal\"><span lang=\"IN\" style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; mso-ansi-language: IN;\">Makrame Cantik adalah nama usaha kerajinan tangan yang pembuatannya dengan teknik simpul menyimpuldanmenghasilkan berbagai macam barang.&nbsp;</span><span style=\"font-family: \'Times New Roman\', serif; font-size: 12pt; text-align: justify; text-indent: 36pt;\">Melihat potensi masyarakat sekarang khususnya perempuan yang lebih mengedepankan style dan mempercantik apa yang dimiliki agar terlihat lebih bernilai tinggi dibanding yang lain , oleh karena itu peluang usaha dibisnis ini cukup menjanjikan karena masih jarang pesaing dalam bisnis ini khususnya di daerah kampus UNESA Lidah Wetan. Makrame cantik ini menyajikan berbagai macam kerajinan tangan seperti gantungan kunci, hiasan pot dan hiasan tempat pensil. Nama usaha ini dibuat sebagi doa dan bertujuan agar konsumen dapat menikmati dengan puas terhadap hasil produk usaha ini.</span></p>','makrame|gantungan kunci|hiasan pot|kerajinan|handmade|seni|simpul tali|kerajinan tangan|style|girl|seni rupa|kreatif|enterpreneur|woman|unesa|mahasiswa unesa',4,1,'2019-03-13 02:08:14','2019-03-15 03:42:36'),(764,0,'Cawan Rasa (Cakwe Aneka Rasa)','2019 17051214063 Siti Nuraisah.pdf',NULL,6300000,'<p>Cawan Rasa merupakan camilan cakwe yang dikembangkan dengan inovasi terbaru yaitu memiliki aneka rasa dan dikemas dengan kemasan yang menarik. Pengembangan Cakwe polos yang biasanya hanya dicocol dengan caos, kini dapat dinikmati dengan inovasi terbaru yaitu cakwe dengan isi ayam yang ditaburi bumbu rasa.&nbsp;</p>','Cawan17051214063Rasa|Cawan Rasa Cakwe Aneka Rasa',1,1,'2019-03-13 02:09:17','2019-03-18 09:05:50'),(765,0,'Fix Me Please','2019 17010024028 Geraldy Dife Caesaro Novari.pdf',NULL,5450000,'<p>Fix me please merupakan jasa instal ulang sistem operasi, perbaikan software, serta aplikasi lainnya, untuk membantu mahasiswa memperbaiki laptop yang bermasalah</p>','Laptop|Instal ulang|windows',2,1,'2019-03-13 02:13:27','2019-03-15 01:09:42'),(766,0,'C&D Production','2019 17040254114 Cendy Nova Weno Saputra.pdf',NULL,10750000,'<p>C&amp;D Production merupakan produk layanan jasa yang menawarkan jasa&nbsp;</p>\r\n<p>pengabadian moment pada saat perayaan hari ulang tahun, wisuda, PKKMB baik&nbsp;</p>\r\n<p>berupa fotografi maupun bentuk short movie sesuai dengan keinginan pelanggan.&nbsp;</p>\r\n<p>C&amp;D Production menawarkan harga yang murah dan sesuai dengan kantong&nbsp;</p>\r\n<p>mahasiswa karena C&amp;D Production juga sadar mahasiswa banyak keterbatasan&nbsp;</p>\r\n<p>dalam hal finansial namun C&amp;D Production menawarkan solusi yaitu dengan&nbsp;</p>\r\n<p>pengabadian moment yang murah namun tidak murahan. Ide pendirian usaha ini&nbsp;</p>\r\n<p>termotivasi dari hobby penulis dalam bidang fotografi dan videografi serta&nbsp;</p>\r\n<p>didukung dengan peralatan yang sudah dimiliki yang dapat menunjang kesuksesan&nbsp;</p>\r\n<p>usaha ini. Motivasi lainnya adalah berdasarkan banyaknya opini mahasiswa&nbsp;</p>\r\n<p>tentang mahalnya jasa pengabadian moment pada saat wisuda ataupun acara&nbsp;</p>\r\n<p>kemahsiswaan lainnya seperti event-event yang diadakan oleh ORMAWA. Selain&nbsp;</p>\r\n<p>itu motivasi pendirian usaha ini adalah dukungan dari orang tua yang telah&nbsp;</p>\r\n<p>memfasilitasi alat-alat yang nantinya digunakan untuk mendukung usaha ini.</p>','Jasa|Videografi|Fotografi',2,1,'2019-03-13 02:14:47','2019-03-15 00:57:16'),(767,0,'Jasa','2019 17020104084 Suseno Mahendra.pdf',NULL,15,'<p class=\"MsoNormal\"><span style=\"font-size: 7.5pt; line-height: 115%; font-family: \'Verdana\',\'sans-serif\'; color: black; background: white;\">Perkembangan globalisasi di era modern ini sangat pesat terutama di Indonesia. akhir-akhir ini&nbsp;streetwear lagi buming-bumingnya di mata orang indonesia. Mulai dari t-shirt sampai sepatu. kami berpikir untuk membikin jasa (reseller) untuk usaha kami, karena kami melihat peluang besar di dunia streetwear ini. kami menjual barang-barang streatwear dan sepatu dengan harga stealdeal yaitu menjual barang dengan harga di bawah market price reseller dan masih di atas harga retail, pastinya dengan harga yang bersahabat.&nbsp;</span></p>','Jasa(reseller)',2,1,'2019-03-13 02:26:44','2019-03-19 03:08:30'),(768,0,'THE BOS (The Banana House)','2019 17020104066 YULIA PRIHATIN PUTRI.pdf',NULL,13348000,'<p>Dalam proposal ini menjelaskan tentang usaha kami yaitu THE BOS (The Banana House), yang memproduksi 4 jenis makanan berbahan dasar pisang. Harapan kami, kami lolos dalam seleksi pmw ini. Karena pisang sangat diperlukan oleh mahasiswa, karena dengan pisang, mahasiswa dapat mengerjakan deadline dengan cemilan yang dapat mengenyangkan perut kosong.&nbsp;</p>','THE BOS|The Banana House|The Banana|Banana House|Banana|Pisang|Rumah Pisang',1,1,'2019-03-13 02:30:11','2019-03-19 04:07:41'),(769,0,'Longgar Dingin','2019 17020104006 Nani Kurniasari.pdf',NULL,4232000,'<p>Es serut merupakan salah satu kuliner yang digemari oleh masyarakat Indonesia apalagi ketika musim kemarau. Es serut yang kami buat adalah es serut yang menggukan serutan dari jus buah yang telah dibekukan (melon, mangga dan stroberi) sehingga es yang kami jual merupakan jajanan yang sehat. Cocok untuk dikonsumsi satu jam sebelum makan berat.</p>','Es Serut Buah|Es Sehat|Melon,|Stroberi|Mangga',1,1,'2019-03-13 02:34:14','2019-03-19 12:48:50'),(770,0,'MAK NDUM \"Makaroni Gandum\"','2019 17020084084 AIKO PUTRI TSANY.pdf',NULL,5105000,'<p><span lang=\"IN\" style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; mso-fareast-font-family: Calibri; letter-spacing: -.05pt; mso-ansi-language: IN; mso-fareast-language: EN-US; mso-bidi-language: AR-SA;\">&nbsp;Usaha MakNdum bergerak di bidang produksi makanan ringan atau biasa disebut camilan. MakNdum merupakan singkatan dari Makaroni Gandum. Kami menggunakan gandum sebagai bahan baku utama membuat makaroni yang umumnya terbuat dari tepung terigu. </span><span style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; mso-fareast-font-family: Calibri; letter-spacing: -.05pt; mso-ansi-language: EN-US; mso-fareast-language: EN-US; mso-bidi-language: AR-SA;\">Selain itu, varian rasa dari MakNdum ini masih jarang di pasaran, telur asin dan balado jeruk akan menjadi andalan kepada konsumen.</span> <span style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; mso-fareast-font-family: Calibri; letter-spacing: -.05pt; mso-ansi-language: EN-US; mso-fareast-language: EN-US; mso-bidi-language: AR-SA;\">Sajian yang kami buat memiliki berbagai varian rasa, mulai dari yang sering ditemui di pasaran, dan juga terdapat yang jarang ditemui di pasaran, contohnya keju, pedas, balado, barbeque, balado daun jeruk, dan juga telur asin, kami percaya diri dengan inovasi MakNdum rasa telur asin ini, karena <em>salted egg powder</em> ini sedang digandrungi masyarakat. Mengonsumsi gandum dalam jumlah yang normal memiliki manfaat untuk kesehatan salah satunya mencegah penyakit obesitas, yang mana gandum memberikan </span><span style=\"font-size: 11.5pt; line-height: 115%; font-family: \'Times New Roman\', serif; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">energi yang kuat tanpa harus sering merasa lapar</span><span style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; mso-fareast-font-family: Calibri; letter-spacing: -.05pt; mso-ansi-language: EN-US; mso-fareast-language: EN-US; mso-bidi-language: AR-SA;\">, juga gandum dapat mengobati radang kronis, dalam biji gandum terdapat kandungan anti inflamasi yang berguna untuk mengatasi peradangan kronis.</span></p>','MAKANAN, MAKANAN RINGAN, MAKARONI GANDUM',1,1,'2019-03-13 02:55:50','2019-03-15 00:51:54'),(771,0,'NISAA (brownis buah) : Healty, Sweet and Soft','2019 17080694054 Selvi Sehiling.pdf',NULL,10954100,'<p>Salah satu usaha yang terus berkembang dan banyak dilirik adalah usaha dibidang makanan. Sebab makanan merpakan kebutuhan pokok setiap individu yang dibutuhkan setiap hari. Adapun peluang pasar terhadap produk makanan brownis cukup besar. Di kota-kota besar seperti surabaya brownis meripakan salah satu buah tangan yang disering dan banyak dibeli oleh wisatawan. Bahkan disurabaya sendiri terdapat brownis yang menjadi ciri khas Surabaya yaitu lapis kukus Surabaya. Oleh karena itu, NISAA (brownis buah) memiliki potensi yang cukup besar untuk dijadikan sebagai icon makanan khas Sidoarjo.</p>\r\n<p>NISAA (Brownis Buah) adalah Inovasi produk brownis menyehatkan yang berbahan dasar buah yakni jeruk dan nanas. Buah jeruk adalah buah yang terkenal kaya akan vitamin C. Jeruk mempunyai 85 kalori namun sama sekali tidak mengandung lemak dan kolestrol. Jeruk juga bermanfaat untuk meminimalisir lemak dalam tubuh dan mengurangi resiko kolestrol. Disamping itu, jeruk dapat mengurangi resiko sakit jantung, memperbaiki saluran pernafasan, kanker dan batu ginjal. Buah jeruk juga dapat memperbaiki kulit dan juga meningkatkan sistem kekebalan pada tubuh serta menetralisir dan melindungi sel sel tubuh.</p>\r\n<p>Nanas mengandung nutrisi vitamin C, Manganese, Asam Float dan senyawa bromelain. Enzim bromelain yang terkandung pada buah nanas dapat memberikan manfaat kesehatan diantaranya seperti meningkatkan sistem kekebalan tubuh.&nbsp;</p>\r\n<p>Manfaat usaha bagi masyarakat dengan adanya usaha ini adalah memudahkan masyarakat dengan gaya hidup sehat untuk mendapatkan produk makanan yang aman bagi tubuh dengan cita rasa yang unik. Disamping itu, mampu memberikan icon makanan khas sidoarjo sehingga bisa dijadikan sebagai produk oleh-oleh dari sidoarjo. Usaha ini juga bermanfaat bagi masyarakat sekitar dengan menciptakan lapangan pekerjaan diantaranya menjadi pegawai dibidang produksi, pemasaran, kasir, dan lain-lain.</p>','Brownis|Buah|Healty|Soft',1,1,'2019-03-13 02:58:30','2019-03-20 06:43:28'),(772,0,'TM60s (The Magic of 60 Second)','2019 17010664078 MOHAMAD REFIKASA KHAF PUTRA GIANMAH.pdf','2019 17010664078 MOHAMAD REFIKASA KHAF PUTRA GIANMAH.pdf',8500000,'<p>TM60s ini merupakan tissue ajaib pembersih sepatu, dimana produk ini memiliki kegunaan yang efektif, efisien, harga yang murah, dan mampu bersaing di pasaran. Ukurannya yang kecil akan mudah untuk dibawa kemana-kemana dan juga satu lembar tissue dapat membersihkan untuk satu pasang sepatu.</p>',NULL,2,1,'2019-03-13 03:02:30','2019-04-28 20:26:55'),(773,0,'Multi-Po (Multi Taste Potato)','2019 17020084052 Nur Faishal Arifandi.pdf',NULL,4011000,'<p class=\"MsoNoSpacing\" style=\"text-align: justify; text-indent: 1.0cm; line-height: 150%; tab-stops: 14.2pt;\"><span lang=\"EN-US\" style=\"font-size: 12.0pt; line-height: 150%; font-family: \'Times New Roman\',\'serif\'; letter-spacing: -.05pt;\">Makanan yang kami sediakan merupakan cemilan ringan dengan harga sesuai kantong mahasiswa. Rasa pun tidak kami lupakan. Multi-Po memiliki keunikan tersendiri untuk rasanya karena diajikan lebih dari satu rasa dalam satu kemasan. Dengan adanya usaha ini diharapka dapat memberikan makanan ringan yang murah dengan sensasi berbeda untuk penikmat cemilan dengan bahan dasar kentang.</span></p>','Makanan|Multi-Po|Kentang',1,1,'2019-03-13 03:03:06','2019-03-15 00:50:51'),(774,0,'HONEY BROWNIE (Brownies with Honey as The Sweetener and Healthy Fruits Topping)','2019 17020084055 Tri Achmad Yadiwinarto.pdf',NULL,9700000,'<p class=\"MsoNoSpacing\" style=\"text-align: justify; line-height: 150%; tab-stops: 14.2pt;\"><em style=\"mso-bidi-font-style: normal;\"><span lang=\"EN-US\" style=\"font-size: 12.0pt; line-height: 150%; font-family: \'Times New Roman\',\'serif\'; letter-spacing: -.05pt;\">Dessert box</span></em><span lang=\"EN-US\" style=\"font-size: 12.0pt; line-height: 150%; font-family: \'Times New Roman\',\'serif\'; letter-spacing: -.05pt;\"> merupakan satu hidangan pencuci mulut yang dikemas dalam wadah yang praktis, khusunya berbentuk <em style=\"mso-bidi-font-style: normal;\">box. </em>Produk yang dikemas dalam bentuk <em style=\"mso-bidi-font-style: normal;\">box</em> yang praktis memudahkan konsumen untuk menikmatinya. Makanan pencuci mulut </span><span style=\"font-size: 12.0pt; line-height: 150%; font-family: \'Times New Roman\',\'serif\'; letter-spacing: -.05pt; mso-ansi-language: IN;\">dalam bentuk lebih sederhana </span><span lang=\"EN-US\" style=\"font-size: 12.0pt; line-height: 150%; font-family: \'Times New Roman\',\'serif\'; letter-spacing: -.05pt;\">sedang digandrungi</span><span style=\"font-size: 12.0pt; line-height: 150%; font-family: \'Times New Roman\',\'serif\'; letter-spacing: -.05pt; mso-ansi-language: IN;\"> masyarakat luas</span><span lang=\"EN-US\" style=\"font-size: 12.0pt; line-height: 150%; font-family: \'Times New Roman\',\'serif\'; letter-spacing: -.05pt;\"> saat ini, khususnya oleh kalangan muda. Namun, <em style=\"mso-bidi-font-style: normal;\">dessert box</em> yang beredar di masyarakat </span><span style=\"font-size: 12.0pt; line-height: 150%; font-family: \'Times New Roman\',\'serif\'; letter-spacing: -.05pt; mso-ansi-language: IN;\">cenderung memiliki harga yang tidak terjangkau dan </span><span lang=\"EN-US\" style=\"font-size: 12.0pt; line-height: 150%; font-family: \'Times New Roman\',\'serif\'; letter-spacing: -.05pt;\">mengandung kadar gula yang tinggi sehingga kurang baik untuk kesehatan.</span></p>\n<p class=\"MsoNoSpacing\" style=\"text-align: justify; line-height: 150%; tab-stops: 14.2pt;\"><span lang=\"EN-US\" style=\"font-size: 12.0pt; line-height: 150%; font-family: \'Times New Roman\',\'serif\'; letter-spacing: -.05pt;\"><span style=\"mso-tab-count: 1;\">&nbsp;&nbsp;&nbsp;&nbsp; </span>Atas dasar ini, kelompok kami ingin membuat inovasi makanan <em style=\"mso-bidi-font-style: normal;\">penutup dessert box</em> yang lebih sehat dengan menggunakan bahan-bahan yang lebih bernutrisi, seperti penggunaan madu sebagai pengganti gula, ubi sebagai varian bahan dasar, serta penggunaan bahan kaya akan vitamin dari buah-buahan seperti buah naga, alpukat, pisang</span><span style=\"font-size: 12.0pt; line-height: 150%; font-family: \'Times New Roman\',\'serif\'; letter-spacing: -.05pt; mso-ansi-language: IN;\">, strawberry, dana anggur</span><span lang=\"EN-US\" style=\"font-size: 12.0pt; line-height: 150%; font-family: \'Times New Roman\',\'serif\'; letter-spacing: -.05pt;\"> yang digunakan sebagai <em style=\"mso-bidi-font-style: normal;\">topping</em>.</span></p>\n<p class=\"MsoNoSpacing\" style=\"text-align: justify; line-height: 150%; tab-stops: 14.2pt;\"><span lang=\"EN-US\" style=\"font-size: 12.0pt; line-height: 150%; font-family: \'Times New Roman\',\'serif\'; letter-spacing: -.05pt;\"><span style=\"mso-tab-count: 1;\">&nbsp;&nbsp;&nbsp;&nbsp; </span><em style=\"mso-bidi-font-style: normal;\">Dessert box</em> dengan bahan-bahan yang lebih sehat tentunya akan lebih bernutrisi sehingga tidak hanya sebagai makanan penutup yang nikmat saja tetapi juga bernutrisi. <em style=\"mso-bidi-font-style: normal;\">Honey Brownie Dessert Box </em>merupakan makanan pencuci mulut yang tidak hanya lebih sehat tetapi juga praktis dalam segi kemasan.</span></p>','brownies|dessert|makanan|honey|madu|fruits|healthy|ubi|murah',1,1,'2019-03-13 03:06:25','2019-03-14 19:14:24'),(775,0,'BuNi KiNang (Burrito Unik Bikin Senang)','2019 17020104052 Nabilah Indah Wahyuni.pdf',NULL,1424800,'<p>Burrito merupakan makanan khas Meksiko berupa tortilla yang diisi dengan berbagai macam daging dan saus. Di Amerika, isian dari Burrito lebih bervariasi dengan tambahan sayur dan biasa digunakan sebagai makan pagi atau makan siang karena kemasannya yang praktis dan mudah dimakan.</p>\n<p><span style=\"text-decoration: underline;\">BuNi KiNang (Burrito Unik Bikin Senang) adalah burrito yang isiannya sudah kami sesuaikan dengan lidah masyarakat Indonesia. Burrito kami memiliki dua varian yaitu ayam geprek dan tahu dengan sayuran dimana kami telah mempertimbangkan gizi dari isian burrito ini agar bisa menjadi pengganti makan, khususnya bagi mahasiswa yang biasa disibukkan dengan berbagai kegiatan. Dengan produk ini, diharapkan konsumen bisa tetap mengerjakan kegiatannya dan makan dengan praktis.</span></p>','makanan|burrito',1,1,'2019-03-13 03:06:58','2019-03-15 05:36:58'),(776,0,'PYCYEGOS \"HAPPY RECYCLE LEGO SET\"','2019 17010664042 Risti Dwi Pramesti.pdf',NULL,4605000,'<p>Permainan Lego merupakan permainan yang dapat digunakan untuk mengembangkan motorik anak, mengasah kreativitas, Dan meningkatkan kecerdasan emosional anak.&nbsp;</p>\r\n<p>Permasalahan yang dewasa ini sering dihadapi adalah banyaknya sampah botol plastik yang banyak berserakan Dan mencemari lingkungan.</p>\r\n<p>Untuk mengatasi masalah tersebut kami membuat sebuah mainan Lego yang dapat bermanfaat bagi anak Dan dapat membantu mengurangi banyaknya sampah botol plastik yang berserakan.</p>','Barang|Permainan|PYCYEGOS',5,1,'2019-03-13 03:12:00','2019-03-15 06:01:59'),(777,0,'Shusi Jawa','2019 17081194067 Aldra Puspita Rahma.pdf',NULL,500,'<p><span lang=\"EN-US\" style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',serif; mso-fareast-font-family: Calibri; mso-ansi-language: EN-US; mso-fareast-language: EN-US; mso-bidi-language: AR-SA;\">Shusi Jawa merupakan salah satu makanan cepat saji tradisional yang menyehatkan tanpa bahan pengawet atau bahan-bahan kimia lainnya. Berbahan baku utama tahu dan sayuran akan menjadikan produk ini menjadi produk makanan cepat saji yang sehat, unggul dan berdaya saing tinggi dikalangan masyarkata.&nbsp;</span></p>','makanan|tradisional Food|fast Food|Healty Food|Industri makanan|Shusi Jawa|kekinian',1,1,'2019-03-13 03:19:26','2019-03-20 02:41:29'),(778,0,'NUSA RARA (Nugget Sayur Varian Rainbow)  Go Vegan Go Healthy','2019 16010684068 Mas Ning Nur Fasichah.pdf',NULL,5442000,'<p>NUSA RARA (Nugget Sayur Varian Rainbow)&nbsp; &ldquo;Go Vegan Go Healthy&rdquo; merupakan salah satu inovasi produk makanan cepat saji yang mengkombinasikan olahan daging ayam (nugget) dengan berbagai macam sayuran diantaranya yaitu bayam, wortel, kubis ungu, dan jagung. Kami membentuk nugget menjadi berbagai macam bentuk geometri dengan memberikan variasi warna rainbow dari bahan alami yang tentunya akan sangat diminati oleh anak &ndash; anak. kami tujukan produk ini untuk ibu-ibu yang sibuk berkarir namun ingin memberikan makanan sehat untuk anaknya.&nbsp;NUSA RARA ini akan dipasarkan di pusat agen oleh-oleh khas Surabaya, serta dipasarkan juga di agen-agen Frozen Food. Selain itu akan dipasarkan melalui membuka stand bazar di acara-acara kegiatan surabaya. Selain itu NUSA RARA juga dapat dipesan melalui Online yang nantinya dapat bekerjasama dengan aplikasi Go-Food untuk proses pengirimannya.&nbsp;</p>','nugget sayur|rainbow|geometri|solusi ibu berkarir|sehat',1,1,'2019-03-13 03:26:19','2019-03-14 22:38:37'),(779,0,'Macsobax Crunchy','2019 17020104041 Febby Fristiavanka.pdf',NULL,3000000,'<p><em><span lang=\"IN\" style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',serif; mso-fareast-font-family: \'Yu Mincho\'; letter-spacing: -.05pt; mso-ansi-language: IN; mso-fareast-language: EN-US; mso-bidi-language: AR-SA;\">Macsobax crunchy</span></em><span lang=\"IN\" style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',serif; mso-fareast-font-family: \'Yu Mincho\'; letter-spacing: -.05pt; mso-ansi-language: IN; mso-fareast-language: EN-US; mso-bidi-language: AR-SA;\"> adalah siomay yang terbuat dari kubis yang akan di isi oleh daging ayam, siomay, sosis, makaroni dan keju.&nbsp;</span><span style=\"font-family: \'Times New Roman\', serif; font-size: 12pt; letter-spacing: -0.05pt;\">Jadi, kami mempunyai ide dengan merubah isi siomay hingga tampilan siomay dengan sedikit kreatifitas dan inovasi baru.&nbsp;</span><span lang=\"EN-US\" style=\"font-size: 12pt; line-height: 115%; font-family: \'Times New Roman\', serif; letter-spacing: -0.05pt;\">D</span><span lang=\"IN\" style=\"font-size: 12pt; line-height: 115%; font-family: \'Times New Roman\', serif; letter-spacing: -0.05pt;\">iharapkan masyarakat meningkatkan minatnya untuk lebih memakan sayuran dengan rasa kekinian ini.</span></p>','Makanan|siomay',1,1,'2019-03-13 03:27:24','2019-03-15 04:55:46'),(780,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,1,'2019-03-13 03:29:05','2019-03-13 03:46:03'),(781,0,'PUKKAW (Krupuk Kawis) Sehat Kaya Gizi','2019 17010024040 ANDRI NOVA AFRIZAL.pdf',NULL,8852200,'<p class=\"MsoNormal\" style=\"text-align: justify; text-indent: 36.0pt;\"><span style=\"font-size: 12.0pt; line-height: 107%; font-family: \'Times New Roman\',\'serif\';\">PUKKAW (Krupuk Kawis) merupakan salah satu jenis olahan dari buah kawis yang menjadi suatu cemilan dalam bentuk krupuk yang sehat karena pengolahannya yang tanpa menggunakan minyak dalam proses penggorengan. PUKKAW (Krupuk Kawis) ini dibuat untuk mengangkat ekonomi daerah-daerah yang dapat berpotensi sebagai wilayah budidaya buah kawis. Selain itu, juga bisa menjadi salah satu inovasi bagi masyarakat dalam mengolah buah kawis. Selama ini masih sedikit olahan dari bahan buah kawis, padahal buah kawis sendiri mengandung karbohidrat dan protein yang dapat mengenyangkan perut serta mampu dijadikan sebagai cemilan saat nugas maupun saat santai. Dengan adanya desain batik lasem sebagai identitas bangsa pada kemasan maka masyarakat juga akan mengetahui jenis-jenis batik Lasem sebagai warisan budaya. Dengan pembukaan usaha PUKKAW (Krupuk Kawis) ini nantinya akan membuka peluang usaha berbagai macam olahan buah kawis yang dapat meningkatkan perekonomian produsen buah kawis. Masyarakat tidak hanya mengandalkan buah kawis sebagai sari minuman saja, namun buah kawis juga mampu dijadikan sebagai olahan yang unik dan menarik minat konsumsi masyarakat karena berbagai kandungan karbohidrat dan protein yang baik bagi kesehatan.</span></p>','krupuk kawis|buah kawis',1,1,'2019-03-13 03:34:04','2019-03-14 13:57:16'),(782,0,'Ido Laku (Inovasi Donat Labu Kuning)','2019 17010024007 Siti Urfaulwiya.pdf',NULL,2443000,'<p><span style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',serif; mso-fareast-font-family: Calibri; letter-spacing: -.05pt; mso-ansi-language: IN; mso-fareast-language: EN-US; mso-bidi-language: AR-SA;\">Kegiatan usaha ini merupakan usaha pembuatan donat dengan campuran bahan dari labu kuning yang dipadukan dengan aneka rasa topping di atasnya. Labu kuning merupakan salah satu buah yang dapat diolah menjadi berbagai macam makanan lezat.</span></p>','Donat Labu Kuning',1,1,'2019-03-13 03:34:40','2019-03-15 01:32:38'),(783,0,'Rainbow\'s Stuff','2019 17020104054 Nindy Jefilla Putri.pdf',NULL,10000000,'<p>Rainbow\'s Stuff adalah sebuah produk yang dapat digunakan oleh masyarakat di kehidupan sehari-harinya. Tie Dye adalah salah satu teknik pewarnaan dengan cara diikat ataupun dicelupkan yang akan menghasilkan motif yang berbeda-beda. Rainbow\'s Stuff akan menujukkan motif yang menarik serta warna yang indah di sebuah kaos, sepatu, totebag, dan lampion.&nbsp;</p>','kaos|totebag|sepatu|lampion',4,1,'2019-03-13 03:46:50','2019-03-15 08:41:27'),(784,0,'KINBAB (KERIPIK KULIT KEBAB)','2019 17040254024 Chusnul Fitriawati.pdf',NULL,8750000,'<p class=\"MsoNormal\" style=\"text-align: justify;\"><span style=\"font-size: 12.0pt; mso-bidi-font-size: 11.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\';\">KINBAB merupakan makanan ringan yang mudah untuk dibawa kemana-mana baik itu untuk kebutuhan mahasiswa dalam menemani saat-saat mengerjakan tugas. Dari peristiwa ini tim kami menemukan ide untuk membuat sebuah makanan ringan yang kami beri nama KINBAB dengan berbagai varian rasa dan harga yang terjangkau. KINBAB menawarkan berbagai varian rasa seperti bbq, sapi panggang, balado, keju, dan beberapa level pedas. Sasaran usaha kami adalah seluruh mahasiswa UNESA dan masyarakat umum khususnya di sekira Kota Surabaya. Jika usaha ini berkembang targer usaha kami adalah meluaskan bisnis dengan menerima pesanan dari luar Kota Surabaya. Keunggulan bisnis ini adalah harga sesuai dengan budget yang dimiliki konsumen dengan berbagai varian rasa dan dibentuk dalam kemasan yang praktis dan mudah dibawa kemana saja. Tantangan dalam usaha ini adalah banyak memiliki pesaing yang memiliki usaha serupa terutama camilan yang memiliki brand atau nama yang cukup terkenal di masyarakat. </span></p>','KINBAB, SNACK|KINBAB (KERIPIK KULIT KEBAB)',1,1,'2019-03-13 03:56:06','2019-03-14 23:12:58'),(785,0,'JAKA ETTID (Jasa Kreatif Marketing Digital)','2019 17010714019 RESTU ANGGADA CIPTA.pdf',NULL,13195000,'<p>Ringkasan Proposal Rencana Usaha</p>\r\n<p>Seiring dengan terjadinya perkembangan teknologi yang begitu pesat, saat ini setiap industri tengah mengalami perubahan masif. Bergantung kepada segala kemungkinan yang dapat ditemukan dari berbagai teknologi baru, sistem pemasaran kini berevolusi secara lebih cepat dibandingkan dengan sebelumnya. Melalui perangkat mobile, social media dan pengoptimasian konten, informasi dapat menjangkau konsumen kapan pun dan di mana pun mereka berada. Sekarang ini, tidak ada bisnis yang dapat bersaing tanpa adanya strategi pemasaran digital yang professional. Oleh karena itu muncul sebuah gagasan ide untuk mendirikan usaha Jasa Kreatif Marketing Digital untuk mengoptimalkan promosi usaha. Usaha itu adalah JAKA ETTID (Jasa Kreatif Marketing Digital) merupakan model usaha dalam pemasaran digital 360&deg; yang menggabungkan kreatifitas dengan solusi teknis yang terpercaya. Dengan memanfaatkan jaringan alat pemasaran yang lengkap untuk memperoleh hasil terbaik, JAKA ETTID (Jasa Kreatif Marketing Digital) membawa keahlian kreatif melalui teknologi yang relevan.</p>\r\n<p>Kami dapat memberikan terobosan dalam pencitraan digital untuk para usaha mikro kecil dan menengah. Tujuan dari usaha jasa kreatif marketing digital tersebut yaitu untuk memasarkan produk para UMKM pada sektor industri kreatif yang belum bisa memasarkan produknya lebih luas. Misalnya produk udeng Sidoarjo yang dimana produk tersebut dalam sistem penjualannya masih dalam sistem jual tempat atau membuat suatu toko. Dari itu maka pengrajin udeng dalam mendapatkan keuntungan masih kecil dan melestarikan udengnyapun masih dalam ranah mikro. Oleh sebab itu, dengan adanya terobosan ini. Di harapkan potensi yang ada di UMKM bisa di sentuh khalayak umum bukan hanya di daerah Sidoarjo aja tapi tingkat nasional dengan menggunakan jasa kreatif marketing digital. Kami akan memasarkan produk tersebut ke seluruh penjuruh indonesia bahkan internasional dengan memanfaatkan marketing digital dan dapat memperoleh keuntungan/laba dari penjualan dari produk digital advertising. Dengan memanfaatkan media media digital mahasiswa dapat memulai usaha untuk membuat produk digital advertising. Bentuk dari optimalisasi informasi tersebut yaitu dengan membuat digitalisai tiga dimensi (3D) sebuah produk. Sistem manajemen pencarian konsumen yang diterapkan adalah custom order yaitu produk yang dibuat disesuaikan sesuai dengan kebutuhan dan keinginan konsumen.</p>\r\n<p>3 hal yang prioritas kami pertama adalah, kampanye menyajikan produk atau jasa kepada target audience dengan cara yang meyakinkan dan original. Lalu kedua, kampanye juga mampu membangun citra brand yang telah dibuat khusus di dalam pikiran target audience dan terakhir adalah konsistensi brand yang harus dijaga di semua channel digital yang memungkinkan dan menyelaraskan citra brand tersebut dengan semua kegiatan aktivasi yang ada di lapangan. Pelaksanaan kegiatan usaha dilakukan di gang 01 no.53A Lidah Wetan, Lakarsanti, Surabaya</p>\r\n<p>ii</p>\r\n<p>yang merupakan tempat usaha yang dimiliki salah satu anggota. Kegiatan usaha akan dilakukan selama hari kerja senin-sabtu, karena sistem pengerjaan adalah custom order jadi pengerjaan produk tidak harus di tempat dan jam kerjanya bisa diselesaikan dirumah dengan catatan projek jadi sesuai deadline pemesanan. Dalam sebulan target kita adalah mampu menjual dan menghasilkan 5 (lima) produk advertising atau rata-rata satu projek dapat diselsaikan selama lima hari Hom Creative yaitu company profil, projek presentasi, media pembelajaran interaktif (MPI), game edukasi maupun aplikasi advertising lainnya sesuai pesanan konsumen.</p>','Digital advertising, |Target audience|UMKM',2,1,'2019-03-13 04:00:58','2019-03-14 00:59:14'),(786,0,'KORAMIL (Kaos Era Millenial)','2019 16080574145 Safira Shabrina.pdf',NULL,6000000,'<p class=\"MsoNoSpacing\" style=\"text-align: justify; line-height: 115%; tab-stops: 14.2pt;\"><span style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; color: #222222; background: white;\">Milenial adalah kelompok&nbsp;</span><a title=\"Demografi\" href=\"https://id.wikipedia.org/wiki/Demografi\"><span style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; color: windowtext; background: white;\">demografi</span></a><span style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; background: white;\">&nbsp;<span style=\"color: #222222;\">setelah Generasi X (Gen-X). Tidak ada batas waktu yang pasti untuk awal dan akhir dari kelompok ini. Para ahli dan peneliti biasanya menggunakan awal 1980-an sebagai awal kelahiran kelompok ini dan pertengahan tahun 1990-an hingga awal 2000-an sebagai akhir kelahiran</span></span><span style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; letter-spacing: -.05pt;\">Jumlah penduduk milenial yang ada di Indonesia ada sekitar </span><span style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; color: #555555; background: white;\">90 juta orang (berusia 20-34 tahun). </span><span style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; color: #222222; background: white;\">Karakteristik Milenial berbeda-beda berdasarkan wilayah dan kondisi sosial-ekonomi. Namun, generasi ini umumnya ditandai oleh peningkatan penggunaan dan keakraban dengan komunikasi, media, dan teknologi digital.&nbsp;Dengan ini kami ingin mempersembahkan kaos yang merepresentasikan dari karakteristik milenial, yaitu pemasaran kaos kami yang berfokus pada teknologi digital seperti sosial media.</span></p>\n<p class=\"MsoNoSpacing\" style=\"text-align: justify; line-height: 115%; tab-stops: 14.2pt;\"><span style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; letter-spacing: -.05pt;\"><span style=\"mso-tab-count: 1;\">&nbsp;&nbsp;&nbsp;&nbsp; </span>KORAMIL (Kaos Era Milenial) adalah fashion item kaos oblong yang tidak biasa. Produk yang kami tawarkan adalah kaos milenial yang memiliki keunikan dan karakteristik tersendiri terlebih di bidang fashion. Hal yang kami prioritaskan dari produk kami adalah kami ingin mengusung tema yang simple, namun mengutamakan kenyamanan dan model yang unik, ditambah dengan kreativitas aksara yang kami gunakan untuk melengkapi produk kami. Design aksara yang ingin kami usung diharapkan dapat menjadi media kaum milenial untuk menyuarakan kata hatinya. Ketika bibir tak mampu berucap dan tak pernah didengar, maka mereka hanya perlu membaca apa yang ingin kami ungkapkan.</span></p>\n<p class=\"MsoNoSpacing\" style=\"text-align: justify; line-height: 115%; tab-stops: 14.2pt;\"><span style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; letter-spacing: -.05pt;\"><span style=\"mso-tab-count: 1;\">&nbsp;&nbsp;&nbsp;&nbsp; </span>Design <em style=\"mso-bidi-font-style: normal;\">oversized </em>dan cutting-an yang unik dari produk kami ini cocok digunakan oleh semua gender. Bagi anda wanita yang mengenakan kerudung dan ingin mengenakan kaos milenial dari kami juga jangan khawatir karena sangat cocok dipadu padankan dengan kerudung dan tentunya tetap <em style=\"mso-bidi-font-style: normal;\">stylish. </em>Ciri khas warna hitam untuk kaos kami juga cocok digunakan untuk wanita dan pria dan netral dengan semua warna. Tingginya pecinta dan pelaku fashion di era modern ini mendorong banyak brand yang bermunculan demi memuaskan kebutuhan masyarakat dalam berbusana. Namun, belum banyak yang mampu menawarkan design kaos dan aksara seperti produk kami.</span></p>\n<p class=\"MsoNoSpacing\" style=\"text-align: justify; line-height: 115%; tab-stops: 14.2pt;\"><span style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; letter-spacing: -.05pt;\"><span style=\"mso-tab-count: 1;\">&nbsp;&nbsp;&nbsp;&nbsp; </span>Kami ingin menjadi pelopor brand yang dinaungi anak muda dan memberikan produk yang terbaik dan diminati banyak kalangan anak muda. Dari anak muda, untuk anak muda.</span></p>','kaos milenial|minimalis|kaos oblong',4,1,'2019-03-13 04:02:26','2019-03-19 17:28:27'),(787,0,'D\'gReat-Y Tote Bag','2019 17020104083 RILLA YUNI NORMA NINGSIH.pdf',NULL,8682000,'<p>D\'gReat-Y Tote Bag adalah produk tote bag yang dibuat dari karung goni kemudian didesain sesuai selera anak muda dan perkembangan saat ini.</p>','Tote Bag|D\'gReat-Y Tote Bag|Tote Bag Karung Goni',5,1,'2019-03-13 04:03:31','2019-03-15 14:46:08'),(788,0,'MAS PRO \"MEDIA PROMOSI DAN UNDANGAN ONLINE DENGAN FLAT ANIMATION\"','2019 17010024032 ADITYA ANANDA WIDHIYANTORO.pdf','2019 17010024032 ADITYA ANANDA WIDHIYANTORO.pdf',4000000,'<p>Ditengah berkembang pesatnya teknologi, dan ramainya industri kreatif , MAS PRO MEDIA PROMOSI DAN UNDANGAN ONLINE DENGAN FLAT ANIMATION hadir untuk membantu setiap orang berkembang dan mengikuti majunya Teknologi serta aktif di tengah gencarnya Revolusi Industri 4.0. MAS PRO menawarkan jasa atau layanan pembuatan Undangan online dan promosi produk yang menarik, di tengah revolusi Industri 4.0 ,penggunaan media cetak seperti brosur ,pamflet , dan undangan cetak semakin banyak ditinggalkan karena kurang efektif, dikarenakan munculnya promosi-promosi produk dan undangan yang menggunakan via online , yakni jaringan Internet melalui sosial media yang hampir seluruh masyarakat punya dan aktif menggunakannya.</p>',NULL,2,1,'2019-03-13 04:04:42','2019-04-29 03:06:13'),(789,0,'KLEPON PAPI PEOT','2019 17010044013 NIKA RIZKI NUR PRAWITASARI.pdf',NULL,14489700,'<p class=\"MsoNoSpacing\" style=\"text-align: justify; line-height: 115%; tab-stops: 14.2pt;\"><span style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',serif; letter-spacing: -.05pt; mso-ansi-language: IN;\">Usulan kegiatan usaha yang diusulkan dalam proposal ini berjudul KLEPON PAPI PEOT (Klepon Pace Krispi Penutrisi Otak). Produk yang diolah adalah Klepon yang aman dan dapat menutrisi otak untuk anak berkebutuhan khusus yang terbuat dari buah mengkudu dan menggunakan isian gula jagung. Dalam proses produksi, klepon ini menggunakan bahan utama buah Mengkudu dan gula jagung. Serta bahan pelengkap berupa balutan tepung roti yang memberikan kesan krispi pada setiap gigitannya. Selain itu juga ditambah dengan bahan pendukung lain seperti daun pandan dan tepung beras ketan. Pengelolaan usaha KLEPON PAPI PEOT dilakukan oleh 3 mahasiswa dengan tiap individu memiliki kemampuan masing-masing yang dapat menunjang pengelolaan suatu usaha.</span></p>\n<p class=\"MsoNoSpacing\" style=\"text-align: justify; line-height: 115%; tab-stops: 14.2pt;\"><span style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',serif; letter-spacing: -.05pt; mso-ansi-language: IN;\"><span style=\"mso-tab-count: 2;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span>Target usaha ini bukan hanya mahasiswa akan tetapi masyarakat umum. Tiap produk dijual seharga Rp. 4.000./pack, 1 pack berisi 4 bola klepon krispi Penjualan produk ini dapat dilakukan di Kampus dan menitipkan di toko-toko. Untuk kelancaran penjualan produk dilakukan analisis dengan SWOT. KLEPON PAPI PEOT memiliki kekuatan dengan rasanya yang unik dan membuat konsumen ketagihan dengan produk yang telah kami jual. Produk ini juga mengangkat kembali nama jajanan pasar khas Indonesia serta menggunakan bahan yang sangat mudah ditemukan dan jarang diberdayakan oleh masyarakat di Indonesia yaitu pace/mengkudu, yang juga dapat memberikan manfaat bagi otak anak.</span></p>\n<p class=\"MsoNoSpacing\" style=\"text-align: justify; line-height: 115%; tab-stops: 14.2pt;\"><span style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',serif; letter-spacing: -.05pt; mso-ansi-language: IN;\"><span style=\"mso-tab-count: 2;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span>Buah Pace/Mengkudu memiliki banyak manfaat bagi yang mengkonsumsinya. Klepon pada umumnya terkenal dengan isian gula merah, namun pada produk ini gula merah diganti dengan gula jagung, gula jagung sendiri memiliki kadar kemanisan yang rendah, jadi membuat <span style=\"mso-spacerun: yes;\">&nbsp;</span>makanan ini aman untuk orang penderita diabetes, darah tinggi, dan juga ramah untuk Anak Berkebutuhan Khusus seperti untuk anak autis, tunagrahita. Klepon ini juga tidak menggunakan toping Kelapa serut, namun KLEPON PAPI PEOT ini menggunakan tepung Panir yang membuat Klepon ini lebih krispi dan berbeda dengan klepon pada umumnya. </span></p>\n<p class=\"MsoNoSpacing\" style=\"text-align: justify; line-height: 115%; tab-stops: 14.2pt;\"><span style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',serif; letter-spacing: -.05pt; mso-ansi-language: IN;\"><span style=\"mso-tab-count: 2;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span>Kekurangan dari produk ini </span><span style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',serif; mso-ansi-language: IN;\">yakni, produk ini tidak bisa dikonsumsi dalam jangka panjang oleh ibu yang sedang mengandung dan menyusui, karena buah mengkudu memberi efek samping yang buruk pada janin ibu hamil tersebut. Selain ibu hamil</span><span lang=\"EN-US\" style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',serif;\"> orang dengan gangguan hati </span><span style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',serif; mso-ansi-language: IN;\">juga tidak dapat mengkonsumsinya terlalu sering </span><span lang=\"EN-US\" style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',serif;\">dikarenakan kandungan mengkudu yang dapat memperparah kondisi si penderita</span><span style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',serif; mso-ansi-language: IN;\">.</span><span lang=\"EN-US\" style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',serif;\"> Memang buah Mengkudu memiliki banyak manfaat untuk menyembuhkan berbagai penyakit, namun disisi lain buah mengkudu memiliki kandungan yang memberikan efek samping yang negatif </span><span style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',serif; mso-ansi-language: IN;\">pada konsumen joka dikonsumsi terlalu sering. Produk makanan ini menghabiskan biaya Rp.14.489.700,- dalam proses pemasaran selama 3 bulan. </span></p>','Klepon|Mengkudu|Pace|Nutrisi Otak|Tunagrahita|Autis|Klepon Gula Jagung|Klepon Krispi',1,1,'2019-03-13 04:06:36','2019-03-18 16:09:19'),(790,0,'MAMPUS (Martabak Kampus Surabaya)','2019 17010024013 Mega Hilda Tias Pratiwi.pdf',NULL,5000000,'<p class=\"MsoNoSpacing\" style=\"text-align: justify; line-height: 150%; tab-stops: 14.2pt;\"><span lang=\"EN-US\" style=\"font-size: 12.0pt; line-height: 150%; font-family: \'Times New Roman\',\'serif\'; background: white;\">Kegiatan usaha ini merupakan usaha pembuat Martabak Spicy yang dipadukan dengan cabai didalam cincang ayam dan sayur lainnya. Martabak merupakan makanan yang berasal dari Arab. Namun di Indonesia sudah dikenal dengan Martabak Telur dan Martabak Martabak Manis. Pemilihan cabai sebagai rasa yang khas dan Mengandung zat antioksidan, menetraliser radikal bebas yang bertanggung jawab terhadap rusaknya jaringan dan sel tubuh, mengurangi kolestrol dan afektif menjaga stoke dan serangan jantung. Di padukan dengan daging ayam yang merupakan salah satu khas yang sangat disenangi oleh masyarakat dan biasa dipakai sebagai campuran makanan dan sayur-sayuran. Daging ayam mengandung zat besi (terhindar dari anemia),</span> <span lang=\"EN-US\" style=\"mso-bidi-font-size: 10.0pt; line-height: 150%; font-family: \'Times New Roman\',\'serif\'; background: white;\">vitamin B5 yang dapat membantu kita merasa tenang dan menghindarkan kita dari stress, dapat meningkatkan sistem kekebalan tubuh dan memperkuat tulang dan menambah massa otot.</span></p>','martabak|kampus|surabaya',1,1,'2019-03-13 04:07:50','2019-03-15 02:52:11'),(791,0,'SUTIMO (Super Tiwol Modis)','2019 16010044064 Nita Dwi Rahmawati.pdf',NULL,5000000,'<p class=\"MsoNormal\" style=\"margin-left: .5in; text-align: justify; text-justify: inter-ideograph; text-indent: .5in; line-height: normal;\"><span style=\"font-size: 12.0pt; font-family: \'Times New Roman\',\'serif\'; letter-spacing: -.05pt; mso-ansi-language: IN;\">Super tiwol modis (</span><span lang=\"EN-US\" style=\"font-size: 12.0pt; font-family: \'Times New Roman\',\'serif\'; letter-spacing: -.05pt;\">\"Sutimo\"</span><span style=\"font-size: 12.0pt; font-family: \'Times New Roman\',\'serif\'; letter-spacing: -.05pt; mso-ansi-language: IN;\">) </span><span lang=\"EN-US\" style=\"font-size: 12.0pt; font-family: \'Times New Roman\',\'serif\';\">adalah kuliner tradisional</span><span style=\"font-size: 12.0pt; font-family: \'Times New Roman\',\'serif\'; mso-ansi-language: IN;\"> yang diinisiasi trend kekinian berupa kuliner yang bernunasa tradisional modern</span><span lang=\"EN-US\" style=\"font-size: 12.0pt; font-family: \'Times New Roman\',\'serif\';\"> dari Indonesia yang memiliki rasa manis dan enak. </span><span style=\"font-size: 12.0pt; font-family: \'Times New Roman\',\'serif\'; letter-spacing: -.05pt; mso-ansi-language: IN;\">Super tiwol modis </span><span lang=\"EN-US\" style=\"font-size: 12.0pt; font-family: \'Times New Roman\',\'serif\';\">ini begitu unik dan sangat populer sebagai jajanan tradisional. </span><span style=\"font-size: 12.0pt; font-family: \'Times New Roman\',\'serif\'; letter-spacing: -.05pt; mso-ansi-language: IN;\">Super tiwol modis ini bisa olah dengan berbagai variasi rasa kekinian dan bisa juga dikonsumsi oleh anak berkebutuhan khusus terutama anak autis dalam program diet gula.</span><span lang=\"EN-US\" style=\"font-size: 12.0pt; font-family: \'Times New Roman\',\'serif\';\">Pembuatan </span><span style=\"font-size: 12.0pt; font-family: \'Times New Roman\',\'serif\'; letter-spacing: -.05pt; mso-ansi-language: IN;\">Super tiwol modis </span><span lang=\"EN-US\" style=\"font-size: 12.0pt; font-family: \'Times New Roman\',\'serif\';\">manis ini pun sangat mudah karena bahan yang digunakan ialah tepung gaplek atau singkong yang telah kering. Menu tiwul banyak disukai masyarakat karena cita rasanya. Rasa manis dan gurih membuat banyak kalangan seperti anak &ndash; anak serta orang tua suka.</span></p>\n<p class=\"MsoNormal\" style=\"text-align: justify; text-justify: inter-ideograph; text-indent: .5in; line-height: normal; mso-pagination: widow-orphan; margin: 0in 0in .0001pt .5in;\"><span lang=\"EN-US\" style=\"font-size: 12.0pt; font-family: \'Times New Roman\',\'serif\';\">Diharapkan </span><span style=\"font-size: 12.0pt; font-family: \'Times New Roman\',\'serif\'; letter-spacing: -.05pt; mso-ansi-language: IN;\">Super tiwol modis</span><span lang=\"EN-US\" style=\"font-size: 12.0pt; font-family: \'Times New Roman\',\'serif\';\"> diharapkan mampu mengambil peluang trend tersebut dengan mengunggulkan keunikkan, menarik dan cita rasa kekinian yang dimiliki oleh </span><span style=\"font-size: 12.0pt; font-family: \'Times New Roman\',\'serif\'; letter-spacing: -.05pt; mso-ansi-language: IN;\">Super tiwol modis</span><span lang=\"EN-US\" style=\"font-size: 12.0pt; font-family: \'Times New Roman\',\'serif\'; letter-spacing: -.05pt;\">. Yakni berupa citarasa yang kekinian dan menjadi makanan bermanfaat bagima diet gula anak autis.<span style=\"mso-spacerun: yes;\">&nbsp; </span></span></p>\n<p class=\"MsoNormal\" style=\"text-align: justify; text-justify: inter-ideograph; text-indent: .25in; line-height: normal; mso-pagination: widow-orphan; margin: 0in 0in .0001pt .5in;\"><span lang=\"EN-US\" style=\"font-size: 12.0pt; font-family: \'Times New Roman\',\'serif\';\">&nbsp;</span></p>\n<p class=\"MsoNormal\" style=\"text-align: justify; text-justify: inter-ideograph; text-indent: .25in; line-height: normal; mso-pagination: widow-orphan; margin: 0in 0in .0001pt .5in;\"><span style=\"font-size: 12.0pt; font-family: \'Times New Roman\',\'serif\'; mso-ansi-language: IN;\">Sutimo ini akan menjadi solusi bagi masyarakat yang ingin mengonsumsi makanan tradisional yang memiliki variasi rasa kekinian yang tidak membosankan dan memiliki manfaat bagi anak autis yang sedang diet gula serta orang yang mengalami masalah penyakit gula (diabetes dkk)</span></p>\n<p class=\"MsoNormal\" style=\"margin-bottom: .0001pt; text-align: justify; text-justify: inter-ideograph; line-height: normal; mso-pagination: widow-orphan;\"><span style=\"font-size: 12.0pt; font-family: \'Times New Roman\',\'serif\'; mso-ansi-language: IN;\">&nbsp;</span></p>\n<p class=\"MsoNormal\" style=\"text-align: justify; text-justify: inter-ideograph; text-indent: .25in; line-height: normal; mso-pagination: widow-orphan; margin: 0in 0in .0001pt .5in;\"><span lang=\"EN-US\" style=\"font-size: 12.0pt; font-family: \'Times New Roman\',\'serif\'; letter-spacing: -.05pt;\">Makanan trasisional Sutimo seperti ini jarang ditemui dipasaran mungkin yang ditemukan dipasaran adalah tiwul pada umunya. Sutimo dapat mengobati rasa rindu terhadap makanan tradisional dengan varian modern kekinian. Dengan harga yang cukup terjangkau dan kemasan yang menarik serta rasa yang memuaskan.</span></p>\n<p class=\"MsoNormal\" style=\"text-align: justify; text-justify: inter-ideograph; text-indent: .25in; line-height: normal; mso-pagination: widow-orphan; margin: 0in 0in .0001pt .5in;\"><strong style=\"mso-bidi-font-weight: normal;\"><span lang=\"EN-US\" style=\"font-size: 12.0pt; font-family: \'Times New Roman\',\'serif\';\">&nbsp;</span></strong></p>\n<p class=\"MsoNormal\" style=\"text-align: justify; text-justify: inter-ideograph; text-indent: .25in; line-height: normal; mso-pagination: widow-orphan; margin: 0in 0in .0001pt .5in;\"><span lang=\"EN-US\" style=\"font-size: 12.0pt; font-family: \'Times New Roman\',\'serif\';\">Dijaman modern ini mengonsumsi makanan tradisional dengan rasa kekinian serta memiliki manfaat bagi tubuh adalah trend yang menyebar dikalangan masyarakat. Sutimo diharapkan menjadi kuliner tradisional yang kekinianyang berdampak pada prospek usaha yang baik dimasa depan </span></p>','Makanan Tradisional Rasa Modern|Makanan Diet Autis|Makanan Sehat|Makanan Rendah Gula',1,1,'2019-03-13 04:15:39','2019-03-15 00:32:17'),(792,0,'Maido (Umai Sandoichi/Sandwich)','2019 17020104017 Yustinanda Dwi Kurniati.pdf',NULL,5000000,'<p><em>Maido&nbsp;</em>merupakan kependekan dari&nbsp;<em>Umai Sandoichi</em>. Kedua kata tersebut berasal dari bahasa Jepang, yaitu&nbsp;<em>umai</em> yang berarti enak dan&nbsp;<em>sandoichi&nbsp;</em>yang berarti&nbsp;<em>sandwich</em>.&nbsp;<em>Sandwich&nbsp;</em>yang kami buat terdapat dua varian, yaitu isi daging dan isi buah. Metode penjualan yang kami gunakan dalam pemasaran adalah dengan berjualan keliling juga menitipkan produk di toko penjual makanan. Salah satu keunggulan dari produk kami adalah dapat dimakan dimanapun dan di saat kapanpun, baik saat sebelum maupum sesudah makan nasi.</p>','Sandwich',1,1,'2019-03-13 04:17:09','2019-03-19 05:40:07'),(793,0,'Sinar Balmi (Siomay Warna Dari Bahan Alami)','2019 17010024005 Meinuella Dwi Asriati.pdf',NULL,7927000,'<p class=\"MsoNoSpacing\" style=\"text-align: justify; line-height: 150%; tab-stops: 14.2pt;\"><span style=\"font-size: 12.0pt; line-height: 150%; font-family: \'Times New Roman\',\'serif\'; letter-spacing: -.05pt;\">Produk yang akan dibuat dalam kegiatan ini sedikit unik dan berbeda yaitu siomay ayam dengan kulit berwarna yang terbuat dari bahan alami. Ada tiga varian warna kulit siomay yang dibuat yaitu warna hijau, merah dan jingga. Untuk warna hijau diperoleh dari sari sayur bayam, warna merah diperoleh dari sari buah naga merah, sedangkan untuk warna jingga di peroleh dari sari wortel. Penamaan dari setiap varian juga berbeda-beda. Untuk siomay yang berwarna hijau adalah &ldquo;Simba&rdquo; singkatan dari siomay bayam. Untuk siomay yang berwana merah adalah &ldquo;Siaga&rdquo; singkatan dari siomay buah naga. Untuk siomay yang bewarna jingga &ldquo;Siwor&rdquo; singkatan dari siomay wortel. Secara umum &lsquo;siomay di Indonesia dicampur dengan saus kacang sebagai pelengkap. Namun, di produk ini saus pelengkapnya adalah saus sambal. <span style=\"mso-spacerun: yes;\">&nbsp;</span></span></p>','siomay warna|siomay unik|warnawarni|simba|siaga|siwor|jobangren',1,1,'2019-03-13 04:19:28','2019-03-15 03:17:27'),(794,0,'KARYA DASAR (Karya Desain Advertising)','2019 17010024035 M FAUZAN ASIDIC.pdf',NULL,9300000,'<p>Karya Dasar adalah usaha berbentuk jasa yang bertujuan membantu para pegiat umkm baru agar dapat mempromosikan produknya dengan baik dan benar supaya dapat mentujukan produknya kepada pasar yang tepat.</p>','Karya Desain Advertising',2,1,'2019-03-13 04:23:31','2019-03-15 02:13:06'),(795,0,'Krejozz (Klethek jozz)','2019 17010014043 Ovilia Risma Safitri.pdf',NULL,8740000,'<p>Produk ini merupakan makanan khas dari Tulungagung yang terbuat dari singkong atau ketela pohon yang diolah menjadi makanan&nbsp;ringan atau keripik yang disebut dengan klethek. Klethek ini dibuat dengan memadukan berbagai macam rempah-rempah sehingga memiliki cita&nbsp;rasa yang khas. Pada saat ini kami memiliki inovasi untuk mengembangkan produk tersebut supaya lebih dikenal oleh masyarakat luas. Bentuk dari inovasi kami yaitu memberikan varian&nbsp;rasa seperti super pedas, jagung bakar, barbeque, pedas manis dan keju.</p>','klethek, keripik rasa|klethek|keripik rasa|khas Tulungagung|singkong',1,1,'2019-03-13 04:31:29','2019-03-15 02:18:56'),(796,0,'LOTUS PRIVATE ART LESSON','2019 16020124047 HENRICO ADHI SUANTORO PUTRA.pdf',NULL,7361000,'<p>Lotus merupakan nama gagasan dari sebuah bidang usaha jasa yang berfokus art and craft lesson pada anak usia 6-18 tahun sebagai sarana alternatif penyaluran kreatifitas dan bakat anak. Seni dan kerajinan sering dipandang mata karena tidak termasuk dalam ujian nasional (UN), tapi itu dulu. Saat ini era industri 4.0 yang berbasis kreatifitas lebih dijunjung dan dikembangkan pada anak agar dapat bersaing, akan tetapi di sekolah sendiri jara ada ekskul seni dan kerajinan, dan juga mata pelajaran seni kebanyakan hanya sekali dalam seminggu maka dari itu terbentuklah Lotus sebagai jalan keluar penyalur bakat dan kreatifitas anak.&nbsp;</p>','enter',2,1,'2019-03-13 05:01:58','2019-03-14 23:39:43'),(797,0,'Salad Nano Nano','2019 17020084058 Anita Valeri Regita.pdf',NULL,8305000,'<p>Melihat banyaknya masyarakat sekitar khususnya mahasiswa yang kurang memperhatikan gizi dan vitamin yang terkandung didalam makanan yang di konsumsi membuat kami ingin menginovasi salah satu makanan sehat yaitu salad. Kami namakan dengan salad nano nano. Salad Nano-Nano adalah makanan sehat yang kami buat dengan inovasi varian topping kekinian serta mengutamakan gizi dan vitamin yang terkandung di dalamnya membuat salad ini beda dengan salad pada umunya. Nantinya kami akan melakukan penjualan secara offline dan online.&nbsp;</p>','salad nano nano|makanan|dessert|salad|makanan sehat|healthy food|makanankekinian',1,1,'2019-03-13 05:04:14','2019-03-14 22:43:40'),(798,0,'Embrodery Shoes Custom','2019 17020124045 SEPTIAN ADI KESUMA.pdf',NULL,13990000,'<p class=\"MsoNormal\" style=\"text-align: justify;\"><span style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',serif; mso-ansi-language: IN;\">&nbsp; &nbsp; Berawal dari kesenangan terhadap dunia fashion terutama di bidang fashion sepatu yang memiliki keunikan tersendiri di setiap desainnya, munculah minat untuk membuat custom hiasan sepatu. Dari sana terpikir ide untuk memproduksi custom motif sepatu dengan teknik sulam dan <a name=\"_Hlk3405415\"></a><em style=\"mso-bidi-font-style: normal;\">punch needle </em>yang bernama <em style=\"mso-bidi-font-style: normal;\">Embrodery Shoes Custom, </em>yang mana motif yang kami terapkan di <em style=\"mso-bidi-font-style: normal;\">Embrodery Shoes Custom </em><span style=\"mso-spacerun: yes;\">&nbsp;</span>menggunakan motif tribal style dengan sulaman benang, <a name=\"_Hlk3405580\"></a>oleh karena itu produk seperti ini masih jarang di temui di masyarakat luas, sebab pada umumnya para produsen custom motif sepatu menggunakan teknik cat atau lukis. </span></p>\n<p class=\"MsoNormal\" style=\"text-align: justify;\"><span style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',serif; mso-ansi-language: IN;\"><span style=\"mso-tab-count: 1;\">&nbsp; &nbsp; &nbsp;</span>Selain mengguanakn teknik sulam dan punch needle, pada produk <em style=\"mso-bidi-font-style: normal;\">Embrodery Shoes Custom </em>juga menawarkan motif kombinasi batik dan sulam di sepatu tersebut, sehingga banyak pilihan untuk para pembeli dalam memilih motif sepatu sesuai selera pembeli. Keunggulan dari produk ini selain memiliki desain motif yang bagus, produk ini adalah buatan tangan atau yang biasa disebut <em style=\"mso-bidi-font-style: normal;\">hand made</em>, dan harga dari <em style=\"mso-bidi-font-style: normal;\">Embrodery Shoes Custom </em>masih sesuai dengan kantong para mahasiswa.</span></p>','sepatu|custom|sulam|embrodery|shoes',4,1,'2019-03-13 05:08:16','2019-03-15 06:15:59'),(799,0,'Sorz Cover Studio','2019 17021254022 CHARLES CHING RUMPUIN.pdf',NULL,15000000,'<p class=\"m_-7037753678420257985gmail-MsoNoSpacing\" style=\"color: #222222; text-indent: 36pt; margin: 0cm 0cm 0.0001pt; font-size: 11pt; font-family: Calibri, sans-serif;\"><span style=\"font-size: 12pt; font-family: \'Times New Roman\', serif;\">Kita melihat dewasa ini, anak muda memiliki hambatan dalam berkarya khususnya dalam bidang musik. Sebuah fenomena berkembang di tengah-tengah masyarakat yaitu kurangnya kesadaran&nbsp; kaum muda karena memiliki keraguan dan tidak adanya fasilitas, sarana dan prasana untuk berkarya.</span></p>\n<p class=\"m_-7037753678420257985gmail-MsoNoSpacing\" style=\"color: #222222; text-indent: 36pt; margin: 0cm 0cm 0.0001pt; font-size: 11pt; font-family: Calibri, sans-serif;\"><span style=\"font-size: 12pt; font-family: \'Times New Roman\', serif;\">Untuk itu Sorz Cover Studio hadir membawa solusi bagi kaum muda, bahkan semua kalangan dari anak-anak sampai orang tua yang ingin berkarya, hingga yang ingin menjadi&nbsp;<em>selebgram&nbsp;</em>bahkan&nbsp;<em>youtuber,&nbsp;</em>lewat jasa ini kami menyediakan fasilitas, sarana dan prasarana dalam berkarya.</span></p>\n<p class=\"m_-7037753678420257985gmail-MsoNoSpacing\" style=\"color: #222222; text-indent: 36pt; margin: 0cm 0cm 0.0001pt; font-size: 11pt; font-family: Calibri, sans-serif;\"><span style=\"font-size: 12pt; font-family: \'Times New Roman\', serif;\">Tidak dipungkiri bahwa hal-hal yang menunjang keberhasilan usaha ini adalah niat, usaha dan kerja keras, disamping itu kita juga membutuhkan materi dalam bentuk dana/modal untuk kelengkapan fasilitas, sarana dan prasaran. Maka dari itu kami sangat bersyukur dengan adanya progam Program Mahasiswa Wirausaha yang memperhatikan mahasiswa sebagai generasi muda yang akan menjadi penerus bangsa ini.&nbsp;</span></p>\n<p class=\"m_-7037753678420257985gmail-MsoNoSpacing\" style=\"color: #222222; text-indent: 36pt; margin: 0cm 0cm 0.0001pt; font-size: 11pt; font-family: Calibri, sans-serif;\"><span style=\"font-size: 12pt; font-family: \'Times New Roman\', serif;\">Kami berharap, program Pelatihan Mahasiswa Wirausaha ikut serta dalam meningkatkan kreatifitas masyarakat di bidang musik melalui usaha jasa rekaman Sorz Cover Studio.</span></p>','Music|Studio|Rekaman Murah|Youtuber|Selebgram|Ashiap',2,1,'2019-03-13 05:08:29','2019-03-20 04:46:45'),(800,0,'DAKER ( Daun Kering )','2019 17010024083 Deyvo M. Imbiri.pdf',NULL,4,'<p>&nbsp;</p>\n<p class=\"MsoNormal\" style=\"margin-bottom: .0001pt; text-align: justify; text-indent: 27.0pt; line-height: 150%; mso-pagination: widow-orphan; mso-layout-grid-align: none; text-autospace: none;\">&nbsp;</p>\n<p class=\"MsoNormal\" style=\"text-align: justify; text-indent: 27.0pt; line-height: 150%; mso-layout-grid-align: none; text-autospace: none;\"><span style=\"font-size: 12pt;\"><span style=\"line-height: 150%; font-family: \'Times New Roman\', serif;\">Daker (Daun kering) memberikan sentuhan inovasi di dalamnya. Jika pada Kerajinan Tangan biasanya Sering manggunakan bahan unorganik, tetapi pada &ldquo;Daker&rdquo; ini benar-benar menggunakan bahan ramah lingkungan. Daun Kering yang akan menjadikan kerajinan tangan yang satu ini memiliki berbagai Bentuk dan Kreasi di tambah dengan Aksesoris Unik. Daker (Daun Kering) ini nantinya akan bersaing dengan berbagai pengrajin tangan lainnya</span></span><span style=\"font-family: Ebrima;\">.</span></p>\n<p class=\"MsoNormal\" style=\"margin-bottom: .0001pt; text-align: justify; text-indent: 27.0pt; line-height: 150%; mso-pagination: widow-orphan; mso-layout-grid-align: none; text-autospace: none;\"><span style=\"font-size: 12.0pt; line-height: 150%; font-family: \'Times New Roman\',\'serif\';\">Daker&nbsp; (Daun Kering) adalah produk Kerajinan tangan yang berbahan dasar&nbsp; Limbah daun kering yang sudah dimodifikasi se-kreatif mungkin dengan paduan berbagai Aksesoris Unik. Daker (Daun kering) sendiri merupakan Produk kerajinan tangan yang banyak digemari dan digunakan oleh kalangan masyarakat dari berbagai kalangan, dari anak kecil, muda-mudi dan orang tua pun menyukai dan menggunakan Kerajinan tangan&nbsp; ini yang terbuat dari Daun kering dan tambahan beberapa bahan bekas lainya, kemudian diberi berbagai macam Variasi bentuk dan Aksesoris unik di dalam dan diluarnya, Pita, Kain, Kancing ,Ranting ,tali dll. Tak hanya itu, Daker (Daun kering) juga memiliki tambahan Kreasi unik ternggatung permintaan konsumen agar terlihat lebih menarik dan berbeda dengan Kerajinan tangan yang lainnya.</span></p>\n<p>&nbsp;</p>','Kerajinan tangan daker',4,1,'2019-03-13 05:35:52','2019-03-14 22:34:13'),(801,0,'SAYHAY Apparel','2019 17051214068 MUHAMMAD MAULANA AL FARICHI PRAWIRANEGARA.pdf',NULL,14033250,'<p class=\"MsoNormal\" style=\"margin-left: 19.0pt; text-indent: 9.35pt; line-height: 115%;\"><span style=\"font-size: 12pt;\"><strong><span style=\"line-height: 115%; font-family: \'Times New Roman\', serif;\">SAYHAY Apparel</span></strong></span></p>\n<p class=\"MsoNormal\" style=\"margin-left: 19.0pt; text-indent: 9.35pt; line-height: 115%;\"><span style=\"font-size: 12pt; line-height: 115%; font-family: \'Times New Roman\', serif;\">Berawal dari minat dalam bidang Clothing dan berwirausaha, Clothing ini akan menjadikan wadah untuk implementasi dalam berwirausaha kedepannya. Membuat kami ingin membuat nama brand clothing Sendiri yang bernama SAYHAY Apparel. Untuk Proses Pemesanan dari SAYHAY sendiri adalah awal mula kami menyediakan <em>Ready Stock Katalog</em> atau Barang Ready sekitar 4 lusin untuk dipasarkan dan kami juga menyediakan sistem <em>pre-order</em> dimana konsumen dapat memilih desain atas rekomendasi dari kami. Jenis usaha ini dinilai akan menjanjikan dimasa depan, dengan inovasi yang kreatif dan berkala diharapkan produk nantinya tetap bisa bertahan dipasar bahkan merajai pasar. </span></p>\n<p class=\"MsoNormal\" style=\"margin-left: 19.0pt; text-indent: 9.35pt; line-height: 115%;\"><span style=\"font-size: 12pt; line-height: 115%; font-family: \'Times New Roman\', serif;\">Dari usaha ini kami menampilkan keunggulan produk salah satunya dari sisi desain yang unik. Karena keunikan desain inilah yang membuat konsumen tertarik akan produk. Ini mengusung konsep Seni Anekdot zaman sekarang dalam setiap desainnya. Akan tetapi bukan konsep Seni Anekdot yang biasa biasa saja, namun SAYHAY memadukan unsur Bahasa seni dan Bahasa sastra sehingga desain yang dihasilkan memiliki ciri khas tersendiri dan bisa dibilang unik. Selain itu, SAYHAY pun mengusung konsep anekdot dalam lingkup teknologi untuk dijadikan desain produknya.</span></p>\n<p class=\"MsoNormal\" style=\"margin-left: 19.0pt; line-height: 115%;\"><span style=\"font-size: 12pt; line-height: 115%; font-family: \'Times New Roman\', serif;\">Keunggulan yang dimiliki SAYHAY pun selain dalam segi desain, juga dalam segi kualitas produk yang menggunakan bahan berkualtias ,untuk produk kaos kami disini menggunakan bahan cotton combed 30s, juga menggunakan sablon berkualitas yaitu sablon plastisol dan rapi dalam pengerjaannya. Produk SAYHAY pun dikerjakan oleh tenaga profesional yang telah berpengalaman.</span></p>\n<p class=\"MsoNormal\" style=\"margin-left: 19.0pt; line-height: 115%;\"><span style=\"font-size: 12pt; line-height: 115%; font-family: \'Times New Roman\', serif;\">Untuk mengembangkan bisnis agar tidak ketinggalan zaman, selain menjual produk dengan sistem offline dengan metode sistem stand booth <em>event</em>an yang mana , kami pun mengusung sistem <em>e-commerce </em>yang akan memberikan kemudahan bagi calon konsumen untuk memesan atau mendapatkan informasi pre-order dan stok barang yang tersedia. Penetapan sistem <em>e-commerce</em> ini juga didasarkan pada kecenderungan masyarakat yang semakin banyak menggunakan jasa online dalam memenuhi berbagai kebutuhan mereka termasuk kebutuhan akan pakaian.</span></p>\n<p class=\"MsoNormal\" style=\"margin-left: 19.0pt; line-height: 115%;\"><span style=\"font-size: 12pt; line-height: 115%; font-family: \'Times New Roman\', serif;\">Selanjutnya, karena usaha ini ingin terus mengikuti perkembangan zaman dengan masuk kedalam sistem E-commerce, maka selain berjualan secara offline, &nbsp;SAYHAY pun bisa diakses secara online oleh para konsumen. Mulai dari website catalog, media sosial maupun marketplace dan forum jual beli online. Sistem pembayaran nya pun mudah dengan metode Transfer dan bisa juga Cash on Delivery (COD).</span></p>\n<p class=\"MsoNormal\" style=\"margin-left: 19.0pt; line-height: 115%;\"><span style=\"font-size: 12pt; line-height: 150%; font-family: \'Times New Roman\', serif;\">Prospek kedepannya diharapkan dengan inovasi yang tiada henti, usaha clothing ini bisa memproduksi pakaian dalam sekala besar sehingga mampu merajai pasar konsumen</span></p>','kaos bandung|kaos|kaos distro|clothing|apparel|kaos murah|kaos murah surabaya|sablon kaos surabaya|sablon kaos murah|kaos mahasiswa|kaos kampus|kaos unisex|kaos kekinian|kaos sablon|kaos pria',2,1,'2019-03-13 05:44:52','2019-03-16 00:46:03'),(802,0,'MIE SUKMA (MIE SUKUN MANTAP)','2019 17010644091 FIFI ANANDARI SHOFIAJI.pdf',NULL,10249000,'<p>Mie sukma, adalah mie varian baru dengan bahan dasar tepung yang berasal dari olahan buah sukun. Tepung sukun ini memiliki kandungan karbohidrat yang lebih tingi daripada tepung yang digunakan pada pembuatan mie biasanya. Varian rasa dalam mie ini dibuat dengan varian pedas seperti mie lainnya, karena saat ini anak muda lebih tertantang dengan makanan pedas. Dengan menggunakan tepung yang terbuat dari sukun ini, maka dapat meninggkatkan daya jual sukun. Kandungan lemak yang terdapat dalam tepung sukun juga lebih rendah daripada kandungan pada tepung trigu yang biasa digunakan dalam pembuatan mie pada umumnya. Maka, inilah salah satu keunggulan dari Mie Sukma, dimana mie ini cocok bagi anak muda yang ingin menjaga berat badan mereka karena kandugan lemak yang lebih sedikit dari mie lainnya.</p>','Sukun, Mie, Pedas|Buah Sukun|MIe Sukma|Pedas|Tepung|Lemak',1,1,'2019-03-13 05:45:43','2019-03-15 02:04:16'),(803,0,'Great Bronze (Nyoeso and Distro Totebag)','2019 17020084043 ANGGORO KURNIA DARMAWAN.pdf',NULL,8672000,'<p>Nyoesoe dan Distro adalah usaha yang dikombinasikan menjadi satu dalam sebuah tempat usaha. Nyoeso sendiri berasal dari susu sapi yang akan di tambahkan aneka rasa sehingga pengunjung bisa memilih sesuka hati rasa yang telah disediakan. Sedangkan distro adalah penyokong dari usaha tersebut sehingga pengunjung ketika datang ke tempat usaha bisa melihat dan menarik pengunjung untuk membeli produk totebag, kaos ataupun wisebag yang berasal dari produk sendiri.&nbsp;</p>\n<p>&nbsp;</p>','Nyoeso dan Distro totebag',2,1,'2019-03-13 06:08:31','2019-03-14 18:12:14'),(804,0,'GELO-BES (Nugget Klepon Telo Wadah Besek)','2019 16010044023 Nova Isniawati.pdf',NULL,7300000,'<p class=\"MsoNormal\" style=\"margin-bottom: .0001pt; text-align: center;\" align=\"center\"><strong><span style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; mso-ansi-language: IN;\">GELO-BES (Nugget Klepon Telo Wadah Besek)</span></strong></p>\r\n<p class=\"MsoNormal\" style=\"margin-bottom: .0001pt; mso-pagination: widow-orphan;\"><span lang=\"EN-US\" style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\';\">&nbsp;</span></p>\r\n<p><span style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; mso-fareast-font-family: Calibri; mso-ansi-language: IN; mso-fareast-language: EN-US; mso-bidi-language: AR-SA;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; <strong>GELO-BES (Nugget Klepon Telo Wadah Besek) adalah produk makanan yang menggabungkan makanan tradisonal dan modern. Oleh karenanya bahan pembuatan GELO-BES menggunakan bahan dasar ubi jalar/telo yang diberikan variasi rasa keju, coklat, dan juga selai buah. Makanan GELO-BES ini terinsipari dari klepon yang biasa di jual dipasaran. Keunikan dari klepon ini yaitu terletak pada bahan dasar pembuatannya dari ubi jalar/telo. Dimana pada umumnya terbuat dari tepung ketan. Selain itu ada variasi isi dari klepon itu sendiri. Dan pembuatannya juga bukan di rebus, melainkan di goreng dengan diluarnya diselimuti tepung roti seperti halnya nugget.&nbsp; Dalam variasi isi klepon pembelipun dapat memilih sendiri sesuai keinginan. Disamping itu ada topping yang menjadikan klepon semakin beda dengan klepon pada umumnya. Topping yang ditawarkan juga bervariasi, pembeli dapat memilih sesuai keinginannya. Produk ini juga masih jarang ditemui di wilayah Universitas Negeri Surabaya dan juga dikalangan masyarakat. Sehingga masih sedikit pesaingnya. Dengan variasi rasa, topping dan pengemasan yang unik dan kekinian pengusaha optimis bahwa GELO-BES ini dapat mendapatkan laba yang banyak. Adapun harga per pack yaitu Rp. 5.000, jika menggunkan variasi toping menambah harga Rp. 1000/toping</strong></span></p>','Nugget|Klepon|Telo',1,1,'2019-03-13 06:40:53','2019-03-14 22:47:31'),(805,0,'KOPISA \"Koin Pisang Selera Bersama\"','2019 17010024037 Santi Arfiani.pdf',NULL,3,'<p><span style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; mso-fareast-font-family: Calibri; mso-ansi-language: EN-US; mso-fareast-language: EN-US; mso-bidi-language: AR-SA;\">Nama produk ini adalah Kopisa, yaitu singkatan dari koin pisang selera bersama<em>. </em>Seperti namanya, produk ini adalah produk makanan ringan yang terbuat dari pisang. Keripik itu dimodifikasi dengan berbagai rasa.</span></p>\n<p><span style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; mso-fareast-font-family: Calibri; mso-ansi-language: EN-US; mso-fareast-language: EN-US; mso-bidi-language: AR-SA;\"><span style=\"font-size: 12pt; line-height: 115%;\">Keunggulan dari produk keripik ini adalah keripik &rdquo;Kopisa&rdquo; memiliki rasa yang bervariasi dan unik. Selain itu, keripik ini lebih mudah didapatkan karena pemasaran yang luas baik dari dalam maupun luar kota secara offline maupun online.</span></span></p>\n<p><span style=\"font-family: \'Times New Roman\', serif; font-size: 12pt; text-align: justify; text-indent: -41.4pt;\">&ldquo;Kopisa&rdquo; merupakan salah satu bentuk produk makanan ringan yanginovatif. Karena keripik pisang di bumbui dengan berbagai rasa yang disesuaikan dengan minat konsumen di Indonesia.</span></p>\n<p>&nbsp;</p>','BANANA COIN',1,1,'2019-03-13 06:44:53','2019-03-14 23:46:34'),(806,0,'GOMOSTA (Good Mood With Robusta)','2019 16030194073 VALDO AYONA.pdf','2019 16030194073 VALDO AYONA.pdf',5000000,'<p class=\"MsoNoSpacing\" style=\"text-align: justify; line-height: 115%; tab-stops: 14.2pt;\"><span style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',serif; letter-spacing: -.05pt;\">Proposal ini bertujuan untuk mengajukan sebuah gagasan berupa cara membuat minuman kopi yang berbeda dengan cara dicelupkan. </span><span lang=\"IN\" style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',serif; letter-spacing: -.05pt; mso-ansi-language: IN;\">Kopi adalah sejenis minuman yang berasal dari proses pengolahan dan ekstraksi biji tanaman kopi</span><span style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',serif; letter-spacing: -.05pt;\">. Kopi kemudian terus berkembang hingga sekarang ini menjadi salah satu minuman paling populer di dunia. Negara Indonesia sendiri telah mampu memproduksi lebih dari 400 ribu ton kopi per tahun dan kemudian dieksport di berbagai penjuru dunia, dengan produksi yang sangat melimpah tersebut kami memanfaatkan minuman ini sebagai minuman yang praktis bagi kalangan pecinta kopi di Indonesia</span></p>\n<p class=\"MsoNoSpacing\" style=\"text-align: justify; line-height: 115%; tab-stops: 14.2pt;\"><span style=\"font-family: \'Times New Roman\', serif; font-size: 12pt; letter-spacing: -0.05pt;\">Dengan adanya GOMOSTA ini, para penikmat kopi akan merasakan sensasi yang berbeda dengan yang lainnya yang biasanya hanya diseduh sekarang sebelum menikmatinya harus dicelup terlebih dahulu, hal ini juga mengurangi adanya endapan yang ada pada minuman kopi tersebut karena adanya kantong saring yang nantinya akan mencegah bubuk kopi ikut kedalam minuman dan GOMOSTA mempunyai 4 varian rasa yakni kopi murni, kopi hitam, kopi kelapa, dan kopi jahe. Produk GOMOSTA ini nantinya akan kami jual dengan 4 varian rasa dengan harga yang sama yakni untuk </span><em style=\"font-family: \'Times New Roman\', serif; font-size: 12pt; letter-spacing: -0.05pt;\">packaging sachet </em><span style=\"font-family: \'Times New Roman\', serif; font-size: 12pt; letter-spacing: -0.05pt;\">Rp 2.500, untuk </span><em style=\"font-family: \'Times New Roman\', serif; font-size: 12pt; letter-spacing: -0.05pt;\">packaging sachet </em><span style=\"font-family: \'Times New Roman\', serif; font-size: 12pt; letter-spacing: -0.05pt;\">isi 5 Rp 6.000/kemasan, untuk </span><em style=\"font-family: \'Times New Roman\', serif; font-size: 12pt; letter-spacing: -0.05pt;\">packaging sachet </em><span style=\"font-family: \'Times New Roman\', serif; font-size: 12pt; letter-spacing: -0.05pt;\">kotak Rp 18.000/kotak.</span></p>\n<p class=\"MsoNoSpacing\" style=\"text-align: justify; line-height: 115%; tab-stops: 14.2pt;\"><span style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',serif; letter-spacing: -.05pt;\"></span></p>',NULL,1,1,'2019-03-13 07:05:52','2019-04-29 19:41:54'),(807,0,'Memory In A Jar','2019 17010024049 Haninda Monesia Thamela.pdf',NULL,7300000,'<p>memory in a jar merupakan suatu hadiah atau gift yang dihadirkan dalam bentuk antimainstream di dalam jar</p>\n<p>&nbsp;</p>','Memory In A Jar |industri kreatif|special gift',4,1,'2019-03-13 07:16:00','2019-03-20 07:03:38'),(808,0,'Mood Plain (Modern Household Plastic Innovations) :Inovasi Usaha Supplier Plasik Modern Berbasis Creative Sales And Digital Marketing','2019 16050423037 Erdhie Rambang Pratama.pdf',NULL,8000000,'<p><span lang=\"EN-US\" style=\"font-size: 12.0pt; line-height: 107%; font-family: \'Times New Roman\',serif; mso-fareast-font-family: Calibri; mso-fareast-theme-font: minor-latin; mso-ansi-language: EN-US; mso-fareast-language: EN-US; mso-bidi-language: AR-SA;\">Usaha ini merupakan usaha yang memiliki kreativitas serta inovasi untuk membuat usaha dibidang perabotan rumahan menjadi lebih prospektif. Karena dalam pengembangan usaha di bidang supplier menggunakan sistem pemasaran berbasis creative sales dan digital marketing, diharapkan nantinya mampu mendorong kemajuan ekonomi kerakyatan di daerah-daerah melalui sistem digital marketing dan skill creative sales yang dimiliki dalam mengenalkan produk dalam negeri.&nbsp;</span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify; text-indent: 36.0pt;\"><span style=\"font-size: 12.0pt; line-height: 107%; font-family: \'Times New Roman\',serif; mso-fareast-font-family: Calibri; letter-spacing: -.05pt; mso-ansi-language: IN;\">Dalam perkemba</span><span lang=\"EN-US\" style=\"font-size: 12.0pt; line-height: 107%; font-family: \'Times New Roman\',serif; mso-fareast-font-family: Calibri; letter-spacing: -.05pt;\">n</span><span style=\"font-size: 12.0pt; line-height: 107%; font-family: \'Times New Roman\',serif; mso-fareast-font-family: Calibri; letter-spacing: -.05pt; mso-ansi-language: IN;\">gannya salah produk yang dijual belikan adalah perabotan rumah tangga dan aksesoris yang memiliki nilai guna </span><span lang=\"EN-US\" style=\"font-size: 12.0pt; line-height: 107%; font-family: \'Times New Roman\',serif; mso-fareast-font-family: Calibri; letter-spacing: -.05pt;\">dan</span><span style=\"font-size: 12.0pt; line-height: 107%; font-family: \'Times New Roman\',serif; mso-fareast-font-family: Calibri; letter-spacing: -.05pt; mso-ansi-language: IN;\"> bermanfaat untuk kegiatan <em style=\"mso-bidi-font-style: normal;\">indoor</em> maupun<em style=\"mso-bidi-font-style: normal;\"> outdoor</em></span> <span lang=\"EN-US\" style=\"font-size: 12.0pt; line-height: 107%; font-family: \'Times New Roman\',serif; mso-fareast-font-family: Calibri; letter-spacing: -.05pt;\">aman untuk penggunaannya </span><span style=\"font-size: 12.0pt; line-height: 107%; font-family: \'Times New Roman\',serif; mso-fareast-font-family: Calibri; letter-spacing: -.05pt; mso-ansi-language: IN;\">. </span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify; text-indent: 36.0pt;\"><span style=\"font-size: 12.0pt; line-height: 107%; font-family: \'Times New Roman\',serif; mso-fareast-font-family: Calibri; letter-spacing: -.05pt; mso-ansi-language: IN;\">Penggunaan perabotan yang tahan lama (awet), mudah dibawa, aman, berkualitas, dan memiliki harga yang terjangkau menjadi sudut pandang yang pasti menjadikan sebuah produk laku di pasaran, sehingga menjadi tolok ukur pemasaran suatu produk untuk memenuhi beberapa aspek tersebut. </span></p>','perabotan rumah tangga aman penggunaan, plastik|sistem pemasaran creative sales and digital marketing',2,1,'2019-03-13 07:23:01','2019-03-15 07:23:12'),(809,0,'Tasku UNESA (Pembatas Buku UNESA)','2019 17010024062 FATIMATUZ ZAHRAH.pdf',NULL,5096700,'<p><span style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; mso-fareast-font-family: Calibri; mso-ansi-language: EN-US; mso-fareast-language: EN-US; mso-bidi-language: AR-SA;\">Tasku UNESA (Pembatasan Buku UNESA) adalah produk berupa pembatas buku yang memiliki desain foto tentang UNESA dan kata-kata motivator yang dimodifikasi se-kreatif mungkin sehingga akan digemari oleh kaum milenial, khususnya mahasiswa UNESA. Terdapat foto tentang unesa, dapat berupa gedung, foto guru besar, dan Dosen UNESA yang didesain semenarik mungkin dan disertai dengan kalimat motivator yang memberi dorongan pada mahasiswa agar lebih giat membaca buku, khususnya bagi mahasiswa semester akhir. Pembatas buku ini memiliki 5 desain yang berbeda agar lebih bervariasi.</span></p>','Tasku|Pembatasbuku|UNESA|FIP|TP|TeknologiPendidikanUNESA',4,1,'2019-03-13 10:11:51','2019-03-14 20:09:54'),(810,0,'JasTipTrans','2019 17020104005 Vindy Agustin.pdf',NULL,10000000,'<p>JasTipTrans adalah jasa titip yang sistemnya dibuat berbeda dengan jasa titip lainnya. JasTipTrans mengutamakan barang-barang yang membutuhkan jasa penerjemah sekaligus sebagai fokus penjualan seperti buku, majalah, novel, komik, dan dvd drama. Cakupan dari JasTipTrans ini tidak hanya terbatas pada satu negara saja dan hal tersebut diharapkan dapat membantu konsumen agar lebih praktis dalam membeli barang-barang dari luar negeri.</p>','Jastiptrans',2,1,'2019-03-13 12:15:42','2019-03-14 03:17:02'),(811,0,'TaJin CuCu (Tas Jinjing Blacu Custom)','2019 17010024048 Asyifa\'un Nufus.pdf',NULL,4000000,'<p>Tas jinjing adalah jenis tas yang mudah dibawa, ringan dan nyaman. Tas jinjing yang kami prosuksi terbuat dari kain blacu, yang mempuyai banyak keunggulan, seperti: tebal, ringan, kuat, dan halus. Tas jinjing blacu custom ini memiliki keunikan, dimana konsumen dapat menentukan desain sesuai dengan keinginannya, dapat berupa gambar vektor 2D, kreasi manik-manik, kreasi kain flanel dan kain percah. Selain untuk kebutuhan fashion, tas jinjing ini juga berguna sebagai pengganti kantong plastik, dimana hal itu bertujuan untuk mengurangi penggunaan kantong plastik juga sebagai bentuk peduli lingkungan untuk mencegah pencemaran tanah. Hal itulah yang menjadi latar belakang terbentuknya usaha &ldquo;TaJin CuCu&rdquo; ini.</p>\n<p>Produk ini dapat digunakan oleh semua kalangan, dari anak-anak hingga dewasa, dengan begitu usaha ini akan mendapatkan banyak peluang di kalangan Masyarakat. Dengan adanya usaha ini maka akan menumbuhkan kreatifitas dan menumbuhkan jiwa wirausaha bagi produsen, memberikan produk yang nyaman untuk konsumen dan memberikan dampak positif bagi lingkungan untuk mengurangi sampah plastik.</p>\n<p>Kami akan mendistribusikan produk ini dibeberapa wilayah di Surabaya, Gresik dan Sidoarjo pada kalangan masyarakat baik dari anak-anak hingga orang dewasa. Kami memasarkan produk ini secara langsung dan secara online. Proses penjualan dimulai dari pengiklanan melalui media sosial, lalu pesanan masuk sesuai dengan desain yang diinginkan konsumen, setelah itu produksi dilakukan, lalu pengemasan produk dan produk siap dikirim ke konsumen.</p>\n<p>Kata kunci yang kami gunakan dalam mengiklankan produk ini adalah Tas Handmade, Tas Keren, Totebag Custom, Kreasi Mahasiswa.</p>','Tas Handmade|Tas Keren|totebag custom|Totebag Custom|Kreasi Mahasiswa',4,1,'2019-03-13 12:54:48','2019-03-14 22:44:31'),(812,0,'Ex-Tanbag : Exclusive Jumputan Bag','2019 16020124056 Ahmad Muzaky Fahim Maftuh.pdf',NULL,14991000,'<p class=\"MsoNormal\" style=\"margin-bottom: 3.0pt; text-align: justify; text-indent: 36.55pt; mso-layout-grid-align: none; text-autospace: none;\"><span style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; mso-ansi-language: IN;\">Berkembangnya trend penggunaan tas disetiap kegiatan sehari &ndash; hari dimasyarakat sangat berkembang pesat pada abad </span><span lang=\"EN-US\" style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\';\">20 ini. Peluang usaha yang bisa diambil dari trend ini adalah usaha industri kreatif akan mampu berkembang pesat dan memiliki pasar yang luas di</span> <span lang=\"EN-US\" style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\';\">masyarakat. Hal tersebut yang membuat kami untuk berinisiasi membuat usaha </span><span style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; mso-ansi-language: IN;\">Ex-Tanbag ini.</span></p>\n<p class=\"MsoNormal\" style=\"margin-bottom: 3.0pt; text-align: justify; text-indent: 36.55pt; mso-layout-grid-align: none; text-autospace: none;\"><span style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; mso-ansi-language: IN;\">Berbagai model dan motif tas yang telah beredar dipasaran sudah marak dan terlalu mainstream di masyarakat. O</span><span lang=\"EN-US\" style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\';\">leh karena itu kami membuat usaha </span><span style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; mso-ansi-language: IN;\">&nbsp;&nbsp;&nbsp;&nbsp;Ex-Tanbag</span><span lang=\"EN-US\" style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\';\"> : </span><span style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; mso-ansi-language: IN;\">Exclusive Jumputan Bag</span><span lang=\"EN-US\" style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\';\"> ini dengan membuat </span><span style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; mso-ansi-language: IN;\">tas</span><span lang=\"EN-US\" style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\';\"> yang tidak mainstream dan memberi kesan </span><span style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; mso-ansi-language: IN;\">unik</span><span lang=\"EN-US\" style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\';\">, keren</span><span style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; mso-ansi-language: IN;\"> dan tentu saja </span><span style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\';\">&nbsp;</span><em><span style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; mso-ansi-language: IN;\">fashionable</span></em> <span style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; mso-ansi-language: IN;\">dengan motif &ndash; motif ekslusif jumputan </span><span lang=\"EN-US\" style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\';\">yang nantinya mampu menjadi alternatif </span><span style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; mso-ansi-language: IN;\">tas</span><span lang=\"EN-US\" style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\';\"> yang bisa menjadi rujukan.</span> <span style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; mso-ansi-language: IN;\">Selain itu usaha ini diharapkan mampu menjadi wadah pelestarian tradisi dan pengenalan kain tradisional Indonesia yaitu tritik jumput pada negara lain. &nbsp;</span></p>\n<p class=\"MsoNormal\" style=\"margin-bottom: 3.0pt; text-align: justify; text-indent: 36.55pt; mso-layout-grid-align: none; text-autospace: none;\">&nbsp;</p>\n<p class=\"MsoNormal\" style=\"margin-bottom: 3.0pt; text-align: justify; text-indent: 36.55pt; mso-layout-grid-align: none; text-autospace: none;\"><span lang=\"EN-US\" style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\';\">Peluang dan keunggulan yang kami miliki membuat kami yakin untuk bisa bersaing diera global dan mampu mewujudkan tujuan program mahasiswa wirausaha untuk mencetak lapangan-lapangan pekerjaan baru dan mencetak wirausaha-wirausaha muda untuk membantu menambah devisa negara, karena seperti yang dikatakan oleh </span><span style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; mso-ansi-language: IN;\">Bambang Soesatya secara persentase, jumlah wirausaha dinegara kita (Indonesia) hanya sekitar 3%. Kalah dari negara tetangga di ASEAN seperti malaysia, Singapura, dan Thailand yang sudah diatas 4%. Berdasarkan hal tersebut </span><span lang=\"EN-US\" style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\';\">&nbsp;kami berusaha untuk turut serta berkontribusi dengan tangan kecil kami untuk impian besar </span><span style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; mso-ansi-language: IN;\">I</span><span lang=\"EN-US\" style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\';\">ndonesia.</span></p>\n<p>&nbsp;</p>\n<p class=\"MsoNormal\" style=\"margin-bottom: 3.0pt; text-align: justify; text-indent: 36.55pt; mso-layout-grid-align: none; text-autospace: none;\">&nbsp;</p>\n<p class=\"MsoNormal\" style=\"margin-bottom: 3pt; text-align: justify; text-indent: 36.55pt;\">&nbsp;</p>','Tas|Jumputan|exclusive|ex-tanbag',4,1,'2019-03-13 13:20:00','2019-03-16 01:53:40'),(813,0,'INOPATIK (INOVASI NOTEBOOK KAIN PERCA BATIK)','2019 17010024020 Melani Fitriana.pdf',NULL,7006300,'<p>INOPATIK adalah Inovasi Notebook Kain Perca Batik yang merupakan produk dengan desain berbeda pada notebook tulis. inovasi ini memanfaatkan sisa potongan kain atau sering disebut dengan kain perca pada kain batik, kain perca ini digunakan untuk sampul pada notebook tulis agar terlihat berbeda dan menarik. Selain itu tidak hanya pada sampul saja namun desain kertas pada notebook tulis ini berbeda dari produk lainnya.&nbsp;&nbsp;</p>','INOPATIK',4,1,'2019-03-13 13:37:28','2019-03-14 20:30:39'),(814,0,'Frozen Food CiZi (Cireng Isi yang Bergizi)','2019 17010024067 SAVINA NUR HIDAYAH.pdf',NULL,5000000,'<p>CiZi (Cireng Isi yang Bergizi) merupakan makanan yang berbahan dasar tepung tapioka, yang mana tepung tapioka terbuat dari singkong yang memiliki beberapa kandungan didalamnya. CiZi merupakan makanan variasi baru yang di update dari makanan sebelumnya yaitu cireng. CiZi sama dengan cireng pada umumnya, namun perbedaannya berada pada varian isinya. Cireng pada umumnya tidak memiliki isi di dalamnya, sedangkan CiZi ini cireng yang memiliki beberapa varian isi.</p>\n<p>Isi dari CiZi memiliki varian yang berguna untuk menambah nilai gizi dari camilan cireng ini dan untuk memberikan menu trobosan baru dari cireng. CiZi memberikan beberapa varian rasa yaitu : 1 . CiZi Mozarela 2. CiZi Sahat 3. CiZi Abon 4. Cizi Ayam yang mana memiliki nilai gizi yang berbeda.&nbsp;</p>\n<p>Produk ini kami buat untuk menambah nilai jual cireng yang pada umumnya hanya dikonsumsi oleh anak-anak kecil dan kurang memiliki gizi yang baik. dengan inovasi ini, kami berharap semua kalangan dapat mengkonsumsi makanan ini dengan kandungan gizi yang baik.</p>\n<p>Target penjualan produk ini adalah mahasiswa unesa dan akan merambat ke masyarakat sekitar kampus terutama ibu-ibu rumah tangga, karena kami berharap makanan ini dapat di konsumsi oleh semua kalangan.</p>\n<p>Proses pembuatan CiZi (Cireng Isi yang Bergizi) ini relatif mudah, karena hanya menggunakan campuran rempah-rempah dan tepung tapioka dan diberikan isi sesuai pilihan.</p>\n<p><span style=\"color: #333333; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif; font-size: 16px;\">Metode yang digunakan dalam pelaksanaan dimulai dengan penyusunan struktur organisasi dan tahapan pelaksanaan program mulai dari persiapan produksi, pelaksanaan produksi, pengemasan, promosi, pemasaran dan evaluasi pelaksanaan program.</span></p>','Cireng Isi|Camilan|Bisnis Inovatif|Camilan Bergizi|Makanan Ringan|Bisnis Makanan',1,1,'2019-03-13 13:53:44','2019-03-14 20:34:08'),(815,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,1,'2019-03-13 13:57:00','2019-03-14 14:00:31'),(816,0,'KRIBO (Keripik Bonggolan) Sebagai Upaya Pelestarian Kearifan Lokal dan Menumbuhkembangkan Sense of Business pada Mahasiswa','2019 16030194051 Fitrah Nadia Rizqiyyah.pdf',NULL,9,'<p class=\"MsoBodyText\" style=\"text-align: justify; line-height: 115%; margin: 0cm 5.5pt .0001pt 0cm;\"><span lang=\"IN\" style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; letter-spacing: -.05pt; mso-ansi-language: IN;\">KRIBO</span> <span lang=\"IN\" style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; letter-spacing: -.05pt; mso-ansi-language: IN;\">(</span><span lang=\"IN\" style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; letter-spacing: -.1pt; mso-ansi-language: IN;\">Keripik Bonggolan</span><span lang=\"IN\" style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; letter-spacing: -.05pt; mso-ansi-language: IN;\">)</span> <span lang=\"IN\" style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; letter-spacing: -.05pt; mso-ansi-language: IN;\">adalah</span> <span lang=\"IN\" style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; letter-spacing: -.05pt; mso-ansi-language: IN;\">sebuah</span> <span lang=\"IN\" style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; letter-spacing: -.05pt; mso-ansi-language: IN;\">inovasi</span> <span lang=\"IN\" style=\"font-size: 12.0pt; line-height: 