ight: 115%; font-family: \'Times New Roman\',\'serif\';\">Harga yang ditawarkan untuk satu bungkus KRIBO adalah Rp. 8.000,00 dengan isi 200 gram. Target pasar <span style=\"letter-spacing: -.05pt;\">dari</span> <span style=\"letter-spacing: -.05pt;\">produk</span> <span style=\"letter-spacing: -.05pt;\">ini</span> <span style=\"letter-spacing: -.05pt;\">yaitu</span> <span style=\"letter-spacing: -.05pt;\">semua</span> <span style=\"letter-spacing: -.05pt;\">kalangan</span> <span style=\"letter-spacing: -.05pt;\">dari</span> </span><span lang=\"IN\" style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; mso-ansi-language: IN;\">remaja hingga dewasa</span><span style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; letter-spacing: -.05pt;\">.</span> <span style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; letter-spacing: -.05pt;\">Proses</span> <span style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; letter-spacing: -.05pt;\">pemasaran</span> <span style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; letter-spacing: -.05pt;\">yang</span> <span style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; letter-spacing: -.05pt;\">dilakukan</span> <span style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; letter-spacing: -.05pt;\">secara</span> <span style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; letter-spacing: -.05pt;\">langsung</span> <span style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; letter-spacing: -.05pt;\">dan</span> <span style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; letter-spacing: -.05pt;\">juga</span> <span style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; letter-spacing: -.05pt;\">melalui</span> <span style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; letter-spacing: -.05pt;\">media</span> <span style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; letter-spacing: -.05pt;\">sosial,</span> <span style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; letter-spacing: -.05pt;\">membuka</span> <span style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; letter-spacing: -.05pt;\">stand</span> <span style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; letter-spacing: -.05pt;\">stand</span> <span style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; letter-spacing: -.05pt;\">kecil,</span> <span style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\';\">dan <span style=\"letter-spacing: -.05pt;\">bekerja</span> sama <span style=\"letter-spacing: -.05pt;\">dengan</span> <span style=\"letter-spacing: -.05pt;\">pemilik</span> toko - toko<span style=\"letter-spacing: -.05pt;\">&nbsp;lain sebagai distributor produk kepada</span> <span style=\"letter-spacing: -.05pt;\">pelanggan</span></span></p>','keripik|bonggolan|sense of bussiness',1,1,'2019-03-13 15:01:20','2019-03-20 00:17:46'),(817,0,'Keripik Pisang Petrok','2019 17010024065 Pramudya Rangga Meirzananda.pdf',NULL,5000000,'<p class=\"MsoNoSpacing\" style=\"text-align: justify; mso-line-height-alt: 1.15pt; tab-stops: 14.2pt;\"><span style=\"font-size: 12.0pt; font-family: \'Times New Roman\',\'serif\'; letter-spacing: -.05pt; mso-ansi-language: IN;\">Pisang merupakan tumbuhan tropis yang biasa hidup di dataran rendah<span style=\"mso-spacerun: yes;\">&nbsp; </span>maupun di dataran tinggi. Sehingga banyak terdapat di berbagai daerah dan mudah mendapatkannya. Keripik pisang merupakan salah satu makanan jajanan yang sangat disukai oleh masyarakat. Cara pembuatannya sangat sederhana dan mudah dikerjakan oleh siapa pun. Dari pemahaman akan dunia usaha, sangat diharapkan produk yang sebaiknya dihasilkan untuk dapat bersaing dan diterima oleh kalangan masyarakat. Oleh karena itu, saya lebih memilih usaha untuk pengolahan keripik pisang. Karena usaha ini terbilang mudah dan cepat di terima oleh masyarakat. Karena keripik pisang sudah tidak asing lagi menjadi makanan ringan yang gurih dan enak ini di kalangan masyarakat, sehingga orang pun tak akan bosan untuk terus mencoba keripik pisang.</span></p>\n<p class=\"MsoNoSpacing\" style=\"text-align: justify; mso-line-height-alt: 1.15pt; tab-stops: 14.2pt;\"><span style=\"font-size: 12.0pt; font-family: \'Times New Roman\',\'serif\'; letter-spacing: -.05pt; mso-ansi-language: IN;\">Karena pisang merupakan bahan utuma dalam pembuatan keripik pisang ini maka saya akan memilih kualitas dan mutu pisang yang baik. Dalam pembuatannya pun<span style=\"mso-spacerun: yes;\">&nbsp; </span>mudah dan sederhana sehingga tidak mengurangi kualitas dan mutu produk. Selain itu juga saya akan melakukan pengemasan pada keripik pisang<span style=\"mso-spacerun: yes;\">&nbsp; </span>yang sudah di produksi dengan kemasan yang sederhana tetapi tidak mengurangi nilai dan rasa dari keripik pisang ini. Keripik pisang dapat menjadi salah satu alternanif makanan ringan yang praktis, dan hemat.</span></p>','#keripik|#pisang|#petrok',1,1,'2019-03-13 15:25:59','2019-03-19 06:34:58'),(818,0,'VCO (Virgin Coconut Oil)','2019 17010024022 Lelly Suherawati.pdf',NULL,3605000,'<p>VCO merupakan olahan minyak kelapa murni yang bermanfaat bagi kesehatan tubuh. VCO diolah tanpa proses pemanasan dan tidak menggunakan bahan kimia</p>','VCO',1,1,'2019-03-13 15:26:23','2019-03-15 01:16:04'),(819,0,'Light Up','2019 17020104028 Soraya Juliestya Ahmad.pdf',NULL,1967500,'<p><span lang=\"IN\" style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',serif; mso-fareast-font-family: Calibri; letter-spacing: -.05pt; mso-ansi-language: IN; mso-fareast-language: EN-US; mso-bidi-language: AR-SA;\">Di era globalisasi saat ini, banyak sekali usaha bisnis yang didirikan. Salah satunya di bidang kerajinan.&nbsp;</span><span lang=\"IN\" style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',serif; letter-spacing: -.05pt; mso-ansi-language: IN;\">Para pemilik cafe berlomba-lomba untuk membuat cafenya terlihat menarik. Hiasan yang paling banyak dipake salah satunya adalah lampion.&nbsp;</span><span style=\"font-family: \'Times New Roman\', serif; font-size: 12pt; letter-spacing: -0.05pt;\">Saat ini banyak sekali kreasi bahan untuk membuat lampion. Mulai dari lampion dengan bahan benang jahit, benang bol, dakron, kertas berwarna, dan masih banyak lagi. K</span><span style=\"font-family: \'Times New Roman\', serif; font-size: 12pt; letter-spacing: -0.05pt;\">ami memilih lampion sebagai bentuk usaha yang ingin kami kembangkan. Kami ingin membuat lampion dengan bahan utamanya yaitu berupa benang bol.&nbsp;</span><span style=\"font-family: \'Times New Roman\', serif; font-size: 12pt; letter-spacing: -0.05pt;\">Oleh karena itu, kami ingin membuat lampion dari benang bol yang nantinya akan kami perjualkan tidak hanya untuk cafe ataupun restauran saja, tetapi untuk masyarakat umum juga dengan harga yang terjangkau.</span></p>','lampion',4,1,'2019-03-13 15:34:46','2019-03-15 16:41:13'),(820,0,'Nourish Dimsuyam (Dimsum Udang Ayam)','2019 16010664082 Putri Ni\'mala Sari.pdf',NULL,7221000,'<p class=\"MsoNoSpacing\" style=\"margin-left: 2.0cm; text-align: justify; text-indent: 1.0cm; line-height: 150%; tab-stops: 14.2pt;\"><span style=\"font-size: 12.0pt; line-height: 150%; font-family: \'Times New Roman\',serif; letter-spacing: -.05pt; mso-ansi-language: IN;\">Pada deskripsi usaha dan penjabaran yang telah dijelaskan bahwa produk kami &ldquo;Nourish Dimsuyam&rdquo; ini berawal dari keinginan untuk menginovasi makanan yang berasal dari percampuran budaya antara Cina dan Indonesia. Lidah dari orang Indonesia menerima Dimsum yang merupakan makanan asli dari negara Cina ternyata diterima di Indonesia, jadi kami mengambil kesempatan ini untuk mengembangkan sebuah Dimsum yang lebih sehat dan juga lezat. Maka dari itu, lahirlah Nourish Dimsuyam yang menambah jajaran makanan sehat dan lezat yang dapat dikonsumsi oleh semua kalangan masyarakat. </span></p>\n<p class=\"MsoNoSpacing\" style=\"margin-left: 2.0cm; text-align: justify; text-indent: 1.0cm; line-height: 150%; tab-stops: 14.2pt;\"><span style=\"font-size: 12.0pt; line-height: 150%; font-family: \'Times New Roman\',serif; letter-spacing: -.05pt; mso-ansi-language: IN;\">Pembuatan produk &ldquo;Nourish Dimsuyam&rdquo; dibuat dengan memilih bahan-bahan yang masih fresh dan tanpa bahan pengawet. Hal ini juga akan memberikan rasa yang tentu berbeda dari Dimsum-Dimsum yang cepat saji di luar sana.</span></p>','Nourish Dimsuyam|Dimsum|Sarapan Sehat|Makanan',1,1,'2019-03-13 15:36:16','2019-03-15 02:20:14'),(821,0,'Salad buah mang ru\'ut','2019 16010664015 Monalita Nurindahsari Pratiwi.pdf',NULL,5900000,'<p>Pada umumnya salad buah memiliki wadah yang terbuat dari mika. Kami ingin membuat inovasi yaitu membuat wadah pada salad buah yang terbuat dari rumput laut. Tujuan dibentuknya wadah yang terbuat dari rumput laut adalah untuk mengurangi sampah plastik yang semakin menumpuk di Indonesia. Selain untuk mengurangi sampah plastik, rumput laut juga kaya akan vitamin dan mineral.</p>','Salad Buah|Mangkok|Rumput laut|wadah',1,1,'2019-03-13 16:25:22','2019-03-15 02:19:04'),(822,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,1,'2019-03-13 16:28:57','2019-03-13 19:44:19'),(823,0,'KRIPTUR ( Kripik Kembang Turi)','2019 17040254116 Atika dwi afitasari.pdf',NULL,5000000,'<p class=\"MsoListParagraph\" style=\"mso-add-space: auto; mso-para-margin-top: 0in; mso-para-margin-right: 0in; mso-para-margin-bottom: .0001pt; mso-para-margin-left: 0gd; text-align: center; text-indent: 0in; mso-char-indent-count: 0; line-height: 150%; tab-stops: 14.2pt; border: none; mso-padding-alt: 31.0pt 31.0pt 31.0pt 31.0pt; mso-border-shadow: yes; margin: 0in 0in .0001pt 35.9pt;\" align=\"center\"><span style=\"font-size: 12.0pt; line-height: 150%; font-family: \'Times New Roman\',\'serif\'; mso-fareast-font-family: \'Times New Roman\'; color: black;\"><strong>KRIPTUR</strong></span></p>\n<p class=\"MsoNormal\" style=\"margin-left: 0in; mso-para-margin-left: 0gd; text-align: justify; text-indent: 35.9pt; mso-char-indent-count: 0;\"><span style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; mso-fareast-font-family: \'Times New Roman\'; color: black;\">Kembang turi merupakan salah satu tumbuhan yang bias kita jumpai di sawah ,kebun maupun perkarangan rumah. Namun kembang turi ini mempunyai banyak khasiat untuk kesehatan<span style=\"mso-spacerun: yes;\">&nbsp; </span>mengobati darah tinggi,membantu proses penyembuhan luka,mengobati rabun senja,untuk mengobati sariawan. Dengan banyaknya khasiat yang di hasilkan kembang turi sehingga dapat menarik para pembeli karena khasiatnya yang banyak untuk kesehatan. Jadi kriptur ini adalah camilan yang sangat mempunyai banyak manfaat jadi dapat dikatakan camilan sehat. Kriptur adalah makanan yang harganya terjangkau dan makanan yang mengandujarang sekali orang yang mengetahui tentang khasiat kembang turi ini maka dari itu kami mengemas sedemikan rupa kripik kembang turi ini agar banyak peminatnya. Produk kriptur ini juga tidak pernah ditemukan dipasaran sehingga dapat dikatakan bahwa produk kriptur ini adalh produk baru yang akan mengundang banyak peminat camilan untuk mencoba camilan ini.</span></p>','kembang|turi|camilan|sehat',1,1,'2019-03-13 16:36:06','2019-03-15 00:44:07'),(824,0,'\"Ayam Kampus\" Surabaya','2019 16020124026 panji bagas setiyo abdi.pdf',NULL,12864000,'<p>Usaha \"Ayam Kampus\" Surabaya ini bergerak dibidang makanan atau kuliner. menghadirkan nuansa baru yakni makanan kekinian yang berbahan dasar ayam. keunikan dari produk \"Ayam kampus\" Surabaya sendiri berasal dari proses pembuatan hingga cara penyajiannya. ayam kentucky fillet yang diberikan bumbu spesial berupa saos racikan dan dibubuhi dengan biji wijen. dalam penyajiannya, pembeli akan disuguhkan dengan tingkatan rasa pedas yang berbeda-beda. untuk tingkat kepedasannya, kami beri nama \"si 8 semester\" yakni, tingkat kepedasan dari level satu hingga level delapan. keunikan lainnya dapat ditemukan dari segi kemasan, dimana ada pengurangan jumlah plastik yang dipakai dan tergantikan oleh paper cup dan artpaper.</p>\n<p>dalam segmentasi peluang usaha \"Ayam Kampus\" Surabaya memiliki peluang yang cukup besar. dilihat dari segi harga yang relatif terjangkau dan mudah didapatkan. untuk harga perproduk, kami patok seharga Rp. 10.000,- (sebelum dilakukan pengembangan). target utama dalam pemasaran produk \"Ayam Kampus\" Surabaya adalah mahasiswa dan masyarakat pada umumnya. dalam realitasnya, \"Ayam Kampus\" Surabaya telah beroperasi dan melakukan proses produksi selama dua tahun. namun, tetap membutuhkan pengembangan usaha dalam peningkatan kualitas produk dan efektifitas proses promosi. oleh karena itu, tercapainya pengajuan proposal PMW ini sangat kami harapkan agar dapat mengembangkan produk \"Ayam Kampus\" Surabaya. yakni dalam segi peningkatan harga jual dan manfaat lain untuk masyarakat luas.</p>','PMW|Ayam Kampus|Ayam Kampus Surabaya',1,1,'2019-03-13 16:41:31','2019-03-15 07:25:31'),(825,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,'2019-03-13 16:46:08','2019-03-13 16:46:08'),(826,0,'FUTTY (Fungi Patty)','2019 17010664010 Nina Puji Iswati.pdf',NULL,3168000,'<p>Futty yaitu suatu olahan makanan yang terbuat dari jamur tiram, jamur tiram ini memiliki kandungan gizi yang sangat tinggi terutama protein. Kandungan protein yang terdapat dalam jamur tiram lebih tinggi daripada kandungan protein didalam daging sapi dan ayam. Futty sendiri merupakan suatu inovasi baru dalam mengola jamur tiram dengan meawarkan berbagai macam rasa varian yaitu original, rendang, lada hitam, barbeque dan didalam futty sendiri memiliki tingkatan varian kepedasan mulai dari S,M,L, dan XL. Dengan memiliki varian rasa dan tingkat kepedasan yang bervarian, produk kami Futty dapat digemari konsumen dari segala macam usia.</p>','FUTTY|Jamur Tiram|Program Mahasiswa Wirausaha',1,1,'2019-03-13 16:47:14','2019-03-14 23:20:32'),(827,0,'Crenyit-Crenyit Legit','2019 17010644112 RERIN DWI ANGGRAENI.pdf',NULL,7000000,'<p>Penulisan karya tulis ini bertunjuan untuk memaparkan pemanfaatan kunyit sebagai inovasi makanan ringan dalam bentuk ice cream. Adapun yang menjadi latar belakang penulisan iki karena indonesia merupakan salah satu negara yang memiliki kekayaan alam yang melimpah khusunya jenis tanaman. Salah satu tanaman yang banyak ditemukan di indonesia yaitu tanaman kunyit. Tanaman kunyit merupakan salah satu tanaman toga yang kaya akan manfaat dan juga kunyit mudah sekali untuk ditemukan serta harganya terjangkau. Alasan-alasan tersebut yang menjadikan kami untuk membuat inovasi ice cream kunyit, dengan nama produk kami yaitu Crenyit-Crenyit Ice Cream Kunyit.</p>\n<p>Crenyit-Crenyit Ice Cream Kunyit ini memiliki potensi yang baik untuk dikembangkan menjadi makanan ringan alternatif yang kaya akan manfaatnya. Hal ini dilihat dari kehidupan masyarakat zaman dulu yang senang akan jamu kunyit sehingga memiliki kesehatan yang baik, tetapi saat ini banyak anak muda kurang menyukai jamu dengan alasan rasanya yang pahit. Dengan Crenyit-Crenyit Ice Cream Kunyit ini kami mengemas kunyit tanpa rasa pahit yang tidak akan menghilakan manfaatnya dan juga diharapkan banyak diterima oleh masyarakat khususnya anak muda.&nbsp;</p>','Makanan ringan, kunyit, ice cream.|Makanan ringan|Ice cream|Kunyit',1,1,'2019-03-13 16:48:34','2019-03-17 18:18:20'),(828,0,'Harajuku Pomade','2019 17020104007 eka sanditya rahmatulloh.pdf',NULL,500000,'<p>Berikut adalah proposal rencana dari kami yang berupa tugas UTS dari mata kuliah KWU.&nbsp;</p>','kosmetik',4,1,'2019-03-13 17:12:33','2019-03-15 00:43:06'),(829,0,'Bolu Sawo','2019 17010014018 Ade Chika Fidalika.pdf',NULL,5046000,'<p>Keunikan dan Keunggulan dari olahan bolu sawo ini, terletak pada bahan <em>dasar</em> yang digunakan untuk membuatnya yaitu buah sawo. Buah yang memiliki warna kulit serta warna daging yang coklat dengan rasa khas sawo yang manis membuat banyak orang menyukai buah ini. Tetapi banyak orang menyantap buah ini secara langsung. Oleh karena itu, kami disini akan membuat inoasi baru olahan dari sawo agar masyarakat luas tahu bahwa buah sawo juga dapat diolah menjadi kudapan yang enak dan kaya akan nutrisi.</p>','Bolu Sawo|makanan|bolu|sawo|enak|nutrisi',1,1,'2019-03-13 17:35:58','2019-03-20 00:57:04'),(830,0,'BOWO (Burger Jowo) Geprek','2019 17020084027 Minhatul Maula.pdf',NULL,6925000,'<p><span lang=\"EN-AU\" style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; mso-fareast-font-family: Calibri; letter-spacing: -.05pt; mso-ansi-language: EN-AU; mso-fareast-language: EN-US; mso-bidi-language: AR-SA;\">BOWO (Burger Jowo) Geprek adalah makanan transformasi dari salah satu kuliner asli Indonesia, yaitu nasi ayam geprek. Burger ini berkomposisi sama seperti nasi ayam geprek pada umumnya yakni nasi, ayam geprek dan selada. Namun yang membuatnya unik yakni bentuknya yang serupa dengan burger, hanya saja rotinya diganti dengan nasi. Burger ini sangat &nbsp;praktis karena menggunakan fillet daging ayam sehingga cocok bagi orang yang memiliki banyak kesibukan. Selain itu, BOWO (Burger Jowo) Geprek dikemas dengan packaging yang menarik yakni dengan motif batik yang menunjukkan ciri khas Indonesia.</span></p>','burger|BURGER|AYAM|NASI|JOWO|GEPREK',1,1,'2019-03-13 17:37:04','2019-03-15 03:13:37');
