man\";\r\n	mso-fareast-language:EN-US;}\r\n</style>\r\n<![endif]--></p>\r\n<p class=\"MsoNoSpacing\" style=\"text-align: justify; line-height: 150%; tab-stops: 14.2pt;\"><span lang=\"IN\" style=\"font-size: 12.0pt; line-height: 150%; font-family: \'Times New Roman\',serif; color: black; mso-themecolor: text1; letter-spacing: -.05pt; mso-ansi-language: IN;\">Candle Aromatheraphy </span><em style=\"mso-bidi-font-style: normal;\"><span lang=\"IN\" style=\"font-size: 12.0pt; line-height: 150%; font-family: \'Times New Roman\',serif; letter-spacing: -.05pt; mso-ansi-language: IN;\">Blumengarten </span></em><span lang=\"IN\" style=\"font-size: 12.0pt; line-height: 150%; font-family: \'Times New Roman\',serif; letter-spacing: -.05pt; mso-ansi-language: IN;\">adalah lilin aroma terapi yang menghadirkam bahan alami buah-buahan dan tumbuhan alami didalamnya. Selain sebagai lilin aroma terapi dengan kemasan yang unik<span style=\"color: black; mso-themecolor: text1;\"> Candle Aromatheraphy </span><em style=\"mso-bidi-font-style: normal;\">Blumengarten</em> juga intagramable untuk difoto maupun menjadi pajangan ataupun menjadi kado untuk orang tercinta .</span></p>','Candle|aromatherapy',4,1,'2019-03-13 17:39:32','2019-03-18 19:29:39'),(832,0,'LUMBA-LUMBA (lumpia mie bandeng)','2019 17040254010 Viochita Navyanda Rindianingkasih.pdf',NULL,6044250,'<p>Makanan adalah kebutuhan pokok setiap manusia. Salah satu jenisnya adalah lumpia, terdapat berbagai macam jenis lumpia seperti lumpia rebung, lumpia ayam, dan lumpia wotel. Namun jenis lumpia tersebut sudah banyak dijumpai di kalangan masyarakat. Sehingga pada waktu ini penulis membuat inovasi yang belum pernah ada dikalangan masyarakat yaitu lumpia mie bandeng atau yang biasa penulis sebut sebagai LUMBA-LUMBA. Inovasi ini memadukan kelezatan mie dan kegurihan bandeng yang dilengkapi dengan segarnya wortel. Bandeng yang digunakan adalah bandeng yang sudah diolah menjadi lembaran dendeng dan tanpa duri. LUMBA-LUMBA ini memiliki kandungan kalsium, zat besi, serat, vitamin B1, dan vitamin A yang baik untuk tubuh. Oleh karena itu penulis membuat inovasi ini dengan harapan bisa memenuhi kebutuhan pokok masyarakat dan mampu bersaing di tengah ramainya industri kuliner Indonesia.</p>','Makanan|Lumpia|Inovasi|LUMBA-LUMBA|Usaha',1,1,'2019-03-13 17:55:05','2019-03-19 05:50:52'),(833,0,'Acrylifers (Acscesoris Fairys Catalis Flowers)','2019 16020124044 Dina puji pebrianti lestari.pdf',NULL,4535678,'<p>Acrylifers adalah produk yang menjual berbagai aksesoris seperti kalung, gelang, bross, bandana, anting hijab, jepit dari bahan resin, catalis dan bunga asli. Dengan desain yang fashionable dan menjadi trend-senter. cocok dipakai untuk semua kalangan. Acrylifers menghadirkan tema dengan mengangkat karakter kepribadian disetiap jenis aksesorisnya.&nbsp;</p>','enter|Acrylifers',4,1,'2019-03-13 18:02:41','2019-03-15 01:13:30'),(834,0,'Hot Room Record Studio','2019 17020084028 Muhammad Pierre Persada Dien.pdf',NULL,14500000,'<p>Surabaya adalah salah satu kota dengan musisi terbanyak di Indonesia selain Bandung dan Jakarta. Selain itu, di wilayah Surabaya khususnya Surabaya Barat belum banyak terdapat studio rekaman yang menawarkan jasa rekam audio. Hot Room Recording Studio menawarkan jasa rekam audio untuk jenis <em>full band</em>, akustik, dan karaoke di wilayah Surabaya Barat. Dilihat dari tingkat persaingan jenis usaha serupa di wilayah Surabaya Barat, maka Hot Room Recording Studio memiliki potensi yang besar untuk berkembang di industri musik khususnya wilayah Surabaya.</p>','Jasa recording|Home recording|Surabaya|Indie Surabaya|Band|Akustik',2,1,'2019-03-13 18:03:33','2019-03-14 20:04:32'),(835,0,'KEKAR BERISI (Ketan Bakar Bervariasi Isi)','2019 16010664069 Galih Indro Prahastho.pdf',NULL,8510000,'<p>Ketan bakar dibuat untuk menumbuhkan kembali cikal bakal makanan tradisional khas Indonesia. Manfaat yang didapatkan dari ketan bakar ini merupakan jenis makan yang tanpa pengawet sehingga aman untuk kesehatan. Ketan bakar yang dibuat mempunyai variasi isi yang berbeda dari biasanya, meskipun membuat inovasi makanan ketan bakar ini menjadi menarik namun tidak menghilangkan penyajian tradisionalnya.</p>','Ketan bakar|Makanan tradisional|Variasi',1,1,'2019-03-13 18:04:06','2019-03-15 02:09:33'),(836,0,'AKATA KOPI','2019 17010664084 Atanasius Yudistira P.pdf',NULL,6275000,'<p>AKATA KOPI merupakan&nbsp;<em>start up</em> di bidang industri minuman. lebih tepatnya minuman kopi kekinian siap saji. kelompok kami menawarkan suatu inovasi dalam menikmati kopi yaitu kami mencampurkan kopi dengan sari buah. buah yang kami gunakan ialah kelengkeng dan alpukat. buah tersebut kami pilih karena memiliki rasa yang ringan dan manis juga tidak menghilangkan rasa asli kopi tersebut. proses pembuatannya yaitu pertama biji kopi dihancurkan menggunakan coffee grider kemudian di seduh menggunakan mesin expresso sehingga menghasilkan kopi yang ringan serta tanpa ampas. kemudian ditambah dengan gula, susu dan sari buah sehingga menghasilkan rasa yang ringan dan manis. terakhir ditambahkan es batu dan di press bagian atasnya agar tidak mudah tumpah dan terasa segar untuk dinikmati. produk ini dapat dinikmati dimanapun dan kapanpun dan cocok untuk semua kalangan.</p>','Kopi|Buah|Kekinian|Minuman|Segar|Dingin',1,1,'2019-03-13 18:05:18','2019-03-16 03:48:31'),(837,0,'Servis computer dan laptop','2019 17040254095 TA\'IBUR RACHMAN.pdf',NULL,1500000000,'<p>Teknologi yang berkembang begitu pesat menuntut semua pihak yang aktivitas hidupnya terikat dengan perangkat tersebut untuk segera menyesuaikan diri baik dalam kebutuhan hardware maupun skill. Hal tersebut bukanlah mengikuti tren semata, namun lebih berorientasi pada kelancaran kerja ataupun aktivitas yang dilakukan sehari-hari. Yang tentu saja dengan adanya teknologi baru, baik hardware maupun software akan sangat mendukung terhadap kecepatan dan kekuatan hasil kinerja di segala bidang.</p>\n<p>Komputer merupakan salah satu hasil produk teknologi yang banyak dipakai dalam menunjang aktivitas kerja sebuah lembaga maupun perorangan/individu. Karena dengan kebutuhan perangkat tersebut mampu mempercepat dan kesempurnaan aktivitas kerja. Namun di sisi lain, tingginya ketergantungan aktivitas kerja pada komputer akan berdampak secara langsung pada kemampuan kinerja perangkat itu sendiri.</p>\n<p><span style=\"font-size: 14px;\">&nbsp;</span></p>\n<p><span style=\"font-size: 14px;\">&nbsp;</span></p>\n<p><span style=\"font-size: 14px;\">&nbsp;</span></p>\n<p>Proposal Program Mahassiwa Wirausaha 2019 | 6</p>\n<p>Meningkatnya pengguna komputer dan juga banyaknya pengguna perangkat tersebut yang tidak mampu menangani beberapa masalah terkait dengan kerusakan sistem operasi, kerusakan hardware, atau kerusakan fisik memberi peluang tersendiri bagi para teknisi komputer dan untuk membuka usaha dibidang penservisan komputer. Persaingan usaha jasa service komputer yang ada di kota-kota besar karena banyaknya pihak yang membuka usaha tersebut, namun peluang usaha tersebut masih cukup menjanjikan untuk dijalankan. Atas dasar pemikiran itulah maka kami membuat proposal ini yang mempunyai kecakapan ilmu di bidang&nbsp; trouble shooting komputer baik hardware maupun software berinisiatif mendirikan usaha jasa service komputer yang dapat dipercaya konsumen dan akurat.</p>','jasa servis computer dan laptop',2,1,'2019-03-13 18:07:43','2019-03-15 00:33:40'),(838,0,'MARTABAR (MARTABAK BAR-BAR)','2019 17010024058 Imam Maulana Putra.pdf',NULL,5414000,'<p class=\"MsoNormal\" style=\"margin-right: 13.3pt; text-align: justify; line-height: 150%;\"><span style=\"font-size: 12.0pt; line-height: 150%; font-family: \'Times New Roman\',\'serif\'; mso-fareast-font-family: Ebrima;\">Pengembangan usaha kami bermula dari banyaknya inovasi makanan atau kuliner yang menyediakan level kepedasan</span><span lang=\"IN\" style=\"font-size: 12.0pt; line-height: 150%; font-family: \'Times New Roman\',\'serif\'; mso-fareast-font-family: Ebrima; mso-ansi-language: IN;\">.</span><span style=\"font-size: 12.0pt; line-height: 150%; font-family: \'Times New Roman\',\'serif\'; mso-fareast-font-family: Ebrima;\"> Berangkat dari itu kami mencoba untuk mengambil peluang dengan inovasi makanan pedas berupa martabak telur dengan level kepedasan.</span></p>','MARTABAR|bar bar|martabak bar bar',1,1,'2019-03-13 18:07:58','2019-03-15 02:07:00'),(839,0,'OPAK SETAN GRIMIS (Opak Pedas, Gurih, Manis)','2019 17040674064 sulis setyowati.pdf',NULL,13230000,'<p><strong>OPAK SETAN GRIMIS (Opak Pedas, Gurih, Manis)</strong></p>\n<p>Usaha ini merupakan usaha yang bergerak dibidang makanan dan minuman dengan menggunakan bahan dasar singkong, yang menjadikannya kerupuk saripati singkong atau yang disebut opak, yang dikombinasikan dengan beberapa varian bahan lain sebagai varian rasa dari produk ini. Sehingga OPAK SETAN GRIMIS dapat dikatakan sebagai makanan yang masih tergolong baru di Surabaya dan dapat menjadi inovasi baru dari makanan tradisional pedesaan yang diolah menjadi berbagai varian rasa yang menarik. Selain itu OPAK SETAN GRIMIS ini menggunakan bahan-bahan kombinasi antara bahan tradisional menjadi dengan bahan modern. Dan tanpa menggunakan pengawet apapun, karena kelebihan OPAK sendiri tidak mudah kadaluarsa.</p>\n<p>OPAK SETAN GRIMIS dikemas menggunakan plastik Standing pouch clip berukuran 100 gr sehingga lebih mudah untuk dibawa dan saat dinikmati lebih mudah untuk meletakkannya, karena standing pouch sendiri dapat berdiri tanpa harus dipegang. Selain itu apabila konsumen tidak habis dalam waktu itu juga maka dapat ditutup lagi karena terdapat klip dimulut plastik kemasan, sehingga akan menambah nilai kepraktisan. Rasa yang ditawarkan dari produk ini adalah memiliki 4 varian rasa, yaitu Pedas, Vanila, Coklat dan Matcha. Khusus untuk rasa pedas ini memiliki 3 level, yakni dari yang terendah level Toeyoel, level Middle yaitu Potjong, dan level tertinggi yaitu Gendroewo.</p>\n<p>Sistem pemasaran yang kami gunakan adalah dengan melakukan pemasokan kepada mitra-mitra usaha seperti sentra camilan, kantin sekolah, dan minimarket. Dalam sistem pemasaran ini kami tidak menggunakan sistem return terhadap barang yang tidak laku. Pada mitra kami memberikan laba sebesar Rp. 500,- sampai Rp. 1000,- per pcs nya. Selain pemasaran offline kami juga melakukan pemasaran Online melalui media sosial yaitu instagram, Line, Facebook dengan sistem pesan.</p>','makanan dan minuman',1,1,'2019-03-13 18:10:48','2019-03-18 20:45:55'),(840,0,'PUDING TELUR NAGA YANG SEHAT DAN NIKMAT','2019 17010644086 Mochamad fathurrizqi.pdf',NULL,5115000,'<p>Puding telur naga merupakan makanan inovasi dari olahan buah naga dimana puding ini berbentuk telur. Bahan dasar yang digunakan dalam olahan ini adalah buah naga yang memiliki banayk manfaat diantaranya mencegah kanker, meredakan batuk dan asma,meningkatkan sistem kekebalan tubuh, mencegah keguguran dan kelahiran prematur, mencegah penuaan dini, serta menjaga kulit agar tidak kering. Alasan kami menggunakan buah naga sebagai bahan dasar olahan puding kami selain karena buah naga yang kaya manfaat, namun juga dikarenakan harga buah naga yang dijual oleh petani buah naga turun di pasaran.</p>','puding telur naga|puding|buah naga|sehat',1,1,'2019-03-13 18:14:56','2019-03-15 01:47:20'),(841,0,'Lemper Sushi Tinggi Gizi','2019 17010644060 Ulfa Qurratul Aini.pdf',NULL,4807000,'<p>Prospek makanan cepat saji berkembang pesat saat ini. Hal itu memberi peluang pada para wirausahawan baru yang akan memulai usaha yaitu usaha makanan cepat saji. Tetapi makanan cepat saji yang ada terkadang tidak memikirkan kandungan gizi di dalamnya. Oleh sebab itu, kami disini ingin memulai usaha dengan memanfaatkan peluang yang ada yaitu membuat produk Lemper Sushi Tinggi Gizi. Dimana lemper yang dikenal dengan makanan tradisional, kini akan dikemas menjadi makanan yang lebih modern yaitu sushi. Isian dari sushi ini bervariasi, mulai dari sayuran (selada, timun, tomat, kentang, dan wortel), sosis (ayam, sayuran, dan ikan), keju dan daging (ikan tongkol dan tuna).</p>\n<p>Dari segi ekonomis, harga olahan ini cukup murah dan sangat pas di semua kalangan. Tidak hanya cita rasanya yang didapatkan, tetapi gizinya juga.</p>','Lemper Sushi|Ekonomis|Bergizi',1,1,'2019-03-13 18:22:45','2019-03-14 22:27:43'),(842,0,'Cilok Kang (Kulit Pisang) Bandung','2019 17010644087 Eko Rahmad Juniawan.pdf',NULL,6306997,'<p><span style=\"text-align: justify;\">Kulit pisang adalah salah satu limbah organik yang masih bernilai gizi tinggi. Kandungan kulit pisang diantaranya karbohidrat, protein, lemak, kalsium, zat besi, fosfor, beberapa vitamin seperti vitamin B dan C, serta air. Salah satu makanan yang digemari semua kalangan mulai dari anak pra sekolah, SD, SMP, sampai orang tua salah satunya adalah cilok. Cilok berbahan dasar tepung kanji, kurang bergizi tanpa tambahan bahan lain. perlu adanya inovasi baru, yaitu cilok dengan tambahan bahan dasar kulit pisang. Untuk menambah cita rasa dan tampilan, maka untuk penyajian diberikan varian rasa yang kekinian atau level pedas, dan sebagainya sehingga cilok berbahan dasar pisang ini dapat bersaing dipasaran dan tentunya keberlangsungan usaha dapat dijamin karena disukai semua kalangan dengan harga yang terjangkau yaitu Rp 7.000,-/porsi.</span></p>','Cilok|Bandung|Kulit pisang',1,1,'2019-03-13 18:23:55','2019-03-19 18:38:13'),(843,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,1,'2019-03-13 18:28:34','2019-03-14 19:45:59'),(844,0,'Lek Napi Tobat','2019 17010644120 Mutiara Sinnta Pancerindani.pdf',NULL,5592000,'<p>Leker merupakan jajanan khas kota Surabaya, jajanan yang terbuat dari olahan tepung, susu, telur, air, dan gula dengan isi yang terdiri dari potongan pisang, meses, dan susu kental manis.&nbsp;</p>\n<p>Jajanan leker sangat diminati oleh semua kalangan masyarakat, terutama anak-anak karena pada umumnya leker dijual di sekitar sekolah-sekolah. Banyak anak yang<strong> lebih menyukai jajanan dari pada sayur-sayuran dan buah-buahan</strong>, sehingga nutrisi tubuh mereka kurang akan sayur dan buah.&nbsp;</p>\n<p>Berkaca dari hal tersebut, kami berinovasi untuk mengembangkan leker menjadi jajanan yang dapat memenuhi kebutuhan nutrisi akan sayur dan buah. Leker yang kami buat bahan dasarnya sama dengan leker pada umumnya, hanya saja kami menambahkan olahan sayur dan buah seperti, <strong>Nanas, Pisang, Tomat, Bayam, dan Timun</strong> pada kulit leker, dan kami memberi variasi pada isi leker seperti <strong>pisang, meses, coklat, susu kental manis, keju, dan oreo.</strong></p>','jajanan|leker|sayur|buah|nutrisi|anak-anak',1,1,'2019-03-13 18:30:31','2019-03-15 05:57:07'),(845,0,'Vegepie','2019 17010644072 Niken Aruna Timur.pdf',NULL,4894000,'<p>Vegepie merupakan makanan yang berupa pie namun dibuat dengan bahan sayuran. Sayuran yang kami buat yaitu bayam dan wortel. Produk ini dibuat dengan tujuan untuk meningkatkan konsumsi sayur di masyarakat. Dengan Vegepie, masyarakat yang suka mengonsumsi sayur akan tertarik dengan vegepie. Begitu pula dengan yang tidak suka sayur akan tertarik untuk merasakan manfaatnya karena vegepie merupakan pie yang dikenal dan disukai masyarakat luas.</p>','Vegepie|Pie Sayuran|Pie sehat|Sayuran',1,1,'2019-03-13 18:38:13','2019-03-14 23:39:41'),(846,0,'Singkong Gembul','2019 16021254007 Lucky hermansyah.pdf',NULL,7647000,'<p class=\"MsoNoSpacing\" style=\"text-align: justify; line-height: 150%; tab-stops: 14.2pt;\"><span style=\"font-size: 12.0pt; line-height: 150%; font-family: \'Times New Roman\',serif; letter-spacing: -.05pt;\">Singkong Gembul ( gurih enak mantap betul ) memiliki keunikan di rasa,tekstur dan penyajian serta pengemasan , yang mana pada umumnya singkong hanya hanya di goreng dan terlalu banyak minya, tapi produk kami mengandung sedikit minyak dan menggunakan toping keju yang lumer dan susu dan juga ada varian rasa dengan toping daging olahan yang memiliki rasa manis , asin gurih dan tekstur yang empuk lembut , </span></p>\n<p class=\"MsoNoSpacing\" style=\"text-align: justify; line-height: 150%; tab-stops: 14.2pt;\"><span style=\"font-size: 12.0pt; line-height: 150%; font-family: \'Times New Roman\',serif; letter-spacing: -.05pt;\">manfaat produk kami bagi masarakat adalah , karena singkong adalah karbohidrat dan toping yang kami gunakan merupakan keju dan susu yang kaya akan kalsium , produk kami selain mengenyangkan, menyehatkan juga memiliki citarasa yang lumerr di lidah juga kayak akan kalsium yang baik untuk tulang serta daging yang mengandung protein hewani , dan singkong ini kami yakini ketika sangat di gemari oleh masyarakat akan membantu percepatan perputaran penjualan singkong di kalangan petani singkong , kami juga akan langsung bermitra dengan para petani untuk mencari singkong dengan kualitas yang super agar produk kami memiliki kualitas yang baik,</span></p>\n<p class=\"MsoNoSpacing\" style=\"text-align: justify; line-height: 150%; tab-stops: 14.2pt;\"><span style=\"font-size: 12.0pt; line-height: 150%; font-family: \'Times New Roman\',serif; letter-spacing: -.05pt;\"><span style=\"mso-spacerun: yes;\">&nbsp;</span>untuk kondisi persaingan saat ini adalah para penjual gorengan yang menjual singkong goreng , tapi kami optimis yakin produk kami bisa laku di pasaran dengan keunggulan yang kami miliki serta beda dari yang lain , dengan pengemasan yang menarik dan harga yang kompetitif </span></p>\n<p class=\"MsoNoSpacing\" style=\"text-align: justify; line-height: 150%; tab-stops: 14.2pt;\"><span style=\"font-size: 12.0pt; line-height: 150%; font-family: \'Times New Roman\',serif; letter-spacing: -.05pt;\">&nbsp;</span></p>\n<p class=\"MsoNoSpacing\" style=\"text-align: justify; line-height: 150%; tab-stops: 14.2pt;\"><span style=\"font-size: 12.0pt; line-height: 150%; font-family: \'Times New Roman\',serif; letter-spacing: -.05pt;\">&nbsp;</span></p>\n<p class=\"MsoNoSpacing\" style=\"text-align: justify; line-height: 150%; tab-stops: 14.2pt;\"><span style=\"font-size: 12.0pt; line-height: 150%; font-family: \'Times New Roman\',serif; letter-spacing: -.05pt;\"><span style=\"mso-spacerun: yes;\">&nbsp;</span>prospek dari usaha singkong kami akan kami kembangkan menjadi sebuah kafe Singkong yang mana segala olahan singkong akan tersedia di kafe kami serta ada berbagai macam farian olahan singkong yang bisa di nikmati untuk seluruh kalangan masyarakat , dengan tampilan yang menarik pemasaran yang baik dan selalu berinovasi dalam olahan berbahan baku singkong , dan bahkan menjadi pusat oleh oleh bagi para wisatawan yang berkunjung di Surabaya, atau bahkan bisa kami pasarkan ke seluruh indonesia</span></p>','Singkong Gembul',1,1,'2019-03-13 18:46:57','2019-03-15 05:36:42'),(847,0,'BACOT LIDAH PEDAS (Bakso Bekicot Pedas, Lidah Wetan)','2019 17010014044 Yunita Rani.pdf',NULL,9638000,'<p>Usaha kuliner ini terbuat dari olahan daging bekicot yang dikemas dengan jenis olahan bakso rendah lemak karena bahan utama \"bakso\" yang biasanya terbuat dari daging diganti dengan bekicot sebagai sumber protein dan memiliki kandungan zat anti kanker serta antioksidan. Daging bekicot dipercaya dapat meningkatkan imunitas tubuh. Tawaran rasa pedas dari produk ini menjadi daya tarik tersendiri bagi pecinta makanan pedas. Hal ini menunjang daya beli masyarakat yang sedang marak akan ketertarikan pada kuliner pedas saat ini. Produk ini juga dapat menunjang perekonomian masyarakat sekitar melalui nama produk yang menyangkut nama daerah yaitu \"Lidah Wetan\" karena pemasaran kami yang melalui media sosial.</p>','Bacot Lidah Pedas|Bakso Bekicot|Lidah Wetan|Surabaya|Pedas',1,1,'2019-03-13 18:48:03','2019-03-15 01:41:15'),(848,0,'BANTUL (Banana Nugget Bekatul)','2019 17040254008 Didin Fatmawati Sukma.pdf',NULL,9269000,'<p>BANTUL merupakan nama singkatan dari \"<em>Banana Nugget Bekatul\"</em> yang membedakan dari nugget pisang lainnya adalah bahan yang ada diadonannya, nugget pisang pada umumnya menggunakan campuran tepung terigu namun dalam proses pembuatan BANTUL menggunakan tepung bekatul sebagai campuran adonan. Masyarakat hanya mengetahui bekatul sebagai pakan ternak unggas, akan tetapi banyak kandungan nutrisi dan manfaat yang baik untuk tubuh. Bahkan bisa menyembuhkan beberapa penyakit misalnya darah tinggi, diabetes, menurunkan kadar kolesterol dalam darah, serangan jantung, dan asthma.</p>','Pisang|Nugget|Bekatul',1,1,'2019-03-13 18:52:00','2019-03-15 02:40:28'),(849,0,'Dolan  (Dodol Siwalan)','2019 17010014013 Siska Ayu Ervianti.pdf',NULL,7700000,'<p class=\"MsoNoSpacing\" style=\"text-align: justify; line-height: 150%; tab-stops: 14.2pt;\"><span style=\"font-size: 12.0pt; line-height: 150%; font-family: \'Times New Roman\',\'serif\'; letter-spacing: -.05pt; mso-ansi-language: IN;\">DOLAN merupakan makanan olahan seperti dodol pada umumnya namun yang membedakan dodol ini dengan yang lain adalah terdapat bahan dasar yang hanya bisa di temui di daerah-daerah tertentu saja seperti di kota Tuban yaitu buah siwalan. Buah siwalan memiliki banyak manfaat diantaranya adalah sebagai isotonik, melancarkan pencernaan, menyejukkan tubuh, baik bagi penderita diabetes, sebagai antibiotik, mengatasi stress, baik bagi kesehatan ginjal, dan masih banyak lagi kasiat yang lainnya. </span></p>','makanan |dodol siwalan|manis|legit|super|bergizi',1,1,'2019-03-13 18:54:13','2019-03-15 00:42:32'),(850,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,1,'2019-03-13 18:55:42','2019-03-15 04:43:51'),(851,0,'BULET\'Z (Bola Tahu Isi Lezat Nikmat dan Bergizi)','2019 17010714081 Novilia Dwi Hermanda.pdf',NULL,6000000,'<p>Indonesia adalah negara yang memiliki berbagai macam olahan makanan. Salah satu makanan yang digemari adalah tahu dengan berbagai macam olahannya. Dari hal tersebut kami berinivasi mengolah tahu menjadi makanan yang digemari semua kalangan. BULET\'Z (Bola Tahu Isi Lezat Nikmat dan Bergizi) adalah kreasi dan inovasi dari olahan makanan dengan bahan dasar tahu. Kami bertujuan agar produk inovasi kami tetap mempertahankan ciri khas tahu asli Indonesia.</p>','TahuLezat, Nikmat, Bergizi|Tahu, Lezat, Nikmat, Bergizi',1,1,'2019-03-13 18:56:08','2019-03-14 05:27:45'),(852,0,'KICK FESTIVE (RECYCLABLE ANTI-SHOE SMELL)','2019 17020504009 Maulana Wahyu Saputra.pdf','2019 17020504009 Maulana Wahyu Saputra.pdf',4000000,'<div class=\"page\" style=\"font-family: -webkit-standard;\" title=\"Page 7\">\n<div class=\"layoutArea\">\n<div class=\"column\">\n<p><span style=\"font-size: 12pt; font-family: TimesNewRomanPSMT;\">Kopi merupakan salah satu komoditas terbesar di Indonesia. Umumnya kopi digunakan hanya untuk dikonsumsi, ataupun dijual. Modern ini banyak berkembang olahan kopi yang sangat variatif hingga merambah ke produk perawatan mulai dari wajah, hingga peralatan sehari-hari. Kick Festive hadir sebagai pelopor penghilang bau sepatu</span><span style=\"font-size: 12pt; font-family: TimesNewRomanPS; font-style: italic;\">portable</span><span style=\"font-size: 12pt; font-family: TimesNewRomanPSMT;\">yang sangat ramah lingkungan. Kick Festive hadir dengan harga yang bersahabat serta bahan organik dari alam yang tidak mencemari lingkungan,</span><span style=\"font-size: 12pt; font-family: TimesNewRomanPS; font-style: italic;\">reusable</span><span style=\"font-size: 12pt; font-family: TimesNewRomanPSMT;\">dan</span><span style=\"font-size: 12pt; font-family: TimesNewRomanPS; font-style: italic;\">recyclable</span><span style=\"font-size: 12pt; font-family: TimesNewRomanPSMT;\">karena merupakan</span><span style=\"font-size: 12pt; font-family: TimesNewRomanPS; font-style: italic;\">plastic-free</span><span style=\"font-size: 12pt; font-family: TimesNewRomanPSMT;\">. Terdapat dua varian yaitu kopi khas Indonesia dan kulit jeruk kering yang</span><span style=\"font-size: 12pt; font-family: TimesNewRomanPS; font-style: italic;\">fresh</span><span style=\"font-size: 12pt; font-family: TimesNewRomanPSMT;\">. Kopi telah dikenal dengan khasiat anti bau juga menangkal terjadinya pertumbuhan jamur dan bakteri yang terdapat dalam sepatu. Sementara kulit jeruk populer dengan wangi yang menyegarkan. Harga yang terjangkau, unik dan ramah lingkungan merupakan daya tarik tersendiri di pasaran bagi Kick Festive.</span></p>\n</div>\n</div>\n</div>',NULL,4,1,'2019-03-13 18:56:45','2019-05-30 17:48:48'),(853,0,'ROBACRE','2019 16010044070 Eka cipta wijaya.pdf',NULL,5644000,'<p class=\"MsoNormal\" style=\"text-align: justify; tab-stops: 0cm;\"><span lang=\"EN-US\" style=\"font-size: 12.0pt; mso-bidi-font-size: 11.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\';\">Usaha ini selalu beregenerasi ditiap tahunnya untuk mengimbangi minat dan mengikuti selera kuliner masyarakat yang selalu berubah, oleh karena itu usaha roti bakar ice cream ini adalah langkah awal sekaligus gebrakan baru dalam dunia kuliner. Pada zaman sekarang masyarakat sangat berhati-hati dalam membeli makanan di luar, karena banyak sekali makanan yang dijual oleh penjual yang tidak bertanggung jawab dan curang untuk menekan biaya produksi sehingga menggunakan bahan-bahan kimia yang berbahaya jika dikonsumsi oleh manusia. Biasanya masyarakat kalangan bawah membeli makanan yang hanya mengutamakan rasanya yang lumayan enak tapi murah. Dua hal itulah yang biasanya menjadi pertimbangan mereka untuk membeli makanan. Masyarakat kalangan ke bawah pada umumnya tidak menghiraukan bahan dan kandungan apa saja yang ada di dalam makanan yang mereka beli. Maka dari itu kami membuat usaha roti bakar ice cream yang memiliki cita rasa enak, harganya terjangkau, pastinya aman dikonsumsi dan juga meiliki kandungan gizi yang cukup.</span></p>\n<p><span lang=\"EN-US\" style=\"font-size: 12.0pt; mso-bidi-font-size: 11.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; mso-fareast-font-family: Calibri; mso-ansi-language: EN-US; mso-fareast-language: EN-US; mso-bidi-language: AR-SA;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Dengan jenis prodak ini harapannya akan selalu bisa memenuhi minat masyarakat yang selalu berbeda ditiap tahunnya, sehimgga dengan mengikuti minat yang ada penjualan roti bakar ice cream ini akan diminati mayoritas kalangan.</span></p>','PMW|robacre',1,1,'2019-03-13 18:57:31','2019-03-14 23:19:13'),(854,0,'NASI KANTONG MAHASISWA (NASKANMAH)','2019 17040254051 Hendrat Rahtami Wulandari.pdf',NULL,1323000,'<p class=\"MsoNoSpacing\" style=\"margin-left: 36.0pt; text-align: justify; line-height: 115%; tab-stops: 14.2pt;\"><span style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; letter-spacing: -.05pt; mso-ansi-language: IN;\">Nasi Kantong Mahasiswa atau nama jualnya NASKANMAH adalah sebuah trobosan baru untuk para mahasiswa dan mahasiswi yang ingin hemat tapi bisa tetap eksis.Sesuai dengan nama jualnya NASKANMAH maka produk ini sangat sesuai dengan kantong mahasiswa. Keunikan dari NASKANMAH ini adalah sebuah nasi yang dikombinasikan dengan lauk &ndash; lauk yang enak, menarik dan kekinian yang tentunya bagus untuk tubuh, menambah nafsu makan dan pastinya pas di kantong mahasiswa. Selain itu, NASKANMAH ini akan dikemas berbeda dari nasi &ndash; nasi bungkus lainnya. Karena, NASKANMAH akan dikemas seperti kantong makan yang tentunya akan menarik untuk diunggah dimedia sosial sebagai update status. Walaupun harganya murah tapi NASKANMAH menawarkan hal &ndash; hal menarik.<span style=\"mso-spacerun: yes;\">&nbsp; </span>NASKAMAH ini akan berpartner kerja dengan salah satu usaha mandiri<span style=\"mso-spacerun: yes;\">&nbsp; </span>kecil dan menengah yakni catering Bu Endang. Jadi, NASKAMAH tentu dijamin rasa dan kualitasnya. NASKANMAH akan mengerluarkan beberapa varian lauk pendamping seperti NASKANMAH SamPeTong (Sambel Pete Tongkol), TelTerSamJo (Telur Teri Sambel Ijo),<span style=\"mso-spacerun: yes;\">&nbsp; </span>Ayleng (Ayam Lengket). Dijamin menu dari NASKANMAH bisa mengobati rasa rindu para mahasiswa dan mahasiswi akan masakan ibu dirumah. </span></p>','NASI KANTONG MAHASISWA',1,1,'2019-03-13 18:58:28','2019-03-14 19:54:19'),(855,0,'CT RICE Beras Ajaib 1000 Manfaat','2019 17010644107 Riska Ayu Syafira.pdf',NULL,4988000,'<p class=\"MsoNoSpacing\" style=\"text-align: justify; line-height: 150%; tab-stops: 14.2pt;\"><span style=\"font-size: 12.0pt; line-height: 150%; font-family: \'Times New Roman\',serif; letter-spacing: -.05pt; mso-ansi-language: IN;\">CT RICE merupakan sebuah inovasi dan kreativitas dari bahan pangan yang mungkin banyak diketahui masyarakat akan tetapi kandungan gizi yang terdapat pada bahan pangan ini belum terlalu diketahui masyarakat awam. Maka dari itu kami mencoba mengenalkan banyaknya kandungan gizi yang tedapat pada bahan pangan tersebut. Oleh karena itu kami berusaha membuat produk pangan yang sangat dibutuhkan oleh masyarakat yaitu berupa olahan beras dengan nama CT RICE. Mengapa kami menamai produk kami dengan nama tersebut, karena &ldquo;CT RICE&rdquo; sendiri merupakan singkatan dari <em style=\"mso-bidi-font-style: normal;\">Corn Tapioca Rice, </em>sehingga dapat diketahui bahwa produk kami berasal dari bahan pangan berupa tepung jagung yang dicampur menggunakan tepung tapioka yang sudah pasti kaya akan manfaat. </span></p>','beras ajaib 1000 manfaat',1,1,'2019-03-13 18:59:43','2019-03-15 01:23:20'),(856,0,'SEPATU SAMPAH AJAIB','2019 17040254056 fatmawati.pdf',NULL,130000,'<p>Banyaknya sampah-sampah berserakan di sekitar kita menuntut masyarakat harus lebih memperhatikan sekitar dan peka pada lingkungan. Sampah-sampah tidak hanya berakhir ketika dibuang atau dibakar. Ada beberapa proses pendaur ulanganan yang dilakukan guna mengelola sampah disekitar dan memperhatikannya. Munculah suatu ide usaha yakni Souvenir Sepatu sampah Ajaib dengan memanfaatkan sampah rumah tangga&nbsp; Souvenir Sepatu Sampah Ajaib adalah suatu usaha yang menghasilkan barang dengan memanfaatkan sampah rumah tangga yang dibuang sembarangan. Souvenir Sepatu Sampah Ajaib bahan dasarnya terbuat dari Roll Tissu Toilet, Koran bekas, lem, triplek berukuran 6x4 lalu cat warna dan air yang di daur ulang yaitu dengan menempelkan dua roll tiss toilet dengan posisi satu vertikal dan satu horizontal. Roll toilet dengan posisi horizontal ujungnya ditutup dengan gumpalan Koran lalu ketika sudah berbentuk sepatu maka roll tissue toilet agar lebih memiliki tekstur maka menempelkan Koran-koran yang sudah dibasahi dengan air lalu ditempelkan kedalam air. Dengan demikian setelah menjadi bentuk sepatu dan bertekstur makan diberi warna sesuai selera dan ditempelkan pada triplek 4x6 yang pada kemasannya dibungkus dengan mika seperti souvenir&nbsp; Mengapa wirausaha harus menggunakan bahan bekas rumah tangga?. Kita tahu bahwasannya setiap sampah harus dikelola dengan baik oleh tangan-tangan yang terampil sebab menciptakan suatu usaha tidak hanya menggunakan modal besar. Dengan kreatifitas dan pintar menangkap peluang maka banyak manfaat yang akan diperoleh seperti Souvenir Sepatu Ajaib. Keunggulan dari usaha ini dimana tidak membutuhkan modal yang besar, dan juga dapat mencegah penumpukan sampah sehingga ketika sampah dapat dikreasikan dengan baik dan tepay maka akan menciptakan suatu barang yang akan menghasilkan keuntungan</p>','sepatu sampah ajaib',4,1,'2019-03-13 19:03:24','2019-03-15 02:30:01'),(857,0,'Nugget Pochi','2019 17020104010 Mohammad Farid Hidayatullah.pdf',NULL,2000000,'<p>Usaha penjualan produk makanan berupa nugget yang terbuat dari kentang dan keju</p>','Nugget|Kentang|Keju|Pochi',1,1,'2019-03-13 19:06:16','2019-03-19 07:51:19'),(858,0,'MITSUKI SAHUR','2019 17040254029 NL BIMO SETYO UTOMO.pdf',NULL,4500000,'<p>Mistsuki sahur merupakan produk baru bagi kami bahkan bagi masyrakat luas. Hal ini dikarenakan produk ini merupakan inovasi yang bersal dari obat tradisional dan ,mie modern yang ada dicafe-cafee anak muda. Mintsuki sahur sendiri konsep awalnya merupakan mie dengan bahan dasar campuran rumput teki sebagai bahan dasar pembuatannya. Dimana nantinya campuran rumput teki itu diharapkan akan membuat rasa baru yang bersaal dari manis alami dan membuat ,mir menjadi berwarna sesuai dengan warna rumput yang hijau. Hal itulah yang dihrap dapat menarik pelanggan utamanya para remaja yang suka terhadap hal menarik dari warna. Tetapi dengan hanya mie tidak akan terlalu menarik pelanggan sehingga ditambahkan juga berbagai varian toping yang utamanya berbahan dasar jamur. Dimana nantinya toping yang berbahan dasar jamur ini juga akan di berikan rasa dengan varian level yang akan mengkatagorikan tingkatan pedas dari toping tersebut. Dengan semua itu maka saya yakin mie dengan konsep sederhana ini akan mudah untuk disukai bahkan menjadi kegemaran dari para remaja. Selain inovasi dari makanan kami juga membuat inovasi dari pemasaran berupa kemasan yang instans sehingga juga dapat dibawah pulang dan dapat dimasak di rumah atau sesuai selerah.</p>','mitsuki, mie, rumput teki, jamur|mitsuki|mie|rumput teki|jamur',1,1,'2019-03-13 19:11:01','2019-03-15 20:43:42'),(859,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,1,'2019-03-13 19:11:46','2019-03-13 19:52:06'),(860,0,'marsyalli  (khimar syar\'i dan stylish)','2019 17020084026 Shoburotin Annur Khoiroh.pdf',NULL,8559000,'<p class=\"MsoNormal\"><span style=\"font-size: 10.5pt; line-height: 107%; font-family: \'Verdana\',sans-serif; color: black; background: white;\">kebutuhan fashion muslimah terus meningkat dan berkembang, kerudung menjadi salah satu produk yang digemari dan banyak dicari di pasaran.sehingga peluang produksi kerudung menjadi pilihan kami untuk membuat dan mengembangkan usaha&nbsp;</span><span style=\"letter-spacing: -.05pt;\"><span style=\"font-variant-ligatures: normal; font-variant-caps: normal; orphans: 2; text-align: start; widows: 2; -webkit-text-stroke-width: 0px; text-decoration-style: initial; text-decoration-color: initial; word-spacing: 0px;\">Produk kami mengusung kerudung instan dengan desain elegan yang terbuat dari kain wolfish dan kombinasi kain satin, sehingga muslimah tidak perlu khawatir kerudung akan tembus pandang. Desain kerudung dengan tambahan tali di bagian depan dan aksesoris secukupnya di bagian belakang. Produk kami bukanlah produksi rumahan, maka kualitas jahitan kerudung sudah dipastikan lebih halus dan rapi dibandingkan produksi konveksi.&nbsp;</span></span></p>','khimar|syar\'i|stylish|wolfis|satin',5,1,'2019-03-13 19:16:14','2019-03-14 22:09:49'),(861,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,1,'2019-03-13 19:19:43','2019-03-14 02:09:13'),(862,0,'Pisang Manis Blackpink','2019 17040254089 Hanifah Mahesta Putri.pdf',NULL,3000000,'<p class=\"MsoListParagraph\"><span style=\"font-size: 12.0pt; line-height: 150%; font-family: \'Times New Roman\',serif; color: black; mso-themecolor: text1;\">saat ini maraknya tren makanan unik yang dimana bahan dasarnya adalah makanan sehari hari, yakni pisang.Pisang manis blackpink ini adalah sebuah inovasi pisang nugget dan pisang goreng dimana pisang ini diolah dengan buah nangka dijadikan satu dengan adonan. dan di beri topping coklat dan coklat strawberry yang di dilelehkan dan juga oreo sehingga berbentuk warna hitam dan pink sehingga diberi nama blackpink. Nama ini juga terinspirasi oleh girlband yang sedang mendunia dari korea selatan yang bernama blackpink. Sehingga konsumen akan lebih tertarik dengan nama yang unik. dan juga berebntuk kotak sesuai ciri khas blackpink. Dimana pisang tersebut juga lumer di topping dan crispy di topping oreonya. Dan memberian sensasi unik kepada konsumen ketika ddimakan karena perpaduan rasa manis buah nangka.</span></p>','pisang, manis, blackpink|pisang,|pisang|manis|lumer|coklat|blackpink',1,1,'2019-03-13 19:23:29','2019-03-14 22:45:03'),(863,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,1,'2019-03-13 19:24:04','2019-03-14 16:48:29'),(864,0,'Tahu Bakso Pedas (TABODAS)','2019 17010644090 Muhammad Azis Berliansyah.pdf',NULL,5,'<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; <strong>Tahu Bakso Pedas (TABODAS)</strong></p>\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;Oleh</p>\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;Muhammad Azis Berliansyah</p>\n<p><span lang=\"IN\" style=\"text-align: justify; font-size: 12pt; line-height: 115%; font-family: \'Times New Roman\', serif;\">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; Dalam program mahasiswa wirausaha Universitas Negeri Surabaya 2019 kami memilih jenis usaha industri makanan dan minuman yang menggusung tema tahu yang diolah bersama adonan bakso pedas, dimana p</span><span style=\"font-family: \'Times New Roman\', serif; font-size: 16px; text-align: justify;\">rospek pengembangan dan pengolahan tahu bakso pedas di Indonesia sangat potensial. Alasan ini didukung oleh adanya sumber daya alam, khususnya sumber pangan tahu, daging sapi serta cabai yang melimpah. Ciri khas&nbsp;<strong>\"TABODAS\"</strong></span><span lang=\"IN\" style=\"text-align: justify; font-size: 12pt; line-height: 115%; font-family: \'Times New Roman\', serif;\">&nbsp;kami berbeda dengan yang lainnya, dikarenakan kami mencampurkan adonan bakso dengan cabai lalu potongan tahu yang besar serta adonan bakso yang melimpah menjadi sehingga menutupi tahu.&nbsp;</span></p>\n<p><span lang=\"IN\" style=\"text-align: justify; font-size: 12pt; line-height: 115%; font-family: \'Times New Roman\', serif;\">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;P</span><span style=\"font-family: \'Times New Roman\', serif; font-size: 12pt; text-align: justify;\">engolahan tahu bakso pedas kami tidak lupa untuk tetap memperhatikan hal-hal penting dalam pengolahan sumber pangan. Karena, pemerintah juga telah menetapkan bahwa urusan tentang pangan telah tercantum dalam UU Nomor 7 Tahun 1996 dalam UU Pangan ini pengaturan masalah lebih komprehensif dari sebelumnya. UU ini mengatur soal ketahanan pangan hingga unit terkecil Rumah Tangga. Jadi setiap manusia pasti memiliki kebutuhan pangan yang sama, tergantung bagaimana mereka berusaha untuk mendapatkannya.</span></p>','pmw unesa 2019|tahu bakso pedas|industri makanan dan minuman',1,1,'2019-03-13 19:26:43','2019-03-15 04:42:50'),(865,0,'MiDeO (Mini Dessert Oreo)','2019 17010024055 Shavyra Adinda Salsabilah.pdf',NULL,4000000,'<p>MiDeO (Mini Dessert Oreo) adalah produk makanan penutup (dessert) yang disajikan dalam cup kecil. Dalam satu cup kecil, produk ini memiliki tiga lapisan. Lapisan paling bawah terbuat dari biskuit oreo yang ditumbuk halus, kemudian selapis diatasnya terbuat dari pudding lembut yang terbuat dari krim oreo, kemudian lapisan paling atas adalah cokelat ganache yang lumer. Dengan bahan utama Oreo dan cokelat, MiDeO (Mini Dessert Oreo) sendiri dapat menjadi pilihan jajanan kekinian yang banyak digemari berbagai kalangan.</p>\r\n<p>&nbsp;</p>','Mini|Desert|Oreo',1,1,'2019-03-13 19:28:06','2019-03-19 15:43:02'),(866,0,'ABON TEWEL REWEL','2019 17010644095 Wulan Ardiyanti.pdf',NULL,5070000,'<p class=\"MsoNoSpacing\" style=\"margin-left: 14.2pt; text-align: justify; text-indent: 1.0cm; line-height: 115%; tab-stops: 14.2pt;\"><span style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; letter-spacing: -.05pt;\">Pada era sekarang, masih banyak masyarakat dan anak anak yang malas / enggan untuk mengkonsumsi sayuran sehingga kami meletakkan kekuatan usaha kami pada hal tersebut.</span><span lang=\"IN\" style=\"font-size: 12pt; line-height: 115%; font-family: \'Times New Roman\', serif; letter-spacing: -0.05pt;\">Oleh sebab itu kami berinovasi untuk membuat olahan makanan yang terbuat dari sayuran yang dapat meningkatkan selera makan masyarakat terutama yang tidak menyukai sayuran. </span><span style=\"font-size: 12pt; line-height: 115%; font-family: \'Times New Roman\', serif; letter-spacing: -0.05pt;\">Masih jarang usaha makanan yang mengolah sayuran ini menjadi makanan yang &nbsp;tidak berpenampilan seperti sayuran pada umumnya.<br /></span></p>\n<p class=\"MsoNoSpacing\" style=\"margin-left: 14.2pt; text-align: justify; text-indent: 1.0cm; line-height: 115%; tab-stops: 14.2pt;\"><span style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; letter-spacing: -.05pt;\">Maka dari itu kami menggunakan nangka muda sebagai bahan utama karena selain enak juga banyak mengandung vitamin dan kalsium bagi kesehatan.Abon ini mirip dengan abon pada umumnya yang berpeluang digemari oleh masyarakat luas.Olahan abon ini tidak menggunakan bahan pengawet jadi kurang lebih bisa di konsumsi 2 sampai 3 bulan kedepan.</span></p>\n<p class=\"MsoNoSpacing\" style=\"margin-left: 14.2pt; text-align: justify; text-indent: 1.0cm; line-height: 115%; tab-stops: 14.2pt;\"><span style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; letter-spacing: -.05pt;\">Terlebih lagi nangka muda ini akan diolah menjadi makanan </span><span style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\';\">yang sering dikonsumsi dan disukai berbagai kalangan, mulai dari anak-anak sampai orang dewasa. Ditinjau dari kesediaan bahan juga tergolong sangat mudah untuk didapat.<span style=\"background: white;\">Selain itu untuk awalnya kami memang hanya mengolahnya dirumah. Namun rencana kami kedepannya kami akan mendirikan stan untuk memasarkan produk ini sehingga peluang yang akan dihasilkan akan semakin baik. Dengan bekerjasama dengan beberapa pihak juga akan membuat produk ini menjadi produk unggulan di Indonesia. </span></span></p>','Abon Tewel|Abon|Tewel|Nangka Muda',1,1,'2019-03-13 19:36:35','2019-03-14 23:08:53'),(867,0,'SWEET MORINGA','2019 17010024036 SILKA KURNIA ABDILAH.pdf',NULL,4300000,'<p><span lang=\"IN\" style=\"text-indent: 47.2667px; font-size: 12pt; line-height: 18.4px; font-family: \'Times New Roman\', serif;\">Usaha&nbsp;</span><span style=\"text-indent: 47.2667px; font-size: 12pt; line-height: 18.4px; font-family: \'Times New Roman\', serif;\">Sweet Moringa</span><span lang=\"IN\" style=\"text-indent: 47.2667px; font-size: 12pt; line-height: 18.4px; font-family: \'Times New Roman\', serif;\">&nbsp;(</span><span style=\"text-indent: 47.2667px; font-size: 12pt; line-height: 18.4px; font-family: \'Times New Roman\', serif;\">stick daun kelor</span><span lang=\"IN\" style=\"text-indent: 47.2667px; font-size: 12pt; line-height: 18.4px; font-family: \'Times New Roman\', serif;\">) ini berawal dari keinginan untuk memberikan sebuah inovasi dengan&nbsp;</span><span style=\"text-indent: 47.2667px; font-size: 12pt; line-height: 18.4px; font-family: \'Times New Roman\', serif;\">mengandalkan bahan alami yang baik untuk kesehatan</span><span style=\"text-indent: 47.2667px; font-size: 12pt; line-height: 18.4px; font-family: \'Times New Roman\', serif;\">&nbsp;<span lang=\"IN\">, bermanfaat bagi seluruh masyarakat di Indonesia. Usaha ini tidak akan ada matinya karena semua masyarakat perlu memperhatikan kesehatan tetapi tetap bisa&nbsp;<em>ngemil</em>&nbsp;camilan manis yang enak. Meskipun&nbsp;</span></span><span style=\"text-indent: 47.2667px; font-size: 12pt; line-height: 18.4px; font-family: \'Times New Roman\', serif;\">banyak camilan yang tidak meggunakan bahan berbahaya bagi tubuh akan tetapi makan makanan dengan bahan yang menyehatkan juga lebih baik</span><span lang=\"IN\" style=\"text-indent: 47.2667px; font-size: 12pt; line-height: 18.4px; font-family: \'Times New Roman\', serif;\">. Disamping itu harga&nbsp;</span><span style=\"text-indent: 47.2667px; font-size: 12pt; line-height: 18.4px; font-family: \'Times New Roman\', serif;\">Sweet Moringa sangat terjangkau</span><span lang=\"IN\" style=\"text-indent: 47.2667px; font-size: 12pt; line-height: 18.4px; font-family: \'Times New Roman\', serif;\">. Sehingga hal itulah yang menjadikan saya layak mendapatkan usaha melalui PMW ini.</span></p>','sweet|moringa',1,1,'2019-03-13 19:38:44','2019-03-15 04:17:51'),(868,0,'Sambal Babysquid','2019 17010644081 Febby Faza Mahiroh.pdf',NULL,6250000,'<p>sambal babysquid, sambal pedas dengan campuran cumi kecil yang bisa disesuaikan tingkat kepedasannya. Sambal ini dibuat dengan kemasan botol plastik kecil dengan harga kisaran 20.000-35.000, sambal ini nantinya akan ada banyak varian contohnya sambal cumi pete, sambal cumi bawang, dan lain-lain</p>','Babysquid',1,1,'2019-03-13 19:39:19','2019-03-15 01:38:35'),(869,0,'Risol Ibu (Risol Isi Buah)','2019 17040254019 Elsa Amalia Trisnanti.pdf',NULL,5000000,'<p><!-- [if gte mso 9]><xml>\r\n <o:OfficeDocumentSettings>\r\n  <o:AllowPNG/>\r\n  <o:TargetScreenSize>1024x768</o:TargetScreenSize>\r\n </o:OfficeDocumentSettings>\r\n</xml><![endif]--><!-- [if gte mso 9]><xml>\r\n <w:WordDocument>\r\n  <w:View>Normal</w:View>\r\n  <w:Zoom>0</w:Zoom>\r\n  <w:TrackMoves/>\r\n  <w:TrackFormatting/>\r\n  <w:PunctuationKerning/>\r\n  <w:ValidateAgainstSchemas/>\r\n  <w:SaveIfXMLInvalid>false</w:SaveIfXMLInvalid>\r\n  <w:IgnoreMixedContent>false</w:IgnoreMixedContent>\r\n  <w:AlwaysShowPlaceholderText>false</w:AlwaysShowPlaceholderText>\r\n  <w:DoNotPromoteQF/>\r\n  <w:LidThemeOther>EN-US</w:LidThemeOther>\r\n  <w:LidThemeAsian>X-NONE</w:LidThemeAsian>\r\n  <w:LidThemeComplexScript>X-NONE</w:LidThemeComplexScript>\r\n  <w:Compatibility>\r\n   <w:BreakWrappedTables/>\r\n   <w:SnapToGridInCell/>\r\n   <w:WrapTextWithPunct/>\r\n   <w:UseAsianBreakRules/>\r\n   <w:DontGrowAutofit/>\r\n   <w:SplitPgBreakAndParaMark/>\r\n   <w:DontVertAlignCellWithSp/>\r\n   <w:DontBreakConstrainedForcedTables/>\r\n   <w:DontVertAlignInTxbx/>\r\n   <w:Word11KerningPairs/>\r\n   <w:CachedColBalance/>\r\n  </w:Compatibility>\r\n  <m:mathPr>\r\n   <m:mathFont m:val=\"Cambria Math\"/>\r\n   <m:brkBin m:val=\"before\"/>\r\n   <m:brkBinSub m:val=\"--\"/>\r\n   <m:smallFrac m:val=\"off\"/>\r\n   <m:dispDef/>\r\n   <m:lMargin m:val=\"0\"/>\r\n   <m:rMargin m:val=\"0\"/>\r\n   <m:defJc m:val=\"centerGroup\"/>\r\n   <m:wrapIndent m:val=\"144