=\"Bibliography\"/>\r\n  <w:LsdException Locked=\"false\" Priority=\"39\" QFormat=\"true\" Name=\"TOC Heading\"/>\r\n </w:LatentStyles>\r\n</xml><![endif]--><!-- [if gte mso 10]>\r\n<style>\r\n /* Style Definitions */\r\n table.MsoNormalTable\r\n	{mso-style-name:\"Table Normal\";\r\n	mso-tstyle-rowband-size:0;\r\n	mso-tstyle-colband-size:0;\r\n	mso-style-noshow:yes;\r\n	mso-style-priority:99;\r\n	mso-style-qformat:yes;\r\n	mso-style-parent:\"\";\r\n	mso-padding-alt:0in 5.4pt 0in 5.4pt;\r\n	mso-para-margin:0in;\r\n	mso-para-margin-bottom:.0001pt;\r\n	mso-pagination:widow-orphan;\r\n	font-size:11.0pt;\r\n	font-family:\"Calibri\",\"sans-serif\";\r\n	mso-ascii-font-family:Calibri;\r\n	mso-ascii-theme-font:minor-latin;\r\n	mso-fareast-font-family:\"Times New Roman\";\r\n	mso-fareast-theme-font:minor-fareast;\r\n	mso-hansi-font-family:Calibri;\r\n	mso-hansi-theme-font:minor-latin;\r\n	mso-bidi-font-family:\"Times New Roman\";\r\n	mso-bidi-theme-font:minor-bidi;}\r\n</style>\r\n<![endif]--></p>\r\n<p class=\"MsoNoSpacing\" style=\"text-align: justify; line-height: 150%; tab-stops: 14.2pt;\"><span lang=\"IN\" style=\"font-size: 12.0pt; line-height: 150%; font-family: \'Times New Roman\',\'serif\'; letter-spacing: -.05pt; mso-ansi-language: IN;\">Program Mahasiswa Wirausaha dengan judul Risol Ibu ( Isi Buah) ini adalah sebagai hasil inovasi olahan risol yang pada umumnya berisikan sayuran didalamnya. Selain isi dari risol yang digantikan dengan buah-buahan, kulit luarnya pun juga ditambahkan dengan buah yang akan menghasilkan warna cantik dari risol ini. Rasa yang dihasilkan risol ibu sangat unik dengan perpaduan kulit risol yang garing bercampur dengan buah yang segar, tentunya masyarakat akan tertarik karena belum pernah mencobanya. Selain rasaya yang enak tentu risol ibu memiliki kandungan gizi yang tinggi serta dapat memberikan alternatif bagi konsumen yang kurang suka dengan buah. Bahan-bahan yang digunakan untuk membuat risol ibu sangat mudah dicari sehingga sangat efisien dalam pembuatannya. Harga dari risol ibu adalah Rp.10.000 untuk satu mika berisikan 3 risol didalamnya, dengan ukuran risol yang cukup besar. Jadi dari uraian diatas Risol Ibu sangat layak untuk di konsumsi semua orang karena keunikan dan manfaatnya serta harganya yang terjangkau.</span></p>','Risol Isi Buah|Risoles|Sehat|Frutarian|Murmer|Bergizi|Terjangaku|Buah|Enak|PMW|PPKn|Mahasiswa|Unesa|Surabaya',1,1,'2019-03-13 19:40:53','2019-03-15 00:57:53'),(870,0,'KOPIYA (Kopi Biji Pepaya)','2019 17040254025 Mochammad Iqbal Hidayatullah.pdf',NULL,13000000,'<p class=\"MsoNormal\" style=\"margin-bottom: .0001pt; text-align: justify; text-indent: 36.0pt;\"><span lang=\"EN-US\" style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\';\">Kopi adalah salah satu minuman dari biji-bijian yang sangat digemari semua kalangan masyarakat muda hingga tua. Tingkat pengemar kopi yang signifikan meningkat ini tak semua dapat menikmati kopi karena ada beberapa alergi dan kesehatan lainnya komposisi kafein yang terkandung didalamnya. Kehadiran produk kopi biji pepaya dalam inovasi olahan sebagai alternatif kopi yang menyehatkan yang dapat membantu masyarakat tetap menikmati citra rasa yang. Biji Pepaya dari beberapa penelitian terbukti kandungan antibakteri, membunuh racun dan mengurangi kolestrol dalam tubuh. Jadi produk ini sangat baik untuk mereka yang memiliki kadar kolestrol tinggi.</span></p>\n<p class=\"MsoNormal\" style=\"margin-bottom: .0001pt; text-align: justify; text-indent: 36.0pt;\"><span lang=\"EN-US\" style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\';\">KOPIYA merupakan inovasi kopi biji pepaya yang disajikan dalam bentuk minuman keadaan dingin atau panas dengan pilihan 3 (tiga)rasa. Rasa terdiri dari Original, Oreo, Susu Vanila atau Coklat. Selain pada pilihan rasanya, KOPIYA semakin khas dengan rasa susu kental manis. KOPIYA dikemas menggunakan botol kale berukuran 250ml dan cup plastik dengan brand logo KOPIYA agar menarik. KOPIYA dijual dengan pemasaran booth stan yang melihat peluang tempat strategis yang didesain semenarik mungkin agar konsumen tertarik membeli, Selain itu promosi publikasi dilakukan online berbagai media sosial KOPIYA ataupun secara offline menggunakan brosur disekeliling kampus atau pemukiman masyarakat.</span></p>','Minuman|Biji Pepaya|Sehat',1,1,'2019-03-13 19:49:08','2019-03-20 05:25:25'),(871,0,'PoTo Ethnic \" Inovasi Pouch dan Tote Bag dengan Aksen Ethnic Khas Nusantara\"','2019 16030174073 nuril intan.pdf',NULL,7365000,'<p class=\"MsoNoSpacing\" style=\"text-align: justify; line-height: 115%; tab-stops: 14.2pt;\"><span style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; letter-spacing: -.05pt; mso-ansi-language: IN;\">Diera millenial ini, fashion dan perangkatnya sudah menjadi ternd yang tidak bisa ditinggalkan. tas dan pouch menjadi salah satu barang incaran. Berbagai merk dan model pun bermunculan. Tidak sedikit barang import yang merajai pasar. Kecenderungan produsen indonesia memproduksi barang tiruan produksi luar negeri menjadikan produksi indonesia kurang diminati pasar internasional.</span></p>\n<p class=\"MsoNoSpacing\" style=\"text-align: justify; line-height: 115%; tab-stops: 14.2pt;\"><span style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; letter-spacing: -.05pt; mso-ansi-language: IN;\"><span style=\"mso-tab-count: 2;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span>Kain tenun dan batik merupakan salah satu kain khas indonesia yang harus dilestarikan dan dipublikasikan. Komoditas pengrajin kain tenun dan batik juga sekarang mulai bertumbuh. Oleh sebab itu kita sebagai generasi millenial harus turut bangga dan mengembangkan kain khas indonesia. Tote Bag dan pouch dengan aksen etnik berupa kain batik atau tenun menjadi salah satu langkah awal untuk memajukan kain khas indonesia sekaligus memajukan produksi tote bag dan pouch asli buatan kelompok kami. Kain batik atau tenun dijadikan sebagai bahan dasar produksi yang akan dipadukan dengan kain-kain bahan dasar pembuatan pouch dan tote bag lain. Sehingga kesan yang diberikan juga lebih modern dan elegan. Ditambah lagi hiasan dan model yang menarik diharapkan produksi ini akan terus berkembang sehingga bisa menjadi trend dikalangan masyarakat indonesia khususnya dan umumnya untuk pasar internasional. Untuk pengemasan dan promosi juga terdapat beberapa hal yang dibuat menarik dengan dibuatnya desain-desain, model-model pemakai produk, testi serta giveaway dan berbagai macam stategi lainnya.</span></p>','tote bag|pouch|kain batik|kain tenun|tas|ethnic',4,1,'2019-03-13 19:50:00','2019-03-15 05:53:45'),(872,0,'Griya canteng (cantik ganteng) kekinian','2019 17010714012 Diajeng Ayu Kinanti.pdf',NULL,3762000,'<p>Griya canteng menyediakan jasa menghias hantaran atau srah-srahan dimana tema hantaran disesuaikan dengan selera atau keinginan customer.</p>','Ornamen hantaran kekinian',2,1,'2019-03-13 19:51:43','2019-03-19 06:07:21'),(873,0,'Naget Gethuk Kesayangan','2019 16010664017 Linda Setyawati.pdf',NULL,6939000,'<p class=\"MsoNormal\" style=\"margin-bottom: .0001pt; text-align: justify; text-indent: 1.0cm;\"><span lang=\"IN\" style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; mso-ascii-theme-font: major-bidi; mso-fareast-font-family: Calibri; mso-hansi-theme-font: major-bidi; mso-bidi-theme-font: major-bidi; letter-spacing: -.05pt; mso-ansi-language: IN; mso-fareast-language: EN-US; mso-bidi-language: AR-SA; mso-bidi-font-weight: bold;\">Naget Gethuk &ldquo;Kesayangan&rdquo; </span><span lang=\"IN\" style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; mso-ascii-theme-font: major-bidi; mso-fareast-font-family: Calibri; mso-hansi-theme-font: major-bidi; mso-bidi-theme-font: major-bidi; mso-ansi-language: IN; mso-fareast-language: EN-US; mso-bidi-language: AR-SA;\">merupakan makanan dengan bahan dasar gethuk singkong yang sangat jarang ditemukan di Kota Surabaya. Padahal, gethuk singkong sendiri memiliki banyak manfaat bagi kesehatan, seperti mendukung fungsi pencernaan, mengendalikan berat badan, sebagai sumber energi,&nbsp; mencegah penyakit diabetes, dan menjaga kesehatan jantung. Mengingat kandungan manfaat yang dimiliki oleh <span style=\"letter-spacing: -.05pt; mso-bidi-font-weight: bold;\">Naget Gethuk &ldquo;Kesayangan&rdquo; yang </span>begitu besar dan masih jarang ditemukan di daerah Surabaya, maka peluang usaha bagi <span style=\"letter-spacing: -.05pt; mso-bidi-font-weight: bold;\">Naget Gethuk &ldquo;Kesayangan&rdquo; </span>dalam memasuki dunia industri sangat besar. <span style=\"letter-spacing: -.05pt; mso-bidi-font-weight: bold;\">Naget Gethuk &ldquo;Kesayangan&rdquo; </span>menggunakan bahan utama dari Gethuk Anyar. Gethuk Anyar merupakan sebuah produk makanan khas dari daerah Ngrambe, Kabupaten Ngawi. <span style=\"letter-spacing: -.05pt; mso-bidi-font-weight: bold;\">Naget Gethuk &ldquo;Kesayangan&rdquo; ini juga menjadi terobosan baru untuk mempromosikan dan melestarikan kuliner jaman dulu, yaitu gethuk singkong. Naget Gethuk &ldquo;Kesayangan&rdquo; </span>ini menggabungkan konsep tradisional dan modern dalam memadukan cita rasanya sehingga menjadi suatu produk makanan yang siap bersaing di pasar modern dan di era millenial seperti saat ini. <span style=\"letter-spacing: -.05pt; mso-bidi-font-weight: bold;\">Naget Gethuk &ldquo;Kesayangan&rdquo; dijual dengan harga yang sangat terjangkau yaitu sebesar Rp. 12.000,- per kardus. Naget Gethuk &ldquo;Kesayangan&rdquo; </span>ini menggabungkan Gethuk Anyar yang telah di cetak menjadi berbagai bentuk yang unik kemudian di goreng dengan tepung roti atau tepung panir, setelah itu dicampur dengan berbagai cita rasa dari beraneka macam toping, seperti coklat, keju, greentea, oreo, taro, stroberi, melon, kacang&nbsp; almond, dan blueberry. Sasaran pemasaran. Target pemasarannya yaitu di toko-toko kecil hingga besar di kota Surabaya. <span style=\"letter-spacing: -.05pt; mso-bidi-font-weight: bold;\">Naget Gethuk &ldquo;Kesayangan&rdquo; dijual secara mandiri dan <em>partnership.</em></span></span></p>','Naget gethuk singkong|Peluang usaha|Manfaat',1,1,'2019-03-13 19:57:31','2019-03-20 04:09:13'),(874,0,'PEMADAM PETA (Pelatihan Motivasi dengan Permainan Tradisional)','2019 16010664019 Ramadhan Maruta Pradana.pdf',NULL,8062000,'<p>PEMADAM PETA adalah sebuah jasa pelatihan dengan tema peningkatan motivasi dengan media permainan tradisional. selain melatih soft skills juga memberikan sentuhan histori agar permainan tradisional tidak punah. latar tempat pun memilih outdor sebagai bentuk upaya menyatu dengan alam sekitar, sehingga inovasi ini sangat menarik dan berbeda dengan pelatihan lainnya.</p>','pelatihan |meningkatkan motivasi|permainan tradisional',2,1,'2019-03-13 20:00:19','2019-03-16 06:29:16'),(875,0,'VIts Fruits: Nugget Buah Camilan Bervitamin dan Rendah Glutein untuk Anak dengan Autisme','2019 16010664054 Aulia Qurrotu Ayuni.pdf',NULL,5213000,'<p>ABSTRAK</p>\n<p>Seperti judulnya, Vits Fruits adalah produk yang kami buat berupa nugget dengan bahan dasar pisang dan ditambahkan buah-buahan lain yang mengandung banyak vitamin sebagai bahan pelengkapnya dan sebagai rasa buah yang alami. Kami telah melakukan riset kecil pada sebuah penelitian yang menyatakan bahwa anak dengan autisme ini tidak diperbolehkan mengkonsumsi terlalu banyak makanan yang mengandung glutein. Sehingga, pada produk yang kami buat ini menggunakan tepung rendah glutein yang mampu memperbaiki gejala hiperaktif pada anak autis. Dan kami memilih buah sebagai bahan pelengkap untuk nugget juga memiliki tujuan untuk memenuhi kebutuhan vitamin untuk anak autisme.</p>\n<p>Berdasarkan jadwal yang telah disusun, kegiatan akan kami berjalan selama 4 bulan. Kegiatan produksi akan dilakukan di daerah Kendangsari Surabaya dan dilakukan di rumah penyusun. Untuk penyebaran produk dilakukan secara online dan langsung di daerah Surabaya.</p>\n<p>Kami mengusulkan produk ini bertujuan untuk membantu anak-anak dengan kebutuhan khusus, supaya mereka dapat mengkonsumsi makanan yang sehat, rendah glutein dan kaya akan vitamin. Yang mana hal tersebut dapat membantu fungsi keseharian mereka. Mengurangi hiperaktif dan melancarkan pencernaan tubuhnya. Jika anak memiliki pencernaan yang baik dan sehat.</p>','Camilan Sehat Anak Autis|Rendah Glutein|Camilan Kaya Vitamin',1,1,'2019-03-13 20:01:04','2019-03-15 02:54:07'),(876,0,'Pentol Mercon','2019 16040284040 Nur Hasanah.pdf',NULL,11600000,'<p>Pentol Mercon adalah makanan yang terbuat dari daging sapi dan daging ayam yang berisikan potongan daging sapi dan cabai. Sudah sering kita jumpai berbagai macam pentol&nbsp; dari yang mulai pentol kecil hingga besar. Banyak pula varian pentol seperti pentol isi dan pentol pedas. Yang menjadi keunikan pentol kami yaitu beirisikan potongan daging dan cabai . Jadi dapat dikatakan pentol daging isi daging yang masih jarang kita jumpai karena harganya cukup mahal. Keunggulan dari produk kami yaitu kami menggunakan daging sapi dan daging ayam&nbsp; dengan harga jual yang terjangkau</p>\n<p>Manfaat bagi masyarakat adalah kami mendekatkan usaha kepada konsumen, sehingga konsumen tidak merasa kesulitan untuk membeli makanan. Kami juga melayani segala bentuk pemesanan sehingga konsumen tidak perlu khawatir kehabisan produk. Dalam lingkungan kampus mahasiswa terbiasa membeli makanan ringan atau jajanan yang ada di sekitar kampus oleh karena itu kami memanfaatkan peluang ini untuk membuat usaha makanan. Usaha yang kami lakukan ini memiliki keunikan dan keunggulan dari proses produksi maupun inovasi yang kami lakukan.</p>','Pentolmercon',1,1,'2019-03-13 20:07:19','2019-03-15 04:32:43'),(877,0,'JAS DESBUK (JASA DESAIN BUKU)','2019 16020124052 Abdus Salim.pdf',NULL,6550000,'<p><strong>Jas desbuk merupakan sebuah usaha jasa desain cover buku, dengan memunculkan inovasi baru yang digemari oleh kalangan anak jaman milineal. Dalam pengerjaannya menggunakan alat-alat digital yang canggih sehingga pengerjaannya pun bisa cepat. Selain itu jas desbuk juga memanfaatkan sosiak media sebagai media pemesanan. Dan menggunakan jasa online seperti j&amp;t dan JNE</strong></p>','ENTER',2,1,'2019-03-13 20:08:56','2019-03-15 02:49:10'),(879,0,'JITUDINGTU (KERAJINAN GANTUNGAN DINDING DAN PINTU)','2019 17010644142 zunita ardani.pdf',NULL,10800000,'<p class=\"MsoNoSpacing\" style=\"text-align: justify; line-height: 115%; tab-stops: 14.2pt;\"><span lang=\"IN\" style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; letter-spacing: -.05pt; mso-ansi-language: IN;\">Hiasan dinding dan pintu untuk mempercantik rumah saat ini sangat diminati<span style=\"mso-spacerun: yes;\">&nbsp; </span>dikalangan remaja maupun ibu-ibu rumah tangga. Tapi karena harga yang ada dipasaran terkadang menjadi kendala untuk membelinya. Banyak harga yang ditawarkan cukup terbilang mahal dan tidak pas untuk kantong remaja yang masih sekolah maupun kuliah. Untuk itu kami membuat produk &ldquo;JituDingtu (Karajinan Gantungan Dinding dan Pintu)&rdquo; dengan harga yang terjangkau.</span></p>\n<p class=\"MsoNoSpacing\" style=\"text-align: justify; line-height: 115%; tab-stops: 14.2pt;\"><span lang=\"IN\" style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; letter-spacing: -.05pt; mso-ansi-language: IN;\"><span style=\"mso-tab-count: 2;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span>Bahan baku yang digunakan sangat mudah ditemukan dimana-mana, seperti kardus bekas dan benang woll. Orang-orang mungkin tidak terpikir bahwa kardus bekas</span><span lang=\"EN-ID\" style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; letter-spacing: -.05pt; mso-ansi-language: EN-ID;\"> dan benang wol</span><span lang=\"IN\" style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; letter-spacing: -.05pt; mso-ansi-language: IN;\"> dapat disulap menjadi barang yang mempunyai nilai jual di masyarakat. Kebanyakan orang menganggap benang wol hanya dapat dijadikan bahan untuk merajut, namun apabila benang wol tersebut diberikan sedikit sentuhan seni dan lebih dikembangkan akan menjadi suatu yang lebih indah. </span><span lang=\"EN-ID\" style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; letter-spacing: -.05pt; mso-ansi-language: EN-ID;\">Selain sebagai hiasan dinding dan pintu, benang wol juga dapat dijadikan aksesoris yang sangat digemari anak remaja pada jaman sekarang seperti gantungan kunci dan aksesoris untuk memperindah leher. </span><span lang=\"IN\" style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; letter-spacing: -.05pt; mso-ansi-language: IN;\">Tetapi tidak hanya itu kami membuat inovasi untuk membuat media pembelajar</span><span lang=\"EN-ID\" style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; letter-spacing: -.05pt; mso-ansi-language: EN-ID;\">an</span><span lang=\"IN\" style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; letter-spacing: -.05pt; mso-ansi-language: IN;\"> dengan menggunakan kedua bahan baku tersebut</span><span lang=\"EN-ID\" style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; letter-spacing: -.05pt; mso-ansi-language: EN-ID;\"> yaitu media pembelajaran &ldquo;Membaca jam analog&rdquo; untuk siswa SD dalam menunjang pembelajaran.</span><span lang=\"IN\" style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; letter-spacing: -.05pt; mso-ansi-language: IN;\"> Cara<span style=\"mso-spacerun: yes;\">&nbsp; </span>membuatnya pun tidak sulit</span><span lang=\"EN-ID\" style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; letter-spacing: -.05pt; mso-ansi-language: EN-ID;\">, hanya saja membutuhkan ketekunan dan kesabaran. Untuk orang yang pertama kali belajar membuat kerajinan dinding dan pintu ini pasti mungkin akan sedikit mengalami kesulitan. Namun apabila ketekunan terus dilatih akan sangat mudah untuk membuatnya. </span></p>\n<p class=\"MsoNoSpacing\" style=\"text-align: justify; line-height: 115%; tab-stops: 14.2pt;\"><span lang=\"EN-ID\" style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; letter-spacing: -.05pt; mso-ansi-language: EN-ID;\"><span style=\"mso-tab-count: 2;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span>Penggemar hiasan dinding dan pintu seperti ini tidak hanya ada di Indonesia saja. Tak jarang orang luar negeri juga menggemari hiasan unik seperti ini. Hiasan ini juga sering kali terlihat dalam acara-acara drama dalam televisi luar negeri. Jadi sudah pasti hiasan dinding dan pintu ini banyak digemari masyarakat luar. Untuk itu pemasaran bisa dilakukan sampai keluar negeri</span></p>','Kerajinan|Dreamcatcher|BenangWol|Benang|Woll',4,1,'2019-03-13 20:11:32','2019-03-14 22:51:50'),(880,0,'SAJI LOCAL (Soya Shake Jelly Fruits Low Callory)','2019 17040674026 Adila Nur Azizah.pdf',NULL,14613000,'<p>Usaha&nbsp; kami&nbsp; ini&nbsp; merupakan&nbsp; usaha&nbsp; yang&nbsp; bergerak&nbsp; dibidang&nbsp; makanan&nbsp; dan&nbsp;minuman&nbsp; dengan&nbsp; mengkombinasikan&nbsp; sari&nbsp; kedelai&nbsp; sebagai&nbsp; &nbsp;minuman&nbsp; segar&nbsp; dan&nbsp;jelly rasa buah sebagai makanan penunda lapar yang rendah kalori dan kaya akan&nbsp;serat.&nbsp; Sehingga&nbsp; SAJI&nbsp; LOCAL&nbsp; dapat&nbsp; dikatakan&nbsp; sebagai&nbsp; produk&nbsp; 2&nbsp; in&nbsp; 1&nbsp; karena&nbsp;terdapat&nbsp; makanan&nbsp; dan&nbsp; minuman&nbsp; dalam&nbsp; satu&nbsp; kemasan&nbsp; produk.&nbsp; Selain&nbsp; itu&nbsp; SAJI&nbsp;LOCAL&nbsp; juga&nbsp; menawarkan&nbsp; manfaat&nbsp; yang&nbsp; besar&nbsp; karena&nbsp; menggunakan&nbsp; bahan&ndash;bahan&nbsp; yang rendah kalori, kaya akan serat, mengandung berbagai vitamin, serta&nbsp;sehat karena tidak menggunakan pengawet apapun. Produk&nbsp; ini&nbsp; ada&nbsp; 6 rasa varian disesuaikan&nbsp; dengan buah&nbsp; yang&nbsp; memiliki&nbsp; kandungan&nbsp; rendah&nbsp;kalori seperti strawberry, avocado, melon, watermelon, guava, dan apple. Sistem&nbsp; pemasaran&nbsp; yang&nbsp; digunakan&nbsp; adalah&nbsp; dengan&nbsp; melakukan&nbsp;pemasokan kepada mitra&nbsp; &ndash;&nbsp; mitra usaha seperti minimarket, foodcourt,&nbsp; dan&nbsp; kantin&nbsp;sekolah. Selain pemasaran offline juga dilakukan&nbsp;pemasaran online melalui media sosial resmi SAJI LOCAL yaitu instagram, line,&nbsp;facebook dengan&nbsp; sistem pemesanan.</p>\n<p>Bisnis&nbsp; minuman&nbsp; di&nbsp; era&nbsp; sekarang&nbsp; adalah&nbsp; salah&nbsp; satu&nbsp; bisnis&nbsp; yang&nbsp; cukup&nbsp;menjanjikan.&nbsp; Berbagai varian produk minuman bermunculan dengan pesat, tetapi&nbsp;kurang&nbsp; memperhatikan&nbsp; kandungan&nbsp; didalamnya&nbsp; dan&nbsp; hanya&nbsp; mementingkan&nbsp; rasa.&nbsp;Disamping itu produk minuman yang dibutuhkan oleh masyarakat saat ini adalah&nbsp;produk&nbsp; yang&nbsp; mendukung&nbsp; program&nbsp; hidup&nbsp; sehat&nbsp; mereka.&nbsp; Berangkat&nbsp; dari&nbsp; alasan&nbsp;tersebut&nbsp; dan&nbsp; realitas&nbsp; masih&nbsp; kurangnya&nbsp; produk&nbsp; minuman&nbsp; yang&nbsp; menawarkan kesehatan di pasaran maka, kami membuat olahan minuman SAJI LOCAL dengan&nbsp;berbagai manfaatnya karena masih mendapatkan tempat pada pilihan masyarakat.&nbsp;</p>','soya|jelly|low callory',1,1,'2019-03-13 20:13:44','2019-03-18 21:42:33'),(881,0,'Tumblr tee','2019 17020104077 Yuvie Dwi Anugerah.pdf',NULL,14175000,'<p><span style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',serif; mso-fareast-font-family: Calibri; letter-spacing: -.05pt; mso-ansi-language: IN; mso-fareast-language: EN-US; mso-bidi-language: AR-SA;\">Tumblr Tee adalah kaos dengan gambar-gambar karakter lucu serta tulisan-tulisan kekinian. Tumblr Tee ini dibuat dengan teknologi sablon. T-shirt yang simpel dan mudah dipadu padankan dengan stelan baju apapun dengan gambar maupun tulisan yang serba kekinian dan banyak diminati oleh kaum remaja jaman sekarang.</span></p>','kaostumblr',4,1,'2019-03-13 20:14:12','2019-03-19 02:15:09'),(882,0,'Puding DuLor (daun kelor) Anti Tantrum Anti magis','2019 17010044022 Titik Nopita Sari.pdf',NULL,8098600,'<p class=\"MsoNormal\" style=\"margin-bottom: .0001pt; text-align: justify;\"><em style=\"mso-bidi-font-style: normal;\"><span lang=\"EN-US\" style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\';\">Moringa oleifera </span></em><span lang=\"EN-US\" style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\';\">atau Daun kelor, memiliki manfaat pada yang jarang diketahui oleh masyarakat. Daun Kelor sendiri kaya akan vitamin, mineral, asam amino esensial, dan masih banyak lagi. Selain itu daun kelor juga aman dan tidak memberikan efek samping apabila dikonsumsi oleh tubuh. PUDING DULOR. Sebuah produk olahan <em style=\"mso-bidi-font-style: normal;\">home made</em> menggunakan bahan dasar sederhana namun memiliki beragam manfaat bagi manusia. Salah satu manfaat utama dari PUDING DULOR ialah kandungan omega 3 nya yang berperan sebagai anti depresan bagi anak dengan spectrum autis. Hal ini kemudian menjadi inspisari dalam penciptaan PUDING DULOR. Anak dengan spectrum autis memerlukan makanan khusus bebas gluten, bebas kasein, bebas gula, namun dalam kendalanya anak anak cenderung tidak suka makan sayur sebagai pemenuhan kebutuhan. Dalam kepercayaan masyarakat Islam daun kelor dipercaya mampu menangkal hal hal ghaib dan juga bersifat sebabagi anti magis. Daun kelor digunakan sebagai bahan untuk memandikan jenazah dalam kepercayaan sebagai masyarakat. Sebagai anti magis, daun kelor digunakan untuk menangkal makhluk halus.. Hal ini menghambat <em style=\"mso-bidi-font-style: normal;\">maintance</em> perkembangan pada anak itu sendiri. Sehingga muncul ide penggolahan daun kelor menjadi naik kelas tanpa menghilangkan khasiat. Sebagai anti tantrum dan anti magis PUDING DULOR mampu berperan menstabilkan <em style=\"mso-bidi-font-style: normal;\">mood </em>dan melindungi kesehatan otak, daun kelor memiliki manfaat sebagai neuro transmitter. Termasuk membantu tubuh dan <em style=\"mso-bidi-font-style: normal;\">mood</em> terasa membaik. PUDING DULOR membantu pemenuhan kebutuhan perkembangan anak serta mampu mengurangi resiko frekuensi tantrum dari anak spectrum autis. PUDING DULOR. Kaya manfaat dan tetap nikmat untuk disantap</span><span style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; mso-ansi-language: IN;\">.</span></p>','Puding, Daun Kelor, Anti Tantrum, Anti Magis',1,1,'2019-03-13 20:19:37','2019-03-18 21:57:10'),(883,0,'Mates','2019 17010014041 Meisiyana Rasulita Boru Sinurat.pdf',NULL,5097495,'<p><span style=\"font-family: \'Times New Roman\', serif;\"><span style=\"font-size: 16px;\">ABSTRAK</span></span></p>\n<p><span lang=\"IN\" style=\"font-size: 12.0pt; mso-bidi-font-size: 11.0pt; line-height: 107%; font-family: \'Times New Roman\',serif; mso-fareast-font-family: Calibri; mso-fareast-theme-font: minor-latin; mso-ansi-language: IN; mso-fareast-language: EN-US; mso-bidi-language: AR-SA;\">Menjadi mahasiswa diera millenial ini memang memiliki banyak tantangan dalam berbagai hal. Mahasiswa didorong untuk memiliki inovasi-inovasi baru yang meginspirasi bagi masyarakat sekitar dan mampu meningkatkan prospek masa depan dari masyarakat sekitar. Oleh karena itu, kami menciptakan inovasi produk olahan makanan yang berbahan dasar dari semanggi. Semanggi dipilih karena memiliki nilai gizi yang baik bagi tubuh serta untuk mencegah osteoporosis sehingga baik dikonsumsi sebelum ataupun sesudah manopause, selain itu semanggi juga memiliki nilai <em>cultural</em> di Surabaya. Di daerah Surabaya, terkhusus Benowo merupakan sentra petani semanggi, yang mana dengan adanya produk ini dapat meningkatkan perekonomian petani semanggi. Bagi kalangan remaja di Surabaya, terkadang enggan untuk mengkonsumsi semanggi karena cara pengolahan dan konsumsi yang cukup rumit, tetapi kami mengemas semanggi dengan sangat praktis dan menarik sehingga meningkatkan minat dari kalangan remaja untuk mengkonsumsinya. Pengolahan produk semanggi ini sudah disesuaikan dengan tren anak muda masa kini, dengan konsep sekali gigit akan semakin menambah nilai praktis dari produk ini. Harga yang ditawarkan juga sangat terjangkau, sangat sesuai dengan target pasar yang ada sehingga dapat dibeli oleh segala kalangan. Dalam pemasaran produk semanggi ini menggunakan media online dan offline, media online berupa instagram dan media offline berupa sewa stand <em>food truck</em>. Media tersebut dinilai sangat cocok karena sesuai dengan perkembangan kalangan anak muda.&nbsp;</span></p>','makanan tradisional|makanan|tradisional|khas surabaya|suroboyo|semanggi suroboyo|young entrepreneur|trend suroboyo',1,1,'2019-03-13 20:22:03','2019-03-20 05:51:54'),(884,0,'Sabun KUAT (Sabun Kulit Durian Anti Bakteri)','2019 16030194080 MOCHAMMAD NURWAHYUDI.pdf',NULL,8300000,'<p>Kulit durian merupakan salah limbah yang jarang dimanfaatkan. Disalah satu penelitian disebutkan bahwa kulit durian mengandung senyawa antibakteri yang dapat dimanfaatkan untuk mencegah pertumbuhan bakteri. Dengan peningkatan jumlah pertumbuhan penduduk menyebabkan permasalahan baru yaitu permasalahan peningkatan akan kebutuhan primer masyarakat. Dengan pemanfaatan kulit durian sebagai produk kesehatan kulit yang akan selalu dimanfaatkan dan dibutuhkan oleh masyarakat untuk semua kalangan. Dengan kandungan senyawa antibakteri pada kulit durian dapat dimanfaatkan sebagai bahan dasar produk perawatan kulit seperti sabun. Selain bermanfaat untuk mengurangi limbah kulit durian juga bermanfaat sebagai produk yang dapat menjaga dan mempertahankan kesehatan kulit yang memiliki nilai jual sehingga dapat menjadi sumber penghasilan bagi pengusaha dan masyarakat yang memiliki prospek hingga masa yang akan datang.</p>','kulit durian|antibakteri|sabun',5,1,'2019-03-13 20:45:49','2019-03-15 03:40:10'),(885,0,'Roti Bakar Gacha','2019 17020104051 Muhammad Afrizal Maulana.pdf',NULL,1200000,'<p>Di era globalisasi saat ini, banyak sekali mahasiswa yang tidak memiliki waktu untuk sarapan. Hal ini dikarenakan mereka dituntut untuk memulai kegiatan perkuliahan pada pukul 7, sehingga menyebabkan para mahasiswa tidak dapat meluangkan waktu untuk sarapan. Dari hal ini kami ingin membuat sebuah inovasi berupa makanan yang ditujukan agar mahasiswa dapat memenuhi kebutuhan sarapan mereka. Dikutip dari http://www.alodokter.com/manfaat-sarapan-yang-tidak-boleh-dilewatkan bahwa terdapat banyak sekali manfaat dari sarapan, seperti membantu melindungi tubuh dari penyakit, lebih fokus, membantu menurunkan berat badan, dan membantu meningkatkan mood. Maka dari itu kami ingin membuat usaha di bidang kuliner khususnya makanan untuk sarapan.</p>\r\n<p>Saat ini banyak usaha yang menjual produk untuk sarapan. Namun kebanyakan dari produk tersebut merupakan makanan berat seperti nasi bungkus. Namun menurut kami produk ini kurang praktis, karena membutuhkan waktu lebih untuk mengkonsumsinya, terlebih disaat terburu-terburu. Maka dari itu kami ingin membuat makanan yang praktis untuk dikonsumsi namun tetap mengenyangkan seperti nasi bugkus dan tetap mengandung gizi yang dibutuhkan saat sarpan pagi.&nbsp;</p>\r\n<p>Maka dari itu, kami memilih Roti Bakar Gacha sebagai bentuk usaha yang ingin kami kembangkan. Kami ingin membuat roti bakar, namun dengan cara penjualan yang berbeda dan unik dari yang lain. Kami akan memberikan undian yang jika beruntung maka akan mendapatkan 1 potong roti bakar secara gratis. Dalam satu hari kami akan menyediakan 5 buah roti bakar yang akan diundi secara gratis.&nbsp;</p>','Roti bakar|roti|Roti|Roti Bakar Gacha',1,1,'2019-03-13 21:00:12','2019-03-19 23:13:10'),(886,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,'2019-03-13 21:02:47','2019-03-13 21:02:47'),(887,0,'The Moncong\'s \"Mochi Mochi Ketan isi Kejutan cocok penghilang stres\"','2019 16050423014 Nur Kholish Ali Fahmi.pdf',NULL,8000000,'<p class=\"MsoNormal\" style=\"text-align: justify; text-indent: 1.0cm;\"><strong style=\"mso-bidi-font-weight: normal;\"><u><span lang=\"IN\" style=\"font-family: \'Times New Roman\',\'serif\'; mso-ansi-language: IN;\">The Moncong&rsquo;s</span></u></strong><strong style=\"mso-bidi-font-weight: normal;\"><span lang=\"IN\" style=\"font-family: \'Times New Roman\',\'serif\'; mso-ansi-language: IN;\"> &ldquo;Mochi Mochi Ketan Isi Kejutan cocok penghilang stres&rdquo;</span></strong> <span style=\"font-family: \'Times New Roman\',\'serif\';\">Olahan ketan ini memadukan beras ketan tradisional yang didalamnya mochi mochi memiliki banyak kejutan rasa dan diatasnya terdapat topping yang di selimuti oleh </span><span lang=\"IN\" style=\"font-family: \'Times New Roman\',\'serif\'; mso-ansi-language: IN;\">berbagai macam bahan dengan memberi </span><span style=\"font-family: \'Times New Roman\',\'serif\';\">rasa kejutan pada mochi mochi ketan tersebut. </span></p>','moncongs|mochi ketan',1,1,'2019-03-13 21:03:55','2019-03-18 20:23:46'),(888,0,'CIPEL IRAS','2019 17040254032 Bero santoso.pdf',NULL,11341000,'<p>Tingginya euforia permintaan masyarakat terhadap camilan ringan yang&nbsp;menyehatkan dan unik serta tampilan yang baik membuat semakin&nbsp;menjamurnya usaha kreatif baru dengan tampilan yang baru. Produk ini&nbsp;diharapkan mampu untuk menganjal perut atau hanya sekedar camilan saja.&nbsp;Besarnya pangsa pasar yang menginginkan camilan tersebut sangat strategis&nbsp;dan merupakan peluang untuk digeluti. Melihat peluang yang begitu besar&nbsp;tersebut kami berinovasi membuat produk camilan cilok menarik dengan&nbsp;bermacam warna dengan nama CIPEL IRAS &ldquo;Cilok Pelang Isi Rasa &ndash; Rasa&rdquo;.&nbsp;Produk kami menggunakan bahan asli tanpa pengawet maupun perasa buatan.&nbsp;Kami sangat optimis bahwa untuk kedepannya bisnis kami dapat berkembang&nbsp;dengan baik dan sukses dengan konsistensi kualitas produk yang tetap.&nbsp;</p>','CILOK|JAJANAN|SEHAT',1,1,'2019-03-13 21:12:06','2019-03-15 03:31:01'),(889,0,'SIOCHI (SIOmay mOCHI)','2019 16010664018 Ari Kresna Budianto.pdf',NULL,5626000,'<p>Fenomena mengenai banyaknya gambar maupun video mengenai makanan yang diunggah di media sosial, mudah ditemui pada masa sekarang. Hal ini terlihat banyaknya video blog (Vlog) yang membahas makanan beberapa media sosial. Total banyaknya viewers, followers, dan bahkan pada likers lebih didominasi oleh konten yang membahas mengenai makanan. Terjadinya hal ini karena makanan sendiri adalah merupakan kebutuhan dasar dari manusia. Makanan sering diulas di media sosial bukan hanya semata merupakan kebutuhan dasar dari manusia, keunikan dan cita rasa dari makanan juga menjadi salah satu poin yang diunggulkan dari konten mengenai makanan. Banyaknya konten tersebut menjadikan media sosial menjadi sebuah target yang tepat melihat bagaimana kebutuhan dan tren makanan saat ini.</p>\n<p>Tren dari makanan tersebut ada atas dasar dari kreativitas para pecinta makanan. Hasil pengamatan lewat media sosial sering dijumpai bahwa konten makanan yang paling banyak dilihat adalah konten makanan yang memiliki nama, rasa, kemasan, dan nuansa tempat makan yang berbeda serta unik. Dari beberapa factor tersebut kami memilih salah satu dari beberapa factor yang dapat dijadikan inspirasi untuk dibuat menjadi peluang usaha. Pemilihan factor tersebut jatuh pada nama dan rasa yang unik agar dapat dibuat suatu produk makanan baru.</p>\n<p>Factor nama pertama kali dipilih karena nama diniai sebagai hal yang pertama dilihat dari keunikan dari sebuah produk. Berangkat dari keunikan nama kami memiliki konsep menggabungkan antara konsep Siomay dan Mochi menjadi SIOCHI. Adanya bentuk produk local dengan cita rasa kue khas jepang akan dihadirkan lewat produk makanan tersebut.</p>\n<p>Focus kedua adalah pada rasa, pemilihan factor rasa telah jelas menjadi point utama dari makanan tersebut dapat dikategorikan enak. Rasa yang akan dihadirkan pada prodak makanan ini adalah siomay dengan cita rasa manis tentu berbeda dengan yang telah umum, sekaligus rasa manis tersebut menghadirkan rasa lama dari salah satu tanaman toga yaitu bunga rosella hal ini juga menjadi keunggulan lebih dari produk makanan ini.</p>','SIOCHI|SIOMAY|MOCHI|BUNGA ROSELLA|TOGA',1,1,'2019-03-13 21:21:10','2019-03-14 23:37:13'),(890,0,'Aksesoris AKSI AMAN (Aksesoris Resin Tanaman Gulma)','2019 16010664044 Achmad Sahron.pdf',NULL,7615000,'<p class=\"MsoNoSpacing\" style=\"margin-left: 21.3pt; text-align: justify; text-indent: 21.25pt; line-height: 115%; tab-stops: 14.2pt;\"><span lang=\"IN\" style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; letter-spacing: -.05pt; mso-ansi-language: IN;\">Usaha </span><span style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; letter-spacing: -.05pt;\">kami layak untuk mendapat pendampingan melalui PMW karena produk yang kami hasilkan masih belum memiliki pesaing yang banyak di pasaran. Produk yang kami kembangkan menggunakan bahan produksi tanaman gulma yang biasa tumbuh di sekitar persawahan, dimana masih sangat jarang dimanfaatkan. Tanaman gulma yang semula dianggap tidak penting dan cenderung dibasmi oleh petani, dapat kami manfaatkan menjadi aksesoris yang unik dan bernilai ekonomis.</span></p>\n<p class=\"MsoNoSpacing\" style=\"margin-left: 21.3pt; text-align: justify; text-indent: 21.25pt; line-height: 115%; tab-stops: 14.2pt;\"><span style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; letter-spacing: -.05pt;\">Produk yang berupa aksesoris dapat bertahan lama sehingga minim akan resiko kerusakan dan kerugian. Kebutuhan masyarakat terutama usia remaja dan dewasa akan aksesoris yang unik dan terjangkau menjadi peluang kami dalam memasarkan produk ini. Harga yang kami tawarkan juga terjangkau sehingga dapat dinikmati oleh mahasiswa dan masyarakat umum.</span></p>','aksesoris|resin|tanaman gulma|milenial|gelang|kalung|cincin|prusik',4,1,'2019-03-13 21:22:45','2019-03-15 00:16:36'),(891,0,'E - JAPRI\'EN','2019 16010034008 Dwi ayu rahmawati.pdf',NULL,15000000,'<p class=\"MsoNormal\" style=\"text-align: justify; line-height: 150%;\"><span lang=\"IN\" style=\"font-size: 12.0pt; line-height: 150%; font-family: \'Times New Roman\',\'serif\';\">PMW adalah sebuah ajang dimana mahasiswa bisa berkreatifitas dan mengembangkan ide mengenai program kewirausahaan. PMW sendiri juga merupakan program yang dibuat pemerintah untuk mengatasi fenomena pengangguran berpendidikan di kalangan mahasiswa. Selain sebagai ajang untuk untuk berkreatifitas dan mengembangkan inovasi ide, PMW juga bisa menjadi jalan mahasiswa untuk meningkatkan kepekaan mahasiswa terhadap masalah-masalah atau fenomena-fenomena yang ada di sekitarnya. Dimana mahasiswa diharapkan tidak hanya berperan sebagai pihak pengkritik atas ketimpangan antara harapan dan ekspektasi pada fenomena atau masalah yang ada di sekitar namun juga berperan sebagai pihak yang juga ikut berkontribusi membantu pemerintah &nbsp;untuk menemukan solusi pemecahan dari fenomena atau masalah yang ada di sekitar tersebut. </span></p>\r\n<p>&nbsp;</p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify; line-height: 150%;\"><span lang=\"IN\" style=\"font-size: 12.0pt; line-height: 150%; font-family: \'Times New Roman\',\'serif\';\">Untuk mencari peluang yang bisa dijadikan sebagai program kewirausahaan belum tentu berasal dari masalah rumit dalam masayarakat, saah satunya adalah potensi mahasiswa yang banyak melakukan kerja sambilan sebagai tutor di lembaga bimbingan belajar atau tutor bimbingan belajar independen atau mandiri. Di lingkup lingkungan kampus UNESA sendiri banyak ditemui fenomena mahasiswa yang menjadi tutor bimingan belajar di tengah kesibukan kegiatan perkuliahannya. Melihat peluang ini, kelompok kami terpikir utuk membuat program kelompok yang mengkoordinir dan menyalurkan tenaga-tenaga tutor bimbingan belajar yang berkualitas dan sudah profesional kepada peserta didik. Di lingkup lingkungan kampus UNESA sendiri belum ada usaha wirausaha di bidang ini. Selain mempermudaha kinerja tutor adapun manfaat lain yang bisa di dapat yaitu peserta didik tidak perlu kesuloitan mencari tutor yang berkualitas dan bisa melayani kebutuhan belajar peserta didik yang beragam. Inovasi yang diberikan oleh kelompok kami adalah menawarkan penyaluran tenaga tutor yang profesional dengan spesifikasi kemampuan baik dalam bidangnya. Program kelompok kami berjalan dalam jaringan atau secara <em>online</em> (DARING) melalui web dan sosial media. Dalam web ini nantinya akan dicantumkan profil-profil tutor beserta spesifikasi kemampuannya sehingga peserta didik bisa mudah ketika akan memilih tutir yang nantinya akan membantunya dalam belajar dan peran kami sebagai lembaga penyalur adalah menghubungkan tutor dengan peserta didik serta orang tua peserta didik untuk salaing berkomunikasi berkaitan dengan pelaksanaan pembelajaran nantinya. Inilah yang menjadi poin keunggulan yang diusung dalam program kewirausahaan yang dirancang oleh kelompok kami. Inilah alasan mengapa program ini memerlukan pendampingan usaha melalui PMW.&nbsp;</span><span lang=\"IN\" style=\"font-size: 12.0pt; line-height: 150%; font-family: \'Times New Roman\',\'serif\';\">&nbsp;</span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify; line-height: 150%;\">&nbsp;</p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify; line-height: 150%;\"><span lang=\"IN\" style=\"font-size: 12.0pt; line-height: 150%; font-family: \'Times New Roman\',\'serif\';\">kata kunci : private, inovasi, online</span></p>','private|guru private|tutor|PMW UNESA|UNESA|Pendidikan|Pendidikan luar sekolah |Pendidikan non formal |Inovasi|online|cari guru|penyalur jasa|inovasi jasa|bidang usaha jasa|lembaga |LBB|PLS|PNF|PMW|PMW UNESA 2019',2,1,'2019-03-13 21:23:59','2019-03-15 07:02:09'),(892,0,'BOBONAS (BOLA - BOLA NASI)','2019 16040284021 Muhimatul Ulya.pdf',NULL,8568000,'<p class=\"MsoNoSpacing\" style=\"margin-left: 14.2pt; text-align: justify; line-height: 150%; tab-stops: 14.2pt;\"><span style=\"font-size: 12.0pt; line-height: 150%; font-family: \'Times New Roman\',\'serif\'; letter-spacing: -.05pt; mso-ansi-language: IN;\">BOBONAS (Bola-Bola Nasi)</span></p>\n<p class=\"MsoNoSpacing\" style=\"margin-left: 14.2pt; text-align: justify; line-height: 150%; tab-stops: 14.2pt;\"><span style=\"font-size: 12.0pt; line-height: 150%; font-family: \'Times New Roman\',\'serif\'; letter-spacing: -.05pt; mso-ansi-language: IN;\"><span style=\"mso-tab-count: 1;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span>Bobonas (Bola-bola nasi) merupakan salah satu jenis olahan nasi yang sangat terkenal di negara-negara Asia seperti Korea dan Jepang. Nama lain dari olahan ini adalah nasi kepal atau dalam bahasa Korea nya <em>jumeokbab</em> dan dalam bahasa Jepang nya adalah <em>onigiri</em>. Keunikan dari Palnas ini adalah bentuknya yang imut, serta dengan varian isi yang banyak, menjadikannya kaya rasa. Selain itu, Palnas ini telah <em style=\"mso-bidi-font-style: normal;\">booming</em> dikalangan muda pecinta K-Drama dan K-Pop (sebagaimana diketahui, Nasi Kepas ini berasal dari Korea dan Jepang, sehingga banyak ditampilkan dalam Drama atau Film-film Korea dan Jepang), namun masih belum banyak dijumpai di Surabaya. Peluang inilah yang membuat tim kami termotivasi membuat nasi kepal dengan varian isi lauk pauk ala Indonesia yang lebih banyak dan kaya dibanding versi originalnya dari Korea dan Jepang.</span></p>','nasi',1,1,'2019-03-13 21:37:15','2019-03-15 05:12:34'),(893,0,'DEGO (Dream Edugathering Event Organizer)','2019 16010034029 Bagus Nur Alifudin.pdf',NULL,15000000,'<p class=\"MsoNoSpacing\" style=\"margin-left: 14.2pt; text-align: justify; line-height: 150%; tab-stops: 14.2pt;\"><span lang=\"IN\" style=\"font-size: 12.0pt; line-height: 150%; font-family: \'Times New Roman\',\'serif\'; letter-spacing: -.05pt; mso-ansi-language: IN;\">Dream Edugathering merupakan penyedia layanan jasa penyelenggaraan Gathering berbasis Edukasi yang dikemas secara menyenangkan, kekeluargaan dan tentunya ada ilmu atau pendidikan yang dapat diambil serta disajikan didalamnya. Selain itu kami tidak hanya menyediakan satu usaha mengenai event organizer saja melainkan menyebarluaskan mengenai Pendidikan terutama Pendidikan Luar Sekolah pula. Menawarkan Jasa Gathering baik bagi Family, Arisan Keluarga, Event Komunitas, Gathering Anak, Gathering Karyawan, dll. Fasilitas yang ditawarkan Trainer/ Fasilitator, Lokasi Indoor/ Outdoor, Perlengkapan Acara, Makanan, Transportasi, dan lain-lain. Keunggulan dari produk jasa yang kami tawarkan ialah tema, fasilitas, benefit, kegiatan, hingga harga yang dapat di kostum oleh pengguna jasa.</span></p>','edukasi, jasa, event organizer, dan Gathering',2,1,'2019-03-13 21:41:25','2019-03-15 00:23:21'),(894,0,'This is My Busy Book','2019 16010684065 Selvi Aprilia Ika Rudianti.pdf',NULL,14582500,'<p class=\"MsoNormal\" style=\"margin-bottom: .0001pt; text-align: justify; text-indent: .5in; line-height: 115%;\"><span style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',serif; mso-fareast-font-family: \'Times New Roman\';\">Busy book merupakan salah satu item dari sumber media pembelajaran, dimana saat ini menjadi kebutuhan penting bagi guru dan orang tua dalam memberikan stimulasi perkembangan pada anak. Tanpa adanya busy book maka pembelajaran dikelas akan menjadi hambar dan monoton dan itu akan menjadikan anak bosan dalam pembelajarannya. Saat ini perkembangan busy book sangat meningkat dengan sangat pesat dan saat ini banyak dibutuhkan oleh guru dan orang tua, ini merupakan bentuk media buku selain digunakan sebagai pendamping pembelajaran buku ini juga dapat digunakan sebagai alat permainan edukatif yang pastinya sangat membantu anak dalam membantu atau menstimulasi daya kembang anak.</span></p>\n<p class=\"MsoNormal\" style=\"margin-bottom: .0001pt; text-align: justify; text-indent: .5in; line-height: 115%;\"><span style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',serif; mso-fareast-font-family: \'Times New Roman\';\"><span style=\"mso-spacerun: yes;\">&nbsp;</span>Busy book ini akan dilengkapi konsep yang disesuaikan dengan STPPA dengan panduan dari Permendikbud 137 dan 146 yang akan menjadikan buku ini sangat berbeda dengan pemilik produk yang lain. Dalam hal ini ketika anak memainkan buku ini maka aspek perkembangan pada diri anak akan terasah dengan baik, hal itu meliputi Nilai Agama dan Moral, Sosial Emosional, Kognitif, Fisik Motorik, Bahasa, dan Seni. Pada dasarnya busy book ini sangat diperlukan bagi guru, orang tua maupun bagi anak.</span></p>\n<p class=\"MsoNormal\" style=\"margin-bottom: .0001pt; text-align: justify; text-indent: .5in; line-height: 115%;\"><span style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',serif; mso-fareast-font-family: \'Times New Roman\';\">Selain itu dalam produk pemasaran kami akan memanfaatkan perkembangan zaman yang saat ini sangat marak yaitu melalui via online yang dimana dengan penjualan melalui online dipastikan konsumen akan semakin luas dan pemesanan akan semakin menyebar. Maka dari itu dengan bisnis ini akan merambah pada bidang industri kreatif denagn menjamin kualitas yang sangat baik denagn mengandalkan pedoman dari STTPA dan permendikbud 137 dan 146 sebagai nilai tambah dibandingkan dengan produsen-produsen lainnya.</span></p>','busy book|pg paud|unesa|proposal pmw unesa|anak usia dini',4,1,'2019-03-13 21:43:27','2019-03-14 23:34:55'),(895,0,'curanmor','2019 16040284058 Eko Susanto.pdf',NULL,2441000,'<p>Dilatar belakangi oleh semakin menurunnya minat masyarakat terutama kalangan muda terhadap jajanan tradisional yang semakin tergerus jaman dari waktu ke waktu. Hal ini dikarenakan jajanan tradisional pada saat ini dianggap sudah kuno, tampilannya tidak menarik, kurang higenis, dan juga bahkan ada oknum yang tidak bertanggung jawab menambahkan bahan-bahan berbahaya dalam memproduksi jajanan pasar ini. Selain itu juga diera yang semakin berkembang ini selera masyarakat pun juga ikut berubah dalam memilih makanan yang mempunyai daya tarik tinggi, mempunyai rasa yang enak dan tentunya ramah dikantong.</p>\n<p>Oleh karena latar belakang dan tantangan itulah kami berinisiatif untuk membuat produk wirausaha berupa CURANMOR (Cucur Enak Mengandung Flavour) dengan mengangkat cucur yang awalnya dianggap hanya jajan tradisional biasa menjadi jajanan modern yang diminati banyak kalangan pada saat ini. Usaha cucur ini kami inovasikan dengan membuat rasa dan warna yang berasal dari bahan alami yaitu buah-buahan dengan menambahkan toping premium agar terdapat sensasi yang berbeda saat menikmati kue cucur pada umumnya serta dikemas dalam kemasan yang menarik dan higenis.</p>','jajanan cucur',1,1,'2019-03-13 21:50:58','2019-03-18 18:51:21'),(896,0,'SNOW ( Serial Number of Windows)','2019 17010644077 yugo adiyanto.pdf',NULL,3300000,'<p>Pada era digital ini manusia tidak bisa lepas dengan teknologi, yang mana&nbsp; peran teknologi sangat di butuhkan dalam kehidupan sehari-hari. Berbagai bidang seperti Pekerjaan,pendidikan,pengobatan dan lain-lain, hal ini dikarenakan teknologi sendiri sudah menjadi bagian dari kehidupan manusia pada era ini.Salah satu teknologi yang sering di jumpai pada saat ini adalah PC (<em>Personal Computer)</em>&nbsp;atau laptop, benda ini dapat dengan mudah kita temukan setiap harinya di lingkungan perkotaan dimana tempat tinggal kita.Penggunaan komputer sendiri juga tidak bisa dilepaskan dari peran 2 perangkat yaitu; Perangkat keras (<em>Hardware)&nbsp;</em>dan perangkat lunak (<em>Software)</em>. Perangkat keras (<em>Hardware)&nbsp;</em>pada komputer berguna sebagai mesin penjalan sebuah komputer yang mana mesin ini akan sangat beguna apabila keseluruhan mesin ini dapat di sesuaikan dengan kebutuhan pengguna sehingga dapat menyelesaikan tugas sesuai dengan bidangnya masing-masing. Perangkat Lunak (<em>Software)&nbsp;</em>komputer berguna sebagai sebuah sistem untuk menjalankan perangkat keras yang bersangkutan karena tanpa perangkat lunak, perangkat keras tidak akan bisa memberikan manfaat yang optimal.Proposal ini akan sedikit membahas tentang penggunaan perangkat lunak (<em>software)&nbsp;</em>untuk menjalankan sebuah komputer. Sistem Operasi pada kebanyakan komputer yang sering digunakan pada saat ini adaalah sistem operasi berbasis windows. Sistem operasi ini sangat disukai bagi kebanyakan pengguna komputer pada saat ini,dikarenakan sistem operasi ini tidak begitu rumit dan pengoperasiannya sangat mudah bagi pengguna itu sendiri. Kemudahan yang diberikan tentunya tidak bisa lepas dari peran seorang pengembang software (<em>Developer)&nbsp;</em>didalamnya,karena pada pengembangan sebuah perangkat lunak perlu adanya pemikiran yang komples dan rumat oleh berbagai pengembang di dalamnya. Akan tetapi hal ini juga tidak menutup kemungkinan bagi seorang pengguna program ilegal dapat membajak sebuah perangkat lunak untuk dapat menggunakannya secara gratis tetapi ilegal.Menurut lembaga&nbsp;<em>Business Software Alliance&nbsp;</em>Menyatakan prosentasi pembajakan di Indonesia mencapai 83% karena lemahnya penegak hukum di Indonesia mengenai pelanggaran terhadap hak cipta. Maka dari itu Proposal ini dibuat bertujuan untuk mengurangi angka pembajakan software di Indonesia dengan menjual serial key original windows di masyarakat dengan harga yang terjangkau.</p>','serial key, windows,original,software,hardware,pembajakan|windows|original|serial key|software|hardware|bajakan|sistem operasi',2,1,'2019-03-13 21:52:27','2019-03-17 02:44:50'),(897,0,'Drinks for HRD (Healty Rapit Diet)','2019 17010664201 Hadiatus Sholiha.pdf',NULL,6941400,'<p>Jenis produk yang kami buat yaitu <em>smoothies</em> buah-buahan dan <em>infuse water</em>, yang mana dari kedua produk tersebut terbuat dari bahan-bahan yang baik untuk kesehatan dan tentunya tepat dikonsumsi untuk orang yang sedang diet ataupun tidak. Produk yang kami buat merupakan produk yang praktis, dapat langsung dikonsumsi, dapat dibawa kemana-mana dan belum banyak orang yang membuat dan memasarkan produk yang sama persis dengan produk kami. Manfaat produk kami untuk kesehatan yaitu sebagai <em>detox</em> (menghilangkan racun dalam tubuh), memperlancar pencernaan sehingga dapat mengurangi sembelit, tubuh mendapatkan vitamin dan serat secara bersamaan dalam bentuk yang berbeda sehingga tidak malas atau bosan untuk mengonsumsinya. <em>Infuse water</em> dapat dijadikan pengganti air putih juga untuk penangkal radikal bebas, tentunya juga dapat menurunkan berat badan dan dapat meningkatkan daya tahan tubuh. Manfaat lain dari produk kami yaitu mengatasi masalah psikologis yang berupa <em>bullying, body shaming</em>, dan gangguan makan yaitu <em>anorexia nervosa</em>, <em>bulimia nervosa</em>, dan <em>binge-eating disorder</em>.</p>','Smoothies|Infuse Water|Diet|Buah|Psikologis',1,1,'2019-03-13 21:54:51','2019-03-15 00:14:58'),(898,0,'Coloureful & Tasteful Lanana Chipz Keripik Pisang Berwarna dan Rasa-rasa','2019 17050524070 Andriyanti Achsan.pdf',NULL,8976000,'<p class=\"MsoNoSpacing\" style=\"text-align: justify; text-indent: 21.3pt; line-height: 115%; tab-stops: 14.2pt;\"><span lang=\"EN-ID\" style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; letter-spacing: -.05pt; mso-ansi-language: EN-ID;\">Surabaya merupakan kota metroplotitan terbesar kedua di Indonesia yang&nbsp;</span><span lang=\"EN-ID\" style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; letter-spacing: -.05pt; mso-ansi-language: EN-ID;\">Pertumbuhan jumlah wirausahannya selalu meningkat, hal tersebut terbukti menurut data BPS (Badan Pusat Statistik) pada tahun 2017 terdapat 256 ribu angkatan kerja di bidang wirausaha. Hal tersebut mengindikasikan bahwa persaingan di bidang usaha cukup ketat. Salah satu usaha yang prospek kedepan yang cukup menjanjikan yakni usaha di bidang makanan dan snack. Oleh sebab itu kami mengangkat usaha snack, yang bahan utamannya dari pisang. Produk kami yakni </span><span style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; letter-spacing: -.05pt;\">&ldquo;<em>Coloureful &amp; Tasteful Lanana Chipz</em> &ldquo;Keripik Pisang Berwarna dan Rasa-rasa&rdquo;, yaitu keripik pisang yang lezat dengan varian rasa-rasa ke kinian.&nbsp;</span></p>\n<p class=\"MsoNoSpacing\" style=\"text-align: justify; text-indent: 21.3pt; line-height: 115%; tab-stops: 14.2pt;\"><span lang=\"EN-ID\" style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; letter-spacing: -.05pt; mso-ansi-language: EN-ID;\">Permasalahan yang muncul saat ini yaitu minimnya persaingan produk lokal yang berkualitas serta kreatif. </span><span style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; letter-spacing: -.05pt;\">&ldquo;<em>Coloureful &amp; Tasteful Lanana Chipz, </em>merupakan salah satu inovasi yang unik untuk di pasarkan, selain belum adannya kompetitor serupa, jumlah peminat yang ada di kalangan kampus cukup banyak. Hampir setiap hari salah satu dari tim kami menerima pesanan keripik dengan variasi rasa yang beragam, melihat besarnya jumlah peminat tersebut kami berupaya untuk mengangkatnya menjadi suatu usaha yang lebih terstruktur dan sistematis dengan mengikuti PMW 2019 ( Pekan Mahasiswa Wirausaha )</span></p>\n<p class=\"MsoNoSpacing\" style=\"text-align: justify; text-indent: 21.3pt; line-height: 115%; tab-stops: 14.2pt;\"><span lang=\"EN-ID\" style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; letter-spacing: -.05pt; mso-ansi-language: EN-ID;\">Selain banyaknya jumlah peminat, usaha kami juga memiliki beberapa kendala yakni diantarannya, proses produksi dari mulai pengupasan pencampuran bumbu hingga penggorengan dan pengovenan masih dilakukan secara manual, yakni kurangnya alat pendukung untuk meningkatkan kapasitas dan kualitas produksi. Lalu kami juga terkendala masalah <em>Package </em>atau kemasan dari keripik pisang yang masih menggunakan plastik biasa, kami berupaya untuk membuat desain produk agar lebih menarik. Dan juga <em>branding product</em> atau peningkatan proses pemasaran yang belum sistematis</span></p>\n<p><span lang=\"EN-ID\" style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; mso-fareast-font-family: Calibri; letter-spacing: -.05pt; mso-ansi-language: EN-ID; mso-fareast-language: EN-US; mso-bidi-language: AR-SA;\">Berdasarkan banyaknya jumlah potensi pasar yang dibutuhkan oleh konsumen &nbsp;&nbsp;serta kendala kendala yang dialami saat ini maka diperlukan metode inovatif yang diperlukan untuk menunjang majunya usaha kami. Oleh sebab itu ketika konsep usaha kami ini disetujui maka, kami akan melakukan proses perbaikan produksi sehingga diaharapkan produktivitas dan efektivitas dapat meningkat, lalu kami akan mendesain produk dengan kreatif sehingga dapat menarik minat konsumen lebih banyak. serta kami juga melakukan <em>branding product</em> dengan cara bekerjsama dengan beberapa <em>stakeholder </em>ternaman seperti jasa periklanan, konten kreatif di media social serta jasa order makanan secara online seperti Go-Food</span></p>','Banana Chip, Inovasi Jajanan, Lezat',1,1,'2019-03-13 21:55:12','2019-03-15 04:10:48'),(899,0,'KARESA (Kawaii Resin Surabaya)','2019 17020104060 Liana Lukita Puri.pdf',NULL,8000000,'<p>usaha ini adalah jenis usaha dimana resin dijadikan sebagai bahan dasar pembuatan aksesoris. Sifat resin yang transparan membuat produk bisa dikombinasikan dengan banyak varian barang sesuai dengan minat konsumen.</p>','resin|kerajinan resin|aksesoris',5,1,'2019-03-13 21:59:09','2019-03-20 00:40:26'),(900,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,'2019-03-13 21:59:14','2019-03-13 21:59:14'),(901,0,'KABEL OLOR (Kebab Buntel Kabel Olor)','2019 16010684010 Ajeng Realita Andreas Putri.pdf',NULL,7879000,'<p><strong><em>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp;</em></strong><strong>KABEL</strong><strong> OLOR</strong></p>\n<p><em><strong>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; (Kebab Buntel Daun Kelor)</strong></em></p>\n<p class=\"MsoListParagraphCxSpFirst\" style=\"text-align: justify; text-indent: 36.0pt;\"><span lang=\"EN-US\" style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\';\">Daun kelor, pasti sudah banyak masyarakat mengenal bagaimana bentuk, rasa hingga manfaatnya daun kelor tersebut. Kandungan dalam daun kelor begitu banyak manfaatnya. Tetapi belakangan ini, masih saja masyarakat yang kurang tertarik untuk mengonsumsi atau mengolah daun kelor. Bahkan daun kelor terkenal hanya sebagai pengobatan tradisional saja. Di era modern ini, akan ada inovasi baru dalam pengolahan daun kelor menjadi sebuah makanan yang unik. Agar masyarakat lebih tertarik dan menyadari bahwa manfaatnya begitu banyak bagi kesehatan. Terlebih juga untuk mengurangi kebiasaan masyarakat mengkonsumsi <em style=\"mso-bidi-font-style: normal;\">junkfood</em> yang kurang baik bagi kesehatan.</span></p>\n<p class=\"MsoListParagraphCxSpMiddle\" style=\"text-align: justify; text-indent: 36.0pt;\"><span lang=\"EN-US\" style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\';\">KABEL OLOR, itulah nama unik dari produk kami, yakni Kebab Buntel Daun Kelor. Mengapa harus kebab? Karena melihat maraknya outlet kebab yang menjadi pusat camilan siap saji di kalangan masyarakat ini. Karena terkenal praktis, efisien, higienis dan yang pasti membuat kenyang lebih cepat. Maka dari itu kami menghadirkan inovasi kebab terbaru dan yang pasti berbeda dengan kebab pada umumnya, yakni olahan kulit kebab berbahan dasar daun kelor. Dimana KABEL OLOR hadir untuk menemani dan memuaskan lidah masyarakat Indonesia yang doyan makan sekaligus menyehatkan. Kemudian kami mengkombinasikan daun kelor sebagai bahan utama pembuatan kulit kebab dengan mencampurkannya dengan telur, tepung dan bahan lainnya. Kemudian kami variasikan isiannya menjadi tiga rasa, yaitu original, pedas dan pisang keju. Tiga rasa tersebut mewakili selera lidah masyarakat Indonesia yang suka pedas, manis dan asin. Dimana setiap varian kebab memiliki keunikan masing-masing.</span></p>\n<p class=\"MsoListParagraphCxSpMiddle\" style=\"text-align: justify; text-indent: 36.0pt;\"><span lang=\"EN-US\" style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\';\"><span style=\"mso-spacerun: yes;\">&nbsp;</span>Tidak hanya unik dalam pengolahannya namun kami juga menjadikan <em style=\"mso-bidi-font-style: normal;\">packaging </em>atau kemasan yang efisien, higienis dan terjangkau. Kami membuat dua jenis kemasan untuk produk makanan ini, yakni dalam kemasan <em style=\"mso-bidi-font-style: normal;\">frozen food</em> dan siap makan. Dan yang pasti kami akan hadir di kota Surabaya, Sidoarjo, Gresik, Mojokerto dan sebagainya. Kemudian KABEL OLOR juga dapat dipesan secara <em style=\"mso-bidi-font-style: normal;\">online </em>maupun <em style=\"mso-bidi-font-style: normal;\">offline </em>yang berupa outlet-outlet dalam mal, pasar, pusat oleh-oleh dan sebagainya.</span></p>\n<p class=\"MsoListParagraphCxSpLast\" style=\"text-align: justify; text-indent: 36.0pt;\"><span lang=\"EN-US\" style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\';\">Itulah yang menjadikan tujuan pembuatan produk ini untuk mempopulerkan daun kelor tidak hanya untuk pengobatan tradisional saja akan tetapi dapat dijadikan olahan baru yang pasti berbeda dengan lainnya dan dapat diminati oleh<span style=\"mso-spacerun: yes;\">&nbsp; </span>berbagai kalangan.</span></p>','kebab|kebabkekinian|kebabmurah|daunkelor|kabelolor|foodie|surabayafood|jajankekinian|instafood|jajansuroboyo|foodstagram|surabaya|malang|FIP|UNESA|PGPAUD|PMW|2019|PMWUNESA2019',1,1,'2019-03-13 22:01:49','2019-03-20 01:00:21'),(902,0,'Plantastic Edu Organizer','2019 16010034046 Balqis Laras Pertiwi.pdf',NULL,15000000,'<p>Usaha dibidang jasa dapat dibilang usaha yang menjanjikan. Hal ini dikarenakan, masyarakat membutuhkan bantuan dari orang lain dalam hal apapun. Salah satu contoh usaha dibidang jasa yang diminati adalah event organizer. Event organizer adalah bantuan mengorganisir suatu acara. Event organizer biasanya membantu dalam serangkaian acara pernikahan, ulang tahun, dan kegiatan bisnis lainnya. Jarang terdapat adanya event organizer yang berfokus mengorganisir event pendidikan seperti pelatihan, parenting dan outbound. Trobosan baru yang diberikan plantastic edu organizer adalah event organizer yang berfokus pada bidang pendidikan. Plantastic edu organizer memberikan kemudahan bagi masyarakat yang ingin membuat suatu acara dengan tema pendidikan. Sehingga memunculkan masyarakat yang pembelajar. Sasaran dari plantastic edu organizer sendiri adalah manusia educandum.</p>\n<p><span style=\"font-size: 14px;\">&nbsp;</span></p>\n<p>Keyword : event organizer, pendidikan, educandum</p>','Event organizer|Pendidikan|Educandum',2,1,'2019-03-13 22:07:41','2019-03-15 16:32:49'),(903,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,'2019-03-13 22:07:45','2019-03-13 22:07:45'),(904,0,'Bola-bola Donat Madu Isi Gethuk Pisang (BODOMUTS)','2019 16010684079 SRI IKA WIDI LILI MAYASARI.pdf',NULL,7023000,'<p>&nbsp;</p>\n<p class=\"MsoNormal\" style=\"text-align: center; line-height: 115%;\" align=\"center\">&nbsp;</p>\n<p class=\"MsoNormal\" style=\"text-align: justify; text-indent: 36.0pt; line-height: 115%;\"><span style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\';\">Pisang adalah salah satu buah yang kandungan gizinya sangat bermanfaat bagi tubuh. Pisang tidak hanya dapat dinikmati secara langsung tapi juga dapat di olah menjadi berbagai macam olahan pangan salah satunya olahan gethuk pisang. Gethuk pisang adalah makanan khas Kota Kediri yang memiliki rasa manis, sedikit masam dan aroma khas yang mengunggah selera. </span></p>\n<p class=\"MsoNormal\" style=\"text-align: justify; text-indent: 36.0pt; line-height: 115%;\"><span style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\';\">Oleh karena itu kita membuat inovasi baru dari olahan gethuk pisang menjadi bola-bola donat madu yang diisi dengan gethuk pisang. Jajanan ini pastinya sangat digemari oleh semua kalangan dari mulai anak-anak hingga lansia. Bola-bola donat ini tidak menggunakan campuran gula, namun kami menggunakan madu sebagai penggantinya karena madu sendiri rendah kalori begitupun dengan getuk pisang. Tekstur bola-bola donat ini sangat lembut dipadu padankan gethuk pisang yang rasanya manis.</span></p>\n<p class=\"MsoNormal\" style=\"text-align: justify; text-indent: 36.0pt; line-height: 115%;\"><span style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\';\">Bola-bola donat madu isi gethuk pisang ini berbeda dengan donat yang lain karena biasanya bentuk donat itu seperti ban motor atau ban mobil, namun pada donat ini berbentuk bola-bola seukuran bola pimpong dengan isian gethuk pisang. </span></p>\n<p class=\"MsoNormal\" style=\"text-align: justify; text-indent: 36.0pt; line-height: 115%;\"><span style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\';\">Produk bola-bola donat madu isi gethuk ini dikemas dengan mika plastik yang berukuran kecil dengan dilabeli stiker kemasan yang sangat menarik. Produk ini bertahan selama 2 hari tanpa mengurangi cita rasanya. Sehingga salah satu tujuan pembuatan produk ini membuat variasi kuliner baru tanpa menghilangkan kekhasan gethuk pisang.</span></p>\n<p>&nbsp;</p>','Bola-bola Donat, Gethuk Pisang|Bola-bola Donat|Gethuk Pisang|Donat Madu',1,1,'2019-03-13 22:26:12','2019-03-15 01:01:41'),(905,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,1,'2019-03-13 22:28:39','2019-03-13 22:29:55'),(906,0,'Usaha Minuman Teh dengan Teknologi Augmented Reality (ARTea)','2019 16051204038 Aganda Maulana Dan Dyantono.pdf',NULL,13500000,'<p><strong>Teh</strong> merupakan minuman yang paling banyak dikonsumsi masyarakat baik dingin maupun panas, Salah satu produk teh yaitu teh celup. Teh celup merupakan teh yang dibungkus kertas berpori-pori halus dan tahan panas.<strong>A</strong><strong style=\"box-sizing: border-box; color: #222222; font-family: Verdana, Geneva, sans-serif; font-size: 15px;\">ugmented Reality </strong>bertujuan<span style=\"color: #222222; font-family: Verdana, Geneva, sans-serif; font-size: 15px;\">&nbsp;untuk mengembangkan teknologi yang memperbolehkan penggabungan secara real-time terhadap digital content yang dibuat oleh komputer dengan dunia nyata. <strong>Augmented Reality</strong> memperbolehkan pengguna melihat objek maya dua dimensi atau tiga dimensi yang diproyeksikan terhadap dunia nyata.</span>Maka dari itu kami membuat produk bernama <strong>ARTea</strong> yakni produk teh kemasan botol yang pertama di dunia yang menggunakan Teknologi <strong>Augmented Reality</strong> untuk memberikan kesan berbeda dibanding dengan brand lain, konsumen kami tidak hanya menikmati nikmatnya rasa teh tetapi juga mendapat hiburan berupa gambar dan tulisan 3D yang menarik dari teknologi <strong>Augmented Reality</strong>&nbsp;</p>','ARTea',1,1,'2019-03-13 22:29:43','2019-03-20 05:37:15'),(907,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,'2019-03-13 22:38:56','2019-03-13 22:38:56'),(908,0,'ROTIKU \"Sistem Penjualan Donat, Roti dan Bakpia Berbasis Waralaba\"','2019 16050423007 Muhammad Rizal.pdf',NULL,10000000,'<p class=\"MsoNoSpacing\" style=\"text-align: justify; line-height: 150%; tab-stops: 14.2pt;\"><strong><span lang=\"EN-ID\" style=\"font-size: 12.0pt; line-height: 150%; font-family: \'Times New Roman\',\'serif\'; letter-spacing: -.05pt; mso-ansi-language: EN-ID;\">&nbsp;</span></strong></p>\n<p class=\"MsoNoSpacing\" style=\"text-align: justify; text-indent: 21.3pt; line-height: 115%; tab-stops: 14.2pt;\"><span lang=\"EN-ID\" style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; letter-spacing: -.05pt; mso-ansi-language: EN-ID;\">&nbsp;&nbsp;&nbsp;&nbsp; Kota Sidoarjo merupakan kota yang dikenal dengan sebutan kota 1000 UKM, salah satu produk UKM yang paling popular adalah usaha makanan di bidang roti. Roti yang merupakan panganan yang terbuat dari adonan tepung terigu lalu digoreng hingga kering serta banyak pula yang diolah bermacam-macam hingga menjadi roti. Salah satu UKM yang bergelut di bidang roti dan sejenisnya yakni UKM ibu hanik di daerah imam bonjol, sidoarjo. Proses produksi roti yang diolah bermacam-macam seperti donat, bakpia hingga roti rasa-rasa yang beragam. </span></p>\n<p class=\"MsoNoSpacing\" style=\"text-align: justify; text-indent: 21.3pt; line-height: 115%; tab-stops: 14.2pt;\"><span lang=\"EN-ID\" style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; letter-spacing: -.05pt; mso-ansi-language: EN-ID;\">Masalahnya masih banyak masyarakat sekitar jawa timur yang belum mengetahui bahwa di sidoarjo terdapat produk-produk unggulan dari UKM yang berpotensi untuk di kembangkan, salah satunya yakni ROTI. Kendala yang dialami selama ini yakni selain terbatasnya alat produksi yang mendukung proses pembuatan roti, sistem penjulan yang dilakukan masih secara konvensional. Padahal permintaan jumlah pesanan roti setiap minggunnya meningkat. </span></p>\n<p class=\"MsoNoSpacing\" style=\"text-align: justify; text-indent: 21.3pt; line-height: 115%; tab-stops: 14.2pt;\"><span lang=\"EN-ID\" style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; letter-spacing: -.05pt; mso-ansi-language: EN-ID;\">Berdasarkan banyaknya jumlah pasar yang dibutuhkan oleh konsumen di daerah sidaorjo maka diperlukan metode pemasarann yang tepat untuk menjangka target pasar yang luas, sehingga diperlukan alternative pemasaran yang kreatif dan inovatif dalam upaya meningkatkan <em>branding product</em>.</span></p>\n<p><span lang=\"EN-ID\" style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; mso-fareast-font-family: Calibri; letter-spacing: -.05pt; mso-ansi-language: EN-ID; mso-fareast-language: EN-US; mso-bidi-language: AR-SA;\">Dari uraian diatas metode yang kami tawarkan yakni dengan membuat strategi pemasaran usaha secara <em>Franchise</em> atau Waralaba. Dimana kami akan membangun jalinan usaha dengan beberapa mitra terpercaya untuk mengembangkan, bekerjasama dengan beberapa <em>stakeholder</em> seperti jasa pengiriman dan periklanan serta mengikuti berbagai macam event untuk memasarkan <em>brand</em> produk ROTIKU hasil UKM di Sidoarjo.</span></p>','Roti,Sistem Waralaba,Online',1,1,'2019-03-13 22:40:46','2019-03-15 03:00:42'),(909,0,'TARI SINGKONG LEKONG (Tahu Onigiri Olahan Daun Singkong Lezat Nikmat Ramah di Kantong)','2019 17010714031 Khansa Aida Wibowo.pdf',NULL,4920000,'<p class=\"MsoNormal\" style=\"text-align: justify; text-indent: 36.0pt;\"><span style=\"font-size: 12.0pt; line-height: 107%; font-family: \'Times New Roman\',\'serif\';\">TARI SINGKONG LEKONG (Tahu Onigiri Olahan Daun Singkong Lezat Nikmat Ramah di Kantong) merupakan inovasi baru dalam bidang makanan yang terinspirasi dari salah satu makanan khas Jepang yaitu onigiri, akan tetapi bahan dasar dari onigiri yang biasanya menggunakan nasi yang dikepal dan dibalut dengan rumput laut, <span style=\"mso-spacerun: yes;\">&nbsp;</span>kini diubah menjadi tahu sebagai pengganti nasi dan daun singkong yang digunakan sebagai pengganti rumput laut. Kami memilih kedua bahan tersebut sebagai identitas produk ini karena bahan tersebut mudah dicari, murah, dan memiliki rasa yang cocok di lidah orang Indonesia. Dengan mengangkat dua bahan ini sebagai bahan utama dalam olahan onigiri tahu, diharapkan dapat menarik minat masyarakat agar lebih menyukai olahan makanan khas Indonesia dan dapat bersaing dengan makanan dari negara lain yang bermunculan di Indonesia saat ini.</span></p>','Tahu|Onigiri|Daun Singkong',1,1,'2019-03-13 22:53:55','2019-03-14 22:44:03'),(910,0,'Caribala : Online Lost and Found Platform','2019 16051204017 Muhamad Ramadhan.pdf',NULL,14550000,'<p>Caribala adalah platform yang dapat mempertemukan orang yang kehilangan barang dengan orang yang menemukan barang secara online. Sebagai platform lost and found online yang akan membawa social impact, Caribala hadir dengan teknologi yang akan mempermudah pencarian dan penemuan barang hilang, yaitu fitur buat laporan, fitur pencarian lengkap, fitur klaim, fitur kontak pelapor, sistem reward, sistem saldo, serta fitur notifikasi. Terlebih Caribala juga menawarkan jasa yang tidak dapat ditemukan pada platform sejenis, yakni jasa jemput barang.</p>','caribala|teknologi|lost and found|website|pencarian barang hilang',3,1,'2019-03-13 22:56:50','2019-03-19 21:36:08'),(911,0,'OCheese','2019 16010664058 Octavia Indri Puspita Dewi.pdf',NULL,2615000,'<p class=\"MsoNoSpacing\" style=\"text-align: justify; line-height: 150%; tab-stops: 14.2pt;\"><span lang=\"IN\" style=\"font-size: 12.0pt; line-height: 150%; font-family: \'Times New Roman\',\'serif\'; letter-spacing: -.05pt; mso-ansi-language: IN;\">O&rsquo;Cheese ini merupakan suatu produk makanan yang bercita rasa manis serta menunjukkan trend atau konsep kekinian. Dewasa ini, beberapa konsep atau trend makanan menggunakan stoples kecil untuk mengemas makanan. Dessert atau makanan penutup kini banyak menggunakan trend atau konsep tersebut, caranya adalah dengan menata beberapa lapisan bahan ke dalam stoples kaca bening sehingga terlihat lapisannya dan akan terlihat lebih menarik.</span></p>','Makanan|Kekinian|PMW|Keju|Oreo',1,1,'2019-03-13 22:59:44','2019-03-14 23:54:02'),(912,0,'JEMBRUL WANI','2019 17040254028 Naila Suroyyah.pdf',NULL,5500000,'<p>Jemblem merupakan kuliner khas Indonesia yang dimana pada jaman dahulu singkong digunakan sebagai bahan dasar pembuatan jemblem menjadi makanan utama pengganti nasi. Jemblem biasanha berwarna kecoklatan terbuat dari singkong berbentuk bulat sebesar telur ayam dan didalamnya berisi gula merah. Makanan ini dibuat menjadi berbeda dengan inovasi warna warni seperti pelangi agar menggugah selera makan dengan warna warna yang ceria. Tak hanya itu isi di dalam jemblem biasanya gula merah di ganti dengan bumbu rujak legi yang memiliki rass perpaduan antara rasa asam, manis, dan pedas. Oleh karena itu,&nbsp; kami mengusulkan nama \" JEMBRUL WANI \". Dengan tampilan yang berbeda akan membuat daya saing tersendiri di pasaran. Orang orang akan penasaran dan membeli produk tersebut.&nbsp; Untuk memperindah kemasan kami menggunakan bungkus paper bag agar tidak memperbanyak limbah plastik. Selain itu untuk mengembangkan bisnis usaha ini juga dipasarkan melalui via online, menyebarkan brosur agar produk lebih dikenal masyarakat. Untuk ukuran paper bag food grade berlogo kami menjual dengan harga Rp. 10.000(isi 8 biji) sedangkan jika dipasarkanvia online menggunakan plastik kedap udara/frozen food kami mematok harga Rp. 10.000(isi 10 biji) sehingga tahan lebih lama. Dalam sekali produksi mendapat untung sebesar Rp. 150.000. Dari uraian tersebut produk Jembrul Wani memudahkan para konsumen yang berada jauh dari daerah produksi selain itu Jembrul Wani ini bisa tahan selama beberapa hari sehingga mudah untuk dibawa dan dapat menyebar di seluruh penjuru negeri.</p>','Jembrul wani,lezat,bergizi,higenis',1,1,'2019-03-13 23:03:12','2019-03-15 00:32:05'),(913,0,'\"BISLORI\" Brownies Daun Kelor Alami','2019 17010644203 YUSTIKA ALAWIYAH.pdf',NULL,5683500,'<p><span style=\"text-align: justify; text-indent: 36pt; font-size: 12pt; font-family: \'Times New Roman\', serif; color: #333333;\">Menurut penelitian yang dilakukan oleh para ahli, daun kelor memiliki banyak mengandung nutrisi yang berguna bagi tubuh manusia. Kandungan nutrisi daun kelor diantaranya : vitamin A, B, C, K zat besi, kalsium, fosfor, protein, karbohidrat, serat dan masih banyak lagi. Beberapa sumber menyebutkan bahwa daun kelor mempunyai beragam manfaat diantaranya membantu mengatasi diabetes, menyembuhkan penyakit mata, mengurangi pertumbuhan sel-sel kanker, membantu melancarkan pencernaan, dan masih banyak manfaat lainnya. Semakin meningkatnya kesadaran masyarakat Indonesia untuk menikmati makanan sehat dan alami, menjadikan beragam inovasi penciptaan produk makanan yang sehat dan berbahan alami semakin gencar didiusahakan, termasuk kue sehat yang bebahan dasar daun kelor.</span><span style=\"text-align: justify; text-indent: 36pt; color: #333333; font-family: \'Times New Roman\', serif; font-size: 12pt;\">Perkembangan kue-kue modern yang semakin menjamur dikalangan masyarakat menjadi peluang tersendiri untuk membuat inovasi kue modern yang menyehatkan. Salah satu kue modern yang menjadi favorit masayarakat adalah kue brownies, banyak berbagai kalangan masyarakat yang menyukai kue ini karena rasanya yang lezat dan harga yang murah.</span></p>','brownies|daun kelor|inovasi kue modern',1,1,'2019-03-13 23:14:00','2019-03-14 23:12:45'),(914,0,'Softcake Bancok with Vartop','2019 17020114030 Miratul Hasanah.pdf',NULL,5000000,'<p class=\"normal\" style=\"margin-bottom: .0001pt; text-align: justify; line-height: 150%; tab-stops: 14.2pt; border: none; mso-padding-alt: 31.0pt 31.0pt 31.0pt 31.0pt; mso-border-shadow: yes;\"><span lang=\"IN\" style=\"font-size: 12pt; line-height: 150%; font-family: \'Times New Roman\', serif; color: black;\">Di era globalisasi ini, Seringkali bagi masyarakat Surabaya khususnya tidak ada waktu untuk menyiapkan makanan dikarenakan sibuknya aktivitas. Oleh karena itu, kami membuka usaha dengan membuat suatu jenis makanan. Makanan tersebut kami beri nama &ldquo;Softcake Bancok with Vartop&rdquo; yaitu suatu kue mini yang sangat lembut dengan proses perpaduan bahan pembuatan pisang dan coklat yang kemudian diberikan bermacam-macam topping seperti krim taro, krim greentea, susu, buah, oreo, chocho crunch saat penyajian. Softcake ini selain rasanya yang enak, juga dapat digunakan sebagai pengganjal lapar dan dapat dibawa kemana-mana dikarenakan ukurannya yang mini dan praktis dan tentunya harganya sangat terjangkau.&nbsp;</span><span style=\"font-family: \'Times New Roman\', serif; font-size: 12pt;\">Usaha tersebut kami pasarkan dengan sistem keliling dan menerima pesanan dari konsumen. Konsumen yang kami sasarkan adalah utamanya para mahasiswa, selain itu juga masyarakat dari berbagai kalangan pada umumnya. Dalam proses pemasaran, tentu kami juga mempromosikan produk melalui media sosial guna menarik perhatian konsumen untuk membeli produk tersebut.</span></p>','softcake|pmw|banana|coklat|topping|wirausaha',1,1,'2019-03-13 23:17:03','2019-03-15 05:25:45'),(915,0,'CHUCOK (Churros Coklat Oreo Kekinian)','2019 17010644134 Aulia Ditta Nurina.pdf',NULL,6500000,'<p>Churros adalah makanan ringan sejenis pastry yang digoreng, berasal dari Spanyol, terbuat dari adonan dasar choux. Choux sendiri merupakan adonan pastry ringan yang umum digunakan untuk membuat kue sus ala Indonesia. Dulu, Churros pernah menjadi makanan yang hits. Namun, sekarang ekstistensi churros mulai meredup karena tidak ada inovasi terbaru, baik dari bahan dasar dan rasa dari churos tersebut, sehingga masyarakat sudah mulai bosan. Maka dari itu, kami berinovasi agar churros dapat diminati kembali. Churros Coklat Oreo Kekinian atau bisa disebut &ldquo;Chucok&rdquo; ini merupakan inovasi dari churros yang menambahkan Oreo pada bahan dasarnya, sehingga rasa Churros tidak monoton original saja. Kami memilih oreo karena pada saat ini rasa oreo sangat digemari oleh kaum milenial yang sekaligus menjadi target pemasaran kami. banyak sekali produk-produk yang menggunakan oreo sebagi bahan dasarnya dan selalu digemari oleh anak remaja. Kami ingin memberikan sesuatu yang berbeda, memunculkan kembali churros yang pernah hits dengan memadukannya dengan oreo sebagai bahan dasarnya.</p>','oreo|coklat oreo|makanan kekinian|churros oreo',1,1,'2019-03-13 23:18:23','2019-03-18 15:38:04'),(916,0,'Ratu Kartini (Ragam Gethuk Masa Kini Aman Untuk Anak Tunagrahita)','2019 17010044049 Ega Edva Nurusyifa\' Hartono.pdf',NULL,5650300,'<p class=\"MsoNormal\" style=\"mso-margin-top-alt: auto; mso-margin-bottom-alt: auto; text-align: justify; line-height: 13.65pt;\"><span style=\"font-size: 12pt; font-family: \'Times New Roman\', serif;\">Perkembangan zaman yang kian cepat Indonesia dihadapkan pada fenomena Revolusi Industri 4.O. Yang mana era ini menuntut kita tidak hanya bergantung sebagai pencari kerja, namun tentunya haruslah bisa menjadi seorang pencipta lapangan kerja. Sebelum menjadi pencipta&nbsp;</span><span lang=\"EN-US\" style=\"font-size: 12pt; font-family: \'Times New Roman\', serif;\">lapangan&nbsp;</span><span style=\"font-size: 12pt; font-family: \'Times New Roman\', serif;\">kerja untuk orang lain, tentunya haruslah&nbsp;</span><span lang=\"EN-US\" style=\"font-size: 12pt; font-family: \'Times New Roman\', serif;\">mampu</span><span style=\"font-size: 12pt; font-family: \'Times New Roman\', serif;\">&nbsp;menciptakan lapangan kerja untuk diri sendiri.&nbsp;Dengan semangat tinggi untuk menjadi pengusaha muda, kami berkomitmen untuk meningkatkan potensi diri melalui kesempatan besar untuk didanai Universitas Negeri Surabaya melalui Program Mahasiswa Wirausaha.</span></p>\r\n<p class=\"MsoNormal\" style=\"mso-margin-top-alt: auto; mso-margin-bottom-alt: auto; text-align: justify; line-height: 13.65pt;\"><span style=\"font-size: 12pt; font-family: \'Times New Roman\', serif;\">Kami menawarkan produk kekayaan lokal berupa makanan daerah bernama &lsquo;Ratu Kartini (getuk kartun masa kini)&rsquo;.Ratu kartini Berbeda dengan getuk yang biasa dijual di pasaran, umumnya getuk tidak popular dikalangan anak-anak dan remaja.&nbsp;</span><span lang=\"EN-US\" style=\"font-size: 12pt; font-family: \'Times New Roman\', serif;\">Namun cukup popular di kalangan orangtua. Untuk menarik minat para kalangan muda agar tertarik dengan makanan daerah sebagai warisan lokal, tentunya dengan memodifikasi getuk sedemikian rupa mirip dengan kartun-kartun popular. Sehingga tampilannya menjadi lebih kekinian. Selain itu, varian rasa yang kami tawarkan berbeda dengan getuk pada umumnya yang hanya memiliki rasa manis dan gurih. Getun yang nantinya akan dijual memiliki varian rasa strawberry,coklat, dan melon. Tentunya rasa-rasa tersebut sangatlah popular di lidah anak-anak dan remaja. Tidak ketinggalan kami juga menyediakan rasa original untuk konsumen yang tidak suka dengan rasa-rasa buah.</span></p>\r\n<p class=\"MsoNormal\" style=\"mso-margin-top-alt: auto; mso-margin-bottom-alt: auto; text-align: justify; line-height: 13.65pt;\"><span lang=\"EN-US\" style=\"font-size: 12pt; font-family: \'Times New Roman\', serif;\">Varian rasa yang ditawarkan pun beragam dengan dengan nama yang unik. Pembuatan Ratu Kartini sama seperti gethuk pada umumnya dengan modifikasi topping beraneka macam sesuai dengan karakter katun yang dipesan.</span></p>\r\n<p class=\"MsoNormal\" style=\"mso-margin-top-alt: auto; mso-margin-bottom-alt: auto; text-align: justify; line-height: 13.65pt;\"><span lang=\"EN-US\" style=\"font-size: 12pt; font-family: \'Times New Roman\', serif;\">Di daerah Surabaya, jumlah pedagang getuk tidaklah banyak. Sehingga kesempatan dan peluang penjualan getun (getuk kartun) akan semakin besar. Dengan bahan-bahan pembuatan getuk yang murah dan mudah dicari, kemungkinan profit yang didapatkan sangatlah menjanjikan. Selain itu, dengan adanya getun (getuk kartun) ini, harapan kami , kaum muda lebih mengenal makanan daerah sebagai kekayaan lokal yang memang harus dilestarikan.&nbsp;</span></p>\r\n<p>&nbsp;</p>\r\n<p class=\"MsoNormal\">&nbsp;</p>','makanan tradisional, gethuk, kekinian|makanan tradisional|gethuk|kekinian',1,1,'2019-03-13 23:22:17','2019-03-19 16:51:24'),(917,0,'KONICIWA (Kotak Sushi Citra Rasa Jawa)','2019 17040274027 Nur Fitriyani.pdf',NULL,12500000,'<p class=\"MsoNormal\" style=\"text-align: center; line-height: 115%;\" align=\"center\"><span style=\"font-size: 12.0pt; line-height: 115%;\">RINGKASAN USAHA</span></p>\n<p class=\"MsoNormal\" style=\"text-align: justify; line-height: 115%;\"><span style=\"font-size: 12.0pt; line-height: 115%;\">&nbsp;</span></p>\n<p class=\"MsoNormal\" style=\"text-align: justify; line-height: 115%;\"><span style=\"font-size: 12.0pt; line-height: 115%;\">Program Mahasiswa Wirausaha yang berjudul KONICIWA ( Kotak Sushi Citra Rasa Jawa ) merupakan sebuah produk kreasi baru dengan menjual makanan seperti sushi dalam berbagai varian nasi khas Jawa yaitu nasi putih, nasi jagung, nasi kuning dan nasi menir. Produk ini diciptakan karena di era globalisasi seperti saat ini yang mana pengaruh budaya luar negeri dengan mudahnya masuk dalam kehidupan masyarakat Indonesia salah satunya dalam bidang makanan. Masyarakat Indonesia sekarang lebih tertarik untuk mengkonsumsi makanan yang berasal dari luar negeri salah satunya adalah sushi. Kondisi seperti ini tentunya menyebabkan berkurangnya minat masyarakat dalam mengkonsumsi masakan Indonesia terlebih pada makanan tradisional. Oleh karena itu produk ini diciptakan dengan tujuan melestarikan makanan tradisional Indonesia ditengah derasnya arus globalisasi, sehingga nantinya masyarakat Indonesia dapat menyukai dan lebih banyak mengkonsumsi masakan tradisional Indonesia yang sebenarnya memiliki citra rasa yang tidak kalah enaknya dengan masakan luar negeri karena produk ini diracik dengan rempah rempah pilihan dan bumbu khas Jawa yang membuat masakan ini menjadi lebih nikmat. Produk ini dibuat seperti sushi pada umumnya namun dari segi bahan nasi dan isinya kami menggunakan berbagai macam varian nasi tradisional dengan lauk pauk khas Jawa yang membuat produk ini berbeda dengan sushi yang sering kita temui.Produk ini dibuat oleh mahasiswa sendiri di tempat tinggalnya selama 3 bulan dari mulai persiapan hingga pemasaran. Produk ini dijual dengan harga Rp 10.000 per kotak. Sedangkan dalam 1 minggu akan memproduksi 100 kotak<span style=\"mso-spacerun: yes;\">&nbsp; </span>dalam 4 kali penjualan dengan<span style=\"mso-spacerun: yes;\">&nbsp; </span>biaya produksi<span style=\"mso-spacerun: yes;\">&nbsp; </span>Rp 750.000 per minggu. Jika 100 dengan harga Rp 10.000 terjual habis, pendapatan yang kami dapat dalam 1 minggu sebesar Rp 1.000.000 Jadi dari penjualan yang dilakukan dalam 1 minggu laba yang dapatkan sebesar Rp 250.000. Dari uraian tersebut KONICIWA sangat efisien dan terjangkau untuk semua orang dari berbagai kalangan serta nilai plusnya adalah mengandung kandungan gizi yang melimpah sehingga sangat baik untuk kesehatan tubuh.V</span></p>','Sushi|Varian Nasi|Tradisional|Makanan Sehat',1,1,'2019-03-13 23:29:56','2019-03-15 05:44:08'),(918,0,'GRANDIS : Sentuhan Pernik Dapur Alami Menggunakan Batik Ecoprint Cover Kitchen Set','2019 16020104047 ira ramadhanty.pdf',NULL,13131500,'<p class=\"MsoNormal\" style=\"text-align: justify; text-indent: 36.0pt; margin: 2.3pt 3.85pt 10.0pt 0cm;\"><span lang=\"EN-US\" style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\';\">Berbagai macam pembuatan produk <em style=\"mso-bidi-font-style: normal;\">cover kitchen set</em> beredar dipasaran yang mengakibatkan konsumen dapat memilih sesuai dengan selera. Dewasa ini, penggalakan budaya hidup sehat kian terus dikembangkan dan diterapkan pada kehidupan sehari-hari. bukan hanya pada perilaku tetapi juga pada produk-produk yang digunakan. Produk warisan bangsa batik merupakan produk yang memiliki nilai estetika dan nilai jual yang tinggi, berbagai jenis batik yang bermacam-macam dengan teknik pembuatan yang berbeda-beda, salah satunya adalah jenis batik ecoprint. Batik <em style=\"mso-bidi-font-style: normal;\">ecoprint</em> merupakan batik yang memanfaatkan tumbuh-tumbuhan sebagai motif dasar batik contohnya penggunaan motif daun jati dll. Selain itu batik <em style=\"mso-bidi-font-style: normal;\">ecoprint</em> juga menggunakan warna alam sebagai warna dasar kain batik. Penggunaan bahan alam, merupakan salah satu upaya dalam mendukung produk ramah lingkungan.</span><span style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; mso-ansi-language: IN;\"> Menurut Naning dalam JatimNow.com (2018/12) Batik dengan teknik <em style=\"mso-bidi-font-style: normal;\">ecoprint</em> ini menghasilkan</span> <span style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; mso-ansi-language: IN;\">corak yang unik dan digemari di mancanegara. </span><span lang=\"EN-US\" style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\';\">Sisa olahan penggunaan bahan batik dapat dijadikan kompos.</span><span style=\"font-family: \'Times New Roman\', serif; font-size: 12pt; text-indent: 36pt;\">Universitas Negeri Surabaya merupakan perguruan tinggi yang memiliki program </span><em style=\"font-family: \'Times New Roman\', serif; font-size: 12pt; text-indent: 36pt;\">ecocampus</em><span style=\"font-family: \'Times New Roman\', serif; font-size: 12pt; text-indent: 36pt;\">, yang mana dalam salah satu programnya menerapkan penggunaan produk-produk ramah lingkungan. Pembuatan produk GRANDIS merupakan salah satu upaya dalam mendukung program </span><em style=\"font-family: \'Times New Roman\', serif; font-size: 12pt; text-indent: 36pt;\">ecocampus</em><span style=\"font-family: \'Times New Roman\', serif; font-size: 12pt; text-indent: 36pt;\"> di UNESA.</span></p>','Daun Jati|Cover Kitchen Set|Eco Campus',4,1,'2019-03-13 23:34:50','2019-03-15 00:25:54'),(919,0,'Keripik Ceker Trio Kece','2019 16040284070 Rosi Anwar.pdf',NULL,10000000,'<p class=\"MsoNormal\" style=\"mso-layout-grid-align: none; text-autospace: none;\"><span style=\"font-size: 12.0pt; line-height: 150%; font-family: \'Times New Roman\',\'serif\'; mso-bidi-font-weight: bold;\">Keripik Ceker yang kami beri nama Trio Kece ini merupakan makanan ringan yang terbuat dari bagian ceker atau kaki ayam, dengan proses manual dan bahan-bahan alami tanpa bahan pengawet dan bahan kimia. Ceker ayam yang biasanya dikonsumsi dengan cara dicampur kuah sebagai olahan basah, kini kami olah sebagai makanan kering berupa keripik, dengan alasan agar mudah dikonsumsi oleh masyarakat, lebih praktis karena telah dipisahkan dengan tulangnya dan lebih awet karena kadar airnya menjadi sangat sedikit disebabkan telah melalui proses pengeringan juga proses penggorengan.</span></p>','Keripik Ceker|Kewirausahaan|Keripik|Ceker|kewirausahaan',1,1,'2019-03-13 23:35:43','2019-03-14 20:22:45'),(920,0,'\"NUGLETOPSAY\" Nugget Lele Toping Sayur','2019 17010644205 WINDY TRI CAHYANI PUTRI.pdf',NULL,6021000,'<p><span style=\"font-size: 10.5pt; line-height: 107%; font-family: Verdana, sans-serif; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">Nugget ikan lele topping sayur merupakan salah satu inovasi olahan berbahan dasar ikan yang menyehatkan, dikarenakan terbuat dari bahan-bahan segar dan bergizi. Makanan ini sangat cocok untuk semua kalangan. Berdasarkan hasil diskusi permasalahan yang dipermasalahkan adalah harga ikan lele. Cara meningkatkan perekonomian yang memanfaatkan budidaya lele yang dikelola dengan mengembangkan atau mengolah menjadi nugget yang memiliki nilai ekonomis yang dapat dikonsumsi oleh masyarakat dan bergizi. Dengan ditambahkan sayuran sebagai topping sehingga baik dikonsumsi oleh anak-anak yang tidak menyukai sayuran.</span></p>','lele|nugget|sayuran',1,1,'2019-03-14 00:00:47','2019-03-15 00:56:57'),(921,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,'2019-03-14 00:01:59','2019-03-14 00:01:59'),(922,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,'2019-03-14 00:01:59','2019-03-14 00:01:59'),(923,0,'Keripik Biduan (Biji Durian)','2019 17010714055 Tri Lindawati Dewi.pdf',NULL,6777000,'<p>Diindonesia Durian merupakan Raja Buah yang disukai di semua kalangan. akan tetapi banyak biji durian yang terbuang sia sia. maka dari itu kita membuat inovasi baru berupa keripik Biji Durian. agar biji durian ini tidak terbuang sia sia dan dapat di nikmati di semua kalangan masyarakat.&nbsp;</p>','enter|Biji Durian',1,1,'2019-03-14 00:03:11','2019-03-19 00:39:52'),(924,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,1,'2019-03-14 00:09:19','2019-03-14 00:50:26'),(925,0,'Hi-SPORT : FASHION HIJAB SPORT','2019 16051204039 dian novita yohanes.pdf',NULL,15000000,'<p>&nbsp;</p>\n<p class=\"Body\" style=\"text-align: center; line-height: 115%;\" align=\"center\"><strong style=\"mso-bidi-font-weight: normal;\"><span style=\"mso-bidi-font-family: \'Times New Roman\';\">Hi-SPORT : FASHION HIJAB SPORT</span></strong></p>\n<p>&nbsp;</p>\n<p class=\"Body\" style=\"text-align: center; line-height: 115%;\" align=\"center\"><strong style=\"mso-bidi-font-weight: normal;\"><span style=\"mso-bidi-font-family: \'Times New Roman\';\">( be sporty and comfort )</span></strong></p>\n<p>&nbsp;</p>\n<p>&nbsp;</p>\n<p class=\"MsoNormal\" style=\"text-align: justify; text-indent: 35.45pt; line-height: 115%;\"><strong style=\"mso-bidi-font-weight: normal;\"><span style=\"font-family: \'Times New Roman\',\'serif\';\">Hi-SPORT</span></strong><span style=\"font-family: \'Times New Roman\',\'serif\';\"> adalah perusahaan rintisan di bidang perdagangan (<em style=\"mso-bidi-font-style: normal;\">fashion</em>) yang menjual hijab khusus untuk olahraga atau yang biasa disebut juga dengan hijab sport. Yang membedakan Hi-SPORT dengan perusahaan produsen lain adalah kami membuatnya dengan kualitas homemade atau produksi rumahan sehingga lebih teliti dan lebih terjamin kualitas bahan baku serta kualitas jahitan dari setiap produknya. mengapa hijabsport ? karna semakin kemari semakin banyak wanita muslimah yang ingin berolahraga tanpa harus melepas hijab nya. Oleh karena itu kami membuat BRAND yang kami namai Hi-SPORT untuk menyapa wanita muslimah dan memberikan fasilitas hijab terbaik&nbsp; sehingga mereka puas dan nyaman menggunakan Hi-SPORT saat berolahraga. Selain itu masih belum banyak produsen hijabsport , jadi kami mengambil kesempatan tersebut untuk ide berwirausaha dan menjadi produsen untuk mensupport pedagang pedagang hijabsport pemula.</span></p>','hijabsport|hijab|hi-sport|Hi-SPORT|fashion hijab sport',2,1,'2019-03-14 00:13:13','2019-03-17 09:09:00'),(926,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,1,'2019-03-14 00:13:40','2019-03-14 13:04:15'),(927,0,'Es DANCOKAN','2019 17010024038 Fatkhur Rozak Artha Pratama.pdf',NULL,6015000,'<p><span style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',serif; mso-fareast-font-family: Calibri; letter-spacing: -.05pt; mso-ansi-language: IN; mso-fareast-language: EN-US; mso-bidi-language: AR-SA;\">Dengan nama yang unik yaitu, Dancokan yang berkesan negatif, kami mencoba menarik minat pembeli dengan nama tersebut. Serta produk yang kami jual, mengambil perpaduan yang berani antara kelapa muda, coklat, dan selasih, akan memberi rasa yang unik sekaligus menyehatkan bagi pembeli.</span></p>','Es DANCOKAN',1,1,'2019-03-14 00:14:32','2019-03-15 02:16:23'),(928,0,'Chocosai (Chocolate Yasai)','2019 17020104024 Ayu Widyawati.pdf',NULL,7000000,'<p>Cokelat adalah makanan ringan yang manis biasanya dikonsumsi oleh kalangan muda. cokelat biasanya digunakan sebagai hadiah&nbsp; kasih sayang dan sebagainya. Tapi banyak orang menganggap bahwa makan cokelat mengakibatkan diabetes, untuk mengurangi trauma pengonsumsi kami memproduksi Chocoyasai, yaitu sejenis cokelat yang bahan dasarnya dipadupadankan dengan sayur. seain bahannya mudah didapatkan harganyapun tidak terlalu mahal dan mempunyai banyak manfaat bagi kesehatan. Untuk memproduksi cokeat ini pun alat-alat yang digunakan tidak banyak. Cokelat ini akan dipasarkan dengan berbagai cara ofline maupun online.</p>','cokelat|makanan ringan|sayur',1,1,'2019-03-14 00:14:40','2019-03-17 06:57:01'),(929,0,'D\'FROGGIE (Dapur Frozen Vegetable)','2019 17080324038 Lusi Andriani Pratiwi.pdf',NULL,7000000,'<p>D\'FROGGIE (Dapur Frozen Vegetable) merupakan sebuah inovasi membuat sayur dengan cepat saji. Kemudahan dalam membuat sayur adalah keunggulan dari D\'FROGGIE serta proses pembuatannya tidak memerlukan waktu yang lama. Keadaan sayuran yang masih segar dan tanpa mengurangi gizi yang terkandung didalamnya serta bumbu yang siap untuk dimasak. Pembersihan hingga pengemasan produk dilakukan secara aman dan higenis menjadikan sayuran masih segar dan terjaga kandungan gizi didalamnya. Sehingga D\'FROGGIE dapat dinikmati oleh semua jenis kalangan yang tidak membutuhkan waktu banyak, sehat, dan bergizi.&nbsp;</p>','Dapur|Frozen Vegetable|Makanan|Cepat Saji',1,1,'2019-03-14 00:33:04','2019-03-20 05:00:36'),(931,0,'ROSI GALAU ( ROTI ISI GEOMETRI KETELA UNGU)','2019 16010684001 ARISKA DWI RAHMAWATI.pdf',NULL,6955000,'<p class=\"MsoNormal\" style=\"margin-left: 1.0cm; text-indent: 42.55pt; line-height: 115%; mso-layout-grid-align: none; text-autospace: none;\"><span style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; mso-ansi-language: IN;\">Rosi Galau adalah singkatan dari Roti Isi Geometri Ketela Ungu. Roti ini memiliki bergai macam bentuk geometri yaitu bentuk lingkaran, persegi, persegi panjang, belah ketupat dan segitiga, yang terbuat dari ketela ungu. </span><span lang=\"EN-US\" style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\';\">Dengan menginovasi </span><span style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; mso-ansi-language: IN;\">b</span><span lang=\"EN-US\" style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\';\">ahan </span><span style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; mso-ansi-language: IN;\">ketela ungu</span><span lang=\"EN-US\" style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\';\"> dengan gaya yang lebih modern</span> <span lang=\"EN-US\" style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\';\">dan kekinian serta memadupadankan dengan bahan-bahan </span><span style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; mso-ansi-language: IN;\">pembuatan roti</span><span lang=\"EN-US\" style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\';\">, </span><span style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; mso-ansi-language: IN;\">ketela</span> <span style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; mso-ansi-language: IN;\">ungu </span><span lang=\"EN-US\" style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\';\">akan menjadi makanan yang global. </span><span style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; mso-ansi-language: IN;\">Ketela ungu</span><span lang=\"EN-US\" style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\';\"> merupakan bahan baku utama pada pembuatan kreasi </span><span style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; mso-ansi-language: IN;\">makanan</span><span lang=\"EN-US\" style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\';\"> satu ini.</span><span style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; mso-ansi-language: IN;\"> Ketela ungu memiliki banyak kandungan gizi didalamnya yang baik untuk tubuh seperti protein, zat besi, lemak, antioksidan, antosianin dan vitamin c. Selain itu, ketela ungu juga merupakan sumber karbohidrat dan sumber kalori yang cukup tinggi. </span><span lang=\"EN-US\" style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\';\">Bahan baku utama yang</span><span style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; mso-ansi-language: IN;\"> mudah didapatkan dan</span> <span style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; mso-ansi-language: IN;\">harga bahan baku yang </span><span lang=\"EN-US\" style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\';\">murah dapat meminimalisir modal. Sehingga keuntungan yang didapatkan akan semakin meningkat. Dengan tekstur dan citarasa yang enak, lembut serta memadukan </span><span style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; mso-ansi-language: IN;\">berbagai macam pilihan</span><span lang=\"EN-US\" style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\';\"> rasa yang disukai anak-anak</span><span style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; mso-ansi-language: IN;\"> hingga orang dewasa</span><span lang=\"EN-US\" style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\';\"> membuat </span><span style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; mso-ansi-language: IN;\">makanan</span><span lang=\"EN-US\" style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\';\"> ini menjadi unik dan dapat dinikmati semua umur.</span><span style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; mso-ansi-language: IN;\"> Namun kami lebih mengutamakan penjualan rosi galau ini kepada anak usia dini. Dikarenakan roti ini disajikan dalam berbagai macam bentuk geometri yang dapat menarik perhatian dan juga anak dapat mengkonsumsi makanan sambil belajar mengenal bentuk geometri. Rosi galau sangat bagus untuk anak usia dini, karena makan ringan ini menyehatkan, enak, lembut, higienis dan memiliki banyak kandungan gizi serta terdapat nilai edukasi sehingga membantu anak untuk dapat meningkatkan aspek perkembangan anak. </span></p>\n<p class=\"MsoNormal\" style=\"margin-left: 1.0cm; text-indent: 42.55pt; line-height: 115%; mso-layout-grid-align: none; text-autospace: none;\"><span lang=\"EN-US\" style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\';\">Produk &ldquo;</span><span style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; mso-ansi-language: IN;\">Rosi Galau</span><span lang=\"EN-US\" style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\';\">&rdquo; ini dikemas menggunakan </span><span style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; mso-ansi-language: IN;\">mika plastik </span><span lang=\"EN-US\" style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\';\">yang berfungsi untuk </span><span lang=\"EN-US\" style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; mso-ansi-language: IN;\"><span style=\"mso-spacerun: yes;\">&nbsp;</span></span><span lang=\"EN-US\" style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\';\">memudahkan para konsumen untuk melihat </span><span style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; mso-ansi-language: IN;\">label</span><span lang=\"EN-US\" style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\';\"> maupun bentuk dari produk &ldquo;</span><span style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; mso-ansi-language: IN;\">Rosi Galau</span><span lang=\"EN-US\" style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\';\">&rdquo;.</span><span style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; mso-ansi-language: IN;\"> Pemasaran rosi galau ini berada disekitar wilayah Surabaya. Pemesanan rosi galau dapat dilakukan secara online dan offline. Secara online melalui aplikasi pesan antar makanan pada <em style=\"mso-bidi-font-style: normal;\">go food </em>menghubungi media sosial yang kami miliki yaitu instagram, facebook, whatsapp dan line. Secara offline dapat langsung mendatangi stand jualan di Lidah Wetan VII B No. 4 Surabaya, kami juga menerima pengiriman pesanan di wilayah Surabaya Barat. </span></p>\n<p class=\"MsoListParagraph\" style=\"margin-left: 1.0cm; line-height: 115%; tab-stops: 1.0cm 70.9pt; mso-layout-grid-align: none; text-autospace: none;\"><span style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; mso-ansi-language: IN;\"><span style=\"mso-tab-count: 1;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span>Rosi Galau memiliki 5 macam pilihan rasa yang berbeda yaitu rasa coklat, keju, oreo, nutela dan stroberi. Roti Galau disajikan dalam mika plastik ukuran sedang dan ukuran besar. Didalam mika plastik ukuran sedang diisi dengan 3 buah rosi galau dengan harga Rp 5.000, sedangkan mika plastik besar diisi dengan 5 buah rosi galau dengan harga Rp 8.000. </span></p>','Roti isi|Roti Geometri|Roti Ketela Ungu',1,1,'2019-03-14 00:36:02','2019-03-15 03:02:18'),(932,0,'KBK (kursi bambu kreatif)','2019 17010024039 Satria Agung Widiantoro.pdf',NULL,2000000,'<p>Kegiatan ini merupakan Usaha Pembuatan Kerajinan Bambu yang mana merujuk pada pembuatan kursi bambu.Dari yang hanya sebatang pohon bambu bisa dibentuk menjadi berbagai macam fungsi antara lain kursi,kursi memang menjadi salah satu furniture yang tidak bisa terlewatkan dari setiap sudut ruangan.selain adanya kursi menjadi pelengkap kekosongan sebuah ruangan juga memiliki nilai fungsi yang tinggi,fungsi kursi yang utama yakni sebagai tempat duduk,bersantai atau tempat beristirahat.semakin beragam desain kursi semakin beragam juga ide manusia menciptakan kursi dari berbagai bahan yang berbeda,salah satunya adalah kusi yang terbuat dari bambu.kursi bambu populer semenjak banyaknya yang sadar akan manfaat&nbsp; &nbsp;bambu yang tumbuh liar.alasan mengapa bambu dipilih sebagai bahan baku kayu salah satunya adalah karena sifat bambu yang kuat tahan lama dan mudah dibentuk.&nbsp; Salah satu keunggulan dari kurasi bambu adalah keunikannya yang masih berbau klasikal sehingga masih banyak masyarakat yang bermiat untuk memiliki kursi ini di rumahnya,selain itu juga kursi bambu juga kuat dan tahan lama.kursi bambu memang menjadi salah satu alternatif bagi sebagian besar orang yang menginginkan perabot rumah tangga yang sedikit berbeda.produk yang dibuat dalam kegiatan ini nenatinya adalah kursi bambu panjang yang akan dipercantik dengan pemberian plitur pada proses finishingnya</p>','KBK (kursi bambu kreatif)',4,1,'2019-03-14 00:40:56','2019-03-15 01:51:03'),(933,0,'Relaxation Massage Body and Main (REMAS BOM)','2019 16010664059 Nita Prinda Sari.pdf',NULL,14982000,'<p>REMAS BOM merupakan pengembangan jasa yang dilakukan dalam bidang massage dan layanan konseling kepada konsumen. Jasa ini dikembangkan sebagai usaha memberikan layanan yang berbeda dengan jasajasa lainnya. Jika pada umumnya konseling dan massage merupakan jasa yang berdiri sendiri karena pada dasarnya konselor yang memberikan layanan konseling tidak memiliki kemampuan dalam bidang massage serta pemberi layanan massage tidak memiliki kemampuan konseling maka dalam jasa yang akan di usulkan kedua layanan ini di jadikan dalam satu kesatuan. Hal ini dilakukan karena menurut pengusul untuk memberikan layanan massage di perlukan pendekatan sehingga dapat dibangun dalam sesi konseling dan dalam pemberian layanan konseling mungkin akan lebih efektif jika diberikan perlakukan relaksasi dengan bantuan layanan massage agar konsumen lebih dapat rileks dalam mengahadapi permasalahannya.</p>','massage|Relaxation|Massage|main',2,1,'2019-03-14 00:54:51','2019-03-15 04:28:46'),(934,0,'Keri Nduk (Keripik Ikan Sunduk)','2019 16040284044 Ilham Dimas Septio Srivani.pdf',NULL,4630000,'<p class=\"MsoNoSpacing\" style=\"text-align: justify; line-height: 115%; tab-stops: 14.2pt;\"><span style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; letter-spacing: -.05pt; mso-ansi-language: IN;\">Keripik Ikan Sunduk mengandung protein yang tinggi, asam lemak Omega 3 (yang dibutuhkan untuk pertumbuhan otak), kalsium, Vitamin B2, zat besi, magnesium, dan kalium yang banyak memberikan manfaat bagi tubuh terutama pada pertumbuhan dan perkembangan anak secara keseluruh, hal ini juga sebagai salah satu usaha untuk meningkatkan angka konsumsi ikan pada masyarakat indonesia. Karena itu kelompok kami membuat suatu produk dengan bahan dasar ikan sunduk yang dibuat keripik dengan berbagai varian rasa, original, balado, sapi panggang, pedas manis, jagung manis, BBQ, keju, pedas, dan balado pedas. <span style=\"mso-spacerun: yes;\">&nbsp;</span></span></p>','enter|makanan',1,1,'2019-03-14 01:04:01','2019-03-15 06:05:11'),(935,0,'PUDAKE (puding Daun Kelor)','2019 17010644141 Nita Yushofah.pdf',NULL,7100000,'<p><strong>Masyarakat menganggap bahwa sayur&nbsp;</strong></p>\n<p><strong>memiliki rasa dan aroma yang tidak enak. Akan tetapi jika tubuh kita kekurangan asupan&nbsp;</strong></p>\n<p><strong>gizi dari sayur daya tahan tubuh kita akan lemah. Kelor merupakan salah satu jenis sayur&nbsp;</strong></p>\n<p><strong>yang banyak manfaat bagi kesehatan. Namun disisi lain kelor memiliki bau yang tidak enak.&nbsp;</strong></p>\n<p><strong>Untuk itu kami menawarkan solusi atas permasalahan diatas dengan produk olahan puding&nbsp;</strong></p>\n<p><strong>&ldquo;PUDAKE (Puding Daun Kelor)&rdquo; yang higienis dan aman dari bahan pengawet berbahaya&nbsp;</strong></p>\n<p><strong>karena distributor yang sudah dipercaya dan tentunya komitmen untuk menjaga kesehatan.&nbsp;</strong></p>\n<p><strong>Disinilah kami memiliki pemikiran agar kelor dapat diterima dan disukai di tengah-tengah&nbsp;</strong></p>\n<p><strong>masyarakat. &ldquo;PUDAKE (Puding Daun Kelor)&rdquo; merupakan sebuah inovasi dan kreativitas&nbsp;</strong></p>\n<p><strong>dari bahan pangan yang sebagian besar tidak terlalu disukai karena bau dari bahan pangan&nbsp;</strong></p>\n<p><strong>tersebut sangat tidak enak namun kelor meiliki manfaat bagi kesehatan yang sangat tinggi&nbsp;</strong></p>\n<p><strong>untuk dimanfaatkan bagi orang-orang. \0</strong></p>','Pudake|Puding Daun Kelor',1,1,'2019-03-14 01:05:45','2019-03-19 02:51:00'),(936,0,'Nuget TERATAS (Nuget Terong Ramah Disabilitas','2019 16010044061 Arie Istiqomah.pdf',NULL,9000000,'<p>Disabilitas adalah ia yang memiliki gangguan pada fisik, mental, sosial, emosian, maupun perilaku. Dalam kehidupannya ada pantangan terhadap makanan-makanan yang dapat memperparah kondisi yang dialami terutama pada jenis ketunaan autis. Larangan terbesar pada anak autis adalah dikonsumsinya tepung dalam kehidupan sehari-hari. Sayuran yang kurang mereka sukai, menjadi suatu permasalahan yang terkadang membuat orang tua susah mengolah makanan yang pas untuk dan sesuai untuk anaknya. Berbekal dari itulah kami menciptakan sebuah inofasi makanan baru yang meminimalisir penggunaan tepung dan menggunakan bahan dasar sayur, tetapi tetap menggutamakan citarasa didalamnya.</p>','Terong',1,1,'2019-03-14 01:12:40','2019-03-14 23:58:12'),(937,0,'Paket Seminar Kit Berbranding','2019 17010014031 Meilda Hendri Hidayanti.pdf',NULL,11784000,'<p>Seminar merupakan sebuah pertemuan khusus yang memiliki tujuan&nbsp;untuk melakukan pembelajaran tentang suatu topik tertentu yang memiliki&nbsp;teknis dan akademis dengan pencarian solusi atau pemecahan dari suatu&nbsp;permasalahan yang sangat perlu interaksi di antara para peserta seminar yang&nbsp;dibantu oleh narasumber terpercaya. Sebagai penyelenggara seminar, panitia&nbsp;tidak boleh lupa menyiapkan seminar kit untuk para peserta ataupun&nbsp;pembicara. Sedangkan seminar kit atau biasa disebut paket seminar sendiri&nbsp;merupakan suatu souvenir atau produk atau barang-barang yang digabungkan&nbsp;dan dipadukan dalam sebuah paket (kit) sebagai perlengkapan seminar untuk&nbsp;para peserta, pembicara, ataupun panitia penyelenggara seminar atau kegiatan&nbsp;tersebut. Melihat banyaknya event atau kegiatan seminar di setiap instansi.&nbsp;Maka, munculah inovasi untuk menawarkan produk seminar kit untuk para&nbsp;penyelenggara kegiatan atau event tertentu. Pastinya lebih memudahkan&nbsp;untuk para panitia penyelenggara dalam menentukan paket seminar yang akan&nbsp;diberikan</p>','Package Seminar Kit|Souvenir Seminar|Package Seminar Berbranding',2,1,'2019-03-14 01:21:00','2019-03-20 04:53:32'),(938,0,'TakoAe (Takoyaki Indomie)','2019 16040284039 Muhammad Rizqi Rabbani.pdf',NULL,10000000,'<p>TakoAe adalah salah satu produk makanan kami yang menggabungkan antara Takoyaki dengan Indomie untuk membuat produk makanan tersebut menjadi lebih menarik.</p>','Takoyaki|Indomie|Makanan',1,1,'2019-03-14 01:24:41','2019-03-15 02:33:06'),(939,0,'TAWSOS (Tahu Walik Isi Sayur dan Sosis)','2019 17010024016 Sindi Yulia Putri.pdf',NULL,3133000,'<p class=\"MsoNoSpacing\" style=\"text-align: justify; line-height: 115%; tab-stops: 14.2pt;\"><span style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; letter-spacing: -.05pt;\">Usaha ini saya buat dengan bekerja sama antara dua mahasiswa yaitu dari jurusan </span><span style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\';\">Pendidikan Bahasa dan Sastra Indonesia<span style=\"letter-spacing: -.05pt;\"> dan jurusan Bimbingan Konseling. Usaha ini dibangun atas dasar hobi suka makan (berkuliner) dan bertujuan untuk menciptakan makanan yang sehat dan enak. </span></span><span style=\"font-size: 12.0pt; mso-bidi-font-size: 14.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; letter-spacing: -.05pt;\">TAWSOS (Tahu Walik Isi Sayur dan Sosis) terbuat dari bahan-bahan yang menyehatkan, karena didalam tahu tersebut nantinya akan diisi dengan sayur seperti wortel, toge dan kol serta bahan utamanya yaitu tahu dan sosis, kemudian dikasih bumbu yang terdiri dari bahan alami karena diracik sendiri. Selain itu juga di sajikan sambal, untuk pendamping tahu tersebut yaitu sambal bawang. Makanan ini merupakan camilan dengan racikan inovatif dan menggunakan bahan-bahan yang alami, sehingga cocok untuk dikonsumsi bagi semua kalangan.</span></p>','Tahu|Olahan Tahu|Tahu Walik',1,1,'2019-03-14 01:31:18','2019-03-14 23:46:12'),(940,0,'KANA MAKRAME','2019 16020124072 Tyas Sri wahyuni.pdf',NULL,7135000,'<p><!-- [if gte mso 9]><xml>\r\n <w:WordDocument>\r\n  <w:View>Normal</w:View>\r\n  <w:Zoom>0</w:Zoom>\r\n  <w:TrackMoves/>\r\n  <w:TrackFormatting/>\r\n  <w:PunctuationKerning/>\r\n  <w:ValidateAgainstSchemas/>\r\n  <w:SaveIfXMLInvalid>false</w:SaveIfXMLInvalid>\r\n  <w:IgnoreMixedContent>false</w:IgnoreMixedContent>\r\n  <w:AlwaysShowPlaceholderText>false</w:AlwaysShowPlaceholderText>\r\n  <w:DoNotPromoteQF/>\r\n  <w:LidThemeOther>EN-US</w:LidThemeOther>\r\n  <w:LidThemeAsian>X-NONE</w:LidThemeAsian>\r\n  <w:LidThemeComplexScript>X-NONE</w:LidThemeComplexScript>\r\n  <w:Compatibility>\r\n   <w:BreakWrappedTables/>\r\n   <w:SnapToGridInCell/>\r\n   <w:WrapTextWithPunct/>\r\n   <w:UseAsianBreakRules/>\r\n   <w:DontGrowAutofit/>\r\n   <w:SplitPgBreakAndParaMark/>\r\n   <w:DontVertAlignCellWithSp/>\r\n   <w:DontBreakConstrainedForcedTables/>\r\n   <w:DontVertAlignInTxbx/>\r\n   <w:Word11KerningPairs/>\r\n   <w: