>\r\n  <w:LsdException Locked=\"false\" Priority=\"32\" SemiHidden=\"false\"\r\n   UnhideWhenUsed=\"false\" QFormat=\"true\" Name=\"Intense Reference\"/>\r\n  <w:LsdException Locked=\"false\" Priority=\"33\" SemiHidden=\"false\"\r\n   UnhideWhenUsed=\"false\" QFormat=\"true\" Name=\"Book Title\"/>\r\n  <w:LsdException Locked=\"false\" Priority=\"37\" Name=\"Bibliography\"/>\r\n  <w:LsdException Locked=\"false\" Priority=\"39\" QFormat=\"true\" Name=\"TOC Heading\"/>\r\n </w:LatentStyles>\r\n</xml><![endif]--><!-- [if gte mso 10]>\r\n<style>\r\n /* Style Definitions */\r\n table.MsoNormalTable\r\n	{mso-style-name:\"Table Normal\";\r\n	mso-tstyle-rowband-size:0;\r\n	mso-tstyle-colband-size:0;\r\n	mso-style-noshow:yes;\r\n	mso-style-priority:99;\r\n	mso-style-qformat:yes;\r\n	mso-style-parent:\"\";\r\n	mso-padding-alt:0cm 5.4pt 0cm 5.4pt;\r\n	mso-para-margin-top:0cm;\r\n	mso-para-margin-right:0cm;\r\n	mso-para-margin-bottom:10.0pt;\r\n	mso-para-margin-left:0cm;\r\n	line-height:115%;\r\n	mso-pagination:widow-orphan;\r\n	font-size:11.0pt;\r\n	font-family:\"Calibri\",\"sans-serif\";\r\n	mso-ascii-font-family:Calibri;\r\n	mso-ascii-theme-font:minor-latin;\r\n	mso-hansi-font-family:Calibri;\r\n	mso-hansi-theme-font:minor-latin;\r\n	mso-bidi-font-family:\"Times New Roman\";\r\n	mso-bidi-theme-font:minor-bidi;}\r\n</style>\r\n<![endif]--></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify; line-height: 150%;\">Salah satu aliran fashion yang terkenal dan tidak pernah tergerus zaman adalah Bohemian Fashion Style. Boho terinspirasi dari bermacam-macam budaya yang ada, terkesan alami dan natural. Gaya bohemian terdiri dari elemen-elemn eksotis dalam fashion sehingga menciptakan nuansa vintage, entik, gaya gipsy. Makrame merupakan sebuah inovasi baru dari lahirnya trend dan gaya skandinavian atau bohemian yang menonjolkan kesan vintage. Bohemian look yang booming di masyarakat dan untuk memenuhi keinginan masyarakat kami terinspirasi untuk membuat berbagai macam aksesoris bergaya bohemian yaitu membuat model macrame dengan nama \"Kana Makrame\".Seni makrame adalah teknik kriya yang memanfaatkan tali dan benang sebagai bahan dasar kerajinan untuk menciptakan aneka assesoris dan produk dengan memilin simpul-simpul. Dengan teknik yang bervariasi membuat produk \"Kana Macrame\" berbeda dari yang lain. Mengangkat bohemian look tetapi dengan selera masyarakat milenial \"kana makrame\" sendiri membuat berbagai macam produk. Contohnya sebagai hiasan dinding yang dipadukan dengan foto Polaroid, hiasan sekaligus tali pada pot gantung, dan tali gorden. Disamping itu, nilai estetik yang mendominasi, menjadikan daya tarik tersendiri untuk dikembangkan dan memenuhi kebutuhan sekunder masyarakat yang menyukai seni terutama pada kerajinan makrame.</p>','Makrame|bohemian|PMW',4,1,'2019-03-14 01:40:19','2019-03-17 06:01:53'),(941,0,'Crunchee Bites','2019 17020084031 Errika Wafa Puteri.pdf',NULL,7200000,'<p>Keju merupakan hal yang sangat diminati oleh masyarakat. Rasa yang lezat tentu menjadi alasan mengapa keju sangat disukai. Selain rasa yang lezat, kandungan yang dimiliki keju juga sangat bermanfaat bagi tubuh manusia. Olahan makanan berbahan dasar keju seperti <em>cheeseball</em> (bola-bola keju) tentu akan sangat digemari. <em>Cheeseball</em> adalah <span style=\"font-family: \'Times New Roman\'; font-size: 12pt; letter-spacing: -0.05pt;\">jajanan yang sedang</span><span style=\"font-family: \'Times New Roman\'; font-size: 12pt; letter-spacing: -0.05pt;\">&nbsp;</span><em style=\"font-family: \'Times New Roman\'; font-size: 12pt; letter-spacing: -0.05pt;\">trendy&nbsp;</em><span style=\"font-family: \'Times New Roman\'; font-size: 12pt; letter-spacing: -0.05pt;\">di Korea Selatan dan masih sangat jarang ditemukan di Indonesia khususnya Surabaya. Keju mozzarella yang dibentuk bola dan dihidangkan dengan saus mayonnaise akan menghasilkan sebuah produk yang akan sangat dinikmati oleh masyarakat</span></p>','mozzarella|cheesy|crunchy|crunchee|keju|bola|cheeseball|snacks|cemilan|camilan|mozza',1,1,'2019-03-14 01:53:27','2019-03-15 04:09:20'),(942,0,'PEMPEK DRAGON','2019 16010684004 Nadia Dwi Aristanti.pdf',NULL,6843500,'<p class=\"MsoBodyText\" style=\"text-align: justify; text-indent: 25.55pt; line-height: 115%; margin: 1.8pt 57.9pt .0001pt 75.85pt;\">Pempek Dragon ini merupakan produk yang berbeda dengan pempek pada umumnya, dengan inovasi baru yaitu pempek dari sari buah naga. Memiliki ciri khas warna ungu dari buah naga dan isian di dalamnya. Berbeda dengan pempek pada umumnya yang menggunakan campuran ikan, Pempek Dragon ini sengaja tidak menggunakannya karena sudah digantikan dengan varian isi di dalam pempek. Selain itu, juga bertujuan jika terdapat konsumen yang tidak menyukai dan alergi ikan laut, Pempek Dragon ini dapat menjadi pilihan sesuai dengan keinginan pelanggan.</p>','Pempek Buah Naga|Pempek Dragon|Pempek Isi|Pempek Dos',1,1,'2019-03-14 01:54:34','2019-03-15 03:41:59'),(943,0,'Bakso Sayur Pelangi','2019 16010664063 Yani Maya Pratiwi.pdf',NULL,9768000,'<p><span style=\"font-size: 12pt; font-variant-numeric: normal; font-variant-east-asian: normal;\">Seperti yang diketahui, permasalahan yang terjadi di Indonesia saat ini<span style=\"font-size: 12pt; font-variant-numeric: normal; font-variant-east-asian: normal;\"> salah satunya ialah pertumbuhan penduduk yang semakin pesat namun tidak<span style=\"font-size: 12pt; font-variant-numeric: normal; font-variant-east-asian: normal;\"> didukung dengan jumlah lapangan pekerjaan yang masih terbatas. Tentu hal<span style=\"font-size: 12pt; font-variant-numeric: normal; font-variant-east-asian: normal;\"> tersebut menjadi permasalahan bagi Indonesia saat ini. Sebagai mahasiswa, saya<span style=\"font-size: 12pt; font-variant-numeric: normal; font-variant-east-asian: normal;\"> merasa tertantang untuk berkontribusi dalam mengatasi masalah tersebut. Salah<span style=\"font-size: 12pt; font-variant-numeric: normal; font-variant-east-asian: normal;\"> satu hal yang dapat saya lakukan pada saat ini yakni dengan mengikuti Program<span style=\"font-size: 12pt; font-variant-numeric: normal; font-variant-east-asian: normal;\"> Mahasiswa Wirausaha (PMW). Dengan mengikuti program tersebut, saya dapat<span style=\"font-size: 12pt; font-variant-numeric: normal; font-variant-east-asian: normal;\"> menuangkan ide-ide yang saya miliki untuk mewujudkan lapangan pekerjaan<span style=\"font-size: 12pt; font-variant-numeric: normal; font-variant-east-asian: normal;\"> yang sesuai dengan kemampuan yang saya miliki.<span style=\"font-size: 12pt; font-variant-numeric: normal; font-variant-east-asian: normal;\"> Awal mula saya mengetahui program ini, saya merasa bahwa saya dapat<span style=\"font-size: 12pt; font-variant-numeric: normal; font-variant-east-asian: normal;\"> memiliki kesempatan untuk mewujudkan ide-ide yang saya miliki. Pada proposal<span style=\"font-size: 12pt; font-variant-numeric: normal; font-variant-east-asian: normal;\"> ini, saya memiliki ide untuk membuat &ldquo;Bakso Sayur Pelangi&rdquo;. Ide tersebut<span style=\"font-size: 12pt; font-variant-numeric: normal; font-variant-east-asian: normal;\"> muncul karena saya merasa bahwa pada saat ini banyak beredar makanan yang<span style=\"font-size: 12pt; font-variant-numeric: normal; font-variant-east-asian: normal;\"> dirasa kurang sehat. Dalam proposal ini, saya memilih produk makanan sehat,<span style=\"font-size: 12pt; font-variant-numeric: normal; font-variant-east-asian: normal;\"> yakni &ldquo;Bakso Sayur Pelangi&rdquo;. Bakso ini berbeda dengan bakso-bakso lain yang<span style=\"font-size: 12pt; font-variant-numeric: normal; font-variant-east-asian: normal;\"> beredar di pasaran. Bakso sayur pelangi memiliki warna yang berbeda-beda.<span style=\"font-size: 12pt; font-variant-numeric: normal; font-variant-east-asian: normal;\"> Warna tersebut diperoleh dari sayur-sayuran yang tentunya juga menyehatkan.<span style=\"font-size: 12pt; font-variant-numeric: normal; font-variant-east-asian: normal;\"> Dengan warna-warni yang bervariasi akan lebih menggugah selera makan. Selain<span style=\"font-size: 12pt; font-variant-numeric: normal; font-variant-east-asian: normal;\"> itu warna yang ada pada bakso tersebut juga menyehatkan. Lebih lanjut, saya<span style=\"font-size: 12pt; font-variant-numeric: normal; font-variant-east-asian: normal;\"> sangat berharap bahwa proposal PMW &ldquo;Bakso Sayur Pelangi&rdquo; yang saya ajukan<span style=\"font-size: 12pt; font-variant-numeric: normal; font-variant-east-asian: normal;\"> saat ini dapat diterima dengan baik.<br style=\"font-variant-numeric: normal; font-variant-east-asian: normal; line-height: normal; text-align: -webkit-auto; text-size-adjust: auto;\" /></span></span></span></span></span></span></span></span></span></span></span></span></span></span></span></span></span></span></span></span></span></p>','bakso|sayur|pelangi|bakso sayur|makanan|sehat|makanan sehat',1,1,'2019-03-14 02:01:43','2019-03-17 18:33:28'),(944,0,'MINDER LAH (Mini Dessert Lapis Buah)','2019 17020084077 DEKA DWI SETIANING RIZKI.pdf',NULL,6000000,'<p>MINDER LAH (Mini Dessert Lapis Buah) merupakan produk makanan penutup yang memiliki tiga lapisan pada satu cup penyajian. Terdapat lapisan puding pada lapisan bagian atas dan bawah, pada bagian tengah merupakan lapisan buah. MINDER LAH ini memiliki beberapa varian rasa puding dan menggunakan beberapa jenis buah seperti mangga, pisang, dan salak. Produk ini diciptakan sebagai salah satu solusi terhadap kesehatan masyarakat terutama pada sistem pencernaan karena selain mengandung serat dessert ini juga memiliki vitamin yang berasal dari buah alami. Produk ini dikemas pada kemasan transparan yang tujuannya agar menarik konsumen serta meggunakan kemasan yang praktis ukuran sedang agar memudahkan konsumen untuk membawanya kemana-mana.</p>','pudding|MINDER LAH (Mini Dessert Lapis Buah)',1,1,'2019-03-14 02:02:31','2019-03-15 02:24:58'),(945,0,'CAK CHIPS (Centella Asiatica Kacang)','2019 17010034046 Erwina Image Rumawi Putri.pdf','2019 17010034046 Erwina Image Rumawi Putri.pdf',4000000,'<p><span class=\"fontstyle0\">KRIPIK CENASKA (</span><span class=\"fontstyle0\" style=\"font-size: 14pt;\">Centella Asiatica Kacang) </span><span class=\"fontstyle2\"> Healthy<br />and Nutritious Food  merupakan produk makanan ringan berupa daun pegagan<br />yang tidak mengandung racun, sehingga dapat dikonsumsi oleh tubuh dengan<br />aman. KRIPIK CENASKA (</span><span class=\"fontstyle2\" style=\"font-size: 14pt;\">Centella Asiatica Kacang) </span><span class=\"fontstyle2\">merupakan makanan<br />yang sehat berkhasiat pada tubuh manusia, dikatakan sehat karena Daun Pegagan<br />(Centella asiatica ) atau biasa disebut juga dengan nama antanan atau daun kaki<br />kuda, memiliki kandungan kimiawi yang terdiri dari asiaticoside, thankuniside,<br />isothankuniside, madecassoside, de, brahmic acid, brahminoside, madasiatic acid,<br />meso-inositol, centelloside, carotenoids, hydrocotylin, vellarine, tanin serta garam<br />mineral seperti kalium, natrium, magnesium, kalsium dan besi. Diduga glikosida<br />triterpenoida yang disebut asiaticoside merupakan antilepra dan penyembuh luka<br />yang sangat luar biasa. Zat vellarine yang ada memberikan rasa pahit. Sebagai<br />obat untuk revitalisasi tubuh dan pembuluh darah serta mampu memperkuat<br />jaringan tubuh. Tak kalah penting, pegagan bisa dikonsumsi sebagai brain tonic<br />atau obat anti lupa bagi orang dewasa atau manula (manusia usia lanjut). Daun<br />pegagan bisa diberikan pada penderita insomnia, penderita stress, keterbelakangan<br />mental dan hiperaktif</span></p>',NULL,1,1,'2019-03-14 02:05:38','2019-05-05 05:13:35'),(946,0,'SOTO KERSO(Studio Photo Karakter Suroboyo)','2019 16050634045 novi anggita putri.pdf',NULL,15000000,'<p><span lang=\"EN-US\" style=\"text-align: justify; font-size: 12pt; line-height: 18.4px; font-family: \'Times New Roman\', serif; letter-spacing: -0.05pt;\"><strong>Studio Photo Karakter Suroboyo</strong>&nbsp;merupakan studio foto yang menyediakan berbagai&nbsp;<em>background</em>&nbsp;karakter seperti superhero,&nbsp;<em>angel</em>/bidadari , Indian dan tema bernuansa jepang maupun korea. selain menyediakan&nbsp;<em>background</em>,&nbsp; Studio Photo Karakter Suroboyo ini sekaligus menyediakan&nbsp;<em>make up</em>&nbsp;serta kostum sesuai dengan tema yang dipilih oleh konsumen.&nbsp;</span><span style=\"text-align: justify; font-family: \'Times New Roman\', serif; font-size: 12pt; letter-spacing: -0.05pt;\">Usaha yang akan dijalankan ini nantinya berbentuk jasa. Dengan menawarkan harga yang bersaing, diharapkan usaha ini dapat dikembangkan dan diperluas&nbsp;</span><span style=\"text-align: justify; font-family: \'Times New Roman\', serif; font-size: 12pt; letter-spacing: -0.05pt;\">&nbsp;di berbagai kota&nbsp;</span><span style=\"text-align: justify; font-family: \'Times New Roman\', serif; font-size: 12pt; letter-spacing: -0.05pt;\">dengan menambahkan tema-tema kreatif lainnya.</span></p>','soto kerso|studio photo|studio|photo|karakter|suroboyo|jasa|sewa studio|sewa kostum|makeup karakter',2,1,'2019-03-14 02:07:12','2019-03-15 04:27:14'),(947,0,'Borong (Brownies Terong) Rendah Kolestrol','2019 17010644110 Lani Dwi Rahayu.pdf',NULL,7000000,'<p>Makanan cepat saji pada saat ini memang sedang menjadi &ldquo;primadona&rdquo; disemua&nbsp;</p>\n<p>kalangan. Akan tetapi, bahaya yang ditimbulkan rawan sekali membahayakan tubuh kita&nbsp;</p>\n<p>dengan adanya bahan-bahan yang berbahaya untuk digunakan. Kami menawarkan solusi&nbsp;</p>\n<p>atas permasalahan diatas dengan produk olahan Brownies, namun olahan ini beda dengan&nbsp;</p>\n<p>brownies yang lain, karena brownies yang kita buat terbuat dari terong yang rendah&nbsp;</p>\n<p>kolestrol dan juga rendah lemak, dan juga tidak menggunakan bahan pengawet makanan.&nbsp;</p>\n<p>Brownies yang kami buat sudah dipercaya dan tentunya menjaga komiten untuk menjaga&nbsp;</p>\n<p>kesehatan dalam makanan itu. dari sinilah kami memiliki pemikiran agar terong ini tidak&nbsp;</p>\n<p>diolah untuk menjadi masakan saja, namun kami memiliki pemikiran untuk membuat&nbsp;</p>\n<p>terong menjadi olahan yang lebih baik lagi yaitu dibuat menjadi brownies. Oleh karena itu,&nbsp;</p>\n<p>kami membuat sebuah olahan pangan yang pasti sudah dikenal oleh masyarakat yaitu&nbsp;</p>\n<p>brownies dengan bahan dasar terong.&nbsp;</p>','Tujug juta rupiah',1,1,'2019-03-14 02:12:33','2019-03-16 03:25:20'),(948,0,'FLOODLE (Flower Noodle) Si Kriting yang Legit','2019 16010044055 Rachma Novita Sari.pdf',NULL,4500000,'<p class=\"MsoNoSpacing\" style=\"text-align: justify; line-height: 115%; tab-stops: 14.2pt;\"><span style=\"letter-spacing: -.05pt;\">Judul : </span><span lang=\"EN-US\" style=\"letter-spacing: -.05pt; mso-ansi-language: EN-US;\">FLOODLE (Flower Noodle), Si Kriting yang Legit</span></p>\n<p class=\"MsoNoSpacing\" style=\"text-align: justify; line-height: 115%; tab-stops: 14.2pt;\"><span style=\"letter-spacing: -.05pt;\">Biaya : </span><span lang=\"EN-US\" style=\"letter-spacing: -.05pt; mso-ansi-language: EN-US;\">4500000<span style=\"mso-tab-count: 1;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span></p>\n<p class=\"MsoNoSpacing\" style=\"text-align: justify; line-height: 115%; tab-stops: 14.2pt;\"><span style=\"letter-spacing: -.05pt;\">Kata Kunci : PMW, Makanan, FLOODLE<span style=\"mso-tab-count: 1;\">&nbsp;&nbsp;&nbsp; </span></span></p>\n<p class=\"MsoNoSpacing\" style=\"text-align: justify; line-height: 115%; tab-stops: 14.2pt;\"><span style=\"letter-spacing: -.05pt;\">Abstrak :</span></p>\n<p class=\"MsoNoSpacing\" style=\"text-align: justify; line-height: 115%; tab-stops: 14.2pt;\"><span style=\"letter-spacing: -.05pt;\"><span style=\"mso-tab-count: 1;\">&nbsp;&nbsp;&nbsp;&nbsp; </span>FLOODLE (<em style=\"mso-bidi-font-style: normal;\">Flower Noodle)</em>, Si Kriting yang Legit adalah sebuah jajanan pasar berupa kue yang berbentuk bunga seperti putu ayu yang terbuat dari bihun yang kriting. Rasanya legit dan manis. Kue putu ayu adalah sebuah kue jajan pasar yang berwarna-warni yang bisa tergolong kedalam kue tradisional yang menggambarkan cita rasa Indonesia. Ada yang menyajikan kue putu ayu dengan warna putih, warna pink, hijau, dan lain-lain. FLOODLE terbuat dari bahan yang aman untuk dikonsumsi, dengan berbagai varian rasa. </span></p>\n<p class=\"MsoNoSpacing\" style=\"text-align: justify; line-height: 115%; tab-stops: 14.2pt;\"><span style=\"letter-spacing: -.05pt;\">&nbsp;&nbsp; Adanya FLOODLE (<em style=\"mso-bidi-font-style: normal;\">Flower Noodle</em>) selain sebagai produk kuliner, diharapkan juga dapat melestarikan makanan tradisional kue jajanan pasar. Karena semakin kencangnya arus modernisasi, masyarakat mulai berpindah ke makanan yang dianggap modern seperti <em style=\"mso-bidi-font-style: normal;\">junk food</em>.</span></p>\n<p class=\"MsoNoSpacing\" style=\"text-align: justify; line-height: 115%; tab-stops: 14.2pt;\"><span style=\"letter-spacing: -.05pt;\"><span style=\"mso-tab-count: 1;\">&nbsp;&nbsp;&nbsp;&nbsp; </span>.</span></p>\n<p class=\"MsoNormal\">&nbsp;</p>','PMW|MAKANAN|FLOODLE|MANIS|ENAK|BIHUN|FLOWERNOODLE|MAKANANTRADISIONAL|TRADISIONAL',1,1,'2019-03-14 02:13:36','2019-03-15 02:31:08'),(949,0,'SERKAWIN Car Perfume (Pewangi Mobil Serbuk Kayu, Wangi Nusantara)','2019 17040274016 Kharisma Dwi Cahyaning.pdf',NULL,8000000,'<p class=\"MsoNoSpacing\" style=\"text-align: justify; line-height: 115%; tab-stops: 14.2pt; margin: 0in 0in 12.0pt 13.5pt;\"><span lang=\"IN\" style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; letter-spacing: -.05pt; mso-ansi-language: IN;\">Serbuk Kayu adalah salah satu limbah yang dihasilkan dari proses penghalusan dan penggergajian kayu. </span><span style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; letter-spacing: -.05pt;\">Salah satunya di daerah Ngrawan, Kecamatan Berbek Kabupaten Nganjuk, Jawa Timur. </span><span lang=\"IN\" style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; letter-spacing: -.05pt; mso-ansi-language: IN;\">Limbah </span><span style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; letter-spacing: -.05pt;\">serbuk kayu di wilayah tersebut </span><span lang=\"IN\" style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; letter-spacing: -.05pt; mso-ansi-language: IN;\">tersebut </span><span style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; letter-spacing: -.05pt;\">biasanya </span><span lang=\"IN\" style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; letter-spacing: -.05pt; mso-ansi-language: IN;\">langsung dibakar tanpa ada pengolahan lebih lanjut. Padahal limbah tersebut jika dibakar atau langsung dibuang lingkungan sekitar pasti akan membuat pencemaran lingkungan. Maka dari itu, pengolahan limbah serbuk kayu sangat diperlukan agar lingkungan tetap terjaga. </span></p>\n<p class=\"MsoNoSpacing\" style=\"text-align: justify; line-height: 115%; tab-stops: 14.2pt; margin: 0in 0in 12.0pt 13.5pt;\"><span lang=\"IN\" style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; mso-ansi-language: IN; mso-no-proof: yes;\">SERKAWIN Car Perfume</span> <span lang=\"IN\" style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; letter-spacing: -.05pt; mso-ansi-language: IN;\">(Pewangi Mobil dari Serbuk Kayu</span><span style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; letter-spacing: -.05pt;\">,</span><span lang=\"IN\" style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; letter-spacing: -.05pt; mso-ansi-language: IN;\"> Wangi Nusantara)</span><span lang=\"IN\" style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; mso-ansi-language: IN; mso-no-proof: yes;\"> merupakan sebuah inovasi yang memanfaatkan limbah hasil penggergajian dan penghalusan kayu yang biasa disebut dengan serbuk<span style=\"mso-spacerun: yes;\">&nbsp; </span>kayu. Selain memanfaatkan limbah, guna dalam pengurangan pencemaran lingkungan, produk ini juga mengangkat khasanah Indonesia yaitu rempah-rempah Nusantara yang memiliki aroma yang menenangkan. Terkadang banyak ditemukan orang yang mabuk kendaraan akibat aroma kendaraan yang terlalu menyengat seperti bau mesin dan asap</span><span style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; mso-no-proof: yes;\"> bahkan bau pengharum mobil kimia yang terlalu kuat</span><span lang=\"IN\" style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; mso-ansi-language: IN; mso-no-proof: yes;\">. Maka dari itu, produk ini menawarkan kombinasi bahan ramah lingkungan dan wewangian Nusantara yang akan memberikan kesan nyaman disetiap perjalanan mengunakan mobil atau bus. Ditambah dengan pengemasan yang menarik yang mencirikan Indonesia maka akan dapat menambah minat beli dan juga meningkatkan rasa nasionalisme yaitu Cinta Produk Indonesia.</span></p>','Serbuk Kayu|Wangi Nusantara|SERKAWIN Car Perfume',4,1,'2019-03-14 02:16:58','2019-03-15 06:22:40'),(950,0,'BOLKAT \'Bola-Bola Cokelat\'','2019 17020114076 EGA TRISNAWATI.pdf',NULL,12897000,'<p class=\"Default\" style=\"text-align: justify; text-indent: 14.2pt; line-height: 150%;\"><span style=\"font-family: \'Times New Roman\',\'serif\';\">BOLKAT (Bola-bola Cokelat) merupakan inovasi usaha dalam bidang makanan yang memadukan kreasi biskuit dengan susu cokelat dan juga mesis. Paduan makanan cokelat ini merupakan perpaduan makanan bergizi yang memiliki kandungan vitamin yang bermanfaat. Sehingga saklah satu tujuan usaha ini menjadi penyedia makanan sehat dan bergizi yang dapat dikonsusmsi oleh berbagai pihak. Oleh karena itu, dengan pembuatan yang mudah dan harga terjangkau membuat makanan ini banyak di minati di kalangan mahasiswa dan masyarakat.</span></p>','BOLKAT |Bola-bola |Cokelat',1,1,'2019-03-14 02:21:54','2019-03-20 03:53:00'),(951,0,'CRIKER (CRISPY CEKER)','2019 17010644178 DEVY RIZKY AMEILIA.pdf',NULL,5000000,'<p>Pada proposal yang berjudul \"CRIKER\" (crispy ceker) ini membahas tentang inovasi ceker dengan olahan yang berbeda, yaitu dengan diolah menjadi keripik yang penuh cita rasa, makanan yang sudah biasa kita olah menjadi makanan yang dapat menarik perhatian. dengan harga yang terjangkau konsumen bisa merasakan rasa yang sangat nikmat.&nbsp;</p>','CRIKER',1,1,'2019-03-14 02:22:57','2019-03-15 01:57:11'),(952,0,'SWEET ZALACCA','2019 17010644193 LUTFIYAH NATASYA SHOHIBAH.pdf',NULL,3429000,'<p>weet Zalacca merupakan jajanan yang berasal dari buah salak yang dipadukan dengan gula, asam, dan cabai. Jajanan ini merupakan jajanan yang enak dengan berbagai varian rasa. Sehingga pembeli dapat menyesuaikan dengan selera lidah mereka. Jajanan ini mengandung banyak manfaat seperti, mencegah sembelit, untuk diet, menjaga kesehatan mata dan masih banyak lagi. salak memiliki kandungan nutrisi yang baik untuk kesehatan tubuh, seperti Vitamin B6,B12,Tanin,Karbohidrat dan memiliki kandungan serat yang tinggi. dan untuk itu penting sekali untuk mengkonsumsi buah salak, karena banyak yang malas untuk mengupas salak yang mengakibatkan tangan kadang terluka maka berdasarkan hal tersebut, kami membuat inovasi jajanan salak yang siap makan.</p>','salakmanis|zalacca',1,1,'2019-03-14 02:42:47','2019-03-15 00:32:15'),(953,0,'KUKREZZ BUZA Kupang Krispy Lezat Bumbu Rasa  Rasa','2019 17040254021 Tis\'a Nursya\'bani.pdf',NULL,10748000,'<p>&nbsp;</p>\n<p style=\"margin: 0cm 0cm 10pt; text-align: justify; -ms-text-justify: inter-ideograph;\"><span lang=\"EN-US\" style=\"font-size: 12.0pt; line-height: 115%;\"><span style=\"mso-spacerun: yes;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span>KUKREZZ BU</span><span style=\"font-size: 12.0pt; line-height: 115%; mso-ansi-language: IN;\">Z</span><span lang=\"EN-US\" style=\"font-size: 12.0pt; line-height: 115%;\">A </span><span style=\"font-size: 12.0pt; line-height: 115%; mso-ansi-language: IN;\"><span style=\"mso-spacerun: yes;\">&nbsp;</span>&rdquo;Kupang Krispy Lezat Bumbu Rasa &ndash; Rasa&rdquo; </span><span lang=\"EN-US\" style=\"font-size: 12.0pt; line-height: 115%;\">merupakan usaha yang bergerak dibidang makanan ringan berupa produk camilan olahan kupang. Camilan ini memiliki tekstur yang renyah dan gurih serta rasa khas kupang dengan perpaduan bumbu rasa rasa. Dalam produk ini terdapat 4 varian rasa yaitu balado, barbeque, keju dan pedas asin. Selain itu juga tersedia varian original bagi konsumen yang menginginkan rasa asli khas kupang. Proses produksi yan</span><span style=\"font-size: 12.0pt; line-height: 115%; mso-ansi-language: IN;\">g</span><span lang=\"EN-US\" style=\"font-size: 12.0pt; line-height: 115%;\"> mudah menjadikan usaha ini strategis untuk dijalankan. Dengan bahan baku yang mudah diperoleh yaitu di desa balongdowo, candi, sidoarjo sebagai wilayah penghasil utama sektor kupang. Meliat Permintaan segmentasi pasar yaang tinggi akan produk oalahan kupang yang unik dan lebih inovatif mendorong usaha ini untuk dijalankan. <span style=\"mso-spacerun: yes;\">&nbsp;</span>Produk ini dipasarkan melalui kerja sama dengan mitra mitra usaha seperti koperasi,mini market dan kantin sekolah selain itu produk ini juga dipasarkan melalui media online seperti instagram, whatsapp, line serta facebook. Camilan KUKREZZ BU</span><span style=\"font-size: 12.0pt; line-height: 115%; mso-ansi-language: IN;\">Z</span><span lang=\"EN-US\" style=\"font-size: 12.0pt; line-height: 115%;\">A ini cocok dikonsumsi untuk berbagai kalangan utamanya pelajar karena dapat dijadikan teman dalam beraktivitas seh</span><span style=\"font-size: 12.0pt; line-height: 115%; mso-ansi-language: IN;\">a</span><span lang=\"EN-US\" style=\"font-size: 12.0pt; line-height: 115%;\">ri - hari. Keunggulan produk ini yaitu harga yang murah serta keunikan rasa kripik yang khas kupang dengan di padukan varian bumbu rasa rasa sesuai keinginginan konsumen. Kupang selama ini hanya diolah menjadi olahan makanan tradisional lontong kupang dan petis. Oleh karena itu KUKREZZ BU</span><span style=\"font-size: 12.0pt; line-height: 115%; mso-ansi-language: IN;\">Z</span><span lang=\"EN-US\" style=\"font-size: 12.0pt; line-height: 115%;\">A merupakan produk inovasi olahan kupang yang unik dan lezat. Ancaman dari usaha ini yaitu ketika musim hujan proses produksi menjadi terhambat. </span></p>\n<p>&nbsp;</p>','Kupang|Kripik|Bumbu rasa',1,1,'2019-03-14 02:44:22','2019-03-15 01:31:32'),(954,0,'PEGUNG SALMON (Pentol Jagung Sambel Pelem Nom)','2019 17020114045 RETNO TRI HARIYANTI.pdf',NULL,8578000,'<p>Pentol merupakan salah satu jenis makanan yang digemari oleh semua umur. Pada umumnya, pentol yang dijajakan pada lingkungan masyarakat merupakan pentol dengan bahan dasar daging. Namun pentol yang akan kami buat ini berbahan dasar jagung yang disajikan bersama sambal dengan campuran mangga muda sebagai pelengkap rasa asam. Sambal yang kami sajikan dapat disesuaikan keasamannya oleh pelanggan Tujuan usaha ini menggunakan bahan dasar jagung karena jagung sendiri memiliki banyak manfaat di bidang kesehatan. Jagung mengandung vitamin A, vitamin B, vitamin C, dan juga folat. Selain itu, jagung juga mengandung sedikit lemak yang mana lemak tersebut termasuk kedalam lemak baik. Dengan adanya usaha ini, kami memberikan jajanan yang diharapkan dapat membantu menurunkan resiko kesehatan yang banyak dialami orang masa kini. Pada masa sekarang, banyak anak kecil yang sudah mengalami penurunan pada fungsi mata dan juga pada kaum muda yang sering mengalami depresi bahkan diabetes akibat pola makan yang buruk. Dilihat dari kandungan yang terdapat didalamnya, jagung baik untuk kesehatan mata. Mata membutuhkan asupan nutrisi yang mengandung antioksidan berupa karotenoid, seperti zeaxanthi dan lutein yang dapat ditemukan pada jagung atau olahan jagung lainnya. Jagung juga termasuk dalam kelompok makanan yang memiliki indeks glikemik rendah sehingga baik untuk penderit diabetes karena mampu mengontrol kadar gula darah. Jagung tidak sepenuhnya dapat mengatasi masalah depresi, namun dengan mengonsumsi jagung dan nutrisi lainnya dapat menjaga kesehatan otak.</p>','Pentol|Jagung|Pentol jagung',1,1,'2019-03-14 02:49:37','2019-03-20 03:11:28'),(955,0,'Pisang Apasih?','2019 17080304027 TRI WINASIH.pdf',NULL,4200000,'<p>Pisang Apasih? merupakan olahan pisang yang lezat dan bergizi. Pisang yang dicampur coklat batang dan dibungkus dengan kulit lumpia dan ditaburI keju ini selain unggul dalam rasa tetapi juga diperkaya berbagai kandungan yang bermanfaat bagi tubuh manusia. Jadi masih ragu untuk mencoba? &nbsp;</p>','Pisang|Lezat|Bergizi',1,1,'2019-03-14 02:55:41','2019-03-20 05:40:15'),(956,0,'\"JANDACU\" Jajanan Daun Cincau','2019 17010644181 Windu Asmoro Rini.pdf',NULL,7000000,'<p>Cincau yang sudah tidak asing lagi ditelinga masyarakat Indonesia dan sudah mulai sedikit peminatnya. Cincau pada umumnya digunakan sebagai bahan dasar es cincau. biasanya peminat cincau kebanyakan adalah orang tua saja.</p>\n<p>Dessert box adalah sejenis makanan pencuci mulut yang tengah populer di kalangan remaja kekinian hingga lanjut usia. Banyak sekali varian rasa dari dessert box tersebut yang dapat dijumpai di tengah-tengah masyarakat Indonesia. Namun belum ada yang memanfaatkan bahan alami sebagai bahan dasar dari dessert box tersebut.</p>\n<p>Dari permasalahan diatas kami mencoba untuk membuat inovasi dengan memanfaatkan daun cincau sebagai bahan dasar pembuatan dessert box. Sehingga cincau tidak lagi dipandang sebelah mata sebab dikemas secara menarik menjadi sebuah dessert yang dikagumi berbagai kalangan. Selain itu cincau juga mempunyai banyak manfaat bagi tubuh.</p>','cincau|daun|dessert box',1,1,'2019-03-14 02:56:24','2019-03-15 06:07:26'),(957,0,'Groenten ijs ( ice cream sayur)','2019 17010644174 Inka Avianty.pdf',NULL,3751000,'<p>Groenten ijs adalah ice cream sayuran yang mengandung banyak manfaat bagi semua kalangan dari dewasa maupun anak anak. Dengan adanya bahan utama sayuran ditambah lagi dengan singkong akan menjadikan ice cream ini memiliki rasa yang unik dan khas yang akan menjadi kegemaran semua orang.&nbsp;</p>\n<p>&nbsp;</p>','Groenten|Ice|Sayuran',1,1,'2019-03-14 02:56:42','2019-03-15 05:57:52'),(958,0,'Bu Nada (Buah Panada)','2019 16010664037 Disya Nafisah Muhadi.pdf',NULL,5175000,'<p><span style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; mso-fareast-font-family: Calibri; letter-spacing: -.05pt; mso-ansi-language: EN-US; mso-fareast-language: EN-US; mso-bidi-language: AR-SA;\">Judul kegiatan usaha kami ialah Bu Nada (Buah Panada). Buah panada merupakan jenis makanan, yaitu panada yang berasal dari Kota Manado. Panada yang akan kami tawarkan, memiliki varian rasa dari buah-buahan, seperti buah pisang, buah stroberi, buah durian, &amp; buah cocoa. Keempat buah tersebut memiliki manfaat bagi tubuh manusia. Dimana, keempat buah tersebut dapat memberikan asupan nutrisi yang baik bagi tubuh manusia.&nbsp;</span></p>','Panada|Buah-buahan |manfaat buah|panada buah|kue|panada',1,1,'2019-03-14 02:58:29','2019-03-15 02:19:10'),(959,0,'DonatQue','2019 17020104043 Mochamad Farhan Adam.pdf',NULL,10000000,'<p>Donat adalah makanan ringan yang sering kita jumpai dimanapun. Bentuk makanan ini dan varian rasa yang cukup banyak membuat donat ini cukup laris baik di kalangan anak-anak, remaja maupun orang dewasa. Dari hal tersebut kami ingin membuat sebuah terobosan baru dimana kami memberi sebuah kebebasan kepada konsumen yaitu konsumen dapat memilih toping sesuai dengan keinginannya, konsumen dapat menemukan kretivitas atau&nbsp; cita rasa yang baru. Hal tersebut lah yang membuat produk unggulan kami berbeda dengan produk donat lainnya.</p>\n<p>&nbsp;</p>\n<p>&nbsp;</p>\n<p>Promosi =&gt; membuka stand =&gt; pengembangan stand</p>','DonatQue',1,1,'2019-03-14 03:16:03','2019-03-19 17:54:42'),(960,0,'SEMPEATUNG (Sepatu Untuk Mengembangkan Pengetahuan Awal Berhitung Anak Usia 18-24 Bulan)','2019 16010684019 Mega mahardhika.pdf',NULL,14600000,'<p class=\"MsoNormal\" style=\"text-align: justify; text-indent: 36.0pt; line-height: 115%;\"><span lang=\"EN-US\" style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\';\">Di zaman sekarang yang serba modern, banyak sekali industri yang mengeluarkan berbagai macam jenis produk salah satunya adalah sepatu yang didesain secara menarik disesuaikan dengan trand fashion. Namun masih banyak masyarakat luas yang hanya melihat sepatu dari bentuk modelnya saja, tanpa memperhatikan manfaat yang bisa diperoleh dari sepatu tersebut. Banyak orang tua yang membelikan anaknya sepatu dengan harapan agar anak bisa tampil keren. Hal ini dikarenakan oleh beberapa faktor salah satunya adalah kebanyakan orang tua hanya melihat sepatu dari bentuknya saja tanpa memperhatikan manfaat<span style=\"mso-spacerun: yes;\">&nbsp; </span>yang didapat. Tanpa disadari apabila orang tua terus-menerus berfikir bahwa bentuk lebih menarik daripada manfaat maka tidak menutup kemungkinan orang tua akan ketinggalan jaman dan hal tersebut bisa berdampak bagi anak. </span></p>\n<p class=\"MsoNormal\" style=\"text-align: justify; text-indent: 36.0pt; line-height: 115%;\"><span lang=\"EN-US\" style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\';\">Oleh karena itu, kami menghadirkan produk inovasi baru yang sangat dibutuhkan di masyarakat. Selain menambah <em>fashion</em> bagi anak, hal ini juga bisa membantu para orang tua untuk menstimulsi anak dengan tepat. Karena pada era yang serba canggih ini, orang tua selalu menuntut anaknya untuk pandai calistung sejak dini, tanpa stimulasi yang diberikan maka hal itu akan sulit dilakukan. Sehingga dengan sepatu yang kreatif ini masyarakat dimudahkan untuk memberikan stimulasi bagi anak untuk mengenalkan pengetahuan anak tentang kemampuan berhitung. </span></p>\n<p class=\"MsoNormal\" style=\"margin-bottom: .0001pt; text-align: justify; text-indent: 35.45pt; line-height: 115%;\"><span lang=\"EN-US\" style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\';\">Terkadang kita melihat ada beberapa anak yang mengalami kemalasan untuk berlatih berjalan dikarenakan kurang menariknya media sepatu yang dia pakai sehingga anak tidak bersemangat dalam berjalan. Pada saat ini sepatu hanya terhenti dengan bunyi &ldquo;cit cit&rdquo;, hal itu bisa menimbulkan kebisingan dan tidak ada pengetahuan baru yang didapatkan anak. Maka dari itu,<span style=\"mso-spacerun: yes;\">&nbsp; </span>kami menciptakan inovasi produk baru yaitu sepatu yang diberikan tambahan suara untuk menarik perhatian anak<span style=\"mso-spacerun: yes;\">&nbsp; </span>dalam latihan berjalan, sekaligus dapat melatih kognitif pada anak.</span></p>\n<p class=\"MsoNormal\" style=\"margin-bottom: .0001pt; text-align: justify; text-indent: 35.45pt; line-height: 115%;\"><span lang=\"EN-US\" style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\';\">Dalam kesempatan ini, kebutuhan sepatu anak Usia Dini masih mengalami <em>stagnansi. </em>Sehingga dibutuhkan pembaharuan dan pengembangan untuk mengikutsertakan model sepatu Anak Usia Dini dalam perkembangan zaman. Terkhusus bagi anak yang mengalami perkembangan mulai berjalan. Dalam standar perkembangan anak pada motoriknya anak mampu berjalan sendiri tanpa jatuh ketika berumur 18-24 bulan. Selain itu pada saat usia ini anak mengalami perkembangan sensori yang cukup cepat. Sehingga ia menyukai aktifitas seperti berjalan, berlari dan meloncat. Maka dari itu anak membutuhkan media yang bisa mendukung dalam aktivitasnya.</span></p>\n<p class=\"MsoNormal\" style=\"margin-bottom: .0001pt; text-align: justify; text-indent: 35.45pt; line-height: 115%;\"><span lang=\"EN-US\" style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\';\">&nbsp;</span></p>\n<p class=\"Default\" style=\"text-align: justify; text-indent: 35.45pt; line-height: 115%;\"><span style=\"mso-ansi-language: IN; mso-bidi-font-weight: bold;\">&nbsp;</span></p>\n<p class=\"Default\" style=\"text-align: justify; text-indent: 35.45pt; line-height: 115%;\"><span style=\"mso-ansi-language: IN; mso-bidi-font-weight: bold;\">SEMPEATUNG merupakan jenis industri kreatif dan belum memiliki daya saing, maka dari itu ini menjadi keunggulan tersendiri untuk prospek usaha kedepan. Untuk prospek pemasaran SEMPEATUNG dikemas dengan plastik bermotif kemudian diletakkan dalam box yang sudah didesain khusus sehingga terjaga kualitasnya, serta sepatu ini dapat dipasarkan di kegiatan-kegiatan kota Surabaya. </span></p>','sepatu|sepatu anak|sepatu pintar|sepatu edukasi|sepatu pembelajaran|unesa|pg paud|industri kreatif|sepatu berhitung|angka|sepatu hits|sepatu kece|sepatu kekinian|sepatu anak pintar|sepatu murah|sepatu pandai|sepatu surabaya',4,1,'2019-03-14 03:17:53','2019-03-20 02:07:18'),(961,0,'Sushi-yamtu (Sushi Shirataki  Ayam Tuna)','2019 16010664033 Dinda Rizqia Widodo.pdf',NULL,10000000,'<p class=\"MsoNormal\" style=\"text-align: justify; text-indent: .5in; margin: 0in 0in 8.0pt 17.3pt;\"><span style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\';\">Kreasi terhadap jenis makanan tertentu merupakan terobosan yang dapat dicoba untuk memberikan refrensi terkini kepada para penikmatnya, tidak terkecuali kreasi pada makanan yang terkenal dari negara Jepang yaitu sushi. Masyarakat Indonesia sendiri sudah akrab dengan sushi karena makanaan ini sendiri dengan mudah ditemukan dimana-mana karena para produsen yang menjual sushi tidak hanya mengemas sushi didalam sebuah restoran melainkan gerobak berjalan atau yang sering kita kenal dengan pedagang kaki lima (PKL).</span></p>\n<p class=\"MsoNormal\" style=\"text-align: justify; text-indent: .5in; margin: 0in 0in 8.0pt 17.3pt;\"><span style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\';\">Sushi yang sering kita temui adalah sushi yang dibalut oleh rumput laut berisikan nasi dan berbagai ragam isi seperti ikan, udan, daging, ayam, sayuran, dll. Hal itu menunjukkan bahwa sushi merupakan salah satu jenis makanan yang dapat dikonsumsi dalam jumlah tertentu sebagai makanan besar karena memiliki jenis bahan yang mengandung karbohidrat tinggi yaitu nasi. Tetapi kandungan karbohidrat yang tinggi itu juga tidak baik juga dikonsumsi dengan jumlah yang banyak, karena selain mengandung kalori yang tinggi, nasi juga mengandung glukosa dimana tidak dapat dikonsumsi oleh orang pendderita diabetes.</span></p>\n<p class=\"MsoNormal\" style=\"text-align: justify; text-indent: .5in; margin: 0in 0in 8.0pt 17.3pt;\"><span style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\';\">Seperti yang kita tahu bahwa sushi pada umumnya juga didampingi dengan berbagai jenis lauk pendamping seperti yang sudah disebutkan sebelumnya yang lauk pauk tersebut dibalut jadi satu didalam rumput laut tersebut sehingga menghasilkan rasa yang nikmat dan membuat konsumen ingin terus membelinya.</span></p>\n<p class=\"MsoNormal\" style=\"text-align: justify; text-indent: .5in; margin: 0in 0in 8.0pt 17.3pt;\"><span style=\"font-family: \'Times New Roman\', serif; font-size: 12pt;\">Produk yang coba kami tawarkan masih sama seperti sushi pada umumnya, tetapi kami mencoba membuat kreasi dengan mengganti nasi dengan mie Shirataki yang tetap mengandung karbohidrat tetapi dengan jumlah kalori lebih sedikit, dan juga tanpa glukosa yang dapat menjadi pengganti nasi kemudian dapat dikonsumsi bagi mereka yang tidak diperbolehkan mengkonsumsi glukosa terlalu banyak atau dalam jumlah besar.</span></p>','Sushi|Shirataki|Makanan|Sehat',1,1,'2019-03-14 03:24:19','2019-03-15 07:07:22'),(962,0,'Sepik Baper (Sego Pitik Blackpepper)','2019 17010644130 Ekasari Cris Monita.pdf',NULL,4500000,'<p>sepik baper adalah sego pitik blackpepper yang menyajikan nasi ayam dengan saus blackpepper atau ayam lada hitam. kami menawarkan solusi melalui usaha makanan sepik baper yang memiliki penyajian yang berbeda dan nama yang unik akan menarik minat masyarakat. itulah yang menyebabkan sepik baper menjadi berbeda dengan nasi ayam blackpepper lainnya.</p>','makanan|praktis|sego pitik',1,1,'2019-03-14 03:24:25','2019-03-19 18:30:35'),(963,0,'BuBiBit (Donat Ubi, Labu dan Bit)','2019 16010664030 Fenzy Farah Azizah.pdf',NULL,6025000,'<p>BuBiBit hadir untuk memberikan inovasi pada jenis makanan sehat. BuBiBit menjadi salah satu olahan makanan manis yang berbentuk donat diolah tanpa digoreng dan tanpa bahan pengawet sehingga rendah kolesterol dan aman bagi tubuh.engan bahan Menggunakan bahan dasar Ubi ungu, Labu kuning dan buah bit yang kaya akan vitamin, mineral dan rendah gula. Berguna untuk antioxidan dan juga dapat digunakan untuk makanan pengganti nasi.&nbsp;</p>','makanan sehat|makanan manis|inovasi baru|BuBiBit',1,1,'2019-03-14 03:24:50','2019-03-15 02:33:16'),(964,0,'Daltok (Daur Ulang Batok)','2019 17020114018 ANI ESA ALFADILA.pdf',NULL,6762000,'<p>Indonesia merupakan salah satu penghasil komoditas tanaman kelapa&nbsp;terbesar. Hampir setiap wilayah menghasilkan tanaman kelapa. Tanaman kelapa&nbsp;</p>\n<p>telah dikenal masyarakat sejak dulu sebagai tanaman yang mempunyai fungsi dan&nbsp;kegunaan yang beraneka ragam dari akar sampai daunnya.</p>\n<p>Tempurung kelapa adalah bagian dari buah kelapa yang berupa endokrap,&nbsp;bersifat keras, dan diselimuti oleh sabut kelapa. Tempurung kelapa biasanya&nbsp;dimanfaatkan sebagai bahan kerajinan, bahan bakar, dan briket.&nbsp;</p>\n<p>Limbah tempurung juga kadang tidak dibergunakan. Perabotan rumah juga bisa digunakan sebagai hiasan. Contohnya yaitu kerajinan perabotan rumah dari tempurung kelapa seperti mangkok, toples, gelas dll.Tujuan diciptakannya desain ini merupakan penggabungan anatara&nbsp;</p>\n<p>pemanfaatan potensi alam Indonesia yang kaya, dengan desain perabotan yang ramah lingkungan. Diharapkan dengan adanya desain ini dapat menjadikan hasil olahan&nbsp;tempurung kelapa menjadi karya kriya yang tidak kalah bersaing dengan bahan plastik.</p>\n<p>&nbsp;</p>','Daur ulang batok|Daur ulang |Batok',4,1,'2019-03-14 03:27:59','2019-03-19 22:27:55'),(965,0,'Sinom Gliyeng (Es Puter Sinom)','2019 17020114057 Marsha Zahirah Junisisetya.pdf',NULL,5079000,'<p>Sinom merupakan salah satu minuman tradisional (jamu) yang cukup digemari oleh banyak kalangan. selain memiliki cita rasa yang unik, sinom juga menyehatkan. oleh karena itu kita menciptakan inovasi dari minuman tersebut yakni Sinom Gliyeng. Sinom Gliyeng merupakan es puter dengan cita rasa tradisional yang tidak hanya menyehatkan namun juga kekinian. karena di era milenial sekarang telah banyak brand-brand minuman kekinian yang telah merambah di dunia kuliner. Kami mengharapkan dengan adanya inovasi tersebut dapat melestarikan serta membudidayakan masyarakat untuk hidup sehat. Banyaknya kalangan muda yang melakukan diet ekstrim membuat kami menciptakan inovasi diet yang tidak hanya menyehatkan tetapi juga menyenangkan. Kami menggunakan sinom sebagai altrnatif diet karena sinom mengandung banyak manfaat diantaranya: daun asam dapat digunakan sebagai antiseptik, dan anti oksidan alami mengontrol gula darah dan menurunkan tekanan darah, melancarkan pernpasan, mengatasi sembelit,nyeri hadi dan masuk angin. selain itu kandungan asam jawa dalam sinom bermanfaat mecegah kanker dan ulkus, membantu perkembangan otot dan saraf, selain itu dapat menurunkan berat badan.&nbsp;</p>','sinom|jamu|traditional drink inovation|es puter',1,1,'2019-03-14 03:28:20','2019-03-19 19:37:01'),(966,0,'Kang Lur Kaligrafi','2019 17040254071 Rinne Dwi safitri.pdf',NULL,15000000,'<p><span style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; mso-fareast-font-family: Calibri; mso-fareast-theme-font: minor-latin; mso-bidi-theme-font: minor-bidi; letter-spacing: -.05pt; mso-ansi-language: EN-US; mso-fareast-language: EN-US; mso-bidi-language: AR-SA;\">&ldquo; Kang Lur Kaligrafi &rdquo; merupakan sebuah kerajinan yang bahan dasarnya terbuat dari limbah cangkang telur. Cangkang telur yang digunakan adalah cangkang telur ayam horen, ayam kampung, bebek maupun telur puyuh. Cangkang telur yang sudah dibersihkan dan dikelompokkan sesuai dengan jenis telur kemudian di potong menjadi beberapa senti atau sesuai kebutuhan. </span><span style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; mso-fareast-font-family: \'Times New Roman\'; mso-bidi-theme-font: minor-bidi; mso-ansi-language: EN-US; mso-fareast-language: IN; mso-bidi-language: AR-SA;\">Kerajinan ini berbeda dengan kerajinan kaligrafi pada umumnya yang biasanya hanya di gambar diatas dikertas/dikanvas dan dengan sapuan cat air saja, kerajinan ini dibuat diatas papan kayu triplek dengan tebal 3mm dan cara penempelan cangkang telur tersebut menggunakan teknik kolease. Desain sesuai dengan permintaan konsumen.</span><span style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; mso-fareast-font-family: Calibri; mso-fareast-theme-font: minor-latin; mso-bidi-theme-font: minor-bidi; letter-spacing: -.05pt; mso-ansi-language: EN-US; mso-fareast-language: EN-US; mso-bidi-language: AR-SA;\"> Cangkang telur di tempel menggunakan lem rajawali. </span><span style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; mso-fareast-font-family: \'Times New Roman\'; mso-bidi-theme-font: minor-bidi; mso-ansi-language: EN-US; mso-fareast-language: IN; mso-bidi-language: AR-SA;\">Setelah proses penempelan cangkang telur selesai. Gambar tersebut dikuas dengan bahan pewarna putih (warna putih menggunakan bubuk kalsium atau bahan untuk plamir dinding) dicampur dengan air diberi lem kayu merk Rajawali secukupnya. Kemudian tahap selanjutnya akan kami jelaskan pada langkah-langkah pembuatan &ldquo; Kang Lur Kaligrafi &rdquo; Manfaat yang dapat diambil dari kerajinan ini adalah mengurangi sampah cangkang telur, terpakainya sampah setelah didaur ulang, serta memiliki nilai estetik yang bisa dipajang didinding-dinding rumah sebagai hiasan dan tentunya memiliki nilai jual yang tinggi.</span></p>','Cangkang Telur, Kerajinan, kaligrafi',4,1,'2019-03-14 03:29:33','2019-03-14 23:46:45'),(967,0,'CUDENG ( Cumi Dendeng ) Tidak Nagih Hutang','2019 16010044082 Nicolas Akbar Pamungkas.pdf',NULL,12735000,'<p class=\"MsoNoSpacing\" style=\"text-align: justify; line-height: 150%; tab-stops: 14.2pt;\"><span lang=\"IN\" style=\"font-size: 12.0pt; line-height: 150%; font-family: \'Times New Roman\',\'serif\'; letter-spacing: -.05pt; mso-ansi-language: IN;\">Keunikan dari CUDENG (Cumi Dendeng) adalah ia berbeda dengan makanan dendeng biasanya, pada umumnya makanan dendeng terbuat dari daging sapi namun berbeda dengan CUDENG, makanan ini memiliki bahan dasar Cumi &ndash; Cumi</span><span style=\"font-size: 12.0pt; line-height: 150%; font-family: \'Times New Roman\',\'serif\'; letter-spacing: -.05pt;\"> &ndash; Cumi</span><span lang=\"IN\" style=\"font-size: 12.0pt; line-height: 150%; font-family: \'Times New Roman\',\'serif\'; letter-spacing: -.05pt; mso-ansi-language: IN;\">. CUDENG dapat dijadikan sebagai lauk untuk makan nasi , bahkan di jadikan sebagai makanan ringan di wilayah Surabaya sejauh ini sepertinya</span><span style=\"font-size: 12.0pt; line-height: 150%; font-family: \'Times New Roman\',\'serif\'; letter-spacing: -.05pt;\"> b</span><span lang=\"IN\" style=\"font-size: 12.0pt; line-height: 150%; font-family: \'Times New Roman\',\'serif\'; letter-spacing: -.05pt; mso-ansi-language: IN;\">elum d</span><span style=\"font-size: 12.0pt; line-height: 150%; font-family: \'Times New Roman\',\'serif\'; letter-spacing: -.05pt;\">i</span><span lang=\"IN\" style=\"font-size: 12.0pt; line-height: 150%; font-family: \'Times New Roman\',\'serif\'; letter-spacing: -.05pt; mso-ansi-language: IN;\">temukan adanya kuliner dendeng yang berbahan dasar Cumi &ndash;Cumi.</span><span style=\"font-size: 12.0pt; line-height: 150%; font-family: \'Times New Roman\',\'serif\'; letter-spacing: -.05pt;\"> Tidak hanya dibuat dendeng, cumi juga bisa dikembangkan menjadi keripik cumi. Hal tersebut akan menjadi perkembangan produk kami selanjutnya. Pada bagian kepala cumi lah yang akan dibuat keripik cumi, karena bagian tersebut tidak bisa dibuat dendeng, namun akan memiliki nilai jual jika dijadikan keripik.</span><span lang=\"IN\" style=\"font-size: 12.0pt; line-height: 150%; font-family: \'Times New Roman\',\'serif\'; letter-spacing: -.05pt; mso-ansi-language: IN;\"> Jadi besar harapan untuk memperoleh peluang dan menjadikan kuliner CUDENG ini eksis di wilayah Surabaya </span><span style=\"font-size: 12.0pt; line-height: 150%; font-family: \'Times New Roman\',\'serif\'; letter-spacing: -.05pt;\">bahkan di seluruh Indonesia </span><span lang=\"IN\" style=\"font-size: 12.0pt; line-height: 150%; font-family: \'Times New Roman\',\'serif\'; letter-spacing: -.05pt; mso-ansi-language: IN;\">di masa yang akan datang</span><span style=\"font-size: 12.0pt; line-height: 150%; font-family: \'Times New Roman\',\'serif\'; letter-spacing: -.05pt;\">.</span></p>','Cumi-Cumi|Dendeng |Keripik |kuliner|Surabaya |makanan',1,1,'2019-03-14 03:31:12','2019-03-19 20:46:06'),(968,0,'MAS BUDAK (Manisan Labu Bedak)','2019 17010714026 Aldona Safira.pdf',NULL,6798500,'<p>MAS BUDAK merupakan sebuah inovasi pengolahan labu bedak yang dijadikan manisan yang mana labu ini biasanya hanya digunakan untuk pakan ternak. Sebenarnya labu ini memiliki banyak manfaat bagi tubuh manusia, jadi sayang jika buah ini masih kurang dimanfaatkan. Oleh karena itu kami ingin membuatnya menjadi olahan manisan yang bisa diterima semua kalangan masyarakat.&nbsp;</p>','enter',1,1,'2019-03-14 03:34:24','2019-03-15 04:06:52'),(969,0,'DENDENG ARANG (Ares Pisang)','2019 17040254050 RAHMA DONA PRAMITA.pdf',NULL,200,'<p class=\"MsoNormal\" style=\"text-align: justify; text-indent: -7.1pt; line-height: 150%; tab-stops: 0in;\"><span style=\"font-size: 12.0pt; line-height: 150%; font-family: \'Times New Roman\',serif;\">&nbsp;DENDENG ARANG (Ares Pisang)&nbsp;</span><span style=\"font-size: 12.0pt; line-height: 150%; font-family: \'Times New Roman\',serif;\">Pada rencana bisnis ini penulis mencoba untuk </span><span lang=\"IN\" style=\"font-size: 12.0pt; line-height: 150%; font-family: \'Times New Roman\',serif; mso-ansi-language: IN;\">mengkreasikan bahan</span> <span lang=\"IN\" style=\"font-size: 12.0pt; line-height: 150%; font-family: \'Times New Roman\',serif; mso-ansi-language: IN;\">dendeng yang biasanya menggunakan daging menjadi dendeng dengan ares pisang</span><span style=\"font-size: 12.0pt; line-height: 150%; font-family: \'Times New Roman\',serif;\">. Pengemasan dilakukan dengan</span><span lang=\"IN\" style=\"font-size: 12.0pt; line-height: 150%; font-family: \'Times New Roman\',serif; mso-ansi-language: IN;\"> membungkus dendeng menggunakan plastik tebal yang sudah didesain semenarik mungkin untuk menarik minat pembeli.</span> <span style=\"font-size: 12.0pt; line-height: 150%; font-family: \'Times New Roman\',serif;\">Harga dari </span><span lang=\"IN\" style=\"font-size: 12.0pt; line-height: 150%; font-family: \'Times New Roman\',serif; mso-ansi-language: IN;\">produk dendeng </span><span style=\"font-size: 12.0pt; line-height: 150%; font-family: \'Times New Roman\',serif;\">ini lebih murah dibanding dengan </span><span lang=\"IN\" style=\"font-size: 12.0pt; line-height: 150%; font-family: \'Times New Roman\',serif; mso-ansi-language: IN;\">harga dendeng</span><span style=\"font-size: 12.0pt; line-height: 150%; font-family: \'Times New Roman\',serif;\"> pada umumnya dan memiliki cita<span style=\"mso-spacerun: yes;\">&nbsp; </span>rasa yang </span><span lang=\"IN\" style=\"font-size: 12.0pt; line-height: 150%; font-family: \'Times New Roman\',serif; mso-ansi-language: IN;\">lebih khas. </span><span style=\"font-size: 12.0pt; line-height: 150%; font-family: \'Times New Roman\',serif;\">Adapun cara pendistribusian dari dendeng </span><span lang=\"IN\" style=\"font-size: 12.0pt; line-height: 150%; font-family: \'Times New Roman\',serif; mso-ansi-language: IN;\">DENDENG ARANG (ARES PISANG) kami menitipkannya di kantin dan koperasi sekolah.</span> <span style=\"font-size: 12.0pt; line-height: 150%; font-family: \'Times New Roman\',serif;\">Dalam rangka mengembangkan keanekaragaman pangan yang mampu memenuhi kebutuhan masyarakat. Maka penulis menginovasikan Ares Pisang yang memiliki ciri khas tersendiri. Produk ini penulis beri nama Dendeng ARANG (ares pisang). </span></p>\n<p class=\"MsoNormal\" style=\"margin-left: 7.1pt; text-align: justify; text-indent: 28.35pt; line-height: 150%; tab-stops: 14.2pt 21.3pt;\"><span style=\"font-size: 12.0pt; line-height: 150%; font-family: \'Times New Roman\',serif;\"> Dendeng ARANG (ares pisang) merupakan makanan yang disukai oleh masyarakat, baik anak-anak maupun orang dewasa. Produk yang penulis tawarkan jelas menarik, sebab menggunakan bahan baku yang berupa Ares Pisang yang biasanya hanya di konsumsi sebagai sayur. Selain itu Dendeng ARANG (ares pisang) yang berbahan baku berupa Ares Pisang yang mengandung protein, vitamin C dan kandungan serat yang tinggi yang sangat di butuhkan oleh tubuh. </span></p>\n<p class=\"MsoNormal\" style=\"margin-left: 7.1pt; text-align: justify; text-indent: 28.35pt; line-height: 150%; tab-stops: 14.2pt 21.3pt;\"><span style=\"font-size: 12.0pt; line-height: 150%; font-family: \'Times New Roman\',serif;\">Produk Dendeng ARANG (ares pisang) merupakan trobosan terbaru dan pengembangan keanekaragaman pangan yang unik, kreatif dan inovatif. Dengan kreasi dan inovasi yang tinggi dendeng ARANG (ares pisang) dapat dijadikan komoditas unggulan berbasis sumber daya lokal. Dengan pengemasan yang menarik serta promosi di berbagai daerah. Penulis yakin produk penulis dapat menembus persaingan pasar.</span></p>','DENDENG ARANG (Ares Pisang)',1,1,'2019-03-14 03:34:33','2019-03-14 23:38:12'),(970,0,'SALAD BECAK ( SALAD BUAH BEBAS CASEIN MAKNYUS)','2019 16010044031 Annisa Fatmawati.pdf',NULL,7562000,'<p>Salad merupakan makanan berbasis buah yang dapat ditemukan dengan mudah di berbagai kalangan. Salad pada umumnya berisi berbagai buah-buahan yang dipotong kecil-kecil, yang kadang diberi variasi nata de coco dan atau jelly, diberi toping madu dan mayonaise, lalu taburan keju parut sebagai pelengkap. Namun perlu kita ketahui, ada beberapa kalangan yang tidak dapat menikmati lezatnya salad karena alergi terhadap kasein dan gluten yang terkandung pada susu dan keju (mengandung kasein), serta mayonaise (mengandung casein). SALAD BECAK ini dapat menjadi pilihan bagi kalangan yang alergi terhadap kasein dan gluten, namun tetap dapat menyantap salad yang lezat tanpa menimbulkan kekhawatiran.</p>','SALAD BUAH|GLUTEN FREE|CASEIN FREE|SEHAT',1,1,'2019-03-14 03:34:46','2019-03-15 04:21:38'),(971,0,'AGAR-AGAR CANTIK','2019 16010684043 ZESIKA DWI MAGHFIROH.pdf',NULL,7040000,'<p class=\"MsoNormal\"><em style=\"mso-bidi-font-style: normal;\"><span style=\"font-size: 12.0pt; line-height: 150%; font-family: \'Times New Roman\',serif;\">Agar-Agar Cantik (Agar-Agar Buah Cantik)</span></em><span style=\"font-size: 12.0pt; line-height: 150%; font-family: \'Times New Roman\',serif;\"> merupakan sebuah produk perpaduan antara agar-agar dengan salad buah. Perpaduan dengan salad buah dengan buah segar yang ditambahkan ditengah tengah agar-agar yang dihias dengan semenarik mungkin akan menambah gizi dalam produk ini. <em style=\"mso-bidi-font-style: normal;\">Agar-Agar Cantik (Agar-Agar Buah Cantik) </em>menjadi solusi bagi masyarakat dapat mengkonsumsi kembali agar-agar namun tetap merasakan adanya buah segar didalamnya agar-agar seperti salad buah.Dengan kandungan gizi pada agar-agar dan buah segar maka makanan ini cocok untuk dikonsumsi segala usia, dan cocok untuk dikonsumsi masyarakat yang sedang menjalani diet ataupun sebagai hidangan penutup. Dengan kemasan yang menarik cocok pula untuk diberikan kepada teman atau saudara. </span></p>','AGAR-AGAR CANTIK|AGAR-AGAR BUAH|AGAR-AGAR',1,1,'2019-03-14 03:34:58','2019-03-15 03:53:09'),(972,0,'CUCI SEPATU KODIK (kotor jadi nyentrik)','2019 17040254078 Heri sutrisno.pdf',NULL,6047000,'<p>Sepatu merupakan aspek penting bagi diri kita, karena sepatu sendiri berguna untuk melindungi kaki kita. Oleh sebab itu sepatu yang kita gunakan harus nyaman untuk kita gunakan. Tidak hanya itu saja, sekarang sepatu merupakan kebutuhan fashion kita. Oleh sebab itu kita harus menggunakan sepatu yang nyaman dan bersih bersih untuk kita gunakan. Sering kali kita lupa akan kenyaman dan kebersihan sepatu kita. Oleh sebab itu kami membuka usaha CUCI SEPATU KODAK (kotor jadi nyentrik). Usaha yang bergerak di bidang jasa pencucian sepatu. Cuci Sepatu KODAK merupakan jasa pencucian, recolour, unyellow dan repair pada sepatu.</p>\r\n<p>Cuci Sepatu KODAK berdiri karena saat ini sangat diperlukan yang serba instan atau mudah. Oleh karena itu banyak masyarakat memilih mencucikan sepatunya dari pada mencuci sendiri. Peluang usaha ini sangat besar karena banyak yang membutuhkan dan pesaing dalam usaha ini belum begitu banyak. Cuci sepatu KODAK sendiri cuci sepatune dengan harga menengah kebawah tapi dengan kualitas papan atas. Agar terjangkau oleh kalangan pelajar atau mahasiswa.harga yang ditawarkan yaitu Rp.40.000 per sepatu pengerjaan 1-2 hari dan Rp.35.000 dengan pengerjaan 2-3 hari dan juga gratis ongkos jemput maupun antar.</p>','Bersih, indah dan nyaman',2,1,'2019-03-14 03:44:16','2019-03-15 01:37:15'),(973,0,'PUGETOZ (Pudak Nugget Topping Lezat)','2019 17010714051 Balqis Imami.pdf',NULL,7005000,'<p class=\"NoSpacing1\" style=\"text-align: justify; tab-stops: 14.2pt;\"><span style=\"font-size: 14.0pt; mso-bidi-font-size: 10.0pt; font-family: \'Times New Roman\',\'serif\'; letter-spacing: -.05pt;\">Progam wirausaha ini bernama PUGETOZ<strong style=\"mso-bidi-font-weight: normal;\"> (</strong>Pudak Nugget Topping Lezat). PUGETOZ ini merupakan usaha dalam bidang makanan yang berfokus pada pengolahan pudak. Kami memiliki inovasi baru dalam pengolahan pudak ini menjadi makanan lezat yang akan disukai banyak kalangan. Produk ini memiliki keunggulan dalam pengonsumsian. Dengan demikian kami rasa produk ini cocok untuk dikonsumsi pada masa yang akan mendatang.Dikarenakan tampilan yang unik dan praktis.Harapan saya melalui PMW ini untuk dapat membimbing saya dan rekan saya dalam berproses<span style=\"mso-spacerun: yes;\">&nbsp; </span>mencapai wirausaha yang baik sehingga dapat membantu mewujudkan impian saya untuk menjadi manusia yang produktiv dan dapat membuka peluang kerja baru serta mengurangi angka<span style=\"mso-spacerun: yes;\">&nbsp; </span>pengangguran.</span></p>\n<p class=\"NoSpacing1\" style=\"text-align: justify; tab-stops: 14.2pt;\"><span style=\"font-size: 14.0pt; mso-bidi-font-size: 10.0pt; font-family: \'Times New Roman\',\'serif\'; letter-spacing: -.05pt;\">&nbsp;</span></p>\n<p><span style=\"font-size: 14.0pt; mso-bidi-font-size: 10.0pt; font-family: \'Times New Roman\',\'serif\'; mso-fareast-font-family: Calibri; letter-spacing: -.05pt; mso-ansi-language: EN-US; mso-fareast-language: EN-US; mso-bidi-language: AR-SA;\"><br style=\"mso-special-character: line-break; page-break-before: always;\" clear=\"all\" /> </span></p>\n<p class=\"MsoNormal\" style=\"margin-bottom: .0001pt; line-height: normal;\"><span style=\"font-size: 14.0pt; mso-bidi-font-size: 10.0pt; font-family: \'Times New Roman\',\'serif\'; letter-spacing: -.05pt;\">&nbsp;</span></p>','#pudak|#nugget',1,1,'2019-03-14 03:45:21','2019-03-14 18:52:22'),(974,0,'ADUH (ABON MENGKUDU HOT)','2019 16030194033 Lukjijatul Lutfiana.pdf',NULL,4993000,'<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp;Abon mengkudu merupakan suatu bisnis di bidang kuliner yang menyajikan olahan abon yang berbeda yaitu terbuat dari buah mengkudu, dimana biasanya abon terbuat dari berbagai jenis daging, seperti sapi maupun ayam. Ide olahan abon mengkudu ini muncul karena banyaknya buah mengkudu yang terbuang dengan percuma ataupun hanya dimanfaatkan sebagai jus atau langsung dikonsumsi begitu saja. Mengkudu (Morinda citrifolia) merupakan tanaman tropis yang telah banyak digunakan sebagai makanan maupun obat tradisional. Selain itu buah mengkudu juga memiliki banyak manfaat bagi kesehatan manusia. Dari sumber penelitian beberapa manfaat dari mengkudu antara lain menghilangkan sakit kepala, menurunkan tekanan darah tinggi (hipertensi), melancarkan sistem pencernaan, anti inflamasi, meningkatkan sistem imun tubuh, dan lain sebagainya. Karena banyaknya manfaat yang bisa didapatkan dari buah mengkudu tersebut, kami memanfaatkan buah mengkudu menjadi olahan yang berbeda yaitu abon mengkudu yang dapat disukai banyak kalangan, termasuk kalangan vegetarian.</p>\n<p>Abon ini dapat dijadikan cemilan maupun lauk pelengkap dengan rasa yang khas dan gurih dan terdapat varian tingkat kepedasan yang mengundang konsumen untuk mencoba. Usaha abon mengkudu dalam jangka panjang bertujuan untuk mendapatkan keuntungan bagi para pelaku usaha. Buah mengkudu yang murah dan banyak ditemukan di Indonesia membuat biaya produksi mengkudu ini menjadi murah sehingga harga jualnya menjadi terjangkau di berbagai kalangan. Hal tersebut menjadi salah satu peluang usaha yang sangat menjanjikan. Pelaksanan usaha ini dilakukan dengan tahap pembuatan dan pengolahan abon mengkudu. Setelah itu dilakukan riset harga pasar dan pemasaran produk. Kemudian melakukan perincian biaya mulai dari perhitungan bahan habis pakai, peralatan tetap dan biaya-biaya yang lain. Metode pemasaran dari produk abon mengkudu ini adalah mendistribusikan dan menitipkan produk abon mengkudu di warung-warung dan toko-toko di area Ketintang, sedangkan untuk pemasaran secara online, produk ini pasarkan melalui berbagai sosial media seperti Instagram, Facebook, maupun WhatsApp. Abon ini nantinya akan dijual dengan harga Rp. 10.000,00/kemasan (Netto 120 gram).</p>','MAKANAN|ABON|MENGKUDU',1,1,'2019-03-14 03:46:00','2019-03-15 05:19:01'),(975,0,'TUNA WISMA (Omah Tuna)','2019 17020084071 Miftaachur Rochmah.pdf',NULL,3057000,'<ol style=\"cursor: text; box-sizing: border-box; margin: 0px; padding: 0px 0px 0px 1.5em; counter-reset: list-1 0 list-2 0 list-3 0 list-4 0 list-5 0 list-6 0 list-7 0 list-8 0 list-9 0; color: #808080; font-family: Lato; white-space: pre-wrap;\">\n<li style=\"box-sizing: border-box; list-style-type: none; counter-reset: list-1 0 list-2 0 list-3 0 list-4 0 list-5 0 list-6 0 list-7 0 list-8 0 list-9 0; counter-increment: list-0 1; padding-left: 1.5em;\">Tuna Wisma (Omah Tuna) adalah&nbsp;gagasan PMW dari tim kami, kami mengusung nama Tuna Wisma atau Omah Tuna karena produk kami ialah berupa makanan yang berbahan dasar tuna. Alasan kuat dari kelompok kami untuk mengusung produk ini karena mengutip dari menteri perikanan, bu sushi susanti yang menggencarkan masyarakat untuk mengkonsumsi ikan utuk tubuh yang lebih sehat dan bugar. Produk kami yakni cup tuna dan rice box tuna yang hadir dengan berbagai varian rasa yang kaya akan rempah dan tentunya lezat. serta, produk kami mempunyai tingkat kepedasan yang berbeda beda mulai dari level original sampai level 1-5. kami berharap untuk mendapatkan bimbingan dari PMW ini karena kami mempunyai target jangka panjang dengan menambah variasi produk kami seperti ; lumpia tuna, lemper tuna, sambosa tuna dsb.</li>\n</ol>','Rice box tuna|Cup Tuna|TUNA WISMA (Omah Tuna)',1,1,'2019-03-14 03:57:29','2019-03-14 14:23:22'),(976,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,1,'2019-03-14 03:57:52','2019-03-14 03:58:36'),(977,0,'Sate Gendeng nugGEt baNDENG','2019 16010044072 Dwi Ayuningtyas.pdf',NULL,120