Et baNDENG) adalah suatu makanan olahan yang berasal dari bahan baku utama ikan bandeng, dibuat nugget dan kemudian dipanggang, dengan level kepedasan yang bervariasi. Sate bandeng tersaji dalam 2 jenis, yaitu siap makan dan frozen food. Sate Gendeng dijual akan dijual secara offline di sekitar lingkungan kampus UNESA dan secara online baik dengan pesan antar maupun diambil sendiri. Harga perkemasan untuk Sate Gendeng siap makan adalah Rp. 30.000,- dengan isi 5 tusuk sate. Sedangkan untuk Sate Gendeng yang berbentuk frozen food, dijual seharga Rp. 25.000,- perkemasan dengan isi yang sama. Sate Gendeng memiliki varian level kepedasan, mulai dari original/tidak pedas sama sekali, hingga level kepedasan 1 &ndash; 5.</span></p>\r\n<p class=\"MsoNoSpacing\" style=\"text-align: justify; line-height: 115%; tab-stops: 14.2pt;\"><span style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; letter-spacing: -.05pt; mso-ansi-language: IN;\"><span style=\"mso-tab-count: 1;\">&nbsp;&nbsp;&nbsp;&nbsp; </span>Sate Gendeng terinspirasi dari banyaknya makanan olahan bandeng di Sidoarjo (yang merupakan alamat dari penanggung jawab usaha ini). Serta variasi olahan ikan bandeng yang masih monoton seperti dijadikan pepes, bandeng asap dan bandeng presto. Selain itu, Sate Gendeng juga memiliki banyak sekali manfaat karena terbuat dari ikan bandeng yang juga kaya protein. Sate Gendeng juga dapat menjadi salah satu alternatif olahan untuk masyarakat yang sebelumnya kurang menyukai ikan bandeng, dikarenakan rasanya yang unik dan berbeda dengan olahan bandeng yang ada selama ini.</span></p>','Sate Gendeng, sate, nugget, bandeng|sate gendeng|sate|nugget|bandeng',1,1,'2019-03-14 03:59:36','2019-03-15 01:59:18'),(978,0,'GO-Pudd Skuy (Gaes Order Pudding Sehat kuy)','2019 16010664010 Yunus Ilham Firmansyah Priyadi Putra.pdf',NULL,8730000,'<p class=\"MsoNormal\"><span style=\"color: black; letter-spacing: -.05pt; background: white;\">Merupakan jenis produk makanan yang bergerak dan mengolah pada jenis makanan puding. Dalam hal ini yang diutamakan merupakan puding herbal atau berbahan dasar sayuran, seperti wortel, bayam, dan lain-lain. Karena dirasa masa kini masyarakat khusunya anak-anak/remaja cenderung tidak menyukai sayuran maka GO-pudd ini lah solusi dari kami, pengalihan bentuk dari rasa sayuran ke rasa puding yang lebih menggairahkan.&nbsp;Kelebihan yang kami miliki, bahan yang kami gunakan dari sayur mayur yang dibeli dari produk lokal masyarakat sekitar. Jadi kami juga mendukung UKM kecil lainnya. Varian rasa yang kami tawarkan dari bahan-bahan yang sehat dan tentunya citara sanya lezat. Kemasan yang kami gunakan akan menjadi nilai tambah . Karena nantinya akan kami berikan sebuah &ldquo;quotes&rdquo;. Dijadikan sebagai pengingat ataupun kata-kata yang sedang digemari masyarakat sekitar.&nbsp;</span></p>','Pudding Sehat, Wortel, Bayam, Sayur dan Buah, dan Kemasan Pudding ber quotes',1,1,'2019-03-14 04:00:58','2019-03-19 04:45:42'),(979,0,'JASTIP TOSERBA (Jasa Titip Toko Serba Ada )','2019 17040284057 Muhammad I\'mad Hamdy.pdf',NULL,3785000,'<p>jasa titip merupakan usaha yang memberikan layanan berupa mengantarkan barang yang telah di pesan oleh konsumen sebelumya. barang yang dipesan bergantung pada jasa titip yang ditawarkan. bisa berupa makanan, minuman, baju, sepatu, skincare, make up dan lainnya.&nbsp;</p>','keyword',2,1,'2019-03-14 04:01:04','2019-03-18 02:50:14'),(980,0,'DOLAR RASA ( Donat Larut Rahasia Keluarga )','2019 17010714054 YHUNANDA.pdf',NULL,6000000,'<p class=\"MsoNormal\" style=\"text-align: justify; text-indent: 36.0pt;\"><span style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; mso-fareast-font-family: \'Times New Roman\'; color: #444444; mso-ansi-language: IN;\">Program wirausaha ini bernama DOLAR RASA ( Donat Larut Rahasia Keluarga ). Usaha ini merupakan usaha pembuatan donat yang menggunakan tepung lerot untuk menggantikan tepung terigu sebagai bahan utamanya. tepung lerot digunakan karena banyaknya tanaman lerot yang tumbuh dan jarang digunakan oleh masyarakat luas. Oleh sebab itu produk ini memiliki keunggulan yang lebih dalam penggunaan tanaman lerot. Beberapa keunggulan produk ini dengan produk lain adalah dengan membentuk konsep yang semenarik mungkin, dimulai dari pembuatan kemasan yang terdapat kalimat pengetahuan atau request konsumen untuk meningkatkan minat baca konsumen, pemberian toping yang bervariasi, serta menggunakan media sosial sebagai media promosinya. Dengan demikian kami rasa produk ini layak dikatakan sebagai usaha kreatif karena menggunakan olahan dari tanaman lerot agar menjadi produk yang bisa dijual.</span></p>','enter|k|dolar rasa|donat larut',1,1,'2019-03-14 04:02:02','2019-03-17 04:05:52'),(981,0,'Muarot (Mukena anti melorot)','2019 17020104002 Rini rakhmawati.pdf',NULL,6000000,'<p>Muarot adalah sebuah produk yang dibuat berdasarkan kebutuhan pasar. untuk memenuhi keinginan masyarakat banyak mengenai mukena yang nyaman digunakan. baik dari segi desain maupun penggunaan. muarot ini didesain dengan dua warna yang simpel namun menarik dan didesain dengan pita dibagian perut sehingga terjamin anti melorot. penggunanya dapat khusyu\' dalam menjalankan ibadah sholat.</p>','barang|muarot',4,1,'2019-03-14 04:07:19','2019-03-19 20:02:30'),(982,0,'LAMPUNCH','2019 17020504037 Kevin naufal syach.pdf',NULL,2870000,'<p><strong>LAMPUNCH</strong> merupakan inovasi lampu unik yang memanfaatkan styrofoam sebagai bahan dasarnya, dengan tujuan mengurangi limbah dan memproduksinya menjadi sebuah karya yang bermanfaat dan memiliki nilai estetika namun dengan harga yang terjangkau.&nbsp;</p>','DESIGN|INTERIOR|FURNITURE|BARANG|KREATIF|URBAN|LAMPU|UNIK|RECYCLE|LINGKUNGAN|kreatif|lampu|Lampu|Design|interior',4,1,'2019-03-14 04:15:53','2019-03-17 04:31:27'),(983,0,'PUBG ( Puding Ubi Bersama tunaGrahita)','2019 16010044002 Ike Peny Rendani.pdf',NULL,14735000,'<p class=\"MsoNormal\" style=\"margin: 0cm; margin-bottom: .0001pt; text-align: justify; text-indent: -.1pt; tab-stops: 14.2pt; border: none; mso-padding-alt: 31.0pt 31.0pt 31.0pt 31.0pt; mso-border-shadow: yes;\"><span style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; mso-fareast-font-family: \'Times New Roman\'; color: black;\">PUBG atau Puding Ubi Bersama Tunagrahita merupakan suatu usaha yang akan mampu menciptakan lapangan kerja untuk anak tunagrahita. Di dalam usaha ini mengajak anak tunagrahita untuk mampu berwirausaha. Puding Ubi dibuat lembut dengan berbagai macam toping buah sesuai pilihan konsumen. Selain buah PUBG juga dilengkapi float.</span></p>','PUBG|Puding ubi|Tuna Grahita',1,1,'2019-03-14 04:27:09','2019-03-15 00:36:33'),(984,0,'BROUAH \"Healthy Food and Mood Enhancer\"','2019 18030654027 Khofifah Indar Parawangsa.pdf',NULL,9482000,'<p>BROUAH merupakan olahan makanan dengan inovasi baru yang terbuat dari bahan lokal dan berkualitas, memadupadankan brownis dengan kandungan buah yang menyehatkan.&nbsp; Brownis buah ini merupakan makanan yang dapat dikonsumsi dengan fleksibel bukan hanya karena kemasannya yang praktis melainkan juga karena adanya kandungan karbohidrat yang memang dibutuhkan manusia untuk melakukan aktivitas. Buah alpukat dan buah naga menjadi variasi perpaduan untuk BROUAH. Alpukat mengandung protein, lemak bermanfaat, karotenoid, lutein, vitamin, dan mineral, antiinflamasi, sedangkan buah naga memiliki kandungan air cukup banyak, karbohidrat, protein, serat, kalsium, fosfor, dan vitamin C.</p>\n<p>&nbsp;</p>\n<p>Keunikan dan keunggulan Brownis Buah merupakan produk makanan yang selain menyehatkan, berenergi juga memiliki khasiat untuk meningkatkan mood. Karena brownis lapis ini akan diisi oleh lapisan brownis coklat, Coklat sendiri&nbsp; mengandung alkaloid seperti theobromin, kafein, dan fenitelamin yang dapat memberikan efek berkaitan dengan serotonin pada otak, sehingga dapat meningkatkan daya sensitif insulin, menurunkan tekanan darah, dan memperbaiki suasana hati.&nbsp; Sehingga selain menyehatkan keunggulan lain brownis ini dapat meningkatkan mood penikmatnya.Untuk harga per cup Rp18.810,-</p>','Alpukat|Buah Naga|Brownis',1,1,'2019-03-14 04:31:24','2019-03-18 21:59:31'),(985,0,'Nasi Terik Matahari Rasa Orabedo (Original,  Barbeque, dan Balado)','2019 16010044049 Anna Nur Anisa.pdf',NULL,6050000,'<p class=\"MsoNoSpacing\" style=\"margin-left: 14.2pt; text-align: justify; line-height: 115%; tab-stops: 14.2pt;\"><span lang=\"EN-US\" style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; letter-spacing: -.05pt;\">&nbsp; &nbsp; &nbsp; &nbsp;Nasi terik matahari </span><span style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; letter-spacing: -.05pt; mso-ansi-language: IN;\">merupakan</span><span lang=\"EN-US\" style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; letter-spacing: -.05pt;\"> makanan</span><span style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; letter-spacing: -.05pt; mso-ansi-language: IN;\"> inovasi</span><span lang=\"EN-US\" style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; letter-spacing: -.05pt;\"> yang </span><span style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; letter-spacing: -.05pt; mso-ansi-language: IN;\">berbahan dasar nasi aking. Nasi aking </span><span lang=\"EN-US\" style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; letter-spacing: -.05pt;\">berasal dari sisa-sisa nasi tak termakan yang </span><span style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; letter-spacing: -.05pt; mso-ansi-language: IN;\">masih baik</span><span lang=\"EN-US\" style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; letter-spacing: -.05pt;\"> dan dikeringkan di</span><span style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; letter-spacing: -.05pt; mso-ansi-language: IN;\"> bawah</span><span lang=\"EN-US\" style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; letter-spacing: -.05pt;\"> terik matahari. Kebanyakan nasi aking dijual sebagai makanan unggas atau diolah menjadi olahan kerupuk. </span><span style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; letter-spacing: -.05pt; mso-ansi-language: IN;\">Sebagian besar masyarakat masih menganggap bahwa nasi aking hanya dikonsumsi oleh masyarakat miskin. Namun sebenarnya </span><span lang=\"EN-US\" style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; letter-spacing: -.05pt;\">banyak </span><span style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; letter-spacing: -.05pt; mso-ansi-language: IN;\">juga </span><span lang=\"EN-US\" style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; letter-spacing: -.05pt;\">masyarakat yang </span><span style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; letter-spacing: -.05pt; mso-ansi-language: IN;\">tidak </span><span lang=\"EN-US\" style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; letter-spacing: -.05pt;\">tau bahwa nasi aking dapat diolah menjadi makanan lezat yang mengandung banyak gizi, bahkan nasi aking memiliki kadar gula dan kalori yang jauh lebih rendah daripada nasi biasa, sehingga aman dikonsumsi untuk orang diabetes maupun orang yang sedang menjalani program diet.</span></p>\n<p class=\"MsoNoSpacing\" style=\"margin-left: 14.2pt; text-align: justify; line-height: 115%; tab-stops: 14.2pt;\"><span lang=\"EN-US\" style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; letter-spacing: -.05pt;\"><span style=\"mso-tab-count: 1;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span>Keunikan nasi terik matahari orabedo ini memanfaatkan nasi aking menjadi santapan lezat berbumbu ala eropa dan Minangkabau, yakni barbeque dan balado, karena kedua bumbu ini banyak diminati dan terkenal enak. Sehingga, masyarakat merasakan cita rasa baru yang &ldquo;murah tapi mewah&rdquo; dengan rasa yang tak diragukan. Kami juga menyediakan berbagai lauk seperti ayam goreng, tahu, tempe dan telur. Untuk tambahannya, kami juga menyediakan sambal teri untuk konsumen yang doyan pedas. </span></p>\n<p class=\"MsoNoSpacing\" style=\"margin-left: 14.2pt; text-align: justify; line-height: 115%; tab-stops: 14.2pt;\"><span lang=\"EN-US\" style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; letter-spacing: -.05pt;\"><span style=\"mso-tab-count: 1;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span>Keunggulan lain dari produk kami yaitu </span><span style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; letter-spacing: -.05pt; mso-ansi-language: IN;\">bahan baku yang digunakan berasal dari nasi aking yang terjamin kualitasnya karena kami tidak menggunakan nasi sisa yang sudah basi melainkan menggunakan nasi kualitas baik untuk kemudian dikeringkan. Untuk mempercantik penampilan, nasi terik matahari ini </span><span lang=\"EN-US\" style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; letter-spacing: -.05pt;\">dibungkus dengan kemasan yang menarik dan tidak terkesan murahan, sehingga orang-orang dari kalangan bawah maupun menengah atas tidak ragu untuk membeli olahan lezat ini. Kemasan yang kami gunakan untuk </span><span style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; letter-spacing: -.05pt; mso-ansi-language: IN;\">membungkus </span><span lang=\"EN-US\" style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; letter-spacing: -.05pt;\">nasinya yaitu menggunakan kertas plastik ala KFC.</span> <span lang=\"EN-US\" style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; letter-spacing: -.05pt;\">Untuk lauknya dibungkus dengan mika, setelah itu nasi dan lauk dimasukkan kedalam <em style=\"mso-bidi-font-style: normal;\">paper bag tumblr quote</em>. Guna paper bag tumblr ini untuk menarik minat kalangan milenial karena cukup <em style=\"mso-bidi-font-style: normal;\">instagramable</em> untuk difoto, meningkatkat motivasi, serta menghibur karena tidak hanya menggunakan quote bijak, tetapi juga dengan quote lucu misalnya &ldquo;Mendengar kamu kentut saja aku sudah bahagia.&rdquo;</span></p>','Nasi Terik Matahari|Nasi Aking|Makanan Inovasi|Kaum Milenial',1,1,'2019-03-14 04:32:47','2019-03-15 05:29:54'),(986,0,'Semanggee - Bubble Drink Semanggi Khas Surabaya','2019 17051214003 Septi Nur Faizani.pdf',NULL,9585000,'<p class=\"MsoNormal\" style=\"margin-bottom: .0001pt; text-align: center; line-height: normal;\" align=\"center\"><strong><span style=\"font-size: 12.0pt; font-family: \'Times New Roman\',\'serif\';\">Semanggee - Pembuatan Bubble Semanggi </span></strong></p>\n<p class=\"MsoNormal\" style=\"text-align: center; line-height: normal;\" align=\"center\"><strong><span style=\"font-size: 12.0pt; font-family: \'Times New Roman\',\'serif\';\">untuk Pengembangan Inovasi Olahan Daun Semanggi</span></strong></p>\n<p class=\"MsoNormal\" style=\"margin-bottom: .0001pt; text-align: center; line-height: normal;\" align=\"center\"><span style=\"font-size: 12.0pt; font-family: \'Times New Roman\',\'serif\';\">Septi Nur Faizani, Putri Amelia Agustin, M. Alfian Ma&rsquo;ruf</span></p>\n<p class=\"MsoNormal\" style=\"margin-bottom: .0001pt; text-align: center; line-height: normal;\" align=\"center\"><span style=\"font-size: 12.0pt; font-family: \'Times New Roman\',\'serif\';\">Dwi Fatrianto Suyatno, S.Kom., M.Kom.</span></p>\n<p class=\"MsoNormal\" style=\"margin-bottom: .0001pt; text-align: center; line-height: normal;\" align=\"center\"><span style=\"font-size: 12.0pt; font-family: \'Times New Roman\',\'serif\';\">Universitas Negeri Surabaya</span></p>\n<p class=\"MsoNormal\" style=\"margin-bottom: .0001pt; text-align: center; line-height: normal;\" align=\"center\"><span style=\"font-size: 12.0pt; font-family: \'Times New Roman\',\'serif\';\">&nbsp;</span></p>\n<p class=\"MsoNormal\" style=\"margin-bottom: .0001pt; text-align: justify; text-justify: inter-ideograph; text-indent: 21.0pt;\"><span style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\';\">Daun semanggi merupakan tanaman yang dijadikan kuliner khas kota pahlawan. Tanaman ini banyak tumbuh liar di pinggiran sungai dan kurang diminati masyarakat, saat ini masih belum banyak dimanfaatkan untuk produk olahan makanan dan minuman. Produk olahan dari daun semanggi selama ini baru pecel semanggi dan kripik daun semanggi saja. </span></p>\n<p class=\"MsoNormal\" style=\"margin-bottom: .0001pt; text-align: justify; text-justify: inter-ideograph; text-indent: 21.0pt; mso-layout-grid-align: none; text-autospace: none;\"><span style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\';\">Berdasarkan analisis peluang yang ada, maka muncullah ide kami untuk membuat produk olahan daun semanggi yang bernama &ldquo;Semanggee&rdquo;. <em style=\"mso-bidi-font-style: normal;\">Bubble</em> &ldquo;Semanggee&rdquo; ini merupakan sebuah terobosan baru cara menikmati daun semanggi yang unik karena akan dipadukan dengan minuman aneka rasa yang begitu menyegarkan dan tentunya baik untuk kesehatan. Daun semanggi menyimpan manfaat untuk kesehatan diantaranya yaitu dapat mengobati penyakit </span><span style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; mso-bidi-font-family: \'Times New Roman\'; mso-bidi-theme-font: minor-bidi;\">diuretik, demam, flu, menurunkan kadar gula darah, sebagai obat pereda rasa sakit, dan masih banyak lagi.</span></p>\n<p class=\"MsoNormal\" style=\"margin-bottom: .0001pt; text-align: justify; text-justify: inter-ideograph; text-indent: 21.0pt; mso-layout-grid-align: none; text-autospace: none;\"><span style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\';\">Dengan adanya usaha ini, kami berharap bisa ikut meningkatkan pendapatan para petani daun semanggi dan juga perekonomian masyarakat sekitar. Peningkatan pendapatan para petani daun semanggi dapat terjadi karena dengan adanya usaha ini maka permintaan daun semanggi akan semakin meningkat karena mengingat bahan baku utama produk kami adalah daun semanggi. Sementara itu, untuk peningkatan perekonomian masyarakat sekitar dapat terjadi karena dengan dibukanya usaha ini maka secara otomatis kami akan merekrut tenaga kerja dari masyarakat sekitar untuk ikut membantu dalam proses produksi &ldquo;Semanggee&rdquo;. Tentu hal tersebut bisa menambah pemasukan mereka sekaligus dapat memberi lapangan pekerjaan bagi masyarakat sekitar tempat produksi. </span></p>','Daun Semanggi|Pengembangan Olahan Daun Semanggi|Bubble Drink Daun Semanggi|Manfaat Daun Semanggi|Mahasiswa Wirausaha|Peningkatan Perekonomian Masyarakat',1,1,'2019-03-14 04:35:07','2019-03-16 18:45:58'),(987,0,'HISYAP-HISYAP CANDY \"Permen Tradisional Aneka Rasa dan Berkhasiat\"','2019 16050394066 Radik Woro Dinalar.pdf',NULL,7685000,'<p class=\"MsoNoSpacing\" style=\"text-align: justify; text-indent: 14.2pt; line-height: 115%; tab-stops: 14.2pt;\"><span lang=\"EN-ID\" style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; letter-spacing: -.05pt; mso-ansi-language: EN-ID;\">Program Mahasiswa Wirausaha</span><span lang=\"IN\" style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; letter-spacing: -.05pt; mso-ansi-language: IN;\"> (PMW) yang</span> <span lang=\"IN\" style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; letter-spacing: -.05pt; mso-ansi-language: IN;\">kami usulkan berupa pengembangan pembuatan permen </span><span lang=\"EN-ID\" style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; letter-spacing: -.05pt; mso-ansi-language: EN-ID;\">aneka rasa yang&nbsp; berkhasit dari bahan-bahan alami salah satunnya berasalah dari, </span><span lang=\"IN\" style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; letter-spacing: -.05pt; mso-ansi-language: IN;\">labu siam </span><span lang=\"EN-ID\" style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; letter-spacing: -.05pt; mso-ansi-language: EN-ID;\">dan daun waung. Labu siam </span><span lang=\"IN\" style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; letter-spacing: -.05pt; mso-ansi-language: IN;\">yaitu sebuah</span> <span lang=\"IN\" style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; letter-spacing: -.05pt; mso-ansi-language: IN;\">produk permen labu siam yang mengandung vitamin C, vitamin B kompleks.</span> <span lang=\"IN\" style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; letter-spacing: -.05pt; mso-ansi-language: IN;\">seperti folat sejumlah 61 mcg dan sejumlah kecil niacin, thiamin, riboflavin, asam</span> <span lang=\"IN\" style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; letter-spacing: -.05pt; mso-ansi-language: IN;\">pantotenat dan vitamin B6. Vitamin B berperan penting dalam proses</span> <span lang=\"IN\" style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; letter-spacing: -.05pt; mso-ansi-language: IN;\">metabolisme tubuh. Selain itu buah labu ini juga mengandung zat mineral seperti</span> <span lang=\"IN\" style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; letter-spacing: -.05pt; mso-ansi-language: IN;\">zat besi, mangan, fosfor, seng, dan tembaga. Labu siam juga mengandung</span> <span lang=\"IN\" style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; letter-spacing: -.05pt; mso-ansi-language: IN;\">antioksidan flavonoid poli fenolik, seperti apigenin dan luteolin. Senyawa ini</span> <span lang=\"IN\" style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; letter-spacing: -.05pt; mso-ansi-language: IN;\">bermanfaat untuk mengikat radikal bebas berbahaya dalam tubuh, yang berperan</span> <span lang=\"IN\" style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; letter-spacing: -.05pt; mso-ansi-language: IN;\">dalam pembentukan kanker, penuaan dini, dan berbagai macam penyakit. Buah</span> <span lang=\"IN\" style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; letter-spacing: -.05pt; mso-ansi-language: IN;\">labu siam juga merupakan sumber anti oksidan vitamin C yang cukup baik, yaitu</span> <span lang=\"IN\" style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; letter-spacing: -.05pt; mso-ansi-language: IN;\">sekitar 7,7 mg/100gram atau 13 % dari kebutuhan harian yang disarankan Targe</span><span lang=\"EN-ID\" style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; letter-spacing: -.05pt; mso-ansi-language: EN-ID;\">t </span><span lang=\"IN\" style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; letter-spacing: -.05pt; mso-ansi-language: IN;\">pemasaran produk kami adalah di sekitar kampus </span><span lang=\"EN-ID\" style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; letter-spacing: -.05pt; mso-ansi-language: EN-ID;\">FT </span><span lang=\"IN\" style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; letter-spacing: -.05pt; mso-ansi-language: IN;\">Universitas</span> <span lang=\"IN\" style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; letter-spacing: -.05pt; mso-ansi-language: IN;\">Negeri </span><span lang=\"EN-ID\" style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; letter-spacing: -.05pt; mso-ansi-language: EN-ID;\">Surabaya </span><span lang=\"IN\" style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; letter-spacing: -.05pt; mso-ansi-language: IN;\">dan sekitarnya, serta di Toko-toko sekitar Kota </span><span lang=\"EN-ID\" style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; letter-spacing: -.05pt; mso-ansi-language: EN-ID;\">Surabaya</span><span lang=\"IN\" style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; letter-spacing: -.05pt; mso-ansi-language: IN;\">, dan</span> <span lang=\"IN\" style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; letter-spacing: -.05pt; mso-ansi-language: IN;\">melalui facebook, twiter, blog dengan promosi yang menarik konsumen sehingga</span> <span lang=\"IN\" style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; letter-spacing: -.05pt; mso-ansi-language: IN;\">target pemasaran dapat tercapai dengan maksimal. Program ini dilaksanakan selama lima bulan dengan tiga tahapan. Tahap</span> <span lang=\"IN\" style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; letter-spacing: -.05pt; mso-ansi-language: IN;\">pertama yaitu persiapan alat dan bahan serta tempat untuk usaha, tahap kedua</span> <span lang=\"IN\" style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; letter-spacing: -.05pt; mso-ansi-language: IN;\">yaitu pelaksanaan meliputi produksi dan pemsaran, tahap ketiga yaitu taha</span><span lang=\"EN-ID\" style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; letter-spacing: -.05pt; mso-ansi-language: EN-ID;\">p </span><span lang=\"IN\" style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; letter-spacing: -.05pt; mso-ansi-language: IN;\">mentoring dan evaluasi.Program ini membutuhkan dana sebesar Rp. 7.685.000,00 dengan hasil</span> <span lang=\"IN\" style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; letter-spacing: -.05pt; mso-ansi-language: IN;\">yang akan diperoleh sebesar Rp. 10.000.000,00, dengan hasil awal ini dapaat</span> <span lang=\"IN\" style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; letter-spacing: -.05pt; mso-ansi-language: IN;\">menutup modal awal dan sudah memperoleh keuntungan. Keuntungan pada bulan</span> <span lang=\"IN\" style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; letter-spacing: -.05pt; mso-ansi-language: IN;\">kedua nantinya akan digunakan untuk membayar kary</span><span lang=\"EN-ID\" style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; letter-spacing: -.05pt; mso-ansi-language: EN-ID;\">awan</span></p>','Permen Khasiat, Rasa-Rasa, Herbal',1,1,'2019-03-14 04:45:25','2019-03-15 03:24:18'),(988,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,1,'2019-03-14 04:47:39','2019-03-14 19:24:41'),(989,0,'Let\'s Talk \'bout You!','2019 16010664078 Anggun Zoraya Br Sinaga.pdf',NULL,13000000,'<p>Aplikasi Konseling akan memudahkan individu atau seseorang menemukan wadah yang berisikan mahasiswa yang kompeten dalam bidang konseling seperti Psikologi dan atau Bimbingan konseling. Pada PMW 2019 ini, mahasiswa psikologi menghadirkan aplikasi&nbsp;<em>let\'s talk \'bout you</em>. Aplikasi konseling ini akan dibuat sedemikian rupa untuk tidak mematok harga guna memudahkan penggunan dari segala tingkatan masyarakat. Untuk mengasah kemampuan berkonseling, admin pada aplikasi ini akan dititik beratkan pada mahasiswa psikologi yang telah menerima matakuliah konseling dengan nilai yang sudah menjadi patokan.&nbsp;</p>','jasa|aplikasi|konseling|psikologi|pmw|let\'s talk|curhat',2,1,'2019-03-14 04:49:45','2019-03-15 03:40:22'),(990,0,'BROKEN HEART AHSOYLOLUR','2019 17010644067 INDAH BUDI ASTUTIK.pdf',NULL,5000000,'<p>Brokoli dan kentang merupakan jenis sayuran yang biasanya hanya dijadikan sebagai bahan pelengkap dalam masakan berkuah. Selain itu tidak jarang kita jumpai camilan yang berbahan dasar dari keduanya hanya diolah dengan cara digoreng. Sehingga kami berinovasi untuk mengolah kedua bahan tersebut menjadi sebuah produk makanan yang lebih menarik. produk makanan yang kami ciptakan bernama \"Broken Heart Ahsoylolur\" yang memiliki arti brokoli kentang berbentuk hati dan kata ahsoylolur yang memiliki kepanjangan ah so yummy loh lur. Produk ini diharapkan dapat diterima dan disukai terutama oleh kalangan remaja yang lebih meminati makanan baru atau hits. Selain itu, produk ini memiliki kelebihan bagi masyarakat yang kurang menyukai sayuran dapat menikmati makanan bergizi ini tanpa merasakan rasa \"tidak enak atau tidak suka\" yang mereka miliki atau rasakan selama ini. Sehingga produk yang kami ciptakan ini selain unik tetapi juga memiliki manfaat yang banyak karena kandungan yang ada di dalam sayuran.&nbsp;</p>','brokoli, kentang, hati|brokoli|kentang|hati|ahsoylolur',1,1,'2019-03-14 04:51:09','2019-03-14 22:34:29'),(991,0,'(Photo to Cartoon) Manipulasi Foto Menjadi Vector Art','2019 17020114052 Yugi Pangestuti.pdf',NULL,10000000,'<p>Program Mahasiswa Wirausaha yang kami buat berjudul&nbsp;<strong><span lang=\"EN-ID\" style=\"font-size: 12.0pt; font-family: \'Times New Roman\',\'serif\'; letter-spacing: -.05pt; mso-ansi-language: EN-ID;\">(Photo to Cartoon)</span></strong><span style=\"font-family: \'Times New Roman\', serif; font-size: 12pt; letter-spacing: -0.05pt; text-align: center;\">&ldquo;</span><strong style=\"font-family: \'Times New Roman\', serif; font-size: 12pt; letter-spacing: -0.05pt; text-align: center;\">Manipulasi Foto Menjadi Vector Art&rdquo; </strong>yang mana bertujuan untuk menggabungkan inovasi dari teknologi yang ada di bidang grafis dengan sebuah produk yang unik yang banyak digandrungi masyarakat saat ini. Dengan kreativitas yang ada diharapkan produk ini dapat bersaing di pasar modern dengan kesempatan produk dapat memiliki nilai guna dan fungsi keindahan yang lebih.</p>','Inovasi',4,1,'2019-03-14 04:54:22','2019-03-20 01:14:26'),(992,0,'MUBI IS TOP (Muffin Ubi Isi dan Topping)','2019 16010044071 LAILATUL UMMAH.pdf',NULL,4243500,'<p class=\"MsoNormal\" style=\"text-align: center;\" align=\"center\"><strong><span lang=\"EN-ID\" style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; mso-ansi-language: EN-ID;\">MUBI IS TOP</span></strong><strong><span lang=\"IN\" style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; mso-ansi-language: IN;\"> (</span></strong><strong><span lang=\"EN-ID\" style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; mso-ansi-language: EN-ID;\">Muffin Ubi Isi dan Topping</span></strong><strong><span lang=\"IN\" style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; mso-ansi-language: IN;\">)</span></strong></p>\n<p class=\"MsoNormal\" style=\"text-align: center;\" align=\"center\"><strong><span lang=\"IN\" style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; mso-ansi-language: IN;\">&nbsp;</span></strong></p>\n<p><span lang=\"IN\" style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; mso-fareast-font-family: Calibri; mso-ansi-language: IN; mso-fareast-language: EN-US; mso-bidi-language: AR-SA;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span><span lang=\"EN-ID\" style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; mso-fareast-font-family: Calibri; mso-ansi-language: EN-ID; mso-fareast-language: EN-US; mso-bidi-language: AR-SA;\">MUBI IS TOP (Muffin Ubi Isi dan Topping) </span><span lang=\"IN\" style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; mso-fareast-font-family: Calibri; mso-ansi-language: IN; mso-fareast-language: EN-US; mso-bidi-language: AR-SA;\">adalah produk </span><span lang=\"EN-ID\" style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; mso-fareast-font-family: Calibri; mso-ansi-language: EN-ID; mso-fareast-language: EN-US; mso-bidi-language: AR-SA;\">mkanan yang berbahan baku Ubi yang mempunyai kandungan karbohidrat dan kalori yang cukup tinggi, selain itu juga ubi mempunyai banyak kandungan dan manfaat. Muffin adalah makanan yang banyak digemari oleh berbagai kalangan dari anak-anak sampai dewasa. Keunikan Muffin Ubi ini adalah berbahan dasar dasar ubi dengan aneka isi dan topping. Selain sebagai usaha yang jarak ditemukan di kalangan mahasiswa di Universitas Negeri Surabaya, Muffin Ubi ini juga sebagai pemanfaatan ubi yang di Indonesia sendiri banyak dan kurang dalam pemanfaatan dan kreasi olahan. Selain sehat dan memiliki isi dan topping yang beraneka rasa Muffin Ubi juga mempunyai harga yang terjangkau dikalangan masyarakat, khususnya mahasiswa.</span></p>','Muffin|Ubi|Terjangkau',1,1,'2019-03-14 04:59:35','2019-03-14 22:04:29'),(993,0,'Es buah varian lumpur','2019 18060484013 Muhammad syeh noer seha.pdf',NULL,7020000,'<p>Usaha &ldquo;Es Buah Varian Lumpr&rdquo; &nbsp;adalah usaha yang sangat unik dan simpel. Usaha ini menghasilkan penghasilan yang lumayan. Sesuai dengan namanya, keunggulan dari usaha ini adalah dapat meningkatkan kesehatan bagi orang lain yang membeli. Dan kita sebagai penjual juga tidak perlu membutuhkan banyak waktu untuk membuatnya.Di area sekitar Surabaya saya sendiri sebagai mahasiswa yang masih baru tidak pernah mengetahui usaha ini sebelumnya.Namun biasanya usaha ini masih sangat diminati di daerah Bogor dan sekitarnya.Bisa dikatakan usaha semacam ini sudah langka, karena sebelumnya menurut saya dulu masih banyak orang yang membuat usaha semacam ini. Dengan proposal ini saya berharap bisa meningkatkan &nbsp;penjualan usaha ini, di Surabaya dan khususnya area yang dekat dengan kampus UNESA. Es ini memiliki banyak varian rasa, seperti pisang, pepaya, melon, dan dan semngka.Dengan varian rasa itu, kemudian buah buah tersebut di baluri dengan varian rasa yang menarik juga, seperti cokelat, valina, red velvet maupun green tea.Es ini termasuk jajanan yang murah tapi lezat dan menyehatkan.</p>','Es buah|Varian lumpur|Rasa|Topping',1,1,'2019-03-14 05:10:22','2019-03-20 04:10:53'),(994,0,'OREN LITERASI (Goresan Pena Literasi)','2019 16010034053 ILFI NUR DIANA.pdf',NULL,10384000,'<p>Oren Literasi adalah bentuk usaha dibidang jasa, dimana kami melayani bagi mereka yang memiliki bakat maupun minat dibidang menulis ataupun desain. Adapun program yang ditawarkan yaitu :</p>\r\n<p>&nbsp;</p>\r\n<p>1. Pelatihan Menulis, yang terdiri dari dua kategori yaitu fiksi dan nonfiksi</p>\r\n<p>&nbsp;</p>\r\n<p>2. Pelatihan desain, yang meliputi desain layout, cover dan editing.</p>\r\n<p>&nbsp;</p>\r\n<p>3. TBA (Taman Baca Anak), sebagai program pendukung dari kedua program tersebut.</p>\r\n<p>&nbsp;</p>\r\n<p>Untuk sasaran konsumen kami yaitu siswa-siswi dari tingkatan SD-SLTA. Untuk wilayah pemasarannya yaitu desa Randegansari dan sekitarnya. Kemudian, untuk harga yang kami tawarkan yaitu berbentuk paket-paket yang nantinya bisa dipilih oleh konsumen dengan jaminan karya mereka pasti diterbitkan dalam bentuk buku yang nantinya bisa dia miliki dan bisa dijual ke khalayak umum. Untuk mempromosikannya yaitu dengan membagikan brosur dan melalui media sosial.</p>','Literasi|Pelatihan|Menulis|DesainTBA |DESAIN|TBA (Taman Baca Anak)',2,1,'2019-03-14 05:13:13','2019-03-19 18:08:42'),(995,0,'Wood Station','2019 16020124006 Muhammad Rofi\'uddin.pdf',NULL,7586000,'<p>dalam usaha yang kami ciptakan ini, kami disini memanfaatkan kayu limbah bekas palet sebagai bahan dasarnya. dimana kayu tersebut kami olah sedemikian rupa, dengan memanfaatkan sedikit kemampuan dan kreatifitas yang kami miliki kita jaikan kayu ini sebagai produk kerajinan yang memiliki nilai jual dan fungsi</p>','PMW|WOOD STATION',4,1,'2019-03-14 05:19:28','2019-03-15 01:04:42'),(996,0,'Roll Lei (Roll Lemper Innovation)','2019 17010014055 SAKINAH MUSFIROH.pdf',NULL,14277000,'<p class=\"MsoNormal\" style=\"text-align: justify; text-indent: .5in; line-height: 115%;\"><span style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',serif; mso-ascii-theme-font: major-bidi; mso-hansi-theme-font: major-bidi; mso-bidi-theme-font: major-bidi; color: black; mso-themecolor: text1; background: white; mso-ansi-language: EN-US;\">Masakan Nusantara Indonesia </span><span lang=\"IN\" style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',serif; mso-ascii-theme-font: major-bidi; mso-hansi-theme-font: major-bidi; mso-bidi-theme-font: major-bidi; color: black; mso-themecolor: text1; background: white;\">adalah salah satu tradisi kuliner yang paling kaya </span><span style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',serif; mso-ascii-theme-font: major-bidi; mso-hansi-theme-font: major-bidi; mso-bidi-theme-font: major-bidi; color: black; mso-themecolor: text1; background: white; mso-ansi-language: EN-US;\">dan paling beragam </span><span lang=\"IN\" style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',serif; mso-ascii-theme-font: major-bidi; mso-hansi-theme-font: major-bidi; mso-bidi-theme-font: major-bidi; color: black; mso-themecolor: text1; background: white;\">di dunia, </span><span style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',serif; mso-ascii-theme-font: major-bidi; mso-hansi-theme-font: major-bidi; mso-b