 0px; text-decoration-style: initial; text-decoration-color: initial; float: none; word-spacing: 0px;\">,&nbsp;</span></span><a style=\"font-variant-ligatures: normal; font-variant-caps: normal; orphans: 2; text-align: start; widows: 2; -webkit-text-stroke-width: 0px; word-spacing: 0px;\" title=\"Lengkuas\" href=\"https://id.wikipedia.org/wiki/Lengkuas\"><span style=\"color: black; mso-themecolor: text1; background: white; text-decoration: none; text-underline: none;\">lengkuas</span></a><span style=\"background: white;\"><span style=\"font-variant-ligatures: normal; font-variant-caps: normal; orphans: 2; text-align: start; widows: 2; -webkit-text-stroke-width: 0px; text-decoration-style: initial; text-decoration-color: initial; float: none; word-spacing: 0px;\">,&nbsp;</span></span><a style=\"font-variant-ligatures: normal; font-variant-caps: normal; orphans: 2; text-align: start; widows: 2; -webkit-text-stroke-width: 0px; word-spacing: 0px;\" title=\"Jahe\" href=\"https://id.wikipedia.org/wiki/Jahe\"><span style=\"color: black; mso-themecolor: text1; background: white; text-decoration: none; text-underline: none;\">jahe</span></a><span style=\"background: white;\"><span style=\"font-variant-ligatures: normal; font-variant-caps: normal; orphans: 2; text-align: start; widows: 2; -webkit-text-stroke-width: 0px; text-decoration-style: initial; text-decoration-color: initial; float: none; word-spacing: 0px;\">,&nbsp;</span></span><a style=\"font-variant-ligatures: normal; font-variant-caps: normal; orphans: 2; text-align: start; widows: 2; -webkit-text-stroke-width: 0px; word-spacing: 0px;\" title=\"Kencur\" href=\"https://id.wikipedia.org/wiki/Kencur\"><span style=\"color: black; mso-themecolor: text1; background: white; text-decoration: none; text-underline: none;\">kencur</span></a><span style=\"background: white;\"><span style=\"font-variant-ligatures: normal; font-variant-caps: normal; orphans: 2; text-align: start; widows: 2; -webkit-text-stroke-width: 0px; text-decoration-style: initial; text-decoration-color: initial; float: none; word-spacing: 0px;\">,&nbsp;</span></span><a style=\"font-variant-ligatures: normal; font-variant-caps: normal; orphans: 2; text-align: start; widows: 2; -webkit-text-stroke-width: 0px; word-spacing: 0px;\" title=\"Kunyit\" href=\"https://id.wikipedia.org/wiki/Kunyit\"><span style=\"color: black; mso-themecolor: text1; background: white; text-decoration: none; text-underline: none;\">kunyit</span></a><span style=\"background: white;\"><span style=\"font-variant-ligatures: normal; font-variant-caps: normal; orphans: 2; text-align: start; widows: 2; -webkit-text-stroke-width: 0px; text-decoration-style: initial; text-decoration-color: initial; float: none; word-spacing: 0px;\">,&nbsp;</span></span><a style=\"font-variant-ligatures: normal; font-variant-caps: normal; orphans: 2; text-align: start; widows: 2; -webkit-text-stroke-width: 0px; word-spacing: 0px;\" title=\"Kelapa\" href=\"https://id.wikipedia.org/wiki/Kelapa\"><span style=\"color: black; mso-themecolor: text1; background: white; text-decoration: none; text-underline: none;\">kelapa</span></a><span style=\"background: white;\"><span style=\"font-variant-ligatures: normal; font-variant-caps: normal; orphans: 2; text-align: start; widows: 2; -webkit-text-stroke-width: 0px; text-decoration-style: initial; text-decoration-color: initial; float: none; word-spacing: 0px;\">&nbsp;dan&nbsp;</span></span><a style=\"font-variant-ligatures: normal; font-variant-caps: normal; orphans: 2; text-align: start; widows: 2; -webkit-text-stroke-width: 0px; word-spacing: 0px;\" title=\"Gula aren\" href=\"https://id.wikipedia.org/wiki/Gula_aren\"><span style=\"color: black; mso-themecolor: text1; background: white; text-decoration: none; text-underline: none;\">gula aren</span></a><span style=\"font-variant-ligatures: normal; font-variant-caps: normal; orphans: 2; text-align: start; widows: 2; -webkit-text-stroke-width: 0px; text-decoration-style: initial; text-decoration-color: initial; float: none; word-spacing: 0px;\"> ataupun rempah &ndash; rempah yang lain<span style=\"background: white;\">&nbsp;dengan diikuti penggunaan teknik-teknik memasak menurut bahan yang tentunya bisa lebih rumit sesuai daerah asal masakan tersebut.</span></span></span></p>\n<p class=\"MsoNoSpacing\" style=\"text-align: justify; line-height: 115%; tab-stops: 14.2pt;\"><span lang=\"IN\" style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',serif; mso-ascii-theme-font: major-bidi; mso-hansi-theme-font: major-bidi; mso-bidi-theme-font: major-bidi; color: black; mso-themecolor: text1; background: white; mso-ansi-language: IN;\"><span style=\"mso-tab-count: 2;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span>Sedangkan Fushion Food ialah penggabungan dari dua atau lebih teknik, penggabungan dari beberapa daerah atau juga dapat juga merupakan penggabungan bahan &ndash; bahan yang kemudian dimodifikasi sehingga menghasilkan suatu karya diatas piring yang tidak hanya memanjakan mata,tetapi juga mempunyai citarasa yang unik.</span> <span style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',serif; mso-ascii-theme-font: major-bidi; mso-hansi-theme-font: major-bidi; mso-bidi-theme-font: major-bidi; color: black; mso-themecolor: text1; background: white;\">L</span><span lang=\"IN\" style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',serif; mso-ascii-theme-font: major-bidi; mso-hansi-theme-font: major-bidi; mso-bidi-theme-font: major-bidi; color: black; mso-themecolor: text1; background: white; mso-ansi-language: IN;\">emper yang kami buat merupakan perpaduan antara ayam suwir yang dibumbui dengan rasa kari, rendang, dan gulai dan ditambahi dengan warna merah, oranye, dan hijau pada kuliat luar sebagai penggugah selera konsumen yang digulung dengan nasi gurih. </span><span lang=\"IN\" style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',serif; letter-spacing: -.05pt; mso-ansi-language: IN;\">Produ</span><span style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',serif; letter-spacing: -.05pt;\">k ini merupakan hasil akulturasi budaya antara negara jepang dan nusantara, karena terinspirasi dari sushi roll namun dengan cita rasa lain yang telah disebutkan.</span></p>','Innovation, jajanan, fushion',1,1,'2019-03-14 05:31:15','2019-03-15 21:18:20'),(997,0,'Guberoot','2019 17020114024 Larasati Maudina Fitriani.pdf',NULL,3410000,'<p>Dewasa ini para ibu merasa Bingung akan gizi anak-anak mereka. Terutama dalam memenuhi mineral Dan vitamin. Hal ini Dikarenakan anak-anak yang Hanya Mau makan beberapa jenis atau bahkan tidak menyukai sayuran Dan buah-buahan. Banyak sekali cara yang menawarkan solusi tersebut pada para ibu. Mulai dari mencampur dengan minuman kesukaannya, menyisipkannya pada telur dadar, Dan lain sebagainya. Namun, cara itu hanya berhasil beberapa persennya saja. Masih ada anak-anak yang tidak tertarik untuk makan sayur-sayuran Dan buah-buahan. Beragam sekali alasannya, mulai dari rasanya yang pahit, baunya yang aneh atau bahkan teksturnya.&nbsp;</p>\r\n<p>Untuk itu Kami memberikan solusi dengan menginovasikan antara Gulali dengan buah bit. Kami memilih untuk membuat Gulali karena anak-anak lebih suka dengan makanan manis dan berpenampilan menarik. Warna merah terang akan membuat anak-anak tertarik untuk memakannya tanpa menyadari bahwa bahan dasar dari Gulali tersebut adalah buah bit. Aroma khas yang dimiliki buah bit pun akan tersamarkan oleh aroma gula yang manis.&nbsp;</p>','Gulali beet root |Jajanan sehat anak|Guberoot sehat',1,1,'2019-03-14 05:33:05','2019-03-20 05:01:23'),(998,0,'ENDEAVOUR STD','2019 16020124012 AKHMAD ILHAM NURHADI.pdf',NULL,14366000,'<p class=\"MsoNoSpacing\" style=\"text-align: justify; line-height: 150%; tab-stops: 14.2pt;\"><span lang=\"IN\" style=\"font-size: 12.0pt; line-height: 150%; font-family: \'Times New Roman\',serif; letter-spacing: -.05pt; mso-ansi-language: IN;\">Endeavour Std atau dibaca Endavour Studio adalah usaha yang bergerak pada jasa desain grafis, Custom Lettering, Type Foundry dan Tees Design. Endavour Studio melayani paket jasa Desain Logo berdasarkan Client Base baik personal, UKM maupun Corporate. Paket Custom Lettering untuk logo, T-shirt maupun Packaging. Type Foundry merupakan usaha menjual font yang dibuat untuk dijual di online marketplace maupun Custom Type untuk corporate sebuah perusahaan</span></p>','PMWUNESA|ENDEAVOUR STD|PMW|ENDEAVOUR STD',4,1,'2019-03-14 05:35:56','2019-03-15 02:28:23'),(999,0,'GANCIQA','2019 16020124027 RACHMAHDANI QEISVARA WIJAYANTO.pdf',NULL,6549000,'<p class=\"MsoNormal\" style=\"line-height: 150%;\"><span style=\"font-size: 12.0pt; mso-bidi-font-size: 11.0pt; line-height: 150%; font-family: \'Times New Roman\',\'serif\';\">Ganciqa merupakan produk gantungan kunci yang didesain secara custom sesuai dengan keinginan konsumen atau menggunakan desain atau gambar berupa figur publik atau karakter fiksi yang memiliki banyak penggemar dengan nuansa budaya Jepang atau Korea. Dalam proses produksinya, tim kami hanya membuat desain atau gambarnya saja, sementara pembuatan atau proses produksinya diserahkan pada pihak jasa percetakan.&nbsp;Target pemasaran produk ini adalah remaja atau anak muda baik laki-laki maupun perempuan dengan rentang usia 18 hingga 24 tahun yang dapat berupa penggemar budaya Korea atau Jepang serta pengapresiasi seni dan desain di wilayah Indonesia, khususnya Surabaya dan sekitarnya. Produk ini dapat dipasarkan dengan online melalui situs jual-beli online atau sosial media, serta dengan cara offline yaitu dengan menawarkan langsung pada konsumen dan dengan mengikuti bazaar.</span></p>','Gantungan Kunci|Budaya Jepang|Budaya Korea|Custom',4,1,'2019-03-14 05:49:06','2019-03-15 01:53:42'),(1000,0,'GETUN MERON','2019 17010714041 Firsty Puspa Kiraina.pdf',NULL,5753000,'<p>GETUN MERON (Geprek Tuna Merah Merona) merupakan makanan olahan dari hasil laut yaitu Ikan Tuna yang memiliki kandungan gizi yang baik bagi kesehatan dan dipadukan dengan racikan sambal bumbu geprek yang akan membuat olahan hasil laut ini harus dinikmati. Produk ini dibuat dengan dipresto. Kemudian digoreng, yang mana sebelumnya telah diberi lapisan tepung pada bagian luarnya agar menambah cita rasa gurih dan crispy. Ikan tuna yang sudah matang langsung digeprek dengan menambahkan lapisan sambel diatasnya, sambel racikan spesial buatan kami.</p>','MAKANAN',1,1,'2019-03-14 05:53:30','2019-03-20 02:05:26'),(1001,0,'N3U (Nasi Uduk Ubi Ungu)','2019 16030234047 SITI KHOTIJAH.pdf',NULL,6000000,'<p class=\"Default\" style=\"text-align: justify; line-height: 115%;\"><span style=\"font-family: \'Times New Roman\',\'serif\';\">Nasi uduk merupakan makanan tradisional dari Indonesia yang begitu populer di kalangan masyarakat Betawi, salah satu suku di Indonesia yang banyak tersebar di wilayah Jawa Barat dan Jakarta. Pembuatan dari nasi ini juga jukup mudah dan bisa dilakukan di dapur sederhana. Nasi uduk juga dapat dikonsumsi oleh seluruh masyarakat karena kandungan gizi yang tinggi. Namun, karena kurangnya inovasi nasi uduk kurang begitu populer di luar wilayah Jawa Barat dan Jakarta. Untuk itu kami merencanakan suatu inovasi untuk menambah popularitas dan nilai jual dari nasi uduk yaitu dengan Nasi Uduk Ubi Ungu. Dikarenakan ubi jalar ungu yang sangat melimpah di Indonesia hanya dimanfaatkan sebagai makanan, ubi jalar ungu memiliki pigmen yang kuat dan merupakan antioksidan. Adapun tujuan dari bisnis kami adalah untuk meningkatkan nilai jual dan mempopulerkan nasi uduk di kalangan masyarakat terutama di mahasiswa Universitas Negeri Surabaya. </span></p>\n<p><span style=\"font-size: 11.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; mso-fareast-font-family: Calibri; mso-fareast-theme-font: minor-latin; mso-ansi-language: EN-US; mso-fareast-language: EN-US; mso-bidi-language: AR-SA;\">Dengan adanya produk N3U ini, ubi jalar ungu yang sangat banyak tersebar di Indonesia dapat termanfaatkan secara optimal dan nasi uduk lebih diminati berbagai kalangan karena adanya inovasi dari nasi uduk. Untuk penjualan produk kami memasarkannya di kantin kantin yang ada di beberapa fakultas di Unesa, kantin kejujuran di beberapa jurusan, serta tempat strategis lain dimana mahasiswa biasa berkumpul saat rehat seperti joglo dan gazzebo. Untuk persediaan produk kami akan membuatnya tidak terlalu banyak karena nasi uduk ini tidak mengandung bahan pengawet. Strategi promosi yang kami lakukan adalah dengan memanfaatkan media sosial yang ada seperti instagram, facebook, dan whatsapp. Produk N3U ini nantinya akan kami jual dengan harga perkemasan sebesar Rp. 15.000,00.</span></p>','Nasi Uduk|Ubi Jalar Ungu',1,1,'2019-03-14 06:09:33','2019-03-15 01:32:59'),(1002,0,'Viomy Music Course','2019 16021254026 Ayubputri Siaoni Andrianto.pdf',NULL,14080000,'<p>Viomy Music Course mengambil konsep usaha bidang jasa yang bergerak di dunia pendidikan seni musik yang memiliki jangkauan dalam kota Surabaya dan Sidoarjo dengan sasaran usaha adalah untuk masyarakat umum rentang usia 6 hingga 30 tahun. Ide usaha ini tercipta karena salah satunya tidak sedikit masyarakat yang ingin mengikuti kursus musik namun seringmengalami kendala soal jarak yang jauh dan waktu perjalanan yang lama</p>','Jasa|Musik',2,1,'2019-03-14 06:13:06','2019-03-20 04:41:00'),(1003,0,'Glowing With Character','2019 17020114027 VIRNANDA SELVYANA SAPUTRI.pdf',NULL,10300000,'<p>Make up yang menjadi suatu hal yang bersifat penting dalam menunjang penampilan seseorang, namun seringkali hal tersebut terkendala dengan keadaan ekonomi yang tidak mendukung. Maka dari itu disini mengambil sistem dimana konsumen bisa menentukan berapa nominal yang akan di keluarkan sesuai dengan kemampuannya.</p>','Glowing|Glowing |With |Character |Make Up',2,1,'2019-03-14 06:27:34','2019-03-14 06:41:49'),(1004,0,'BATEJUZI (Banana Stem Juice Bergizi)','2019 17010714069 Dian Erika Aristiani.pdf',NULL,7265000,'<p>BATEJUZI merupakan usaha dibidang minuman yang berbahan utama batang pisang yang diolah menjadi jus. Minuman dari batang pisang ini diolah dengan serangkaian proses pengolahan sehingga produk ini aman untuk dikonsumsi oleh konsumen. Usaha di bidang minuman yang bernama BATEJUZI (Banana Stem Juice Bergizi) memiliki banyak manfaat untuk kesehatan bagi segala rentang usia. Minuman ini dapat mencegah dan mengatasi berbagai penyakit. Usaha ini memiliki pesaing yang masih minim sehingga dapat memungkinkan untuk berkembang pada waktu yang akan datang.&nbsp;</p>\r\n<p>BATEJUZI memiliki keunggulan antara lain dapat mengatasi dan mencegah sembelit, dapat membantu program diet, mengatasi dan mencegah penyakit batu ginjal serta membantu penyembuhan penyakit diabetes.</p>','Minuman|Batang Pisang|Juice|Kesehatan|Bergizi|Manfaat',1,1,'2019-03-14 06:37:13','2019-03-15 18:52:40'),(1005,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,1,'2019-03-14 06:50:27','2019-03-18 14:29:00'),(1006,0,'PIPI BUNDA NAGA','2019 17020114048 Ninda Evrilia Devinta.pdf',NULL,3500000,'<p>Buah naga memiliki beberapa jenis yaitu buah naga putih, buah naga merah, dan buah naga super red. Akan tetapi pada pembuatan produk blush on ini menggunakan buah naga super red. Buah naga super red memiliki warna merah pada daging dan kulitnya. Warna merah yang cenderung keunguan memberi rasa ketertarikan tersendiri. Seperti dalam jurnal penelitian yang berjudul &ldquo;Bahwa Ekstrasi pigmen antosianin dari kulit buah naga dapat dijadikan sebagai alternatif pengganti pewarna sintetis&rdquo;. Buah naga digunakan untuk pewarna makanan selain itu juga dapat digunakan sebagai pewarna kain seperti hasil penelitian dari Yulianti dalam abstrak penelitiannya berjudul Ekstraksi dan Uji Kestabilam Pigmen Betasianin dalam kulit buah naga.</p>\n<p>Zat warna adalah zat atau campuran zat yang dapat digunakan pada sediaan kosmetik untuk mewarnai sediaan. Zat warna ini dapat pula digunakan sebagai bahan aktif dengan tujuan untuk melapisi luar tubuh manusia dengan bantuan zat lain.</p>\n<p>Produk blush on dipasaran cenderung menggunakan pewarna sintetik daripada pewarna alam sehingga dapat menimbulkan resiko efek samping yang lebih besar dan merugikan bagi konsumen. Berdasarkan hal tersebut, pembuatan ini akan dicoba menggunakan buah naga sebagai pewarna alami untuk blush on. Blush on dibuat dalam 3 bentuk yaitu cream, compact dan powder.</p>\n<p>&nbsp;</p>','Buah naga|Blush on|Kosmetik',4,1,'2019-03-14 07:01:29','2019-03-20 05:07:12'),(1007,0,'HB Cookies','2019 16040284067 Nur Hidayati Al Maghfiroh.pdf',NULL,5793000,'<p>BH cookies merupakan makanan pendamping anak-anak yang memiliki bentuk yang unik dan memiliki cita rasa yang disukai anak-anak dan terbuat dari bahan-bahan yang berkualitas tinggi.</p>','BH Cookies baby helaty cookies|beby healty cookies',1,1,'2019-03-14 07:13:12','2019-03-15 05:31:26'),(1008,0,'SPP (eS Pleret Pelangi)','2019 17020114014 Ristika Arlia Herawati.pdf',NULL,7740,'<p>proposal dengan judul SPP (eS Pleret Pelangi) ini produk dalam bidang oalahan minuman. eS Pleret Pelangi merupakan minuman khas kota Blitar yang terbuat dari tepung beras dan di siram kuah yang terbuat dari santan. agar lebih menarik konsumen ditambah dengan pewarna makanan yang warna-warni maka dari itu di sebut eS Pleret Pelangi dan cara membuatnya cukup mudah. selain itu juga rasanya enak dan segar, juga bergizi dan tidak mengandung bahan-bahan kimia yang berbahaya bagi tubuh kita. kami juga ingin mengenalkan minuman tradisional ini ke kalangan masyarakat saat ini yang mulai meninggalkannya karena muncul minuman yang lebih modern dan digandrungi oleh masyarakat sekarang utamanya para pelajar dan anak-anak terutamanya di kota-kota bersar seperti surabaya. kami melihat peluang yang cukup besar untuk membuat usaha ini dan mengembangkan untuk jangka waktu yang panjang dengan mempromosikan produk menggunakan media-media sosial yang tentunya masyarakat atau konsumen berminat untuk membeli produk ini. dengan cara pemasaran kami yang lebih modern ini kami mengharapkan banyak masyarakat yang mengetahuinya san membeli produk kami dan targetnya bisa laku khususnya di daerah surabaya. selain rasanya yang enak harganya juga murah dan ramah dikantong serta bisa dinikmati oleh berbagai kalangan.</p>','eS Pleret pelangi|Konsumen|pemasaran',1,1,'2019-03-14 07:35:43','2019-03-20 03:11:09'),(1009,0,'Glow Water Marble Case','2019 17020114010 Melvin Widyaningrum.pdf',NULL,4100000,'<p class=\"Default\" style=\"text-align: center; line-height: 115%;\" align=\"center\"><strong><span lang=\"DE\" style=\"color: windowtext; mso-ansi-language: DE;\">GLOW WATER MARBLE CASE</span></strong></p>\n<p class=\"MsoNormal\">&nbsp;</p>\n<p class=\"MsoNormal\" style=\"margin-left: 28.35pt; text-indent: 7.65pt; line-height: 115%; mso-layout-grid-align: none; text-autospace: none;\"><span style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',serif;\">Usaha yang diusung berjudul Glow Water Marble Case merupakan usaha yang bergerak dibidang produksi barang. Glow Water Marble Case merupakan hasil suatu seni menghias pelindung <em style=\"mso-bidi-font-style: normal;\">Handphone</em> dengan proses menggabungkan beberapa cat pewarna kuku ke dalam air. Sedangkan yang membedakan produk ini dengan produk lain yang sejenis terdapat pada mengutamakan penggunaan cat pewarna kuku yang berwarna neon yang didukung dengan warna &ndash; warna pastel. Warna neon yaitu warna yang memiliki pigmen warna yang kuat dan terkenal dengan warna &ndash; warna nyentrik seperti hijau neon, pink neon, kuning neon, merah neon, dan lain &ndash; lain. </span></p>\n<p class=\"MsoNormal\" style=\"margin-left: 28.35pt; text-indent: 7.65pt; line-height: 115%; mso-layout-grid-align: none; text-autospace: none;\"><span style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',serif;\">Keunikan dari usaha ini sangat jarang di area Surabaya, karena Glow Water Marble Case merupakan inovasi terbarukan. Produk ini dapat menjadi pilihan menarik para konsumen karena perpaduan dan gaya percampuran warna yang alami dan modern. Produk ini juga dapat digunakan pada semua jenis Handphone android yang telah merajalela di kalangan masyarakat saat ini. Produk ini memiliki manfaat bagi masyarakat luas. Pemilihan warna neon pada produk ini memiliki nilai guna sebagai pendeteksi letak <em style=\"mso-bidi-font-style: normal;\">Handphone</em> ketika berada di area gelap. Seperti ketika di dalam ruangan gelap atau di dalam tas. Karena seringkali masyarakat kesulitan mencari Handphone mereka ketika berada di ruangan gelap bahkan di dalam tas sekalipun. Selain itu, produk ini memiliki nilai guna yang utama yaitu untuk melindungi <em style=\"mso-bidi-font-style: normal;\">Handphone</em> para konsumen agar tidak lecet dan meminimalisir kerusakan ketika <em style=\"mso-bidi-font-style: normal;\">Handphone</em> konsumen mengalami benturan.</span></p>','GLOW WATER MARBLE CASE|neon|case',2,1,'2019-03-14 07:39:05','2019-03-16 21:04:29'),(1010,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,1,'2019-03-14 07:51:26','2019-03-14 21:23:27'),(1011,0,'Symbiyouth','2019 16020124042 Bagus aji pambudi.pdf',NULL,7200000,'<p>sebuah inovasi untuk menanggulangi permasalahan yang timbul di lingkungan para illustrator muda berbakat dalam ruang lingkup kampus, tidak hanya bertujuan untuk mengembangkan peluang usaha namun juga menciptakan ruang lingkup apresiasi terhadap semua pihak yang terlibat di dalam simbiosis ini, dan menjadikannya media pembelajaran untuk generasi mendatang.</p>','brand |inovation|clothing|art|design|creative|screenprinting',4,1,'2019-03-14 08:24:33','2019-03-20 02:59:54'),(1012,0,'Ponten Mlaku','2019 16010044081 Ibrahim Maulidia Salis.pdf',NULL,15000000,'<p class=\"MsoNormal\" style=\"text-align: justify;\"><span style=\"font-size: 12.0pt; line-height: 107%; font-family: \'Times New Roman\',serif;\">kami berinsiatif untuk memberikan terobosan baru dengan kearifan local yaitu Ponten Mlaku, dimana Ponten ini merupakan Bahasa khas Suroboyoan yang sering kita jumpai disudut ruang Surabaya. Adapun ponten ini sebagai solusi yang tepat untuk kampus Universitas Negeri Surabaya tercinta dalam mendukung sanitasi lebih baik. Kenapa ? karena produk Ponten Mlaku ini di desain menggunakan tingkat aksesibilitas untuk penyandang disabilitas, demi mewujudkan Universitas Negeri Surabaya menjadi kampus yang inklusi.di lain sisi mempunyai kebermanfaatan untuk digunakan saat ada acara-acara penting dikampus untuk mengurangi pengeluaran akibat sewa ponten yang dikelola oleh pihak lain, dan Unesa juga berperan dalam program pembangunan nasional SDG&rsquo;s 2030 poin 6 Air Bersih dan Sanitasi karena sangat penting untuk menciptakan sumber daya yang berkualitas. </span></p>\n<p>&nbsp;</p>\n<p class=\"MsoNormal\" style=\"text-align: justify;\"><span style=\"font-size: 12.0pt; line-height: 107%; font-family: \'Times New Roman\',serif;\">Kami menawarkan terobosan baru dengan menggunakan solar panel dalam menerangi cahaya pada dalam ponten, untuk menjaga kelestarian alam dan hemat energi listrik tentunya. Dan terlebih penting kami akan bekerja sama dengan stalkholders event-event yang ada di Surabaya dalam mempromosikan Ponten Mlaku ini, penggunakan media sosial untuk market ini masih sangat ampuh mengingat perusahaan maupun perseorangan akan lebih condong kearah medsos dalam mencari jasa penyewaan terlebih Ponten Mlaku. Kami akan membuat portal website, akun media sosial dalam marketing ini, kami percaya bisa berbicara banyak di Proses Seleksi PMW Unesa 2019 ini.</span></p>','toilet|ponten|sewa|produksi|pmw|unesa',2,1,'2019-03-14 08:32:14','2019-03-15 02:14:28'),(1013,0,'MUCHIKARI','2019 16040284091 Muhammad Faris Nurdien.pdf',NULL,6350000,'<p class=\"MsoNormal\" style=\"text-align: justify; line-height: 150%; tab-stops: 40.5pt 171.0pt;\"><span style=\"font-size: 12.0pt; line-height: 150%; font-family: \'Times New Roman\',serif;\">Makanan dengan model packaging yang menarik dan mudah untuk dibawa kemana-mana saat ini sedang diminati oleh masyarakat. alasannya karena praktis dan tidak membutuhkan tempat yang besar. kemasan yang simple juga memudahkan konsumen untuk memakan produk tersebut. Ditambah lagi mobilitas masyarakat saat ini sangat tinggi sehingga sangat mendambakan semuanya serba praktis begitu juga dengan makanan. Terutama tempat makan atau produsen yang membuka jasa <em style=\"mso-bidi-font-style: normal;\">delivery order. </em>Pasti sangat banyak diminati karena mobilitas yang tinggi dan aktivitas yang begitu padat membuat seseorang terkadang malas untuk pergu walau untuk membeli makan. </span></p>\n<p class=\"MsoNormal\" style=\"text-align: justify; line-height: 150%; tab-stops: 40.5pt 171.0pt;\"><span style=\"font-size: 12.0pt; line-height: 150%; font-family: \'Times New Roman\',serif;\"><span style=\"mso-tab-count: 1;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span>MUCHIKARI merupakan konsep makanan cepat saji dengan kemasan yang praktis tanpa dan menggunakan kemasan bowl kertas. Produk makanan ini berisikan nasi putih ditambah jamur tiram dan ayam yang disaos asam manis yang dimasak dengan rasa sedikit pedas, mengikuti trend makananan saat ini. tetapi kami tidak menyediakan saos dengan tingkatan pedas. Kami hanya membuat satu rasa pedas tetatapi tetap tidak terlalu pedas juga. Jadi rasanya masih standart bisa dirasakan semua kalangan yang suka pedas maupun tidak. Jika ingin lebioh pedas bisa juga ditambahkan saos yang telah disediakan. Saos asam manis merupakan saos yang selalu disenangi oleh segala kalangan. penggunaan jamur dan ayam merupakan suatu menu yang sudah familiar dan disukai oleh banyak orang oleh karena itu untuk mendampingi nasi putih, dual auk itu sangat cocok digabungkan. Selain mengenyangkan juga rasanya enak. </span></p>','makanan|jamur|ayam|saos asam manis|nasi|murah|enak',1,1,'2019-03-14 10:11:48','2019-03-15 04:25:03'),(1014,0,'Macaroni Bento','2019 17030654081 Faola Firnanda.pdf',NULL,11632000,'<p><strong>\"Macaroni Bento\"</strong></p>\n<p><strong>ABSTRAK</strong></p>\n<p>&nbsp;</p>\n<p class=\"MsoBodyText\" style=\"text-align: justify; text-indent: 36.0pt; line-height: 115%; margin: 0cm 50.7pt .0001pt 55.4pt;\">Usaha MACARONI BENTO merupakan usaha yang berkecimpung dibidang makanan. Usaha ini dilatarbelakangi oleh kebutuhan mahasiswa dan gaya hidup mahasiswa ketika sedang mengerjakan tugas, dimana biasanya mereka suka memakan cemilan sambil mengerjakan tugas baik malam hari maupun siang hari. Dari peristiwa ini tim kami memilki ide untuk membuat bisnis MACARONI BENTO. Dimana dalam usaha ini pembeli bisa memperoleh rasa macaroni yang tidak seperti biasannya. Di bisnis ini memudahkan pembeli untuk memilih rasa tradisional apa yang mereka sukai dengan level pedas yang mereka inginkan. MACARONI BENTO menawarkan tiga jenis rasa tradisonal, yaitu rasa rendang, rasa soto, dan rasa rasa kari yang bisa dipesan sesuai level pedas yang konsumen inginkan. Sasaran usaha kami adalah seluruh masyarakat yang ada di Surabaya, khususnya mahasiswa-mahasiswi yang ada di Surabaya. Jika usaha ini berkembang target usaha kami adalah meluaskan bisnis dengan menerima pesanan dari luar kota Surabaya. Selain itu jika bisnis ini berkembang kami akan<span style=\"mso-spacerun: yes;\">&nbsp; </span>mengembangkan bisnis ini dengan menambah varian MACARONI BENTO seperti rasa bakso, rujak, dll. Keungguulan bisnis ini adalah harga sesuai dengan budget yang dimiliki konsumen dengan tekstur macaroni yang gurih dan renyah yang hadir dengan rasa tradisional, kemudian pengemasan yang dibuat elegan dengan klip sehingga walapun sudah dibuka MACARONI BENTO mlempem dan sangat efektif dan efisien dimakan saat berpergian, mengerjakan tugas, dan kumpul keluarga ataupun teman. Tantangan dalam usaha ini adalah banyak pesaingnya seperti online shop yang membuka usaha serupa karena produk mudah ditiru terutama online shop yang telah memiliki brand/nama yang cukup terkenal di masyarakat.</p>','Macaroni|Pedas|Rasa rendang|Rasa soto|Rasa kari',1,1,'2019-03-14 10:35:50','2019-03-20 05:32:07'),(1015,0,'Sambel Netizen Mantab','2019 16010044018 Silvia Valentina Tri Hastuti.pdf',NULL,7000000,'<p>Masyarakat Indonesia merupakan penikmat sambal, tak heran jika sambal merupakan salah satu hal yang tidak dapat dilupakan saat menyantap suatu masakan. Sambal Netizan Mantab merupakan pilihan yang tepat bagi masyarakat yang ingin menikmati berbagai varian sambal dengan harga yang terjangkau.</p>','SAMBAL',1,1,'2019-03-14 11:47:32','2019-03-16 01:28:05'),(1016,0,'FC Mentoring (Franklin Clinton\'s Mentoring)','2019 16020124040 Mohammad Salman Al Farisi.pdf',NULL,2793500,'<p>FC Mentoring merupakan sebuah program yang dibuat untuk fungsi pendidikan atau edukasi khusus tentang seni khususnya tentang drawing, disini kami akan melatih skill dari para costumer yang ingin meningkatkan kreatifitas mereka dengan pengetahuan yang sudah kami pelejari, tidak hanya itu kami juga berpengalaman dalam bidang seni khususnya dalam hal peningkatan seni, kami pun juga tidak bersifat monoton dalam mengajarkan cara menggambar dengan teknik drawing karena kami juga akan lebih mengarahkan pada seni kontemporer atau seni yang muncul pada masa ini.</p>','Art|Mentoring|Education|Drawing|Skills|Creatifity|Knowledge|Experience',4,1,'2019-03-14 11:56:36','2019-03-15 03:35:57'),(1017,0,'Marquisa Jam Si Kuning yang Kaya akan Vitamin C','2019 17010644074 NURIL MUFIDAH.pdf',NULL,6700000,'<p><span style=\"line-height: 115%;\"><span style=\"font-family: \'Times New Roman\', serif;\"><span style=\"font-size: 16px; letter-spacing: -0.0666667px;\">Marquisa Jam Si Kuning yang Kaya akan Vitamin C</span></span></span></p>\n<p><span style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',serif; mso-fareast-font-family: Calibri; letter-spacing: -.05pt; mso-ansi-language: IN; mso-fareast-language: EN-US; mso-bidi-language: AR-SA;\">Markisa atau nama latinnya Passiflora adalah buah yang memiliki banyak biji kecil yang mempunyai rasa asam. Biasanya markisa ini ditemukan di kawasan dataran rendah atau kawasan dengan iklim hangat. Manfaat buah Markisa mengandung banyak antioksidan, mengurangi serangan asma, menurunkan berat badan, sumber serat untuk tubuh, dan membantu tidur lebih nyenyak dan masih banyak manfaat lainnya. Selai markisa </span><span style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',serif; mso-fareast-font-family: Calibri; mso-ansi-language: IN; mso-fareast-language: EN-US; mso-bidi-language: AR-SA;\">merupakan sebuah inovasi dan kreativitas dari bahan pangan yang sebagian besar tidak terlalu disukai karena bentuk dari bahan panga<a name=\"_GoBack\"></a>n tersebut jarang untuk dimanfaatkan orang-orang. </span><span lang=\"EN-US\" style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',serif; mso-fareast-font-family: Calibri; mso-ansi-language: EN-US; mso-fareast-language: EN-US; mso-bidi-language: AR-SA;\">Alasan dalam pemberian nama produk ini adalah </span><span style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',serif; mso-fareast-font-family: Calibri; mso-ansi-language: IN; mso-fareast-language: EN-US; mso-bidi-language: AR-SA;\">di</span><span lang=\"EN-US\" style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',serif; mso-fareast-font-family: Calibri; mso-ansi-language: EN-US; mso-fareast-language: EN-US; mso-bidi-language: AR-SA;\">karena</span><span style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',serif; mso-fareast-font-family: Calibri; mso-ansi-language: IN; mso-fareast-language: EN-US; mso-bidi-language: AR-SA;\">kan<span style=\"letter-spacing: -.05pt;\"> mungkin jarang pengusaha rumahan menggunakan nama usahanya dalam bahasa Inggris. Adapun manfaat usaha bagi masyarakat adalah memiliki banyak peluang untuk usaha membuat selai markisa karena jarang ada usaha yang membuat selai dari buah asam yang satu ini. </span></span><span lang=\"EN-US\" style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',serif; mso-fareast-font-family: Calibri; mso-ansi-language: EN-US; mso-fareast-language: EN-US; mso-bidi-language: AR-SA;\">Dalam pengolahan </span><span style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',serif; mso-fareast-font-family: Calibri; mso-ansi-language: IN; mso-fareast-language: EN-US; mso-bidi-language: AR-SA;\">Marquisa Jam</span> <span style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',serif; mso-fareast-font-family: Calibri; mso-ansi-language: IN; mso-fareast-language: EN-US; mso-bidi-language: AR-SA;\">ini, </span><span lang=\"EN-US\" style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',serif; mso-fareast-font-family: Calibri; mso-ansi-language: EN-US; mso-fareast-language: EN-US; mso-bidi-language: AR-SA;\">kami tidak lupa untuk tetap memperhatikan hal-hal penting dalam pengolahan sumber pangan. Karena, pemerintah juga telah menetapkan bahwa urusan tentang pangan telah tercantum dalam UU Nomor 7 Tahun 1996 dalam UU Pangan ini pengaturan masalah lebih komprehensif dari sebelumnya. UU ini mengatur soal ketahanan pangan hingga unit terkecil Rumah Tangga. Jadi setiap manusia pasti memiliki kebutuhan pangan yang sama, tergantung bagaimana mereka berusaha untuk mendapatkannya. Prospek pengembangan dan pengolahan </span><span style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',serif; mso-fareast-font-family: Calibri; mso-ansi-language: IN; mso-fareast-language: EN-US; mso-bidi-language: AR-SA;\">Marquisa</span> <span style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',serif; mso-fareast-font-family: Calibri; mso-ansi-language: IN; mso-fareast-language: EN-US; mso-bidi-language: AR-SA;\">Jam</span><span lang=\"EN-US\" style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',serif; mso-fareast-font-family: Calibri; mso-ansi-language: EN-US; mso-fareast-language: EN-US; mso-bidi-language: AR-SA;\"> di Indonesia</span><span style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',serif; mso-fareast-font-family: Calibri; mso-ansi-language: IN; mso-fareast-language: EN-US; mso-bidi-language: AR-SA;\"> ini mungkin masih jarang, karena banyak orang yang mungkin masih meremehkan buah yang berbiji banyak dan mempunyai rasa asam ini. Oleh karena itu kita berusha membuat sebuah produk yang berbeda dari yang lainnya.&nbsp;</span></p>','markisa|markisa kuning|selai|marquisa jam|asam|vitamin c|marquisa',1,1,'2019-03-14 12:45:12','2019-03-15 04:30:17'),(1018,0,'AnZay Exploding Box','2019 17020114013 ADINNIA YURISWANDHA.pdf',NULL,12000000,'<p class=\"MsoNoSpacing\" style=\"text-align: justify; line-height: 115%; tab-stops: 14.2pt;\"><em style=\"mso-bidi-font-style: normal;\"><span style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; letter-spacing: -.05pt;\">AnZay </span></em><em style=\"mso-bidi-font-style: normal;\"><span lang=\"IN\" style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; letter-spacing: -.05pt; mso-ansi-language: IN;\">Exploding </span></em><em style=\"mso-bidi-font-style: normal;\"><span style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; letter-spacing: -.05pt;\">Box</span></em><span style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; letter-spacing: -.05pt;\"> adalah kotak hadiah atau bingkisan berisi <em style=\"mso-bidi-font-style: normal;\">pop-up</em> foto, hadiah berukuran kecil dan tulisan ucapan selamat kepada yang terkasih. Momen wisuda,ulang tahun maupun perayaan apapun adalah sasaran pasar yang dituju. Karena dalam momen tersebut memberikan ucapan maupun hadiah merupakan hal yang sering terjadi.<em style=\"mso-bidi-font-style: normal;\"> AnZay </em></span><em style=\"mso-bidi-font-style: normal;\"><span lang=\"IN\" style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; letter-spacing: -.05pt; mso-ansi-language: IN;\">Exploding </span></em><em style=\"mso-bidi-font-style: normal;\"><span style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; letter-spacing: -.05pt;\">Box</span></em><span style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; letter-spacing: -.05pt;\"> adalah jawaban yang paling tepat karena baik ucapan maupun hadiah yang diberikan akan dikemas dalam bentuk wadah kotak yang apabila dibuka akan muncul berbagai hasil kreasi yang berisi kenangan-kenangan berupa foto, kartu ucapan hingga hadiah tersembunyi di dalamnya. <em style=\"mso-bidi-font-style: normal;\">AnZay </em></span><em style=\"mso-bidi-font-style: normal;\"><span lang=\"IN\" style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; letter-spacing: -.05pt; mso-ansi-language: IN;\">Exploding </span></em><em style=\"mso-bidi-font-style: normal;\"><span style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; letter-spacing: -.05pt;\">Box</span></em><span style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; letter-spacing: -.05pt;\"> bisa disimpan dalam jangka waktu yang lama sehingga ucapan maupun hadiah yang diberikan bisa dibuka kapanpun bila sewaktu-waktu ingin melihat lagi kejutan yang sama. Dana yang diajukan pada proposal ini senlai Rp. 12.000.000,00 dengan keterangan pada proposal.</span></p>','AnZay Exploding Box|hadiah',4,1,'2019-03-14 13:22:19','2019-03-20 01:13:38'),(1019,0,'MIE KENKONA TSURAI \"Mie Sehat dan Pedas\"','2019 17080554013 Marina Nur Cahyaningrum.pdf',NULL,6200000,'<p class=\"MsoNormal\" style=\"margin-left: 27.0pt; text-indent: 36.0pt; line-height: 115%; mso-layout-grid-align: none; text-autospace: none;\"><span style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\';\">MIE KENKONA TSURAI &ldquo;Mie Sehat dan Pedas&rdquo; merupakan produk makanan yang terbuat dari sayuran wortel dan sawi yang diambil sarinya untuk diolah menjadi sebuah mie dengan penambahan bumbu dapur yang memiliki kekhasan rasa dan membuat ketagihan dengan dilengkapi taburan ikan sebagai <em style=\"mso-bidi-font-style: normal;\">garnish</em>. Penamaan MIE KENKONA TSURAI &ldquo;Mie Sehat dan Pedas&rdquo; ini termotivasi dari tingginya euphoria masyarakat khususnya remaja terhadap mie pedas yang saat ini lagi memarak dikalangan pecinta pedas. Pada MIE KENKONA TSURAI ini memiliki karakteristik tersendiri yaitu bahan mie yang terbuat dari olahan sari wortel dan sawi untuk mensiasati masyarakat khususnya remaja yang tidak menyukai sayur. Selain itu mie olahan dari wortel dan sawi ini mempunyai kandungan zat yang bermanfaat bagi tubuh. Wortel dengan kandungan vitamin A dalam bentuk beta karoten yang baik untuk mata serta biotin yang merupakan salah satu vitamin B yang berperan penting dalam metabolisme lemak dan protein. Begitu pula dengan sawi yang kaya akan vitamin A, B, C, E, dan K. Manfaat lain dari sawi yang belum diketahui oleh masyarakat diantaranya untuk menurunkan kadar kolestrol jahat penyebab stroke atau penyakit jantung dan dapat menurunkan kadar gula darah penyebab kencing manis serta dapat menghambat penyakit kanker.</span></p>\n<p class=\"MsoNormal\" style=\"margin-left: 27.0pt; text-indent: 36.0pt; line-height: 115%; mso-layout-grid-align: none; text-autospace: none;\"><span style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\';\">Produk ini dikemas dalam paper bowl berukuran 650ml yang dilengkapi dengan tutup transparan dan sumpit. Dengan kemasan paper bowl yang ringan, aman, dan mudah dibawa sehingga dapat menarik konsumen untuk berminat membeli produk, serta penambahan sumpit kayu yang mempermudah konsumen untuk langsung mengonsumsinya.</span></p>','enter|MIE KENKONA TSURAI|makana|mie sehat|mie kenkona tsurai|wortel|sawi|makanan',1,1,'2019-03-14 13:28:16','2019-03-20 02:48:06'),(1020,0,'SAMI BOS (Sawut Milenial Buatan Orang Surabaya)','2019 17010714022 Erina Ashtye Mufidah.pdf',NULL,5536500,'<p class=\"MsoNormal\" style=\"margin-right: 7.05pt; text-align: justify; text-indent: 36.0pt; tab-stops: 354.4pt;\"><span lang=\"EN-US\" style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; mso-fareast-font-family: Ebrima;\">Inovasi usaha yang ingin kami wujudkan serta mendapatkan bimbingan lebih lanjut dari program PMW yaitu usaha dibidang kuliner (makanan) yang memiliki prospek baik di masa yang akan datang yang berjudul SAMI BOS (Sawut Milenial Buatan Orang Surabaya) yaitu makanan terbuat dari parutan singkong yang dicampur dengan gula jawa kemudian dikukus dan diselimuti oleh aneka macam tambahan rasa kekinian yang disukai oleh generasi milenial seperti pelajar dan mahasiswa. Tujuan kami membuat inovasi makanan sawut milenial ini untuk lebih mengembangkan dan mempopulerkan kembali makanan legendaris indonesia yang dapat dikonsumsi oleh berbagai pihak serta mengalihkan budaya konsumtif generasi milenial terhadap fast food menjadi beralih ke makanan yang memiliki kandungan gizi terdapat pada singkong itu sendiri. Latar belakang terciptanya makanan ini karena di Indonesia, singkong merupakan produksi hasil pertanian pangan terbesar ke dua setelah padi, sehingga singkong memiliki potensi sebagai bahan baku yang sering di produksi oleh masyarakat. Masyarakat membuat inovasi bahan baku singkong ini menjadi sawut. Sawut merupakan makanan legendaris yang memiliki kandungan gizi yang baik bagi tubuh. Sehingga dapat membantu pemerintah dalam memenuhi kebutuhan pangan masyarakat Indonesia. Selain itu, dengan adanya inovasi sawut milenial, kami berharap dapat membantu mitra masyarakat petani singkong yang berada di Mojokerto serta pedagang singkong yang berada di Surabaya untuk bekerjasama sehingga singkong yang biasanya langsung dijual setelah panen dapat diolah menjadi sebuah inovasi baru. Sawut milenial dapat dikonsumsi oleh semua kalangan khususnya generasi milenial yang pada saat ini memiliki daya tarik yang besar dengan makanan instan atau fast food dapat beralih ke produk makanan yang kami olah ini dengan kemasan yang menarik, praktis dan modern serta tidak mengandung bahan pengawet, tentunya juga memiliki harga yang terjangkau untuk kantong pelajar mulai dari tingkat sekolah dasar hingga perguruan tinggi. SAMI BOS merupakan jenis makanan inovasi baru dan belum memiliki daya saing, hal itu menjadi keunggulan tersendiri untuk prospek usaha kedepan. Untuk prospek pemasaran produk SAMI BOS ini juga dapat disajikan sebagai kuliner atau <em style=\"mso-bidi-font-style: normal;\">Coffee</em> <em style=\"mso-bidi-font-style: normal;\">break </em>di tempat-tempat rapat (<em style=\"mso-bidi-font-style: normal;\">meeting</em>), hotel, serta dapat dipasarkan melalui online, kegiatan kampus dan di Pusat Oleh-Oleh Surabaya. </span></p>','Sawut|Milenial|Kekinian|Inovatif|Kreatif|Surabaya|SAMIBOS|Makanan|Makanan\'|Makanan',1,1,'2019-03-14 13:29:19','2019-03-14 22:44:59'),(1021,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,1,'2019-03-14 13:34:07','2019-03-14 16:09:34'),(1022,0,'CICOL RUSAKE (Cireng Cocol Rujak Sambal Keju)','2019 17010014051 Aziziyah Munawaroh.pdf',NULL,2405000,'<p>cireng adalah makanan yang berasal dari sunda yang artinya adalah aci digoreng. Cireng pada umumnya hanya dicocol dengan bumbu yang seadanya. kami disini hadir dengan cireng yang dicocol dengan variansi bumbu yaitu bumbu rujak, sambal dan juga keju. yang pastinya akan digemari karena tidak membosankan dari segi rasa.</p>','cireng|rujak|sambal|keju',1,1,'2019-03-14 13:41:40','2019-03-15 00:23:03'),(1023,0,'Sanggar Edutrasi-G (Education Traditional Games)','2019 16010034001 Fryda Adella.pdf',NULL,15000000,'<p><span style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',serif; mso-fareast-font-family: SimSun; mso-ansi-language: EN-US; mso-fareast-language: EN-US; mso-bidi-language: AR-SA;\"><span lang=\"IN\" style=\"text-align: justify; text-indent: 1cm; font-size: 12pt; line-height: 150%;\">Sanggar EDUTRASI-G adalah sebuah tempat bermain yang dikemas dengan tema &ldquo;sehari tanpa gadget&rdquo;, pengunjung difasilitasi berbagai jenis permainan tradisional yang sekarang sudah mulai dilupakan oleh anak-anak karena kehadiran gadget canggih. </span><span style=\"text-align: justify; text-indent: 1cm; font-size: 12pt; line-height: 150%;\">Dalam program ini memanfaatan permainan jaman dahulu yang sudah mulai dilupakan dimasyarakat perkotaan, sehingga permainan tersebut tidak akan dilupakan kedepannya.&nbsp; </span><span lang=\"IN\" style=\"text-align: justify; text-indent: 1cm; font-size: 12pt; line-height: 150%;\">Selain untuk bermain, di sanggar Edutrasi-G juga berperan untuk mengedukasi pengunjung dalam permainan tersebut. Tujuannya selain untuk membangkitkan popularitas permainan tradisional juga berguna untuk membangkitkan jiwa kebersamaan, kerja sama, dan menumbuhkan sifat sosial. Hal ini sangat berperan dalam perkembangan anak.</span>Edutrasi-G merupakan permainan yang akan mengingatkan tentang permainan tradisional di tengah modernisasi yang saat ini terjadi di Indonesia. Edutrasi-G akan memperlihatkan bawha tanpa gadget ataupun smartphone bisa melahirkan kebahagiaan dan kepuasan tersendiri.</span><span style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',serif; mso-fareast-font-family: SimSun; mso-ansi-language: IN; mso-fareast-language: EN-US; mso-bidi-language: AR-SA;\">&nbsp;Permainan tradisional yang ditawarkan dalam Edutrasi-G antara lain enggrang, bakiak, congklak, dakon, ular tangga, gobak sodor.</span></p>','pendidikan|permainan tradisional|belajar dengan bermain|belajar dan bermain|sanggar',2,1,'2019-03-14 13:42:10','2019-03-14 23:59:41'),(1024,0,'MANDOR (MARTABAK NDOG BADER)','2019 17040254085 Haslinda Syafitri.pdf',NULL,6720000,'<p class=\"MsoNormal\" style=\"text-align: justify; text-justify: inter-ideograph;\"><span lang=\"EN-US\" style=\"font-size: 12.0pt; line-height: 115%;\">Martabak mungkin sudah tak asing lagi bagi masyarakat umum dengan </span></p>\n<p class=\"MsoNormal\" style=\"text-align: justify; text-justify: inter-ideograph;\"><span lang=\"EN-US\" style=\"font-size: 12.0pt; line-height: 115%;\">bentuknya yang kotak dan tekstur yg crispy. Bentuk martabak yang standar membuat kami ingin berinovasi membuat martabak yang mempunyai isi berbeda supaya lebih menarik dan menarik banyak konsumen. Oleh karena itu, kami terinspirasi untuk membuat ide kreatif berupa makanan khas kota Gresik, yaitu martabak dengan isi yang </span></p>\n<p class=\"MsoNormal\" style=\"text-align: justify; text-justify: inter-ideograph;\"><span lang=\"EN-US\" style=\"font-size: 12.0pt; line-height: 115%;\">tidak seperti biasa, yaitu isi telur bader yang juga merupakan makanan khas gresik. Dengan adanya inovasi ini kami berharap martabak khas gresik ia akan semakin dikenal dan digemari oleh masyarakat sehingga penjualannya pun akan naik.Pembuatan martabak ndog bader ( Mandor) dibuat selama 5 minggu dimulai dari persiapan hingga promosi ke masyarakat berupa penyebaran brosur, pendirian outlet, pembagian sampel, umumnya ke warga Greskk khususnya wisatawan yang berkunjung ke kota gresik .bertujuan memperkenalkan makanan khas gresik dengan inovasi isi dan cita rasa berbeda namun tetap tidak menghilangkan identitas makanan khas tersebut.</span></p>','KULINER|MAKANAN|MARTABAK|MAKANAN KHAS|MANDOR',1,1,'2019-03-14 13:43:11','2019-03-15 00:04:22'),(1025,0,'ONLEN NYAK! (ONDE-ONDE LELEH ENYAK!)','2019 17020084090 FARAH IKA DHAMAYANTI.pdf',NULL,7863000,'<p>ONLEN NYAK! adalah usaha yang bergerak dibidang makanan tradisional. ONLEN NYAK! merupakan inovasi unik dari jajanan pasar yakni onde-onde makanan khas mojokerto dengan tujuan melestarikan jajanan tersebut agar tetap eksis dan ada di kalangan masyarakat khususnya generasi milenial pada masa kini.</p>','ONLEN NYAK!',1,1,'2019-03-14 13:49:06','2019-03-15 06:03:21'),(1026,0,'KUPU UJANG (Kue Putu Ubi Jalar Ungu)','2019 17020114011 Novia Dwi Wahyuni.pdf',NULL,5688000,'<p class=\"MsoNormal\" style=\"text-align: justify; text-indent: 36.0pt;\"><span lang=\"EN-US\" style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\';\">Kegiatan usaha ini merupakan usaha pembuatan kue putu dengan campuran bahan dari ubi jalar ungu yang dipadukan dengan aneka rasa topping di atasnya. Kue putu merupakan salah satu makanan<span style=\"mso-spacerun: yes;\">&nbsp; </span>tradisional yang berasal dari Indonesia, khususnya di Pulau Jawa. Pemilihan ubi jalar ungu sebagai bahan utama pembuatan kue putu dikarenakan ubi jalar ungu<span style=\"mso-spacerun: yes;\">&nbsp; </span>mengandung karbohidrat dan nilai gizi. Kandungan karbohidrat ubi jalar ungu yang tinggi dijadikan sebagai sumber kalori. Selain itu kandungan ubi jalar ungu termasuk ke dalam golongan low glycemic index yaitu merupakan jenis karbohidrat yang apabila dikonsumsi tidak akan meningkatkan kadar gula darah dalam tubuh secara drastis (Ginting et al., 2011).&nbsp;</span><span style=\"text-indent: 36pt; font-size: 12pt; line-height: 115%; font-family: \'Times New Roman\', serif;\">U</span><span lang=\"EN-US\" style=\"text-indent: 36pt; font-size: 12pt; line-height: 115%; font-family: \'Times New Roman\', serif;\">bi jalar ungu baik dikonsumsi oleh para penderita diabetes (Martiningsih dan Suyanti, 2011). Berdasarkan penelitian Marsono et al (2002), &nbsp;Ubi jalar ungu juga merupakan sumber vitamin dan mineral, vitamin yang terkandung dalam ubi jalar antara lain vitamin A, vitamin C, thiamin (vitamin B1), dan riboflavin. Sedangkan mineral dalam ubi jalar diantaranya adalah zat besi (Fe), fosfor (P), dan kalsium (Ca). Kandungan lainnya adalah protein, lemak, serat kasar, dan abu.&nbsp; Total kandungan antosianin bervariasi pada setiap tanaman dan berkisar antara 20 mg/100 g sampai 600 mg/100 g berat basah.</span> <span lang=\"EN-US\" style=\"text-indent: 36pt; font-size: 12pt; line-height: 115%; font-family: \'Times New Roman\', serif;\">Total kandungan antosianin ubi jalar ungu adalah 519 mg/100 g berat basah (Meyer, 1982).Produk yang akan dibuat dalam kegiatan ini adalah kue putu dari ubi jalar ungu dengan aneka rasa dan topping. Topping berupa keju, coklat, matcha, kismis, messes, dan susu kental manis.</span></p>','KUE PUTU',1,1,'2019-03-14 13:51:02','2019-03-15 13:33:22'),(1027,0,'Ayam Petelur Hasilkan Omset Puluhan Juta Rupiah','2019 17010664200 Ahmad Aldy Hisbullah.pdf',NULL,14895000,'<p>Budidaya ayam petelur merupakan kegiatan usaha bisnis yang sangat menjanjikan. Manfaat atau peran telur ayam sebagai kebutuhan konsumsi manusia sangatlah banyak, sehingga tak heran masyarakat di Indonesia bahkan hampir seluruh dunia menjadikan telur ayam sebagai bahan pokok untuk segala kebutuhan. Harga kebutuhan&nbsp; ekonomi di Indonesia relatif menetap, bahkan sering naik dikala waktu tertentu seperti hari-hari besar, oleh karena itu pemerintah mendukung sepenuhnya pemasok kebutuhan ekonomi, sehingga tidak sampai melakukan impor dari negara lain. Seiring berkembangnya era revolusi industri saat ini diharapkan untuk mengolah segala sumber daya alam secara higienis dan cepat sebagai bentuk persaingan global. Untuk itu tujuan proposal PMW kami ini bertujuan untuk ikut serta mengembangkan pertumbuhan ekonomi berdaya saing menciptakan inovasi-inovasi yang terbaru dan modern dengan hasil yang sangat memuaskan.</p>','Ayam petelur|Fermentasi|Modern',5,1,'2019-03-14 14:06:28','2019-03-19 01:59:08'),(1028,0,'Gubook Panas (Guide Book Pop Up Ttraditional Games)','2019 16010034010 Risa Salamatul Insani.pdf',NULL,15000000,'<p class=\"p16\" style=\"margin-bottom: 0pt; margin-top: 0pt; text-align: justify; line-height: 150%;\"><span style=\"mso-spacerun: \'yes\'; letter-spacing: -0.0500pt; font-size: 12.0000pt; font-family: \'Times New Roman\';\">Penciptaan</span><span style=\"mso-spacerun: \'yes\'; letter-spacing: -0.0500pt; font-size: 12.0000pt; font-family: \'Times New Roman\';\">&nbsp;buku&nbsp;pop&nbsp;up&nbsp;yang&nbsp;berisikan&nbsp;tentang&nbsp;panduan&nbsp;bermain&nbsp;permainan&nbsp;tradisional</span><span style=\"mso-spacerun: \'yes\'; letter-spacing: -0.0500pt; font-size: 12.0000pt; font-family: \'Times New Roman\';\">,&nbsp;manfaat&nbsp;permainan&nbsp;tradisional&nbsp;dan&nbsp;asal&nbsp;permainan&nbsp;tradisional&nbsp;ini&nbsp;didesain&nbsp;dengan&nbsp;gambar&nbsp;illustrasi&nbsp;dan&nbsp;pop&nbsp;up&nbsp;yang&nbsp;sangat&nbsp;menarik&nbsp;bagi&nbsp;anak-anak&nbsp;sehingga&nbsp;menimbulkan&nbsp;minat&nbsp;belajar&nbsp;bagi&nbsp;mereka.&nbsp;Gambar&nbsp;illustrasi&nbsp;pada&nbsp;buku&nbsp;&nbsp;juga&nbsp;membantu&nbsp;memperjelas&nbsp;isi&nbsp;buku&nbsp;serta&nbsp;menggambarkan&nbsp;cara-cara&nbsp;bermain&nbsp;permainan&nbsp;tradisional&nbsp;sehingga&nbsp;memudahkan&nbsp;anak-anak&nbsp;terutama&nbsp;yang&nbsp;belum&nbsp;lancar&nbsp;membaca&nbsp;untuk&nbsp;memahami&nbsp;buku&nbsp;ini.</span></p>\n<p class=\"p16\" style=\"margin-bottom: 0pt; margin-top: 0pt; text-align: justify; line-height: 150%;\"><span style=\"mso-spacerun: \'yes\'; letter-spacing: -0.0500pt; font-size: 12.0000pt; font-family: \'Times New Roman\';\">Produksi</span><span style=\"mso-spacerun: \'yes\'; letter-spacing: -0.0500pt; font-size: 12.0000pt; font-family: \'Times New Roman\';\">&nbsp;buku&nbsp;ini&nbsp;merupakan&nbsp;suatu&nbsp;upaya&nbsp;kami&nbsp;untuk&nbsp;melestarikan&nbsp;permainan&nbsp;tradisional&nbsp;di&nbsp;masa&nbsp;millennial&nbsp;ini,&nbsp;dengan&nbsp;</span><span style=\"mso-spacerun: \'yes\'; letter-spacing: -0.0500pt; font-size: 12.0000pt; font-family: \'Times New Roman\';\">melihat&nbsp;</span><span style=\"mso-spacerun: \'yes\'; letter-spacing: -0.0500pt; font-size: 12.0000pt; font-family: \'Times New Roman\';\">fenomena&nbsp;perubahan&nbsp;aktivitas&nbsp;anak-anak&nbsp;Indonesia&nbsp;yang&nbsp;lebih&nbsp;mengenal&nbsp;permainan&nbsp;modern&nbsp;di&nbsp;gadget</span><span style=\"mso-spacerun: \'yes\'; letter-spacing: -0.0500pt; font-size: 12.0000pt; font-family: \'Times New Roman\';\">&nbsp;atau&nbsp;games&nbsp;online.&nbsp;</span><span style=\"mso-spacerun: \'yes\'; font-size: 12.0000pt; font-family: \'Times New Roman\';\">Game&nbsp;pada&nbsp;gadget&nbsp;menimbulkan&nbsp;sifat&nbsp;individual,&nbsp;karena&nbsp;kebanyakan&nbsp;game&nbsp;pada&nbsp;gadget&nbsp;tidak&nbsp;menggunakan&nbsp;fitur&nbsp;untuk&nbsp;berinteraksi&nbsp;dengan&nbsp;lawan&nbsp;main.&nbsp;Jika&nbsp;ada&nbsp;itu&nbsp;pun&nbsp;hanya&nbsp;sekedar&nbsp;melalui&nbsp;layar&nbsp;gadget.&nbsp;</span><span style=\"font-size: 12pt; font-family: \'Times New Roman\'; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">yang&nbsp;membuat&nbsp;mereka&nbsp;asyik&nbsp;sendiri&nbsp;dengan&nbsp;dunianya.&nbsp;Kecerdasan&nbsp;kognitif&nbsp;anak&nbsp;memang&nbsp;berkembang&nbsp;pesat&nbsp;dengan&nbsp;gadget,&nbsp;tapi&nbsp;secara&nbsp;moral&nbsp;dan&nbsp;spiritualnya&nbsp;kurang.&nbsp;Kecerdasan&nbsp;motorik&nbsp;juga&nbsp;bisa&nbsp;terkena&nbsp;imbasnya&nbsp;karena&nbsp;anak&nbsp;menjadi&nbsp;malas&nbsp;berkeringat.&nbsp;Bila&nbsp;begitu,&nbsp;risiko&nbsp;obesitas&nbsp;pun&nbsp;dapat&nbsp;menghampiri.&nbsp;soliter,&nbsp;anti-sosial,&nbsp;malas&nbsp;bergerak,&nbsp;atau&nbsp;hanya&nbsp;terpaku&nbsp;pada&nbsp;teman-teman&nbsp;dunia&nbsp;maya&nbsp;di&nbsp;situs&nbsp;jejaring&nbsp;social&nbsp;</span><span style=\"font-size: 12pt; font-family: \'Times New Roman\'; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">M</span><span style=\"mso-spacerun: \'yes\'; letter-spacing: -0.0500pt; font-size: 12.0000pt; font-family: \'Times New Roman\';\">aka&nbsp;disinilah&nbsp;peranan&nbsp;permainan&nbsp;tradisional&nbsp;sangat&nbsp;penting&nbsp;dan&nbsp;perlu&nbsp;dilestarikan&nbsp;karena&nbsp;permainan&nbsp;tradisional&nbsp;memiliki&nbsp;banyak&nbsp;nilai&nbsp;postif&nbsp;yang&nbsp;baik&nbsp;bagi&nbsp;pengembangan&nbsp;intelektual,&nbsp;emosi,&nbsp;sosial,dan&nbsp;kepribadian&nbsp;anak&nbsp;salah&nbsp;satunya&nbsp;dengan&nbsp;menciptakan&nbsp;buku&nbsp;panduan&nbsp;permainan&nbsp;tradisional</span></p>\n<p class=\"p16\" style=\"margin-bottom: 0pt; margin-top: 0pt; text-align: justify; line-height: 150%;\"><span style=\"mso-spacerun: \'yes\'; letter-spacing: -0.0500pt; font-size: 12.0000pt; font-family: \'Times New Roman\';\">Produk&nbsp;seperti&nbsp;ini</span><span style=\"mso-spacerun: \'yes\'; letter-spacing: -0.0500pt; font-size: 12.0000pt; font-family: \'Times New Roman\';\">&nbsp;masih&nbsp;jarang&nbsp;sekali&nbsp;beredar&nbsp;di&nbsp;pasaran</span><span style=\"mso-spacerun: \'yes\'; letter-spacing: -0.0500pt; font-size: 12.0000pt; font-family: \'Times New Roman\';\">,&nbsp;apalagi&nbsp;dengan&nbsp;bentuk&nbsp;gambar&nbsp;pop&nbsp;up&nbsp;yang&nbsp;timbul</span><span style=\"mso-spacerun: \'yes\'; letter-spacing: -0.0500pt; font-size: 12.0000pt; font-family: \'Times New Roman\';\">,&nbsp;s</span><span style=\"mso-spacerun: \'yes\'; letter-spacing: -0.0500pt; font-size: 12.0000pt; font-family: \'Times New Roman\';\">ehingga&nbsp;merupakan&nbsp;suatu&nbsp;peluang&nbsp;bagi&nbsp;kami&nbsp;untuk&nbsp;menciptakan&nbsp;buku&nbsp;seperti&nbsp;ini&nbsp;disamping&nbsp;melestarikan&nbsp;budaya&nbsp;Indonesia&nbsp;di&nbsp;era&nbsp;milenial&nbsp;ini.&nbsp;Buku&nbsp;ini&nbsp;nantinya&nbsp;akan&nbsp;disebarkan&nbsp;di&nbsp;seluruh&nbsp;Indonesia&nbsp;dengan&nbsp;tujuan&nbsp;agar&nbsp;warga&nbsp;Indonesia&nbsp;mencintai&nbsp;dan&nbsp;menghargai&nbsp;budayanya&nbsp;sendiri,&nbsp;bahkan&nbsp;warga&nbsp;negara&nbsp;asing&nbsp;yang&nbsp;sangat&nbsp;mencintai&nbsp;budaya&nbsp;Indonesia&nbsp;diharapkan&nbsp;memiliki&nbsp;minat&nbsp;untuk&nbsp;membaca&nbsp;buku&nbsp;ini.&nbsp;</span></p>','buku|pop up|permainan tradisional',5,1,'2019-03-14 14:11:47','2019-03-17 17:22:13'),(1029,0,'\"BURP-EATO\" Burrito Wrap','2019 17020084069 Randy Diego.pdf',NULL,5500000,'<p>Usaha makanan berupa&nbsp;<em>Buritto&nbsp;</em>yang memiliki dua varian rasa yaitu manis (selai dan buah) dan asin (daging) dengan harga terjangkau dan rasa yang sesuai lidah masyarakat Indonesia</p>','BURITTO',1,1,'2019-03-14 14:19:44','2019-03-15 06:34:47'),(1030,0,'BOOMERANG','2019 17010644194 Tirza Mawarti Wibowo.pdf',NULL,3637000,'<p>BOOMERANG adalah klepon kekinian yang isian klepon kekinian nya berisi rasa yang sedang terkenal saat ini, klepon kekinian juga di taburi dengan varian yang berbeda dari biasa nya. BOOMERANG juga memilik arti agar pembeli dapat kembali setelah merasakan klepon kekinian dengan membeli yang lebih banyak lagi.</p>','BOOMERANG|Klepon Kekinian',1,1,'2019-03-14 14:21:54','2019-03-15 01:46:30'),(1031,0,'Balera (Bubble Aloe Vera)','2019 17080554068 Velia Eka Rahmawati.pdf',NULL,10000000,'<p>Susu Aloe Vera (Lidah Buaya) merupakan minuman segar yang memiliki banyak manfaat untuk kesehatan. Minuman ini dapat memberikan&nbsp; inovasi baru yang bervariasi dengan&nbsp; kombinasi Aloe Vera di dalamnya.&nbsp; Manfaat Aloe Vera (Lidah Buaya) untuk kesehatan yaitu dapat mempercepat penyembuhan penyakit pada kulit karena memiliki kandungan zat antioksidan. (Liputan 6.com). Akan tetapi,&nbsp; Aloe Vera (Lidah Buaya) terkenal memiliki rasa yang pahit didalamnya. Sehingga, inovasi yang dapat diberikan yaitu dengan menciptakan suatu produk minuman yang memiliki tampilan menarik yang bervariasi dengan kombinasi berbagai rasa yang menarik.</p>\r\n<p>Tujuan dibuatnya produk ini adalah&nbsp; agar konsumen dapat menikmati Aloe Vera (Lidah Buaya) dengan tidak merasakan&nbsp; rasa pahit pada rasa Aloe Vera. Ide usaha ini dapat tercipta karena terinspirasi dari tumbuhan Aloe Vera (Lidah Buaya) yang dapat dimanfaatkan dalam pengobatan tradisional di sejumlah negara. Salah satu nya yaitu di China, Aloe Vera&nbsp; &nbsp; (Lidah Buaya) dapat digunakan sebagai pengobatan penyakit jamur. Sedangkan di negara bagian barat Aloe Vera (Lidah Buaya) dapat digunakan dalam industri kosmetik, farmasi, dan makanan. Salah satu bagian yang dapat dimanfaatkan dari Aloe Vera (Lidah Buaya) yaitu terdapat pada bagian gel yang diperoleh dari sel-sel di tengah daun. Pemilihan bahan Aloe Vera (Lidah Buaya) sebagai salah satu bahan dasar utamanya yaitu karena memiliki banyak manfaat untuk kesehatan dan bahan bakunya tidak sulit untuk didapatkan.</p>\r\n<p>Berdasarkan hasil riset di pasar, produk yang akan ditawarkan ini dapat dibandingkan dengan produk lain yang sejenis dengan menentukan harga yang sesuai dengan harga yang sesuai dengan kondisi yang ada di pasar. Produk ini ditujukan kepada semua kalangan masyarakat. Pemasaran produk ini dapat dilakukan secara dengan menjual secara langsung (Direct Promotion) dan penjualan secara online melalui berbagai media sosial seperti Whatsapp, Facebook dan Instagram. Sehingga, dari berbagai inovasi yang bervariasi maka dapat tercipta&nbsp; sebuah produk baru yang layak untuk dijual dan dikembangkan di lingkungan masyarakat pada umumnya.</p>','Susu|Aloe vera (lidah buaya) |Minuman',1,1,'2019-03-14 14:25:30','2019-03-20 03:52:25'),(1032,0,'Jeztik','2019 17020104046 Wakhda Nurmafazah.pdf',NULL,10000000,'<p>Kain batik merupakan salah satu warisan budaya Indonesia yang perlu dilestarikan agar tidak hilang seiring berkembangnya zaman. Kain batik identik digunakan dalam acara formal. Seiring berkembangnya zaman modern, kain batik terkesan dianggap kuno. Anak milenial masa kini lebih cenderung menyukai pakaian jeans. Sehingga ketika dipakai dalam acara formal terkesan kurang sopan. Oleh karena itu, kami mencoba mengombinasikan pemikiran tersebut dengan menggabungkan jaket jeans dan kain batik. Tetap terkesan modern, formal dan tentunya melestarikan warisan budaya Indonesia.</p>','Jaket|Jeans|Batik|Sandang|Jaket jeans',4,1,'2019-03-14 14:56:21','2019-03-19 23:13:57'),(1033,0,'FABULOUS (Flower Bouquet Blooming Marvelous)','2019 17020084010 Tita Kinasih.pdf',NULL,4376000,'<p>Fabulous adalah buket bunga yang terbuat dari kain flanel sebagai bahan utamanya dan menggunakan kertas khusus sebagai bouqetnya. keunikan dari buket bunga ini adalah menggunakan pot, gelas kaca, atau botol plastik yang di hias untuk meletakkan buket bunga sehingga buket bunga bisa di letakkan dengan rapi dan bisa di gunakan sebagai hiasan atau dekorasi ruangan. Memiliki berbagai keunggulan seperti kualitas yang bagus, varian yang menarik, lebih tahan lama dibandingkan dengan bunga asli, dan harga yang terjangkau untuk masyarakat khususnya para remaja sebagai konsumen sasaran.</p>','FABULOUS|buket bunga|buket bunga flanel|flanel',5,1,'2019-03-14 15:01:31','2019-03-15 06:02:15'),(1034,0,'RUMAHSAYA (Kerudung Mahasiswa UNESA Berkarya)','2019 17010714045 Aryuna Dini Rahayu.pdf',NULL,13198000,'<p><span lang=\"EN-US\" style=\"text-align: justify; text-indent: 48px; font-size: 12pt; line-height: 24px; font-family: \'Times New Roman\', serif; letter-spacing: 0.05pt;\">Kami mencermati tren kerudung</span><span lang=\"EN-US\" style=\"text-align: justify; text-indent: 48px; font-size: 12pt; line-height: 24px; font-family: \'Times New Roman\', serif; letter-spacing: -0.05pt;\">&nbsp;motif sedang berkembang saat ini. Atas alasan itulah, kami melihat adanya peluang dalam bisnis kerudung motif dan ingin memberikan inovasi berupa kerudung motif logo UNESA. Kerudung dipilih atas pertimbangan mayoritas warga UNESA memakai kerudung. Selain itu, kami melihat bahwa UNESA sudah banyak memproduksi souvenir khas seperti gantungan kunci, jam dinding, sampul buku dan lainnya, tetapi tidak dengan kerudung. Melalui produk kerudung ini juga, kami ingin mempromosikan UNESA hingga ke eksternal universitas dan menambah pendapatan universitas dengan melakukan pemasaran melalui KOPMA UNESA. Pelaksanaan inovasi kerudung ini kami memanfaatkan tenaga jasa kreator desain dalam membuat desain kerudung.&nbsp;</span><span style=\"text-align: justify; text-indent: 36pt; font-family: \'Times New Roman\', serif; font-size: 12pt; letter-spacing: -0.05pt;\">Melalui &ldquo;RUMAHSAYA&rdquo;, kami ingin</span><span style=\"text-align: justify; text-indent: 36pt; font-family: \'Times New Roman\', serif; font-size: 12pt; letter-spacing: -0.05pt;\">&nbsp;&nbsp;</span><span style=\"text-align: justify; text-indent: 36pt; font-family: \'Times New Roman\', serif; font-size: 12pt; letter-spacing: -0.05pt;\">menjawab kebutuhan civitas akademika UNESA akan kerudung yang berkualitas dan dapat dijadikan&nbsp;</span><em style=\"text-align: justify; text-indent: 36pt; font-family: \'Times New Roman\', serif; font-size: 12pt; letter-spacing: -0.05pt;\">trademark</em><span style=\"text-align: justify; text-indent: 36pt; font-family: \'Times New Roman\', serif; font-size: 12pt; letter-spacing: -0.05pt;\">&nbsp;produk UNESA.</span></p>','Kerudung, Inovasi, Lokal, UNESA, Berkarya',4,1,'2019-03-14 15:03:04','2019-03-15 02:30:42'),(1035,0,'SCURA','2019 16080574116 ANGDRIANI PUSPITA DEWI.pdf',NULL,6500000,'<p><span lang=\"IN\" style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',serif; mso-fareast-font-family: Calibri; letter-spacing: -.05pt; mso-ansi-language: IN; mso-fareast-language: EN-US; mso-bidi-language: AR-SA;\">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; SCURA merupakan produk industri kreatif yang menawarkan tanaman hias dengan media tanam dan kemasan yang unik, cantik, dan menarik. Media tanam yang digunakan scura yang bervariasi seperti batu hias, batu kerikil, pasir malang dan sekam menjadi keunikan tersendiri di tiap <em>layer</em> media tanamnya. Sesuai dengan konsep utama SCURA yaitu tanaman pada wadah tembus pandang/transparan, SCURA menggunakan wadah gelas kaca dan plastik, sehingga memudahkan pemiliknya menikmati tidak hanya estetika dari tanamannya, tetapi dari media tanam yang bervariasi di tiap layernya.</span></p>','tanaman hias|kaktus|sukulen|scura',4,1,'2019-03-14 15:10:13','2019-03-20 05:49:52'),(1036,0,'balerina','2019 17010644162 DEPRIANA DWININGRUM.pdf',NULL,5000000,'<p class=\"MsoNormal\" style=\"margin-left: 1.0cm; text-indent: 42.55pt; line-height: 115%;\"><span lang=\"EN-US\" style=\"font-family: \'Times New Roman\',serif;\">Sudah menjadi kebiasaan dimasyarakat mulai usia muda hingga dewasa yang semakin lalai terhadap pola konsumtif sehari-hari. Khususnya pada produk makanan yang memiliki cita rasa pedas, hal ini menyebabkan jumlah pengkonsusmsi makanan pedas menjadi lebih banyak. Apalagi dengan perkembangan teknologi menyebabkan perkembangan makanan yang bercita rtasa pedas menjadi lebih diminati dan menjadi fanatik bagi orang-orang yang menyukai makanan pedas. Namun dengan peminat yang banyak terkadang membuat si konsumen melupakan mafaat yang ia dapatkan setelah menyantap makanan pedas dan akhirnya berimbas ke kesehatan. Dalam modernisasi yang bisa dikatakan terlalu berlebihan sehingga kita terlalu latah menyalahkan semuanya tanpa memberikan solusi terhadap permasalahan ini. Kami menawarkan solusi melayani latahnya pola konsumsi makanan yang bercita rasa pedas, bukan untuk menghilangkan namun meminimalisir dampak negatifnya. Hal ini semata juga karena kepedulian kami terhadap kesehatan utamanya, juga ekonomi pada tujuan akhirnya. Aspek kesehatan yakni khasiat bahan-bahan yang kami gunakan, khususnya belalang yang memiliki khasiat tinggi dan baik untuk dikonsumsi. Bukan hanya menciptakan produk yang kreatif dan <span style=\"mso-spacerun: yes;\">&nbsp;</span>inovasi makanan yang baru, semata untuk memberikan dampak yang lebih luas lagi dibidang sosial dan ekonomi. </span></p>\n<p class=\"MsoNormal\" style=\"margin-left: 1.0cm; text-indent: 42.55pt; line-height: 115%;\"><span lang=\"EN-US\" style=\"font-family: \'Times New Roman\',serif;\">Begitu banyak manfaat dari progam wirausaha barang yang kami usulkan. Tidak semata kesehatan yang dapat teratasi, namun sosial ekonomi diharapkan akan tergerak ke arah kebaikan bagi masyarakat. Bukan pula hanya penyakit dapat ditekan penyebarannya, namun juga pas di kantong pembeli. Harga yang kami tawarkan diharapkan dapat membantu perekonomian dan meminimalisir pengangguran yang ada. Sebab bila usaha ini berhasil dan berkembang maka masalah pengangguran dapat teratasi dengan lapangan pekerjaan. Selain itu dengan adanya program kewirausahaan diharapkan akan membuat mahasiswa menjadi lebih aktif dan membuat terobosan terobosan baru agar bisa berkembang dan bertahan di peradaban jaman yang semakin berkembang. </span></p>\n<p class=\"MsoNormal\" style=\"margin-left: 1.0cm; line-height: 115%;\"><strong style=\"mso-bidi-font-weight: normal;\"><span lang=\"EN-US\" style=\"font-family: \'Times New Roman\',serif;\">&nbsp;</span></strong></p>','BALERINA|BELALANG',1,1,'2019-03-14 15:37:43','2019-03-20 05:53:26'),(1037,0,'PUCING','2019 17081194068 Andika Radyasasmita.pdf',NULL,5000000,'<p>Di era sekarang ini banyak masyarakat yang mengeluhkan terkait terlalu banyak tempat penyimpanan barang sehingga pemakaian tas tersebut tidak efektif karena fungsi yang berbeda-beda. Pucing hadir dalam rangka untuk memberikan para pengguna kenyamanan dan keefektifan tempat penyimpanan barang tersebut dengan menggunakan berbagai fungsi tas yang berbeda-beda. Terinspirasi dari alam dan budaya sekitar menjadikan usaha ini focus untuk memproduksi kebutuhan gaya hidup didalam maupun diluar ruangan seperti tas serbaguna yang keseluruhan bahannya menggunakan kain alami. Pembuatannya pun dilakukan secara detail dengan memilih bahan pilihan yang dibuat dengan bahan non-polyester sehingga mengurangi penggunaan plastik dalam tas ini serta dijahit dengan menuangkan grafis original yang dicetak oleh kami. Tren yang relatif menimbulkan suatu hal baru menjadikannya pilihan karena memiliki banyak fungsi yang memudahkan penggunanya untuk membawa keperluannya.</p>','bag|canvas',4,1,'2019-03-14 15:44:19','2019-03-20 06:07:10'),(1038,0,'Bucin Siwon (Budak cinta Singkong Pawon)','2019 16040284050 lenny Lestari.pdf',NULL,12,'<p class=\"MsoNormal\" style=\"text-align: justify;\"><span style=\"font-size: 12.0pt; mso-bidi-font-size: 11.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\';\">Indonesia dikenal sebagai negara yang mengkonsumsi nasi sebagai makanan pokok utama untuk memenuhi kebutuhan karbohidrat. Namun, masyarakat Indonesia juga banyak mengkonsumsi makanan ringan dalam kehidupan sehari-hari. Seiring globalisasi dan modernisasi, makanan ringan yang bermunculan di Indonesia semakin beragam. Rasa yang enak, dan gurih menjadi tolak ukur utama dalam peminatan makanan ringan. Salah satu zat yang dapat meningkatkan rasa enak dan gurih pada makanan ialah Monosodium Glutamat (MSG). Sehingga MSG menjadi materi esensial yang banyak digunakan oleh industri pangan. Padahal dilansir dari helium.com, MSG masuk dalam kategori excitotoxin atau neurotoksin. Jika dikonsumsi secara lama dapat merusak otak dan sistem saraf. Sementara dilansir dari detik.com berdasarkan data dari Chemical Economics Handbook 2015, Indonesia merupakan negera kedua pengkonsumsi MSG terbanyak di Asia. Dengan konsumsi MSG yang besar, meningkatkan risiko gangguan kesehatan bagi masyarakat Indonesia semakin besar. MSG yang berperan dalam menciptakan rasa enak dan gurih ini dapat digantikan dengan bumbu-bumbu alami tradisional. Makanan yang menggunakan bumbu tradisional sebagai pengganti MSG dapat menurunkan risiko yang disebabkan oleh MSG. </span></p>\n<p class=\"MsoNormal\" style=\"text-align: justify;\"><span style=\"font-size: 12.0pt; mso-bidi-font-size: 11.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\';\"><span style=\"mso-tab-count: 1;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span>Oleh karena itu, kami ingin memperkenalkan makanan ringan tradisional yang tidak kalah enak dan gurih serta tanpa MSG, yaitu keripik singkong pawon. Keripik singkong adalah makanan yang sudah tidak asing di lidah masyarakat Indonesia. Keripik singkong telah diminati masyarakat sejak zaman dahulu hingga saat ini. Keripik singkong pawon adalah inovasi dari keripik singkong yang diberi bumbu tradisional alami dengan rasa pedas yang khas, serta gurih yang membuat ketagihan. Dengan keripik singkong pawon ini, kami berharap masyarakat Indonesia dapat kembali menghidupkan makanan tradisional yang tidak kalah lezatnya, dari makanan zaman sekarang. Di samping itu, dalam segi kemasan, kami juga memberikan inovasi yang lebih modern, sehingga keripik singkong pawon ini tidak kalah tampilan luarnya dengan makanan modern. Dengan program PMW ini kami membutuhkan bimbingan usah agar keripik singkong pawon dapat membangkitkan minat masyarakat Indonesia terhadap makanan tradisional Indonesia yang alami, tanpa MSG, dan tidak memiliki risiko tinggi dalam menyebabkan penyakit.</span></p>','Keripik, Singkong, Camilan|keripik|singkong|camilan',1,1,'2019-03-14 16:05:54','2019-03-19 22:48:03'),(1039,0,'Garingan Vegan','2019 16010664068 Devi Diani Intan Izazi.pdf',NULL,9698000,'<p class=\"MsoNoSpacing\" style=\"margin-left: 36.0pt; text-align: justify; text-indent: -18.0pt; line-height: 115%; mso-list: l0 level1 lfo1; tab-stops: 14.2pt;\"><span style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; mso-fareast-font-family: \'Times New Roman\'; letter-spacing: -.05pt; mso-ansi-language: IN;\"><span style=\"mso-list: Ignore;\"><!-- [if gte mso 9]><xml>\r\n <o:OfficeDocumentSettings>\r\n  <o:AllowPNG/>\r\n </o:OfficeDocumentSettings>\r\n</xml><![endif]--><!-- [if gte mso 9]><xml>\r\n <w:WordDocument>\r\n  <w:View>Normal</w:View>\r\n  <w:Zoom>0</w:Zoom>\r\n  <w:TrackMoves/>\r\n  <w:TrackFormatting/>\r\n  <w:PunctuationKerning/>\r\n  <w:ValidateAgainstSchemas/>\r\n  <w:SaveIfXMLInv