g akan digoreng dengan system <em style=\"mso-bidi-font-style: normal;\">deep frying </em>agar dapat kering sempurna serta awet dalam janga waktu lama tanpa bantuan pengawet. Agar tidak mengurangi cita rasa, mesin <em style=\"mso-bidi-font-style: normal;\">spinner </em>digunakan untuk &lsquo;mengeringkan minyak&rsquo; dalam bawang merah dan kentang. Dalam pengolahan sayur bayam, sebelum dikeringkan dengan oven, terlebuh dahulu sayur bayam di<em style=\"mso-bidi-font-style: normal;\"> spray </em>dengan menggunakan <em style=\"mso-bidi-font-style: normal;\">olieve oil. </em>Setelah itu, tiga bahan tersebut dikemas menjadi satu.</span></p>\r\n<p class=\"MsoNoSpacing\" style=\"margin-left: 36.0pt; text-align: justify; text-indent: -18.0pt; line-height: 115%; mso-list: l0 level1 lfo1; tab-stops: 14.2pt;\"><span style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; mso-fareast-font-family: \'Times New Roman\'; letter-spacing: -.05pt; mso-ansi-language: IN;\"><span style=\"mso-list: Ignore;\">1)<span style=\"font: 7.0pt \'Times New Roman\';\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span></span><span style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; letter-spacing: -.05pt; mso-ansi-language: IN;\">Keunggulan Kegiatan :</span></p>\r\n<p>&nbsp;</p>\r\n<p class=\"MsoNoSpacing\" style=\"margin-left: 72.0pt; text-align: justify; text-indent: -18.0pt; line-height: 115%; mso-list: l1 level1 lfo2; tab-stops: 14.2pt;\"><span style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; mso-fareast-font-family: \'Times New Roman\'; letter-spacing: -.05pt; mso-ansi-language: IN;\"><span style=\"mso-list: Ignore;\">1)<span style=\"font: 7.0pt \'Times New Roman\';\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span></span><span style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; letter-spacing: -.05pt; mso-ansi-language: IN;\">Merupakan produk inovasi 