=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; letter-spacing: -.05pt; mso-ansi-language: IN;\">Dikemas secara praktis dan tahan lama</span></p>\r\n<p class=\"MsoNoSpacing\" style=\"margin-left: 72.0pt; text-align: justify; text-indent: -18.0pt; line-height: 115%; mso-list: l1 level1 lfo2; tab-stops: 14.2pt;\">&nbsp;</p>\r\n<p>&nbsp;</p>','Makanan Garingan Vegan|Makanan sehat',1,1,'2019-03-14 16:16:02','2019-03-15 06:41:38'),(1040,0,'BON - PEACE (ABON JANTUNG PISANG)','2019 17040254107 Bella Septian Ananda.pdf',NULL,8799000,'<p class=\"MsoNoSpacing\" style=\"margin-top: 12.0pt; text-align: justify; tab-stops: 14.2pt;\"><span lang=\"EN-US\" style=\"font-size: 12.0pt; font-family: \'Times New Roman\',\'serif\'; letter-spacing: -.05pt;\">Abon merupakan salah satu makanan sehat pelengkap dan cocok sebagai camilan sehat yang higeienis dan ekonomis. Dewasa ini abon menjadi salah satu makanan yang laris di pasaran selain kandungan protein serta vitamin didalamnya yang memiliki manfaaat bagi tubuh. Abon banyak diolah dengan bahan baku daging ayam</span><span lang=\"IN\" style=\"font-size: 12.0pt; font-family: \'Times New Roman\',\'serif\'; letter-spacing: -.05pt; mso-ansi-language: IN;\"> ataupun daging sapi</span><span lang=\"EN-US\" style=\"font-size: 12.0pt; font-family: \'Times New Roman\',\'serif\'; letter-spacing: -.05pt;\">. Bon-Peace merupakan produk makanan alternative yang kami ajukan sebagai sebuah inovasi dari abon dengan <span style=\"mso-spacerun: yes;\">&nbsp;</span>mengolah jantung pisang menjadi sebuah olahan makanan (abon ) yang memiliki nilai jual dengan tampilan yang berbeda. </span><span lang=\"IN\" style=\"font-size: 12.0pt; font-family: \'Times New Roman\',\'serif\'; letter-spacing: -.05pt; mso-ansi-language: IN;\">Produk yang tim kami buat adalah menu olahan</span><span lang=\"EN-US\" style=\"font-size: 12.0pt; font-family: \'Times New Roman\',\'serif\'; letter-spacing: -.05pt;\"> jatung</span><span lang=\"IN\" style=\"font-size: 12.0pt; font-family: \'Times New Roman\',\'serif\'; letter-spacing: -.05pt; mso-ansi-language: IN;\"> pisang yang menyehatkan dan ramah lingkungan, namun masih langka di pasaran. </span><span lang=\"EN-US\" style=\"font-size: 12.0pt; font-family: \'Times New Roman\',\'serif\'; letter-spacing: -.05pt;\">Jantung P</span><span lang=\"IN\" style=\"font-size: 12.0pt; font-family: \'Times New Roman\',\'serif\'; letter-spacing: -.05pt; mso-ansi-language: IN;\">isang yang mengandung karbohidrat cocok untuk konsumsi diet karena mengandung serat dan vitamin B6.</span><span lang=\"EN-US\" style=\"font-size: 12.0pt; font-family: \'Times New Roman\',\'serif\'; letter-spacing: -.05pt;\"> Selain itu pada produk ini memilki bahan dasar jinten putih yang sangat baik bagi kesehatan, karena didalam jinten mengandung vitamin A, Vit.C, asam folat, Vit.K, Magnesium dan lainnya</span><span lang=\"IN\" style=\"font-size: 12.0pt; font-family: \'Times New Roman\',\'serif\'; letter-spacing: -.05pt; mso-ansi-language: IN;\">. Sehingga sangat cocok untuk di konsumsi sebagai camilan maupun untuk gaya hidup diet bagi semua kalangan. </span><span lang=\"EN-US\" style=\"font-size: 12.0pt; font-family: \'Times New Roman\',\'serif\'; letter-spacing: -.05pt;\">Bon-Peace </span><span lang=\"IN\" style=\"font-size: 12.0pt; font-family: \'Times New Roman\',\'serif\'; letter-spacing: -.05pt; mso-ansi-language: IN;\">merupakan </span><span lang=\"EN-US\" style=\"font-size: 12.0pt; font-family: \'Times New Roman\',\'serif\'; letter-spacing: -.05pt;\">abon yang terbuat dari olahan jantung pisang yang kami kemas secara apik sehingga dapat menarik konsumen terutama bagi kalangan anak- anak hingga dewasa dan dapat menjadi prosepek bisnis abon yang menjanjikan. </span><span lang=\"IN\" style=\"font-size: 12.0pt; font-family: \'Times New Roman\',\'serif\'; letter-spacing: -.05pt; mso-ansi-language: IN;\">Produk ini berbeda dengan produk yang lain karena dalam produk ini mengkolaborasikan</span><span lang=\"EN-US\" style=\"font-size: 12.0pt; font-family: \'Times New Roman\',\'serif\'; letter-spacing: -.05pt;\"> sebuah bahan yang jarang diolah oleh masyarakat</span> <span lang=\"EN-US\" style=\"font-size: 12.0pt; font-family: \'Times New Roman\',\'serif\'; letter-spacing: -.05pt;\">agar </span><span lang=\"IN\" style=\"font-size: 12.0pt; font-family: \'Times New Roman\',\'serif\'; letter-spacing: -.05pt; mso-ansi-language: IN;\">menjadi sebuah makanan yang layak konsumsi namun tetap memperhatikan kandungan gizi di dalamnya.</span></p>','Makanan Sehat|Camilan Sehat|Inovasi Abon|Bisnis Abon',1,1,'2019-03-14 16:28:29','2019-03-14 23:29:00'),(1041,0,'TRAKTIR : Tas karakter anti bocor dari limbah sofa dan jas hujan','2019 17030174039 Firnanda Muharrima.pdf',NULL,5277900,'<p>TRAKTIR akronim dari tas karakter anti bocor dari limbah sofa dan jas hujan. Dimana produk ini berbahan baku limbah kain sofa dan jas hujan. Produk ini juga sangan unik, berkualitas, dan memiliki harga yang mudah dijangkau. Produk ini dapat digunakan dari kalangan anak-anak hingga orang dewasa. Karena memiliki desain yang elegan, produk ini sangat disukai oleh konsumen.</p>','Traktir|Industrikreatif|Pmw2019',4,1,'2019-03-14 16:30:53','2019-03-20 06:29:22'),(1043,0,'LUMPIA NAGASAKE ( Buah Naga, Salad, Keju)','2019 17040254030 Ririn Setiyowati.pdf',NULL,3900000,'<p>Dalam rangka mengembangkan keanekaragaman pangan yang mampu memenuhi kebutuhan masyarakat, maka kami memvariasikan lumpia dengan menggunakan kulit buah naga yang tidak terpakai sebagai bahan utama dalam pembuatan kulit lumpia. Sedangkan isi dari lumpia tersebut berisi buah-buahan. Kulit lumpia di buat mengunakan kulit buah naga agar dapat memanfaatkan warna dari kulit buah naga sebagai pewarna alami sebagai tekstur luar makanan lumpia.&nbsp;</p>','Makanan|Variasi|Kulit buah naga',1,1,'2019-03-14 16:34:12','2019-03-17 04:35:46'),(1044,0,'WIZEL','2019 16051204007 Sylvia Rahma.pdf',NULL,14500000,'<p>Bisnis online shop saat ini sangatlah berkembang pesat sehingga semakin banyaknya pesaing online shop yang bermunculan oleh sebab itu dibutuhkan pengenalan akan keinginan konsumen untuk mempengaruhi niat belanja di online shop. Variable dalam penelitian ini terdapat faktor dari produk, harga, dan promosi. Sampel konsumen yang diambil adalah 20 dengan menggunakan metode pengumpulan data dengan menggunakan kuesioner. Analisis data digunakan untuk analisis faktor. Dalam analisis ini dapat dilihat bahwa peminta konsumen untuk belanja di online shop dikarenakan mengikuti trend. Maka disarankan untuk pebisni online shop menawarkan produk yang sesuai dengan produk aktualnya.</p>','WIZEL',2,1,'2019-03-14 16:43:16','2019-03-19 17:49:18'),(1045,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,'2019-03-14 16:49:27','2019-03-14 16:49:27'),(1046,0,'BETA (Liebe Tasche Totebag Sajadah)','2019 17020504005 Arziah Anhar.pdf',NULL,6940000,'<p><span style=\"text-align: justify; text-indent: 7.7pt; font-family: Ebrima; font-size: 11pt;\">Totebag merupakan salah satu model tas jinjing berbentuk kotak dan terbuka. Namun jika melihat kedalam tas totebag yang biasa digunakan masyarakat, khususnya kaum muslim, tidak banyak dari mereka yang membawa alat sholat, begitu pula sajadah.&nbsp;</span><span lang=\"EN-US\" style=\"text-align: justify; text-indent: 7.7pt; font-size: 11pt; line-height: 16.72px; font-family: Ebrima;\">Sajadah merupakan alas yang digunakan kaum Muslim untuk menjaga kebersihan tempat shalat.&nbsp;</span><span lang=\"DE\" style=\"text-align: justify; text-indent: 7.7pt; font-size: 11pt; line-height: 16.72px; font-family: Ebrima;\">Namun, ketika kaum muslim beraktivitas diluar ruangan tak jarang merasa terbebani untuk membawa sajadah. Mereka beranggapan membawa sajadah dalam tas hanya akan membuat tas terasa berat, utamannya dalam tas totebag yang tidak memiliki banyak ruang didalamnya.&nbsp;</span><span style=\"text-align: justify; text-indent: 7.7pt; font-family: Ebrima; font-size: 11pt;\">BETA memiliki konsep 2in1 dimana sajadah dan totebag berada pada satu produk, sehingga ketika sedang tidak digunakan sebagai alas shalat, ia dapat berperan sebagai totebag itu&nbsp;</span><span style=\"text-align: justify; text-indent: 10.2667px; font-family: Ebrima; font-size: 11pt;\">sendiri. Didesain dengan motif simple dan pilihan warna-warna yang lembut membuat kesan minimalis pada totebag.</span></p>','Totebag|Sajadah|Muslim|2in1',4,1,'2019-03-14 16:53:54','2019-03-20 02:18:35'),(1047,0,'NUBITA (Nugget Umbi Talas)','2019 17010714024 Nanik Wahyuningsih.pdf',NULL,6125000,'<p>Proposal Rencana Usaha yang kami susun merupakan usaha di bidang makanan. Bahan dasar yang kami gunakan merupakan hasil pertanian yang berupa umbi-umbian, yakni talas yang merupakan komoditi yang paling sedikit dalam pengolahannya atau kurangnya inovasi dalam pengolahan. Selama ini penpengolahan talas hanya dijadikan sebagai kripik dan olahan makanan tradisional gethuk. Inovasi usaha yang kami buat merupakan inovasi usaha dalam bidang makanan yang menjadikan talas sebagai bahan utama pengganti tepung dalam pembuatan nugget. Usaha yang kami buat bernama NUBITA yang merupakan akronim dari Nugget Umbi Talas. Kami menyajikan NUBITA (Nugget Umbi Talas) dalam bentuk siap makan maupun frozen food sehingga memudahkan konsumen. Tidak hanya itu, packaging dari produk kami menggunakan desain yang kekinian sehingga memiliki daya tarik yang tinggi. NUBITA (Nugget Umbi Talas) merupakan bentuk makanan inovasi yang memiliki banyak manfaat, yaitu sebagai media untuk mengembangkan hasil pertanian, menjadi makanan oleh-oleh khas malang sehingga dapat meningkatkan penghasilan masyarakat, dsb. Bagi mahasiswa, NUBITA (Nugget Umbi Talas) dapat dijadikan makanan siap saji, mengingat banyaknya kegiatan mahasiswa ataupun dapat dijadikan cadangan makanan di tempat tinggalnya dengan cara memesan dalam bentuk frozen food. Bagi masyarakat secara umum, NUBITA (Nugget Umbi talas) memiliki banyak manfaat bagi kesehatan tubuh seperti mengatasi masalah pencernaan, menurunkan tekanan darah, baik untuk pengelihatan, penguatan sistem kekebalan tubuh, dsb. Selain itu masyarakat juga dapat menjalin kerjasama sehingga meningkatkan ekonomi masyarakat. Dalam jangka pendek, usaha kami ditujukan kepada mahasiswa UNESA dan masyarakat khususnya area surabaya sebab lokasi usaha kami berada di Surabaya. Dalam jangka menengah dan produksi yang konsisten NUBITA diharapkan akan menjadi oleh-oleh khas Malang mengingat bahan dasar pembuatan NUBITA berasal dari daerah tersebut, seiring dengan perkembangan usaha kami, akan berdampak pada peningkatan perekonomian masyarakat karena usaha kami dapat menciptakan lapangan pekerjaan baru bagi masyarakat. Adapun feedback yang didapat oleh Jurusan dan Universitas yaitu bertambahnya karya mahasiswa sehingga menambah motivasi terhadap mahasiswa lain untuk terus berkarya.</p>','Makanan|Inovasi|Nugget|Umbi|Talas',1,1,'2019-03-14 17:04:03','2019-03-14 22:23:43'),(1048,0,'JANCUCOK (Jamu Varian Susu, Coklat','2019 17020114026 Andriani Yovi Permatasari.pdf',NULL,6000000,'<p>Minuman tradisional (jamu) adalah obat yang berasal dari bahan tumbuh-tumbuhan yang dipergunakan sebagai pengobatan. Kegiatan Usaha ini merupakan pembuatan sebuah produk minuman, yakni kombinasi minuman tradisional (jamu) yang memiliki khasiat untuk kesehatan dengan bubuk susu dan bubuk coklat yang juga memiliki khasiat tersendiri, sehingga khasiat ini dapat dikombinasikan.</p>','Susu|Coklat|Jahe|Beluntas|Varian|Minuman|Tradisional|Jancucok',1,1,'2019-03-14 17:08:15','2019-03-20 04:07:57'),(1049,0,'Pentol Saos Naga','2019 17010644192 ARUM ASMORO RATNOSUMIRAT.pdf',NULL,4000000,'<p>Ini adalah pmw yang berjudul pentol saos naga. olahan ini hampir sama dengan pentol pentol yang lain. kami memakai tambahan buah naga karena harga buah naga sedang sangat anjlok jadi kami memanfaatkan momen ini.</p>','pentol',1,1,'2019-03-14 17:11:07','2019-03-15 05:48:35'),(1050,0,'Creamjus Ice Cream','2019 17051214051 Silmi Khashaish Fillah.pdf',NULL,4967000,'<p class=\"MsoNormal\" style=\"margin-bottom: .0001pt; text-align: justify; line-height: 150%; tab-stops: 14.2pt; border: none; mso-padding-alt: 31.0pt 31.0pt 31.0pt 31.0pt; mso-border-shadow: yes;\"><span style=\"font-size: 12.0pt; line-height: 150%; font-family: \'Times New Roman\',serif; mso-fareast-font-family: \'Times New Roman\';\">CreamJus Ice Cream merupakan produk ice cream yang terbuat dari buah dan susu. Namun yang dimaksud buah dan susu disini bukan hanya susu rasa buah biasa, tetapi susu yang di mix dengan 3 macam buah asli dan juga terdapat varian lain yaitu susu dengan potongan berbagai macam buah segar. Perpaduan antara susu dengan buah asli ini tentunya memiliki manfaat yang baik bagi tubuh. Perlu kita ketahui bahwa susu kaya akan kalsium dan fosfor dan buah buahan juga mengandung beraneka vitamin yang baik untuk kesehatan tubuh.</span></p>\n<p class=\"MsoNormal\" style=\"margin-bottom: .0001pt; text-align: justify; line-height: 150%; tab-stops: 14.2pt; border: none; mso-padding-alt: 31.0pt 31.0pt 31.0pt 31.0pt; mso-border-shadow: yes;\"><span style=\"font-size: 12pt; line-height: 150%; font-family: \'Times New Roman\', serif;\">Saat ini&nbsp; produk ice cream yang biasa dijual kebanyakan hanya ice cream dengan rasa susu dan buah biasa</span><span lang=\"EN-US\" style=\"font-size: 12pt; line-height: 150%; font-family: \'Times New Roman\', serif;\">,</span><span style=\"font-size: 12pt; line-height: 150%; font-family: \'Times New Roman\', serif;\"> masih jarang yang menjual produk ice cream dari buah asli atau dengan potongan buah segar.&nbsp; Selain itu produk ini juga memiliki manfaat yang baik bagi tubuh.&nbsp;</span><span style=\"font-family: \'Times New Roman\', serif; font-size: 16px;\">oleh karena itu kami berniat untuk menjual dan mengembangkan produk ini.</span></p>','creamjus ice cream|ice cream|creamjus',1,1,'2019-03-14 17:16:54','2019-03-16 02:11:39'),(1051,0,'TAKAYLI (Kotak Ayam Brokoli)','2019 17010014005 Bunga Sukmawangi.pdf',NULL,11000000,'<p>&nbsp;</p>\r\n<p style=\"margin: 0px 0px 10.66px; text-align: center; line-height: 150%;\" align=\"center\"><span lang=\"EN-US\" style=\"margin: 0px; line-height: 150%; font-family: \'Times New Roman\',serif; font-size: 16pt;\">ABSTRAK</span></p>\r\n<p style=\"margin: 0px 0px 10.66px; text-align: center; line-height: 150%;\" align=\"center\"><span lang=\"EN-US\" style=\"margin: 0px; line-height: 150%; font-family: \'Times New Roman\',serif; font-size: 12pt;\">Dalam Program Mahasiswa Kewirausahaan kali ini, kami menciptkan inovasi baru yang memadukan antara sayuran yang jarang sekali diminati oleh masyarakat dan makanan yang sudah tidak asing lagi di kalangan masyarakat. Keduanya adalah brokoli dan ayam, produk ini kami namakan Takayli (Kotak Ayam Brokoli). Sayuran yang satu ini memang jarang di minati oleh masyarakat, namun dengan mencampurnya dengan ayam besar kemungkinan camilan ini memiliki banyak peminat. Takayli ini terbuat dari bahan yang mengandung banyak manfaat bagi tubuh dan kesehatan manusia, seperti brokoli yang dapat mencegah terjadinya kanker, meyehatkan bagi jantung, anti-inflamasi, mencegah penuaan dini, baik bagi kesehatan tulang dan mata, mengurangi kolesterol, anti oksidan kuat serta dapat merawat kesehatan kulit. Brokoli juga mengandung banyak vitamin, seperti vitamin A, C, E, zat besi dan seng. Selain brokoli juga terdapat ayam yang mengandung protein. Untuk pemasarannya kami menggunakan media online dan offline. Untuk online kami mempromosikannya melalui akun media social, salah satunya Instagram. Pemesanannya melalui system <em style=\"mso-bidi-font-style: normal;\">pre-order</em> yang kami lakukan empat kali dalam sebulan, sedangkan untuk offline kami memasarkannya dengan cara membuka stan bazzar. Harga pasaran untuk Takayli sangat terjangkau yaitu Rp 7.000,00 yang dirasa cukup murah meriah. </span></p>\r\n<p>&nbsp;</p>','Brokoli, Olahan Brokoli,Ayam Brokoli|brokoli|ayam|ayam brokoli|olahan brokoli|camilan sehat|olahan ayam',1,1,'2019-03-14 17:33:19','2019-03-15 01:13:13'),(1052,0,'Es Kating (Es Cutting: Es Potong Selimut)','2019 17010664125 Intan Putri Asiyadi.pdf',NULL,10000000,'<p>Usaha Es Kating (Es Cutting: Es Potong Selimut) merupakan usaha yang unik dan menarik. Tidak seperti es potong pada umumnya, produk yang kami tawarkan merupakan bentuk baru dari Es potong yang sudah dikenal masyarakat luas. Kami mendesain Es kating sedemikian rupa agar menarik pembeli. Lapisan coklat yang biasanya membalut Es potong, kini kami desain dengan berbagai varian warna dan rasa. Sehingga bentuknya lebih menarik dan pembeli dapat menentukan selera rasa yang mereka inginkan. Untuk Es potongnya sendiri akan kami buat dengan bahan-bahan pilihan yang tentunya menyehatkan. Harapannya, dengan adanya Es kating ini masyarakat dapat memilih jajanan yang sehat dan tentunya dengan harga yang terjangkau. Sehingga mengurangi risiko penyakit yang disebabkan oleh jajanan yang tidak sehat. Target pemasaran kami adalah anak-anak, remaja, mahasiswa, serta orang dewasa yang menyukai Es kating. Distribusi produk yang kami tawarkan ini adalah dengan membuat gerobak Es kating yang akan kami letakkan di beberapa tempat yang strategis. Seperti, di depan sekolah-sekolah, di sekitar kampus dan di perkampungan. Penetapan harga produk kami sesuaikan dengan keunikan dan kandungan gizi yang ada pada produk kami. Kami akan menjual Es kating dengan harga mulai dari Rp 3.000,00 hingga Rp 5.000,00. Kami akan belajar&nbsp; bekerja keras, karena orang yang bekerja keras akan bisa melampaui orang cerdas jika dia berlari sekuat tenaga. Dengan demikian, kami siap untuk mendapat bimbingan dalam Program Mahasiswa Wirausaha ini. Kami ingin mengimplementasikan ide-ide kreatif. Menginovasi suatu produk yang berdaya guna dan dinikmati oleh masyarakat luas.</p>','Es kating|sehat|murah',1,1,'2019-03-14 17:33:45','2019-03-14 20:49:55'),(1053,0,'BOBOHO ( Bracelet of Boho )','2019 16020124021 Maulidiyah Dwi Anugrah Sari.pdf',NULL,5630000,'<p>Gelang merupakan produk aksesoris yang sering digunakan dan diminati oleh</p>\n<p>masyarakat. Pada era sekarang gelang bukan lagi sebagai aksesoris biasa, namun</p>\n<p>menjadi item pendukung penampilan dalam sehari- hari.</p>\n<p>Gelang Boho ini merupakan gelang yang bertemakan bohemian , yang identik</p>\n<p>dengan warna dan motif yang beragam. Dapat memadupadankan motif etnik,</p>\n<p>vintage dan hippis yang berwarna-warni. Produk ini dapat dipakai berbagai</p>\n<p>kalangan baik muda maupun tua, laki-laki maupun perempuan. Dalam kalangan</p>\n<p>masyarakat sendiri belum banyak yang memproduksi gelang yang bertemakan</p>\n<p>bohemian (boho), sehingga membuka peluang bagi wirausahawan.</p>\n<p>Dalam produk ini kami menggunakan manik-manik dan clay yang dibentuk</p>\n<p>sesuai kebutuhan desain.</p>','PMW|BOBOHO',4,1,'2019-03-14 17:34:55','2019-03-15 05:37:46'),(1054,0,'LUNIK (Lettering Unik)','2019 16020124016 Fitri Nurdiansyah.pdf',NULL,7505000,'<p class=\"MsoNormal\" style=\"margin-bottom: .0001pt; text-align: justify; text-indent: 36.0pt; line-height: 150%;\"><span lang=\"EN-US\" style=\"font-size: 12.0pt; line-height: 150%; font-family: \'Times New Roman\',serif;\">Dewasa ini seni rupa mengalami perkembangan yang sangat pesat, khususnya di bidang <em style=\"mso-bidi-font-style: normal;\">typography</em>. Salah satu cabang seni <em style=\"mso-bidi-font-style: normal;\">typography</em> yang banyak diminati oleh anak muda adalah <em style=\"mso-bidi-font-style: normal;\">lettering</em>. <em style=\"mso-bidi-font-style: normal;\">Lettering</em> merupakan seni melukis huruf yang seperti ini sedang banyak digandrungi. Umumnya <em style=\"mso-bidi-font-style: normal;\">lettering</em> diaplikasikan pada kertas</span><span style=\"font-size: 12.0pt; line-height: 150%; font-family: \'Times New Roman\',serif; mso-ansi-language: IN;\">, berangkat dari hal itu</span><span lang=\"EN-US\" style=\"font-size: 12.0pt; line-height: 150%; font-family: \'Times New Roman\',serif;\"> yang mendasari kami untuk </span><span style=\"font-size: 12.0pt; line-height: 150%; font-family: \'Times New Roman\',serif; mso-ansi-language: IN;\">menciptakan inovasi </span><span lang=\"EN-US\" style=\"font-size: 12.0pt; line-height: 150%; font-family: \'Times New Roman\',serif;\">bisnis yang menguntungkan yakni </span><span style=\"font-size: 12.0pt; line-height: 150%; font-family: \'Times New Roman\',serif; mso-ansi-language: IN;\">memberikan sentuhan <em style=\"mso-bidi-font-style: normal;\">lettering</em></span><span lang=\"EN-US\" style=\"font-size: 12.0pt; line-height: 150%; font-family: \'Times New Roman\',serif;\"> pada </span><span style=\"font-size: 12.0pt; line-height: 150%; font-family: \'Times New Roman\',serif; mso-ansi-language: IN;\">alat tulis untuk keperluan sehari-sehari bagi pelajar maupun umum, yakni desain buku pada <em style=\"mso-bidi-font-style: normal;\">notebook</em>, <em style=\"mso-bidi-font-style: normal;\">sketchbook dan bookmark (</em>pembatas buku)<em style=\"mso-bidi-font-style: normal;\">.</em>&nbsp;</span><em style=\"text-indent: 36pt;\"><span style=\"font-size: 12.0pt; line-height: 150%; font-family: \'Times New Roman\',serif; mso-ansi-language: IN;\">Notebook</span></em><span style=\"text-indent: 36pt; font-size: 12pt; line-height: 150%; font-family: \'Times New Roman\', serif;\">, <em>sketchbook dan bookmark</em> pada dasarnya desain yang digunakan monoton dan kurang menarik, <em>&nbsp;</em>u</span><span lang=\"EN-US\" style=\"text-indent: 36pt; font-size: 12pt; line-height: 150%; font-family: \'Times New Roman\', serif;\">ntuk mengikuti perkembangan pasar kami berusaha memberi sentuhan pada </span><em style=\"text-indent: 36pt;\"><span style=\"font-size: 12.0pt; line-height: 150%; font-family: \'Times New Roman\',serif; mso-ansi-language: IN;\">notebook</span></em><span lang=\"EN-US\" style=\"text-indent: 36pt; font-size: 12pt; line-height: 150%; font-family: \'Times New Roman\', serif;\"> dengan motif yang lebih <em>up to date</em>.&nbsp; </span><span style=\"text-indent: 36pt; font-size: 12pt; line-height: 150%; font-family: \'Times New Roman\', serif;\">Selain itu <em>lettering</em> yang digunakan bisa <em>custom</em> <em>manual</em> maupun <em>digital</em>.&nbsp;</span><span style=\"text-indent: 36pt; font-size: 12pt; line-height: 150%; font-family: \'Times New Roman\', serif;\">LUNIK (<em>Lettering</em> Unik)</span><span lang=\"EN-US\" style=\"text-indent: 36pt; font-size: 12pt; line-height: 150%; font-family: \'Times New Roman\', serif;\"> merupakan inovasi yang berdasarkan dengan </span><span style=\"text-indent: 36pt; font-size: 12pt; line-height: 150%; font-family: \'Times New Roman\', serif;\">perkembangan <em>notebook</em>, <em>sketchbook dan bookmark </em></span><span lang=\"EN-US\" style=\"text-indent: 36pt; font-size: 12pt; line-height: 150%; font-family: \'Times New Roman\', serif;\">yang terjadi dewasa ini. </span><span style=\"text-indent: 36pt; font-size: 12pt; line-height: 150%; font-family: \'Times New Roman\', serif;\">Sentuhan yang berbeda dan bisa dikembankan sesuai dengan kemauan <em>klien</em>, akan memberikan peluang bagi LUNIK untuk terus memajukan usahanya.</span></p>','LUNIK|Lettering|unik|custom',4,1,'2019-03-14 17:39:35','2019-03-15 01:27:36'),(1055,0,'COS BAG (Control Limbah  Plastik And Save The World)','2019 17040254007 Istiqomah Nur Azizah.pdf',NULL,8078000,'<p>ABSTRAK</p>\r\n<p>&nbsp;</p>\r\n<p>COS BAG merupakan usaha yang berkecimpung dibadang industri kreatif. Usaha ini dilatarbelakangi oleh banyaknya sampah plastik dilingkungan serta isu berlakunya kantong plastik berbayar untuk mengurangi 30% sampah pada tahun 2025. Dari peristiwa ini tim kami memilki ide untuk membuat bisnis COS BAG (Control Limbah &nbsp;Plastik And Save The World) dimana dalam usaha ini pembeli bisa tetap trendy serta menjaga kelangsungan dunia dari pencemaran lingkungan karena limbah kantong plastik yang sulit diuraikan. Selain itu dengan adanya Cos Bag masyarakat tidak perlu membeli kantong plastik setiap akan melakukan pembelian karena Cost Bg dapat dilakukan berulang kali. Target usaha kami adalah anak-anak, remaja dan orang dewasa sebab mereka semua adalah pelaku dalam jual beli. Keunggulan dari Cost Bag adalah dibuat dari bahan dasar yang ramah lingkungan dengan bentuk yang bervariasi, kreatif, lucu, kemudian menginovasikan barang yang kurang bernilai jual menjadi barang yang banyak digandrungi dengan pengemasan yang unik serta menarik yang efektif dan efisien bisa dipesan kapanpun dengan waktu yang cepat. Tantangan dalam usaha ini adalah belum terbiasanya masyarakat dalam menggunakan tas belanja yang ramah lingkungan karena sudah terbiasa menggunakan kantong plastik yang mudah dan praktis walaupun mengetahui fakta tentang bahayanya limbah plastik yang sulit diuraikan. Namun hal tersebut menjadikan kami semakin optimis untuk kedepannya dan berharap bisnis kami dapat sukses dengan konsistensi kualitas produk serta selalu melakukan perbaharuan setiap pergantian trend.</p>\r\n<p>&nbsp;</p>\r\n<p>Kata kunci : tas ramah lingkungan, alternatif pengganti kantong plastik, unik dan modern</p>','tas ramah lingkungan|alternatif pengganti kantong plastik|unik dan modern',4,1,'2019-03-14 17:40:27','2019-03-15 18:30:01'),(1056,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,1,'2019-03-14 17:40:47','2019-03-14 19:53:28'),(1057,0,'LUNGGO Lumpia Semanggi Ijo Inovasi Semanggi menjadi Jajanan Hits Khas Surabaya','2019 16040254068 Muchammad Bagus Widianto.pdf',NULL,5237500,'<p class=\"MsoNormal\">Semanggi merupakan salah satu tumbuhan yang hidup di daerah yang lembab. Semanggi sendiri memiliki khasiat untuk mencegah atau mengobati berbagai macam penyakit seperti meredakan demam, mengobati flu, anti diare, dan juga untuk wanita dapat mengobati terlambat datang bulan. Tumbuhan ini pada umumnya dapat diolah untuk dikonsumsi misalnya pecel semanggi. Makanan olahan semanggi tersebut, merupakan panganan khas kota Surabaya. Namun seiring perkembangan zaman, semanggi mulai menjadi bahan olahan makanan yang jarang ditemui, bahkan dikota khasnya. Hal tersebut dikarenakan kurangnya minat konsumen terhadap hasil olahan tanaman semanggi yang kurang inovatif.</p>\r\n<p class=\"MsoNormal\"><span style=\"font-size: 11.0pt; line-height: 150%; font-family: \'Calibri\',\'sans-serif\'; mso-fareast-font-family: Calibri; mso-bidi-font-family: \'Times New Roman\'; mso-ansi-language: EN-US; mso-fareast-language: EN-US; mso-bidi-language: AR-SA;\">Padahal industri makanan saat ini telah berkembang cepat, tercatat pada laman Kementerian Perindustran, sumbangan industri makanan dan minuman kepada PDB non migas mencapai 34,95% pada triwulan III pada tahun 2017. Hal ini menunjukkan industri makanan dan minuman menjadi industri yang dapat diandalkan untuk menunjang pembangunan ekonomi negara</span></p>\r\n<p class=\"MsoNormal\">Oleh karena itu, disebabkan kondisi yang ada. Memunculkan ide untuk membuat inovasi baru yang berasal dari olahan daun semanggi. Inovasi ini bertajuk &ldquo;LUNGGO&rdquo; yang merupakan kepanjangan dari Lumpia Semanggi Ijo. Lumpia yang merupakan makanan yang disukai segala umur dan tingkatan, membuat inovasi lumpia semanggi ijo ini menjadi menarik dan tentunya menjanjikan. Lumpia isi semanggi ini berbeda dengan lumpia pada umumnya.</p>\r\n<p class=\"MsoNormal\"><span style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\';\">Pada umumnya warna lumpia adalah kecoklat-coklatan kali ini warna kulit lumpianya berwarna hijau, dengan campuran daun semanggi akan menjadikan kulit lumpia menjadi warna hijau seperti warna khas yang melambangkan dari kota Surabaya. Lumpia ini nantinya juga diharapkan dapat menjadi salah salah satu oleh-oleh khas Surabaya dikemudian hari. Dengan warna Hijau yang segar, tentunya hal ini akan menarik konsumen.</span></p>','Surabaya|Inovatif|Inovasi|Lumpia|Semanggi',1,1,'2019-03-14 17:41:46','2019-03-16 06:12:15'),(1058,0,'SOKOLTA TYR FROTA','2019 16040284004 RIZKI ANISATUL MAGHFIROH.pdf',NULL,8000000,'<p>Tujuan mengikuti PMW kewirausahaan yaitu mengembangkan kreativitas dalam menciptakan sesuatu yang belum umum karena ditambah dengan variasi pribadi. Kreativitas dalam mengolah makanan untuk menjadi makanan yang sehat, menjadi dasar utama bagi kami untuk merespon maraknya makanan ringan yang diisi dengan komposisi yang tidak seharusnya. Hal ini sangat berbahaya mengingat kesehatan konsumen merupakan aspek utama yang harus dipertimbangkan. Oleh karena itu, hadir Sokol&agrave;ta Tyr&igrave; Fro&ugrave;ta yaitu camilan keluarga yang diolah dalam bentuk puding telur dengan isian buah melon dan strawberry dengan toping keju serut dan meises candy. Produk kami sesuai dengan selera pasar dimana kami mendistribusikan produk. Terlebih lagi kami mengharapkan bahwa produk makanan ini dapat menjadi batu loncatan kami untuk memulai wirausaha berskala kecil.</p>','Kuliner jajanan sehat murah enak isi buah|Jajanan isi buah segar menyehatkan|Makanan|Sehat|Murah|Kenangan masa kecil',1,1,'2019-03-14 17:49:53','2019-03-15 11:52:12'),(1059,0,'SETAN (Sego Tanduk)','2019 17020084033 Muhammad Husnun Nadhif.pdf',NULL,5234000,'<p class=\"MsoNoSpacing\" style=\"text-align: justify; line-height: 115%; tab-stops: 14.2pt;\"><span lang=\"IN\" style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',serif; letter-spacing: -.05pt; mso-ansi-language: IN;\">Konsep awal dari SETAN ini adalah nasi bungkus, tapi kami ingin mengubah penampilan nasi bungkus yang terlihat kuno dan tidak praktis menjadi lebih modern dan praktis hingga dapat disantap dimana saja, dan tetap menjaga kehigienisannya. Kami juga menyesuaikan kemasan produk kami sesuai dengan era sekarang yang identik dengan kaum millenial. Kami juga menambahkan berbagai pilihan menu kekinian yang banyak digemari banyak masyarakat dengan harga yang lebih terjangkau. Kami juga menggunakan bahan-bahan dan bumbu pilihan untuk menjamin cita rasa dari produk kami sehingga rasanya tidak jauh berbeda dengan masakan restoran.</span></p>','Makanan|Minuman|Nasi|Sego|Tanduk|Milenial|Praktis',1,1,'2019-03-14 17:51:07','2019-03-15 04:46:10'),(1060,0,'Proposal PMW KaSeTo','2019 17020104042 BRIGITTA ANINDYA RINJANI SUDARMONO.pdf',NULL,12890000,'<p class=\"MsoNoSpacing\" style=\"text-align: justify; line-height: 150%; tab-stops: 14.2pt;\"><span style=\"font-size: 12.0pt; line-height: 150%; font-family: \'Times New Roman\',\'serif\'; letter-spacing: -.05pt; mso-ansi-language: IN;\">Kanji <em>Case Custom </em>(KaSeTo) merupakan sebuah usaha pembuatan <em>phone case </em>atau pelindung ponsel yang memiliki <em>design</em> dasar huruf kanji dalam bahasa Jepang.</span></p>\n<p class=\"MsoNoSpacing\" style=\"text-align: justify; line-height: 150%; tab-stops: 14.2pt;\"><span style=\"font-size: 12.0pt; line-height: 150%; font-family: \'Times New Roman\',\'serif\'; letter-spacing: -.05pt; mso-ansi-language: IN;\">&nbsp;</span></p>','KaSeTo|Barang',2,1,'2019-03-14 17:52:49','2019-03-18 10:00:07'),(1061,0,'Pudding Teplok (Telur Ceplok)','2019 16040284023 Lumlumatul Widad.pdf',NULL,4583000,'<p style=\"text-indent: .25in; line-height: 150%; margin: 0in 0in .0001pt .25in;\"><span lang=\"IN\" style=\"letter-spacing: -.05pt; mso-ansi-language: IN; mso-bidi-font-weight: bold;\">Puding&ldquo;TEPLOK&rdquo; (Puding Telur Ceplok)</span> <span lang=\"IN\" style=\"letter-spacing: -.05pt; mso-ansi-language: IN; mso-bidi-font-weight: bold;\">adalah</span> <span lang=\"IN\" style=\"letter-spacing: -.05pt; mso-ansi-language: IN; mso-bidi-font-weight: bold;\">sejenis makanan</span> <span lang=\"IN\" style=\"letter-spacing: -.05pt; mso-ansi-language: IN; mso-bidi-font-weight: bold;\">ringan yang bahan dasarnya terbuat dari </span><span style=\"letter-spacing: -.05pt; mso-bidi-font-weight: bold;\">perpaduan pudding dan agar-agar </span><span lang=\"IN\" style=\"letter-spacing: -.05pt; mso-ansi-language: IN; mso-bidi-font-weight: bold;\">yang dikolaborasikan</span> <span lang=\"IN\" style=\"letter-spacing: -.05pt; mso-ansi-language: IN; mso-bidi-font-weight: bold;\">dengan</span> <span lang=\"IN\" style=\"letter-spacing: -.05pt; mso-ansi-language: IN; mso-bidi-font-weight: bold;\">tahu</span> <span lang=\"IN\" style=\"letter-spacing: -.05pt; mso-ansi-language: IN; mso-bidi-font-weight: bold;\">kemudian</span> <span lang=\"IN\" style=\"letter-spacing: -.05pt; mso-ansi-language: IN; mso-bidi-font-weight: bold;\">dikreasikan</span> <span lang=\"IN\" style=\"letter-spacing: -.05pt; mso-ansi-language: IN; mso-bidi-font-weight: bold;\">dengan</span> <span lang=\"IN\" style=\"letter-spacing: -.05pt; mso-ansi-language: IN; mso-bidi-font-weight: bold;\">hiasan</span> <span lang=\"IN\" style=\"letter-spacing: -.05pt; mso-ansi-language: IN; mso-bidi-font-weight: bold;\">telur</span> <span lang=\"IN\" style=\"letter-spacing: -.05pt; mso-ansi-language: IN; mso-bidi-font-weight: bold;\">ceplok</span> <span style=\"letter-spacing: -.05pt; mso-bidi-font-weight: bold;\">pudding ini sangat unik dan berbeda dengan pudding-pudding lainnya karena dari bentuk pudding terlihat seperti telur ceplok orang akan menyangka kalau itu terbuat dari bahan dasar telur, padahal tidak, pudding ini terbuat dari bahan dasar tahu/tofu yang dikreasikan model seperti telur ceplok.</span></p>\n<p style=\"text-indent: .25in; line-height: 150%; margin: 0in 0in .0001pt .25in;\"><span style=\"letter-spacing: -.05pt; mso-bidi-font-weight: bold;\">Sedangkan usaha pudding ini sendiri bisa bermanfaat bagi masyarakat yang mana usaha &ldquo;Pudding Teplok&rdquo; tentu akan sangat bermanfaat untuk masyarakat yang tinggal di sekitar tempat usaha. Sebab <span style=\"mso-bidi-font-style: italic;\">owner</span> akan memperkerjakan masyarakat bila usaha ini telah <span style=\"mso-bidi-font-style: italic;\">grow and bloom </span>sehingga dapat mengurangi pengangguran dan masyarakat bisa memiliki penghasilan tetap untuk memenuhi kebutuhan hidup.<span style=\"mso-spacerun: yes;\">&nbsp; </span>Selain itu, konsumen juga bisa menikmati kelezatan pudding teplok yang<span style=\"mso-spacerun: yes;\">&nbsp; </span>benar-benar lembut.</span></p>','enter|keyword|enter',1,1,'2019-03-14 17:56:06','2019-03-15 05:11:26'),(1062,0,'KASUS LANGKA (Keripik Usus Langsung Makan)','2019 17020084061 Lia Mumtazah.pdf',NULL,6500000,'<p>Keripik Usus adalah salah satu cemilan lokal yang sangat digemari oleh semua orang dari berbagai kalangan. KASUS LANGKA berbeda dengan keripik usus pada umumnya. Karena KASUS LANGKA dibuat dengan usus yang berkualitas dan dibumbui dengan varian rasa yang banyak. KASUS LANGKA menawarkan rasa baru yang belum pernah ada dijual di pasar yaitu dengan&nbsp;<strong>keju leleh</strong>. keju leleh yang bercampur dengan dengan bumbu yang sudah ada akan menambah kenikmatan dari keripik usus yang telah dibuat. disamping itu, usaha kami juga menyediakan suatu fasilitas&nbsp;<strong>Linggis&nbsp;</strong>(Lingkungan Inggris) yang ditujukan untuk para pelanggan yang ingin belajar bahasa inggris dengan lebih santai namun mendapatkan banyak ilmu. tidak hanya itu, pada kemasan USUS LANGKA terdapat kata-kata bahasa inggris dari level TOEFL hingga IELTS yang akan menambah pengetahuan kosakata bahasa inggris bagi pelanggan.</p>','keripik, usus, varian rasa, keju, inggris|keripik|usus|varian rasa|keju|inggris|fasilitas',1,1,'2019-03-14 18:06:21','2019-03-15 23:26:31'),(1063,0,'BASIRE (Batagor Suroboyo Isi Pare)','2019 18010684059 Marinda Nur Aini.pdf',NULL,8500000,'<p class=\"MsoListParagraphCxSpFirst\" style=\"text-align: justify; text-indent: 36.0pt; line-height: 150%;\"><span lang=\"EN-GB\" style=\"font-size: 12.0pt; line-height: 150%; font-family: \'Times New Roman\',\'serif\';\">Indonesia memiliki ragam kuliner, mulai dari makanan ringan sampai ke makanan berat. Salah satunya yaitu kota Surabaya, kota Surabaya merupakan salah satu kota ramai penduduk di Indonesia. Selain ramai penduduk, di kota Surabaya juga terdapat berbagai ragam kuliner.</span></p>\n<p class=\"MsoListParagraphCxSpMiddle\" style=\"text-align: justify; text-indent: 36.0pt; line-height: 150%;\"><span lang=\"EN-GB\" style=\"font-size: 12.0pt; line-height: 150%; font-family: \'Times New Roman\',\'serif\';\">Nah BASIRE ini seperti batagor pada umumnya. BASIRE merupakan inovasi usaha bidang makanan yang mencampurkan antara batagor dengan sayur pare. Pare sangatlah terkenal akan rasa pahitnya, namun dalam pare mengandung khasiat untuk kesehatan dan mengobati berbagai penyakit. Sehingga selain menjadi makanan ringan masyarakat pada umumnya, BASIRE ini dapat sebagai alternatif pengobatan dan dapat juga sebagai makanan sehat. Oleh karena itu, usaha ini dapat menjadi prospek yang bagus di Surabaya.</span></p>\n<p class=\"MsoListParagraphCxSpLast\" style=\"text-align: justify; text-indent: 36.0pt; line-height: 150%;\"><span lang=\"EN-GB\" style=\"font-size: 12.0pt; line-height: 150%; font-family: \'Times New Roman\',\'serif\';\">BASIRE merupakan jenis makanan inovasi baru dan belum memiliki daya saing, sehingga menjadi keunggulan tersendiri untuk prospek usaha kedepannya. Untuk pemasaran BASIRE ini dapat disajikan sebagai makanan kuliner di restaurant atau <em style=\"mso-bidi-font-style: normal;\">Coffe break</em> di tempat-tempat rapat, hotel, serta dapat dipasarkan di acara atau kegiatan-kegiatan yang ada di kota Surabaya.</span></p>','BASIRE',1,1,'2019-03-14 18:06:48','2019-03-14 19:58:24'),(1064,0,'UKULELE (Usaha Kue Lemper Lumer)','2019 16010044007 Intaniyah Nurida Firdausi.pdf',NULL,10159000,'<p class=\"MsoNormal\" style=\"text-align: justify;\"><span lang=\"EN-US\" style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\';\"><span style=\"mso-spacerun: yes;\">&nbsp; &nbsp; &nbsp; L</span>emper kami beri inovasi rasa dan topping sehingga sangat menarik dan dapat diterima oleh berbagai kalangan. Mulai anak-anak, remaja hingga dewasa. Kami akan menyajikan menu-menu andalan dengan berbagai kreasi. Kami juga akan memfasilitasi beberapa alat musik sederhana untuk menghibur para pengunjung. Sehingga suasana di kedai yang akan kami dirikan akan semakin nyaman dan mengena di hati para pengunjung. </span></p>\n<p class=\"MsoNormal\" style=\"text-align: justify;\"><span lang=\"EN-US\" style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\';\"><span style=\"mso-spacerun: yes;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span>Bahan makanan dari beras ketan sangat bermanfaat untuk tubuh beberapa diantaranya adalah untuk menurunkan risiko penyakit jantung, membantu menangkal radikal bebas, mengatur aktivitas hormon tiroid, menjaga sistem metabolisme tubuh untuk tetap sehat, membantu mengendalikan nafsu makan, mencegah penuaan dini, menjaga daya tahan tubuh, mencegah diabetes, menjaga kulit sehat alami, memperbaiki kerusakan sel hati, mencegah kanker dan tumor, mencegah anemia, dan menetralisir kolestrol dalam darah. Begitu banyaknya manfaat dari beras ketan sehingga kita termotivasi untuk membuat olahan ketan dan lemper dengan inovasi rasa dan topping agar menumbuhkan minat masyarakat dalam mengkonsumsi makanan yang sehat dan juga melestarikan makana</span><span style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; mso-ansi-language: IN;\">n</span><span lang=\"EN-US\" style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\';\"> tradisional. </span></p>','lemper lumer|olahan ketan|ukulele',1,1,'2019-03-14 18:20:12','2019-03-15 02:33:40'),(1065,0,'KERIPIK TALAS RASA (PIKLARAS)','2019 17020114039 Syafrida Marsha Nuris Shania.pdf',NULL,2737000,'<p>&nbsp;</p>\n<p class=\"MsoNormal\" style=\"text-align: justify;\"><span style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\';\">Keripik talas rasa lokal (Piklaras) adalah program usaha yang dirancang dengan memanfaatkan talas sebagai bahan baku dari pembuatan produk keripik talas rasa lokal (Piklaras). Keunikan dari keripik ini adalah keripik talas ini memiliki rasa makanan khas lokal. Tujuan dibuatnya program usaha ini adalah untuk mengembangkan bidang usaha yang dikelola oleh mahasiswa dan harapan ke depannya dapat lebih berkembang lebih besar sehingga dapat tercipta lapangan pekerjaan bagi masyarakat umum. Dalam proses produksinya, talas dibeli dari petani talas sehingga kesegaran dan kualitas dari talas tidak diragukan lagi. Kemudian talas akan diproses dengan dilakukan pencucian terlebih dahulu, lalu dikupas kulitnya hingga bersih. Setelah itu talas akan dipotong standar dan tipis agar saat penggorengan menjadi renyah. Setelah dipotong, talas akan memasuki tahap penggorengan. Potongan talas digoreng sampai matang. Setelah matang, keripik talas akan diberi bumbu-bumbu rasa lokal sehingga keripik akan memiliki cita rasa. Manfaat dari keripik talas ini sangat beragam, karena talas itu sendiri memiliki kandungan vitamin A dan C yang baik bagi tubuh. Selain itu, konsumsi talas akan semakin diminati sebagai makanan khas Indonesia yang sempat ditinggalkan karena adanya makanan <em style=\"mso-bidi-font-style: normal;\">western</em> yang lebih digandrungi masarakat Indonesia. Manfaat lainnya adalah untuk meningkatkan tingkat ekonomi dan kesejahteraan petani talas.</span></p>\n<p>&nbsp;</p>','keripik|keripik talas|ubi talas',1,1,'2019-03-14 18:26:39','2019-03-15 07:00:27'),(1066,0,'FUNGI ICE CREAM (FUNICE YAHUTT)','2019 17040254004 Suci Rismawati.pdf',NULL,7368000,'<p><span lang=\"EN-US\" style=\"font-size: 12pt; line-height: 18.4px; font-family: \'Times New Roman\', serif; letter-spacing: -0.05pt;\">Ice Cream adalah sebuah makanan beku dibuat dari produk susu yang seperti krim, digabungkan perasa dan pemanis. Ice Cream banyak disukai oleh kalangan masyarakat bahkan dapat dikatakan semua orang menyukai Ice Cream. Maka dengan peluang masyarakat yang banyak menyukai Ice Cream, dengan ini kami membuat produk&nbsp;<strong>FunIce Yahutt</strong>&nbsp;yang kami pilih karena dapat dikatakan berbeda dengan Ice Cream yang biasa dijual dipasaran, sebab dalam&nbsp;</span><span style=\"font-size: 12pt; line-height: 18.4px; font-family: \'Times New Roman\', serif; letter-spacing: -0.05pt;\">FunIce Yahutt&nbsp;</span><span lang=\"EN-US\" style=\"font-size: 12pt; line-height: 18.4px; font-family: \'Times New Roman\', serif; letter-spacing: -0.05pt;\">ini dibuat dari pemanfaattan jamur tiram yang mengandung banyak manfaat bagi kesehatan tubuh manusia.&nbsp;</span><span style=\"font-size: 12pt; line-height: 18.4px; font-family: \'Times New Roman\', serif; letter-spacing: -0.05pt;\">Nama&nbsp;<strong><em>FunIce Yahutt atau Fungi Ice Cream</em></strong>&nbsp;ini tercipta dari nama spesies dari jamur yaitu&nbsp;<strong><em>fungi</em></strong>.&nbsp;</span><span lang=\"EN-US\" style=\"text-align: justify; text-indent: 18pt; font-size: 12pt; line-height: 18.4px; font-family: \'Times New Roman\', serif;\">Selain itu</span><span style=\"text-align: justify; text-indent: 18pt; font-size: 12pt; line-height: 18.4px; font-family: \'Times New Roman\', serif;\">,</span><span lang=\"EN-US\" style=\"text-align: justify; text-indent: 18pt; font-size: 12pt; line-height: 18.4px; font-family: \'Times New Roman\', serif;\">&nbsp;manfaat dari jamur tiram pun dapat diperoleh dengan cara yang enak melalui memakan&nbsp;</span><em style=\"text-align: justify; text-indent: 18pt;\"><span style=\"font-size: 12pt; line-height: 18.4px; font-family: \'Times New Roman\', serif;\">ice cream</span></em><span style=\"text-align: justify; text-indent: 18pt; font-size: 12pt; line-height: 18.4px; font-family: \'Times New Roman\', serif;\">&nbsp;</span><span lang=\"EN-US\" style=\"text-align: justify; text-indent: 18pt; font-size: 12pt; line-height: 18.4px; font-family: \'Times New Roman\', serif;\">jamur tiram.&nbsp;</span><span style=\"text-align: justify; text-indent: 18pt; font-size: 12pt; line-height: 18.4px; font-family: \'Times New Roman\', serif;\">Maka, dapat dikatan dari berbagai manfaat dan inovasi yang dibuat usaha ini layak untuk dikembangkan menjadi sebuah usaha yang inovasi.&nbsp;</span><span lang=\"EN-US\" style=\"font-size: 12pt; line-height: 18.4px; font-family: \'Times New Roman\', serif;\">Selain itu</span><span style=\"font-size: 12pt; line-height: 18.4px; font-family: \'Times New Roman\', serif;\">,</span><span lang=\"EN-US\" style=\"font-size: 12pt; line-height: 18.4px; font-family: \'Times New Roman\', serif;\">&nbsp;manfaat dari jamur tiram pun dapat diperoleh dengan cara yang enak melalui memakan&nbsp;</span><em><span style=\"font-size: 12pt; line-height: 18.4px; font-family: \'Times New Roman\', serif;\">ice cream</span></em><span style=\"font-size: 12pt; line-height: 18.4px; font-family: \'Times New Roman\', serif;\">&nbsp;</span><span lang=\"EN-US\" style=\"font-size: 12pt; line-height: 18.4px; font-family: \'Times New Roman\', serif;\">jamur tiram.&nbsp;</span><span style=\"font-size: 12pt; line-height: 18.4px; font-family: \'Times New Roman\', serif;\">Maka, dapat dikatan dari berbagai manfaat dan inovasi yang dibuat usaha ini layak untuk dikembangkan menjadi sebuah usaha yang inovasi.</span></p>','Fungi, Ice Cream,Funice |Fungi|Ice Cream|Jamur Tiram',1,1,'2019-03-14 18:28:52','2019-03-15 03:06:12'),(1067,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,'2019-03-14 18:40:50','2019-03-14 18:40:50'),(1068,0,'Chicken Katsu','2019 17020114062 Tabita Permata Sukma.pdf',NULL,15948000,'<p>Chicken katsu adalah makanan yang berbahan dasar ayam. makanan ini dibaluri dengan tepung panir. makanan ini memiliki ciri khas dari berbagai bumbu untuk memproduksi Chicken Katsu tersebut. Chicken Katsu ini juga memiliki 2 topping yaitu balado dan lada hitam. selain topping tersebut kami juga memiliki ciri khas yaitu bumbu merah.</p>','chicken|katsu|ayam katsu chicken balado',1,1,'2019-03-14 18:44:20','2019-03-20 03:07:21'),(1069,0,'Sosis Jamur (Sosis Jamur Uenak, Lumer, Murah)','2019 16040284090 Vivin Amaliya.pdf',NULL,7231000,'<p><span lang=\"EN-US\" style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; mso-fareast-font-family: Calibri; mso-ansi-language: EN-US; mso-fareast-language: EN-US; mso-bidi-language: AR-SA;\">Sosis daging merupakan produk pangan bergizi tinggi, namun berkolestrol tinggi. Hal inilah yang menyebabkan produk sosis daging hanya diminati oleh orang-orang yang tidak memiliki gangguan terhadap penambahan kolestrol.&nbsp;Oleh karena itu perlu dikembangkan inovasi pembuatan sosis dari bahan baku non daging yang tidak mempunyai kolesterol, tanpa mengurangi citra sosis sebagai makanan favorit keluarga. Salah satunya adalah jamur tiram. Jamur tiram putih (Pleurotus ostreatus) adalah&nbsp;</span><span lang=\"EN-US\" style=\"font-size: 11pt; line-height: 115%; font-family: Calibri, sans-serif;\"><a title=\"Jamur pangan\" href=\"http://id.wikipedia.org/wiki/Jamur_pangan\"><span style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; color: black;\">jamur pangan</span></a></span><span lang=\"EN-US\" style=\"font-size: 12pt; line-height: 115%; font-family: \'Times New Roman\', serif;\">&nbsp;d</span><span lang=\"EN-US\" style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; mso-fareast-font-family: Calibri; mso-ansi-language: EN-US; mso-fareast-language: EN-US; mso-bidi-language: AR-SA;\">engan tudung berbentuk setengah lingkaran mirip cangkang tiram dengan bagian tengah agak cekung dan berwarna putih hingga krem.&nbsp; Jamur ini memiliki nilai nutrisi yang tinggi.&nbsp;</span><span lang=\"EN-US\" style=\"font-size: 12.0pt; line-height: 150%; font-family: \'Times New Roman\',\'serif\';\">Kandungan protein dalam jamur tiram memiliki kadar nilai yang lebih tinggi dibandingkan dengan sayuran lainnya maupun daging sapi. Terdapat asam amino esensial yang terkandung pada protein dalam jamur tiram. Asam amino esensial adalah asam yang dibutuhkan oleh tubuh dalam jumlah cukup, tetapi tubuh tidak dapat menghasilkan asam amino.&nbsp;</span><span style=\"font-family: \'Times New Roman\', serif; font-size: 12pt;\">Jamur Tiram biasanya diolah menjadi aneka makanan lezat. Ternyata Jamur Tiram sejak jaman dahulu digunakan sebagai bahan&nbsp;baku&nbsp;pembuatan obat tradisional. Khasiat Jamur Tiram bagi kesehatan tubuh memang terbukti.&nbsp;</span></p>\n<p class=\"MsoNormal\" style=\"text-align: justify; text-indent: 36.0pt; line-height: 150%; margin: 0cm 0cm .0001pt 14.2pt;\">&nbsp;</p>','Sosis |Jamur',1,1,'2019-03-14 18:50:38','2019-03-15 01:32:43'),(1070,0,'Mie Sampah Gobyos','2019 16010034016 Zenitha Anki Mawarni.pdf',NULL,7500000,'<p>Mie Sampah Gobyos merupakan suatu bisnis di bidang kuliner yang menawarkan mie atau kudapan yang di sajikan dengan cara yang berbeda yaitu di dalamnya terdapat khas nusantara dengan level kepedasan yang disesuaikan dengan minat konsumen. Ide ini original dan mengikuti perkembangan zaman sekarang yaitu lebih mengunggulkan cita rasa pedas yang tinggi. Peluang pasar masih sangat terbuka dan berdasarkan analisis kelayakan yang digunakan, rencana usaha ini memiliki prospek yang cukup baik dan layak untuk diimplementasikan.</p>','Mie, Mie Sampah Gobyos, Penyajian BerbedaPeluang|Mie, Mie Sampah Gobyos, Penyajian Berbeda, Peluang',1,1,'2019-03-14 19:01:01','2019-03-15 00:36:26'),(1071,0,'Donat Gepeng Purple Yang Menyehatkan','2019 17010644148 Rahmad Bashari.pdf',NULL,8000000,'<p>Ubi ungu merupakan jenis ubi yang cukup diminati dikalangan masyarakat, baik di pedesaan ataupun kota-kota besar. Pada umumnya ubi ungu mempunyai ciri seperti namanya, yaitu berwarna ungu. Ubi ungu memiliki juga rasa yang enak, menyehatkan, dan mudah didapat, sehingga banyak yang menyukainya.</p>\n<p>Ubi ungu biasanya dimakan dengan cara direbus atau digoreng terlebih dahulu, bahkan tidak sedikit yang mengolahnya kembali menjadi makanan yang memiliki harga jual yang lebih tinggi, misalnya seperti donat gepeng purple yang akan kami buat ini. Ubi jenis ini memiliki banyak manfaat bagi tubuh kita, misanya dapat digunakan untuk menjaga tubuh agar tetap ideal, melancarkan system pencernaan, mengatasi hipertensi, asma, dan masih banyak lagi.</p>\n<p>Ubi ungu jika dihidangkan dengan cara direbus atau digoreng seperti biasa tentu akan kurang menarik dan harga jualnya akan kurang untuk berwirausaha, maka dari itu, kami berinovasi untuk mengolah ubi jenis ini menjadi donat gepeng purple. Seperti namanya, donat tersebut akan berwarna purple atau ungu dan bentuknya gepeng (pipih) sehingga akan lebih menarik.</p>\n<p>Ditinjau dari segi ekonomi, harga penjualan produk yang kami tawarkan ini sangat terjangkau di kalangan masyarakat, bahan baku mudah didapat dan harganya pun terbilang murah. Dan dari segi social, agroindustri yang bergerak pada pengolahan donat gepeng purple ini dapat mengembangkan para petani dan pengangguran untuk menanam ubi jenis ini sehingga mereka dapat bekerja untuk menyedikan dan mengolah bahan baku dengan cara menanam ubi ungu.</p>','makanan|manfaat|ekonomi',1,1,'2019-03-14 19:02:36','2019-03-19 04:56:55'),(1073,0,'KeiKeu Dessert Box','2019 17010024043 Yashinta Salsabila.pdf',NULL,7000000,'<p class=\"MsoNoSpacing\" style=\"text-align: justify; text-indent: 35.45pt; line-height: 150%; tab-stops: 14.2pt;\"><span style=\"font-size: 12.0pt; line-height: 150%; font-family: \'Times New Roman\',\'serif\'; letter-spacing: -.05pt; mso-ansi-language: IN;\">KeiKeu Dessert Box merupakan makanan manis (kue) yang dikemas dalam kotak makanan (box) berukuran 8 x 12 cm yang didalamnya berisi pilihan jenis kue mulai dari cheese cake, bolu, ataupun brownis yang atasnya disiram dengan coklat ganache serta terdapat pilihan toping dan isian mulai dari oreo, biskuit regal, atau keju parut.</span></p>','dessert box|cake|makanan manis|kue|coklat',1,1,'2019-03-14 19:10:32','2019-03-15 00:16:50'),(1074,0,'MACARON IN YOUR AREA','2019 16040284005 Gary Alvin Sadewa.pdf',NULL,14748000,'<p class=\"MsoListParagraph\" style=\"text-align: justify; text-indent: .5in; line-height: 150%;\"><span style=\"font-size: 12.0pt; line-height: 150%; font-family: \'Times New Roman\',\'serif\'; mso-bidi-font-family: \'Times New Roman\'; mso-bidi-theme-font: minor-bidi; letter-spacing: -.05pt; mso-bidi-font-weight: bold;\">Usaha &ldquo;Macaron in Your Area&rdquo; ini dirintis karena <em>owner</em> melihat fakta bahwa macaron sangat populer di Indonesia, terutama dalam kalangan K-Pop fans yang kini sangat <em>addict</em> <em>and interested </em>terhadap salah satu <em>girl group </em>Korea Selatan &ldquo;BLACKPINK&rdquo;.<span style=\"mso-spacerun: yes;\">&nbsp; </span>Macaron juga sangat populer di Korea Selatan serta banyak <em>idol</em> yang suka membuat dan memakan macaron. Oleh sebab itu, <em>owner</em> ingin memproduksi macaron yang <em>tasty</em>, <em>cute</em>, dan <em>colorful</em> yang dikemas dalam wadah bernuansa BLACKPINK. Usaha &ldquo;Macaron in Your Area&rdquo; ini juga merupakan wujud <em>love support </em>kepada BLACKPINK. </span></p>','macaron, blackpink|macaron in your area|tasty, cute, colorful',1,1,'2019-03-14 19:14:59','2019-03-17 16:56:52'),(1075,0,'PEMBALL MILLENIAL (Pempek Bola Millenial )','2019 16010044054 M. Hasbih Ashshidiqi.pdf',NULL,8000000,'<p class=\"MsoListParagraphCxSpFirst\" style=\"margin: 0in 0in 8pt; text-align: justify; text-indent: 13.5pt; line-height: 14.98px;\"><span style=\"font-size: 12pt; line-height: 17.12px; font-family: \'Times New Roman\', serif; letter-spacing: -0.05pt;\">Kami berinovasi membuat empek-empek menjadi lebih berkelas dan mengikuti trend saat ini, dengan bentuk dan penyajian berbeda. Pempek yang kita buat memiliki tujuh varian isian dengan nama :&nbsp;</span><span style=\"font-size: 12pt; line-height: 17.12px; font-family: \'Times New Roman\', serif;\">red chili, blue salted egg, green mushroom, yellow cheese, orange sausage, black zonk. Setiap warna mewakili satu jenis isiannya, yaitu merah untuk isian cabai, biru untuk isian telur asin, hijau untuk isian jamur kuping, kuning untuk isian keju, jingga untuk isian sosis, dan hitam untuk varian original atau tanpa isian. Untuk satu porsinya terdapat empat buah pempek dan konsumen bebas memilih varian isian yang tersedia, dengan kuah yang disendirikan dalam wadah lain.</span></p>\n<p class=\"MsoListParagraphCxSpLast\" style=\"margin: 0in 0in 8pt; text-align: justify; text-indent: 13.5pt; line-height: 14.98px;\"><span style=\"font-size: 12pt; line-height: 17.12px; font-family: \'Times New Roman\', serif; letter-spacing: -0.05pt;\">Target pemasaran dari penjualan &ldquo;Pemball Millenial&rdquo; adalah masyarakat umum tanpa ada batasan usia di daerah Surabaya bagian barat pada khususnya, dan Surabaya pada umumnya. Sistem pemasaran yang kami lakukan yaitu pemasaran langsung dan melalui media sosial yaitu Instagram, dengan alamat Instagram @pemball.millenial dan memberikan tester&nbsp;&nbsp;kepada beberapa konsumen secara langsung. Harga yang kami tetapkan adalah Rp. 12.000,- per porsi</span></p>\n<p><span style=\"font-size: 12pt; line-height: 17.12px; font-family: \'Times New Roman\', serif; letter-spacing: -0.05pt;\">&nbsp;</span></p>','pemball |pemball|pempek bola',1,1,'2019-03-14 19:36:07','2019-03-15 21:57:15'),(1076,0,'BTS (Buah Transparent Soda)','2019 16040284045 Safitri Purnama Sari.pdf',NULL,7000000,'<p><span style=\"font-family: \'Times New Roman\', serif; font-size: 16px; letter-spacing: -0.0666667px;\">BTS</span><em style=\"font-family: \'Times New Roman\', serif; font-size: 16px; letter-spacing: -0.0666667px;\">&nbsp;</em><span style=\"font-family: \'Times New Roman\', serif; font-size: 16px; letter-spacing: -0.0666667px;\">atau yang merupakan singkatan dari&nbsp;</span><em style=\"font-family: \'Times New Roman\', serif; font-size: 16px; letter-spacing: -0.0666667px;\">Buah Transparent Soda</em><span style=\"font-family: \'Times New Roman\', serif; font-size: 16px; letter-spacing: -0.0666667px;\">&nbsp;merupakan sebuah produk minuman bersoda dengan yang berisi potongan buah segar.&nbsp;</span></p>','Buah segar',1,1,'2019-03-14 19:54:30','2019-03-15 03:42:10'),(1077,0,'La Fiet (Mozzarella Fish Nugget)','2019 16010664032 Adelia Gita Mutiaranisa.pdf',NULL,8202000,'<p class=\"MsoNoSpacing\" style=\"text-align: justify; line-height: 115%; tab-stops: 14.2pt;\"><span style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; letter-spacing: -.05pt; mso-ansi-language: IN;\">Berawal dari hasil observasi kami yang melihat minimnya minat makan olahan laut di kalangan mahasiswa, kami berencana membuat produk olahan hasil laut yang dapat dinikmati secara praktis dan tetap memperhatikan kandungan gizi. Produk tersebut kami beri nama La Fiet yang merupakan singkatan dari Mozzarella Fish Nugget, yaitu nugget yang berbahan dasar ikan dan diberi isian keju mozzarella. Tidak lupa juga dilengkapi dengan sayur-sayuran, sehingga dalam sebuah produk ini mengandung gizi yang lengkap. </span></p>','MozarellaFish nugget, bergizi|Mozarella|fish nugget|bergizi',1,1,'2019-03-14 19:58:49','2019-03-15 04:59:43'),(1078,0,'BEAUTY TREASURE BOX','2019 16040284014 Anindita Surya Mahanani.pdf',NULL,2073000,'<p class=\"MsoNormal\" style=\"text-align: justify; text-indent: 1.0cm;\"><span style=\"font-size: 12.0pt; mso-bidi-font-size: 11.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\';\">Produk kami bernama <em>Beauty Treasure Box</em> yaitu merupakan box yang di desain sedemikian rupa sebagai inovasi untuk produk rak atau box yang digunakan untuk menyimpan alat-alat kosmetik dan segala benda-benda yang berhubungan dengan produk kecantikan. Kami memilih jenis Indudtri kreatif berupa kotak make up ini karena menurut kami benda ini sangat cocok apabila dipasarkan dikalangan mahasiswi terutama mahasiswi yang hidupdi Kos. Hal ini karena sebagian besar mahasiswi yang hidup di Kos tidak mempunyai tempat untuk meletakkan alat-alat Make up mereka sehingga biasanya alat make up milik mereka bereserakan di Meja</span></p>\r\n<p>&nbsp;</p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify; text-indent: 1.0cm;\"><span style=\"font-size: 12.0pt; mso-bidi-font-size: 11.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\';\">Selain bisa dipakai sebagai tempat alat make up produk kami ini juga bisa digunakan sebagai tempat meletakkan alat yang lain selain alat Make up misalnya alat tulis, dan peralatan yang lainnya sehingga produk kami ini sangat multifungsi dan dijual dengan harga yang cukup terjan<a name=\"_GoBack\"></a>gkau.&nbsp;&nbsp;</span></p>','enter|industri kreatif|homemade',4,1,'2019-03-14 20:03:04','2019-03-15 04:56:14'),(1079,0,'Shaarom (Shampoo Aromaticum)','2019 16010044038 Annisa Fitri Wulan Sari.pdf',NULL,13975000,'<p class=\"MsoNoSpacing\" style=\"text-align: justify; line-height: 150%; tab-stops: 14.2pt;\"><span style=\"font-size: 12.0pt; line-height: 150%; font-family: \'Times New Roman\',\'serif\'; letter-spacing: -.05pt; mso-ansi-language: IN;\">Kegiatan usaha dengan membuat sebuah Shampo <em style=\"mso-bidi-font-style: normal;\">Aromaticum</em> yang berbahan dasar berupa minyak daun cengkeh yang sudah diolah sebagai aromaterapi. Selain sebagai aroma terapi didalam shampo yang membuat wangi khas cengkeh terdapat banyak manfaat antara lain salah satunya untuk mencegah kerontokan, mencegah ketombe dan sebagai kondisioner sehingga rambut akan tetap sehat. Shampo ini menggunakan bahan alami sebagai bahan dasar, dengan begitu dapat mengurangi bahan kimia yang ada dalam kandungan shampo. </span></p>\n<p class=\"MsoNormal\" style=\"margin-bottom: .0001pt; text-align: justify; line-height: 150%; mso-pagination: widow-orphan;\"><span lang=\"EN-US\" style=\"font-size: 12.0pt; line-height: 150%; font-family: \'Times New Roman\',\'serif\';\"><span style=\"mso-tab-count: 1;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span>Kegiatan usaha ini akan dikelola oleh sebuah tim yang di dalamnya mempekerjakan teman &ndash; teman disabilitas (ABK yang mampu didik maupun mampu latih</span><span style=\"font-size: 12.0pt; line-height: 150%; font-family: \'Times New Roman\',\'serif\'; color: black; letter-spacing: -.05pt; mso-ansi-language: IN;\">)</span><span lang=\"EN-US\" style=\"font-size: 12.0pt; line-height: 150%; font-family: \'Times New Roman\',\'serif\'; color: black; letter-spacing: -.05pt;\"> sehingga dapat menjadi lapangan pekerjaan dan peluang bagi mereka untuk dapat sukses bersama.</span></p>','Shaarom (Shampoo Aromaticum)',4,1,'2019-03-14 20:06:15','2019-03-16 04:50:39'),(1080,0,'CIMURI ( Cilok Jamur Isi )','2019 16040284025 Riska Ravana Putri.pdf',NULL,9090000,'<p><span lang=\"EN-US\" style=\"font-size: 12pt; line-height: 18.4px; font-family: \'Times New Roman\', serif; letter-spacing: -0.05pt;\">CIMURI atau cilok jamur isi ini berbeda dengan cilok kebanyakan, perbedaannya terletak dari &nbsp;bahan baku utama pembuatan cilok yaitu jamur tiram. Jamur tiram memiliki banyak sekali mamfaat diantaranya meningkatkan kekebalan tubuh, menurunkan kolestrol, membantu mencegah kanker, sumber vitamin B3, sumber antioksidan, kaya akan mineral dan lain sebagainya.&nbsp;&nbsp;</span></p>\n<p><span lang=\"EN-US\" style=\"font-size: 12pt; line-height: 18.4px; font-family: \'Times New Roman\', serif; letter-spacing: -0.05pt;\"><span lang=\"EN-US\" style=\"font-size: 12pt; line-height: 18.4px;\">Dengan adanya CIMURI ini orang tua tidak perlu risau dengan kualitas jajanan yang dikonsumsi anak. Maka dari itu, dengan adanya inovasi baru di bidang jajanan kami&nbsp;&nbsp;layak untuk mendapatkan pendaping usaha dalam PMW untuk meningkatkan dan mengembangkan jajanan ringan sehat dan berkualitas.&nbsp;</span></span></p>','enter|Makanan',1,1,'2019-03-14 20:08:31','2019-03-15 05:54:07'),(1081,0,'SaBana (Satay Banana)','2019 16010044050 vivi fitrahana supriyanto.pdf',NULL,8000000,'<p class=\"MsoNoSpacing\" style=\"text-align: justify; line-height: 150%; tab-stops: 14.2pt;\"><span lang=\"EN-ID\" style=\"font-size: 12.0pt; line-height: 150%; font-family: \'Times New Roman\',serif; mso-fareast-font-family: SimSun; mso-ansi-language: EN-ID;\"><span style=\"mso-tab-count: 1;\">&nbsp;&nbsp;&nbsp;&nbsp; </span></span></p>\n<p class=\"MsoNoSpacing\" style=\"text-align: justify; line-height: 150%; tab-stops: 14.2pt;\"><span style=\"font-size: 12.0pt; line-height: 150%; font-family: \'Times New Roman\',serif; mso-fareast-font-family: SimSun;\">Akhir-akhir ini,</span> <span style=\"font-size: 12.0pt; line-height: 150%; font-family: \'Times New Roman\',serif; mso-fareast-font-family: SimSun;\">bisnis kuliner menjadi salah satu bentuk bisnis yang menjanjikan. Berbagai macam jenis makanan bermunculan dengan ragam kreatifitas yang menarik. Makanan biasa dapat dikreasikan menjadi makanan yang memiliki cita rasa dan nilai jual tinggi. Salah satu makanan biasa yang sering kita temui adalah </span><span lang=\"EN-ID\" style=\"font-size: 12.0pt; line-height: 150%; font-family: \'Times New Roman\',serif; mso-fareast-font-family: SimSun; mso-ansi-language: EN-ID;\">pisang</span><span style=\"font-size: 12.0pt; line-height: 150%; font-family: \'Times New Roman\',serif; mso-fareast-font-family: SimSun;\"> dengan kandungan protein yang tinggi. Namun, masyarakat mulai jenuh dengan bentuk dan rasa </span><span lang=\"EN-ID\" style=\"font-size: 12.0pt; line-height: 150%; font-family: \'Times New Roman\',serif; mso-fareast-font-family: SimSun; mso-ansi-language: EN-ID;\">pisang</span><span style=\"font-size: 12.0pt; line-height: 150%; font-family: \'Times New Roman\',serif; mso-fareast-font-family: SimSun;\"> yang biasa-biasa saja, tidak adanya inovasi.</span> <span style=\"font-size: 12.0pt; line-height: 150%; font-family: \'Times New Roman\',serif; mso-fareast-font-family: SimSun;\">Untuk itu, diperlukan inovasi baru dalam mengolah </span><span lang=\"EN-ID\" style=\"font-size: 12.0pt; line-height: 150%; font-family: \'Times New Roman\',serif; mso-fareast-font-family: SimSun; mso-ansi-language: EN-ID;\">pisang</span><span style=\"font-size: 12.0pt; line-height: 150%; font-family: \'Times New Roman\',serif; mso-fareast-font-family: SimSun;\"> tersebut sehingga penyajian tahu tidak monoton. Saya mencoba mengkreasikan pisang</span><span lang=\"EN-ID\" style=\"font-size: 12.0pt; line-height: 150%; font-family: \'Times New Roman\',serif; mso-fareast-font-family: SimSun; mso-ansi-language: EN-ID;\"> menjadi Satay Banana</span><span style=\"font-size: 12.0pt; line-height: 150%; font-family: \'Times New Roman\',serif; mso-fareast-font-family: SimSun;\">, yaitu dengan perpaduan buah pisang dan balutan tepung panir </span><span lang=\"EN-ID\" style=\"font-size: 12.0pt; line-height: 150%; font-family: \'Times New Roman\',serif; mso-fareast-font-family: SimSun; mso-ansi-language: EN-ID;\">serta siraman berbagai macam pilihan saus dan topping </span><span style=\"font-size: 12.0pt; line-height: 150%; font-family: \'Times New Roman\',serif; mso-fareast-font-family: SimSun;\">yang</span> <span style=\"font-size: 12.0pt; line-height: 150%; font-family: \'Times New Roman\',serif; mso-fareast-font-family: SimSun;\">memanjakan lidah konsumen yang sehat, bergizi, serta tampilan yang mampu mengundang selera.</span></p>','banana|sabana|pmw2019',1,1,'2019-03-14 20:13:00','2019-03-15 08:59:43'),(1082,0,'Badang (Bakbadak Pindang)','2019 16040284051 Nur Halimah.pdf',NULL,4725000,'<p>&nbsp;</p>\n<p class=\"MsoNormal\" style=\"text-align: justify; text-justify: inter-ideograph; text-indent: 36.0pt;\"><span lang=\"EN-US\" style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\';\">Bakdabak</span><span style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; mso-ansi-language: IN;\"> merupakan suatu </span><span lang=\"EN-US\" style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\';\">jajanan khas Madura yang</span><span style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; mso-ansi-language: IN;\"> pada umumnya terbuat </span><span lang=\"EN-US\" style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\';\">dari ikan </span><span style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; mso-ansi-language: IN;\">tenggiri </span><span lang=\"EN-US\" style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\';\">dicampur dengan tepung tapioka dan tepung terigu. Bakdabak memiliki ciri khas rasa ikan yang gurih, pengemasan yang dibuat gepeng menggunakan tangan</span><span style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; mso-ansi-language: IN;\">. </span><span lang=\"EN-US\" style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\';\">Bakdabak banyak digemari masyarakat selain memiliki kualitas produk yang baik, juga memiliki rasa yang khas ditambah petis khas Madura</span><span style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; mso-ansi-language: IN;\">. Namun untuk di Surabaya ini Bakdabak belum terlalu terkenal. Dengan adanya inovasi terbaru dari kami sehingga menemukan sebuah ide untuk menciptakan olahan pangan tambahan dengan isian pindang dan isian level pedas dalam bakdabak, yang kemudian dipadukan dengan adanya sambal serta saos tomat dan </span><span lang=\"EN-US\" style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\';\">harganya yang murah.</span></p>\n<p class=\"MsoNormal\" style=\"text-align: justify; text-justify: inter-ideograph; text-indent: 36.0pt;\"><span style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; mso-ansi-language: IN;\">Kami memilih ikan pindang selain harganya yang murah namun khasiat ikan pindang ternyata sangat baik untuk kesehatan. Kandungan gizi ikan pindang lebih baik dari ikan asin yaitu mengandung protein tinggi, vitamin A dan asam omega-3. Selain itu ikan pindang juga mengandung protein hewani, membantu program diet, menstabilkan tekanan darah tinggi dimana asam lemak omega-3 yang terkandung dalam ikan pindang merupakan jenis lemak yang sangat penting untuk mencegah dan menstabilkan tekanan darah tinggi.</span></p>\n<p class=\"MsoNormal\" style=\"text-align: justify; text-justify: inter-ideograph; text-indent: 36.0pt;\"><span style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; mso-ansi-language: IN;\">Bakdabak pindang ini diharapkan menjadi suatu makanan cemilan yang lezat, gurih, dan mempunyai ciri khas rasa dari ikan pindang sehingga membuat makanan ini menjadi makanan camilan yang sehat.</span></p>','bakdabak|pindang|Madura',1,1,'2019-03-14 20:23:14','2019-03-15 00:56:47'),(1083,0,'NAGA PELANGI (Nagasari Penunda Lapar Masa Kini)','2019 16010044063 Dini Ismillah.pdf',NULL,5000000,'<p class=\"MsoNormal\" style=\"margin-left: 13.5pt; text-align: justify; text-indent: .5in;\"><span style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\';\">Kondisi persaingan yang ada di lingkungan mahasiswa dan masyarakat lidah wetan belum ada yang menjual produk kami sehingga prospek kedepannya ketika produk kami mulai di pasarkan, kami akan memiliki pelanggan tetap karena kami mengutamakan kualitas dan kepuasan konsumen. Produk ini bergerak dibidang makanan ringan yang siap saji yang langsung bisa dinikmati oleh mahasiswa maupun masyarakat. </span></p>\n<p class=\"MsoNormal\" style=\"margin-left: 13.5pt; text-align: justify; text-indent: .5in;\"><span style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\';\">Nagasari yaitu sejenis makanan ringan tradisional yang sudah sangat familiar dikalangan masyarakat. Makanan ringan tradisional ini biasanya digunakan dalam hajatan maupun kegiatan adat yang banyak digemari oleh berbagai kalangan usia. Produk yang berjudul &ldquo;Naga Pelangi (Nagasari Penunda Lapar Generasi Masa kini)&rdquo; adalah untuk bermaksud mengangkat makanan ringan tradisional agar lebih digemari dan dinikmati oleh mahasiswa dan masyarakat. Produk ini bergerak dibidang makanan ringan yang siap saji yang langsung bisa dinikmati oleh mahasiswa maupun masyarakat. </span></p>\n<p class=\"MsoNormal\" style=\"margin-left: 13.5pt; text-align: justify; text-indent: .5in;\"><span style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\';\">Keunggulan dari produk NAGA PELANGI yaitu di kemas lebih menarik dengan berbagai macam isi buah &ndash; buahan, dan dengan bentuk yang lucu dan beragam sesuai minat pembeli. Disamping itu juga menawarkan harga yang terjangkau oleh masyarakat dan sesuai kantong mahasiswa.</span></p>','Naga|pelangi|nagasari|buah|mahasiswa|wirausaha|makanan',1,1,'2019-03-14 20:24:45','2019-03-16 23:52:04'),(1084,0,'P3L (Puding Pelangi Pelipur Lapar)','2019 16010044019 Aisyah Roesadi Putri.pdf',NULL,14079000,'<p>&ldquo;P3L (Puding Pelangi Pelipur Lapar)&rdquo;. Puding pelangi pelipur lapar ini berisikan warna-warna pelangi yang berasal dari buah-buahan yang aman dikonsumsi masyarakat, khususnya anak kecil. Macam-macam warna dari pelangi tersebut langsung dari warna buah-buahan yang telah diolah dengan baik. Untuk warna merah dari semangka, jingga dari jeruk, kuning dari mangga, hijau dari alpukat, biru dari blueberri dengan campuran agar-agar warna putih, nila dari blueberri, dan ungu dari anggur ungu. Semua buah tersebut di olah menjadi puding yang dapat membantu seseorang mengganjal lapar.</p>','Puding|Buah-buahan',1,1,'2019-03-14 20:28:04','2019-03-14 23:53:42'),(1085,0,'HRD \"Healthy Rainbow Doughnut\"','2019 17010644153 INDAH SRI WAHYUNI.pdf',NULL,5000000,'<p>HRD adalah sebuah produk makanan donat yang terbuat dari buah dan sayuran sehingga, rasanya buah dan sayur. selain itu, warna doughnut juga berwarna warni sehingga di beri nama rainbow. doughnut ini mempunyai gizi yang sangat banyak karena terbuat dari bahan alami dan terhindar dari pengawet yang dapat nenbahayakan tubuh dan kesehatan. produk ini lebih banyak dipasarkan ke anak-anak dan remaja karena dapat membantu tumbuh kembang mereka dan juga masih banyak lagi manfaat lainnya.</p>','Doughnut|Ranbow|bergizi tinggi|untuk tumbuh kembang anak-anak|healthy',1,1,'2019-03-14 20:29:46','2019-03-16 07:06:46'),(1086,0,'ES Poligami','2019 17010714034 Dian Wahyu Pratama.pdf',NULL,8587082,'<p>Indonesia merupakan negara yang kaya akan rempah-rempah. Khususnya kunyit yang memiliki banyak sekali manfaat untuk kesehatan tubuh. Oleh sebab itu kita menfaatkan kunyit untuk berinovasi dalam bidang minuman. Inovasi ini tergolong hal baru dalam dunia usaha.&nbsp;</p>\n<p>Inovasi ini kita&nbsp; berinama \"ES POLIGAMI\" yang terbuat dari bahan dasar kunyit. Agar kunyit lebih dikenal dan sukai di semua kalangan. Baik anak-anak,remaja,dewasa hingga orang tua. Dengan minimnya persaingan dan manfaat yang ada dalam kunyit kami yakin usaha ini akan berkembang kedepanya.</p>','#Es #Poligami #Kunyit #Minuman|#Es|#Poligami|#Kunyit|#Minuman',1,1,'2019-03-14 20:43:28','2019-03-14 23:48:05'),(1087,0,'SUGOY (SUSU GOYANG)','2019 16040284063 Yenni Anika Rahmania.pdf',NULL,13958000,'<p class=\"MsoNoSpacing\" style=\"text-align: justify; line-height: 115%; tab-stops: 14.2pt;\"><span style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',serif; letter-spacing: -.05pt;\">Sugoy atau susu goyang adalah usaha minuman berbentuk seperti milkshake, namun dalam sugoy ini memiliki banyak varian rasa, seperti original, green tea, macha, coklat, dan stroberi dengan isian cincau hijau yang menyehatkan. Dilihat dari jenis usaha, usaha minuman belum sebanyak usaha makanan, masih ada 1 atau 2 usaha minuman yang ada di lingkungan sekitar. Jadi dengan adanya inovasi minuman baru, yaitu Sugoy, akan menjadi daya tarik tersendiri karena belum ada usaha yang sama dengan produk Sugoy ini. </span></p>\n<p class=\"MsoNoSpacing\" style=\"text-align: justify; line-height: 115%; tab-stops: 14.2pt;\"><span lang=\"IN\" style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',serif; letter-spacing: -.05pt; mso-ansi-language: IN;\">&nbsp;</span></p>','susu|cincau|kocok',1,1,'2019-03-14 20:52:06','2019-03-16 18:57:06'),(1088,0,'Geboy Mujaer Nang...Ning...Nung! (Gegog Box Ayam Udang Jamur dan Mujaer Rasa Nendang Bikin Kenyang Dung))','2019 17020114040 Anang Prakosa.pdf',NULL,5000000,'<p>Geboy Mujaer Nang...Ning...Nung! (Gegog Box Ayam Undang Jamur dan Mujaer Rasa Nendang Bikin Kenyang Dung)) adalah sebuah inovasi baru pada produk makanan dengan varian lauk pendamping yang bervariasi, harga kos rasa apartemen.</p>','Nasi gegog, makanan, inovasi',1,1,'2019-03-14 20:53:38','2019-03-20 05:13:12'),(1089,0,'Ice Cream Simanis (Sinom Madu Manis)','2019 16010044079 Mohamad Rasyiid Umardi.pdf',NULL,13044998,'<p class=\"MsoNoSpacing\" style=\"text-align: justify; line-height: 115%; tab-stops: 14.2pt;\"><span style=\"font-size: 12pt;\"><strong><span lang=\"IN\" style=\"line-height: 115%; font-family: \'Times New Roman\', serif; letter-spacing: -0.05pt;\">Ice Cream Simanis (Sinom Madu Manis)</span></strong></span></p>\n<p class=\"MsoNoSpacing\" style=\"text-align: justify; line-height: 115%; tab-stops: 14.2pt;\"><span lang=\"IN\" style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; letter-spacing: -.05pt; mso-ansi-language: IN;\">PMW dalah salah satu tempat yang mendukung untuk kita khususnya para mahasiwa dalam mengembangkan usahanya dimana salah satunya terdapat komponen yang melengkapi untuk pengembangan usaha, seperti adanya modal yang diberikan, dosen pembimbing, seleksi berbagai tahap dengan kegiatan berbeda membantu para mahasiswa meningkatkan kemampuan yang dimiliki bahkan dapat membuat mereka kreatif, dan tidak tergantung dengan dunia luar. </span></p>\n<p class=\"MsoNoSpacing\" style=\"text-align: justify; line-height: 115%; tab-stops: 14.2pt;\"><span lang=\"IN\" style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; letter-spacing: -.05pt; mso-ansi-language: IN;\">&nbsp;</span></p>\n<p class=\"MsoNoSpacing\" style=\"text-align: justify; line-height: 115%; tab-stops: 14.2pt;\"><span lang=\"IN\" style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; letter-spacing: -.05pt; mso-ansi-language: IN;\">&nbsp;&nbsp;&nbsp;&nbsp; Kelompok kami menyusul proposal ini sangat terbantu dengan adanya PMW, dengan programn tersebut kami membuktikan bahwa kami berbeda dengan mahasiswa pada umumnya, dengan program ini kami dapat menjadi pribadi yang lebih tangguh dan mandiri, semangat pantang menyerah, serta bisa membuat orang lain merasakan manfaat melalui usaha yang akan kami jalankan.</span></p>\n<p class=\"MsoNoSpacing\" style=\"text-align: justify; line-height: 115%; tab-stops: 14.2pt;\"><span lang=\"IN\" style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; letter-spacing: -.05pt; mso-ansi-language: IN;\">&nbsp;</span></p>\n<p><span lang=\"IN\" style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; mso-fareast-font-family: Calibri; letter-spacing: -.05pt; mso-ansi-language: IN; mso-fareast-language: EN-US; mso-bidi-language: AR-SA;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Kami akan membuktikan dengan program ini kami akan berkembang kebih baik bahkan menjadi paling baik dari wirausaha luar dan kami bisa bersaing secara internasional dari hal yang kita mulai disini. Pendidikan memang perlu dan itu penting tetapi lebih berharga jika kami bermanfaat untuk orang lain dan membuat perubahan nyata, tidak hanya dari segi pendidikan tetapi juga kesehatan dan keuangan. Karena dalam PMW ini kami memsarkan &ldquo;Ice Cream Simanis (Sinom madu manis)&rdquo;. Memandang semakin hari semakin banyak orang yang tidak peduli dengan kesehatan karena disibukkan dengan berbagai hal, mereka lebih baik mengandal minuman ini karene tidak mengandung bahan kimia&nbsp; dan baik bagi kesehatan. Oleh karena itu sebagai generasi penerus bangsa kami akan membuat masyarakan lebih sadar akan kesehatannya dengan mengonsumsi Ice Cream Simanis (Sinom madu manis) yang bahannya dari sinom dan mempunyai manfaat untuk menyegarkan tubuh dan baik untuk kesehatan.&nbsp;</span></p>','ice cream|Sinom|Madu',1,1,'2019-03-14 20:58:51','2019-03-14 23:50:37'),(1090,0,'Gombal Mukiyo Suroboyo','2019 16010034036 MOCHAMAD LUCKY OKTAVIAN.pdf',NULL,11420000,'<p>Gombal mukiyo suroboyo adalah usaha yang bergerak di bidang sablon kaos yang kontennya mengangkat tema tentang budaya kota surabaya. Dalam produk ini setiap desain kaos yang kami produksi adalah sesuatu yang berhubungan tentang kota, tempat wisata, tempat bersejarah, makanan khas dan lain-lain seputar kota surabaya. Manfaat dari kegiatan sablon ini adalah dengan harapan dapat mewujudkan rasa cinta akan kota surabaya melalui karya seni screen printing. Manfaat lain yaitu juga sebagai media untuk memperkenalkan kota surabaya kepada masyarakat secara luas.</p>','Gombal|Desain|Budaya|Sablon',4,1,'2019-03-14 21:07:46','2019-03-15 16:24:18'),(1091,0,'BENTO JAHAT (JAjanan seHAT)','2019 16020104023 Mayang farida.pdf',NULL,2070500,'<p>BENTO JAHAT merupakan sebuah makanan sehat yang konsepnya mengadopsi dari makanan Jepang kemudian dimodifikasi isinya diganti dengan makanan lokal Indonesia. Bento di Jepang sendiri dinilai praktis dan mudah dibawa kemana mana,&nbsp; dan sebagai budaya di Jepang. Dalam produk makanan ini terdapat paduan budaya Jepang dengan Indonesia sehingga memiliki nilai filosofi didalamnya.</p>','Bento|Bento sehat|Makanan sehat|Makanan|Makanan bergizi|Sehat|Praktis',1,1,'2019-03-14 21:08:48','2019-03-20 00:16:06'),(1092,0,'Satchel Crush','2019 17081324036 Rizqiya Fauziyah Akhmad.pdf',NULL,5500000,'<p>Satchel Crush multifunction bag</p>','Satchel Crush',4,1,'2019-03-14 21:30:18','2019-03-20 03:38:09'),(1093,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,1,'2019-03-14 21:31:26','2019-03-14 21:31:48'),(1094,0,'KETAWA LATAH (Keripik Tahu Walik Sambal Matah)','2019 17050634043 Vonny Yuliana.pdf',NULL,10858000,'<p>Pilihan sebuah usaha yang tepat sangat mempengaruhi kesuksesan sebuah usaha. Kami mencoba mengamati sebuah usaha yang sedang berkembang akhir-akhir ini yaitu produk makanan ringan dalam bentuk keripik. Tahu sebagai salah satu makanan yang disukai banyak orang merupakan makanan yang biasa dikonsumsi oleh masyarakat Indonesia. Selain harganya terjangkau, tahu berbahan dasar kedelai yang memgandung banyak protein.&nbsp;</p>\n<p>Hal ini menjadikan kami tertarik untuk mempelajari bagaimana cara usaha pembuatan keripik tahu. Di pasaran, keripik tahu hanya dijual dengan rasa original asin dengan kemasan yang kurang menarik. Keripik Tahu Walik Sambal Matah (KETAWA LATAH) merupakan sebuah inovasi yang kami lakukan agar menambah daya jual keripik tahu walik di pasaran. Dengan menambahkan sambal matah dan kemasan yang menarik, keripik tahu yang awalnya dipandang sebelah mata akan menarik perhatian konsumen. Selain itu cara penjualan dan promosi menjadi poin utama dalam wirausaha yang akan kami jalankan.</p>','keripik |tahu |tahu walik|sambal|sambal matah',1,1,'2019-03-14 21:37:42','2019-03-19 15:51:38'),(1095,0,'NUGGET SABU \"Sayur & Buah\"','2019 17051214067 Choirun Nisa.pdf',NULL,5365000,'<p>Nuget sabu merupakan makanan cepat saji yang berbahan dasar sayuran dan buah - buahan. Yang membedakan antara nuget sabu dengan yang lainnnya adalah nuget yang kami dibuat tidak hanya berbahan dasar ayam saja, terdapat varian rasa sayuran dan buah - buahan yang bermacam macam. Oleh karena itu kami berkeinginan untuk merubah pemikiran dan menumbuhkan minat masyarakat serta anak-anak agar lebih senang makan sayuran dan buah-buahan.&nbsp; &nbsp; Nuget sabu ini sangat bermanfaat bagi semua kalangan terutama anak - anak yang kini tidak begitu suka memakan sayuran dan buah - buahan, dengan begitu orangtua tidak perlu mengeluh anaknya tidak memakan sayuran dan buah - buahan. Dan minat anak - anak terhadap sayuran dan buah - buahan kembali menigkat.&nbsp;</p>','nugget|sayur|buah',1,1,'2019-03-14 21:40:08','2019-03-15 22:30:39'),(1096,0,'Cool! Foyo','2019 16010664065 Masyhuda fahim akhmada.pdf',NULL,6000000,'<p class=\"MsoNoSpacing\" style=\"margin-left: 17.85pt; text-align: justify; text-indent: 17.6pt; line-height: 115%; tab-stops: 14.2pt;\"><span style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; letter-spacing: -.05pt; mso-ansi-language: IN;\">Cool! Foyo adalah</span><span lang=\"EN-US\" style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; letter-spacing: -.05pt;\"> sebuah</span><span style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; letter-spacing: -.05pt; mso-ansi-language: IN;\"> usaha kuliner yang menyajikan makanan penutup atau dessert. Makanan </span><span lang=\"EN-US\" style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; letter-spacing: -.05pt;\">ini berupa frozen yogurt yang diolah dengan bayam, dimakan bersama dengan jelly dan buah-buah an segar. Produk ini menjadi unik karena yogurt dikombinasikan dengan bayam dan dibekukan, sehingga bentuk penyajiannya hamper mirip dengan ice cream. Selain itu ditambahkan jelly yang akan membuat tekstur produk ini kenyal ketika disantap. Serta buah-buahan segar seperti apel, melon, dan buah naga yang membuat produk ini sehat dan fresh. </span><span style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; letter-spacing: -.05pt; mso-ansi-language: IN;\">Bahan utama mentah usaha ini adalah yogurt yang bergizi sehingga akan menarik minat masyarakat. Dengan kombinasi yang unik, yaitu frozen yogurt dan bayam. </span><span lang=\"EN-US\" style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; letter-spacing: -.05pt;\">Yogurt mempunyai kandungan bakteri probiotik yang dapat memperbaiki proses pencernaan dan mencegah kanker atau tumor. Bahan utama lainnya yaitu bayam yang merupakan sayuran kaya nutrisi, mengandung rendah kalori, namun memiliki vitamin dan mineral tinggi. Dengan demikian akan menarik masyarakat untuk mencoba dan mengkonsumsinya. </span></p>\n<p class=\"MsoNoSpacing\" style=\"margin-left: 17.85pt; text-align: justify; text-indent: 17.6pt; line-height: 115%; tab-stops: 14.2pt;\"><span lang=\"EN-US\" style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; letter-spacing: -.05pt;\">Ide produk ini muncul karena melihat kurangnya minat anak-anak di lingkungan rumah pengusul yang kurang menyukai sayur. Sehingga tidak jarang dari mereka mengalami kesulitan buang air besar. Anak-anak, remaja, dan masyarakat umumnya menyukai ice cream, sehingga mendorong ide untuk membuat makanan penutup yang menyerupai ice cream tetapi berbahan yogurt. Buah- bua</span><span style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; letter-spacing: -.05pt; mso-ansi-language: IN;\">h</span><span lang=\"EN-US\" style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; letter-spacing: -.05pt;\">an yang dipakai dalam produk ini juga beraneka warna. Warna yang beragam diharapkan akan menarik perhatian masyarakat untuk mencicipinya. Produk ini juga dapat digunakan sebagai alternatif camilan bergizi bagi mahasiswa serta dapat dipakai untuk camilan diet bagi yang memprogramnya. </span></p>\n<p class=\"MsoNoSpacing\" style=\"margin-left: 17.85pt; text-align: justify; text-indent: 17.6pt; line-height: 115%; tab-stops: 14.2pt;\"><span lang=\"EN-US\" style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; letter-spacing: -.05pt;\">Sasaran pemasaran dari kuliner ini adalah anak-anak, mahasiswa, ibu-ibu, serta orang-orang yang meprogram diet sehat. Jajanan ini sangat sesuai untuk orang-orang yang sedang memprogram diet sehat, karena mengandung yogurt bernutrisi dan terdapat bayam kaya serat serta dapat disantap sebagai camilan ketika lapar atau dinikmati setelah berolahraga.</span></p>','Frozen Yogurt',1,1,'2019-03-14 21:57:22','2019-03-15 06:53:51'),(1097,0,'Meaningful Bouquet Paper Flowers','2019 16010664023 Niva Fadhila.pdf',NULL,5053000,'<p class=\"MsoNormal\" style=\"text-indent: 36.0pt; line-height: 115%;\"><span lang=\"IN\" style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',serif; mso-ansi-language: IN; mso-no-proof: yes;\">Di era modern ini, bekerja pada orang bukanlah satu-satunya jalan menuju kesuksesan. Banyak industri-industri kecil kreatif yang mencoba memulai usahanya, termasuk usaha <em>Meaningful Bouquet Paper Flowers</em> kami. Usaha kecil ini akan menjadi besar nantinya apabila terwadai dengan baik. Berwirausaha dapat membuka lapangan pekerjaan dan mengentas kemiskinan. <em>Meaningful Bouquet Paper Flowers</em> nantinya juga dapat menjadi lapangan pekerjaan baru yang dapat memperkerjakan ibu-ibu rumah tangga, mahasiswa, maupun pengangguran-pengangguran yang ada. Keterampilan membuat bunga dari kertas ini dapat dipelajari dengan mudah sehingga meskipun bukan dari latar belakang pengrajin tetap bisa melakukannya. Oleh karena itu, usaha <em>Meaningful Bouquet Paper Flowers</em> nantinya dapat menyerap banyak pekerja dan dapat meningkatkan perekonomian. </span></p>\n<p class=\"MsoNormal\" style=\"text-indent: 36.0pt; line-height: 115%;\"><span lang=\"IN\" style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',serif; mso-ansi-language: IN; mso-no-proof: yes;\">Peluang <em>Meaningful Bouquet Paper Flowers</em> kami cukuplah besar untuk berkembang karena saat ini banyak masyarakat, khususnya mahasiswa dan generasi milenial yang sering kali mencari <em>bouquet </em>bunga sebagai hadiah. <em>Bouquet</em> bunga asli dipasaran memiliki harga yang relative mahal, oleh karena itu kami membuat b<em>ouquet </em>bunga dari kertas yang memiliki harga lebih terjangkau. </span></p>\n<p>&nbsp;</p>\n<p class=\"MsoNormal\" style=\"text-indent: 36.0pt; line-height: 115%;\"><em><span lang=\"IN\" style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',serif; mso-ansi-language: IN; mso-no-proof: yes;\">Meaningful Bouquet Paper Flowers </span></em><span lang=\"IN\" style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',serif; mso-ansi-language: IN; mso-bidi-font-weight: bold; mso-no-proof: yes;\">akan menarik banyak minat terutama dalam kalangan mahasiswa dan generasi milenial.&nbsp; </span><em><span lang=\"IN\" style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',serif; mso-ansi-language: IN; mso-no-proof: yes;\">Meaningful Bouquet Paper Flowers </span></em><span lang=\"IN\" style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',serif; mso-ansi-language: IN; mso-bidi-font-weight: bold; mso-no-proof: yes;\">mengatasi masalah mahasiswa dan generasi milenial saat bingung memilih hadiah dengan budget pas-pasan. Meskipun demikian, kami tetap menggunakan bahan kertas kualitas </span><em><span lang=\"IN\" style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',serif; mso-ansi-language: IN; mso-no-proof: yes;\">terbaik</span></em><span lang=\"IN\" style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',serif; mso-ansi-language: IN; mso-bidi-font-weight: bold; mso-no-proof: yes;\"> sehingga akan indah dan menyerupai bentuk <em>bouquet</em> bunga asli. Oleh karena itu, </span><em><span lang=\"IN\" style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',serif; mso-ansi-language: IN; mso-no-proof: yes;\">Meaningful Bouquet Paper Flowers </span></em><span lang=\"IN\" style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',serif; mso-ansi-language: IN; mso-no-proof: yes;\">layak mendapatkan pendampingan usaha melalui PMW.&nbsp;</span></p>','bouquet|paper flowers|mahasiswa|generasi milenial',4,1,'2019-03-14 21:57:53','2019-03-15 01:53:20'),(1098,0,'Catering Menu Sehat Harian','2019 17040254076 heny kurniasari.pdf',NULL,4000000,'<p class=\"MsoListParagraph\" style=\"mso-add-space: auto; text-align: justify; margin: 6.0pt 21.6pt 10.0pt 31.5pt;\"><span style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',serif;\">Usaha Catering Menu Sehat Harian adalah usaha menu makanan sehari-hari yang sehat. Setiap satu porsi terdiri dari satu gelas minuman sehat dan satu tepak makan yang didalamnya terdapat sayuran, buah-buahan dan daging yang dapat memenuhi kebutuhan tubuh seseorang dalam sehari. Usaha catering menu sehat harian ini benar-benar tidak menggunakan minyak dalam memasaknya, tidak menggunakan gula, tepung-tepungan ataupun nasi. Dalam pengelolahannya tersebut dengan cara dikukus, direbus dan dipanggang agar tidak menghilangkan nilai gizinya.</span><span style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',serif;\">Target pemasaran produk Menu Diet Sehat Harian ini untuk semua kalangan khususnya untuk orang yang lagi program diet dan terlebih untuk orang sibuk yang malas memasak atau menginginkan sesuatu yang instan namun ingin tetap sehat.&nbsp;</span></p>\n<p class=\"MsoListParagraph\" style=\"mso-add-space: auto; text-align: justify; margin: 6.0pt 21.6pt 10.0pt 31.5pt;\">&nbsp;</p>\n<p class=\"MsoListParagraph\" style=\"mso-add-space: auto; text-align: justify; margin: 6.0pt 21.6pt 10.0pt 31.5pt;\">&nbsp;</p>','Catering, diet, Menu Sehat|catering|diet|menusehat',2,1,'2019-03-14 22:01:44','2019-03-14 22:26:04'),(1099,0,'PIGET (Pie Yoghurt)','2019 17030654057 Dwi Nur Qomariyah.pdf',NULL,7888000,'<p>Pie merupakan salah satu makanan yang bercita rasa gurih dan manis. Pada saat ini kebanyakan pie berisi fla susu. Adanya inovasi rasa sangat diperlukan agar pie yang kami buat berbeda dari pie yang di jual di pasaran. Oleh karena itu, kami menggagas sebuah ide inovasi untuk isian pie yaitu di isi dengan fla yang berbahan dasar yoghurt. Yoghurt adalah salah satu produk olahan susu yang mengandung banyak manfaat baik bagi tubuh, diantaranya dapat menurunkan tekanan darah, sebagai sumber protein yang sangat baik, dapat membantu melancarkan sistem pencernaan, dan lain sebagainya. Selain itu, pie yoghurt ini dilengkapi dengan toping yang juga menyehatkan yakni berupa potongan buah-buahan. Dengan mengingat manfaat yang baik bagi tubuh, tentunya inovasi ini akan menarik minat para konsumen dari seluruh lapisan masyarakat, baik anak-anak maupun orang dewasa. Pemasaran pie yoghurt ini dilakukan secara online dan offline. Pemasaran secara online dilakukan melalui media sosial, sedangkan pemasaran secara offline dilakukan dengan mengikuti bazar makanan dan dijajakan (oleh produsen) di lingkungan kampus. Pie yoghurt ini akan dikemas secara kekinian, sehingga dapat menarik pelanggan serta menggoda selera konsumen.&nbsp;</p>','Piget (pie yoghurt)|Pie|Inovasi',1,1,'2019-03-14 22:06:09','2019-03-19 20:13:49'),(1100,0,'O Salato - Onigiri Ayam Saos Telur Asin','2019 17051214013 Yemi Fitriana.pdf',NULL,13689500,'<p>O salato (Onigiri Ayam Saos Telur Asin) yaitu sebuah inovasi makanan kombinasi makanan khas Indonesia dan Jepang yang dibuat dengan bahan baku utama kita adalah telur asin, ayam, dan nasi. Telur asin diolah menjadi saos telur asin kemudian dipadukan dengan ayam crispi lalu dibalut dengan nasi yang sudah dibumbui seperti sushi yang dibentuk menyerupai onigiri dengan toping rumput laut. Selain untuk meningkatkan jiwa kewirausahaan kami, tujuan kami untuk menjalankan usaha ini yaitu untuk turut serta meningkatkan penghasilan peternak bebek telur, peternak sapi perah, dan turut serta memberdayakan UMKM telur asin.</p>','makanan|kekinian|saltegg|onigiri|salato|mahasiswa|murah|bergizi|telurasin|japanesefood|UMKM',1,1,'2019-03-14 22:07:34','2019-03-18 22:22:45'),(1101,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,1,'2019-03-14 22:08:55','2019-03-14 23:04:55'),(1102,0,'Keripik O-Peel (keripik kulit jeruk)','2019 16010044039 Elma Wulandari.pdf',NULL,13275000,'<p>Keripik o-peel adalah keripik yang terbuat dari kulit jeruk. Produk ini memiliki banyak nutrisi yang terkandung diantaranya vitamin C, zat besi dan masih banyak lagi, selain itu produk diolah secara bersih dan menggunakan bahan-bahan alami dari buah jeruk asli sebagai perasa yang dikemas dalam kemasan yang menarik dan juga ramah lingkungan.</p>','keripiksehat',1,1,'2019-03-14 22:12:55','2019-03-20 06:25:43'),(1103,0,'Namaste crafting','2019 16020124031 sidiq amanah.pdf',NULL,3945000,'<p>dunia modern memang menuntut manusia berkembang lebih cepat, diantaranya dari dunia pendidikan dan industri. berbagai produk yang hadir kebanyakan hanya mengutamakan keuntungan bagi pemilik usaha. tetapi disini kami berusaha membuat produk yang lebih dari itu, yaitu menguntungkan pemilik usaha dan juga mengedukasi konsumen tentang seni dan menghargai produk kratif. dari aksesoris gantungan kunci, pin dan bross kami memberikan tampilan baru yang lebih fresh dan fleksibel bagi semua usia. berbahan acrilyc dengan sentuhan manual painting dan digital art print kami memberikan hal baru bagi konsumen dengan berbagai bentuk produk yang kami tawarkan. dengan menjangkau semua kalangan, maka akan lebih mudah mengedukasi pasar dan konsumen, selain itu produk akan lebih diminati karena bentuk dan desainnyayang lebih kekinian sesuai dengan selera konsumen dan perkembangan dunia fasion. pemasaran melalui media online dan bazar akan sangat membantu pengenalan produk yang kami tawarkan.</p>','Aksesoris, acrilyc, gantungan kunci, pin, bross|aksesoris|acrilyc|gantungan kunci|pin|bross',4,1,'2019-03-14 22:14:34','2019-03-15 08:15:35'),(1104,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,1,'2019-03-14 22:18:29','2019-03-15 06:10:50'),(1105,0,'LUMER (Lumpia Pisang Merah)','2019 16010664021 Yanna Murnika Sari.pdf',NULL,8800000,'<p class=\"MsoNormal\" style=\"margin-left: .5in; text-align: justify; text-indent: .5in;\"><span style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\';\">Era Di era modern ini,banyak industry kecil dan rumahan yang gencar disuarakan oleh pemerintah agar menunjang perekonomian negara. Banyak industri-industri kecil kreatif yang mencoba memulai usahanya, termasuk usaha <em style=\"mso-bidi-font-style: normal;\">Lumer (</em>Lumpia pisang merah<em style=\"mso-bidi-font-style: normal;\">) </em>kami. Usaha kecil ini akan menjadi besar nantinya apabila terwadai dengan baik. Berwirausaha dapat membuka lapangan pekerjaan dan mengentas kemiskinan. Lumpia pisang merah ini nantinya juga dapat menjadi lapangan pekerjaan baru yang dapat memperkerjakan ibu-ibu rumah tangga, mahasiswa, maupun pengangguran-pengangguran yang ada dengan sedikit modal yang diperlukan untuk memulai usaha ini. Ketelatenan dalam membuat lumpia pisang merah ini tidak memerlukan banyak waktu sehingga banyak orang yang dapat membuatnya termasuk mahasiswa dan ibu rumah tangga yang memiliki kegiatan lainnya.</span></p>\n<p class=\"MsoNormal\" style=\"margin-left: .5in; text-align: justify; text-indent: .5in;\"><span style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\';\">Peluang lumpia pisang merah kami cukuplah besar untuk berkembang karena saat ini banyak masyarakat, khususnya mahasiswa dan generasi milenial yang sering kali mencari makanan murah namun sehat dan higienis. Lumpia pisang merah dipasaran memiliki harga yang cukup murah namun belum tentu terjamin kualitasnya, oleh karena itu kami membuat lumpia pisang merah <span style=\"mso-bidi-font-weight: bold; mso-no-proof: yes;\">yang memiliki harga lebih terjangkau. </span></span></p>\n<p class=\"MsoNormal\" style=\"margin-left: .5in; text-align: justify; text-indent: .5in;\"><span style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\';\">Lumpia pisang merah <span style=\"mso-bidi-font-weight: bold; mso-no-proof: yes;\">akan menarik banyak minat terutama dalam kalangan mahasiswa dan generasi milenial.<span style=\"mso-spacerun: yes;\">&nbsp; </span></span>Lumpia pisang merah <span style=\"mso-bidi-font-weight: bold; mso-no-proof: yes;\">mengatasi masalah mahasiswa dan generasi milenial saat bingung memilih makanan enak dan sehat dengan budget pas-pasan. Meskipun demikian, kami tetap menggunakan bahan baku kualitas terbaik sehingga akan menghasilkan makanan dengan mutu terbaik pula. Oleh karena itu, </span>lumpia pisang merah layak mendapatkan pendampingan usaha melalui PMW. </span></p>','LUMPIA|PISANG|MERAH',1,1,'2019-03-14 22:20:06','2019-03-17 19:07:17'),(1106,0,'Mochi Moji','2019 16010664053 Anggraheni Puspita Dewi.pdf',NULL,3263000,'<p>&nbsp;</p>\n<p style=\"margin: 0px 0px 0px 19px; text-align: justify; text-indent: 21.8pt;\"><span lang=\"EN-US\" style=\"margin: 0px; font-family: \'Times New Roman\',serif;\"><span style=\"font-size: medium;\">Wirausaha merupakan salah satu kegiatan penyaluran hobi yang bisa mendatangkan keuntungan. Dengan berwirausaha kita mendapat banyak pengalaman seru dan juga menegangkan. Apalagi jika berwirausaha dibidang kuliner, sensasi menegangkan didapat ketika menunggu komentar atas apa yang telah disajikan pada pelanggan. Komentar baik ataupun buruk menjadi satu kepuasan tersendiri untuk memacu semangat belajar lebih keras dan melakukan banyak inovasi lagi supaya pelanggan puas atas produk kuliner yang kita buat. Salah satu produknya yakni &ldquo;Mochi Moji&rdquo; merupakan produk mochi yang memiliki banyak kejutan isi didalamnya. Memiliki visual yang menarik, varian isi yang mengejutkan tiap harinya, dan packaging yang memikat hati dan sulit terlupakan. </span></span></p>\n<p>&nbsp;</p>','Mochi Moji',1,1,'2019-03-14 22:20:27','2019-03-15 03:47:21'),(1107,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,'2019-03-14 22:27:50','2019-03-14 22:27:50'),(1108,0,'MALIKA (MASKER KULIT ALPUKAT)','2019 16010044059 elyta nichlah mayyustita.pdf',NULL,10000000,'<p class=\"MsoNormal\"><span style=\"mso-fareast-font-family: Calibri;\">Buah alpukat adalah buah yang memiliki banyak sekali manfaatnya. Bagian buah alpukat yang biasanya dikonsumsi dan diambil manfaatnya adalah daging dan bijinya. Namun ada satu bagian yang terlewatkan oleh semua orang, yang tentunya juga terdapat berbagai manfaat untuk kesehatan manusia, terkhususnya pada<span style=\"mso-spacerun: yes;\">&nbsp; </span>kecantikan kulit manusia. Bagian tersebut adalah kulit buah alpukat. MALIKA adalah masker wajah alami yang terbuat dari bahan dasar kulit alpukat yang telah dikeringkan dengan diberikan sedikit campuran minyak zaitun yang yang berfungsi untuk melembabakan wajah. Selain melembabakan masker ini juga banyak sekali manfaatnya, seperti membersihkan wajah secara alami, mencegah jerawat. menghilangkan bekas jerawat dan berbagai menfaat lainnya.</span></p>','MALIKA|PMW2019|KECANTIKAN|MASKER|UNESA',4,1,'2019-03-14 22:27:50','2019-03-20 01:17:56'),(1109,0,'BAGOES BAGPACK WITH SHOES COMPARTMENT','2019 17081194070 Taufiqur Rohman.pdf',NULL,8000000,'<p>Tas ini merupakan tas <em>bagpack</em> yang berisikan tempat untuk menaruh sepatu di dalamnya. Misalnya saat kita sedang dikampus sampai malam hari atau kita mau sholat di masjid dan ingin melepas sepatu kita, kita mempunyai wadah untuk menaruh sepatu kita. Tas ini juga merupakan jawaban dari perkembangan zaman dimana semakin tahun orang &ndash; orang mulai mencari produk sepatu yang original dan kita tahu sepatu original itu juga harganya tidak murah, sehingga kita bisa menyimpan sepatu kesayangan kita ke dalam tas dengan mudah dan tidak perlu ribet.</p>','Bagpack, Tas.',4,1,'2019-03-14 22:29:41','2019-03-20 05:23:03'),(1110,0,'Pengkolan Nusantara','2019 17010714021 Riskiyatul hasanah.pdf',NULL,5000000,'<p>Usaha kami bergerak dibidang makanan yang merupakan inovasi dari makanan yang sudah ada saat ini. Makanan ini merupakan jalan keluar dari permasalahan di suatu daerah. Makanan ini berasal dari ikan tongkol yang melimpah didaerah pesisir khususnya di Desa Sangkah, Sepuluh, Bangkalan. Produk ini kami pilih karena ikan tongkol yang melimpah di Desa Sangkah tidak diimbangi dengan kretifitas pengolahannya. Ikan tongkol hanya dijual dan dijadikan lauk pauk oleh warga setempat, sehingga hasil laut yang melimpah tidak bisa dimanfaatkan dengan maksimal dan tidak memberi dampak yang signifikan. Produk yang bernama &ldquo;Pengkolan Nusantara&rdquo; Pentol Tongkol Nusantara ini diharapkan akan memberi dampak yang baik dan dapat dijadikan makanan khas daerah Bangkalan. Pentol kami pilih karena banyaknya masyarakat yang menyukai pentol dan rasa-rasa nusantara seperti rasa rendang, soto, sate dan gulai yang telah kental dengan lidah orang Indonesia. Kami juga akan menampung kritik dan saran dari konsumen sehingga kami bisa memperbaiki produk kami sesuai saran dan selera konsumen.</p>\n<p>&nbsp;</p>','Inovatif|Kreatif|Bergizi|Berkualitas|Unik',1,1,'2019-03-14 22:35:07','2019-03-14 23:09:03'),(1111,0,'TOKANI (Totebag Karung Goni)','2019 17040254053 Nurfadila Raudotun Nisa.pdf',NULL,6425000,'<p>Di era milenial sekarang ini tas merupakan sebuah kebutuhan yang wajib dimiliki oleh setiap orang baik laki - laki maupun perempuan. Kemanapun orang bepergian baik acara formal maupun non-formal tas merupakan benda wajib yang harus dibawa. ukurannya pun beragam mulai dari yang berukuran kecil,sedang, hingga besar dengan model dan motif yang beragam.&nbsp;&nbsp;</p>','tas|milenial',4,1,'2019-03-14 22:37:41','2019-03-14 22:54:54'),(1112,0,'ICON EL VIDI','2019 16040284001 Vikky Nur Vaisyal.pdf',NULL,8910000,'<p>ICON EL VIDI</p>\r\n<p>Musik adalah suara yang disusun demikian rupa sehingga mengandung irama, lagu, nada, dan keharmonisan terutama dari suara yang dihasilkan dari alat-alat yang dapat menghasilkan irama Walaupun musik adalah sejenis fenomena intuisi, untuk mencipta, memperbaiki dan mempersembahkannya adalah suatu bentuk seni. Mendengar musik adalah sejenis hiburan. Musik adalah sebuah fenomena yang sangat unik yang bisa dihasilkan oleh beberapa alat musik. Dewasa ini salah satu aliran yang sedang digandrungi dan sering dipentaskan ialah music akustik. Musik akustik sendiri merupakan Musik akustik adalah musik yang secara tunggal dan secara utama memakai alat musik yang menghasilkan suara melalui alat musik akustik, berseberangan dengan alat musik elektronik atau alat musik elektrik. Meskipun semua musik sempat merupakan akustik, retronim \"musik akustik\" muncul setelah kemajuan alat-alat musik elektrik, seperti gitar elektrik, biola eletrik, organ elektrik dan synthesizer. Selain mudah dimainkan, musik akustik juga tidak memerlukan banyak peralatan musiknya. Salah satu alat yang saat ini juga menjadi peralatan wajib dalam pertunjukan musik akustik adala cajon. Namun harga cajon yang terbilang mahal membuat terkadang cajon tidak digunakan. Melihat hal ini kami ingin membuat produk cajon yang murah serta mudah dibawa kemana &ndash; mana dengan kualitas yang tidak kalah bersaing.</p>','Enter|Cajon|Musik|Industri|Cahon|Alat musik',4,1,'2019-03-14 22:39:29','2019-03-19 18:29:03'),(1113,0,'Bakdabak Achimi','2019 17040254080 Nur Kurdiati Debila.pdf',NULL,6100000,'<p>Bakdabak achimi adalah cireng ikan laut yang khas dari madura.</p>','Ikan, bakdabak, cireng ikan',1,1,'2019-03-14 22:44:01','2019-03-15 03:13:07'),(1114,0,'LiAr','2019 16010664073 BUDHININGTHIYAS.pdf',NULL,6273000,'<div class=\"WordSection1\">\n<p class=\"MsoNormal\" style=\"text-align: justify; text-indent: 35.45pt;\"><span style=\"font-size: 12pt; line-height: 18.4px; font-family: \'Times New Roman\', serif;\">Salah satu permasalahan yang sedang di hadapi oleh Negara Indonesia adalah minimnya jumlah lapangan pekerjaan, hal tersebut memicu naiknya jumlah pengangguran. Sebagai seorang mahasiswa, kami merasa tertantang untuk mengambil bagian dalam mengatasi permasalahan tersebut. &nbsp;Salah satu caranya untuk saat ini adalah dengan mengikuti Program Mahasiswa Wirausaha (PMW). Adanya program PMW tersebut dapat membantu kami menyalurkan ide-ide yang kami miliki, yang nantinya kami harapkan dapat membantu pemerintah Indonesia dalam membuat lapangan pekerjaan yang sesuai dengan kemampuan yang kami miliki.</span></p>\n<p class=\"MsoNormal\" style=\"text-align: justify; text-indent: 35.45pt;\">&nbsp;</p>\n<span style=\"font-size: 12pt; line-height: 18.4px; font-family: \'Times New Roman\', serif;\">Pada proposal ini, kami memiliki ide untuk membuat inovasi baru terkait lilin aromaterapi, yang kami beri nama &ldquo;LiAr&rdquo;. Ide tersebut muncul karena kami merasa bahwa pada saat ini lilin aromaterapi yang dijual di pasaran tidak memiliki banyak inovasi dan cenderung sama antara satu dengan lainnya. Produk yang kami buat berbeda dengan produk yang telah ada di pasaran. Perbedaannya terletak pada bentuk, variasi aroma, serta tempat lilin (<em>candle holder</em>). LiAr memiliki berbagai macam bentuk yang menarik. Dalam satu buah lilin, terdapat dua sampai tiga aroma, oleh karena itu aroma yang dihasilkan nantinya akan berubah sesuai masa nyala lilin. LiAr juga bermanfaat dalam membantu merilekskan tubuh penggunanya, selain itu juga dapat digunakan sebagai penghias ruangan karena bentuknya yang unik. Lebih lanjut, kami sangat berharap bahwa proposal PMW &ldquo;LiAr&rdquo; yang kami ajukan saat ini dapat diterima dengan baik.</span>\n<p>&nbsp;</p>\n</div>\n<p><span style=\"font-size: 12pt; line-height: 18.4px; font-family: \'Times New Roman\', serif;\">&nbsp;</span></p>','Lilin Aromaterapi',4,1,'2019-03-14 22:45:45','2019-03-15 07:02:41'),(1116,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,1,'2019-03-14 22:51:13','2019-03-16 13:48:00'),(1117,0,'RAJA - RUMAH REMAJA','2019 16010664067 Dinda ayu mutiara pramesty.pdf',NULL,10,'<p class=\"MsoListParagraphCxSpFirst\" style=\"mso-add-space: auto; text-align: justify; text-indent: 36.0pt; margin: 12.0pt 0cm 10.0pt 0cm;\"><span style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; mso-fareast-font-family: Ebrima; color: black; mso-ansi-language: IN;\">Rumah remaja merupakan sebuah wadah untuk menampung remaja yangmengalami permasalahan baik sosial, keluarga maupun masalah yang lainnya. Atau dengan kata lain, rumah remaja merupakan tempat bagi para remaja untuk membuang sampah psikologis mereka. Di tempat ini remaja juga dapat&nbsp;</span><span style=\"text-indent: 36pt; font-size: 12pt; line-height: 115%; font-family: \'Times New Roman\', serif;\">menuangkan kreatifitasnya seperti melukis, bermain musik, membuat kerajinan tangan, dan lain sebagainya.&nbsp;</span><span style=\"text-indent: 36pt; font-size: 12pt; line-height: 115%; font-family: \'Times New Roman\', serif;\">Nantinya remaja yang bergabung juga akan diberi edukasi dan diberdayakan agar tidak menjadi anak jalanan yang dianggap meresahkan masyarakat</span></p>','Raja|Rumah remaja|Psikologi|Surabaya',2,1,'2019-03-14 22:52:49','2019-03-15 02:05:11'),(1118,0,'CENAKLUR (Cemilan Enak Keripik Telur)','2019 16040284084 Yoga Afwana Putra Sonda.pdf',NULL,14606000,'<p><span style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; mso-fareast-font-family: Calibri; letter-spacing: -.05pt; mso-ansi-language: EN-US; mso-fareast-language: EN-US; mso-bidi-language: AR-SA;\">Cenaklur ( Cemilan Enak Keripik Telur )</span><span style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; mso-fareast-font-family: Calibri; mso-ansi-language: EN-US; mso-fareast-language: EN-US; mso-bidi-language: AR-SA;\"> &nbsp;merupakan sebuah makanan yang terbilang unik. Jika biasanya telur diolah menjadi omlate atau digunakan lauk makanan dan juga jamu saja, maka berbeda dengan kami karena kami ingin membuat inovasi baru yaitu keripik telur sebagai makanan cemilan yang dapat dinikmati banyak orang. Sehingga kami akan memberikan menu tampilan keripik telur dengan banyak varian rasa agar terlihat lebih menarik</span></p>','Cemilan Keripik Telur',1,1,'2019-03-14 22:58:19','2019-03-16 00:00:38'),(1119,0,'Tahu Krispi Jancok','2019 16040284072 Ahmad Dimas Romadhon.pdf',NULL,6000000,'<p>Tahu Krispi Jancok adalah olahan makanan ringan berbahan dasar tahu. penggunaan kata&nbsp;<em>jancok</em> disini, dimaksudkan untuk menggaambarkan varian rasa yang sangat pedas yang terdapat dalam produk tahu krispi kami, kami memilih kata tersbut dikarenakan sangat familiar bagi orang Surabaya dan diharapkan produk kami mudah diinggat dan sukai oleh seluruh mahasiswa dan masyarakat, khususnya yang tinggal di Surabaya.</p>','tahu, pedas, camilan|tahu|krispi|makanan|camilan|pedas',1,1,'2019-03-14 23:08:54','2019-03-15 01:50:39'),(1120,0,'Rainbow Goat Milk Pudding','2019 16030194036 Nuril Lailiyah Iswahyuni.pdf','2019 16030194036 Nuril Lailiyah Iswahyuni.pdf',5000000,'<p class=\"MsoNormal\" style=\"text-align: justify; text-indent: 36.0pt; line-height: 150%;\"><span style=\"font-size: 12.0pt; line-height: 150%; font-family: \'Times New Roman\',\'serif\'; mso-bidi-font-family: Arial;\">Rainbow goat milk puding merupakan usaha yang bergerak di bidang makanan ringan berupa puding berbahan dasar susu kambing dengan aneka rasa buah. Susu kambing yang digunakan adalah susu kambing etawa yang telah dikenal khasiatnya, namun masih minim usaha pengolahan lebih lanjut, maka produksi susu kambing yang diolah dalam bentuk puding dapat menarik perhatin konsumen untuk mengonsumsinya. Penggunaan beberapa rasa buah sebagai pewarnaan puding (<em>rainbow</em>) membuat penampilan puding ini menarik dan sehat karena tidak menggunakan pewarna buatan.</span><span style=\"font-family: \'Times New Roman\', serif; font-size: 12pt;\">Dengan adanya produk ini, susu kambing etawa dapat dimanfaatkan dengan berbagai inovasi sehingga membuat konsumen tertarik untuk mengonsumsinya ataupun diguanakan dalam pengobatan. Maraknya puding yang dijual dipasaran yang menggunakan pengawet yang bukan bahan alami, sehingga memunculkan ide untuk membuat puding yang sehat dan dapat dikonsumsi di segala kalangan usia</span></p>',NULL,1,1,'2019-03-14 23:16:30','2019-05-01 15:04:20'),(1121,0,'Yaki Aigiri ','2019 17020104026 Kevin Keegan Latuheru.pdf',NULL,4221000,'<p>Pada masa globalisasi seperti saat ini tentu saja masyarakat Indonesia khususnya kaum remaja dan pemuda sangat berminat dengan kuliner dari luar negeri atau kuliner indonesia yang memiliki brand atau nama dari bahasa asing. Dari dasar itulah &ldquo;Yaki Aigiri&rdquo; dibuat, dengan bahan dasarnya onigiri (makanan khas Jepang). Dimana yaki aigiri ini terbuat dari roti tawar yang kemudian diberi isian es krim beraneka ragam kemudian digoreng dan diberi sedikit sentuhan akhir dengan balutan nori semacam kertas yang terbuat dari olahan rumput laut. Pada saat ini onigiri dengan cita rasa manis dan dingin juga gurih belumlah banyak yang menjual onigiri dengan cita rasa tersebut. Oleh karena itu, Yaki aigiri ini sangat cocok untuk masyarakat Surabaya dan sekitarnya. Dimana udara di Surabaya sendiri terbilang cukup panas pada siang hari yang membuat yaki aigiri semakin tinggi peminatnya dengan cita rasa khas kesukaan orang Indonesia. Yaki aigiri sendiri terbilang produk yang berpeluang besar karena produknya yang memiliki citarasa khas dan harga yang murah. Ditambah dengan banyaknya peminat makanan khas Jepang yang ada di Indonesia umumnya dan Surabaya khususnya. Yaki Aigiri sendiri sangat baik untuk kesehatan dan merupakanan makanan yang pas untuk penunda lapar.&nbsp;&nbsp;</p>\n<p>&nbsp;</p>','YakiAigiri|||',1,1,'2019-03-14 23:19:33','2019-03-16 02:36:58'),(1122,0,'Susu Tanpa Kaleng ( Sustakal )','2019 16040284053 Muhammad Dawud Basari.pdf',NULL,9000000,'<p>Susu murni dengan berbagai rasa yang pastinya menyehatkan dengan harga bersahabat</p>','Susu tanpa kaleng SUSTAKAL',1,1,'2019-03-14 23:22:28','2019-03-15 07:01:59'),(1123,0,'BACOK MOERA (Brownies Cokelat Moringa Oleifera)','2019 17010034052 Denta Gara Yusvano.pdf',NULL,4105500,'<p class=\"MsoNormal\" style=\"text-align: justify; line-height: 115%; margin: 0cm 13.4pt .0001pt 70.0pt;\"><span style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; mso-fareast-font-family: Ebrima;\">Kami membuat kegiatan usaha di bidang kuliner yaitu &ldquo;<span style=\"mso-font-width: 96%;\">BACOK MOERA (Brownies Coklat <em style=\"mso-bidi-font-style: normal;\">Moringa Oleifera</em>)&rdquo;. BACOK MOERA adalah produk jajanan kuliner berupa brownies cokelat yang berbahan dasar <em style=\"mso-bidi-font-style: normal;\">Moringa Oleifera </em>(tumbuhan daun kelor) dimana daun kelor memiliki banyak manfaat antara lain anti stress, menurunkan gula darah, mengurangi peradangan (anti-inflamasi), menurunkan kolesterol, mengandung antioksidan, anti kanker, anti diabetes, mengobati arthritis, menjaga kesehatan sistem pencernaan, dan sebagainya.</span></span></p>','makanan|Brownies|Daun Kelor|Makanan',1,1,'2019-03-14 23:28:11','2019-03-15 01:28:26'),(1124,0,'Pasmin Si KOBEL','2019 17080554048 Heru Jaka Pratama.pdf',NULL,5256000,'<p>Pasmin Si KOBEL (Pastel mini isi Kol Banda dan daging Lele) merupakan makanan yang kaya akan gizi dan manfaat yang baik bagi tubuh, berkat kandungan alkaloid, flavonoid, dan polifenol yang ada pada daun kol banda serta kandunga omega 3 dan 6 pada daging ikan lele. daun kol banda yang diolah dengan daging ikan lele menjadi abon lalu dimasukkan ke dalam adonan pastel membuat cita rasa manis dan gurih dengan tekstur renyah di luar dan lembut di dalam. ditambah lagi dengan taburan bumbu balado, barbaque dan keju yang dapat dipilih sesuai keinginan membuat Pasmin Si KOBEL semakin menggoda untuk dinikmati</p>','pastel mini|makanan ringan|kol banda|kuliner',1,1,'2019-03-14 23:47:50','2019-03-15 15:04:15'),(1125,0,'SEMIR KUTANG (SEMIR SEPATU DARI KULIT PISANG)','2019 17010024082 Sulih aji pangestu.pdf',NULL,1255000,'<p><span lang=\"IN\" style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; mso-fareast-font-family: Ebrima; mso-ansi-language: IN; mso-fareast-language: EN-US; mso-bidi-language: AR-SA;\">Dengan usaha ini diharapkan dapat memenuhi kebutuhan masyarakat terutama kalangan pencinta sepatu hitam. Konsumen yang pertama dibidik adalah mahasiswa karena untuk mendapatkan keuntungan yang lebih dan bisa memperkenalkan usaha kami</span></p>','SEMIR KUTANG|SEMIR KULIT PISANG|SEMIR SEPATU',4,1,'2019-03-15 00:00:40','2019-03-15 03:33:01'),(1127,0,'Steak Tempe Berlumpur','2019 17010644085 FIRDA ALVIYANTI.pdf',NULL,4000000,'<p>Steak Tempe Berlumpur adalah steak yang bahan utamanya teebuat dari tempe yang menggunakan saus sambal kacang.&nbsp; Keunikan dari steak temoe berlumpur yaitu bahan steak bukan teebuat dari daging melainkan dari tempe</p>','Steak|Temoe|Tempe',1,1,'2019-03-15 00:20:18','2019-03-15 04:22:07'),(1128,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,'2019-03-15 00:20:19','2019-03-15 00:20:19'),(1129,0,'TAKO WORTH IT (Takoyaki Wortel Halal Istimewa)','2019 17010714065 Moch. Anwar.pdf',NULL,5693000,'<p>Takoyaki merupakan salah satu cemilan khas jepang yang berbentuk bulat kecil-kecil serupa bola pingpong. Namanya yang unik dan rasanya yang lezat membuat takoyaki banyak digemari dan menjadi trend dikalangan anak muda saat ini. Meskipun makanan ini bukan khas Indonesia, akan tetapi makanan ini cukup mendapat respon yang baik dari masyarakat indonesia.</p>\r\n<p>Disini kami mengolah produk takoyaki ini dengan inovasi yang baru yaitu dengan memadukan kelezatan dari takoyaki itu sendiri dengan varian sayuran seperti wortel. Dimana wortel itu sendiri mengandung vitamin A yang baik untuk kesehatan mata. Selain itu isian dari takoyaki yang kami buat berbagai varian seperti gurita, ayam, sosis, udang dan masih banyak lagi. Dengan demikian makanan ini memiliki kandungan gizi yang tidak hanya didapatkan pada wortel saja, tetapi juga pada varian isi tersebut.</p>','Takoyaki|Inovatif|Makanan bergizi',1,1,'2019-03-15 00:23:26','2019-03-20 02:37:28'),(1130,0,'CIDAK (Cabe Isi Daging Ayam dan Kentang)','2019 16040284085 Fitri Emiya Ayu Lestari.pdf',NULL,13364000,'<p>CIDAK</p>\n<p>(CABAI ISI DAGING AYAM DAN KENTANG)</p>\n<p>Indonesia saat ini merupakan Negara yang mencoba untuk menggalakkan masyarakat untuk dapat menciptakan lapangan pekerjaan dengan cara membuka usaha. Dengan cara hal tersebut mampu mewujudkan untuk mengubah Indonesia dari Negara berkembang menjadi Negara maju. Hal tersebut dikarenakan beberapa Negara maju di Asia merupakan Negara dengan memiliki omset perekonomian yang cukup tinggi yang berasal dari wirausaha, cotohnya adalah China, Jepang, Singapore dan lain sebagainya. Untuk itu pemerintah khususnya yang menangani perguruan tinggi yaitu DIKTI mewajibkan seluruh perguruan tinbgi untuk dapat membrikan pengetahuan awal dan mengajak anak muda untuk mengetahui cara membuka awal usaha. Beberapa dana awal untuk modal bahkan akan diberikan kepada anak muda yang benar-benar memiliki jiwa tinggi dalam wirausaha.</p>\n<p>Selain perguruan tinggi beberapa perusahan atau bank besar yang ada di Indonesia juga membuka peluang yang besar kepada generasi muda yang menginginkan untuk membuka lapangan usaha namun masih belum memiliki modal. Sehingga, dari informasi tersebut, sebagai masyarakat yang juga mendukung penuh akan program pemerintah harus berusaha untuk menyebarkan info dari data yang benar dan berusaha untuk mengikutinya. Saat ini, usaha di kalangan masyarakat banyak yang mengangkat kuliner baik makanan atau minuman. Hal tersebut dinilai sangat menjual dengan lingkungan masyarakat yang semakin menginginkan apapun dengan instan.</p>\n<p>Namun satu hal yang harus sangat diperhatikan bagi para masyarakat yang ingin membuka lapangan usaha adalah dengan melihat pasar masyarakat. Bahwa tidak semua ide yang kita buat dapat diterima dengan tangan terbuka. Untuk itu inovasi serta melihat apa yang menjadi kegemaran masyarakat adalah suatu kunci dari mencari ide untuk dapat diterima oleh masyarakat. Salah satunya adalah kuliner makanan dengan memiliki level pedas. Kita ketahui bahwa saat ini merupakan trend banyak masyarakat menyukai kuliner dengan level pedas hal tersebut menjadi sebuah tantangan tersendiri bagi mereka.</p>\n<p>Lalu bagaimana yang harus kita lakukan untuk menyiapkan hal yang digemari oleh masyarakat? Apakah mungkin usaha atau ide kita dapat diterima dengan tangan terbuka oleh masyarakat apabila memakai ide makanan pedas? Jawabannya adalah bias. Yaitu dengan mencampurkan makanan yang ringan dan tetap mengandung kandungan sehat untuk kebutuhan tubuh serta menyajikan dalam bentuk yang berbeda.</p>','cabai|daging|ayam|makanan|kentang',1,1,'2019-03-15 00:45:12','2019-03-15 05:28:36'),(1131,0,'Bulletin Naluri (Nael, Lulu, Risa)','2019 17020084073 Nathanael Santika.pdf',NULL,5000000,'<p class=\"MsoNoSpacing\" style=\"text-align: justify; line-height: 150%; tab-stops: 14.2pt;\"><span style=\"font-size: 12.0pt; line-height: 150%; font-family: \'Times New Roman\',\'serif\'; letter-spacing: -.05pt;\">Kreatifitas yang kami lakukan, wujudkan dan ingin mendapatkan bimbingan serta binaan dari tim PMW Unesa adalah berupa bulletin journal yang unik dan berbeda dari yang lainnya.Produk kami termasuk jenis industry kreatif. Produk ini kami beri judul Bulletin Naluri (Nael, Lulu, Risa). Bulletin ini dikemas dengan sangat menarik dan berbeda dari yang lainnya. Terlebih lagi, bulletin ini tersedia dalam berbagai pilihan atau dapat dicustom sesuai minat pembeli. Di sini kami menargetkan produk ini kepada mahasiswa-mahasiswa yang merasa kesulitan dalam memanage waktu atau keuangan mereka. Dengan bulletin journal ini, mereka akan lebih tertarik untuk memanage waktu dan keuangan mereka. Selain itu, kami juga turut membantu pembeli untuk member reward bagi hidup mereka melalui isi-isi (fasilitas) yang ada dalam produk kami. Latar belakang dalam pembuatan produk ini adalah kemalasan mahasiswa dalam mengatur waktu dan seringnya mahasiswa melakukan hal-hal yang sesungguhnya tidak bermanfaat bagi kehidupan mereka. Selain itu, mahasiswa juga sering merasa kesusahan dalam mengatur keuangan mereka. Dengan produk ini, kami berniat dan berfokus untuk membantu mahasiswa memanage waktu serta keuangan mereka dengan baik dan benar menggunakan produk industry kreatif asli Indonesia.</span></p>','bulletin|naluri|bulletinnaluri|jurnal|nathanael|risa|lulu',4,1,'2019-03-15 00:52:57','2019-03-15 01:45:06'),(1132,0,'Ikat Pinggang seragam untuk santri Pondok Pesantren Modern Al Kautsar','2019 17010024023 A. M. Fathulloh.pdf',NULL,5000000,'<p>Usaha ini adalah usaha industri kreatif dalam bidang pengadaan barang untuk sekolah berupa ikat pinggang seragam yang didesain sendiri mamun produksinya bekerja sama dengan perusahaan produksi lain.&nbsp;</p>\r\n<p>Usaha ini juga untuk mengembangkan perekonomian pondok pesantren melalui koperasinya yang menjadi mitra distribusi kami kepada pelanggan.&nbsp;</p>','Industri|Kreatif|Ikat pinggang|Industri kreatif|Produksi|Reseller|Usaha|Perusahaan|Pesantren|Pondok|Distributor|Distribusi',5,1,'2019-03-15 01:10:16','2019-03-15 12:18:55'),(1133,0,'SOBEG PAINTING','2019 17020124034 ELLY ZATI NUR ALFI SANAH.pdf',NULL,11182000,'<p>Sobeg painting yaitu sepatu dan tas totebag lukis. memadukan desain batik tradisional ataupun modern dengan memanfaatkan keahlian kami pada bidang seni rupa. Sehingga mampu memberikan aksen pendukung pada setiap penapilan fashion pada era milenial ini. Kami tentunya memodifikasi desain dengan menambahkan cat <em>glowing in the dark</em> ataupun gambar kartun, doodle, dan lain sebagainya agar tidak terkesan ketinggalan zaman.</p>','sepatu dan totebag lukis|sepatu lukis|totebag lukis|sepatu|totebag|kekinian|murah|sepatu lukis murah|totebag lukis murah|unik|lukis unik|sepatu batik|totebag batik|custom sepatu|custom totebag|fashion|hitz',4,1,'2019-03-15 01:11:35','2019-03-15 06:09:43'),(1134,0,'Talas Dog Imasese','2019 17020114042 Debby Erlambang.pdf',NULL,2341000,'<p>Talas dog adalah makanan kreasi dari hotdog dan corndog (dari korea) yang hits dan instagramable dan rasa yang nikmat, dimodifikasi dengan bahan dasar tepung talas untuk pemanfaatan bahan lokal tanpa mengurangi cita rasanya.</p>','TALASDOG|Talas|Mozarela|Corndog',1,1,'2019-03-15 01:26:36','2019-03-15 06:03:54'),(1135,0,'Chum ngai ( milksheek daun kelor)','2019 17010024085 Mega Novita Sari.pdf',NULL,5500,'<p>Milksheek Daun kelor adalah minuman yang terbuat dari bahan daun yang mengandung nutrisi seperti vitamin, meneral , dan asam amino. Daun kelor banyak mengandung vitamin A,C, dan E. Tak hanya itu daun kelor juga berguna bagi kesehatan tubuh.</p>','Minuman',1,1,'2019-03-15 01:31:15','2019-03-20 06:08:39'),(1136,0,'Stici UC','2019 16020104027 Faris Robbany Taufiqurochman.pdf',NULL,3678000,'<p><strong>PROPOSAL STICI UC</strong></p>','Proposal Stici UC|proposal|stici uc',2,1,'2019-03-15 01:37:37','2019-03-18 22:16:46'),(1137,0,'Nushirttara Distro and Clothing','2019 17050754032 ALDIANSYAH RUSMINANDA.pdf',NULL,14150000,'<p>Usaha ini merupakan usaha yang memiliki kreativitas serta inovasi untuk membuat usaha distro dan pakaian yang lebih prospektif. Karena dalam pengelolaan usaha di bidang pakaian, diharapkan nantinya mampu mendorong kemajuan ekonomi kerakyatan di daerah-daerah. Usaha ini mengelola dari proses design, produksi, pemasaran,pengemasan hingga pengiriman hasil produk. Jadi usaha ini sangat mempertimbangkan aspek penekanan hasil produk dan memaksimalkan pemasaran produk. Dari Proses design kita melakukan riset tentang tema relief yang diangkat, seperti riset tentang ceritanya, detail, dan aspek yang ingin ditonjolkan. Proses produksi melibatkan vendor atau ukm Pembina yaitu Bandung Syndicate Sablon Kertosono. Target awal produksi adalah 3-10 design dengan masing-masing design diproduksi 12pcs kaos. Setiap design yang keluar akan dievaluasi mengingat kebutuhan dan pasar kaos distro sangat cepat berubah. Jadi ketika design sudah tidak lagi dianggap menarik akan dievaluasi dan akan dijadikan bahan untuk promosi seperti melakukakan give away dengan cuma&ndash;cuma. Tantangan tersendiri yaitu untuk brand kaos baru untuk menembus pasar nasional kaos distro, maka dari itu marketing pada saat ini lebih menjadi peran utama perkembangan brand &ldquo;NUSHIRTTARA&rdquo;. Adapun bentuk kerja sama dengan berbagai pihak sudah kita fikirkan matang-matang dengan siapa dan keuntungan seperti apa yang ingin dicapai bersama. Sasaran dari brand ini tentu saja para kawula muda,wisatawan, dan toko-toko merchandise. Selain dari sisi ekonomi NUSHIRTTARA juga mempunyai tujuan lain dimana kita ingin memperkenalkan kembali peninggalan sejarah nenek moyang yang dewasa ini sudah mulai dilupakan. Harapan kedepannya dengan memakai kaos dari NUSHIRTTARA para konsumen merasa memiliki dan ikut melestarikan budaya bangsa sendiri. Dan sebagai bentuk kepedulian kita kita akan menyisihkan sedikit keuntungan kita untuk CSR pada bidang pendidikan dan kebudayaan di Indonesia.</p>','Relief|Kaos|Desain',4,1,'2019-03-15 01:39:04','2019-03-20 01:47:37'),(1138,0,'BAYEG (Banana Layered By Egg)','2019 16021254037 Rr. Rahmadiana Ramadhanty.pdf',NULL,15000000,'<p class=\"MsoNoSpacing\" style=\"text-align: justify; line-height: 150%; tab-stops: 14.2pt;\"><span style=\"font-size: 12.0pt; line-height: 150%; font-family: \'Times New Roman\',\'serif\'; letter-spacing: -.05pt;\">BAYEG (Banana Layered By Egg)</span></p>\n<p class=\"MsoNoSpacing\" style=\"line-height: 150%; tab-stops: 14.2pt;\"><span style=\"font-size: 12.0pt; line-height: 150%; font-family: \'Times New Roman\',\'serif\'; letter-spacing: -.05pt;\">Keunikan memiliki cita rasa pedas manis yang lezat. <br /> Keunggulan produk makanan yang berbahan dasar pisang yang murah, berkabohidrat tinggi, dan dipadu lapisan telor. Selain itu, pisang tersebut dibelah jadi dua dan diberi isi seperti sandwich, berisi sayur selada, sosis ayam, cornet sapi. Kemudian diberi topping saus sambal berlevel 1-3. Level 1 Bayeg Cilik, Level 2 Bayeg Gede, Level 3 Bayeg Tuek, dan juga diberi topping mayonais. Kemasannya dibuat semenarik mungkin dengan plastik mika dan terdapat desain logo Bayeg.</span></p>','pisang|bayeg|banana|layered |egg|olahan makanan|makanan|resep |masakan rumah|masakan ibu|lapis|selada',1,1,'2019-03-15 02:00:42','2019-03-15 03:54:54'),(1140,0,'STUPA (STik Ubi PelAngi)','2019 16040284027 Nestayu Dean Afrilla Waskitho.pdf',NULL,10906000,'<p class=\"MsoNormal\" style=\"text-align: justify;\"><span style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\';\">Kegiatan ini dilatarbelakangi karena masih sedikitnya variasi produk hasil olahan ubi, sehingga menyadari akan kondisi tersebut kelompok kami ingin memberikan sentuhan baru untuk produk yang berbahan dasar ubi jalar menjadi olahan pangan yang lebih menarik perhatian untuk segala kalangan sehingga olahan pangan yang berbahan dasar ubi jalar menjadi salah satu<span style=\"mso-spacerun: yes;\">&nbsp; </span>kuliner terbaik dari Indonesia dikalangan persaingan kuliner-kuliner yang lain .</span><span style=\"font-family: \'Times New Roman\', serif; font-size: 12pt;\">Pembuatan produk ini hadir dari pemanfaatan tanaman ubi jalar yang biasanya dikenal masyarakat awam sebagai makanan yang hanya bisa dikonsumsi dengan cara digoreng dan direbus, sehingga melalui inovasi ini masyarakat bisa mengenal variasi dari produk olahan ubi yang dikemas secara modern dan diberikan tampilan yang cantik namun tidak mengurangi cita rasanya agar menarik antusiasme dari masyarakat yang ingin mencoba untuk mengonsumsinya.</span></p>\n<p class=\"MsoNormal\" style=\"text-align: justify;\"><span style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\';\">Usaha ini akan menjadi salah satu inovasi dalam bidang makanan khususnya olahan ubi karena belum ada usaha mengenai pengolaha tanaman ini menjadi produk makanan yang modern. Penambahan <em style=\"mso-bidi-font-style: normal;\">filling</em> dan <em style=\"mso-bidi-font-style: normal;\">topping</em> bertujuan agar cita rasa manis yang dihasilkan bervariasi. Produk ini akan hadir dengan kemasan praktis yang mudah dibawa kemana-mana sehingga dapat menarik minat pembeli.&nbsp;</span><span style=\"font-family: \'Times New Roman\', serif; font-size: 12pt;\">Target khusus dari usaha ini adalah mahasiswa/mahasiswi Universitas Negeri Surabaya yang memiliki kesibukan dalam menjalani kehidupan kampus dan tidak dapat menyempatkan waktu untuk mengisi energi yang ada di dalam tubuh. Sehingga produk ini hadir sebagai camilan alternatif bagi mahasiswa yang praktis, mengenyangkan dan menyehatkan karena komposisinya yang memiliki kebermanfaatan bagi tubuh. Target lainnya yaitu masyarakat umum dari seluruh usia mulai dari anak-anak, remaja, maupun orang tua yang tidak bisa menyempatkan waktunya untuk mengisi kekosongan perut akibat jadwal mereka yang padat sehingga produk ini merupakan makanan camilan alternatif yang manis, praktis, ekonomis, namun masih tetap mengenyangkan.</span></p>','enter',1,1,'2019-03-15 02:19:53','2019-03-15 04:30:54'),(1141,0,'Si Kripsi (Kripik Singkong Asli)','2019 16040704114 Asfarina Oktaviani.pdf',NULL,11930000,'<p class=\"MsoNoSpacing\" style=\"margin-left: 14.2pt; text-align: justify; text-indent: -14.2pt; line-height: 150%; tab-stops: 14.2pt;\"><span lang=\"IN\" style=\"font-size: 12.0pt; line-height: 150%; font-family: \'Times New Roman\',serif; letter-spacing: -.05pt; mso-ansi-language: IN;\">&nbsp; &nbsp; Camilan Kripik Surabaya hadir untuk menjawab keinginan masyarakat di Kota Surabaya umumnya dan masyarakat Universitas Negeri Surabaya khususnya yang ingin menikmati cemilan kripik singkong yang enak, gurih dan higienis serta terjangkau bagi kantong teman-teman mahasiswa. <strong>&ldquo;Si Kripsi&rdquo;</strong> merupakan camilan Kripik dengan aneka rasa yang dapat menghilangkan rasa <em>stress </em>dikala banyak tugas dan kegiatan, sehingga para penikmat camilan dapat menikmati enaknya kripik </span><span style=\"font-size: 12.0pt; line-height: 150%; font-family: \'Times New Roman\',serif; letter-spacing: -.05pt;\">sebagai santapan ringan saat sedang mengerjakan tugas maupun saat melakukan kegiatan lain agar lebih bersemangat.</span></p>\n<p class=\"MsoNoSpacing\" style=\"margin-left: 14.2pt; text-align: justify; text-indent: -14.2pt; line-height: 150%; tab-stops: 14.2pt;\"><span lang=\"IN\" style=\"font-size: 12.0pt; line-height: 150%; font-family: \'Times New Roman\',serif; letter-spacing: -.05pt; mso-ansi-language: IN;\">&nbsp; &nbsp; &nbsp;<strong>\"</strong><strong>Si Kripsi\"</strong></span><span style=\"font-size: 12.0pt; line-height: 150%; font-family: \'Times New Roman\',serif; letter-spacing: -.05pt;\"> ini</span><span lang=\"IN\" style=\"font-size: 12.0pt; line-height: 150%; font-family: \'Times New Roman\',serif; letter-spacing: -.05pt; mso-ansi-language: IN;\"> sangat cocok bagi kalangan mahasiswa yang menginginkan camilan</span><span style=\"font-size: 12.0pt; line-height: 150%; font-family: \'Times New Roman\',serif; letter-spacing: -.05pt;\"> ringan, gurih dan enak untuk dinikmati dengan kisaran harga</span><span lang=\"IN\" style=\"font-size: 12.0pt; line-height: 150%; font-family: \'Times New Roman\',serif; letter-spacing: -.05pt; mso-ansi-language: IN;\"> yang pas di kantong. Mahasiswa sebagai <em>agent </em>perubahan dengan segala kesibukannya tentu menginginkan</span><span style=\"font-size: 12.0pt; line-height: 150%; font-family: \'Times New Roman\',serif; letter-spacing: -.05pt;\"> apabila</span><span lang=\"IN\" style=\"font-size: 12.0pt; line-height: 150%; font-family: \'Times New Roman\',serif; letter-spacing: -.05pt; mso-ansi-language: IN;\"> dikala santai dapat menikmati camilan enak sambil ditemani secangkir kopi, maupun </span><span style=\"font-size: 12.0pt; line-height: 150%; font-family: \'Times New Roman\',serif; letter-spacing: -.05pt;\">saat </span><span lang=\"IN\" style=\"font-size: 12.0pt; line-height: 150%; font-family: \'Times New Roman\',serif; letter-spacing: -.05pt; mso-ansi-language: IN;\">rapat organisasi, berdiskusi dan mengerjakan skripsi (tugas akhir) bagi mahasiswa tingkat akhir yang tentu sangat melelahkan apabila tidak </span><span style=\"font-size: 12.0pt; line-height: 150%; font-family: \'Times New Roman\',serif; letter-spacing: -.05pt;\">sambil memakan camilan </span><span lang=\"IN\" style=\"font-size: 12.0pt; line-height: 150%; font-family: \'Times New Roman\',serif; letter-spacing: -.05pt; mso-ansi-language: IN;\"><strong>&ldquo;Si Kripsi&rdquo;</strong>. Oleh sebab itu kami hadir untuk menjawab kebutuhan teman-teman mahasiswa yang sudah rindu ngemil sejak dulu.</span></p>\n<p class=\"MsoNoSpacing\" style=\"margin-left: 14.2pt; text-align: justify; text-indent: -14.2pt; line-height: 150%; tab-stops: 14.2pt;\"><span lang=\"IN\" style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',serif; mso-fareast-font-family: Calibri; letter-spacing: -.05pt; mso-ansi-language: IN; mso-fareast-language: EN-US; mso-bidi-language: AR-SA;\">&nbsp; &nbsp; &nbsp;Camilan Kripik Surabaya hadir dengan produk barunya yang dinamakan&nbsp;<strong>\"Si Kripsi\"&nbsp;</strong></span><span lang=\"IN\" style=\"font-size: 12pt; line-height: 115%; font-family: \'Times New Roman\', serif; letter-spacing: -0.05pt;\">karena bidikan pasarnya </span><span style=\"font-size: 12pt; line-height: 115%; font-family: \'Times New Roman\', serif; letter-spacing: -0.05pt;\">yaitu</span><span lang=\"IN\" style=\"font-size: 12pt; line-height: 115%; font-family: \'Times New Roman\', serif; letter-spacing: -0.05pt;\"> teman-teman mahasiswa, sehingga teman-teman mahasiswa</span><span style=\"font-size: 12pt; line-height: 115%; font-family: \'Times New Roman\', serif; letter-spacing: -0.05pt;\"> dapat</span><span lang=\"IN\" style=\"font-size: 12pt; line-height: 115%; font-family: \'Times New Roman\', serif; letter-spacing: -0.05pt;\"> menikmati lezatnya <strong>&ldquo;Si Kripsi&rdquo;</strong>, namun tidak sampai </span><span style=\"font-size: 12pt; line-height: 115%; font-family: \'Times New Roman\', serif; letter-spacing: -0.05pt;\">menguras kantong ataupun sampai melupakan</span><span lang=\"IN\" style=\"font-size: 12pt; line-height: 115%; font-family: \'Times New Roman\', serif; letter-spacing: -0.05pt;\"> tugasnya</span><span style=\"font-size: 12pt; line-height: 115%; font-family: \'Times New Roman\', serif; letter-spacing: -0.05pt;\"> untuk</span><span lang=\"IN\" style=\"font-size: 12pt; line-height: 115%; font-family: \'Times New Roman\', serif; letter-spacing: -0.05pt;\"> menyelesaikan skripsinya. <strong>&ldquo;Si Kripsi&rdquo;</strong> dapat lebih dikenal oleh teman-teman mahasiswa dan sangat cocok bagi semua kalangan karena rasanya yang bervarian dan harganya&nbsp;</span><span lang=\"IN\" style=\"font-size: 12.0pt; line-height: 150%; font-family: \'Times New Roman\',serif; letter-spacing: -.05pt; mso-ansi-language: IN;\">yang sangat terjangkau. Dengan demikian camilan <strong>&ldquo;Si Kripsi&rdquo;</strong> ini tentu akan sangat cocok bagi kalangan mahasiswa maupun anak muda sampai golongan tua.</span></p>\n<p class=\"MsoNoSpacing\" style=\"margin-left: 14.2pt; text-align: justify; text-indent: -14.2pt; line-height: 150%; tab-stops: 14.2pt;\"><span lang=\"IN\" style=\"font-size: 12.0pt; line-height: 150%; font-family: \'Times New Roman\',serif; letter-spacing: -.05pt; mso-ansi-language: IN;\"><span style=\"mso-tab-count: 2;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span>Harapannya cemilan <strong>&ldquo;Si Kripsi&rdquo;</strong> nantinya bukan hanya dapat </span><span style=\"font-size: 12.0pt; line-height: 150%; font-family: \'Times New Roman\',serif; letter-spacing: -.05pt;\">menjangkau konsumen dari </span><span lang=\"IN\" style=\"font-size: 12.0pt; line-height: 150%; font-family: \'Times New Roman\',serif; letter-spacing: -.05pt; mso-ansi-language: IN;\">kalangan mahasiswa</span><span style=\"font-size: 12.0pt; line-height: 150%; font-family: \'Times New Roman\',serif; letter-spacing: -.05pt;\"> saja</span><span lang=\"IN\" style=\"font-size: 12.0pt; line-height: 150%; font-family: \'Times New Roman\',serif; letter-spacing: -.05pt; mso-ansi-language: IN;\">, namun </span><span style=\"font-size: 12.0pt; line-height: 150%; font-family: \'Times New Roman\',serif; letter-spacing: -.05pt;\">juga </span><span lang=\"IN\" style=\"font-size: 12.0pt; line-height: 150%; font-family: \'Times New Roman\',serif; letter-spacing: -.05pt; mso-ansi-language: IN;\">masyarakat Kota Surabaya pada umumnya. Karena camilan singkong sangat digemari </span><span style=\"font-size: 12.0pt; line-height: 150%; font-family: \'Times New Roman\',serif; letter-spacing: -.05pt;\">oleh semua</span><span lang=\"IN\" style=\"font-size: 12.0pt; line-height: 150%; font-family: \'Times New Roman\',serif; letter-spacing: -.05pt; mso-ansi-language: IN;\"> kalangan. Disamping karena khasiatnya yang sangat banyak untuk kesehatan, juga rasanya yang enak dan tidak menjenuhkan serta harganya yang terjangkau.</span></p>','SiKripsi|Camilan|Kripik Singkong|higienis|Makanan ringan|Gurih',1,1,'2019-03-15 02:35:28','2019-03-20 03:11:59'),(1142,0,'Si Bulak (Ekstraksi Bubuk Biji Salak)','2019 17010714062 Yana Dwi Kurniya Wati.pdf',NULL,8096000,'<p class=\"judul\"><a name=\"_Toc3408985\"></a>Ringkasan Proposal Rencana Usaha</p>\n<p class=\"MsoNormal\" style=\"margin-top: 12.0pt; text-align: justify; line-height: 150%;\"><strong style=\"mso-bidi-font-weight: normal;\"><span style=\"font-size: 12.0pt; line-height: 150%; font-family: \'Times New Roman\',serif;\"><span style=\"mso-tab-count: 1;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span></strong><span style=\"font-size: 12.0pt; line-height: 150%; font-family: \'Times New Roman\',serif;\">Masing-masing negara memiliki Sumber Daya Alam (SDA) yang berbeda. Negara Indonesia memiliki SDA yang meilimpah dalam bidang tambang, rempah-rempah, maupun sumber makanan yang khas dengan berbagai manfaat didalamnya. SDA yang melimpah di Indonesia manjalar disemua wilayah, salah satunya wilayah Jawa Timur dengan Kabupaten Bojonegoro yang memiliki buah khas di beberapa desa, khususnya Desa Wedi berupa buah Salak Wedi. Jika salak pada umunya memiliki rasa manis, salak wedi berbeda dengannya karena memiliki rasa yang asam, manis, dan juga tekstur yang renyah. Namun, yang akan dijadikan prouk kali ini bukan buahnya melainkan bijinya. Mungkin ada yang penasaran, mari disimak di bawah.</span></p>\n<p class=\"MsoNormal\" style=\"margin-top: 12.0pt; text-align: justify; line-height: 150%;\"><span style=\"font-size: 12.0pt; line-height: 150%; font-family: \'Times New Roman\',serif;\"><span style=\"mso-tab-count: 1;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span>Adanya perkembangan zaman dimana semua orang lebih suka berkumpul di tempat umum dan ditemani hidangan dan seduhan yang menyegarkan, kini hadir Si Bulak yang mempunyai kepanjangan &ldquo;Ekstraksi Bubuk Biji Salak&rdquo;. Meskipun sudah ada kopi biji kopi, kini hadir Si Bulak yang berbeda karena minuman ini dari ekstraksi biji salak berupa bubuk yang diproses dengan mengutamakan kebersihan dan kualitas bahan, serta kemasan yang menarik dan ukuran kemasan yang dapat dibawa kemana saja konsumen menginginkannya. </span></p>\n<p class=\"MsoNormal\" style=\"margin-top: 12.0pt; text-align: justify; line-height: 150%;\"><span style=\"font-size: 12.0pt; line-height: 150%; font-family: \'Times New Roman\',serif;\"><span style=\"mso-tab-count: 1;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span>Si Bulak hadir bagi konsumen yang memiliki cita rasa tinggi terhadap minuman sepeti kopi. Seiringnya jalan, Si Bulak akan mampu menyaingi posisi kopi yang sering dijadikan minuman pelengkap kegiatan, karena Si Bulak dapat dikonsumsi semua elemen masyarakat yang suka kopi maupun tidak. Bagi konsumen yang tidak suka kopi, the, atau tidak kuat dengan kanddungan kafein kopi dan minuman lain dapat mengonsumsi Si Bulak. Dengan begini, Si Bulak mempunyai prospek usaha yang baik untuk kedepannya. </span></p>','Si Bulak',1,1,'2019-03-15 02:53:19','2019-03-15 14:46:47'),(1143,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,1,'2019-03-15 03:20:57','2019-03-15 03:22:40'),(1144,0,'BUTANIAS MEKAMA (BUdidaya TAnaman hIAS menggunakan MEdia kokedAMA)','2019 17010044039 Tama Kusuma Jayanti.pdf',NULL,11004000,'<p>Tanaman Hias yang kaya akan manfaat juga memiliki nilai ekonimis cukup tinggi di kombinasikan dengan media tanam kokedama yang mudah dan efesien. BUTANIAS MEKAMA sebuah produk yang terinspirasi dari negeri sakura, bertujuan mengajak masyarakat untuk tertarik dalam membudidayakan tanaman hias. Pada pembudidayaan kali ini akan fokus pada tanaman asli Indonesia dimana, dengan adanya budidaya yang dikemas semenarik mungkin, juga dapat menjadi ajang pengenalan beragam tanaman hias yang dimiliki negara tercinta ini. Seperti yang banyak orang ketahui manfaat dari memelihara beberapa tanaman juga dapat menjaga kesehatan serta daya tahan tubuh, salah satunya tanaman jenis jade, sukulen, dan sansivieria.</p>','Tanaman hias|Kokedama',5,1,'2019-03-15 03:27:40','2019-03-20 00:27:18'),(1145,0,'Dunia Lele','2019 16010034027 Ulvi Nirmala Kurniasari.pdf',NULL,14155000,'<p class=\"MsoListParagraph\" style=\"margin-left: 14.2pt; mso-add-space: auto; text-align: justify; text-indent: .5in; line-height: 150%; mso-pagination: widow-orphan;\"><em><span style=\"font-size: 12.0pt; line-height: 150%; font-family: \'Times New Roman\',serif; mso-bidi-font-family: \'Times New Roman\'; mso-bidi-theme-font: minor-bidi;\">DUNIA LELE </span></em><span style=\"font-size: 12.0pt; line-height: 150%; font-family: \'Times New Roman\',serif; mso-bidi-font-family: \'Times New Roman\'; mso-bidi-theme-font: minor-bidi;\"><span style=\"mso-spacerun: yes;\">&nbsp;</span>tempat wisata edukasi berbasis outdoor learning yang didalamnya terfokus dalam materi pembelajaran terkait kehidupan fauna yaitu &ldquo;Ikan Lele&rdquo;. Tetapi kami tidak hanya menjual kondisi berternak Ikan Lele saja, kami juga menjual pendidikan terkait apa itu Ikan Lele, siklus keehidupan, bagaimana mengolah Ikan Lele/kuliner, berbagai macam permainan dan ourbond dan masih banyak lagi. Usaha yang kami bangun ini merupakan usaha dibidang jasa, tetapi didalamnya juga terdapat beberapa produk yang kami jual. Di dalam edukasi tersebut kami juga menyelipkan beberapa pembelajaran berbasis Tematik agar nantinya para wisatawan yang datang juga dapat mengasah kemampuan Kognitif, Afektif dan juga Psikomotorik para wisatawan utamanya jika pelajar. </span><span lang=\"IN\" style=\"font-size: 12.0pt; line-height: 150%; font-family: \'Times New Roman\',serif; mso-bidi-font-family: \'Times New Roman\'; mso-bidi-theme-font: minor-bidi; mso-ansi-language: IN;\">Dengan adanya wisata edukasi ini diharapkan mampu mendukung dalam hal </span><span style=\"font-size: 12.0pt; line-height: 150%; font-family: \'Times New Roman\',serif; mso-bidi-font-family: \'Times New Roman\'; mso-bidi-theme-font: minor-bidi;\">pengoptimalan potensi alam dengan membentuk destinasi wisata edukasi budidaya lele bertema &ldquo;Dunia Lele&rdquo; sesuai dengan tren</span> <span style=\"font-size: 12.0pt; line-height: 150%; font-family: \'Times New Roman\',serif; mso-bidi-font-family: \'Times New Roman\'; mso-bidi-theme-font: minor-bidi;\">dan kebutuhan masa kini.</span><span style=\"font-size: 12.0pt; line-height: 150%; font-family: \'Times New Roman\',serif; mso-bidi-font-family: \'Times New Roman\'; mso-bidi-theme-font: minor-bidi; mso-ansi-language: IN;\"> <span lang=\"IN\">Kemudian segmentasi pasar yang kami targetkan adalah kepada semua orang mulai dari anak kecil sampai orang dewasa, mulai dari kalangan pelajar dari PAUD, SD, SMP, SMA bahkan Mahasiswa, Para Pekerja Pensiun dan Pra Pensiun ataupun masyarakat lainnya. </span></span><span style=\"font-size: 12.0pt; line-height: 150%; font-family: \'Times New Roman\',serif; mso-bidi-font-family: \'Times New Roman\'; mso-bidi-theme-font: minor-bidi;\">Disitu mereka bisa belajar, bermain, dan sambil berekreasi mengenali lele dan juga bisa membuat atau masak masakan lele yang sangat lezat. Pada pangsa pasar anak &ndash; anak perusahaan kami memiliki konsep yaitu belajar sambil bermain tentang budidaya atau siklus kehidupan lele itu sendiri. Pada sasaran dewasa kami fokus para prospek pengelolaan bisnisnya.</span></p>','Wisata Edukasi Dunia Lele',2,1,'2019-03-15 03:48:21','2019-03-15 05:45:04'),(1146,0,'MEBOCA ( GAME BOOK EDUCATION )','2019 17010664077 Miftahul Jannah.pdf',NULL,5830000,'<p><span style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; mso-fareast-font-family: Calibri; letter-spacing: -.05pt; mso-ansi-language: IN; mso-fareast-language: EN-US; mso-bidi-language: AR-SA;\">Dunia anak adalah dunia bermain, melalui bermain anak memperoleh pelajaran yang mengandung aspek perkembangan kognitif, sosial, emosi dan perkembangan fisik. Melalui kegiatan bermain dengan berbagai permainan anak dirangsang untuk berkembang secara umum baik perkembangan berpikir, emosi maupun sosial.&nbsp; Pendidikan. usia prasekolah adalah usia perkembangan bahasa anak meningkat sebelum memasuki usia sekolah secara resmi nantinya. Maura Xaveria Tupamahu, M.Psi, Psikolog Universitas Indonesia memaparkan, umumnya anak akan mengenal huruf dan angka pada usia 2-3 tahun.&nbsp; Untuk itulah adanya suatu permainan untuk merangsang perkembangan anak agar selain dapat bermain juga belajar sehingga pengetahuan baik kognitif, afektif dan psikomotorik dapat berkembang dengan baik sesuai teori Bloom. Namun di indonesia sendiri angka permainan anak yang di produksi sendiri oleh indonesia sangat sedikit bahkan permainan yang beredar adalah hasil impor dari negara lain seperti Chinna, Denmark, Singapura dan lainnya. Sesuai data dari </span><span lang=\"EN-US\" style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; mso-fareast-font-family: Calibri; mso-ansi-language: EN-US; mso-fareast-language: EN-US; mso-bidi-language: AR-SA;\">IITE 2018</span> <span lang=\"EN-US\" style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; mso-fareast-font-family: Calibri; mso-ansi-language: EN-US; mso-fareast-language: EN-US; mso-bidi-language: AR-SA;\">China menjadi negara pemasok terbesar impor produk mainan anak. Data Asosiasi Mainan Indonesia (AMI) menyebutkan, impor produk mainan asal China mencapai Rp320 miliar per bulan.</span><span style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; mso-fareast-font-family: Calibri; mso-ansi-language: IN; mso-fareast-language: EN-US; mso-bidi-language: AR-SA;\"> Selain itu, </span><span lang=\"EN-US\" style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; mso-fareast-font-family: Calibri; mso-ansi-language: EN-US; mso-fareast-language: EN-US; mso-bidi-language: AR-SA;\">pasaran mainan masih stabil tidak terlalu lesu seperti pada kuartal I 2018. Meski pasar mainan impor berkisar 65-70%, dimana sekitar 60% berasal dari China, tidak terlalu mempengaruhi industri mainan anak dalam negeri.</span><span style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; mso-fareast-font-family: Calibri; mso-ansi-language: IN; mso-fareast-language: EN-US; mso-bidi-language: AR-SA;\">&nbsp; <span style=\"letter-spacing: -.05pt;\">Hal ini tentu sangat disayangkam karena usaha dalam menyediakan alat permainan edukatif selain sebagai usaha yang menjanjikan pengembangannya juga dalam usaha ini memang sangat dibutuhkan oleh masyarakat, apalagi ketika melihat prospek di masa yang akan datang, semakin hari orang tua akan sadar pentingnya permainana&nbsp; edukatif bagi anak.&nbsp;</span></span></p>','meboca',4,1,'2019-03-15 03:54:23','2019-03-20 01:28:57'),(1147,0,'IDEAS (Iconic 3D berbasis budaya Suroboyo)','2019 17010714038 Cindi Dwi Apriliasari.pdf',NULL,4619800,'<p class=\"MsoNormal\" style=\"text-align: justify; text-indent: 36.0pt;\"><span style=\"font-family: \'Times New Roman\',\'serif\';\">Indonesia memiliki banyak keberagaman suku, adat, budaya dan makanan di setiap daerahnya. Setiap kota didunia ini pastilah memiliki ciri khas yang mana itu membedakan daerah/ wilayah yang satu dengan wilayah yang lainya yang mana itu menjadi keunikan dari wilayah tersebut. Salah satunya adalah kota Surabaya ini yang memiliki budaya, dimana budaya ini banyak yang dituangkan ke dalam bentuk artefak atau yang populer dalam sebuah wilayah atau daerah yakni icon dari sebuah wilayah tersebut. Ketika kita menyebut &ldquo; menara Eiffel &rdquo; maka pemikiran kita akan merujuk pada kota paris atau &ldquo; Monas &rdquo; maka pikiran kita akan merujuk ke jakarta atau bahkan jika &ldquo; Borobudur &rdquo; maka secara otomatis ke kota Yogyakarta. Begitupun juga dengan kota pahlawan ini juga memiliki icon yang menarik yakni patung suro dan boyo, lalu tugu pahlawan, bambu runcing dll .</span></p>\n<p class=\"MsoNormal\" style=\"text-align: justify; text-indent: 36.0pt;\"><span style=\"font-family: \'Times New Roman\',\'serif\';\">Jika kita berkaca pada wilayah jakarta, Yogyakarta, dan paris tersebut, ketika kita berkunjung ke sana kurang afdhol jika tidak membawakan cendramata dari daerah yang kita kunjungi tersebut, seperti gantungan kunci menara Eiffel, tugu monas, atau bahkan gantungan candi borobudur untuk di bagikan kepada teman ataupun sanak saudara, karena selain makanan oleh oleh yag wajib dibawa bagi para pelancong itu adalah gantungan kunci, akan tetapi melihat data yang ada dilapangan / di kota Surabaya ini oleh-oleh terutama dalam hal<span style=\"mso-spacerun: yes;\">&nbsp; </span>makanan dan pakaian khas Surabaya itu sudah menjamur di jual di gerai-gerai akan tetapi saya sampai saat ini masih belum pernah menjumpai gantungan kunci yang berpolakan suro dan boyo / icon Surabaya<span style=\"mso-spacerun: yes;\">&nbsp; </span>yang selainnya yang banyak saya jumpai itu adalah baju dan makanannya seperti &ldquo; LAKUSA (Lapis Kukus Surabaya) &rdquo;. Maka salah satu tujuan dari usaha ini untuk memperkenalkan kepada dunia / wilayah di luar sana bahwa dari iconic ini kita bisa memerkenalkan bahwa di Surabaya ini banyak tempat wisatanya dengan demikian juga bisa memperkenalkan tempat wisata di Surabaya dengan demikian maka ketika orang berbicara &ldquo; tugu pahlawan, bamboo runcing, dan soro boyo &rdquo; maka mereka akan mengenal kota Surabaya ini akan menjadi daya tarik tersendiri bagi pelancong baik dari dalam atau pun luar negeri dan juga bisa menarik para investor untuk menginvestasikannya ke Surabaya.</span></p>\n<p class=\"MsoNormal\" style=\"text-align: justify; text-indent: 36.0pt;\"><span style=\"font-family: \'Times New Roman\',\'serif\';\">Dari sini kami membaca peluang bahwa diluar sana masih belum banyak yang berusaha buah tangan icon Surabaya, maka kami membacanya sebagai peluang usaha yang boleh dikatakan prospek maka dengan ini akan menjadi keunggulan tersendiri untuk kedepannya . Untuk pemasarannya sendiri dapat ditemukan dalam toko yang menjual pernak pernik maupun tempat wisata.</span></p>\n<p class=\"MsoNormal\">&nbsp;</p>','enter',4,1,'2019-03-15 03:58:54','2019-03-18 13:31:22'),(1148,0,'Bolu MongOl (Bolu Moringa Oleifera)','2019 17010714080 Della Krismeirinda.pdf',NULL,4825000,'<p>Bolu MongOl merupakan jenis olahan makanan yang berasal dari tanaman asli Indonesia yang bernama latin Moringa Oleifera atau biasa di sebut dengan tanaman Kelor. Yang kemudian kami ambil bagian daunnya untuk kami jadikan bahan dasar Bolu MongOl. Tanaman ini banyak tumbuh di Desa Dawuhan, Kec. Purwoasri, Kab. Kediri yang sebagian masyarakatannya tidak memanfaatkan tanaman ini. Padahal jika di tinjau dari kesehatan tanaman ini banyak menyimpan manfaat yang baik bagi kesehatan manusia. Dapat menyembuhkan berbagai macam penyakit. Untuk itu kami membuat inovasi baru yang dapat memanfaatkan tanaman ini agar memiliki nilai ekonomis yang dapat menunjang pertumbuhan perekonomian masyarakat setempat.</p>','Bolu MongOl|Kelor|Manfaat|Macam penyakit|Kandungan gizi|Proses|Biaya',1,1,'2019-03-15 04:06:04','2019-03-17 03:48:24'),(1149,0,'Lembaga Bimbingan Belajar \"Si Mediaku\"','2019 16020084079 Femailia Aldaka.pdf',NULL,14757000,'<p>Saat ini bidang pendidikan di Indonesia sedang berada dalam pengawasan khusus, ini terjadi karena masyarakat dan pemerintah sepakat untuk meningkatkan kualitas dari sumber daya manusia di Negara ini. Oleh karena itu Lembaga Bimbingan Belajar memiliki peranan yang sama besar seperti lembaga pendidikan formal seperti sekolah. Hal ini dikarenakan banyak orang tua yang ingin memberikan pendidikan terbaik bagi anak-anak mereka.</p>\n<p>&ldquo;Si Mediaku&rdquo; dibentuk dan dirancang setelah melalui observasi secara tidak langsung seperti mengevaluasi pengalaman bergabung dengan sebuah lembaga bimbingan belajar dan menanyakan tentang ekspektasi siswa selama proses belajar. Hal ini menjadi modal bagi kami untuk menghadirkan inovasi yang dapat mengatasi keluhan siswa dalam belajar. Kami memastikan seluruh tutor yang tergabung dalam staff &ldquo;Si Mediaku&rdquo; diseleksi melalui wawancara yang ketat dan dipilih berdasarkan kemampuan mengajar serta pengetahuan terkait subyek materi pelajaran yang mumpuni. Hal ini dilaksanakan untuk memastikan perkembangan target pencapaian siswa dalam belajar dapat dicapai dengan baik. Penyaringan yang dilakukan, selanjutnya para tutor dipertemukan dalam suatu forum rapat untuk diberi arahan dan pelatihan sebelum bertemu dengan calon murid supaya dapat siap menghadapi situasi apapun yang mungkin terjadi selama proses belajar. Informasi yang akan diberikan kepada tutor merupakan rincian informasi yang kami dapat dari calon wali terkait karakter, kebiasaan, dan keluhan tentang calon murid melalui diskusi diawal kontrak.</p>\n<p>Dengan memperhatikan kondisi tersebut, kami menginovasikan sebuah lembaga bimbingan belajar yang mengkombinasikan tenaga pengajar dari kalangan mahasiswa yang telah dijamin kualitasnya disertai dengan materi dan media pembelajaran yang sesuai dengan kebutuhan siswa. Dan menjadikan inovasi pembelajaran sebagai motto kami. Oleh sebab itu, kami menciptakan lembaga bimbingan belajar dengan nama &ldquo;Si Mediaku&rdquo;.</p>','LBB Privat|Bimbel privat|Si Mediaku|LBB Si Mediaku|Bimbel Si Mediaku|Les Privat',2,1,'2019-03-15 04:08:25','2019-03-20 00:36:27'),(1150,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,'2019-03-15 04:47:43','2019-03-15 04:47:43'),(1151,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,'2019-03-15 04:47:49','2019-03-15 04:47:49'),(1152,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,'2019-03-15 04:47:52','2019-03-15 04:47:52'),(1153,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,'2019-03-15 04:47:52','2019-03-15 04:47:52'),(1154,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,'2019-03-15 04:47:52','2019-03-15 04:47:52'),(1155,0,'CILUYA (Cireng Lupa Gaya) Varian rasa Alpukat, Apel, Pepaya, Nanas, Naga','2019 16010044025 Ayub Wulandari.pdf',NULL,15000000,'<p>Ciluya (Cireng Lupa Gaya) merupakan salah satu makanan ringan yang dibuat dengan varian rasa Alpukat, Apel, Pepaya, Nanas, Naga. makanan ringan ini cocok dikonsumsi oleh semua kalangan. selain rasanya yang enak makanan ini mengandung banyak gizi dan kaya akan vitamin. Harga yang ekonomis sangat cocok dijangkau untuk mahasiswa.</p>','#CILUYA#PMW2019#UNESA|#CILUYA#PMW2019#UNESA#',1,1,'2019-03-15 04:47:55','2019-03-20 00:33:41'),(1156,0,'Heritage Styles','2019 16080574041 Cahyono Jagad Raya.pdf',NULL,9500000,'<p>Usaha yang rencana kami jalankan merupakan bisnis startup yang melihat dari lingkungan sekitar kampus terlebih dahulu, seperti dari segi kebutuhan fashion pastinya dalam kehidupan sehari-hari tidak terlepas dari pemakaian produk fashion berupa tas, dompet, dan accessories lainnya. Dari hal itu kami mengambil peluang yang bisa menghasilkan profit bagi kami sendiri.</p>\n<p>Untuk Nama Brand yang kami ambil adalah Heritage Styles karena dari salah satu anggota kami memiliki kemampuan memproduksi produk tersebut tetapi ilmu yang dia dapatkan dari orangtuanya sehingga bisa disebut warisan yang diterjemahkan dalam bahasa inggris adalah Heritage. Kemudian setiap produk fashion pasti dilihat dari segi elegan, sportif, dan indah dilihat dapat disimpulkan satu kata adalah gaya yang diterjemahkan dalam bahasa inggris adalah Styles.</p>\n<p>Sisi keunikan dan keunggulan produk kami menngunakan bahan yang berbeda disisi dalammya dengan menggunakan varian warna menyala seperti merah, orange, kuning, dan hijau pupus. Kemudian harga yang kita tetapkan masih terjangkau. Dan manfaat usaha yang kami jalankan bagi masyarakat itu sebagai bentuk penyediaan produk fashion harga standar tapi dengan kualitas yang memadai.</p>','Web|Soft|Teknologi',4,1,'2019-03-15 05:05:38','2019-03-15 06:03:17'),(1157,0,'Stick Gledek','2019 16040284018 livya puji lestari.pdf',NULL,2732000,'<p>Stick&nbsp;</p>\r\n<p>Stick Gledek adalah makanan ringan yang memiliki citra rasa pedas yang siap mengoyangkan lidah anda dimana sekarang mulai digemari oleh kalangan remaja , anak &ndash; anak bahkan orang dewasa. Belakangan ini makanan ringan yang memiliki rasa unik dengan rasa pedas seperti macaroni dan salah satunya stick gledek ini. Kenapa bisa disebut dengan stick gledek karena makanan stick ini dijamin akan membuat semua tidak akan berhenti minum. Dari namanya saja sudah terbayang bagaimana jahatnya stick saat disantap, pedas dan menjadi candu. Tampilan stick ini sangat unik dimana dengan melihat tampilan luarnya akan membuat pembeli tertarik membeli.</p>\r\n<p>&nbsp;</p>','Stick enak gurih pedas',1,1,'2019-03-15 05:31:51','2019-03-16 19:25:43'),(1158,0,'Smart Incubator','2019 17080574122 Dyana Novita Taristy.pdf',NULL,6000,'<p>Smart Incubator merupakan suatu alat berteknologi canggih berupa kotak incubator dilengkapi dengan kecerdasan buatan berupa sensor pengatur suhu,heater,dan sessor kelembapan beserta sensor-sensor otomatis yang dapat digunakan untuk menetaskan telur. Alat ini juga dilengkapi rak otomatis yang mampu memutar telur pada saat proses penetasan,dan tentunya teknologi seperti ini dibutuhkan oleh para peternak hewan petelur terutama telur-telur yang sulit ditetaskan seperti contohnya telur burung love bird dan telur burung murai. Maka Smart Incubator hadir untuk membantu menyelesaikan masalah dalam penetasan telur.</p>','Smart|Incubator|Penetas|Telur|Teknologi',3,1,'2019-03-15 05:33:40','2019-03-20 02:14:33'),(1159,0,'Bunker Pengamuk (Bunga Kering Pengharum Ruangan Anti Nyamuk)','2019 17080574014 David Yusuf Firnanda.pdf',NULL,6000000,'<p class=\"MsoNormal\" style=\"margin-left: 28.35pt; line-height: 115%;\"><span style=\"mso-bidi-font-size: 12.0pt; line-height: 115%; font-family: Ebrima;\">Bunker Pengamuk (Bunga Kering Pengharum Ruangan Anti Nyamuk) merupakan suatu produk pengharum ruangan anti nyamuk dengan menggunakan bahan alami yang aman serta ramah lingkungan. Produk ini sangat meminimalisir penggunaan bahan-bahan kimia didalamnya, karena produk yang kami buat mengusung konsep back to nature yang tentu saja aman bagi pengguna dan juga bagi lingkungan.</span></p>','Bungka kering|Pengharum ruangan anti nyamuk|anti nyamuk| unik|ramah lingkungan |bunker pengamuk|pengharum ruangan',4,1,'2019-03-15 05:42:19','2019-03-19 16:22:48'),(1160,0,'coroko','2019 16020124048 Alfian Mada Prasetya.pdf',NULL,3500000,'<p class=\"MsoNormal\"><span style=\"font-family: \'Arial\',\'sans-serif\'; color: #222222; background: white;\">Redisgn ini bertujuan sebagai upaya peningkatan nilai ekonomi pada produk snack food coroko melalui inovasi kemasan. Hal ini dikarenakan produk coroko merupakan salah satu snack food&nbsp; yang kurang banyak diketahui oleh masyarakat dan remaja millenial saat ini. Kurang menariknya pengemasan dan sosialisasi pemasaran yang kurang meluas membuat makanan ini tidak banyak dikenal masyarakat. Dengan kegiatan kewirausahaan ini diharapkan dapat memberikan inovasi pada kemasan produk coroko sehingga produk dapat lebih dikenal oleh banyak masyarakat dan nilai jual menjadi meningkat. Produk mata maling merupakan makanan yang terbuat dari bahan utama biskuit Oreo dengan campuran susu kental manis dan balutan puding diatasnya yang terinspirasi dari puding Oreo yang diinovasikan sehingga menjadi produk baru yang sangat inovativ dan menarik. Diharapkan dengan adanya inovasi pembaharuan pada kemasan produk coroko ini akan meningkatkan daya tarik konsumen dan membuat puding Susu Oreo diminati oleh banyak masyarakat dan muda mudi millenial saat ini. Diperkuat dengan adanya pemasaran melalui media sosial dan web diharapkan makanan inovatif dan unik ini menjadi makanan yang digemari oleh semua kalangan masyarakat.</span></p>','redesign|rebranding|coklat|oreo|susu',4,1,'2019-03-15 05:42:42','2019-03-16 05:36:34'),(1161,0,'RASIS (RAK SEPATU PRAKTIS) INOVASI RAK SEPATU MASA KINI YANG PRAKTIS DAN HEMAT TEMPAT','2019 17080574083 Muhammad Bagas Syabana Hardianto.pdf',NULL,8000000,'<p>Memiliki sepatu atau sandal sudah menjadi kebutuhan setiap orang. Bahkan sebagian kalangan menjadikan kepemilikan sepatu atau sandal sebagai sebuah kesenangan. Tidak dapat dihindari, rentetan pasang sepatu dan sandal memenuhi rumah. Karena itu keberadaan rak sepatu menjadi hal yang penting di rumah. Baik bagi mereka yang mengoleksi sepatu atau sandal maupun tidak. Di era modern saat ini dengan meningkatnya jumlah penduduk yang tinggal didaerah perkotaan menyebabkan terjadinya penyempitan lahan yang kemudian diikuti dengan menyempitnya luas lahan rumah-rumah serta nilai ekonomi masyarakat perantauan yang sangat terbatas maka dari itu kami membuat sebuah inovasi. Rak sepatu yang juga merupakan alternatif untuk menghemat ruang pada rumah minimalis kita. Disini kami menginovasikan sebuah tempat sepatu yang simple dan dapat dibawa kemana mana. Rak sepatu tersebut kami beri nama RASIS (Rak Sepatu Praktis).</p>','rak sepatu|rak sandal|rak|sandal|sepatu|hemat|praktis|hemat tempat',2,1,'2019-03-15 06:14:38','2019-03-15 06:45:02'),(1162,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,1,'2019-03-15 06:24:14','2019-03-15 09:18:22'),(1163,0,'Madzone','2019 16040254055 Cika Anggela Alvinda.pdf',NULL,13900000,'<p>Usaha ini merupakan usaha yang berkecimpung di bidang jasa. Usaha ini&nbsp;dilatar belakangi oleh kebutuhan mahasiswa, guru, serta pelajar yang sedang&nbsp;menempuh pendidikan ketika akan melakukan sebuah presentasi atau membuat&nbsp;media pembelajaran. Dari peristiwa ini tim kami memiliki ide untuk membuat&nbsp;bisnis usaha MADZONE. Dimana dalam usaha ini konsumen atau client bisa&nbsp;mendapatkan bantuan pembuatan media pembelajaran yang bermacam &ndash; macam hanya dengan satu alamat usaha. Di bisnis jasa ini memudahkan pembeli untuk&nbsp;membuat media pembelajaran educatif sesuai yang mereka pesan . MADZONE&nbsp;menawarkan 3 jenis media pembelajaran yang bisa mereka pesan, media tersebut&nbsp;yaitu video educatif, game interaktif, presentasi menarik yang bisa mereka pesan&nbsp;sesuai selera dan keinginan mereka. Selain itu bisnis usaha kami mempunyai&nbsp;prinsip &ldquo;ilmu yang dibagi tidak akan berkurang&rdquo;,artinya antara konsumen serta&nbsp;produsen akan saling belajar dan mengajari, kemudia dibentuk sebuah forum untuk&nbsp;bertukar informasi satu sama lain biasanya berisi kritikan, ide, dan percobaan media&nbsp;yang sudah jadi. Sasaran usaha kami adalah mahasiswa yang ingin skripsi,&nbsp;mahasiswa yang ingin membuat materi pembelajaran interaktif, dan guru untuk&nbsp;pembelajaran di kelas, sasaran khususnya mahasiswa &ndash; mahasiswi yang ada di&nbsp;Surabaya agar dapat menunjang keahlian yang dimiliki. Jika usaha ini berkembang&nbsp;target selanjutnya adalah meluaskan bisnis dengan menerima pesanan dari luar&nbsp;Kota Surabaya. Selain itu jika bisnis ini berkembang kami akan mengembangkan&nbsp;bisnis ini dengan menambah varian MADZONE seperti, membuka pelatihan untuk&nbsp;mahasiswa, pembuatan film dokumenter, percetakan, dll. Keunggulan bisnis ini&nbsp;adalah <strong>3 M (membantu, mengajari, menghemat)</strong>. Harga yang sesuai dengan budget&nbsp;yang dimiliki konsumen dengan bentuk yang ervariasi, kreatif, dan membantu&nbsp;dalam presentasi. Tantangan dalam membuka usaha ini adalah kreatif dalam setiap&nbsp;pembuatan project karena tidak mungkin ada sesamaan antara project yang satu dengan yang lainnya agar konsumen tidak ada yang merasa kecewa dengan hasil&nbsp;project yang dipesan.</p>','Teknologi|Software|Media|Media pembelajar|Game educatif',2,1,'2019-03-15 06:55:44','2019-03-20 01:44:58'),(1164,0,'MOBILE SALON UNESA','2019 16050634056 Siti Fajar Magfiroh.pdf',NULL,14890000,'<p><span style=\"font-size: 12pt; line-height: 18.4px; font-family: \'Times New Roman\', serif; letter-spacing: -0.05pt;\">Pada era generasi&nbsp; saat ini dunia kecantikan semakin diminati oleh para kaum hawa, mereka tidak lagi memikirkan tentang biaya bahkan mereka berani menempuh cara yang terbilang ekstrim untuk memperoleh hasil yang maksimal. Namun dengan padatnya jadwal mereka serta situasi dan kondisi yang tidak mungkinkan membuat mereka malas atau tidak sempat datang langsung ke salon. Dengan Mobile Salon Unesa ini akan mempermudah para kaum hawa untuk melakukan treatment dimanapun dan kapan pun waktunya, sesuai permintaan pelanggan. S</span><span style=\"font-family: \'Times New Roman\', serif; font-size: 16px; letter-spacing: -0.0666667px;\">ep</span><span style=\"font-family: \'Times New Roman\', serif; font-size: 16px; letter-spacing: -0.0666667px;\">erti dirumah, di t</span><span style=\"font-family: \'Times New Roman\', serif; font-size: 16px; letter-spacing: -0.0666667px;\">empat k</span><span style=\"font-family: \'Times New Roman\', serif; font-size: 16px; letter-spacing: -0.0666667px;\">erja p</span><span style=\"font-family: \'Times New Roman\', serif; font-size: 16px; letter-spacing: -0.0666667px;\">elanggan dan lain s</span><span style=\"font-family: \'Times New Roman\', serif; font-size: 16px; letter-spacing: -0.0666667px;\">ebagainya.</span><span style=\"font-family: \'Times New Roman\', serif; font-size: 12pt; letter-spacing: -0.05pt;\">&nbsp;Manfaat dari Mobile Salon&nbsp;</span><span style=\"font-family: \'Times New Roman\', serif;\"><span style=\"font-size: 16px; letter-spacing: -0.0666667px;\">Unesa&nbsp;</span></span><span style=\"font-family: \'Times New Roman\', serif; font-size: 12pt; letter-spacing: -0.05pt;\">ini pelanggan tidak perlu datang kesalon jadi akan menghemat waktu dan biaya serta lebih efektif dan efisien disela kesibukan pelanggan tanpa mengurangi pelayanan.&nbsp;</span><span style=\"font-family: \'Times New Roman\', serif; font-size: 12pt; letter-spacing: -0.05pt;\">Mobile Salon&nbsp;</span><span style=\"font-family: \'Times New Roman\', serif;\"><span style=\"font-size: 16px; letter-spacing: -0.0666667px;\">Unesa ini akan dijalankan ol</span></span><span style=\"font-family: \'Times New Roman\', serif; font-size: 16px; letter-spacing: -0.0666667px;\">eh mahasiswa S1. Pendidikan Tata Rias yang ahli dibidangnya dengan standar operasional indones</span><span style=\"font-family: \'Times New Roman\', serif; font-size: 16px; letter-spacing: -0.0666667px;\">ia&nbsp; (SNI), s</span><span style=\"font-family: \'Times New Roman\', serif; font-size: 16px; letter-spacing: -0.0666667px;\">erta m</span><span style=\"font-family: \'Times New Roman\', serif; font-size: 16px; letter-spacing: -0.0666667px;\">enerapkan pros</span><span style=\"font-family: \'Times New Roman\', serif; font-size: 16px; letter-spacing: -0.0666667px;\">edur k</span><span style=\"font-family: \'Times New Roman\', serif; font-size: 16px; letter-spacing: -0.0666667px;\">es</span><span style=\"font-family: \'Times New Roman\', serif; font-size: 16px; letter-spacing: -0.0666667px;\">e</span><span style=\"font-family: \'Times New Roman\', serif; font-size: 16px; letter-spacing: -0.0666667px;\">lamatan dan k</span><span style=\"font-family: \'Times New Roman\', serif; font-size: 16px; letter-spacing: -0.0666667px;\">esehatan kerja (K3).</span></p>','salon unesa |Mobile Salon Unesa|mobile salon|salon unesa|salon|treatment kecantikan|makeup|perawatan kecantikan|perawatan rambut|perawatan kulit',2,1,'2019-03-15 07:52:49','2019-03-19 13:53:29'),(1165,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,'2019-03-15 15:55:55','2019-03-15 15:55:55'),(1166,0,'KERUMUNAN Gresik','2019 17010014078 Elya Nova Anggraini.pdf',NULL,9719441,'<p><span style=\"font-size: 12.0pt; mso-bidi-font-size: 10.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; mso-fareast-font-family: Calibri; letter-spacing: -.05pt; mso-ansi-language: EN-US; mso-fareast-language: EN-US; mso-bidi-language: AR-SA;\">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; KERUMUNAN gresik merupakan inovasi usaha dalam bidang makanan yang menjadikan aneka ikan menjadi kerupuk, ikan merupakan salah satu hasil Sumber Daya Alam yang besar di Gresik. Dengan banyaknya hasil ikan yang di produksi di gresik maka dari itu kita memanfaatkan ikan tidak hanya untuk lauk ketika makan saja, tetapi kita memanfaatkan ikan sebagai cemilan atau makanan ringan dengan menjadikanya sebagai krupuk karena mungkin tidak semua orang menyukai ikan dikarenakan baunya amis. Dan dengan menghilangkan bau amis tersebut kita menjadikanya sebagai kerupuk.</span><span style=\"font-size: 12.0pt; mso-bidi-font-size: 10.0pt; line-height: 150%; font-family: \'Times New Roman\',\'serif\'; letter-spacing: -.05pt;\">kerupuk ini tidak digoreng menggunakan minyak goreng tetapi kita menggunakan pasir, kita membuat produk yang bukan hanya lezat saja tetapi juga menyehatkan. Menggoreng dengan pasir ini supaya dapat mencegah kolestrol dan dapat dikonsumsi oleh semua pihak.&nbsp;</span><span style=\"font-family: \'Times New Roman\', serif; font-size: 12pt; letter-spacing: -0.05pt;\">&nbsp;</span><span style=\"font-family: \'Times New Roman\', serif; font-size: 12pt; letter-spacing: -0.05pt;\">KERUMUNAN Gresik merupakan inovasi baru dan belum memiliki daya saing, karena kerupuk &ndash; kerupuk yang lain masih digoreng dengan minyak goreng, mungkin ada kerupuk yang digoreng dengan pasir yang dikenal banyak orang dengan sebutan kerupuk OPEL yang beraneka warna tetapi itu tidak berasal dari hasil ilahan ikan . Kita memanfaatkan pasir untuk mengoreng yang dapat mencegah kolestrol dan memanfaatkan ikan yang banyak mengandung protein dan vitamin. Bukan hanya mencegah kolestrol saja tetapi menggoreng dengan pasir dapat meminimalisir biaya karena harga minyak goreng sekarang cukup mahal. Prospek pemasaran produk ini dapat disajikan sebagai kuliner di warung, restoran, pasar, kantin sekolah, serta dapat dipasarkan di kegiatan &ndash; kegiatan kota Surabaya dan pusat oleh &ndash; oleh.</span></p>\n<p class=\"MsoNoSpacing\" style=\"text-align: justify; tab-stops: 14.2pt;\"><span lang=\"IN\" style=\"font-size: 12.0pt; mso-bidi-font-size: 10.0pt; font-family: \'Times New Roman\',\'serif\'; letter-spacing: -.05pt; mso-ansi-language: IN;\">&nbsp;</span></p>','KERUPUKIKAN|MAKANANRINGAN|KERUPUKANTIKOLESTROL|KERUPUKENAK|KERUPUKKHASGRESIK|KERUPUKGURIH|KERUPUKMURAH|OLEHOLEHKHASGRESIK|CEMILANGRESIK|GRESIK|MAKANANKEKIKINIAN|MAKANANSEHAT|KERUPUKRENYAH|CEMILANENAK',1,1,'2019-03-15 17:22:13','2019-03-19 06:41:41'),(1167,0,'Kopi Kepin (Kopi Kedai Pintar) : Konsep edukopi dan Cashless Payment Society','2019 17020114025 Eka Nur Valentiani Dewi.pdf',NULL,12100000,'<p>&nbsp;</p>\n<p class=\"MsoBodyText\" style=\"margin-top: .45pt; text-align: justify; text-indent: 36.0pt; line-height: 115%;\"><span lang=\"EN-US\">Indonesia merupakan salah satu negara penghasil kopi terbesar di dunia dengan menduduki posisi ke-empat setelah Brazil, Vietnam, Colombia dengan produksi &plusmn;10 juta karung kopi (@60kg) tiap tahunnya (Majalah BBC, edisi 15 April 2018). Namun sebagai Negara penghasil kopi terbesar di dunia, Indonesia memiliki jumlah peminum kopi yang minim. Kopi tidak hanya berperan penting sebagai sumber devisa melainkan juga merupakan sumber penghasilan bagi tidak kurang dari satu setengah juta jiwa petani kopi di Indonesia (Rahardjo, 2012).</span></p>\n<p class=\"MsoNormal\" style=\"text-align: justify; text-indent: 36.0pt; line-height: 115%;\"><span lang=\"EN-US\">Seiring berkembangnya gaya hidup masyarakat, kini kopi mulai memiliki penggemarnya, sehingga memunculkan argumen bahwa kopi berevolusi menjadi <em>lifestyle</em> / gaya hidup masyarakat. Dengan munculnya trend gaya hidup <em>ngopi</em> ini, maka bermunculan banyak <em>coffee shop</em> baik dari harga rendah maupun mahal.</span></p>\n<p class=\"MsoNormal\" style=\"text-align: justify; text-indent: 36.0pt; line-height: 115%;\"><span lang=\"EN-US\">&nbsp;Dengan adanya Kopi Kepin ini nantinya diharapkan bisa ikut meramaikan pasar serta pemasaran kopi Indonesia khususnya menjadi <em>creator</em> dalam pembuatan kedai pintar <em>low-budget</em> namun memiliki tingkat keuntungan yang tinggi. Sehingga mampu meningkatkan pemasaran kopi Indonesia, serta menjadi inspirator guna meningkatkan kreatifitas pembangunan <em>Coffee shop </em>&nbsp;di kemudian hari.</span></p>\n<p>&nbsp; <span lang=\"EN-US\"> Kopi Kepin (Kopi Kedai Pintar) adalah salah satu konsep <em>ngopi</em> pintar tanpa menghilangkan esensi dari kopi itu sendiri. Dirancang dengan edukasi kopi kepada pelanggan dan pemanfaatan dari salah satu revolusi industri 4.0 yang sudah merambah kepada jaringan <em>cashless payment </em>yang mana kopi dan <em>cashless </em>telah menjadi salah satu gaya hidup generasi milenial saat ini.</span></p>\n<p>&nbsp;</p>\n<p>&nbsp;</p>','Kopi|Milenial|Industrikreatif|industri4.0|coffeeshop',4,1,'2019-03-15 17:29:49','2019-03-20 05:04:28'),(1168,0,'RICESOSTICK','2019 17040284050 NISA FATMA NURJANAH.pdf',NULL,2500000,'<p>Ricesostick ini merupakan produk makanan kekinian yang terbuat dari nasi yang sudah dibumbui yang dililitkan di stick bambu dan didalam nasinya terdapat sosis.</p>\n<p>Ricesostick. Makanan ini tergolong makanan yang praktis untuk dibawa dan di nikmati. Makanan berkarbohidrat yang sehat, enak, dan bergizi. Dapat dinikmati mulai dari kalangan anak &ndash; anak sampai orang tua. Manfaat usaha kami bagi masyarakat tak lain adalah untuk menambah penghasilan kepada toko klontong yang menjual bahan-bahan yang kami butuhkan. Dalam persaingan bisnis, produk kami lebih unggul dalam kualitas rasa, dimana pada produk kami terdapat varian rasa yang dapat dinikmati dari berbagai kalangan. Dan dalam jangka waktu kedepan kami akan mengikuti perkembangan dalam dunia bisnis terutama dalam bisnis makanan agar produk kita mampu eksis di tahun-tahun yang akan dating.&nbsp;</p>\n<p>Pada proses pembuatan sampai pemasaran sendiri tidak membutuhkan alat dan bahan yang sulit, karena alat dan bahan yang kami gunakan tersedia di lingkungan sekitar kami tinggal. Terakhir pada tahap pengelolaan usaha kami menggunakan bahan-bahan yang berkualitas dan bersih sehingga pada hasil akhir akan memuaskan pelanggan kami.</p>\n<p>Target pemasaran kami yang paling utama adalah di area kampus yang merupakan lingkungan strategis, karena kebanyakan para mahasiswa akan males untuk membawa bekal dari rumah atau kos. Dengan hal itu kami membuat inovasi baru untuk makanan kekinian tersebut. Dalam system pemasarannya sendiri selain dengan cara promosi lewat mulut ke mulut kami juga menggunakan internet dan media social yang sudah menjadi konsumsi sehari-hari para mahasiswa. Harga yang kami Tentukan juga ramah dengan kantong mahasiswa terutama anak kos yaitu 5 biji/pcs dengan harga Rp. 12.000,00.-</p>\n<p>Kita menetapkan wilayah pemasaran di area kampus dan kos yang mana bisa dilakukan COD. Dan menargetkan penjualan 10 pcs/hari. Kami juga akan meminta konsumen memberi testi atau masukan serta kritikan tentang produk kami yang nantinya kami jadikan acuan untuk mengembangkan produk kami.&nbsp;</p>','Enter|Makanansehat|Hitsdanmurah|Pmw2019|Makananringan|Murahdanhits',1,1,'2019-03-15 19:05:36','2019-03-19 17:39:27'),(1169,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,1,'2019-03-15 19:11:27','2019-03-15 19:52:47'),(1170,0,'Cireng Panik','2019 17040284046 Amalia Diah Retno Istiqomah.pdf',NULL,5,'<p><strong><em><span style=\"text-decoration: underline;\">cireng panik</span></em></strong></p>\n<p>&nbsp;</p>','enter|keyword',1,1,'2019-03-15 21:24:33','2019-03-20 05:59:18'),(1171,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,1,'2019-03-15 21:30:11','2019-03-16 00:23:35'),(1172,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,'2019-03-15 23:17:52','2019-03-15 23:17:52'),(1173,0,'MANMUS (Manset Muslimah) Inovasi Manset Muslimah Masa kini','2019 16030214014 Muizzatul mukaromah.pdf',NULL,6580000,'<p>Manmus adalah manset muslimah yang memberi inovasi bagi para muslimah untuk menutup aurat pergelangan tangan dengan aman dan nyaman.&nbsp;</p>','manmus',4,1,'2019-03-15 23:58:27','2019-03-18 05:39:25'),(1174,0,'SAMBEL EMPON-EMPON','2019 17020114071 Eka Uli Fitriani.pdf',NULL,13,'<p class=\"MsoNoSpacing\" style=\"text-align: justify; line-height: 150%; tab-stops: 14.2pt;\"><span style=\"font-size: 12.0pt; line-height: 150%; font-family: \'Times New Roman\',\'serif\'; letter-spacing: -.05pt; mso-ansi-language: IN;\">Sambel Empon-Empon merupakan sambal yang dibuat dengan bahan dan cara yang tradisional. Dengan bahan sambal pada umumnya, yaitu dengan bahan utama cabai, bawang merah, bawang putih dan bahan lainnya. Namun dalam sambal ini memiliki keunikan tersendiri yaitu dengan ditambahkannya rempah-rempah (empon-empon) khas Indonesia. Seperti kencur, jahe, dan kunci, sehingga memiliki rasa sambal yang khas. Dengan adanya Sambel Empon-Empon ini masyarakat bisa lebih mengenal berbagai macam jenis rempah-rempah khas Indonesia. Serperti yang kita ketahui saat ini banyak aneka ragam kuliner yang lebih menekankan pada makanan yang berasal dari budaya asing. Sehingga kami mencoba untuk menyajikan kuliner asli khas Indonesia yang bisa menambah inovasi baru dibidang kuliner, dan mampu menjadikan kuliner nusantara berkualitas tinggi.</span></p>','SAMBEL',1,1,'2019-03-16 02:59:59','2019-03-20 03:58:45'),(1175,0,'Dendeng Omakito Keuken Lamak Rasonyo','2019 16020154073 Advaita Sinatrya Rulinsantica.pdf',NULL,15000000,'<p><strong>Dendeng merupakan makanan khas Padang yang berbentuk daging yang digoreng kering lalu dimakan menjadi pelengkap lauk. Rasa khas dendeng yang sangat berbeda dengan makanan lainnya menjadi keunggulan tersendiri dari makanan yang lain. Seperti pada umumnya dendeng disajikan dalam bentuk original. Dan dengan rasa yang hampir sama di setiap tempat yang menjualnya. Kami mencoba berinovasi dan mengembangkan bagaimana caranya agar dendeng tetap terkenal di kalangan masyarakat khususnya anak muda yang sekarang lebih memilih makan makanan ala ala cafe untuk bisa beralih ke makanan khas indonesia namun tetap asik di nikmati semua kalangan serta praktis dan efisien. Selanjutnya terbesitlah dipikiran kami untuk membuat suatu olahan dendeng yang tidak biasa, kemudian kami beri nama Omakito Keuken yang kami ambil dari bahasa Padang dan juga Bahasa Belanda, yang berarti Dapur Nenek Kita. Kami menyediakan 3 varian sambal yaitu: balado, lombok ijo, dan sambal matah. Sehingga customer/pelanggan dapat memilih sesuai selera mereka dan tanpa merasa bosan dengan menu serta rasa yang itu-itu saja.</strong></p>','dendeng|omakito keuken|balado|lombok ijo|matah',1,1,'2019-03-16 03:54:36','2019-03-20 06:47:10'),(1176,0,'CHOI JR (Pemanfaatan potongan kain bekas untuk dijdikan Custom Painting Patch yang unij dan menarik)','2019 16020124064 Bahrul Hilmi Rizky.pdf',NULL,6992000,'<p class=\"MsoNormal\" style=\"text-align: justify; text-justify: inter-ideograph; text-indent: .5in; line-height: 150%;\"><span style=\"font-size: 12.0pt; line-height: 150%; font-family: \'Times New Roman\',\'serif\'; mso-bidi-font-family: \'Times New Roman\'; mso-bidi-theme-font: minor-bidi;\">Produk ini akan dibuat dengan teknik yang akan kami gunakan, jahit menjahit dengan sedikit sentuhan melukis yang sudah kami pelajari di mata kuliah Ibu Dosen Fera Setyaningrum di matakuliah Kewirausahaan. Dengan membentuk sebuah desain dan rancangan pola kami menggunakan jarum, benang, gunting, kuas, cat, dan kain yang akan dipola. Dari bahan tersebut kami buat akan kami finishing dengan plastik dan lebel yang akan kami tempelkan. Dengan bahan mudah ekonomis, murah tentunya menarik pembeli baik dari mahasiswa, masyarakat, pelajar ataupun umum.</span></p>','choi jr|patch',4,1,'2019-03-16 07:05:25','2019-03-19 03:03:06'),(1177,0,'Media Pembelajaran Flanel (MELA)','2019 17010684060 Fitri Nur Rachmah Aisyah.pdf',NULL,10,'<p><span style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; mso-fareast-font-family: Calibri; letter-spacing: -.05pt; mso-ansi-language: IN; mso-fareast-language: EN-US; mso-bidi-language: AR-SA;\">Di Indonesia banyak orang tua maupun guru yang belum paham tentang aspek perkembangan yang berumur 0-2 tahun. Diumur itu anak membutuhkan stimulasi untuk membantu mas kembangnya. </span><span style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; mso-fareast-font-family: Calibri; mso-ansi-language: IN; mso-fareast-language: EN-US; mso-bidi-language: AR-SA;\">Selain itu kurangnya informasi dan tingkat pengetahuan orang tua ternyata kondisi ini didasari oleh kurangnya alat permainan edukatif yang ada dipasaran. Dalam kondisi tersebut kami mulai mencari solusi yang tepat untuk orang tua maupun guru dalam memberikan alat permainan edukatif untuk anak. Media pembelajaran flanel (MELA) adalah alat permainan edukatif yang berbentuk busy book berasal dari bahan flanel, dengan setiap lembarnya terdapat kegiatan yang mencangkup semua aspek perkembangan anak. Permainan edukatif ini bisa digunakan anak dalam usia 0-8 tahun</span></p>','Media Pembelajaran Flanel (MELA) Melalui Busy Book Untuk Anak Usia Dini',5,1,'2019-03-16 16:48:06','2019-03-20 02:52:16'),(1178,0,'Nasi Afeksi','2019 16010664008 Vega Shavira Triswanto.pdf',NULL,6276000,'<p>Inovasi baru yaitu nasi yang dibentuk seeperti burger. dengan isi ayam geprek . Dibuat sedemikian rupa agar memudahkan konsumen/pelanggan ketika makan produk yang kami jual.&nbsp;</p>','Nasi Burger',1,1,'2019-03-16 17:41:37','2019-03-18 13:20:51'),(1179,0,'CLANTIK (Clay Anti Nyamuk)','2019 17030654035 SALSABILA SEPTIARA.pdf','2019 17030654035 SALSABILA SEPTIARA.pdf',4500000,'<p><span style=\"font-size: 11.0pt; font-family: \'Times New Roman\',\'serif\'; mso-fareast-font-family: \'Times New Roman\'; color: #222222; mso-ansi-language: EN-US; mso-fareast-language: EN-US; mso-bidi-language: AR-SA;\">Program wirausaha ini bernama CLANTIK (Clay Anti Nyamuk). Clantik merupakan produk inovasi dari clay yang selama ini digunakan sebagai aksesoris ruangan maupun tubuh. CLANTIK ini diciptakan untuk menambah kegunaan dari clay yaitu membasmi nyamuk disekitar kita karena mengandung aroma yang tidak disukai oleh nyamuk menggunakan ekstrak dari lemon, serai dan lavender. CLANTIK dibuat beraneka macam bentuk semanarik mungkin untuk meningkatkan ketertarikan konsumen dan wanginya yang harum akan membasmi nyamuk. CLANTIK ini akan diproduksi dalam bentuk aksesoris ruangan yang memiliki wangi anti nyamuk. Bahan utama clay merupakan tepung yang mudah sekali didapatkan selain itu harganya juga murah. Aroma dari CLANTIK ini memang akan hilang setelah beberapa minggu, namun CLANTIK akan tetap pada bentuknya, jadi meski aroma telah hilang CLANTIK masih dapat digunaan untuk menghiasi ruangan. Konsumen dapat membeli lagi jika aroma telah hilang dengan harga yang tidak mahal, oleh karena itu CLANTIK memungkinkan akan menjadi kebutuhan untuk masyarakat karena masyarakat akan memilih produk ini dibanding cairan dan lotion anti nyamuk yang berbayaha jika masuk kedalam tubuh . Dengan demikian, kami rasa produk ini cocok digunakan pada masa sekarang sebagai usaha meningkatkan kualitas dan kegunaan clay serta memperbaiki produk anti nyamuk yang dirasa berbahaya.</span></p>','Aroma|Clay|Pembasmi',4,1,'2019-03-16 21:50:32','2019-07-05 23:14:10'),(1180,0,'Songkok Lukis Rakyat','2019 16081194030 firza oktavia nurul kumala.pdf',NULL,9414000,'<p class=\"MsoNormal\" style=\"line-height: 115%;\"><span style=\"font-family: \'Times New Roman\', serif; font-size: 12pt;\">Pada era saat ini seni dan kerajinan adalah bisnis yang menjajikan.</span><span lang=\"EN-US\" style=\"font-size: 12pt; font-family: \'Times New Roman\', serif;\">Maka inilah kesempatan emas</span><span style=\"font-size: 12pt; font-family: \'Times New Roman\', serif;\"> untuk mahasiswa lebih bisa berkreasi, dimana </span><span style=\"font-size: 12pt; font-family: \'Times New Roman\', serif;\">Songkok Lukis Rakyat</span><span style=\"font-size: 12pt; font-family: \'Times New Roman\', serif;\">&nbsp;merupakan pr</span><span style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; mso-ansi-language: IN;\">oduk yang dipasarkan dari hasil modifikasi songkok polos yang dikemas berbeda. Songkok Lukis Rakyat <span style=\"mso-spacerun: yes;\">&nbsp;</span>merupakan produk kerajinan tangan berupa seni lukis yang dipadukan dengan lukisan menjadi satu kesatuan.</span></p>','songkok|seni lukis|handmade|unik',4,1,'2019-03-16 23:44:52','2019-03-20 05:18:46'),(1181,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,'2019-03-17 01:30:50','2019-03-17 01:30:50'),(1182,0,'SET TOURIST','2019 16051204042 Ahmad Rizki Maulana.pdf',NULL,14855000,'<p class=\"MsoNormal\" style=\"text-indent: 35.45pt; line-height: 115%;\"><span lang=\"EN-US\" style=\"font-size: 11.0pt; line-height: 115%; font-family: Ebrima; mso-bidi-font-family: \'Times New Roman\';\">Setourist adalah sebuah usaha yang membuka lapangan kerja untuk menjadi Tourist Collega. </span><span lang=\"IN\" style=\"font-size: 11.0pt; line-height: 115%; font-family: Ebrima; mso-ansi-language: IN;\">Setourist merupakan Ide bisnis yang berorientasi pada perjalanan liburan. Konsep yang ditawarkan adalah menguntungkan 2 pihak, yaitu turis (Si Tourist) dan Tourguide (Tourist Collega). Diharapkan penerapan ide bisnis ini menjadi suatu kemajuan pada dunia travelling yang semakin didominasi oleh aplikasi booking. </span><span lang=\"EN-US\" style=\"font-size: 11.0pt; line-height: 115%; font-family: Ebrima;\">Ide </span><span lang=\"IN\" style=\"font-size: 11.0pt; line-height: 115%; font-family: Ebrima; mso-ansi-language: IN;\">yang </span><span lang=\"EN-US\" style=\"font-size: 11.0pt; line-height: 115%; font-family: Ebrima;\">ditawarkan pada aplikasi ini</span> <span lang=\"EN-US\" style=\"font-size: 11.0pt; line-height: 115%; font-family: Ebrima;\">menarik dan ma</span><span lang=\"IN\" style=\"font-size: 11.0pt; line-height: 115%; font-family: Ebrima; mso-ansi-language: IN;\">mpu bersaing dengan banyaknya ide-ide pada dunia travelling</span></p>\n<p class=\"MsoNormal\" style=\"text-align: justify; line-height: 115%;\"><span lang=\"EN-US\" style=\"font-size: 11.0pt; line-height: 115%; font-family: Ebrima; mso-bidi-font-family: \'Times New Roman\';\"><span style=\"mso-tab-count: 1;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span>Layanan ini sangat bermanfaat khususnya bagi mereka yang mencari pekerjaan sampingan di rumah. Aplikasi ini tidak terikat dengan penginapan, rumah makan, ataupun yang lain sehingga lebih menghemat budget yang dikeluarkan dan biaya lebih bisa diatur dengan mudah.</span></p>\n<p class=\"MsoNormal\" style=\"text-align: justify; line-height: 115%;\"><span lang=\"EN-US\" style=\"font-size: 11.0pt; line-height: 115%; font-family: Ebrima; mso-bidi-font-family: \'Times New Roman\';\"><span style=\"mso-tab-count: 1;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span>Pengguna aplikasi ini atau Si Tourist bisa menentukan sendiri meeting point atau bertem di suatu tempat dengan Si Tourist Collega, dan tempat destinasi wisata yang diinginkan.</span></p>\n<p class=\"MsoNormal\" style=\"text-align: justify; line-height: 115%;\"><span lang=\"EN-US\" style=\"font-size: 11.0pt; line-height: 115%; font-family: Ebrima; mso-bidi-font-family: \'Times New Roman\';\"><span style=\"mso-tab-count: 1;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span>Untuk saat ini, layanan sejenis seperti ini belum ada di Indonesia. Ini merupakan aplikasi satu-satunya yang akan dikembangkan di Indonesia. Diharapkan dengan adanya apikasi ini dapat membantu mempromosikan destinasi wisata di Indonesia dan membuka lowongan pekerjaan bagi mereka yang belum bekerja dan ingin bekerja sampingan.</span></p>','tourist|wisata',2,1,'2019-03-17 12:19:46','2019-03-19 21:03:54'),(1183,0,'Avicenna Green Cupcake','2019 17030244058 Dia Rohmatul Hidayah.pdf',NULL,14314330,'<p>Tumbuhan obat merupakan Sumber Daya Alam yang sangat melimpah di Indonesia dengan keanekaragaman jenis. Terdapat banyak potensi yang dimiliki tumbuhan obat dalam mengobati suatu penyakit tertentu. Salah satunya tumbuhan binahong (nama ilmiah) yang pengolahan dan pemanfaatannya masih cenderung sederhana dirasa perlu inovasi supaya masyarakat dapat menikmatinya dengan antusias lagi. Dalam era globalisasi, Industri 4.0 merupakan suatu gagasan yang menjadi pendorong untuk memanfaatkan SDA menjadi olahan menarik yakni makanan. oleh karena itu kami menawarkan produk kami yang berjudul \"Avicenna Green Cupcake\". Pemilihan Cupcake sebagai inovasi makanan obat diharapkan dapat memberikan manfaat kepada masyarakat dalam mengobati penyakit. Rasa yang gurih didapat dari adonan Cupcake yang dicampur dengan ekstrak binahong dan rasa manis yang didapat dari isi selai binahong.</p>','Cupcake, Daun Binahong, selai|cupcake|daun binahong|selai daun binahong|ekstrak daun binahong',1,1,'2019-03-17 18:44:54','2019-03-20 06:52:47'),(1184,0,'Shining kicks','2019 17060484049 Yoppy Julian Pradanata.pdf',NULL,14946000,'<p>Saat ini trend koleksi sepatu sneaker mulai dari training, running dan juga casual mulai brrkberkem di kalangan muda maupun tua. Jika dulu merek sepatu seperti, Converse, vans, nike, dan Adidas tidak terlalu banyak dipakai, kini hampir semua kaum muda maupun tua di mall maupun tempat nongkrong menggunakan sepatu dengan merek merek tersebut. bahkan saat ini banyak terdapat merk merk sepatu lokal yang tidak kalah bagus dengan merek sepatu yang sudah mendunia, dengan harga yang terjangkau,hal ini yang akan menjadikan banyak kaum muda maupun tua banyak yang suka mengkoleksi sepatu. Tak hanya pada sepatu, di zaman modern seperti sekarang ini banyak muda-mudi yang nostalgia kembali ke era 90-an, contohnya saja dari segi fashion seperti trend jaket jeans yang banyak dipakai oleh muda-mudi di zaman sekarang.</p>','Treatment and custom',2,1,'2019-03-17 22:02:48','2019-03-20 05:23:51'),(1185,0,'Mobile Sports Performance','2019 16060484101 Ruchy Pharamanandya Okta.pdf','2019 16060484101 Ruchy Pharamanandya Okta.pdf',6500000,'<p class=\"MsoNormal\" style=\"text-align: justify; tab-stops: 14.2pt;\"><em style=\"mso-bidi-font-style: normal;\"><span lang=\"IN\" style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; mso-fareast-font-family: \'Times New Roman\'; color: black; mso-ansi-language: IN;\">Mobile Sports Performance</span></em> <span lang=\"IN\" style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; mso-fareast-font-family: \'Times New Roman\'; color: black; mso-ansi-language: IN;\">merupakan</span><span style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; mso-fareast-font-family: \'Times New Roman\'; color: black;\"> suatu usaha yang kami rencanakan</span><span lang=\"IN\" style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; mso-fareast-font-family: \'Times New Roman\'; color: black; mso-ansi-language: IN;\"> guna membantu meningkatkan tingkat kebugaran jasmani maupun persoalan tentang tubuh dalam menunjang aktifitas olahraga ataupun aktifitas sehari</span><span style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; mso-fareast-font-family: \'Times New Roman\'; color: black;\">-</span><span lang=\"IN\" style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; mso-fareast-font-family: \'Times New Roman\'; color: black; mso-ansi-language: IN;\">hari</span><span style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; mso-fareast-font-family: \'Times New Roman\'; color: black;\"> dari masyarakat</span><span lang=\"IN\" style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; mso-fareast-font-family: \'Times New Roman\'; color: black; mso-ansi-language: IN;\"> dengan maksimal dan baik, melihat semakin banyak nya masyarakat yang sibuk dengan kep</span><span style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; mso-fareast-font-family: \'Times New Roman\'; color: black;\">erluan</span><span lang=\"IN\" style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; mso-fareast-font-family: \'Times New Roman\'; color: black; mso-ansi-language: IN;\"> pekerjaan maupun aktifitas sehari-hari </span><span style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; mso-fareast-font-family: \'Times New Roman\'; color: black;\">yang menyita banyak waktu </span><span lang=\"IN\" style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; mso-fareast-font-family: \'Times New Roman\'; color: black; mso-ansi-language: IN;\">sehingga mengabaikan pentingnya menjaga kebugaran</span><span style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; mso-fareast-font-family: \'Times New Roman\'; color: black;\"> jasmani</span><span lang=\"IN\" style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; mso-fareast-font-family: \'Times New Roman\'; color: black; mso-ansi-language: IN;\"> dari tubuh. </span></p>\n<p class=\"MsoNormal\" style=\"text-align: justify; tab-stops: 14.2pt;\"><span style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; mso-fareast-font-family: \'Times New Roman\'; color: black;\"><span style=\"mso-tab-count: 1;\"> </span></span><span lang=\"IN\" style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; mso-fareast-font-family: \'Times New Roman\'; color: black; mso-ansi-language: IN;\">T</span><span style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; mso-fareast-font-family: \'Times New Roman\'; color: black;\">idak kalah penti</span><span lang=\"IN\" style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; mso-fareast-font-family: \'Times New Roman\'; color: black; mso-ansi-language: IN;\">ngn</span><span style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; mso-fareast-font-family: \'Times New Roman\'; color: black;\">y</span><span lang=\"IN\" style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; mso-fareast-font-family: \'Times New Roman\'; color: black; mso-ansi-language: IN;\">a seluruh anggota tim yang terlibat merupakan seorang yang telah mimiliki <em style=\"mso-bidi-font-style: normal;\">basic skill</em> keahlian masing-masing di bidangnya dan juga telah memiliki jam terbang sebelumnya dengan terlibat di berbagai event daerah maupun nasional. Dengan memadukan setiap bidang keahlian dari tiap-tiap anggota tim, dapat menjadikan sebuah tim wirausaha yang cukup lengkap dalam dunia industri olahraga. </span><span style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; mso-fareast-font-family: \'Times New Roman\'; color: black;\">Sehingga kami ingin dan memantaskaan diri untuk berkembang dengan berwirausaha dalam bidang ini.</span></p>',NULL,2,1,'2019-03-18 02:00:48','2019-05-13 23:33:09'),(1186,0,'SY ALE (STORY FOR SEXUAL EDUCATION) POP UP BOOK','2019 17010664053 BELLA AYU DIANTI PRIASTUTY.pdf',NULL,10000000,'<p class=\"MsoListParagraphCxSpFirst\" style=\"margin-left: 0cm; mso-add-space: auto; text-align: justify; text-indent: 20.7pt; line-height: 150%;\"><span style=\"font-size: 12.0pt; line-height: 150%; font-family: \'Times New Roman\',serif;\">Buku cerita bergambar 3 dimensi (3D) yang di dalamnya berisi konten pendidikan seksual dan bersifat preventif yang penulis namai Sy Ale <em style=\"mso-bidi-font-style: normal;\">(Story for Sexual Education)</em>. Solusi ini penulis rasa memadai untuk anak dengan usia 3-6 tahun karena pada tahap ini menurut teori Kognitif Piaget anak masuk dalam tahap praoperasional yaitu anak mulai menjelaskan dunia dengan kata-kata dan gambar yang mencerminkan peningkatan pemikiran simbolis dan melampaui hubungan informasi sensoris dan tindakan fisik (Santrock, 2007). Sasaran Sy Ale ialah anak usia 3-6 tahun dengan dibimbing oleh orangtua dan guru Pendidikan Anak Usia Dini (PAUD).</span></p>\n<p class=\"MsoListParagraphCxSpLast\" style=\"margin-left: 0cm; mso-add-space: auto; text-align: justify; text-indent: 20.7pt; line-height: 150%;\"><span style=\"font-size: 12.0pt; line-height: 150%; font-family: \'Times New Roman\',serif;\">Berdasarkan hal tersebut diatas maka kami berinisiasi menciptakan sebuah buku yang di tengah-tengahnya akan dilengkapi Pop Up. Buku ini akan berisi cerita mengenai seorang anak perempuan Sysy dan seorang anak laki-laki Ale. Konten dalam buku ini akan berisi mengenai hal-hal yang sebaiknya dilakukan anak jika ada orang lain yang mencoba menyentuh bagian-bagian intim tubuhnya. Buku ini akan berisi ilustrasi dan cerita yang menarik sehingga tidak lagi tabu untuk dibahas oleh orang tua dan guru PAUD.</span></p>','SY ALE, Pop Up, Sexual Education|Pop Up|Sy Ale|Sexual Education',4,1,'2019-03-18 02:06:55','2019-03-20 03:42:09'),(1187,0,'USAHA KURSUS MUSIK ONLINE \"BelajarMusik.NET\"','2019 17021254009 Johanes Yongky Pratama.pdf',NULL,14576000,'<p><span style=\"font-size: 12.0pt; line-height: 150%; font-family: \'Times New Roman\',\'serif\'; mso-fareast-font-family: Calibri; mso-ansi-language: EN-US; mso-fareast-language: EN-US; mso-bidi-language: AR-SA; mso-bidi-font-weight: bold;\"><strong>BelajarMusik.net</strong> adalah situs yang berisikan materi-materi pembelajaran musik berbentuk video maupun buku eletronik dari berbagai macam instrumen seperti gitar, drum, piano, vokal, dan lain sebagainya. Yang dapat diakses dengan memasukkan kode, yang didapatkan oleh siswa, setelah melakukan pembayaran administrasi.</span></p>','KURSUS MUSIK ONLINE',2,1,'2019-03-18 03:29:38','2019-03-20 06:54:51'),(1188,0,'Nasti Subuh','2019 16010684069 Hera Desita Nuril Azifa.pdf',NULL,14864000,'<p>Nasti Subuh merupakan makan pendamping ASI atau MPASI yang dimasak dengan bahan alami berasal dari sayur-sayuran, ikan segar dan buah-buahan yang dibuat menjadi nasi tim atau buah tim bagi anak yang berusia 6-12 bulan. Dengan adanya makanan pendamping ASI atau MPASI ini baik untuk kesehatan dan gizi bagi anak yang berusia 6-12 bulan. Ibu-ibu berkarir akan semakin mudah untuk memberikan asupan gizi bagi anak dengan memberikan Nasti Subuh ini.&nbsp;</p>\n<p>Nasti Subuh ini memiliki varian tekstur yang sesuai dengan usia anak dan berdasarkan WHO/UNICEF. Bayi pada umur 6 bulan menurut WHO tekstur makanan MPASI yang diberikan adalah makanan lumat/halus (bubur saring, pure, makanan ditumbuk atau makanan dihaluskan). Tekstur makanan MPASI tidak terlalu cair atau encer bisa diberi sedikit saja air sehingga tekstur bubur cair. Pada umur 9-11 bulan, tekstur makanan MPASI dinaikkan menjadi makanan lembek (nasi tim, bubur tanpa disaring, makanan dicincang halus atau irisan makanan lunak). Pada umur 12 bulan tekstur makanan MPASI bayi sudah bisa memakan makanan yang dicincang kasar.&nbsp;</p>\n<p>&nbsp;Untuk usia 6-7 bulan nasi tim akan dimasak secara halus, 8-9 bulan nasi tim dimasak sedikit kasar dan usia 10-12 bulan nasi tim dimasak mendekati tekstur orang dewasa. Keunggulan Nasti Subuh memilih nasi tim sesuai kondisi dengan usia anak, konsumen juga dapat memilih nasi tim dengan memesan varian rasa yang diinginkan. Kemampuan anak dalam mengkonsumsi makanan nasi tim ini terkadang kondisi fisik setiap anak berbeda. Sasaran wilayah produk kami yaitu di Posyandu Menganti,Gresik dengan adanya pertimbangan data-data usia anak sehingga kami dapat mempromosikan produk kami sesuai dengan usia dan kebutuhan anak. Untuk menjangkau seluruh konsumen harga produk kami tawarkan berkisar 4-6 ribu.&nbsp;</p>','proposal|unesa|pmw|pg-paud|FIP|nasi tim|sayur|buah|bayi|posyandu|anak usia dini|6-12bulan',1,1,'2019-03-18 03:49:49','2019-03-19 21:55:26'),(1189,0,'Topq Glow (Tote Bag Apik & Unique)','2019 16020124077 Didik Setyawan.pdf',NULL,5834000,'<p>&nbsp;</p>\n<p class=\"MsoNormal\"><span lang=\"EN-US\" style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',serif; background: white;\">Tote bag&nbsp;</span><span style=\"font-family: \'Times New Roman\', serif; font-size: 12pt;\">atau tas yang biasanya dibawa dengan satu tangan&nbsp;</span><span style=\"font-family: \'Times New Roman\', serif; font-size: 12pt;\">ini bisa digunakan untuk membawa buku, kosmetik, alat dan kegunaan lain sesuai kebutuhan.&nbsp;</span><span style=\"font-family: \'Times New Roman\', serif; font-size: 12pt;\">Sesuai dengan fungsinya dan tujuan penggunaannya, tas tersebut tersedia dalam berbagai desain dan ukuran.&nbsp;</span><strong><span style=\"font-size: 12pt; line-height: 115%; font-family: \'Times New Roman\', serif; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">Top</span><span lang=\"EN-US\" style=\"font-size: 9.5pt; line-height: 115%; font-family: Arial, sans-serif; color: #333333; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">&egrave;</span><span style=\"font-size: 9.5pt; line-height: 115%; font-family: Arial, sans-serif; color: #333333; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">q </span></strong><span style=\"font-size: 12pt; line-height: 115%; font-family: \'Times New Roman\', serif; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">ini singkatan dari&nbsp; \'<em>Tote bag Apik dan Unique\'</em>. Yang merupakan tas terbuat dari&nbsp;</span><span style=\"font-family: \'Times New Roman\', serif; font-size: 12pt;\">bahan kain kanvas/blacu. D</span><span style=\"font-family: \'Times New Roman\', serif; font-size: 12pt;\">i desain sehingga terlihat menarik dan unik berbeda dengan tas yang lainnya. Dan kata <strong>Glow</strong> diambil dari keu</span><span style=\"font-family: \'Times New Roman\', serif; font-size: 12pt;\">nikannya dari produk tas ini menggunakan fosfor untuk&nbsp;</span><span style=\"font-family: \'Times New Roman\', serif; font-size: 12pt; text-align: justify;\">menghasilkan warna menyala ketika ditempat yang gelap atau biasa kita kenal dengan </span><em style=\"font-family: \'Times New Roman\', serif; font-size: 12pt; text-align: justify;\">glow in the dark</em><span style=\"font-family: \'Times New Roman\', serif; font-size: 12pt; text-align: justify;\">. Dibuat secara limited edition, tas ini hanya diproduksi 20 buah per-bulannya dikarenakan desain dari tas berubah-ubah dan memiliki tema disetiap bulannya. Dengan mengikuti tren anak muda zaman sekarang serta bisa menjadi trend-setter</span></p>\n<p>&nbsp;</p>\n<p>&nbsp;</p>','tote bag|glow in the dark|PMW|APIK|UNIK|TOPEQ|UNESA',2,1,'2019-03-18 06:31:16','2019-03-20 05:45:01'),(1190,0,'Warkop Inklusi','2019 16010044056 Ashya Firdausy Ramadhanti.pdf',NULL,14840600,'<p class=\"MsoNoSpacing\" style=\"text-align: justify; line-height: 150%; tab-stops: 14.2pt;\"><span style=\"font-size: 12.0pt; line-height: 150%; font-family: \'Times New Roman\',\'serif\'; letter-spacing: -.05pt;\">Warkop Inklusi adalah sebuah gagasan ide mengenai usaha kuliner yang di kombinasi dengan menjunjung nilai-nilai kemanusiaan dan toleransi. Krisis nilai kemanusiaan dan rasa toleransi di kalangan muda saat ini menjadi alasan utama gagasan Warkop Inklusi. Mengingat bahwa tempat favorit untuk berkumpul generasi muda adalah warkop, maka warkop ini akan dibuat dengan menyelipkan nilai-nilai kemanusiaan dan toleransi, contohnya keberagaman agama, adanya disabilitas, dan isu-isu sosial yang lain. Secara tidak langsung, konsumen yang datang akan berkumpul sekaligus mengenal lebih jauh tentang penerimaan keberagaman. Maka penerimaan keberagaman atau Inklusi akan menjadi <em style=\"mso-bidi-font-style: normal;\">icon </em>dari usaha ini. </span></p>','warkop|inklusi|warkop inklusi',4,1,'2019-03-18 06:33:15','2019-03-20 06:15:23'),(1191,0,'AKI SABAR','2019 16040254079 Adilah Rizqi Awwalia.pdf',NULL,8188002,'<p class=\"MsoNormal\" style=\"margin-bottom: .0001pt; text-align: justify; line-height: 115%; tab-stops: 15.85pt; mso-layout-grid-align: none; text-autospace: none;\"><span style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\';\">Usaha ini merupakan usaha yang berkecimpung dibidang makanan. Usaha ini dilatarbelakangi karena banyak diminati oleh berbagai kalangan usia. Dari ini tim kami memilki ide untuk membuat bisnis AKI SABAR. Dimana dalam usaha ini pembeli bisa mendapatkan beberapa jenis varian rasa yaitu bakso aci original dan pedas dengan satu alamat usaha. Di bisnis ini memudahkan pembeli untuk mencari bakso aci apa yang akan mereka pesan. AKI SABAR merupakan bakso aci siwalan kelapa bakar yang mempunyai dua varian yaitu original dan pedas yang bisa dipesan sesuai selera. Sasaran usaha kami adalah seluruh masyarakat yang ada di Surabaya, khususnya mahasiswa-mahasiswi yang ada di Surabaya. Jika usaha ini berkembang target usaha kami adalah meluaskan bisnis dengan menerima pesanan dari luar kota Surabaya. Selain&nbsp; itu jika bisnis ini berkembang kami akan mengembangkan bisnis ini dengan menambah varian AKI SABAR dengan campuran rasa maupun komponen baru yang akan ditambahkan. Keungguulan bisnis ini adalah harga sesuai dengan budget yang dimiliki konsumen dengan bentuk yang ervariasi, kreatif, rasa yang enak dan berbeda dengan bakso aci pada umumnya, dengan bahan siwalan dan kelapa bakar baik batok kelapanya untuk tempatnya dan air kelapa bakar untuk komponen pembuatan kuah. Tantangan dalam usaha ini adalah banyak pesaingnya seperti muncul bakso aci varian terbaru yang membuka usaha serupa terutama yang telah memiliki brand/nama yang cukup terkenal di masyarakat.</span></p>\r\n<p>&nbsp;</p>\r\n<p class=\"MsoNormal\" style=\"margin-bottom: .0001pt; text-align: justify; line-height: 115%; tab-stops: 15.85pt; mso-layout-grid-align: none; text-autospace: none;\"><span style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\';\">&nbsp;</span></p>','makanan|Bakso aci',1,1,'2019-03-18 15:40:06','2019-03-20 05:01:23'),(1192,0,'Pangsit MiSang','2019 17010644168 Ayu Hawa Cipsiandira.pdf',NULL,8000000,'<p>Penulisan proposal PMW ini bertujuan untuk memberikan gambaran bahwa pisang kepok dapat digunakan sebagai alternatif pembuatan mie yang enak dan organik. Adapun yang menjadi latar belakang penulisan proposal ini karena banyaknya produksi pisang kepok dengan harga yang murah maka kami memanfatkan peluang tersebut untuk membuat mie dari pisang kepok.&nbsp;</p>','makan|sehat|organik|makanan|pisang|kepok|mie',1,1,'2019-03-18 17:00:44','2019-03-20 02:54:19'),(1193,0,'Jasa dan Penyedia DEKEA (Dekorasi Kelas Anak)','2019 17010684032 Resi Rosalianisa.pdf',NULL,10000000,'<p>Indonesia memiliki berbagai macam lembaga pendidikan mulai dari PAUD, SD, hingg tingkat perguruan tinggi, setiap lembaga pendidikan memiliki kelas yang menjadi cirikhas dari lembaga pendidikan tersebut. Salah satunya adalah lembaga pendidikan PAUD, lembaga pendidikan tersebut merupakan lembaga pendidikan untuk anak usia dini sehingga memiliki cirikhas kelas yang ceria penuh dengan warna dan harus dapat mearik utuk aak usia dini.</p>\n<p>&nbsp;DEKEA (Dekrasi Kelas Anak) merupakan inovasi usaha bidang jasa yang memudahka masyarakat dalam menghias kelas. Masyarakat yang bekera di lembaga pendidikan anak usia dini sering kali kesulitan dalam mendekorasi kelas yang dapat menarik perhatian anak dan dapat membuat anak merasa nyama dengan kelas tersebut, DEKEA merupakan alternative yang dapat digunakan dalam mendekorasi kelas untuk anak . Oleh karena itu usaha ini dapat menjadi prospek yang bagus bagi masyarakat.</p>\n<p>&nbsp;</p>','DEKEA sekolah anak usia dini|DEKEA',2,1,'2019-03-18 17:16:14','2019-03-20 04:13:48'),(1194,0,'The Message T-Shirt','2019 16010664009 Ivana Elza Harefa.pdf',NULL,12810000,'<p><span style=\"margin: 0px; line-height: 115%; letter-spacing: -0.05pt; font-family: \'Times New Roman\',\'serif\'; font-size: 12pt;\">The Message T-Shirt adalah kaos yang unik dan istimewa. Ide usaha ini muncul melihat semakin besarnya minat anak muda terhadap penggunaan kaos sehari-hari. Di zaman modern ini kaos sudah menjadi bagian hidup bagi anak-anak muda, oleh sebab itu The Message T-Shirt hadir untuk memenuhi kebutuhan tersebut. The Message T-Shirt menjadi media bagi anak muda untuk mengaktualisasikan dan mengekspresikan diri mereka. Hal yang istimewa dari The Message T-Shirt yakni kaos The Message T-Shirt di desain dengan pesan positif yang unik dan memotivasi. Dari pesan yang ditulis dalam kaos diharapkan penggunanya dapat menjadi semakin percaya diri, dan bagi orang-orang disekitar pengguna The Message T-Shirt juga merasakan dampak positifnya. Sederhananya, pesan positif dapat disampaikan lewat media pakaian dimana saja dan kapan saja.</span><u></u></p>','The Message T-Shirt|Kaos|Unik|Pesan Positif',4,1,'2019-03-18 19:59:28','2019-03-19 00:51:48'),(1195,0,'Kerupuk SADIS (Seblak Pedas dan Manis)','2019 17080304092 Lesta Denisa.pdf',NULL,9604000,'<p style=\"text-align: justify;\"><span lang=\"IN\" style=\"mso-bidi-font-size: 11.0pt; mso-fareast-font-family: Calibri; mso-ansi-language: IN;\">Kerupuk <strong style=\"mso-bidi-font-weight: normal;\">SADIS</strong></span><span lang=\"EN-US\" style=\"mso-bidi-font-size: 11.0pt; mso-fareast-font-family: Calibri;\"> (Seblak Pedas Manis) </span><span lang=\"IN\" style=\"mso-bidi-font-size: 11.0pt; mso-fareast-font-family: Calibri; mso-ansi-language: IN;\"><span style=\"mso-spacerun: yes;\">&nbsp;</span>merupakan produk makanan ringan yang terbuat dari kerupuk bawang yang biasanya </span><span lang=\"EN-ID\" style=\"mso-bidi-font-size: 11.0pt; mso-fareast-font-family: Calibri; mso-ansi-language: EN-ID;\">menjadi teman disaat makan</span><span lang=\"IN\" style=\"mso-bidi-font-size: 11.0pt; mso-fareast-font-family: Calibri; mso-ansi-language: IN;\"> nasi di setiap waktu</span><span lang=\"EN-US\" style=\"mso-bidi-font-size: 11.0pt; mso-fareast-font-family: Calibri;\">. <strong style=\"mso-bidi-font-weight: normal;\">SADIS</strong> berbeda dengan olahan kerupuk pada umumnya karena <strong style=\"mso-bidi-font-weight: normal;\">SADIS</strong> diberi bumbu seblak, sehingga disebut dengan seblak kering. </span><strong style=\"mso-bidi-font-weight: normal;\"><span lang=\"EN-US\" style=\"mso-bidi-font-size: 11.0pt;\">SADIS</span></strong><span lang=\"IN\" style=\"mso-bidi-font-size: 11.0pt; mso-ansi-language: IN;\"> di kemas dengan stand pouch plastik yang di lapisi alumunium foil berukuran 50gr, setelah di kemas produk kerupuk ini di sealer dengan rapat bagian atas plastik,supaya makanan di dalamnya dapat bertahan lama</span><span lang=\"EN-US\" style=\"mso-bidi-font-size: 11.0pt;\"> dan terjamin kebersihannya. </span><strong style=\"mso-bidi-font-weight: normal;\"><span lang=\"IN\" style=\"mso-bidi-font-size: 11.0pt; mso-ansi-language: IN;\">SADIS</span></strong><span lang=\"IN\" style=\"mso-bidi-font-size: 11.0pt; mso-ansi-language: IN;\"> memiliki beberapa varian rasa yaitu original, barbeque, balado, dan jagung manis. </span><span lang=\"EN-US\" style=\"mso-bidi-font-size: 11.0pt;\">Seblak kering memiliki peluang usaha yang sangat tinggi, mengingat masih jarangnya penjual yang menjual seblak kering, karena faktanya penggemar seblak basah maupun kering sangat tinggi. </span></p>\n<p style=\"text-align: justify;\"><span lang=\"EN-ID\" style=\"mso-fareast-font-family: Calibri; letter-spacing: -.05pt; mso-ansi-language: EN-ID;\">Kami sangat optimis bahwa kedepannya usaha kuliner kami dapat sukses dengan konsistensi kualitas produk. Selain itu bisnis kuliner adalah salah satu bisnis yang tidak ada matinya. Maka dari itu kami sangat optimis dengan penjualan kami karena peluang pasar yang sangat tinggi dan dengan kualitas produk yang terjamin. Maka dari itu kami menawarkan sebuah produk <strong style=\"mso-bidi-font-weight: normal;\">SADIS </strong>sebagai jawaban atas peluang pasar yang terbuka bebas.</span></p>','SADIS|SEBLAK|PEDAS',1,1,'2019-03-18 22:42:20','2019-03-20 06:07:37'),(1196,0,'Pudot Ainak (Pudding Sedot Cinta Anak)','2019 17020104073 Isnaini Habiba Dinul Mahmudah.pdf',NULL,5000000,'<p class=\"MsoNoSpacing\" style=\"text-align: justify; text-justify: inter-ideograph; line-height: 150%; tab-stops: 14.2pt;\"><span style=\"font-size: 12.0pt; line-height: 150%; font-family: \'Times New Roman\',\'serif\'; letter-spacing: -.05pt;\">Pudot Ainak (Pudding Sedot Cinta Anak) merupakan pengembangan dari makanan pudding yang kaya serat. Pudot ainak bertekstur lembut namun tidak sepadat pudding pada umumnya sehingga dapat disedot. Pudot dapat digunakan sebagai minuman penuntas dahaga dan penunda lapar. Sangat cocok untuk mahasiswa-mahasiswi yang belum sarapan ketika berangkat kuliah di pagi hari.</span></p>\n<p class=\"MsoNoSpacing\" style=\"text-align: justify; text-justify: inter-ideograph; line-height: 150%; tab-stops: 14.2pt;\"><span style=\"font-size: 12.0pt; line-height: 150%; font-family: \'Times New Roman\',\'serif\'; letter-spacing: -.05pt;\">Pudot Ainak dikemas dalam <em>standing pouch</em> plastik sehingga praktis dibawa kemana-mana dan tidak mudah tumpah. Standing pouch plastik ini diberi hiasan berupa gambar, kata-kata, ataupun <em>quotes</em> zaman sekarang sehingga terlihat menarik. Tulisan juga bisa dari <em>request</em> atau permintaan konsumen.</span></p>','pudot|pudding|pudotainak',1,1,'2019-03-18 23:34:54','2019-03-19 20:19:33'),(1197,0,'Bebek Bokep','2019 16021254017 Billawa Gatra Jannah.pdf',NULL,15000000,'<p>semoga bisa menjadi modal buat usaha kami.</p>','Bebek bokep|wirausaha muda|inovatif',1,1,'2019-03-18 23:37:21','2019-03-20 07:03:20'),(1198,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,1,'2019-03-19 02:17:57','2019-03-19 02:20:26'),(1199,0,'Beauty House','2019 17081194034 Rias Mei Riananda.pdf',NULL,7000000,'<p>Kami membuat usaha ini dengan tujuan untuk memenuhi keinginan konsumen yang semakin lama semakin mengalami perkembangan.&nbsp;</p>\r\n<p>Usaha yang kami dirikan ini tidak mengandung unsur negatif apapun dan kami berani menjamin bahwa produk yang kami tawarkan ini mampu berkembang pesat dan tetap mengikuti arus jaman yang semakin berkembang.</p>','Bucket|Buket|Make-up',4,1,'2019-03-19 03:05:46','2019-03-20 05:24:54'),(1200,0,'PIKACU (pisang coklat keju)','2019 18060484129 Masitha Dewi Aulia.pdf',NULL,8610000,'<p class=\"MsoNormal\" style=\"margin: 0cm; margin-bottom: .0001pt; mso-para-margin-top: 0cm; mso-para-margin-right: 0cm; mso-para-margin-bottom: .0001pt; mso-para-margin-left: 0gd; text-align: justify; text-indent: 0cm; mso-char-indent-count: 0; line-height: 150%; tab-stops: 14.2pt; border: none; mso-padding-alt: 31.0pt 31.0pt 31.0pt 31.0pt; mso-border-shadow: yes;\"><span style=\"font-size: 12pt; line-height: 150%; font-family: \'Times New Roman\', serif;\">Produk kami sudah dikenal oleh masyarakat, dan produk pisang yang kami gunakan adalah pisang kepok yang berkualiatas</span><span lang=\"EN-US\" style=\"font-size: 12pt; line-height: 150%; font-family: \'Times New Roman\', serif;\"> terbaik</span><span style=\"font-size: 12pt; line-height: 150%; font-family: \'Times New Roman\', serif;\"> langsung dari perkebunanya. Oleh karna itu keunggulan dari produk kami adalah rasa yang sangat krispi, lumer, dan enak tanpa </span><span lang=\"EN-US\" style=\"font-size: 12pt; line-height: 150%; font-family: \'Times New Roman\', serif;\">bahan pengawet tambahan. Dengan kualitas minyak goreng terbaik dan proses pengolahan yang higienis pasti akan diminati oleh banyak kalangan masyarakat.&nbsp;</span></p>','#pikacu #pisang #coklat #keju|#pikacu|#pisang|#coklat|#keju',1,1,'2019-03-19 03:27:30','2019-03-20 05:54:20'),(1201,0,'Lecco : PORTAL PERSEWAAN KOSTUM DAN PAKAIAN BERTEMA','2019 17051214066 M. Irfan Novandri.pdf',NULL,13850000,'<p>Lecco adalah suatu platform berbentuk startup berbasis Teknologi Informasi yang menghubungkan penyedia usaha sewa pakaian bertema dengan masyarakat yang membutuhkannya. Biasanya masyarakat yang ingin menyewa pakaian bertema harus berkeliling untuk mencari griya persewaan yang menurut mereka cocok sehingga membutuhkan banyak tenaga untuk sekedar mencari pakaian untuk disewa. Dengan adanya Lecco ini diharapkan dapat menjadi solusi untuk permasalahan sulitnya mencari persewaan pakaian bertema. Selain itu, Lecco juga diharapkan dapat menambah pendapatan dari penyedia jasa sewa pakaian bertema, dengan menyediakan platform yang mewadahi para penyedia jasa sewa dengan pelanggan. Dengan adanya Lecco, diharapkan penyerapan tenaga kerja yang cukup tinggi dapat mengurangi tingkat pengangguran yang telah lama menjadi momok bagi pemerintah Indonesia seperti mulai dari penyedia jasa, kurir, hingga komponen pendukung lain.&nbsp;</p>\n<p>&nbsp;</p>','sewa kostum|sewa pakaian|sewa seragam|aplikasi sewa pakaian|sewa baju|sewa celana',2,1,'2019-03-19 03:39:16','2019-03-20 05:12:40'),(1202,0,'MBS (Makanan Brownis Siwalan) Halal','2019 17010714074 Rahmad Kholik Akbar.pdf',NULL,4652700,'<p>Usaha kami bernama MBS (Makakan Brownis Siwalan) Halal yaitu olahan kreasi makanan khususnya brownis yang berbahan utama buah siwalan, sehingga rasa buah siwalan mendominasi rasa brownis ini. Rasa Brownis Siwalan ini akan sangat khas dan pastinya lezat. Buah siwalan sendiri merupakan buah khas yang berasal dari Tuban, Jawa Timur. Selain untuk memanfaatkan rasa buahnya tujuan kami juga ingin melestarikan makanan khas dan berharap buah siwalan dapat lebih dikenal orang banyak. kami harap masyarakat dapat beralih produk makanan yang kami olah ini dengan kemasan yang menarik, praktis, enak, dan tidak mengandung bahan pengawet, tentunya juga memiliki harga yang terjangkau.&nbsp;</p>','#Brownis #siwalan #enak #lezat #manis #Tuban',1,1,'2019-03-19 04:09:17','2019-03-20 03:11:44'),(1203,0,'SAGET SALUT (Sayur Nagget Rasa Belut)','2019 16010714005 Reza Fardany Ramadhan.pdf',NULL,8321500,'<p class=\"MsoNoSpacing\" style=\"text-align: justify; line-height: 150%; tab-stops: 14.2pt;\"><span lang=\"IN\" style=\"font-size: 12.0pt; line-height: 150%; font-family: \'Times New Roman\',\'serif\'; mso-ansi-language: IN;\">Indonesia merupakan negara kepulauan yang memiliki sumber daya alam yang melimpah, salah satunya adalah kekayaan biota laut. Ikan ini memiliki kadar protein yang cukup tinggi. Oleh karena itu, hal ini menjadi keuntungan bagi Kami untuk menciptakan produk inovasi dalam PMW yang akan Kami beri judul</span><span lang=\"IN\" style=\"font-size: 12.0pt; mso-bidi-font-size: 10.0pt; line-height: 150%; font-family: \'Times New Roman\',\'serif\'; letter-spacing: -.05pt; mso-ansi-language: IN;\">&ldquo;SAGET SALUT&rdquo; (Sayur Nagget Rasa Belut)</span></p>\n<p class=\"MsoNormal\" style=\"text-align: justify; text-indent: .5in; line-height: 150%;\"><span lang=\"IN\" style=\"font-size: 12.0pt; line-height: 150%; font-family: \'Times New Roman\',\'serif\'; mso-ansi-language: IN;\"><span style=\"mso-spacerun: yes;\">&nbsp;</span>Produk ini dibuat dengan </span><span style=\"font-size: 12.0pt; line-height: 150%; font-family: \'Times New Roman\',\'serif\';\">mudah, karena proses pembutannya cukup singkat dan goring terlebih dahulu ikan belutnya. Y</span><span lang=\"IN\" style=\"font-size: 12.0pt; line-height: 150%; font-family: \'Times New Roman\',\'serif\'; mso-ansi-language: IN;\">angmana sebelumnya telah </span><span style=\"font-size: 12.0pt; line-height: 150%; font-family: \'Times New Roman\',\'serif\';\">dibersihkan terlebih dahulu</span><span lang=\"IN\" style=\"font-size: 12.0pt; line-height: 150%; font-family: \'Times New Roman\',\'serif\'; mso-ansi-language: IN;\"> agar </span><span style=\"font-size: 12.0pt; line-height: 150%; font-family: \'Times New Roman\',\'serif\';\">kuman-kuman yang ada di dalam ikan tidak masuk kedalam tubuh kita</span><span lang=\"IN\" style=\"font-size: 12.0pt; line-height: 150%; font-family: \'Times New Roman\',\'serif\'; mso-ansi-language: IN;\">. Ikan yang sudah </span><span style=\"font-size: 12.0pt; line-height: 150%; font-family: \'Times New Roman\',\'serif\';\">di bersihkan lalu di goring terlebih dahulu. Setelah itu baru dicampur dengan tepung terigu dan sayur wortel dan brokoli, setelah itu di taburi dengan tepung roti</span><span lang=\"IN\" style=\"font-size: 12.0pt; line-height: 150%; font-family: \'Times New Roman\',\'serif\'; mso-ansi-language: IN;\">. Latar belakang Kami menciptakan produk ini karena adanya inovasi &ldquo;</span><span style=\"font-size: 12.0pt; line-height: 150%; font-family: \'Times New Roman\',\'serif\';\">nugget</span><span lang=\"IN\" style=\"font-size: 12.0pt; line-height: 150%; font-family: \'Times New Roman\',\'serif\'; mso-ansi-language: IN;\">&rdquo; yang sedang hits-hitsnya. Selain itu dengan adanya inovasi ini diharapkan dapat membiasakan masyarakat untuk mengonsumi makanan yang sehat dan bergizi.</span></p>','belut|nugget',1,1,'2019-03-19 05:20:34','2019-03-19 22:43:15'),(1204,0,'MiLaundry','2019 16051204003 Nadya Hidayatun Najah.pdf',NULL,11988000,'<p class=\"MsoNormal\" style=\"text-align: justify; text-indent: 35.45pt; line-height: 115%;\"><span style=\"font-size: 11.0pt; line-height: 115%; font-family: Ebrima; mso-bidi-font-family: \'Times New Roman\';\">MiLaundry merupakan aplikasi <em>laundry</em> berbasis android yang melayani jasa antar jemput cucian. Yang membedakan aplikasi MiLaundry dengan aplikasi <em>laundry</em> yang sudah ada adalah aplikasi kami menggunakan fitur <em>tracking</em> dengan <em>QR code</em>, dimana pelanggan dapat memantau <em>laundry</em> yang telah diterima oleh kurir.</span></p>\n<p class=\"MsoNormal\" style=\"text-align: justify; text-indent: 35.45pt; line-height: 115%;\"><span style=\"font-size: 11.0pt; line-height: 115%; font-family: Ebrima; mso-bidi-font-family: \'Times New Roman\';\">Aplikasi ini sangat bermanfaat khususnya bagi mahasiswa dan pekerja kantoran yang memiliki kesibukan sehingga tidak memiliki waktu untuk mencuci atau bahkan mengantar cuciannya ke tempat <em>laundry</em>.</span></p>\n<p><span style=\"font-size: 11.0pt; font-family: Ebrima; mso-fareast-font-family: Calibri; mso-fareast-theme-font: minor-latin; mso-bidi-font-family: \'Times New Roman\'; mso-ansi-language: EN-US; mso-fareast-language: EN-US; mso-bidi-language: AR-SA;\">Bagi mahasiswa/pekerja kantoran yang membutuhkan jasa antar jemput cucian ke tempat <em>laundry</em>, dapat mengunduh aplikasi MiLaundry dengan mudah di PlayStore</span></p>','MiLaundry',2,1,'2019-03-19 05:32:36','2019-03-19 19:16:14'),(1205,0,'POKEMON GO!! (Produk Kembang Montari Goyang!!)','2019 16040284069 Mochammad Jauharuddin.pdf',NULL,8250000,'<p>usaha ini dilakukan untuk melestarikan jajanan tradisional terutama kembang goyang dengan disajikan inovasi berupa toping dan varian rasa</p>','Kembang Goyang|Varian Rasa|Toping',1,1,'2019-03-19 05:54:35','2019-03-19 06:50:47'),(1206,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,'2019-03-19 06:24:05','2019-03-19 06:24:05'),(1207,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,'2019-03-19 07:02:01','2019-03-19 07:02:01'),(1208,0,'KANCA BARU (Kain Perca Model Baru)','2019 16010664007 Cintiya Ayu Sinta Andriani.pdf',NULL,6,'<p>KANCA Baru terinspirasi daari tumpukan kain perca yang sudah tidak terpakai. inovasi ini muncul untuk mengurangi tumpukan kain perca yang ada sekaligus menjadikan produk menarik dikalangan masyarakat. kain perca ini diproduksi secara kerjasama dengan pemasaran dan salah satu konveksi maupun ibu-ibu rumah tangga dilingkungan sekitar. keunggulan dari produk kami yaitu tidak adanya motiv yang sama dan hanya satu kali produksi sehingga menjadikan barang terbatas dan tidak ada yang menyaingi. ramah lingkungan dengan harga yang terjangkau juga untuk semua umur dan semua jenis kelamin.&nbsp;</p>','Kain Perca, Produksi kain perca baru, Olahan kain perca',5,1,'2019-03-19 15:56:19','2019-03-20 02:03:09'),(1209,0,'SOOW SOMAY RAINBOW','2019 16021254018 Adi William Raharja.pdf',NULL,1282500,'<p>Somay Rainboow merupakan produk kuliner somay dimsum (berbeda dengan somay bakso/batagor) yang berbahan dasar daging ayam. Produk ini merupakan produk baru dan belum ada yang pernah memproduksi produk semacam ini. Yang membuat produk ini unik adalah konsep varian rasa (isian somay) yang dibedakan ke dalam warna. Dengan rincian dan rencana usaha dimaksudkan dapat didanai sebagaimana mestinya.</p>','Soow somay rainbow|Somay|Soow',1,1,'2019-03-19 16:15:04','2019-03-20 06:45:05'),(1210,0,'Jubung Jaya','2019 16050423026 Dimas Nugroho.pdf',NULL,8000000,'<p class=\"MsoListParagraphCxSpFirst\" style=\"margin-left: 18.0pt; mso-add-space: auto; text-align: justify; text-indent: 18.0pt; line-height: 150%;\"><span lang=\"IN\" style=\"font-size: 12.0pt; line-height: 150%; font-family: \'Times New Roman\',\'serif\'; mso-ansi-language: IN;\">Jubung </span><span style=\"font-size: 12.0pt; line-height: 150%; font-family: \'Times New Roman\',\'serif\';\">adalah Salah satu makanan yang cukup sederhana, banyak di minati dan sangat cocok di nikmati untuk hari-hari santai dan liburan sekaligus makanan yang cukup istimewa, </span><span lang=\"IN\" style=\"font-size: 12.0pt; line-height: 150%; font-family: \'Times New Roman\',\'serif\'; mso-ansi-language: IN;\">Jubung </span><span style=\"font-size: 12.0pt; line-height: 150%; font-family: \'Times New Roman\',\'serif\';\">sendiri<span style=\"mso-spacerun: yes;\">&nbsp; </span>merupakan produk olahan dari </span><span lang=\"IN\" style=\"font-size: 12.0pt; line-height: 150%; font-family: \'Times New Roman\',\'serif\'; mso-ansi-language: IN; mso-bidi-font-style: italic;\">Beras Hitam </span><span style=\"font-size: 12.0pt; line-height: 150%; font-family: \'Times New Roman\',\'serif\';\">yang di olah menjadi makanan ringan yang lezat, gurih dan praktis karena dapat di konsumsi. Produk ini mempunyai varian rasa gurih dan </span><span lang=\"IN\" style=\"font-size: 12.0pt; line-height: 150%; font-family: \'Times New Roman\',\'serif\'; mso-ansi-language: IN;\">manis</span><span style=\"font-size: 12.0pt; line-height: 150%; font-family: \'Times New Roman\',\'serif\';\">. Selain langsung di makan, produk ini juga bisa di konsumsi menggunakan </span><span lang=\"IN\" style=\"font-size: 12.0pt; line-height: 150%; font-family: \'Times New Roman\',\'serif\'; mso-ansi-language: IN;\">pudak</span><span style=\"font-size: 12.0pt; line-height: 150%; font-family: \'Times New Roman\',\'serif\';\">.</span></p>\n<p class=\"MsoListParagraphCxSpLast\" style=\"margin-left: 18.0pt; mso-add-space: auto; text-align: justify; text-indent: 18.0pt; line-height: 150%;\"><span style=\"font-size: 12.0pt; line-height: 150%; font-family: \'Times New Roman\',\'serif\';\">Keberadaan makanan </span><span lang=\"IN\" style=\"font-size: 12.0pt; line-height: 150%; font-family: \'Times New Roman\',\'serif\'; mso-ansi-language: IN;\">jajanan daerah </span><span style=\"font-size: 12.0pt; line-height: 150%; font-family: \'Times New Roman\',\'serif\';\">ini layak dikembangkan menjadi salah satu usaha kuliner alternative di Indonesia. Dengan melihat potensi tersebut, maka kami membuat usaha ini untuk dikembangkan menjadi usaha yang lebih besar lagi, sehingga masyarakat tidak perlu repot-repot membeli </span><span lang=\"IN\" style=\"font-size: 12.0pt; line-height: 150%; font-family: \'Times New Roman\',\'serif\'; mso-ansi-language: IN;\">jubung</span><span style=\"font-size: 12.0pt; line-height: 150%; font-family: \'Times New Roman\',\'serif\';\"> dan mengolahnya, cukup bisa beli </span><span lang=\"IN\" style=\"font-size: 12.0pt; line-height: 150%; font-family: \'Times New Roman\',\'serif\'; mso-ansi-language: IN;\">Jubung </span><span style=\"font-size: 12.0pt; line-height: 150%; font-family: \'Times New Roman\',\'serif\';\">ini sudah membantu mengobati rasa ingin memakan </span><span lang=\"IN\" style=\"font-size: 12.0pt; line-height: 150%; font-family: \'Times New Roman\',\'serif\'; mso-ansi-language: IN;\">jajanan daerah</span><span style=\"font-size: 12.0pt; line-height: 150%; font-family: \'Times New Roman\',\'serif\';\">.</span></p>','Jubung|Makanan Tradisional|Beras Hitam',1,1,'2019-03-19 17:03:59','2019-03-20 02:01:50'),(1211,0,'Partners (Permohonan dan Gugatan Cerai Surabaya)','2019 16040704135 Vioxcy Ananta Putra.pdf',NULL,9560500,'<p class=\"MsoNormal\"><span style=\"color: black; background: white;\">Indonesia merupakan negara dengan jumlah penduduk sekitar 267 juta jiwa. Semakin banyak penduduk dapat mempengaruhi permasalahan yang timbul di masyarakat terutama yang diselesaikan melalui jalur peangadilan.&nbsp;</span>&ldquo;Partners&rdquo;<span style=\"font-variant-ligatures: normal; font-variant-caps: normal; orphans: 2; widows: 2; -webkit-text-stroke-width: 0px; text-decoration-style: initial; text-decoration-color: initial; word-spacing: 0px;\">&nbsp;merupakan&nbsp;solusi yang tepat untuk para pihak yang ingin mengajukan permohonan dan gugatan cerai ke Pengadilan karena&nbsp;<em>&ldquo;Partners&rdquo;</em>&nbsp;tidak memasang tarif yang tinggi seperti ketika meminta bantuan hukum di Kantor Advokat atau Lembaga Bantuan Hukum. Para pihak yang ingin mengajukan permohonan atau gugatan perceraian ke Pengadilan pasti akan kesulitan jika melakukannya sendiri karena prosedur mengajukan permohonan dan gugatan cerai di Pengadilan memerlukan proses yang panjang dan melelahkan. Sehingga &ldquo;Partners&rdquo; menawarkan jasa pembuatan surat permohonan dan gugatan perceraian ke Pengadilan Negeri untuk memudahkan para pihak yang ingin mengajukan gugatan perceraian. Oleh karena itu&nbsp;&nbsp;partners hadir untuk menjawab kebutuhan masyarakat di Surabaya yang ingin mendapatkan layanan jasa bantuan hukum dengan tarif yang murah.</span></p>','indonesia, partners|partners|jasa|gugatan|permohonan',2,1,'2019-03-19 17:17:20','2019-03-20 06:02:20'),(1212,0,'BARASO (Bakso Rasa Soto)','2019 17060484079 Muhamad Rodlotul Alfirdaus.pdf',NULL,14102000,'<p class=\"MsoNormal\" style=\"text-align: justify; text-indent: 36.0pt; mso-layout-grid-align: none; text-autospace: none;\"><span lang=\"EN-US\" style=\"font-size: 12.0pt; mso-bidi-font-size: 11.0pt; line-height: 115%; font-family: \'Times New Roman\',serif; color: black;\">BARASO merupakan inovasi terbaru dikarenakan penggabungan dua jenis makanan menjadi satu. Pada era yang modern banyaknya makanan instan yang beredar di masyarakat, untuk mengurangi masyarakat mengkonsumsi makanan instan terlalu sering makan BARASO dapat menjadi alternatif untuk di konsumsi.<span style=\"mso-spacerun: yes;\">&nbsp; </span>Dengan banyaknya penggemar bakso dan soto di pulau Jawa maka BARASO mampu menjadi menu pilihan utama para penikmat Bakso dan Soto. Selain itu BARASO juga memiliki kualitas yang baik dari segi nutrisi dan gizi.</span></p>','Bakso Rasa Soto',1,1,'2019-03-19 20:27:55','2019-03-20 05:01:40'),(1213,0,'ITSOKELA (Ini Sosis Kentang Mozarela)','2019 17060484070 Ganes Candra Eka Paksi.pdf',NULL,14750000,'<p class=\"MsoNoSpacing\" style=\"text-align: justify; line-height: 150%; tab-stops: 14.2pt;\"><span style=\"font-size: 12.0pt; line-height: 150%; font-family: \'Times New Roman\',\'serif\'; letter-spacing: -.05pt; mso-ansi-language: IN;\"><span style=\"font-family: \'Times New Roman\', serif; letter-spacing: -0.0666667px;\">Kuliner adalah suatu bagian hidup yang erat kaitannya dengan konsumsi makanan sehari-hari. Kuliner merupakan sebuah gaya hidup yang tidak dapat dipisahkan dari kehidupan sehari-hari. Karena setiap orang memerlukan makanan setiap harinya untuk mempertahankan hidup. Pada saat ini, kuliner semakin bermacam-macam. Hal tersebut dikarenakan semakin kreatif orang dalam mengutarakan idenya melalui sebuah produk olahan berupa makanan.</span></span></p>\n<p class=\"MsoNoSpacing\" style=\"text-align: justify; line-height: 150%; tab-stops: 14.2pt;\"><span style=\"font-size: 12.0pt; line-height: 150%; font-family: \'Times New Roman\',\'serif\'; letter-spacing: -.05pt; mso-ansi-language: IN;\">Untuk bersaing dalam dunia kuliner, tentu sangatlah dibutuhkan ide-ide yang kreatif. Oleh karena itu, kami ingin membuat suatu produk makanan yang kami namakan IT&rsquo;SOKELA (Ini Sosis Kentang Mozarela). Produk makanan ini sangatlah unik, karena memadukan cita rasa dari sosis, kentang, dan keju mozarela yang dibalut dengan tepung roti. Produk tersebut merupakan produk makanan yang memiliki kandungan gizi mulai dari karbohidrat, lemak, zat besi hingga protein. Tentunya kandungan gizi tersebut sangat berguna bagi tubuh untuk memenuhi kebutuhan gizinya.</span></p>','kuliner|IT\'SOKELA|makanan|sosis|mozarela',1,1,'2019-03-19 20:41:12','2019-03-20 02:30:24'),(1214,0,'DONTATO ( Donut Without Potato)','2019 16010684062 Fitria Novitasari.pdf',NULL,14325500,'<p>Dontato ( Donut Without Potato) merupakan produk makanan ringan berupa donat tanpa kentang, tetapi tetap empuk. Dengan bentuk yang mungil dan&nbsp;<em>topping</em>&nbsp;yang beraneka ragam, terlebih kami menyediakan&nbsp;<em>topping</em>&nbsp;dari sayur dan buah-buahan. Hal tersebut mampu menjadi makanan ringan alternatif orang tua untuk anaknya tidak menyukai sayuran. Bahan-bahan tersebut menjadi keunggulan kami dari produk sejenis.</p>','Dontato',1,1,'2019-03-19 20:54:00','2019-03-20 05:35:04'),(1215,0,'KTP (KENTUCKY TAHU KRISPY)','2019 16050423004 Arnes Setya Prayogo.pdf',NULL,15000000,'<p class=\"MsoNormal\" style=\"margin-right: 6.7pt; text-align: justify; text-indent: 36.0pt; line-height: 150%;\"><span style=\"font-size: 12.0pt; line-height: 150%; font-family: \'Times New Roman\',\'serif\'; mso-fareast-font-family: Ebrima;\">Tahu </span><span style=\"font-size: 12.0pt; line-height: 150%; font-family: \'Times New Roman\',\'serif\'; color: #222222; background: white;\">adalah makanan yang dibuat dari endapan perasan biji kedelai yang mengalami koagulasi. Tahu merupakan </span><span style=\"font-size: 12.0pt; line-height: 150%; font-family: \'Times New Roman\',\'serif\'; mso-fareast-font-family: Ebrima;\">bahan makanan yang sering dijumpai dan diolah menjadi berbagai jenis makanan yang<span style=\"mso-spacerun: yes;\">&nbsp; </span>diminati dikalangan masyarakat, sehingga kami melakukan inovasi produk kuliner yang bernama KTP( Kentucky Tahu Krispy) yaitu merupakan suatu produk olahan<em style=\"mso-bidi-font-style: normal;\"> franchise</em> yang menggunakan bahan dasar tahu dan tepung terigu. Produk ini kami olah menggunakan tahu yang dilumuri dengan adonan tepung terigu yang sudah diberi bumbu sehingga akan menghasilkan rasa crispy renyah dan gurih. Produk yang kami tawarkan merupakan salah satu inovasi yang saat ini sangat sesuai dibutuhkan karena tingkat daya beli masyarakat terhadap camilan sederhana yang gurih dan renyah sangatlah tinggi<span style=\"color: #222222;\">. Berdasarkan kondisi pasar yang masih terbuka lebar dengan</span> <span style=\"color: #222222;\">permintaan yang cukup tinggi dengan produk oalahan kami dan jumlah kompetitor yang minim menunjukan bahwa prospek kedepan usaha ini sangatlah menjajikan untuk dijadikan produk unggulan di bidang camilan makanan. </span><span style=\"color: black;\">Konsumen</span> <span style=\"color: black;\">yang ingin memesan produk kami bisa menggunakan jasa online dengan menggunakan <strong style=\"mso-bidi-font-weight: normal;\">ig yakni: KTP(kentucky tahu crispy)</strong>, serta bisa bekerjasama dengan go-food, untuk pendistribusian ke konsumen kita menggunakan jasa antar kirim barang dan juga pengiriman dengan jasa karyawan di daerah surabaya. Namun untuk jangka pendek usaha kami masih hanya bisa mencangkup di daerah Gresik dan Surabaya. Untuk jangka pendek konsumen yang diharapkan yakni berupa swalayan serta madiri/online yang dapat bekerjasama dalam pemasaran produk kami. Untuk jangka panjang kami bekerjasama dengan pasar moder(Indomaret/Alfamart). </span></span></p>','KTP (KENTUCKY TAHU KRISPY)',1,1,'2019-03-19 20:55:09','2019-03-20 02:32:25'),(1216,0,'Stick Telor Daun Kelor Krispi','2019 16010684018 firkatun ni\'mah.pdf',NULL,11686000,'<p class=\"MsoNormal\"><span style=\"color: #333333; font-family: \'Times New Roman\', serif; font-size: 12pt;\">Meningkatnya minat dan konsumsi terhadap cemilan, menjadi salah satu alasan mengapa penulis mengembangkan sebuah produk makanan ringan atau cemilan. Dan disini, penulis menggunakan suatu bahan yang masih jarang digunakan sebagai bahan pembuat cemilan, yaitu daun kelor. Pembuatan cemilan dari daun kelor ini atau lebih tepatnya adalah stick telur daun kelor krispy </span><span style=\"color: #333333; font-family: \'Times New Roman\', serif; font-size: 12pt;\">&nbsp;</span><span style=\"color: #333333; font-family: \'Times New Roman\', serif; font-size: 12pt;\">diharapakan dapat memenuhi kebutuhan para konsumen akan cemilan atau makanan ringan. Selain menyehatkan, stick telur daun kelor krispy juga mengandung banyak vitamin yang bagus untuk tumbuh kembang anak usia dini. Penulis berharap stick telur daun kelor krispy ini menjadi cemilan yang menyehatkan. Serta dapat menjadi usaha produksi yang membawa hasil yang menguntungkan.</span></p>','inovasi dalam membuat camilan sehat dengan mencari sayuran yang bernilai gizi tinggi. daun kelor dipilih karena memiliki berbagai macam khasiat yang berguna bagi tubuh manusia. zaman sekarang ini semakin susah mencari tanaman kelor, namun tanaman kelor ini masih banyak tumbuh subur di daerah madiun. snack atau camilan sehat yang ditunjukkan untuk anak usia dinii untuk memenuhi gizi seimbang anak. sebagai solusi para orangtua untuk menyediakan camilan yang sehat bagi anak mereka.',1,1,'2019-03-19 20:59:31','2019-03-20 03:51:11'),(1217,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,'2019-03-19 21:06:39','2019-03-19 21:06:39'),(1218,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,1,'2019-03-19 21:10:45','2019-03-20 00:35:53'),(1219,0,'SusuMuJaHat ( Susu Murni Jagung Sehat )','2019 17050634012 Siti Chusnul Chasanah.pdf',NULL,8850000,'<p><span style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; mso-fareast-font-family: Calibri; letter-spacing: -.05pt; mso-ansi-language: EN-US; mso-fareast-language: EN-US; mso-bidi-language: AR-SA;\"><strong>SusuMuJaHat</strong> hadir sebagai susu inovasi baru dari jagung manis yang diolah untuk dijadikan minuman segar yang menyehatkan, dan bisa diminum kapanpun bahkan bisa digunakan sebagai menu sarapan. Susu Jagung ini sangat cocok dikonsumsi oleh mereka yang sedang menjalankan program diet karena jagung mengandung karbohidrat dan lemak baik yang menimbulkan efek kenyang lebih lama. Selain itu Susu Jagung</span><span style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; mso-fareast-font-family: Calibri; mso-ansi-language: EN-US; mso-fareast-language: EN-US; mso-bidi-language: AR-SA;\"> dapat menyegarkan dan menyehatkan tubuh karena tidak mengandung kolesterol.<span style=\"letter-spacing: -.05pt;\">&nbsp;</span></span></p>','SusuMuJaHat',1,1,'2019-03-19 21:52:38','2019-03-20 03:40:35'),(1220,0,'GetBus : Aplikasi Portal Penyewaan Bus Pariwisata','2019 17051214028 RAMA SYAIFUL ARIF.pdf',NULL,14280000,'<p class=\"MsoNormal\" style=\"text-indent: 35.45pt; line-height: 115%; border: none; mso-padding-alt: 31.0pt 31.0pt 31.0pt 31.0pt; mso-border-shadow: yes; margin: 0cm 0cm 12.0pt 35.45pt;\"><span lang=\"EN-US\" style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; mso-fareast-font-family: \'Times New Roman\';\">Program Mahasiswa Wirausaha merupakan suatu wadah bagi mahasiswa Universitas Negeri Surabaya untuk berkreasi dalam bidang kewirausahaan. Dengan adanya program PMW ini saya Rama Syaiful Arif sebagai ketua dari tim GetBus ingin memanfaatkan kesempatan ini untuk mengikuti PMW ini untuk membentuk jiwa wirausaha dalam tim kami.<span style=\"mso-tab-count: 1;\">&nbsp; </span></span></p>\n<p class=\"MsoNormal\" style=\"text-indent: 36.0pt; line-height: 115%; margin: 0cm 0cm 10.0pt 36.0pt;\"><span lang=\"EN-US\" style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; mso-fareast-font-family: \'Times New Roman\';\">Persewaan bus pariwisata saat ini kebanyakan ditawarkan melalui media offline, namun beberapa PO bus yang telah memiliki website. Baik PO bus yang sudah memiliki website ataupun belum, Tour &amp; Travel agent pun akan mengalami kesulitan untuk membandingkan harga antara PO bus satu dengan yang lain karena harus mengakses halaman yang berbeda pula. Maka dari itu, kami ingin membuat sebuah aplikasi platform persewaan bus yang dapat memudahkan Tour &amp; Travel Agent dalam mencari bus dan membandingkan harga dari tiap - tiap PO bus yang memiliki armada yang siap untuk memenuhi kebutuhan pesanan Tour &amp; Travel Agent.</span></p>\n<p class=\"MsoNormal\" style=\"margin-left: 35.45pt; text-indent: 35.45pt; line-height: 115%; border: none; mso-padding-alt: 31.0pt 31.0pt 31.0pt 31.0pt; mso-border-shadow: yes;\"><span lang=\"EN-US\" style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; mso-fareast-font-family: \'Times New Roman\';\">Konsep usaha GetBus merupakan konsep yang pertama kali ada sehingga menjadi terobosan baru dalam mengubah sistem persewaan bus yang ada selama ini. Dengan berbekal konsep ini, prospek GetBus untuk berkembang semakin besar memiliki prosentase tinggi jika kami bisa menguasai pasar yang ada di masyarakat. kami berharap mendapat kepercayaan bantuan modal untuk membangun dan mengembangkan usaha kami melalui PMW.</span></p>','startup|portal|aplikasi|web|sewa|bus|pariwisata|sewabus|GetBus|jasa',2,1,'2019-03-19 23:08:34','2019-03-20 04:40:27'),(1221,0,'STODOR (stop odor)','2019 17060484075 Alfiyan Kurnia Fernando.pdf',NULL,13000000,'<p>STODOR (stop odor) adalah produk pengharum sepatu yang dapat menyerap kuman</p>','stodor|odor|deodoran|sepatu|inovatif|bau',4,1,'2019-03-20 00:38:11','2019-03-20 05:44:36'),(1222,0,'Fifty Plus','2019 17060484048 EKA AYU MIRANDA.pdf',NULL,14500000,'<p>Fifty Plus merupakan rancangan usaha di bidang jasa yang berbentuk dalam kegiatan olahraga yaitu senam yang ditujukan untuk lansia agar menjaga kebugaran mereka. Namun tidak hanya kebugaran saja, kita akan menyediakan program rehabilitasi untuk penyakit kesehatan dalam konten kebugaran. Program ini menggunakan pendamping tenaga kesehatan untuk pemeriksaan anggota lansia dan juga menggunakan aplikasi dari smartphone untuk mengetahui bagaimana kondisi tubuh baik tulang maupun lainnya dengan cara di potrait.</p>','Fifty Plus|Rehabilitasi|Lansia|Kebugaran|Kesehatan|Senam',2,1,'2019-03-20 00:53:35','2019-03-20 06:08:55'),(1223,0,'AVE (Accessories Since 2019)','2019 16010044005 afiqo muhammad suhail.pdf',NULL,1810000,'<p>Kota semakin padat, karena kedatangan para kaum urban menyebabkan tingkat lapangan kerja yang ada tidak sesuai dengan pencarinya. Keadaan ekonomi global yang makin melemah juga menyebabkan dampak terhadap lapangan kerja yang ada. Bidang industri kreatif menjadi alternatif bagi kaum muda untuk mengatasi sulitnya lapangan kerja dan ketatnya persaingan. Di era industri 4.0 ini memudahkan produsen untuk memasarkan hasil produksinya. Accessories berbahan dasar clay merupakan aksesoris dengan bahan dasar murah tetapi diminati oleh konsumen dan mempunyai pasar yang bagus dari kalangan anak muda sampai dewasa. Hal ini menyebabkan kami menjadikan accessories dengan bahan dasar clay sebagai penunjang kreatifutas ABJ (anak berkebutuhan khusus) agar anak dapat memaksimalkan potensi yang ada pada dirinya. Dilain hal itu anak juga dapat manfaat utama yaitu dari penjualab hasil kreatifitasnya untuk menghidupi kesehariannya.</p>','Accessories |Clay |Accessories',4,1,'2019-03-20 01:03:23','2019-03-20 03:38:01'),(1224,0,'RDA Recycling Tote Bag','2019 17060484065 Radha Dwi Arta.pdf',NULL,14200000,'<p><span style=\"font-family: \'Times New Roman\', serif; font-size: 16px; letter-spacing: -0.0666667px; text-align: justify;\">Saat ini dunia fashion menjadi pusat perhatian masyarakat luas. Semua berlomba menciptakan fashion dengan kriteria dan fungsi masing-masing, dan tentunya keindahan dan kenyamanan barang yang menjadi poin utama. Akan tetapi dengan bergulirnya waktu semua pakaian lama yang tak terpakai hanya menumpuk di lemari saja, bahkan ada yang sampai dibuang dengan percuma. Karena setiap hari pasti ada saja inovasi baru atas fashion itu sendiri. Tetapi saya ingin mencari peluang dari pakaian bekas ini menjadi suatu yang berguna dan juga memiliki nilai jual. Pakaian bekas tersebut ingin saya jadikan sebuah tote bag. Tote bag menjadi fashion pendukung outfit harian kaum millenial saat ini. Tas yang simple namun memiliki fungsi yang membantu untuk keseharian. Dengan banyaknya model dan warna pada pakaian membuat tote bag ini memiliki motif yang beragam dan tidak akan membuat bosan. Dan tentunya dengan pembuatan tote bag ini akan memanfaatkan pakaian bekas yang hanya akan menjadi sampah berubah menjadi barang yang berguna dan menunjang fashion keseharian.</span></p>\n<p><span style=\"font-family: \'Times New Roman\', serif; font-size: 16px; letter-spacing: -0.0666667px; text-align: justify;\">&nbsp;</span></p>','Tote Bag|Recycling Tote Bag|Tote Bag Kreatif',4,1,'2019-03-20 01:12:29','2019-03-20 06:15:27'),(1225,0,'SidoArt_Joe','2019 17060484118 HABIB IBRAH ABI MAHESA.pdf',NULL,12894000,'<p class=\"MsoListParagraph\" style=\"margin-left: 1.0cm; line-height: 115%; tab-stops: 1.0cm; mso-layout-grid-align: none; text-autospace: none;\"><span lang=\"IN\" style=\"font-family: Ebrima; mso-ansi-language: IN;\">Di sebuah instansi, di sebuah organisasi atau apapun yang bersangkutan dengan acara, pasti membutuhkan yang namanya desain. Dari desain pamflet, background, undangan atau apapun. Desainer itu sangatlah banyak, namun kebanyakan dari mereka hanya mendesain apa yang ada di kepentingannya. Mereka tidak memanfaatkan keahliannya untuk berbisnis dengan luas, namun ada beberapa desainer yang melakukan jual jasa desain. Tentu itu tidaklah banyak, Oleh karena itu saya selaku pengusung PMW, saya mau membuat sebuah usulan. Dengan membuat sebuat jasa desain dengan nama &ldquo; SidoArt_Joe&rdquo;. Saya mendapat ide itu karena saya orang sidoarjo, dan nama itu cocok bila digunakan untuk nama instansi jasa desain. Kita memudahkan para mahasiswa atau masyarakat untuk membuat desian yang bagus. Dan harga yang di tawarkan sesuai dengan tingkat kesusahan desainnya.</span></p>','desain kreatif|sidoarjo|mahasiswa|unesa |pmw|pmw unesa',4,1,'2019-03-20 01:19:04','2019-03-20 04:37:33'),(1226,0,'usus ndess aahh','2019 17060484072 Moh rifai.pdf',NULL,14434000,'<p class=\"MsoListParagraphCxSpFirst\" style=\"margin-left: 3.8pt; mso-add-space: auto; text-indent: 32.2pt; line-height: 14.65pt; background: white;\"><span lang=\"EN-US\" style=\"font-family: Ebrima; mso-fareast-font-family: \'Times New Roman\'; mso-bidi-font-family: Arial; color: #333333; mso-fareast-language: IN;\">Awal mula dari tercetusnya usaha </span><span style=\"font-family: Ebrima; mso-bidi-font-family: Arial; mso-ansi-language: IN;\">Usus NDESS AAHH</span><span style=\"font-family: Ebrima; mso-fareast-font-family: \'Times New Roman\'; mso-bidi-font-family: Arial; color: #333333; mso-fareast-language: IN;\"> <span lang=\"EN-US\">ini kebetulan saya penggemar usus dan sering kali kalau disekolah atau pun dijalan kalau ada usus saya selalu beli, karna saya pecinta usus sehingga tau rasa usus dan teksturnya kriuh tapi kurang nyaman bagi yang tak punya gig</span></span><span style=\"font-family: Ebrima; mso-fareast-font-family: \'Times New Roman\'; mso-bidi-font-family: Arial; color: #333333; mso-ansi-language: IN; mso-fareast-language: IN;\">i</span><span lang=\"EN-US\" style=\"font-family: Ebrima; mso-fareast-font-family: \'Times New Roman\'; mso-bidi-font-family: Arial; color: #333333; mso-fareast-language: IN;\">. Maka </span><span style=\"font-family: Ebrima; mso-fareast-font-family: \'Times New Roman\'; mso-bidi-font-family: Arial; color: #333333; mso-ansi-language: IN; mso-fareast-language: IN;\">dari itu saya punya teman yang sama pecinta usus dengan saya memberi saran mendingan kita buat usus dengan cita rasa yang berbeda dan nyaman bagi orang tidak punya gigi juga bagi anak kecil yang tak punya gigipun bisa mengkonsumsi juga.</span><span lang=\"EN-US\" style=\"font-family: Ebrima; mso-fareast-font-family: \'Times New Roman\'; mso-bidi-font-family: Arial; color: #333333; mso-fareast-language: IN;\"><span style=\"mso-spacerun: yes;\">&nbsp; </span>ibu saya bekerja di pasar dan menjadi pembersih bulu ayam dan pembuang jeroan ayam. karena saya melihat adanya usus ditempat kerja ibu saya setelah selesai selalu dibuang dan terkadang ibu saya membawa pulang untuk diolah untuk sandingan makanan. Dari situlah saya punya inisiatif kenapa tidak saya buat usaha saja </span><span style=\"font-family: Ebrima; mso-fareast-font-family: \'Times New Roman\'; mso-bidi-font-family: Arial; color: #333333; mso-ansi-language: IN; mso-fareast-language: IN;\">dan saran dari teman saya tadi juga mengenai usus varian </span></p>\n<p class=\"MsoListParagraphCxSpMiddle\" style=\"margin-left: 3.8pt; mso-add-space: auto; text-indent: 32.2pt; line-height: 14.65pt; background: white;\"><span lang=\"EN-US\" style=\"font-family: Ebrima; mso-fareast-font-family: \'Times New Roman\'; mso-bidi-font-family: Arial; color: #333333; mso-fareast-language: IN;\">Usaha </span><span style=\"font-family: Ebrima; mso-bidi-font-family: Arial; mso-ansi-language: IN;\">Usus Ndess Aahh </span><span lang=\"EN-US\" style=\"font-family: Ebrima; mso-fareast-font-family: \'Times New Roman\'; mso-bidi-font-family: Arial; color: #333333; mso-fareast-language: IN;\">adalah usaha yang akan dijalankan di Pasuruan. Dengan bahan mentah usus yang memiliki cita rasa </span><span style=\"font-family: Ebrima; mso-fareast-font-family: \'Times New Roman\'; mso-bidi-font-family: Arial; color: #333333; mso-ansi-language: IN; mso-fareast-language: IN;\">pedas </span><span lang=\"EN-US\" style=\"font-family: Ebrima; mso-fareast-font-family: \'Times New Roman\'; mso-bidi-font-family: Arial; color: #333333; mso-fareast-language: IN;\">gurih dan renyah ketika diolah membuat peminat konsumen untuk mengkonsumsinya. Usaha makanan ringan tersebut merupakan usaha yang ramai diminati bagi masyarakat saat ini untuk cemilan sehari hari. Dengan adanya </span><span style=\"font-family: Ebrima; mso-bidi-font-family: Arial; mso-ansi-language: IN;\">Usus Ndess Aahh</span><span lang=\"EN-US\" style=\"font-family: Ebrima; mso-fareast-font-family: \'Times New Roman\'; mso-bidi-font-family: Arial; color: #333333; mso-fareast-language: IN;\"> ini<span style=\"mso-spacerun: yes;\">&nbsp; </span>bisa dikonsumsi disituasi santai dan dapat juga sebagai teman santapan makan. </span></p>\n<p class=\"MsoListParagraphCxSpMiddle\" style=\"margin-left: 3.8pt; mso-add-space: auto; line-height: 14.65pt; background: white;\"><span style=\"font-family: Ebrima; mso-fareast-font-family: \'Times New Roman\'; mso-bidi-font-family: Arial; color: #333333; mso-ansi-language: IN; mso-fareast-language: IN;\"><span style=\"mso-tab-count: 1;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span>Usus ndess aah ini memiliki 4 varian rasa yaitu pedas original, bbq pedas, balado pedas, dan yang terakhir varian soas, yang kami tonjolkan disini yaitu bentuk kripik usus yang beda dengan kripik<span style=\"mso-spacerun: yes;\">&nbsp; </span>usus yang ada dipasaran. Ususnya kita blender sehingga terasa halus dan renyah kita bentuk seperti kripik tempe dan bentuk bentuk yang lain.</span></p>\n<p class=\"MsoListParagraphCxSpLast\" style=\"margin-left: 3.8pt; mso-add-space: auto; text-indent: 24.55pt; line-height: 14.65pt; background: white;\"><span lang=\"EN-US\" style=\"font-family: Ebrima; mso-fareast-font-family: \'Times New Roman\'; mso-bidi-font-family: Arial; color: #333333; mso-fareast-language: IN;\">Usaha ini akan dijadikan sampingan kaum muda pasuruan yang tidak punya pekerjaann yang terikat sehingga bisa mengantar order an ke konsumen dan juga lebih tren nya sekarang jualan online. Selain itu produk kripik usus ini dipublikasikan pada berbagai media agar segera konsumen mengetahui informasi.</span></p>','usus|kripik',1,1,'2019-03-20 01:19:59','2019-03-20 04:14:37'),(1227,0,'Waste Wood Project','2019 16020124057 della tiara paramitha.pdf',NULL,7642000,'<p class=\"MsoNormal\" style=\"text-align: justify; text-indent: 36.0pt; line-height: 150%;\"><span style=\"font-size: 12.0pt; line-height: 150%; font-family: \'Times New Roman\',\'serif\';\">&ldquo;Waste Wood Project&rdquo; memanfaatkan limbah kayu sebagai bahan untuk membuat prodak hiasan dinding bertemakan POP Art. Kami memilih salah satu tema POP Art karna tema ini kami rasa banyak diminati oleh banyak kalangan. <span style=\"mso-spacerun: yes;\">&nbsp;</span>Kami mendirikan waste wood ini karna merasa bahwa limbah kayu yang ada di kampus unesa lidah wetan tidaklah begitu di perhatikan dan kami ingin membuat limbah kayu ini menjadi barang yang benilai tinggi juga turut serta melestarikan lingkungan kampus unesa. Melalui PMW kami berharap dapat mengembangkan usaha yang sedang kami rintis, sehingga dapat berkembang dan bermanfaat</span></p>','waste wood, wood dekorasi, pop art',4,1,'2019-03-20 02:57:33','2019-03-20 05:12:07'),(1228,0,'LORDBANANA_SHOESCLEANING','2019 15060484151 Surya Kusuma arief putra.pdf',NULL,14966000,'<p><span lang=\"EN-US\" style=\"font-size: 11pt; line-height: 150%; font-family: Calibri, sans-serif; color: #222222; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">Saat ini tren koleksi sepatu sneakers dan running mulai berkembang di tengah kalangan anak muda. Jika dulu merek sepatu seperti, Converse, Vans, Nike dan Adidas tidak terlalu banyak dipakai, kini hampir semua anak muda di mall atau tempat nongkrong menggunakan sepatu dengan merek-merek tersebut. Tren ini merupakan peluang usaha, tapi bukan menjual sepatunya, melainkan membuka usaha laundry sepatu</span><span lang=\"EN-US\" style=\"font-size: 11pt; line-height: 150%; font-family: Calibri, sans-serif; color: #404040; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">.</span><span lang=\"EN-US\" style=\"font-size: 11.0pt; line-height: 150%; font-family: \'Calibri\',sans-serif; mso-fareast-font-family: Calibri; mso-bidi-font-family: \'Times New Roman\'; color: #222222; mso-ansi-language: EN-US; mso-fareast-language: EN-US; mso-bidi-language: AR-SA;\"> Kini berkat adanya tren tersebut, jasa reparasi dan laundry sepatu mulai banyak dicari orang. Menyadari harga belinya yang tidak murah, hampir semua kolektor sepatu menginginkan perawatan khusus untuk menjaga kondisi sepatu miliknya</span></p>','LORDBANANA',2,1,'2019-03-20 03:11:30','2019-03-20 05:32:53'),(1229,0,'KiesBay (Cookies Bayam)','2019 16060484013 Aulia Lita Pradina.pdf',NULL,7904500,'<p>olahan yang berupa cookies ini dimodifikasi dengan menggunakan bahan sayuran yang memiliki kandungan nutrisi yang cukup tinggi. olahan cookies tersebut bernama KiesBay atau Cookies Bayam. bayam mengandung banyak nutrisi terutama pada kandungan kalori serta seratnya. Olahan ini diperuntukkan untuk segala kalangan usia mulai dari balita sampai dengan orang dewasa dengan harga Rp. 10.000,-/bungkus dengan isi 12 pcs disetiap bungkusnya. Memiliki banyak akan nutrisi dan harga yang terjangkau membuat KiesBay akan lebih dinikmati.&nbsp;</p>','#cookies|#bayam |#olahanbayan|#cookiesbayam |#KiesBay |#makananringan',1,1,'2019-03-20 03:17:36','2019-03-20 05:38:10'),(1230,0,'SEBERKEL (Sehat Bersama Kedelai)','2019 17060484113 Diah Dwi Astutik.pdf',NULL,8000000,'<p>Bisnis minuman yang saya tawarkan adalah inovasi sari kedelai dengan nama Seberkel (Sehat Bersama Kedelai). Keunggulan dan keunikan dari bisnis ini adalah pada penyajiannya yang unik disertai dengan varian rasa yang bermacam-macam. Seberkel disajikan dingin dengan es batu yang diblender. Seberkel ditambah dengan toping berupa bubble untuk menambah keunggulan dan keunikannya. Selain itu, minunman ini mempunyai berbagai pilihan rasa diantaranya Original, Oreo, Cocholate, Vanila Latte, Taro, dan Cappucino. Sehingga selain rasa asli dari Kedelai, Seberkel memiliki pilihan rasa yang pasti akan diminati seluruh kalangan masyarakat.&nbsp;</p>\n<p>&nbsp;</p>\n<p>Produk ini dikemas menggunakan cup plastik dan ditutup menggunakan tutup plastic cembung. Sedotan yang digunakan berukuran besar yang bertujuan supaya Seberkel dapat dinikmati dengan mudah. Minuman ini dijual menggunakan booth menarik pada tempat-tempat strategis agar masyarakat dapat menjangkau Seberkel dengan mudah.&nbsp;</p>\n<p>Bisnis&nbsp;</p>','kedelai',1,1,'2019-03-20 03:22:02','2019-03-20 05:50:27'),(1231,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,'2019-03-20 03:28:13','2019-03-20 03:28:13'),(1232,0,'Keripik Sawi','2019 17060484105 Desi munita.pdf',NULL,3000000,'<p>Keripik Sawi ini dibuat dengan bahan dasar utamanya tepung terigu dan&nbsp; bahan dasar sayur sawi. Sayuran berfungsi sebagai menarik perhatian konsumen dewasa maupun anak kecil. Selain itu sayuran juga berfungsi untuk memudahkan para orangtua untuk memenuhi gizi seimbang memalui camilan &ldquo;Keripik Sawi&rdquo; ini.&nbsp;</p>','sawi',1,1,'2019-03-20 03:29:19','2019-03-20 06:12:16'),(1233,0,'Rapi Bukanlah Hal yang Rumit','2019 17060484084 Paulus Hendro Titirloloby.pdf',NULL,11650000,'<p>Kerah Pasangan untuk semua kalangan</p>','Kerah Pasangan|PMW UNESA',2,1,'2019-03-20 03:36:02','2019-03-20 06:15:04'),(1234,0,'Cireng Pelangi','2019 17060484094 Silvia Damayanti.pdf',NULL,9000000,'<p class=\"MsoNormal\" style=\"margin-left: 14.2pt; text-align: justify; text-indent: 36.0pt; mso-layout-grid-align: none; text-autospace: none;\"><span lang=\"IN\" style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; mso-ansi-language: IN;\">Cireng merupakan jajanan tradisional yang terbuat dari tepung tapioka. Di Indonesia utamanya diberbagai daerah sudah meluas jajanan tersebut, dan juga tidak asing lagi bagi masyarakat sekitar, utamanya pada kalangan anak &ndash; anak jajanan tersebut banyak diminati. Dalam hal ini saya<span style=\"mso-spacerun: yes;\">&nbsp; </span>membuat &rdquo;cireng pelangi&rdquo; sebagai inovasi baru untuk jajanan yang banyak manfaatnya.</span></p>\n<p class=\"MsoNormal\" style=\"margin-left: 14.2pt; text-align: justify; text-indent: 36.0pt; mso-layout-grid-align: none; text-autospace: none;\"><span lang=\"IN\" style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; mso-ansi-language: IN;\">Cireng pelangi ini dibuat dengan bahan dasar utamanya tepung tapioka dan lambang pelanginya menggunakan bahan dasar sayuran. Sayuran berfungsi sebagai menarik perhatian konsumen utamanya untuk anak-anak kecil. Selain itu sayuran juga berfungsi untuk memudahkan para orangtua untuk memenuhi gizi seimbang memalui camilan &ldquo;Cireng Pelangi&rdquo; ini. Disisi lain &ldquo;Cireng Pelangi&rdquo; ini dibuat untuk memenuhi kebutuhan pengganti karbohidrat dan juga memenuhi kebutuhan gizi. Sesuai dengan yang ada dilingkungan masyarakat cireng pelangi belum terlalu viral dan belum terlalu dikenal oleh masyarakat. Maka dari itu &ldquo;Cireng Pelangi&rdquo; ini dibuat sebagai inovasi dari camilan yang sudah ada.</span></p>','Cireng Pelangi',1,1,'2019-03-20 03:42:40','2019-03-20 05:40:50'),(1235,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,1,'2019-03-20 03:48:02','2019-03-20 03:48:59'),(1236,0,'SOLAR OLI  (personal trainer for slim body)','2019 17060484099 Abdulloh Faliqul Isbach.pdf',NULL,9000000,'<p class=\"MsoNormal\" style=\"margin-left: 1.0cm; text-indent: 7.65pt; line-height: 115%; mso-layout-grid-align: none; text-autospace: none;\"><span lang=\"IN\" style=\"font-size: 12.0pt; mso-bidi-font-size: 11.0pt; line-height: 115%; font-family: \'Times New Roman\',serif; mso-ansi-language: IN;\">Berat badan ideal dan bentuk tubuh proporsional saat ini menjadi daya tarik tersendiri sebagai peluang usaha. Karena masyarakat sekarang semakin sadar pentingnya arti kesehatan. Kaum hawa khususnya dan pria dengan kepedulian tinggi terhadap penampilannya sangat membutuhkan tubuh yang dapat meningkatkan rasa percaya diri dan performa mereka.&nbsp; </span></p>\r\n<p>&nbsp;</p>\r\n<p class=\"MsoNormal\" style=\"margin-left: 1.0cm; line-height: 115%; mso-layout-grid-align: none; text-autospace: none;\"><span lang=\"IN\" style=\"font-size: 12.0pt; mso-bidi-font-size: 11.0pt; line-height: 115%; font-family: \'Times New Roman\',serif; mso-ansi-language: IN;\">Usaha ini menawarkan jasa personal trainer melalui latihan terprogram dan pemantauan </span><span lang=\"IN\" style=\"font-size: 12.0pt; mso-bidi-font-size: 11.0pt; line-height: 115%; font-family: \'Times New Roman\',serif;\">&nbsp;</span><span lang=\"IN\" style=\"font-size: 12.0pt; mso-bidi-font-size: 11.0pt; line-height: 115%; font-family: \'Times New Roman\',serif; mso-ansi-language: IN;\">pola makan dan asupan makan. Trainee (peserta program) </span><span style=\"font-size: 12.0pt; mso-bidi-font-size: 11.0pt; line-height: 115%; font-family: \'Times New Roman\',serif;\">akan </span><span lang=\"IN\" style=\"font-size: 12.0pt; mso-bidi-font-size: 11.0pt; line-height: 115%; font-family: \'Times New Roman\',serif; mso-ansi-language: IN;\">mendapatkan informasi pengingat dari trainer untuk melakukan aktivitas fisik terjadwal dengan</span> <span lang=\"IN\" style=\"font-size: 12.0pt; mso-bidi-font-size: 11.0pt; line-height: 115%; font-family: \'Times New Roman\',serif; mso-ansi-language: IN;\">&nbsp;pendampingan</span> <span lang=\"IN\" style=\"font-size: 12.0pt; mso-bidi-font-size: 11.0pt; line-height: 115%; font-family: \'Times New Roman\',serif; mso-ansi-language: IN;\">&nbsp;trainer dan saran</span> <span lang=\"IN\" style=\"font-size: 12.0pt; mso-bidi-font-size: 11.0pt; line-height: 115%; font-family: \'Times New Roman\',serif; mso-ansi-language: IN;\">&nbsp;menu makanan tiap hari dari trainer.</span></p>','personal traier|diet|slimbody',2,1,'2019-03-20 03:54:21','2019-03-20 06:42:26'),(1237,0,'USFC (Uitimate Swim For Children)','2019 17060484082 Rizaldi Agasta.pdf',NULL,13820000,'<p class=\"MsoNormal\" style=\"margin-left: 1.0cm; text-indent: 7.65pt; line-height: 115%; mso-layout-grid-align: none; text-autospace: none;\"><span style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; mso-ansi-language: IN;\"><span style=\"mso-spacerun: yes;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span><span lang=\"EN-US\" style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\';\">Olahraga merupakan hal penting yang diperlukan oleh tubuh apalagi</span><span style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; mso-ansi-language: IN;\"> seiring berjalannya waktu anak-anak lebih menyukai bermain Gadget dan lupa akan pentingnya berolahraga bagi kesehatan tubuh. Para orangtua mulai banyak yang cemas dengan keadaan ini kian hari mulai bertambah intensitasnya dalam bermain game online dan juga berbagai penyakit yang timbul akibat keseringan bermain Gadget. </span></p>\n<p class=\"MsoNormal\" style=\"margin-left: 1.0cm; text-indent: 7.65pt; line-height: 115%; mso-layout-grid-align: none; text-autospace: none;\"><span style=\"font-size: 12.0pt; line-height: 115%; font-family: \'Times New Roman\',\'serif\'; mso-ansi-language: IN;\"><span style=\"mso-spacerun: yes;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span>Oleh karena itu saya ingin menambahkan wawasan atau edukasi kepada anak-anak terkait bagaimana pentingnya kesehatan tubuh melalui berlatih renang namun yang saya lihat didaerah Surabaya ini hanya sekedar les berenang biasa pada umumnya. Maka, dalam usaha ini saya akan memunculkan metode mengapung dan menunggu ini supaya anak-anak tahu bagaimana menyenangkannya ketika bisa mengapung didalam kolam renang sekalipun dikolam yang dalam. Selain melatih motorik saya juga melatih mental anak-anak agar terbentuk seorang individu dengan pembawaan tenang.</span></p>','anak-anak|renang|pelatihan|pemasaran',2,1,'2019-03-20 05:14:09','2019-03-20 06:01:38'),(1238,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,1,'2019-03-20 05:18:37','2019-03-20 15:38:18'),(1239,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,1,'2019-03-20 05:48:23','2019-03-20 06:43:37'),(1240,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,'2019-03-20 06:02:13','2019-03-20 06:02:13'),(1241,0,'Buaya Darat','2019 17060484117 shofyan ali mashuri.pdf',NULL,6400000,'<p class=\"MsoNormal\" style=\"margin-left: 1.0cm; text-indent: 1.0cm; line-height: 115%; mso-layout-grid-align: none; text-autospace: none;\"><span lang=\"IN\" style=\"font-family: \'Times New Roman\',serif; mso-ansi-language: IN;\">&ldquo;Buaya Darat&rdquo; adalah sebuah produk minuman hasil pemanfaatan lahan kosong yang ditanami tanaman lidah buaya. Produk minuman ini merupakan trobosan minuman baru berbahan <em style=\"mso-bidi-font-style: normal;\">aloevera </em>(lidah buaya) dan berpadu dengan bahan bahan lainnya. Sebagimana diketahui, lidah buaya mendapat sebutan sebagai &ldquo;miracle plant&rdquo; tanaman ajaib, karena manfaatnya sangat banyak dan<span style=\"mso-spacerun: yes;\">&nbsp; </span>baik bagi kesehatan.<span style=\"mso-spacerun: yes;\">&nbsp; </span></span></p>\n<p class=\"MsoNormal\" style=\"margin-left: 1.0cm; text-indent: 1.0cm; line-height: 115%; mso-layout-grid-align: none; text-autospace: none;\"><span lang=\"IN\" style=\"font-family: \'Times New Roman\',serif; mso-ansi-language: IN;\">Penamaan Buaya Darat diambil dari kata yang sering digunakan didalam media sosial dan mudah diingat, jadi dari penamaan ini bisa mudah diingat dan memunculkan rasa ingin tahu dari banyak orang dan ini menjadi peluang ramainya pembeli minuman &ldquo;Buaya Darat&rdquo;. </span></p>\n<p class=\"MsoNormal\" style=\"margin-left: 1.0cm; text-indent: 1.0cm; line-height: 115%; mso-layout-grid-align: none; text-autospace: none;\"><span lang=\"IN\" style=\"font-family: \'Times New Roman\',serif; mso-ansi-language: IN;\">Konsep pemasaran akan menggabungkan antara media sosial dan kurir pengiriman barang, sehingga dapat meminimalisir waktu dan tenaga. Karena di era sekarang <em style=\"mso-bidi-font-style: normal;\">online shop </em>telah menjadi alat yang sangat membantu konsumen. <span style=\"mso-spacerun: yes;\">&nbsp;</span>Jadi tempat yang strategis bukan hal yang penting.</span></p>\n<p class=\"MsoNormal\" style=\"text-indent: 1.0cm; line-height: 115%; mso-layout-grid-align: none; text-autospace: none; margin: 0cm -.05pt .0001pt 1.0cm;\"><span lang=\"IN\" style=\"font-family: \'Times New Roman\',serif; mso-ansi-language: IN;\">Segi desain kemasan yang menarik yang berlabel &ldquo;Buaya Darat&rdquo; menambah mudah diingatnya produk minuman ini, ditambah <em style=\"mso-bidi-font-style: normal;\">Bajol Ijo </em>sebagai <em style=\"mso-bidi-font-style: normal;\">icon </em>kota Surabaya<em style=\"mso-bidi-font-style: normal;\">.</em> Selanjutnya kedepan diharapkan dapat menjadi salah satu kuliner khas kota berjuluk <em style=\"mso-bidi-font-style: normal;\">Bajol Ijo </em>ini.</span></p>','Buaya Darat',1,1,'2019-03-20 06:02:13','2019-03-20 06:37:33'),(1242,0,'PROGRAM PENCAK SILAT UNTUK WANITA','2019 17060484009 Nurul Azizah.pdf',NULL,11250000,'<p class=\"MsoNormal\" style=\"margin-left: 28.35pt; mso-layout-grid-align: none; text-autospace: none;\"><span lang=\"IN\" style=\"font-size: 12.0pt; line-height: 150%; font-family: \'Times New Roman\',\'serif\'; mso-ansi-language: IN; mso-bidi-font-weight: bold;\">Aktivitas olahraga dewasa ini sudah merupakan kebutuhan hidup baik bagi masyarakat pedesaan maupun perkotaan. Kinerja organ &ndash; organ tubuh manusia seperti jantung, paru &ndash; paru, pembuluh darah, otot, dan psikologis, secara tidak disadari dipengaruhi dengan melakukan olahraga. Selain itu olahraga juga digunakan sebagai pencegahan, pengobatan dan rehabilitasi. Pada umumnya orang melakukan olahraga untuk menjaga kesehatan dan dan kesegaran jasmani. Olahraga merupakan kebutuhan setiap orang, tidak hanya bagi yang muda saja, tetapi bagi yang lanjut usia (lansia) baik laki &ndash; laki maupun perempuan. Dengan berolahraga kebugaran akan terjaga, tetap sehat dan segar, sehingga dapat membuat tubuh menjadi bahagia.</span></p>','KEWIRAUSAHAAN, PENCAK SILAT, INDUSTRI OLAHRAGA',2,1,'2019-03-20 06:04:40','2019-03-20 07:01:40'),(1243,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,1,'2019-03-20 06:09:57','2019-03-20 06:17:05'),(1244,0,'Moringa Magic Soap','2019 17060484093 Pascaliandra D.B.pdf',NULL,13,'<p>moringa magic soap merupakan sabun mandi dari daun kelor. sabun mandi dari daun kelor ini mempunyai banyak manfaat. sabun ini berbeda dari yang lain karena bentuknya yang unik sehingga menarik. daun kelor ini sangat bermanfaat untuk membersihkan tubuh dari kotoran. target pemasaran ini menuju kepada semua orang.</p>','sabun|kelor|murah',5,1,'2019-03-20 06:29:54','2019-03-20 07:02:03'),(1245,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,1,'2019-03-20 06:50:16','2019-03-20 07:06:13'),(1246,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,'2019-03-20 07:20:53','2019-03-20 07:20:53'),(1247,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,1,'2019-03-20 12:57:09','2019-03-20 13:01:37'),(1248,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,1,'2019-03-20 14:53:29','2019-03-20 14:54:47'),(1249,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,1,'2019-03-20 15:45:42','2019-03-21 18:39:21'),(1250,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,1,'2019-10-13 03:45:27','2019-10-13 04:10:59'),(1251,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,1,'2019-10-13 04:49:26','2019-10-13 04:50:39'),(1252,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,1,'2020-01-31 17:34:12','2020-02-17 20:22:58'),(1253,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,1,'2020-01-31 17:35:56','2020-02-19 18:32:29'),(1254,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,1,'2020-01-31 21:23:47','2020-02-11 17:10:27'),(1255,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,'2020-02-03 00:23:53','2020-02-03 00:23:53'),(1256,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,'2020-02-06 20:28:08','2020-02-06 20:28:08'),(1257,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,'2020-02-10 03:34:15','2020-02-10 03:34:15'),(1258,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,1,'2020-02-10 18:59:46','2020-02-10 19:16:54'),(1259,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,1,'2020-02-11 16:18:13','2020-02-11 16:46:01'),(1260,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,1,'2020-02-11 19:00:08','2020-02-11 19:03:24'),(1261,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,1,'2020-02-11 19:59:30','2020-02-11 20:26:39'),(1262,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,1,'2020-02-11 20:58:39','2020-02-11 21:12:15'),(1263,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,1,'2020-02-12 17:09:08','2020-02-12 18:39:32'),(1264,0,NULL