f]--></p>\r\n<p class=\"MsoNormal\">Terimakasih saudara telah ikut berperan serta dalam seleksi PMW Unesa. Semoga semangat entrepreneur selalu terjaga. Seleksi adalah bagian dari proses yang harus dilalui. Ide saudara cukup bagus namun karena ini seleksi maka saya akan memberikan catatan: Ketua pengusul dan anggota belum tanda tangan, Deskripsi usaha belum bisa menjelaskan usaha yang akan dilaksanakan, Kandungan kesehatan daun kelor meragukan karena tidak didukung sumber yang akurat, belum menggambarkan adanya peluang pasar karna belum jelas siapa target pasar, Value/keunggulan produk masih belum nyata, justifikasi pemilihan wilayah pemasaran belum jelas, kelayakan usaha dari sisi profitabilitas belum nampak jelas</p>',NULL,'2019-03-23 19:24:31'),(2624,'0018078504',1142,1,'<p><!-- [if gte mso 9]><xml>\r\n <o:OfficeDocumentSettings>\r\n  <o:AllowPNG/>\r\n </o:OfficeDocumentSettings>\r\n</xml><![endif]--><!-- [if gte mso 9]><xml>\r\n <w:WordDocument>\r\n  <w:View>Normal</w:View>\r\n  <w:Zoom>0</w:Zoom>\r\n  <w:TrackMoves/>\r\n  <w:TrackFormatting/>\r\n  <w:PunctuationKerning/>\r\n  <w:ValidateAgainstSchemas/>\r\n  <w:SaveIfXMLInvalid>false</w:SaveIfXMLInvalid>\r\n  <w:IgnoreMixedContent>false</w:IgnoreMixedContent>\r\n  <w:AlwaysShowPlaceholderText>false</w:AlwaysShowPlaceholderText>\r\n  <w:DoNotPromoteQF/>\r\n  <w:LidThemeOther>EN-ID</w:LidThemeOther>\r\n  <w:LidThemeAsian>X-NONE</w:LidThemeAsian>\r\n  <w:LidThemeComplexScript>X-NONE</w:LidThemeComplexScript>\r\n  <w:Compatibility>\r\n   <w:BreakWrappedTables/>\r\n   <w:SnapToGridInCell/>\r\n   <w:WrapTextWithPunct/>\r\n   <w:UseAsianBreakRules/>\r\n   <w:DontGrowAutofit/>\r\n   <w:SplitPgBreakAndParaMark/>\r\n   <w:EnableOpenTypeKerning/>\r\n   <w:DontFlipMirrorIndents/>\r\n   <w:OverrideTableStyleHps/>\r\n  </w:Compatibility>\r\n  <m:mathPr>\r\n   <m:mathFont m:val=\"Cambria Math\"/>\r\n   <m:brkBin m:val=\"before\"/>\r\n   <m:brkBinSub m:val=\"--\"/>\r\n   <m:smallFrac m:val=\"off\"/>\r\n   <m:dispDef/>\r\n   <m: