";\r\n	mso-padding-alt:0cm 5.4pt 0cm 5.4pt;\r\n	mso-para-margin-top:0cm;\r\n	mso-para-margin-right:0cm;\r\n	mso-para-margin-bottom:8.0pt;\r\n	mso-para-margin-left:0cm;\r\n	line-height:107%;\r\n	mso-pagination:widow-orphan;\r\n	font-size:11.0pt;\r\n	font-family:\"Calibri\",sans-serif;\r\n	mso-ascii-font-family:Calibri;\r\n	mso-ascii-theme-font:minor-latin;\r\n	mso-hansi-font-family:Calibri;\r\n	mso-hansi-theme-font:minor-latin;\r\n	mso-bidi-font-family:\"Times New Roman\";\r\n	mso-bidi-theme-font:minor-bidi;\r\n	mso-fareast-language:EN-US;}\r\n</style>\r\n<![endif]--></p>\r\n<p class=\"MsoNormal\">Terimakasih saudara telah ikut berperan serta dalam seleksi PMW Unesa. Semoga semangat entrepreneur selalu terjaga. Seleksi adalah bagian dari proses yang harus dilalui. Ide saudara sudah bagus, namun karena ini seleksi maka saya akan memberikan catatan: Deskripsi tidak didukung data misalanya besarnya minat anak muda terhadap penggunaan kaos sehari-hari, besar itu bagaimana ukuran? Keunggulan produk belum terlihat, sudah banyak produk sejenis, Inovasi dan varian produk perlu ditingkatkan, Tambahkan data dan fakta bahwa produk ini dibutuhkan masyarakat, Target pasar, wilayah pemasaran dan media pemasaran perlu disertai dengan alasan, Anggaran biaya perlu ditambah dengan data yang menunjukkan kelayakan usaha.</p>',NULL,'2019-03-24 16:07:27');
