\r\n	mso-hansi-font-family:Calibri;\r\n	mso-hansi-theme-font:minor-latin;\r\n	mso-bidi-font-family:\"Times New Roman\";\r\n	mso-bidi-theme-font:minor-bidi;\r\n	mso-fareast-language:EN-US;}\r\n</style>\r\n<![endif]--><span style=\"font-size: 11.0pt; line-height: 107%; font-family: \'Calibri\',sans-serif; mso-ascii-theme-font: minor-latin; mso-fareast-font-family: Calibri; mso-fareast-theme-font: minor-latin; mso-hansi-theme-font: minor-latin; mso-bidi-font-family: \'Times New Roman\'; mso-bidi-theme-font: minor-bidi; mso-ansi-language: EN-ID; mso-fareast-language: EN-US; mso-bidi-language: AR-SA;\">Terimakasih saudara telah ikut berperan serta dalam seleksi PMW Unesa. Semoga semangat entrepreneur selalu terjaga. Seleksi adalah bagian dari proses yang harus dilalui. Ide saudara sudah bagus, namun karena ini seleksi maka saya akan memberikan catatan: Keunggulan produk belum nampak, Inovasi dan varian produk perlu ditingkatkan, Tambahkan data dan fakta bahwa produk ini dibutuhkan masyarakat, Target pasar, wilayah pemasaran dan media pemasaran perlu disertai dengan alasan, Anggaran biaya perlu ditambah dengan data yang menunjukkan kelayakan usaha</span></p>',NULL,'2019-03-24 16:10:25'),(2641,'0018078504',1203,1,'<p>keunggulan produk belum terlihat, inovasi produk perlu ditingkatkan, tambahkan desain logo dan kemasan, pastikan makanan ini lolos uji gizi dan kesehatan, target pasar perlu diperjelas, anggaran biaya belum menunjukkan kelayakan usaha</p>',NULL,'2019-03-24 16:15:01'),(2642,'0018078504',1208,1,'<p>Sistematika perlu dirapikan seharusnya tidak perlu scan semua dokumen, deskripsi mestinya diawali dengan peluang pasar dan keunggulan bukan dari ketersedian bahan baku, inovasi dan varian perlu ditingkatkan, target pasar belum jelas, anggaran biaya belum menunjukkan kelayakan</p>\r\n<p>&nbsp;</p>',NULL,'2019-03-24 16:19:22'),(2643,'0018078504',1214,1,'<p>topik sudah umum, inovasi perlu ditingkatkan, kelayakan usaha dari aspek pemasaran dan keuangan belum nampak</p>',N