001',1205,1,'<p>Perlu inovasi dan kreativitas</p>',NULL,'2019-03-23 19:11:39'),(2731,'197610022006041001',1211,1,'<p>Ide bagus dan kreatif</p>',NULL,'2019-03-23 19:19:13'),(2732,'198105232005012002',492,1,'<p>Gambaran bahwa tas tersebut akan dapat memuat berbagai barang belum terjelaskan bagaimana teknis dan mekanisme nya serta belum dapat terdeskripsikan dalam desain. Kelebihan perlu ditonjolkan misalkan apakah tas akan kuat ketika muatannya banyak. Swot masih belum spesifik langkah2 apa yang akan dilakukan untuk mengatasi hambatan</p>',NULL,'2019-03-23 09:15:35'),(2733,'198105232005012002',515,1,'<p>Saya kurang paham maksudnya dana diterima 5 juta perorangan<br />Penghitungan modal menjadi 10.500 ada dimana kah di hitungan dari 68 ribu belum dituliskan rinci shg menjadi 10 juta dari 3.607.000</p>\r\n<p><span style=\"font-size: 11.0pt; line-height: 115%; font-family: \'Calibri\',\'sans-serif\'; mso-ascii-theme-font: minor-latin; mso-fareast-font-family: Calibri; mso-fareast-theme-font: minor-latin; mso-hansi-theme-font: minor-latin; mso-bidi-font-family: \'Times New Roman\'; mso-bidi-theme-font: minor-bidi; mso-ansi-language: EN-US; mso-fareast-language: EN-US; mso-bidi-language: AR-SA;\">SWOT kurang detail analisisnya, masih identifikasi saja</span></p>',NULL,'2019-03-25 07:46:29'),(2734,'198105232005012002',522,1,'<p>Keunikan dan kreativitas belum muncul dari kajian yang detail atau dari data-data, manfaat belum terlihat, sehingga nilai lebihnya belum muncul</p>\r\n<p>format dan perencanaan memadai</p>\r\n<p>analisis swot dan rancangan jadwal perlu disesuaikan</p>\r\n<p>&nbsp;</p>',NULL,'2019-03-23 09:36:21'),(2735,'198105232005012002',542,1,'<p><!-- [if gte mso 9]><xml>\r\n <o:DocumentProperties>\r\n  <o:Version>14.00</o:Version>\r\n </o:DocumentProperties>\r\n <o:OfficeDocumentSettings>\r\n  <o:AllowPNG/>\r\n </o:OfficeDocumentSettings>\r\n</xml><![endif]--><!-- [if gte mso 9]><xml>\r\n <w:WordDocument>\r\n  <w:View>Normal</w:View>\r\n  <w:Zoom>0</w:Zoom>\r\n  